-- INSERÇÃO MASSIVA EM ASSETS_MASTER\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLDI', 'STOCK', 'Calidi Biotherapeutics, Inc.', 'ASE', 'Healthcare', 'Biotechnology', 'Calidi Biotherapeutics, Inc. is a clinical-stage immuno-oncology company. The Company is developing proprietary allogeneic stem cell-based and enveloped virus platforms to potentiate and deliver oncolytic viruses (vaccinia virus and adenovirus) and, potentially, other molecules to cancer patients. It is focused on developing two proprietary stem cell-based platforms and one enveloped vaccinia virus platform designed to protect the oncolytic virus, whether natural or engineered, from neutralization by the patients immune defenses, allowing for greater infection of the tumor cells and leading to a potential improvement in the antitumor activity of oncolytic viruses over traditional naked oncolytic virus therapies. Its product candidates include the CLD-101 product for high grade glioma (HGG), CLD-101 product for Recurrent HGG, CLD-201 product for solid tumors, CLD-301 (AAA) for multiple indications and CLD-400 (RTNova) for certain lung cancer and metastatic solid tumors.', 'San Diego, CA, United States', 28);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMD', 'STOCK', 'Advanced Micro Devices, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Advanced Micro Devices, Inc. É uma empresa global de semicondutores. Ele é focado em computação de alto desempenho, gráficos e tecnologias de visualização. Atua em quatro segmentos. O segmento de Data Center inclui aceleradores de inteligência artificial (IA), unidades de processamento central de servidor (CPUs), unidades de processamento gráfico (GPUs), unidades de processamento de dados (DPUs), matrizes de porta programáveis de campo (FPGAs), placas de interface de rede inteligentes (SmartNICs) e produtos de sistema-on-chip (SoC) adaptativo para data centers. O segmento Cliente inclui principalmente CPUs, APUs e chipsets para desktops e notebooks. O segmento Gaming inclui principalmente GPUs discretas, produtos SoC semi-personalizados e serviços de desenvolvimento. O segmento incorporado inclui CPUs incorporadas, GPUs, APUs, FPGAs, sistema em módulos (SOM) e produtos de SoC adaptáveis. Comercializa e vende seus produtos sob a marca registrada AMD. Seus produtos incluem AMD EPYC, AMD ', 'Santa Clara, CA, United States', 28000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNN', 'STOCK', 'Denison Mines Corp.', 'ASE', 'Energy', 'Uranium', 'Denison Mines Corp. is a Canada-based uranium exploration and development company focused on the Athabasca Basin region of northern Saskatchewan, Canada. The Company holds a 95% interest in the Wheeler River Project, which is a uranium project. It hosts two uranium deposits: Phoenix and Gryphon. It is located along the eastern edge of the Athabasca Basin in northern Saskatchewan. It holds a 22.5% ownership interest in the McClean Lake joint venture (MLJV), which includes several uranium deposits and the McClean Lake uranium mill. It also holds a 25.17% interest in the Midwest Main and Midwest A deposits, and a 67.41% interest in the Tthe Heldeth Tue (THT) and Huskie deposits on the Waterbury Lake property. The Company, through JCU (Canada) Exploration Company, Limited, holds indirect interests in the Millennium project, the Kiggavik project, and the Christie Lake project. It also offers environmental services. The Company also uses MaxPERF drilling tool technology and systems.', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBAI', 'STOCK', 'BigBear.ai Holdings, Inc.', 'NYQ', 'Technology', 'Information Technology Services', 'BigBear.ai Holdings, Inc. is a provider of artificial intelligence (AI)-powered decision intelligence solutions for national security, supply chain management and digital identity. The Company is a technology-led solutions organization, providing both software and services to its customers. It combines subject-matter expertise with technology to connect the enterprise, provide insights on process performance and recommendations for managing risk. It offers computer vision, anomaly/event detection, and descriptive and predictive analytics to support operations and break down silos between vendors and systems. The Companys customers span the public and private sector, including the United States defense and intelligence agencies, border protection, transportation security, manufacturing, distribution and logistics, as well as travel, entertainment and tourism. It also offers software assets that are tailored for digital identity and biometrics, leveraging advanced vision AI technology.', 'McLean, VA, United States', 630);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAL', 'STOCK', 'American Airlines Group Inc.', 'NMS', 'Industrials', 'Airlines', 'American Airlines Group Inc. É uma holding. Sua principal atividade de negócios é a operação de uma grande rede aérea, fornecendo transporte aéreo regular para passageiros e carga através de seus hubs em Charlotte, Chicago, Dallas/Fort Worth, Los Angeles, Miami, nova Iorque, Filadélfia, Phoenix e Washington, D.C. e gateways de parceiros, incluindo Londres, Doha, Madrid, Seattle/Tacoma, Sydney e Tóquio, entre outros. Juntamente com suas subsidiárias regionais de companhias aéreas e companhias aéreas regionais terceirizadas que operam como American Eagle. A sua divisão de cargas oferece uma ampla gama de serviços de frete e correio, com instalações e conexões interline disponíveis em todo o mundo. Opera aproximadamente 977 aeronaves principais apoiadas por suas subsidiárias regionais de companhias aéreas e companhias aéreas regionais terceirizadas, que operam juntas mais 585 aeronaves regionais. Suas subsidiárias incluem American Airlines, Inc., Envoy Aviation Group Inc., PSA Airlines, I', 'Fort Worth, TX, United States', 138100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRRX', 'STOCK', 'DURECT Corporation', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'DURECT Corporation is a late-stage biopharmaceutical company. The Company is engaged in the development of epigenetic therapies that target dysregulated deoxyribonucleic acid (DNA) methylation to transform the treatment of serious and life-threatening conditions, including acute organ injury. Its lead drug candidate, Larsucosterol binds to and inhibits the activity of DNA methyltransferases, epigenetic enzymes that are elevated and associated with hypermethylation found in alcoholic hepatitis (AH) patients. Larsucosterol is in clinical development for the potential treatment of AH, for which the FDA has granted a Fast Track and a Therapy designation, and metabolic dysfunction-associated steatohepatitis (MASH) is also being explored. Its commercial pharmaceutical product includes POSIMIR (bupivacaine solution) for infiltration use, a non-opioid analgesic utilizing the SABER platform technology. It has developed a proprietary drug product for the treatment of ADHD called Methydur.', 'Cupertino, CA, United States', 21);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SMCI', 'STOCK', 'Super Micro Computer, Inc.', 'NMS', 'Technology', 'Computer Hardware', 'Super Micro Computer, Inc. provides application-optimized Total IT solutions. It delivers rack-scale solutions optimized for various workloads, including artificial intelligence and high-performance computing, where acceleration is critical. It produces a portfolio of server and storage solutions for enterprise data centers, cloud service providers and edge computing (5G Telco, Retail and embedded). Total IT Solutions include complete servers, storage systems, modular blade servers, workstations, full-rack scale solutions, networking devices, server sub-systems, server management and security software. It provides global support and services to help its customers install, upgrade and maintain their computing infrastructure, including liquid-cooling operations. It offers platforms in rackmount, blade, multi-node and embedded form factors, which support single, dual and multiprocessor architectures. Its key product lines include SuperBlade and MicroBlade, SuperStorage, Twin and others.', 'San Jose, CA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMDL', 'STOCK', 'GraniteShares 2x Long AMD Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change of the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund will aim to primarily obtain its notional exposure against the underlying stock through swap agreements. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADAP', 'STOCK', 'Adaptimmune Therapeutics plc', 'NCM', 'Healthcare', 'Biotechnology', 'Adaptimmune Therapeutics PLC is a commercial-stage biopharmaceutical company. The Company is focused on providing cell therapies to people with cancer. The engineered T cell receptor (TCR) platform, which the Company is developing for personalized medicines designed to target and destroy difficult-to-treat solid tumor cancers. It is focused on the commercialization of TECELRA, which is a genetically modified autologous T-cell immunotherapy indicated for the treatment of adults with advanced synovial sarcoma. Its second T-cell immunotherapy, letetresgene autoleucel (lete-cel), targets the NY-ESO antigen in people with synovial sarcoma and myxoid round cell liposarcoma (MRCLS). It has filed an IND for ADP-5701 for a Phase I trial in Head and Neck Cancer in collaboration with Galapagos NV (Galapagos). It has two pre-clinical programs for the development of T-cell therapies directed to PRAME (ADP-600) and CD70 (ADP-520).', 'Abingdon, , United Kingdom', 506);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('F', 'STOCK', 'Ford Motor Company', 'NYQ', 'Consumer Cyclical', 'Auto Manufacturers', 'Ford Motor Company é uma empresa automobilística. A empresa desenvolve e entrega caminhões Ford, veículos utilitários esportivos, vans comerciais e carros, e veículos de luxo Lincoln, juntamente com serviços conetados. Os segmentos da empresa incluem Ford Blue, Ford Model e, Ford Pro e Ford Credit. O segmento Ford Blue inclui principalmente a venda de motores de combustão interna Ford e Lincoln (ICE) e veículos híbridos, peças de serviço, acessórios e serviços digitais para clientes de varejo. O segmento Ford Model e inclui principalmente a venda de seus veículos elétricos, peças de serviço, acessórios e serviços digitais para clientes de varejo. O segmento Ford Pro inclui principalmente a venda de veículos Ford e Lincoln, peças de serviço, acessórios e serviços para clientes comerciais, governamentais e de aluguel. O segmento Ford Credit consiste no negócio Ford Credit numa base consolidada, que é principalmente atividades de financiamento e leasing relacionadas com veículos. Suas mar', 'Dearborn, MI, United States', 169000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTBT', 'STOCK', 'Bit Digital, Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'Bit Digital, Inc. is a global platform for high performance computing (HPC) infrastructure and digital asset production company. The Company is a provider of HPC data centers and cloud-based HPC graphics processing units (GPU) services, which term cloud services, for customers such as artificial intelligence (AI) and machine learning (ML) developers. The Company designs, develops, and operates HPC data centers, through which it offers hosting and colocation services. The Company has four reportable segments: Digital asset mining, Cloud services, Colocation services, and ETH Staking. The Digital asset mining segment is engaged in bitcoin and mining activities. The Cloud services segment provides HPC services to support generative AI workstreams. The Colocation services segment provide customers with physical space, power and cooling within the data center facility. The ETH staking segment is engaged in both native staking and liquid staking.', 'New York, NY, United States', 54);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAN', 'STOCK', 'Canaan Inc.', 'NGM', 'Technology', 'Computer Hardware', 'Canaan Inc. provides high performance computing solutions through its proprietary application-specific integrated circuits (ASICs). The Company is a fabless IC designer engaged in the front-end and back-end of IC design. The Company primarily offers its technology and expertise in ASIC applications to Bitcoin mining machines and is also a producer of Bitcoin mining machines in the global market. The Company, through its subsidiaries, independently designs and develops its products in-house, including the design of proprietary ASIC chips for its Bitcoin mining machines. It has in-house production capabilities to assemble both Bitcoin mining machines and artificial intelligence (AI) chips. It assembles its Bitcoin mining machines primarily at its assembly plant located in the Peoples Republic of China (PRC) by integrating the ICs designed by the Company and related components it procures. It also intends to engage in Bitcoin mining through self-owned facilities.', 'Singapore, , Singapore', 463);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAPL', 'STOCK', 'Apple Inc.', 'NMS', 'Technology', 'Consumer Electronics', 'A Apple Inc. Projeta, fabrica e comercializa smartphones, computadores pessoais, tablets, wearables e acessórios, e vende uma variedade de serviços relacionados. Suas categorias de produtos incluem iPhone, Mac, iPad e Wearables, Home e Acessórios. Suas plataformas de software incluem iOS, iPadOS, macOS, watchOS, visionOS, e tvOS. Seus serviços incluem publicidade, AppleCare, serviços em nuvem, conteúdo digital e serviços de pagamento. A empresa opera várias plataformas, incluindo a App Store, que permitem aos clientes descobrir e baixar aplicativos e conteúdo digital, como livros, música, vídeo, jogos e podcasts. Ele também oferece conteúdo digital por meio de serviços baseados em assinatura, incluindo Apple Arcade, Apple e a Apple TV. Seus produtos incluem iPhone 16 Pro, iPhone 16, iPhone 15, iPhone 14, iPhone SE, MacBook Air, MacBook Pro, iMac, Mac mini, Mac Studio, Mac Pro, iPad Pro, iPad Air, AirPods, AirPods Pro, AirPods Max, Apple TV e Apple Vision Pro.', 'Cupertino, CA, United States', 150000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CASK', 'STOCK', 'Heritage Distilling Holding Company, Inc.', 'NCM', 'Consumer Defensive', 'Beverages - Wineries & Distilleries', 'Heritage Distilling Holding Company, Inc. is a craft distillery producing, marketing, and selling a diverse line of craft spirits, including whiskeys, vodkas, gins, rums, and ready-to-drink canned cocktails. The Company sells its products through wholesale distribution, directly to consumers through its five owned and operated distilleries and tasting rooms located in Washington and Oregon, and by shipping directly to consumers online were legal. It sells products in the Pacific Northwest with limited distribution in other states throughout the United States. Its operations are spread across national through multiple sales channels, including wholesale, e-commerce, direct-to-consumer (DTC) in 46 states, on-premises venues at its distilleries and tasting rooms, a subscription-based program, and the Tribal Beverage Network (TBN). Its DTC sales also support growing its wholesale volume with its distributors through key national accounts both on-premises and off-premises.', 'Gig Harbor, WA, United States', 62);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSX', 'STOCK', 'CSX Corporation', 'NMS', 'Industrials', 'Railroads', 'A CSX Corporation é uma empresa de transporte. A empresa fornece serviços e soluções de transload ferroviário, intermodal e ferroviário para caminhão para clientes em uma variedade de mercados, incluindo energia, industrial, construção, agricultura e produtos de consumo. Fornece serviços de transporte de mercadorias com base em trilhos, incluindo o serviço ferroviário tradicional, o transporte de contentores e reboques intermodais, bem como outros serviços de transporte, tais como transferências entre camiões e operações de mercadorias a granel. Através de sua subsidiária, a CSX Transportation, Inc. (CSXT), fornece um link para a cadeia de suprimentos de transporte através de sua rede ferroviária de aproximadamente 20 000 rotas e atende grandes centros populacionais em 26 estados a leste do rio Mississippi, do Distrito de Columbia e das províncias canadenses de Ontário e Quebec. A CSXT também está envolvida em vendas imobiliárias, leasing, aquisição e gestão e atividades de desenvolvim', 'Jacksonville, FL, United States', 23500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MARA', 'STOCK', 'MARA Holdings, Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'MARA Holdings, Inc. is engaged in digital asset compute that develops and deploys technologies. The Company secures the blockchain ledger and supports energy transformation by converting clean, stranded, or otherwise underutilized energy into economic value. It also offers advanced technology solutions to optimize data center operations, including liquid immersion cooling and firmware for bitcoin miners. It is primarily focused on computing for, acquiring, and holding digital assets as a long-term investment. Its core business is bitcoin mining, and it produces, or mines, bitcoin using energy-efficient fleets of specialized computers while providing dispatchable compute as an optionality to the electric grid operators to balance electric demands on the grid. It is also engaged in the sale of data center infrastructure, such as immersion-cooled systems, to third parties operating in the bitcoin ecosystem and the artificial intelligence (AI) and high-performance compute (HPC) sectors.', 'Hallandale Beach, FL, United States', 201);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTG', 'STOCK', 'B2Gold Corp.', 'ASE', 'Basic Materials', 'Gold', 'B2Gold Corp. is an international gold producer. The Company is operating gold mines in Mali, Namibia and the Philippines, the Goose Project under construction in northern Canada, and numerous development and exploration projects in various countries, including Mali, Colombia, and Finland. The Fekola Mine is located in southwest Mali, on the border between Mali and Senegal, approximately 500 kilometers due west of the capital city, Bamako. The Masbate Mine is located approximately 360 kilometers southeast of Manila. The Otjikoto Mine is located in the north-central part of Namibia, approximately 300 kilometers north of Windhoek and is a gold producer. The Company also owns the Gramalote Project in Colombia. It also has an interest in the Back River Gold District, which is located in Nunavut, Canada. The Back River Gold District consists of approximately five mineral claims blocks along an 80-kilometer belt. It is engaged in operating Goose Project, which is located in Nunavut, Canada.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LIDR', 'STOCK', 'AEye, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'AEye, Inc. is a provider of active lidar systems technology for vehicle autonomy, advanced driver-assistance systems (ADAS), and robotic vision applications. Its 4Sight Intelligent Sensing Platform includes a solid-state software-definable active lidar sensor, an adaptive sensing SmartScan architecture to scan dynamic scenes/targets, and a sophisticated signal processing capability that provides precise measurements and imaging for various safety-critical applications. Its active 4Sight Intelligent Sensing Platform leverages principles from automated targeting systems and biomimicry to scan the environment, while intelligently focusing on what matters in order to enable safer, smarter, and faster decisions in complex scenarios. Its technology includes 4Sight for Automotive, and 4Sight for Non-Automotive. It offers Apollo, the 4Sight Flex family of lidar sensors. The Apollo lidar is specifically designed to address system requirements for ADAS and autonomous vehicles (AV) applications.', 'Dover, DE, United States', 45);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACHR', 'STOCK', 'Archer Aviation Inc.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'Archer Aviation Inc. is an aerospace company. It is engaged in providing customers with advanced aircraft and related technologies and services in the United States and internationally in both the commercial and defense sectors. Its commercial line of business consists of the sale of its commercial aircraft (Archer Direct), such as Midnight, to aircraft operators as well as technologies and services related thereto, including commercial launch (certification, testing, training, demonstration, market survey and early trial operations), and maintenance and repair. Its defense line of business consists of the sale of aircraft and related technologies for defense applications. Its initial product is intended to be a hybrid-propulsion, vertical take-off and landing (VTOL) aircraft. Its Midnight aircraft is designed around its proprietary 12-tilt-6 distributed electric propulsion platform. It carries four passengers plus a pilot. The aircraft is purpose-built for air taxi operations.', 'San Jose, CA, United States', 774);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NU', 'STOCK', 'Nu Holdings Ltd.', 'NYQ', 'Financial Services', 'Banks - Regional', 'A Nu Holdings Ltd é uma holding sediada no Brasil, que se dedica à prestação de serviços bancários digitais. A empresa oferece aos seus clientes produtos nas cinco temporadas financeiras: Gastos, economia, investimento, empréstimos e proteção. Suas soluções de gastos são projetadas para ajudar os clientes a pagar por bens e serviços em suas vidas diárias com uma linha de crédito personalizada ou instantaneamente através de um telefone celular, enquanto coleta pontos de fidelidade e recompensas em transações aplicáveis. Suas soluções de poupança são projetadas para ajudar os clientes a depositar, gerenciar e economizar seu dinheiro em contas que ganham juros com cartões de débito complementares. Suas soluções de investimento são projetadas para ajudar os clientes a investir seu dinheiro em produtos e serviços de investimento. Suas soluções de empréstimo são projetadas para fornecer aos clientes empréstimos não garantidos que são fáceis de receber, gerenciar e pagar de volta. Suas soluçõ', 'São Paulo, SP, Brazil', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BITF', 'STOCK', 'Bitfarms Ltd.', 'NGM', 'Financial Services', 'Capital Markets', 'Bitfarms Ltd. is a Canada-based global Bitcoin and vertically integrated data center company that sells its computational power to one or more mining pools from which it receives payment in Bitcoin. It develops, owns, and operates vertically integrated mining facilities with in-house management and Company-owned electrical engineering, installation service, and multiple onsite technical repair centers. Its proprietary data analytics system delivers operational performance and uptime. The Company operates through the cryptocurrency mining segment. The activities of the Company mainly consist of selling its computational power used for hashing calculations for the purpose of cryptocurrency mining in multiple jurisdictions. Volta, a wholly owned subsidiary of the Company, assists the Company in building and maintaining its data centers. The Company operates Bitcoin data centers in four countries: the United States, Canada, Paraguay, and Argentina.', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZN', 'STOCK', 'Amazon.com, Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'Amazon.com, Inc. Fornece uma gama de produtos e serviços para os clientes. Os produtos oferecidos através de suas lojas incluem mercadoria e conteúdo que adquiriu para revenda e produtos oferecidos por vendedores terceirizados. Os segmentos da empresa incluem América do Norte, Internacional e Amazon Web Services (AWS). Ele atende os consumidores através de suas lojas on-line e físicas e se concentra na seleção, preço e conveniência. Os clientes acessam suas ofertas através de seus sites, aplicativos móveis, Alexa, dispositivos, streaming, e fisicamente visitando suas lojas. Também fabrica e vende dispositivos eletrônicos, incluindo Kindle, tablet Fire, Fire TV, Echo, anel, Blink e eero, e desenvolve e produz conteúdo de mídia. Ele atende desenvolvedores e empresas de todos os tamanhos, incluindo start-ups, agências governamentais e instituições acadêmicas, por meio da AWS, da AWS, da AWS e da AWS. que oferece um conjunto de serviços de tecnologia sob demanda, incluindo computação, arma', 'Seattle, WA, United States', 1546000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTE', 'STOCK', 'Baytex Energy Corp.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Baytex Energy Corp. is a Canada-based energy company. The Company is engaged in the acquisition, development and production of crude oil and natural gas in the Western Canadian Sedimentary Basin and in the Eagle Ford in the United States. Its crude oil and natural gas operations are organized into three main operating areas: Light Oil USA (Eagle Ford), Light Oil Canada (Pembina Duvernay / Viking) and Heavy Oil Canada (Peace River / Peavine / Lloydminster). The Canadian operating segment includes its light oil assets in the Viking and Duvernay, its heavy oil assets in Peace River and Lloydminster and its conventional oil and natural gas assets in Western Canada. The U.S. operating segment includes its Eagle Ford operated and non-operated assets in Texas. Its Viking assets are in the Dodsland area in southwest Saskatchewan and in the Esther area of southeastern Alberta. It also holds a 100% working interest land position in the East Duvernay resource play in central Alberta.', 'Calgary, AB, Canada', 370);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MRK', 'STOCK', 'Merck & Co., Inc.', 'NYQ', 'Healthcare', 'Drug Manufacturers - General', 'A Merck & Co., Inc. É uma empresa global de cuidados de saúde que fornece soluções de saúde através dos seus medicamentos prescritos, incluindo terapias biológicas, vacinas e produtos de saúde animal. Os segmentos da Companhia incluem Saúde Farmacêutica e Animal. O segmento farmacêutico inclui produtos farmacêuticos e vacinas de saúde humana. A empresa vende seus produtos farmacêuticos de saúde humana principalmente para atacadistas e varejistas de medicamentos, hospitais, agências governamentais e prestadores de cuidados de saúde gerenciados. Vende suas vacinas de saúde humana principalmente a médicos, atacadistas, distribuidores e entidades governamentais. O segmento de Saúde Animal descobre, desenvolve, fabrica e comercializa uma gama de produtos farmacêuticos e vacinas veterinários, bem como soluções e serviços de gestão da saúde, para a prevenção, tratamento e controle de doenças em todas as principais espécies animais e animais de companhia. Vende seus produtos para veterinários,', 'Rahway, NJ, United States', 73000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCS', 'STOCK', 'Barclays PLC', 'NYQ', 'Financial Services', 'Banks - Diversified', 'O Barclays PLC é um banco diversificado com cinco divisões, incluindo o Barclays UK, o Barclays UK Corporate Bank, o Barclays Private Bank e a Wealth Management, o Barclays Investment Bank e o Barclays US Consumer Bank. A divisão Barclays UK representa empresas que se encontram no banco do Reino Unido, Barclays Bank UK PLC e suas subsidiárias, e compreende Personal Banking, Business Banking e Barclaycard Consumer UK. A divisão do Barclays UK Corporate Bank oferece soluções de empréstimo, comércio e capital de giro, liquidez, pagamentos e FX para clientes corporativos. A divisão Barclays Private Bank e Wealth Management compreende o Banco Privado, Gestão de Riqueza e Negócios de Investimentos. A divisão do Barclays Investment Bank incorpora os mercados globais, a banca de investimento e as empresas de Banking Corporativo Internacional. A divisão Barclays US Consumer Bank representa o negócio de cartões de crédito dos Estados Unidos, focado no mercado de parcerias, bem como uma franquia ', 'London, , United Kingdom', 93000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBD', 'STOCK', 'Banco Bradesco S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'O Banco Bradesco SA, anteriormente Banco Brasileiro de Descontos SA, é uma empresa pública brasileira que atua no Grupo Setor de Serviços Bancários. A Companhia atua como um amplo banco comercial em termos de ativos totais, operações de crédito e volume de depósitos e financiamentos. A Companhia oferece uma gama de produtos e serviços bancários e financeiros, no Brasil e no exterior, para indivíduos e principais empresas e instituições nacionais e internacionais. Os produtos e serviços da Companhia abrangem operações bancárias e não bancárias, tais como: Empréstimos e adiantamentos, depósitos, emissão de cartões de crédito, consórcio, seguros, etc. capitalização, leasing, cobrança e processamento de pagamentos, planos de pensões complementares, gestão de ativos e serviços de intermediação e corretagem de valores mobiliários.', 'Osasco, SP, Brazil', 82147);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADIL', 'STOCK', 'Adial Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Adial Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on the development of therapies for the treatment and prevention of addiction and related disorders. The Companys lead investigational new drug product, AD04, is a genetically targeted, serotonin-3 receptor antagonist, therapeutic agent for the treatment of Alcohol Use Disorder (AUD) in heavy drinking patients and was recently investigated in the Companys ONWARD pivotal Phase III clinical trial for the potential treatment of AUD in subjects with certain target genotypes identified using the Companys proprietary companion diagnostic genetic test. AD04 is also used for the treatment of other addictive disorders, such as Opioid Use Disorder, obesity, smoking, and other drug addictions. The Companys wholly owned subsidiary is Purnovate, Inc.', 'Glen Allen, VA, United States', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BULL', 'STOCK', 'Webull Corporation', 'NCM', 'Technology', 'Software - Application', 'Webull Corporation is a digital investment platform built upon a next-generation global infrastructure. The Companys platform allows its customers to invest in United States (U.S.) listed stocks, exchange-traded funds (ETFs), as well as American Depository Receipts. It offers fractional share trading for U.S.-listed stocks and ETFs on its Webull App, which allows its customers to invest in fractions of a share of a stock or ETF instead of buying or selling whole shares. It also offers trading in multiple-listed stock options, ETFs, and index options. It offers cash sweep products to its customers, allowing them to earn interest on uninvested brokerage cash that the Company sweeps to its partner banks. It provides robo-advisor services through Webull Advisors LLC. It also provides retirement investment accounts and portfolio management tools for long-term investors. It offers seamless interoperability for clients investing through mobile, tablet, Web-based, and desktop devices.', 'Saint Petersburg, FL, United States', 1194);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABP', 'STOCK', 'Abpro Corporation', 'NGM', 'Healthcare', 'Biotechnology', 'Abpro Holdings, Inc. is a biotechnology company. The Company is advancing a pipeline of next generation antibody therapies for human epidermal growth factor receptor 2 (HER2)+cancers, non-HER2+ gastric and liver cancer, and wet age-related macular degeneration and diabetic macular edema. These antibodies are developed using the Companys proprietary DiversImmune platform. Its two lead product candidates, ABP-102 and ABP-201, feature its next generation tetravalent antibody format (TetraBi antibody format), which binds to two different targets with two distinct binding sites per target. ABP-102 is designed to redirect a patients immune system to fight cancer by engaging T cells through co-targeting HER2, and CD3, T-cell co-receptor. ABP-201 is designed to block blood vessel formation and normalize damaged vessels through co-targeting VEGF and ANG-2. It plans to develop ABP-201 to treat vascular disease of the eye, focusing on wet age-related macular degeneration (Wet AMD).', 'Woburn, MA, United States', 6);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLD', 'STOCK', 'Applied Digital Corporation', 'NMS', 'Technology', 'Information Technology Services', 'A Applied Digital Corporation é uma designer, desenvolvedora e operadora de infraestrutura digital de última geração em toda a América do Norte. Ele fornece soluções de infraestrutura digital e serviços de nuvem para computação de alto desempenho (HPC) e inteligência artificial (IA). Seus segmentos incluem hospedagem de data center blockchain (o Datacenter Hosting Business), serviços de nuvem, por meio de uma subsidiária integral (o Cloud Services Business) e hospedagem de data center HPC (o HPC Hosting Business). O segmento de hospedagem do Datacenter opera datacenters para fornecer espaço energizado aos clientes de mineração de cripto. O segmento de serviços em nuvem opera por meio de sua marca Sai Computing e fornece serviços em nuvem para clientes, como inteligência artificial e desenvolvedores de aprendizado de máquina, para desenvolver seus produtos avançados. O segmento de hospedagem HPC projeta, constrói e opera datacenters, que são projetados para suportar aplicativos de alto ', 'Dallas, TX, United States', 205);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIFR', 'STOCK', 'Cipher Mining Inc.', 'NMS', 'Financial Services', 'Capital Markets', 'Cipher Mining Inc. is an industrial-scale data center construction and operations company. The Company is focused on the development and operation of industrial-scale data centers for bitcoin mining and high-performance computing (HPC) hosting. It operates approximately 327 MW of facilities across four bitcoin mining data centers in Texas, including one wholly owned data center and three partially owned data centers. The Company also has a pipeline of 2.8 GW across seven additional sites in Texas. It operates an aggregate hash rate capacity of 15.7 exahash per second (EH/s). Its operational data center is its Odessa data center, which is its wholly owned 207 MW facility located in Odessa, Texas. Its Alborz data center is located near Happy, Texas. Its Bear data center is located near Andrews, Texas. Its Black Pearl data center is in Winkler County, Texas. Its Barber Lake site is located near Colorado City, Texas. Stingray site is in West Texas. Its Reveille site is in Cotulla, Texas.', 'New York, NY, United States', 43);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMCSA', 'STOCK', 'Comcast Corporation', 'NMS', 'Communication Services', 'Telecom Services', 'A Comcast Corporation é uma empresa global de mídia e tecnologia. A empresa oferece banda larga, sem fio e vídeo através da Xfinity, Comcast Business e Sky; produz, distribui, e transmite entretenimento, esportes e notícias através de marcas, incluindo NBC, Telemundo, Universal, Peacock, e Sky; e traz parques temáticos e atrações para a vida através de Destinos e Experiências Universal. Opera através de duas empresas principais: Conetividade e plataformas e conteúdos e experiências. A conetividade e as plataformas incluem as suas empresas de banda larga, sem fios, vídeo e voz fixa nos Estados Unidos, Reino Unido e Itália. Inclui também as operações das suas redes de televisão de entretenimento com a marca Sky no Reino Unido e na Itália. O Content & Experiences inclui os seus negócios de mídia e entretenimento que produzem e distribuem entretenimento, esportes, notícias e outros conteúdos para o público global e que possuem e operam parques temáticos e atrações nos Estados Unidos e na Á', 'Philadelphia, PA, United States', 182000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCL', 'STOCK', 'Carnival Corporation & plc', 'NYQ', 'Consumer Cyclical', 'Travel Services', 'A Carnival Corporation é uma empresa global de cruzeiros e viagens de lazer. A Companhia possui um portfólio de linhas de cruzeiro, incluindo AIDA Cruises, Carnival Cruise Line, Costa Cruises, Cunard, Holland America Line, P&O Cruises (Austrália), P&O Cruises (Reino Unido), Princess Cruises e Seabourn. O segmento da empresa inclui operações de cruzeiro NAA, operações de cruzeiro na Europa (Europa), apoio ao cruzeiro e Tour e outros. O segmento Cruise Support inclui o seu portfólio de destinos portuários e ilhas exclusivas, bem como outros serviços, todos operados em benefício das suas marcas de cruzeiros. Além de suas operações de cruzeiro, possui a Holland America Princess Alaska Tours, uma empresa de turismo no Alasca e no Yukon canadense, que complementa suas operações de cruzeiro no Alasca. Seu Tour e outro segmento representa as operações de hotel e transporte da Holland America Princess Alaska Tours e outras operações. Sua empresa de turismo possui e opera hotéis, lodges, vagões ', 'Miami, FL, United States', 115000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVLT', 'STOCK', 'Datavault AI Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Datavault AI Inc. is a data licensing and monetization company. The Companys patented platform enables secure data valuation, exchange, and AI-driven monetization-enabling businesses and creators to unlock the value of their data assets across cloud, Web 3.0, and experiential computing landscapes. Its offerings are its artificial intelligence (AI)-driven agents branded as Data Vault, DataValue, DataScore, and Data Vault Bank. These tools harness generative AI to deliver enterprise-grade data management solutions. It operates through two synergistic platforms: Data Science and Acoustic Science. Its Data Sciences Platform is anchored by its flagship Data Vault platform, a patented, cyber-secured asset tokenization platform that sets a new standard for trust and innovation in Web 3.0 data science. The Acoustic Sciences Platform features a fusion of WiSAs wireless standard technology and the category creating ADIO inaudible tone, data over sound, and mobile quick response technology.', 'Beaverton, OR, United States', 63);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FFAI', 'STOCK', 'Faraday Future Intelligent Electric Inc.', 'NCM', 'Consumer Cyclical', 'Auto Manufacturers', 'Faraday Future Intelligent Electric Inc. is a global shared intelligent electric mobility ecosystem company. The Company designs and engineers next generation intelligent, connected, electric vehicles, including both the FF Series and the FX Series. The Company has developed a proprietary platform architecture, Variable Platform Architecture (VPA), advanced propulsion systems, and a proprietary intelligent computing ecosystem, Internet, Autonomous Driving, and Intelligence (I.A.I.) systems to support the Companys electric vehicle (EV) lineup. The Companys vehicle pipeline includes the FF 91 series, the FX 5 series, the FX 6 series, and the FX Super One series. Its flagship model is the FF 91 2.0 Futurist Alliance and is positioned as an AI-enhanced ultra-luxury EV. The FX 5 is designed as an entry-level EV, aimed at young professionals and first-time EV buyers. The FX 6 is positioned as a family-friendly AI-enhanced vehicle, featuring premium safety features and smart AI technology.', 'Gardena, CA, United States', 249);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLF', 'STOCK', 'Cleveland-Cliffs Inc.', 'NYQ', 'Basic Materials', 'Steel', 'Cleveland-Cliffs Inc. is a steel producer with a focus on value-added sheet products, particularly for the automotive industry in North America. The Company is vertically integrated from the mining of iron ore, production of pellets and direct reduced iron, and processing of ferrous scrap through primary steelmaking and downstream finishing, stamping, tooling, and tubing. Its offering includes advanced high-strength steel, hot-dipped galvanized, aluminized, galvalume, electrogalvanized, galvanneal, hot-rolled coil (HRC), cold-rolled coil, plate, grain oriented electrical steel (GOES), non-oriented electrical steel (NOES), stainless steels, tool and die, stamped components, rail, slab and cast ingot. Its Other Businesses primarily include the Tubular and Tooling and Stamping segments that provide customer solutions with carbon and stainless steel tubing products, advanced-engineered solutions, tool design and build, hot- and cold-stamped steel components and complex assemblies.', 'Cleveland, OH, United States', 30000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAC', 'STOCK', 'Bank of America Corporation', 'NYQ', 'Financial Services', 'Banks - Diversified', 'Bank of America Corporation é uma holding bancária e uma holding financeira. Seus segmentos incluem Consumer Banking, Global Wealth & Investment Management (GWIM), Global Banking e Global Markets. O segmento Consumer Banking oferece uma gama de produtos e serviços de crédito, bancário e de investimento para consumidores e pequenas empresas. O GWIM inclui dois negócios: Merrill Wealth Management, que fornece soluções personalizadas para atender às necessidades dos clientes através de um conjunto completo de gestão de investimentos, corretagem, produtos bancários e de aposentadoria e Bank of America Private Bank, que fornece soluções abrangentes de gerenciamento de patrimônio. O Global Banking Segment fornece uma gama de produtos e serviços relacionados com empréstimos, soluções integradas de gestão de capital de giro e tesouraria, e serviços de subscrição e consultoria. O segmento Global Markets oferece serviços de vendas e negociação e serviços de pesquisa para clientes institucionais ', 'Charlotte, NC, United States', 213000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BA', 'STOCK', 'The Boeing Company', 'NYQ', 'Industrials', 'Aerospace & Defense', 'A Boeing Company é uma empresa aeroespacial. Seus segmentos incluem Aviões Comerciais (BCA), Defesa, Espaço e Segurança (BDS) e Serviços Globais (BGS). Seu segmento BCA desenvolve, produz e comercializa aeronaves comerciais a jato principalmente para a indústria de companhias aéreas comerciais em todo o mundo. Sua família de aeronaves comerciais a jato em produção inclui o modelo de corpo estreito 737 e os modelos de corpo largo 767, 777 e 787. Seu segmento BDS está envolvido na pesquisa, desenvolvimento, produção e modificação de aeronaves militares tripuladas e não tripuladas e sistemas de armas para greve, vigilância e mobilidade. O seu segmento BGS presta serviços aos seus clientes comerciais e de defesa em todo o mundo. Ele suporta plataformas e sistemas aeroespaciais com uma gama de produtos e serviços, incluindo cadeia de suprimentos e gerenciamento de logística, engenharia, manutenção e modificações, atualizações e conversões, peças de reposição, sistemas e serviços de treiname', 'Arlington, VA, United States', 172000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMG', 'STOCK', 'Chipotle Mexican Grill, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Chipotle Mexican Grill, Inc. É uma empresa de restaurantes. A Companhia, através de suas subsidiárias, possui e opera restaurantes Chipotle Mexican Grill, que apresentam um cardápio relevante de burritos, tigelas de burrito (um burrito sem tortilla), quesadillas, tacos e saladas. A empresa opera mais de 3 700 restaurantes nos Estados Unidos, Canadá, Reino Unido, França, Alemanha, Kuwait, e os Emirados Árabes Unidos. Ele tornou o pedido digital conveniente com aprimoramentos no aplicativo e no site Chipotle, como personalização, entrega sem contato e pedidos em grupo. Sua aplicação também inclui mensagens de prontidão de pedidos, deteção de localização errada e lembretes para procurar pontos. As subsidiárias da empresa incluem Chipotle Mexican Grill Canada Corp., Chipotle Mexican Grill France SAS, Chipotle Mexican Grill of Berwyn Heights, LLC, Chipotle Mexican Grill GERMANY GMBH e Chipotle Mexican Grill U.S. Finance Co., LLC, entre outros.', 'Newport Beach, CA, United States', 130000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CONI', 'STOCK', 'GraniteShares 2x Short COIN Daily ETF', 'NGM', NULL, NULL, 'The fund manager will enter into one or more swap agreements with major financial institutions for a specified period ranging from a day to more than one year whereby the fund and the financial institution will agree to exchange the return earned or realized on the underlying stock. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMCR', 'STOCK', 'Amcor plc', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'A Amcor plc está envolvida em soluções de embalagem para produtos de consumo e saúde. A empresa desenvolve embalagens sustentáveis em formatos flexíveis e rígidos em vários materiais. A Companhia atua através de dois segmentos: Flexibles e embalagens rígidas. O segmento Flexibles consiste em operações que fabricam embalagens flexíveis e de filme nos alimentos e bebidas, médicos e farmacêuticos, produtos frescos, lanches, cuidados pessoais, etc. e outras indústrias. O segmento de embalagens rígidas consiste em operações que fabricam recipientes rígidos para uma ampla gama de produtos predominantemente de bebidas e alimentos, incluindo refrigerantes, água, sucos, bebidas esportivas, bebidas à base de leite, bebidas à base de água e bebidas alcoólicas. bebidas espirituosas e vinho, molhos, molhos, molhos, spreads e itens de cuidados pessoais, e tampas de plástico para uma ampla variedade de aplicações. As subsidiárias da empresa incluem Berry Global Group Inc., Amcor Flexibles North Ameri', 'Zurich, , Switzerland', 41000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUR', 'STOCK', 'Aurora Innovation, Inc.', 'NMS', 'Technology', 'Information Technology Services', 'Aurora Innovation, Inc. develops the Aurora Driver, which is designed as a platform to adapt and interoperate among a multitude of vehicle types and applications. The Aurora Driver is an advanced and scalable suite of self-driving hardware, software, and data services to transform the global transportation market. The Company has integrated the Aurora Driver into numerous different vehicle platforms designed to meet its requirements: from passenger vehicles to light commercial vehicles to Class 8 trucks. It intends to launch Aurora Driver for Freight, its driverless trucking subscription service, as its first commercial product. Its second core market focuses on passenger mobility, initially targeting the ride hailing space with Aurora Driver for Rides, its driverless ride hailing subscription service. Its third core market is local goods delivery, which spans several sub-segments, including last-mile parcel and post, prepared food, grocery, and business-to-business (B2B) delivery.', 'Pittsburgh, PA, United States', 1800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNC', 'STOCK', 'Centene Corporation', 'NYQ', 'Healthcare', 'Healthcare Plans', 'A Centene Corporation é uma empresa de saúde. A empresa fornece serviços totalmente integrados a programas de saúde comerciais e patrocinados pelo governo, com foco em indivíduos sub-segurados e não segurados. Seus segmentos incluem Medicaid, Medicare, comercial e outros. Especificamente, o segmento Medicaid inclui o programa de Assistência Temporária para Famílias Carentes (TANF), programas de expansão Medicaid, o programa Idoso, Cego ou Desabilitado (ABD), o Programa de Seguro de Saúde Infantil (CHIP), Serviços e Apoios de Longo Prazo (LTSS), Cuidados de Foster, Planos Medicare-Medicaid (MMP), que cobrem beneficiários dually elegíveis para Medicaid e outros programas estaduais. O segmento Medicare inclui o Medicare Advantage, o Suplemento Medicare, os Planos de Necessidades Especiais Duplas Elegíveis e os Planos de Medicamentos de Prescrição Medicare. O segmento comercial inclui o produto Health Insurance Marketplace juntamente com produtos individuais, de pequeno grupo e de grande g', 'Saint Louis, MO, United States', 60500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLSK', 'STOCK', 'CleanSpark, Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'CleanSpark, Inc. is a bitcoin mining company. The Company independently owns and operates data centers across the United States with locations in Georgia, Mississippi, Tennessee and Wyoming for a total contracted power capacity of approximately 853 megawatts (MW). The Company designs its infrastructure to responsibly secure and support the bitcoin network. Its operating mining units are capable of producing over 40 exahashes per second (EH/s) of computing power. The Company operates approximately 188,500 bitcoin mining machines, with a hashrate capacity of approximately 27.6 EH/s and a fleetwide efficiency of 21.94 joules per terahash (J/TH). The Company''s subsidiaries include ATL Data Centers LLC, CleanBlok, Inc., CleanSpark DW, LLC, CleanSpark GLP, LLC, CSRE Properties Washington, LLC, CSRE Properties Dalton, LLC, CSRE Property Management Company, LLC, and CSRE Properties Norcross, LLC, among others.', 'Henderson, NV, United States', 256);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATOS', 'STOCK', 'Atossa Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Atossa Therapeutics, Inc. is a clinical-stage biopharmaceutical company. It is engaged in developing medicines in areas of unmet medical need in oncology with a focus on womens breast cancer and other breast conditions. Its lead drug candidate under development is oral (Z)-endoxifen, which it is developing for both the prevention and treatment of breast cancer. (Z)-endoxifen is the potent Selective Estrogen Receptor Modulator for estrogen receptor inhibition and causes estrogen receptor degradation. In addition to its potent anti-estrogen effects, (Z)-endoxifen has been shown to target PKCB1, a known oncogenic protein, at clinically attainable blood concentrations. It is developing a form of (Z)-endoxifen which is administered orally for the potential treatment of breast cancer and reduction of breast density. It has completed four Phase I clinical studies and two Phase II clinical studies with its proprietary (Z)-endoxifen (including oral and topical formulations).', 'Seattle, WA, United States', 15);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVGO', 'STOCK', 'Broadcom Inc.', 'NMS', 'Technology', 'Semiconductors', 'A Broadcom Inc. É uma empresa global de tecnologia que projeta, desenvolve e fornece uma gama de semicondutores, software empresarial e soluções de segurança. A empresa opera através de dois segmentos: Soluções de semicondutores e software de infraestrutura. Seu segmento de soluções de semicondutores inclui todas as suas linhas de produtos e licenciamento de propriedade intelectual (IP). Ele fornece uma variedade de dispositivos semicondutores de radiofrequência, soluções de conetividade sem fio, controladores de toque personalizados e soluções de carregamento indutivo para aplicações móveis. Seu segmento de software de infraestrutura inclui sua nuvem privada e híbrida, desenvolvimento e entrega de aplicativos, borda definida por software, rede e segurança de aplicativos, mainframe, soluções distribuídas e de segurança cibernética e seus negócios FC SAN. Ele fornece um portfólio de soluções de software que permitem que os clientes planejem, desenvolvam, automatizem, gerenciem e proteja', 'Palo Alto, CA, United States', 37000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLS', 'STOCK', 'Celestica Inc.', 'NYQ', 'Technology', 'Electronic Components', 'Celestica Inc. is engaged in designing, manufacturing and providing hardware platform and supply chain solutions. It delivers supply chain solutions globally to customers in two operating segments: Advanced Technology Solutions (ATS) and Connectivity & Cloud Solutions (CCS). The ATS segment consists of its ATS end market and comprises its Aerospace & Defense (A&D), Industrial, HealthTech, and Capital Equipment businesses. Its Capital Equipment business comprises its semiconductor, display, and robotics equipment businesses. The CCS segment consists of its communications and enterprise end markets. The enterprise end market consists of Celesticas servers and storage businesses. It offers a range of product manufacturing and related supply chain services to customers in both of its segments, including design and development, new product introduction, engineering services, component sourcing, electronics manufacturing and assembly, testing, systems integration, among others.', 'Toronto, ON, Canada', 21914);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZN', 'STOCK', 'AstraZeneca PLC', 'NMS', 'Healthcare', 'Drug Manufacturers - General', 'A AstraZeneca PLC é uma empresa biofarmacêutica liderada pela ciência. Descobre, desenvolve e comercializa medicamentos de prescrição em oncologia, doenças raras e biofármacos, incluindo cardiovascular, renal e metabolismo, respiratória e imunologia e vacinas e terapias imunológicas. Os seus principais produtos de oncologia comercializados incluem a Tabrisso, Imfinzi, Lynparza, Calquence, Enhertu, Orpathys, Zoladex, Faslodex e outros. Seus produtos de doenças raras incluem Soliris, Ultomiris, Strensiq e Kanuma. Seus produtos biofarmacêuticos incluem Farxiga, Crestor, Breztri e outros. Sua vacina investigativa candidata IVX-A12, que tem como alvo tanto o vírus sincicial respiratório quanto o metapneumovirus humano. Seu candidato oncológico inclui FPI-2265 visando antígeno de membrana específico da próstata para câncer de próstata metastático resistente à castração, que está em um ensaio de Fase II. Ele também descobre, desenvolve e fabrica terapias de recetores de células T. Seu Enebopa', 'Cambridge, , United Kingdom', 94300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXEL', 'STOCK', 'Exelixis, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Exelixis, Inc. É uma empresa de oncologia. A empresa produziu quatro produtos farmacêuticos comercializados, dois dos quais são formulações de sua molécula principal, o cabozantinib. Também está avançando e evoluindo seu portfólio de dutos de produtos, incluindo seu principal ativo de investigação, zanzalintinib. Cabozantinib é um inibidor de múltiplas quinases de tirosina, incluindo MET, AXEL, recetores VEGF e RET e também foi aprovado como comprimidos CABOMETYX para carcinoma avançado de células renais, para carcinoma hepatocelular previamente tratado e para câncer de tireoide diferenciado refratário radioativo de iodo, e como cápsulas COMETRIQ para câncer medular progressivo e metastático da tireoide. Os outros dois produtos da empresa são COTELLIC, um inibidor da MEK aprovado como parte de esquemas de combinação múltipla para tratar formas específicas de melanoma avançado e MINNEBRO um bloqueador seletivo oral, não-esteroide do recetor mineralocorticoide aprovou o tratamento da hip', 'Alameda, CA, United States', 1147);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CX', 'STOCK', 'CEMEX, S.A.B. de C.V.', 'NYQ', 'Basic Materials', 'Building Materials', 'A Cemex SAB de CV é uma empresa de exploração e holding sediada no México, que atua principalmente, direta ou indiretamente, através de subsidiárias, na produção, distribuição, distribuição e distribuição de produtos e serviços. comercialização e venda de cimento, betão pronto, agregados, clínquer e outros materiais de construção fornecidos globalmente. Os serviços relacionados à construção fornecem clientes e comunidades em mais de 50 países em todo o mundo. A empresa opera em vários locais, incluindo México, Estados Unidos, Europa, América do Sul, América Central, Caribe, Ásia, Oriente Médio e África. As instalações de produção de cimento estão localizadas no México, Estados Unidos, Espanha, Egito, Alemanha, Colômbia, Polônia, República Dominicana, Reino Unido, Panamá, Porto Rico, Tailândia e Nicarágua. A Companhia é fornecedora de agregados, principalmente a pedra triturada, areia e cascalho, utilizados em várias formas de construção.', 'San Pedro Garza García, NL, Mexico', 42587);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTOG', 'STOCK', 'Bit Origin Ltd', 'NCM', 'Financial Services', 'Financial Data & Stock Exchanges', 'Bit Origin Ltd is a holding company. The Company through its subsidiary, SonicHash LLC (SonicHash US), it is engaged in Bitcoin mining in the United States. It uses computers called miners to generate Bitcoins, a type of digital asset (also known as a cryptocurrency). It focuses on existing layouts and mining sites in the United States (US). The Company does not have miners for other cryptocurrencies. The Companys subsidiaries include SonicHash Inc, SonicHash Pte. Ltd., and SonicHash LLC. SonicHash US has approximately 3,200 miners with a hash power of over 304.8 petahashes per second (PH/s) deployed in a Cheyenne, Wyoming facility and has delivered over 1,050 miners with a hash power of around 99.1 PH/s to the same facility, ready for deployment with Phase II of the mining facility.', 'Singapore, , Singapore', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEHL', 'STOCK', 'Antelope Enterprise Holdings Limited', 'NCM', 'Industrials', 'Building Products & Equipment', 'Antelope Enterprise Holdings Limited provides livestreaming ecommerce services, business management and information systems consulting services. The Companys livestreaming ecommerce business is operated in China through its 51%-owned subsidiary, Hainan Kylin, and its subsidiaries, Hangzhou Kylin and Anhui Kylin. The Companys business model involves the promotion of its customers goods by its hosts. Then it connects with different suppliers of hosts and influencers, usually staffing agencies that have a diverse pool of such individuals. The Company provides business management and consulting services, which consist of computer consulting services and software development through its subsidiaries in China, including Chengdu Future and Antelope Chengdu. It is also focused on developing natural gas power generation to provide efficient and stable power output to the energy supply market by purchasing advanced natural gas generators and implementing modern power generation technologies.', 'Jinjiang, , China', 66);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CORZ', 'STOCK', 'Core Scientific, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Core Scientific, Inc. provides digital infrastructure for high-density colocation services and digital asset mining. The Company operates dedicated, purpose-built facilities for digital asset mining and is a provider of digital infrastructure, software solutions and services to its third-party customers. Its Digital Asset Self-Mining segment consists of digital asset mining for its own account. Its Digital Asset Hosted Mining segment consists of its digital infrastructure and third-party hosting services for digital asset mining. Its Colocation segment consists of providing high-density colocation services to third parties for graphics processing units (GPU)-based high-performance computing (HPC) operations. It employs its own large fleet of computers (miners) to earn digital assets for its own account and to provide hosting services for large digital asset-mining customers, and it is in the process of allocating and converting a significant portion of its 10 facilities.', 'Dover, DE, United States', 325);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGNC', 'STOCK', 'AGNC Investment Corp.', 'NMS', 'Real Estate', 'REIT - Mortgage', 'AGNC Investment Corp. is an internally managed real estate investment trust (REIT). The Company provides private capital to the United States housing market, enhancing liquidity in the residential real estate mortgage markets and, in turn, facilitating home ownership in the United States. The Company invests primarily in Agency residential mortgage-backed securities (Agency RMBS) on a leveraged basis. These investments consist of residential mortgage pass-through securities and collateralized mortgage obligations for which the principal and interest payments are guaranteed by a United States Government-sponsored enterprise, such as the Federal National Mortgage Association (Fannie Mae) and the Federal Home Loan Mortgage Corporation (Freddie Mac, and together with Fannie Mae, the GSEs), or by a United States Government agency, such as the Government National Mortgage Association (Ginnie Mae). It may also invest in other assets related to the housing, mortgage or real estate markets.', 'Bethesda, MD, United States', 53);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATYR', 'STOCK', 'aTyr Pharma, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'aTyr Pharma, Inc. is a clinical-stage biotechnology company. The Company is leveraging evolutionary intelligence to translate tRNA synthetase biology into new therapies for fibrosis and inflammation. Its lead therapeutic candidate is efzofitimod, a first-in-class biologic immunomodulator in clinical development for the treatment of interstitial lung disease (ILD), a group of immune-mediated disorders that can cause inflammation and fibrosis, or scarring, of the lungs. Efzofitimod is a tRNA synthetase-derived therapy that selectively modulates activated myeloid cells through neuropilin-2 (NRP2) to resolve aberrant inflammation without immune suppression and potentially prevent the progression of fibrosis. ATYR0101 is a fusion protein derived from a domain of aspartyl-tRNA synthetase (DARS). ATYR0750 is a fusion protein derived from the domain of alanyl-tRNA synthetase (AARS). ATYR0750 is a novel ligand to fibroblast growth factor receptor 4 (FGFR4).', 'San Diego, CA, United States', 56);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABAT', 'STOCK', 'American Battery Technology Company', 'NCM', 'Industrials', 'Waste Management', 'American Battery Technology Company is an integrated battery materials company. The Company is engaged in the exploration of new primary resources of battery metals, the development and commercialization of new technologies for the extraction and refining of these battery metals from primary resources, and the commercialization of an internally developed integrated process for the recycling of lithium-ion batteries for the recovery of battery materials. The Companys business includes lithium-ion battery recycling and Primary Resource Development & Refining. The Companys recycling system is a two-phase process: an automated de-manufacturing process followed by a targeted chemical extraction train to separate the individual high-value metals. The Company has designed and optimizing internally developed sustainable lithium extraction process for the manufacturing of battery cathode grade lithium hydroxide from Nevada-based sedimentary claystone primary resources.', 'Reno, NV, United States', 96);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNH', 'STOCK', 'CNH Industrial N.V.', 'NYQ', 'Industrials', 'Farm & Heavy Construction Machinery', 'CNH Industrial N.V. is an equipment and services company. The Company is engaged in the design, production, marketing, sale, and financing of agricultural and construction equipment. It operates through three segments: Agriculture, Construction and Financial Services. Its Agriculture segment designs, manufactures, and distributes a full line of farm machinery and implements, including two-wheel and four-wheel drive tractors, crawler tractors, combines, grape and sugar cane harvesters, hay and forage equipment, planting and seeding equipment, material handling equipment, and others. Its Construction segment designs, manufactures, and distributes a full line of construction equipment, including excavators, crawler dozers, graders, wheel loaders, backhoe loaders, skid steer loaders, and compact track loaders. Its Financial Services segment offers retail note and lease financing to end-use customers for the purchase of new and used agricultural and construction equipment and components.', 'Basildon, , United Kingdom', 35850);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADT', 'STOCK', 'ADT Inc.', 'NYQ', 'Industrials', 'Security & Protection Services', 'ADT Inc. provides safe, smart and sustainable solutions for people, homes and small businesses. The Company''s core security offerings include burglar and life safety alarms, smart security cameras, smart home automation systems, and video surveillance systems. Its security offerings are designed to detect intrusion; control access; sense movement, smoke, fire, carbon monoxide, leaks, temperature, and other environmental conditions and hazards; and address personal medical emergencies, such as injuries or unanticipated falls. It offers its customers routine maintenance and the installation of upgraded or additional equipment. Additionally, its personal emergency response system products and services utilize its security monitoring infrastructure to provide customers with solutions that help to sustain independent living, detect when a fall occurs, and provide protection while on the go with geolocation capability.', 'Boca Raton, FL, United States', 12800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKR', 'STOCK', 'Baker Hughes Company', 'NMS', 'Energy', 'Oil & Gas Equipment & Services', 'A Baker Hughes Company é uma empresa de tecnologia energética com um portfólio de tecnologias e serviços que abrangem a cadeia de valor energético e industrial. A empresa atua em dois segmentos: Serviços e Equipamentos de Campo de Petróleo (OFSE) e Tecnologia Industrial e Energética (IET). O segmento OFSE fornece produtos e serviços para operações de campo petrolífero onshore e offshore em todo o ciclo de vida de um poço, que vão desde a exploração, avaliação e desenvolvimento, até a produção, rejuvenescimento, e descomissionamento. O OFSE está organizado em quatro linhas de produtos: Construção de Poeiras; Completações, Intervenção e Medidas; Soluções de Produção, e sistemas de pressão submarina e de superfície. O segmento IET fornece soluções e serviços tecnológicos para aplicações de acionamento mecânico, compressão e geração de energia em toda a indústria de energia, incluindo petróleo e gás, operações de gás natural liquefeito (GNL), refino a jusante e mercados petroquímicos, bem ', 'Houston, TX, United States', 57000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VCIT', 'STOCK', 'Vanguard Intermediate-Term Corporate Bond Index Fund ETF Shares', 'NGM', NULL, NULL, 'The fund employs an indexing investment approach designed to track the performance of the Bloomberg U.S. 5-10 Year Corporate Bond Index. This index includes U.S. dollar-denominated, investment-grade, fixed-rate, taxable securities issued by U.S. and non-U.S. industrial, utility, and financial companies, with maturities between 5 and 10 years. Under normal circumstances, at least 80% of the fund''s assets will be invested in bonds included in the index.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGC', 'STOCK', 'Canopy Growth Corporation', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Canopy Growth Corporation is a cannabis company. It delivers innovative products with a focus on premium and mainstream cannabis brands, including Doja, 7ACRES, Tweed, and Deep Space, in addition to category-defining vaporizer technology made in Germany by Storz & Bickel. The principal activities of the Company are the production, distribution and sale of a diverse range of cannabis and cannabinoid-based products for both adult-use and medical purposes under a portfolio of distinct brands in Canada. Its Canada cannabis segment includes the production, distribution, and sale of a range of cannabis, hemp, and cannabis related products in Canada. International markets cannabis segment includes the production, distribution, and sale of a range of cannabis and hemp products internationally. Storz & Bickel segment includes the production, distribution, and sale of vaporizers. This Works segment includes the production, distribution and sale of beauty, skincare, wellness and sleep products.', 'Smiths Falls, ON, Canada', 960);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MP', 'STOCK', 'MP Materials Corp.', 'NYQ', 'Basic Materials', 'Other Industrial Metals & Mining', 'A MP Materials Corp. Produz materiais especiais que são insumos vitais para a eletrificação e outras tecnologias avançadas. A empresa possui e opera a fábrica de processamento e mina de terras raras Mountain Pass (Mountain Pass) localizada na Califórnia. Também está desenvolvendo uma instalação de fabricação de metal, liga e ímã de terras raras em Fort Worth, Texas (Independence Facility). Os segmentos da Companhia incluem Materiais e Magnetics. O segmento de materiais opera Mountain Pass, que produz produtos refinados de terras raras, bem como concentrado de terras raras e produtos relacionados. O segmento de materiais gera principalmente receita de vendas de concentrado de terras raras, vendido principalmente para distribuição adicional a um único cliente principal na China, e vendas de óxido de neodímio-praseodímio (NDPR) e metal, vendidos principalmente para clientes no Japão, Coreia do Sul e Ásia em geral. O segmento Magnetics opera o Independence Facility, onde produz produtos pr', 'Las Vegas, NV, United States', 804);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FHN', 'STOCK', 'First Horizon Corporation', 'NYQ', 'Financial Services', 'Banks - Regional', 'First Horizon Corporation is a regional financial services company. The Company is a financial holding company. The Companys principal subsidiary, and only banking subsidiary, is First Horizon Bank (the Bank). Through the Bank and other subsidiaries, it offers commercial, private banking, consumer, small business, wealth and trust management, retail brokerage, capital markets, fixed income, and mortgage banking services. Its segments include Commercial, Consumer & Wealth; Wholesale; and Corporate. The Commercial, Consumer & Wealth segment offers financial products and services, including traditional lending and deposit taking, to commercial and consumer clients primarily in the southern United States and other selected markets. The Wholesale segment includes mortgage warehouse lending, franchise finance, correspondent banking, and mortgage. Additionally, the Wholesale segment has a line of business focused on fixed-income securities sales, trading, underwriting, and others.', 'Memphis, TN, United States', 7300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABEV', 'STOCK', 'Ambev S.A.', 'NYQ', 'Consumer Defensive', 'Beverages - Brewers', 'A Ambev SA, anteriormente Inbev Participações Societarias SA, é uma empresa brasileira com sede no setor cervejeiro. A Companhia produz, distribui e vende cerveja, refrigerantes com gás (CSDs) e outras bebidas não alcoólicas e não carbonatadas (NANC) nas Américas. As atividades da Companhia estão divididas em três segmentos: América Latina do Norte, incluindo venda de cerveja, refrigerantes e bebidas NANC no Brasil, além de operações na República Dominicana, São Vicente, Antígua, Dominica, Cuba, Guatemala, El Salvador, Honduras, Nicarágua, Barbados e Panamá; América Latina Sul, distribuindo produtos na Argentina, Bolívia, Paraguai, Uruguai, Chile; e Canadá, representado pelas operações da Labatt, que inclui vendas no Canadá e algumas exportações para o mercado dos EUA. A Companhia comercializa produtos com várias marcas, como Adriatica, Brahma, Leffe, Budweiser, Corona, PepsiCo e Lipton. É uma subsidiária da Interbrew International BV.', 'São Paulo, SP, Brazil', 43000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DFLI', 'STOCK', 'Dragonfly Energy Holdings Corp.', 'NCM', 'Industrials', 'Electrical Equipment & Parts', 'Dragonfly Energy Holdings Corp. is a lithium battery technology company, specializing in cell manufacturing, battery pack assembly, and full system integration. It offers several lines of batteries across its two brands, namely Battle Born Batteries and Wakespeed. Through its Battle Born Batteries brand, the Company provides battery packs through original equipment manufacturers (OEMs) and a diverse retail customer base. In domestic lithium battery cell production, its dry electrode manufacturing process offers chemistry-agnostic power solutions for a broad spectrum of applications, including energy storage systems, electric vehicles, and consumer electronics. Battle Born Batteries branded products are sold to direct-to-consumers (DTC), while the Dragonfly Energy brand is primarily sold to OEMs. To supplement its battery offerings, the Company is also a reseller of accessories for battery systems. These include chargers, inverters, monitors, controllers, and other system accessories.', 'Reno, NV, United States', 139);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABSI', 'STOCK', 'Absci Corporation', 'NMS', 'Healthcare', 'Biotechnology', 'Absci Corporation is a clinical-stage biopharmaceutical company advancing therapeutics with generative design. Its Integrated Drug Creation platform combines artificial intelligence (AI) models with a synthetic biology data engine, enabling the design of therapeutics that address challenging therapeutic targets. Its approach leverages a continuous feedback loop between advanced AI algorithms and wet lab validation. Alongside collaborations with pharmaceutical, biotech, tech, and academic companies, the Company is advancing its own pipeline of AI- designed therapeutics. These include ABS-101, an antibody to treat inflammatory bowel disease (IBD), as well as other indications, and ABS-201, for hair regrowth with the potential to redefine treatment possibilities for androgenetic alopecia, commonly known as male and female pattern baldness. It has four wholly owned, internally developed programs focusing on cytokine biology. Its other pipeline programs include ABS-301 and ABS-501.', 'Vancouver, WA, United States', 156);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BABA', 'STOCK', 'Alibaba Group Holding Limited', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Alibaba Group Holding Ltd é uma holding de investimentos principalmente envolvida no fornecimento de infra-estrutura de tecnologia e plataformas de marketing. A Companhia opera seus negócios por meio de nove segmentos. O segmento de varejo de comércio da China está envolvido no negócio de varejo de comércio da China. O segmento de atacado do comércio de China está envolvido principalmente na operação de 1688.com. O segmento Cloud Intelligence fornece serviços em nuvem. O segmento de Varejo de Comércio Internacional fornece serviços de gestão de clientes, vendas de bens e serviços de logística. O segmento de Comércio Internacional Atacado está envolvido principalmente na operação de Alibaba.com. A Cainiao representa o segmento de Serviços Logísticos fornece serviços de atendimento. A receita do segmento de Serviços Locais inclui comissões de plataforma, receita de serviços de logística. O segmento de Mídia Digital e Entretenimento se envolve na operação da Youku e Alibaba. O segmento To', 'Causeway Bay, , Hong Kong', 124320);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGRI', 'STOCK', 'AgriFORCE Growing Systems Ltd.', 'NCM', 'Consumer Defensive', 'Farm Products', 'AgriFORCE Growing Systems Ltd. is a diversified technology and infrastructure company. The Company is focused on agriculture, clean energy, and digital infrastructure. Through its TerraHash Digital division, the Company is building high-performance Bitcoin mining campuses with dual-purpose utility supporting decentralized compute networks while enabling clean energy reuse and sustainable food production. Its segments include Unthink Food, which produces high- protein baking flour; Radical Clean Solutions, which sells its patented hydroxyl devices; and Bitcoin Mining. Its AgriFORCE Brands division focuses on the development and commercialization of plant-based ingredients and products that deliver more nutritious food. Its AgriFORCE Solutions division is dedicated to transforming modern agriculture through its controlled environment agriculture (CEA) equipment, including its FORCEGH+ solution. It owns and operates three Bitcoin mining facilities, one in Alberta, Canada and two in Ohio.', 'Vancouver, BC, Canada', 3);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARR', 'STOCK', 'Carrier Global Corporation', 'NYQ', 'Industrials', 'Building Products & Equipment', 'A Carrier Global Corporation está empenhada em fornecer soluções inteligentes de clima e energia com foco no fornecimento de soluções de ciclo de vida diferenciadas e habilitadas digitalmente para seus clientes. A empresa atua através de dois segmentos: HVAC e refrigeração. O segmento HVAC fornece produtos, controles, serviços e soluções para atender às necessidades de aquecimento, resfriamento e ventilação de seus clientes, ao mesmo tempo em que melhora o desempenho do edifício, saúde e eficiência energética. Os produtos e serviços no segmento incluem ar condicionado, sistemas de aquecimento, bombas de calor, sistemas de automação de edifícios, componentes pós-venda, serviços e alugueres de reparação e manutenção, bem como modernização e atualizações. O segmento de refrigeração fornece produtos, serviços e monitoramento para transporte confiável e preservação de alimentos, medicamentos e outras cargas perecíveis. Seu portfólio inclui marcas, como Carrier, Viessmann, Toshiba, Automated', 'Palm Beach Gardens, FL, United States', 48000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AG', 'STOCK', 'First Majestic Silver Corp.', 'NYQ', 'Basic Materials', 'Silver', 'First Majestic Silver Corp. is a mining company. The Company is focused on silver and gold production in Mexico and the United States. It owns and operates approximately 350,000 hectares of land package, which include the San Dimas Silver/Gold Mine, the Santa Elena Silver/Gold Mine, the La Encantada Silver Mine, and a 70% joint venture interest in the Cerro Los Gatos Silver Mine as well as a portfolio of development and exploration assets, including the Jerritt Canyon Gold project located in northeastern Nevada, United States. The San Dimas Silver/Gold Mine is located over 130 kilometers (km) northwest of the city of Durango, Durango State, Mexico. The Santa Elena Silver/Gold Mine is located over 150 km northeast of the city of Hermosillo, Sonora, Mexico. The La Encantada Silver Mine is an underground mine located in the northern Mexico State of Coahuila, 708 km northeast of Torreon. The Cerro Los Gatos Mine is located around 120 kms south of Chihuahua City, Mexico.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSCO', 'STOCK', 'Cisco Systems, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'A Cisco Systems, Inc. Projeta e vende uma gama de tecnologias que potenciam a Internet. A empresa está integrando seus portfólios de produtos em rede, segurança, colaboração, aplicativos e nuvem. Os segmentos da empresa incluem as Américas; Europa, Oriente Médio e África (EMEA), e Ásia-Pacífico, Japão, e China (APJC). Sua categoria de produtos de rede representa suas principais tecnologias de rede de comutação, roteamento, wireless, quinta geração (5G), silício, soluções óticas e produtos de computação. Sua categoria de produtos de Segurança consiste em suas ofertas de segurança em nuvem e aplicativos, segurança industrial, segurança de rede e segurança de usuários e dispositivos. Sua categoria de produto Colaboração consiste em suas reuniões, dispositivos de colaboração, chamadas, contact center e oferta de plataforma como serviço (CPaaS). Sua categoria de produto de observabilidade consiste em suas ofertas completas de observabilidade de pilha.', 'San Jose, CA, United States', 90400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNP', 'STOCK', 'CenterPoint Energy, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'Centerpoint Energy, Inc. É uma empresa de fornecimento de energia. A Companhia, por meio de suas subsidiárias, possui e opera instalações de transmissão elétrica, distribuição e geração e sistemas de distribuição de gás natural. Seus segmentos incluem Gás Elétrico e Natural. O segmento elétrico inclui serviços de transmissão elétrica e distribuição que estão sujeitos à regulamentação de taxas nos territórios de serviço da Houston Electric e da Indiana Electric. O segmento de Gás Natural inclui vendas de gás natural intraestado e transporte e distribuição de gás natural para clientes residenciais, comerciais, industriais e institucionais em Indiana, Minnesota, Ohio e Texas; conexões permanentes de dutos por meio de interconexões com várias empresas de gasodutos interestaduais e intraestatais; e serviços de manutenção e reparo de eletrodomésticos para clientes em Minnesota e planos de proteção de reparo doméstico para clientes de gás natural em Indiana, Ohio e Texas através de terceiros.', 'Houston, TX, United States', 8872);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEO', 'STOCK', 'American Eagle Outfitters, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'American Eagle Outfitters, Inc. is a global specialty retailer. The Company offers clothing, accessories and personal care products under its American Eagle and Aerie brands. The Company operates through two segments: American Eagle and Aerie. American Eagle is an American jeans and apparel brand. Aerie is a lifestyle brand offering intimates, apparel, activewear, and swim collections. OFFLINE by Aerie offers a complete collection of activewear and accessories. The Company sells its products directly to consumers through its retail channel, which includes its stores and concession-based shops-within-shops. It operates stores in the United States, Canada, Mexico, and Hong Kong. The Company has license agreements with third parties to operate American Eagle and Aerie stores and online marketplace businesses throughout Asia, including India, Europe, Latin America, and the Middle East. The Company also operates Todd Snyder New York (Todd Snyder), a premium menswear brand.', 'Pittsburgh, PA, United States', 9000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGTX', 'STOCK', 'Cognition Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cognition Therapeutics, Inc. is a clinical-stage biopharmaceutical company engaged in the discovery and development of small molecule therapeutics targeting age-related degenerative disorders of the central nervous system and retina. The Company is investigating its lead candidate, zervimesine (CT1812), in clinical programs in dementia with Lewy bodies (DLB) and Alzheimers disease. Its CT1812 and pipeline of sigma-2 modulators can regulate pathways that are impaired in these diseases for the treatment of degenerative diseases. Its lead product candidate, CT1812, is an orally delivered, small molecule designed to protect neuronal synapses by preventing the binding of oligomers of pathogenic proteins. Its pipeline candidates were discovered using proprietary biology and chemistry platforms designed to identify novel drug targets and disease-modifying therapies that address dysregulated pathways. It is developing other product candidates in the area of synucleinopathies.', 'Purchase, NY, United States', 25);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOW', 'STOCK', 'Dow Inc.', 'NYQ', 'Basic Materials', 'Chemicals', 'A Dow Inc. Atua como holding para a Dow Chemical Company e suas subsidiárias. A empresa realiza suas operações por meio de seis negócios globais, que são organizados em segmentos, como Embalagens e Plásticos Especializados, Intermediários Industriais e Infraestrutura e Materiais de Desempenho e Revestimentos. O segmento de Embalagens e Plásticos Especializados consiste em dois negócios globais integrados: Hidrocarbonetos e Energia e Embalagens e Plásticos Especializados. Este segmento emprega um portfólio de produtos de poliolefina. O segmento de Intermediários Industriais e Infra-estrutura consiste em dois negócios globais centrados no cliente: Soluções Industriais e Poliuretanos e Produtos Químicos de Construção que desenvolvem produtos químicos intermediários que são essenciais para os processos de fabricação, bem como materiais e formulações a jusante e personalizados que utilizam tecnologias avançadas de desenvolvimento. O segmento Performance Materials & Coatings consiste em dois', 'Midland, MI, United States', 36000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPX', 'STOCK', 'Amprius Technologies, Inc.', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'Amprius Technologies, Inc. develops, manufactures and markets lithium-ion batteries for mobility applications, including the aviation, electric vehicle (EV) and light electric vehicle (LEV) industries. The Companys commercially available SiMaxx batteries deliver up to 450 Wh/kg and 1,150 Wh/L, with third-party validation of 500 Wh/kg and 1,300 Wh/L. Its batteries are primarily used for existing and emerging aviation applications, including unmanned aerial systems (UAS), such as drones and high-altitude pseudo satellites (HAPS). It offers high-performance silicon anode batteries under product platforms: SiCore and SiMaxx. Its SiCore batteries are based on an innovative, proprietary silicon anode material system delivering high-energy-density silicon anode batteries that surpass current graphite cell performance. Its SiMaxx high-energy battery cells are designed to maximize specific energy for applications with low power requirements.', 'Fremont, CA, United States', 99);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHSN', 'STOCK', 'Chanson International Holding', 'NCM', 'Consumer Cyclical', 'Restaurants', 'Chanson International Holding is a holding company mainly engaged in the manufacturing and sales of a wide selection of bakery products, seasonal products and beverage products. The Company mainly sells products in the PRC (People''s Republic of China) Stores and the U.S. (the United States) Stores through the George Chanson, Patisserie Chanson and Chanson brand bakery chains. The PRC Stores mainly offer bakery products, beverage products, and contract third-party manufacturers to produce seasonal products. The U.S. Stores primarily offer bakery products, breakfast, lunch and all-day brunch, bar food, and other light meals, as well as beverage products made within the kitchen in the store. The Company primarily distributes its products in Mainland China and the United States markets.', 'Urumqi, , China', 405);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQX', 'STOCK', 'Equinox Gold Corp.', 'ASE', 'Basic Materials', 'Gold', 'Equinox Gold Corp. is a diversified gold producer. The Company has a portfolio of mines in five countries anchored by two Canadian gold mines: the Greenstone Gold Mine in Ontario and the Valentine Gold Mine in Newfoundland and Labrador. Its other operating mines include Mesquite Mine, Aurizona Mine, RDM Mine, Bahia Complex, Limon Mine, Libertad Mine, and Pan Gold Mine. Greenstone is a multi-million-ounce gold project located in the mining jurisdiction of Ontario, Canada, approximately 275 kilometers (km) northeast of Thunder Bay in Geraldton, Ontario. Mesquite Mine is an open pit, run-of-mine heap leach gold mine located in Imperial County, California, United States, approximately 200 miles south of its Castle Mountain Mine. Aurizona Mine is located in northeastern Brazil near the town of Godofredo Viana in Maranhao State, and within three km of an Atlantic Ocean inlet. RDM Mine is located in Minas Gerais State, Brazil, about 560 km north of the state capital city of Belo Horizonte.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COIN', 'STOCK', 'Coinbase Global, Inc.', 'NMS', 'Financial Services', 'Financial Data & Stock Exchanges', 'A Coinbase Global, Inc. É uma holding da Coinbase, Inc. E outras subsidiárias. A empresa fornece uma plataforma para seus clientes se envolverem com ativos cripto e oferece infraestrutura crítica para a economia onchain. Ele oferece produtos e serviços para três grupos de clientes: Consumidores, Instituições e Desenvolvedores. Os consumidores incluem clientes de varejo que buscam investir ou negociar ativos cripto e se envolver em cadeia. As instituições consistem em empresas que incluem fabricantes de mercado, gerentes de ativos, fundos de hedge, bancos, plataformas de riqueza, consultores de investimento registrados, plataformas de pagamento e corporações públicas e privadas. Os desenvolvedores incluem empreendedores, criadores, comerciantes, emissores de ativos cripto, organizações e instituições financeiras e outros grupos que criam protocolos descentralizados, aplicativos, produtos ou outros serviços on-chain. Seus produtos de transação incluem negociação principal, protocolo base', 'New York, NY, United States', 3772);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRO', 'STOCK', 'Brown & Brown, Inc.', 'NYQ', 'Financial Services', 'Insurance Brokers', 'Brown & Brown, Inc. is an insurance brokerage company engaged in delivering risk management solutions to individuals and businesses. It markets and sells insurance products and services, primarily in the property, casualty and employee benefits areas. Its segments include Retail, Programs, and Wholesale Brokerage. The Retail segment provides a range of insurance products and services to commercial, public and quasi-public, professional and individual insured customers, and non-insurance services and products through its automobile dealer services F&I businesses. The Programs segment specializes in the development, underwriting and management of insurance program business, often designed for niche, underserved markets, and distributes these coverage to retail agencies, as well as affinity groups, wholesale entities and sold direct to consumers. Its Wholesale Brokerage segment markets and sells excess and surplus commercial insurance products and services to retail insurance agencies.', 'Daytona Beach, FL, United States', 17403);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMC', 'STOCK', 'AMC Entertainment Holdings, Inc.', 'NYQ', 'Communication Services', 'Entertainment', 'A AMC Entertainment Holdings, Inc. é uma empresa de exibição teatral. A Companhia está envolvida principalmente no negócio de exibição teatral e possui, opera ou tem participação em teatros localizados principalmente nos Estados Unidos e na Europa. A Companhia opera através de dois segmentos: mercados nos EUA e mercados Internacionais. No segmento de mercados nos EUA, ela possui, aluga e opera teatros em aproximadamente 43 estados e no Distrito de Columbia. O segmento de mercados Internacionais tem operações ou participação parcial em teatros no Reino Unido, Alemanha, Espanha, Itália, Irlanda, Portugal, Suécia, Finlândia, Noruega, Dinamarca e Arábia Saudita. Suas marcas incluem AMC, AMC CLASSIC e AMC DINE-IN. Também oferece alimentos e bebidas que incluem refeições, lanches saudáveis, opções de bebidas, cervejas e vinhos, entre outros produtos gourmet. Ela opera aproximadamente 946 teatros através de 10.562 telas nos Estados Unidos e mercados internacionais.', 'Leawood, KS, United States', 2915);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNUT', 'STOCK', 'Krispy Kreme, Inc.', 'NMS', 'Consumer Defensive', 'Grocery Stores', 'Krispy Kreme, Inc. and its subsidiaries operate through its omni-channel business model to produce doughnuts and deliver fresh doughnut experiences for Doughnut Shops, Delivered Fresh Daily (DFD) Doors, and digital channels, expanding consumer access to the Krispy Kreme brand. The Company operates through three segments: U.S., International and Market Development. The U.S. segment includes all Krispy Kreme Company-owned operations in the U.S. The International segment includes all Krispy Kreme Company-owned operations in the U.K., Ireland, Australia, New Zealand, Mexico, Canada, and Japan. The Market Development segment includes franchise operations across the globe. It operates in more than 40 countries through its network of fresh doughnut shops, partnerships with retailers, and a rapidly growing digital business with more than 17,500 fresh points of access.', 'Charlotte, NC, United States', 21000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAG', 'STOCK', 'Conagra Brands, Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'A ConAgra Brands, Inc. É uma empresa de alimentos para bens de consumo. Os segmentos da Companhia incluem mercearia e lanches que incluem produtos alimentícios de marca, estáveis em prateleiras, vendidos em vários canais de varejo nos Estados Unidos; o segmento refrigerado e congelado inclui produtos alimentícios de marca e temperatura controlada vendidos em vários canais de varejo nos Estados Unidos; o segmento internacional inclui principalmente produtos alimentícios de marca em vários estados de temperatura, vendidos em vários canais de varejo e serviços alimentícios fora dos Estados Unidos, e o segmento Foodservice inclui produtos alimentícios de marca e personalizados, incluindo refeições, entradas, molhos e uma variedade de produtos culinários personalizados embalados para venda a restaurantes e outros estabelecimentos de serviços alimentícios principalmente nos Estados Unidos. Suas marcas incluem Birds Eye, Duncan Hines, Healthy Choice, Marie Callender''s, Reddi-wip, e BOOMCHICK', 'Chicago, IL, United States', 18300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOC', 'STOCK', 'Healthpeak Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'Healthpeak Properties, Inc. É uma confiança de investimento imobiliário totalmente integrada (REIT). A empresa adquire, desenvolve, possui, aluga e gerencia imóveis de saúde em todos os Estados Unidos. Sua estratégia é investir e gerenciar imóveis focados na descoberta e entrega de cuidados de saúde. Possui um portfólio diversificado de propriedades de saúde de alta qualidade em três classes de ativos principais de imóveis de laboratório, médicos ambulatoriais e comunidade de aposentadoria de cuidados contínuos (CCRC). Os segmentos da empresa incluem Lab, Ambulatório médico e CCRC. As propriedades do segmento de laboratório contêm espaço de laboratório e escritório, são alugadas principalmente a empresas de biotecnologia, dispositivos médicos e farmacêuticos, instituições de pesquisa científica, agências governamentais e outras organizações envolvidas na indústria de ciências da vida. O segmento Médico ambulatorial inclui edifícios médicos e hospitais. Os edifícios médicos ambulatoriai', 'Denver, CO, United States', 387);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTS', 'STOCK', 'AST SpaceMobile, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'AST SpaceMobile, Inc. is engaged in building a global cellular broadband network in space to operate directly with standard, unmodified mobile devices based on its intellectual property (IP) and patent portfolio and designed for both commercial and government applications. The Company is engaged in designing and developing the constellation of BlueBird (BB) satellites and has planned space-based Cellular Broadband network distributed through a constellation of low Earth orbit (LEO) satellites. Its SpaceMobile Service is being designed to provide high-speed cellular broadband services to end-users who are out of terrestrial cellular coverage using existing mobile devices. The Company intends to continue testing capabilities of the BW3 test satellite, including further testing with cellular service providers and the government. The Company has operations in India, Scotland, Spain, Israel and Lithuania.', 'Midland, TX, United States', 578);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVS', 'STOCK', 'CVS Health Corporation', 'NYQ', 'Healthcare', 'Healthcare Plans', 'CVS Health Corporation é uma empresa de soluções de saúde. Os segmentos da empresa incluem benefícios de cuidados de saúde, serviços de saúde, farmácia e bem-estar do consumidor e corporativo/outro. O segmento de benefícios de cuidados de saúde oferece uma gama de produtos de seguros de saúde tradicionais, voluntários e direcionados ao consumidor e serviços relacionados, incluindo planos de saúde médicos, farmácia, odontológicos e comportamentais, capacidades de gestão médica, PDP e serviços de gestão de cuidados de saúde da Medicaid. O segmento de Serviços de Saúde oferece uma gama completa de soluções PBM, oferece serviços de saúde em suas clínicas médicas, virtualmente e em casa, e oferece soluções de capacitação de provedores. O segmento de Farmácia & Bem-Estar do Consumidor dispensa prescrições nas suas farmácias de retalho e através das suas operações de infusão, presta serviços de farmácia auxiliares, incluindo programas de cuidados de farmácia, testes de diagnóstico e administr', 'Woonsocket, RI, United States', 219000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDE', 'STOCK', 'Coeur Mining, Inc.', 'NYQ', 'Basic Materials', 'Gold', 'Coeur Mining, Inc. is a diversified precious metals producer. The Company has five wholly owned operations: the Las Chispas silver-gold mine in Sonora, Mexico, the Palmarejo gold-silver complex in Chihuahua, Mexico, the Rochester silver-gold mine in Nevada, the Kensington gold mine in Alaska and the Wharf gold mine in South Dakota. In addition, the Company wholly owns the Silvertip polymetallic critical minerals exploration project in British Columbia. The Las Chispas Operation is located approximately 180 kilometers (km) northeast of Hermosillo, Sonora, Mexico. The Palmarejo complex consists of the Palmarejo processing facility, three underground mines, exploration targets and a campsite. The Rochester mine is an open pit, heap leach silver-gold operation, located in Pershing County, Nevada. The Kensington mine is an underground gold operation located in southeast Alaska. Wharf is an open pit, heap leach gold operation located in the northern Black Hills of western South Dakota.', 'Chicago, IL, United States', 2116);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BB', 'STOCK', 'BlackBerry Limited', 'NYQ', 'Technology', 'Software - Infrastructure', 'BlackBerry Limited is a Canada-based company, which provides enterprises and governments the intelligent software and services. The Company delivers operational resiliency with the certified platform for mobile fortification, mission-critical communications, and critical events management. It operates in three segments: Secure Communications, QNX, and Licensing. The Secure Communications segment consists of BlackBerry UEM, BlackBerry AtHoc, and BlackBerry SecuSUITE. Its endpoint management platform includes BlackBerry UEM, BlackBerry Dynamics, and BlackBerry Workspaces solutions. The QNX segment consists of BlackBerry QNX, BlackBerry Certicom, BlackBerry Radar, and other QNX applications. The Licensing segment consists of the Companys intellectual property arrangements and settlement awards. Its BlackBerry Radar is a family of asset monitoring and telematics solutions for the transportation and logistics industry.', 'Waterloo, ON, Canada', 1820);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMKR', 'STOCK', 'Amkor Technology, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Amkor Technology, Inc. is a provider of outsourced semiconductor packaging and test services. The Company is engaged in the outsourcing of semiconductor packaging and test services. It designs and develops packaging and tests technologies focused on advanced packaging solutions, including artificial intelligence. Its packaging and test services are designed to meet application and chip-specific requirements, including: the required type of interconnect technology; size; thickness; electrical, mechanical, and thermal performance. It provides turnkey packaging and test services including semiconductor wafer bump, wafer probe, wafer back-grind, package design, packaging, system-level and final test and drop shipment services. The Company offers services to integrated device manufacturers (IDMs), fabless semiconductor companies, original equipment manufacturers (OEMs) and contract foundries. It allows IDMs to outsource packaging and test services and focus their investments.', 'Tempe, AZ, United States', 28300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ERIC', 'STOCK', 'Telefonaktiebolaget LM Ericsson (publ)', 'NMS', 'Technology', 'Communication Equipment', 'A Telefonaktiebolaget LM Ericsson (LM Ericsson) oferece um portfólio de sistemas e serviços de telecomunicações e comunicação de dados cobrindo uma variedade de tecnologias. Oferece soluções ponta a ponta para todos os principais padrões de comunicação móvel. A LM Ericsson possui três segmentos de negócios: Sistemas, Telefones e Outras Operações. O segmento de Sistemas dirige-se a operadoras de redes telefônicas públicas móveis e fixas. O segmento de telefones dirige-se aos distribuidores de aparelhos móveis aos usuários finais. O segmento Outras Operações consiste em várias operações diferentes com diferentes tipos de clientes.As operações incluídas são sistemas de micro-ondas (defesa), sistemas empresariais, tecnologias de rede (cabos), plataformas móveis e módulos de energia. Durante o ano findo em 31 de dezembro de 2005, a Companhia adquiriu a NetSpira Networks, S.L. e Axxessit AsA. A NetSpira Networks, S.L. é uma empresa espanhola de software. A Axxessit AsA é uma empresa noruegue', 'Stockholm, , Sweden', 91937);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('C', 'STOCK', 'Citigroup Inc.', 'NYQ', 'Financial Services', 'Banks - Diversified', 'A Citigroup Inc. É uma holding global de serviços financeiros diversificados. Os segmentos da Companhia incluem Serviços, Mercados, Banca, Riqueza e U.S. Personal Banking (USPB). O segmento de Serviços inclui serviços de Tesouraria e Soluções Comerciais (TTS) e valores mobiliários. A TTS fornece um conjunto integrado de soluções personalizadas de gestão de caixa, comércio e capital de giro para corporações multinacionais, instituições financeiras e organizações do setor público. O segmento de Mercados oferece aos clientes corporativos, institucionais e do setor público em todo o mundo uma gama completa de serviços de vendas e negociação em ações, câmbio, taxas, spread de produtos e commodities. O segmento bancário inclui o investimento bancário, que apoia as necessidades de captação de capital do cliente para ajudar a fortalecer e expandir seus negócios. O segmento de riqueza inclui Private Bank, Wealth at Work e Citigold e fornece serviços financeiros para uma variedade de segmentos d', 'New York, NY, United States', 230000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANET', 'STOCK', 'Arista Networks Inc', 'NYQ', 'Technology', 'Computer Hardware', 'A Arista Networks, Inc. É fornecedora de redes cliente-nuvem orientadas por dados para ambientes de grande inteligência artificial (IA), data center, campus e roteamento. Suas plataformas oferecem disponibilidade, agilidade, automação, análise e segurança por meio de uma pilha operacional avançada de rede. Sua plataforma é o Sistema Operacional Extensível (EOS), um sistema operacional modernizado de rede de compartilhamento de estado de publicação-assinatura. Seu portfólio de produtos, serviços e tecnologias está agrupado em várias categorias: Núcleo (Data Center, Cloud e AI Networking), adjacências cognitivas (Campus e Roteamento) e Rede Cognitiva (Software e Serviços). Ele oferece portfólios de produtos de switches Ethernet de alta velocidade, nuvem e data center baseados em dados. Suas adjacências cognitivas incluem o Cognitive Campus Switching, o Cloud-Grade Routing e o WAN Routing. Seu software e serviços são baseados em modelos baseados em assinatura e incluem várias ofertas: Clo', 'Santa Clara, CA, United States', 4412);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BND', 'STOCK', 'Vanguard Total Bond Market Index Fund', 'NGM', NULL, NULL, 'This index measures the performance of a wide spectrum of public, investment-grade, taxable, fixed income securities in the United States-including government, corporate, and international dollar-denominated bonds, as well as mortgage-backed and asset-backed securities-all with maturities of more than 1 year. All of the fund''s investments will be selected through the sampling process, and at least 80% of its assets will be invested in bonds held in the index.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BE', 'STOCK', 'Bloom Energy Corporation', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'Bloom Energy Corporation is engaged in stationary fuel cell power generation by market share. The Company provides distributed energy technology solutions to customers. The Company manufactures advanced and versatile fuel cell energy platforms, supporting the commercial availability of two products: the Bloom Energy Server for generating electricity and the Bloom Electrolyzer for producing hydrogen. With approximately 1.4 gigawatts (GW) of Energy Server systems deployed in more than 1,000 locations and nine countries. Its solid oxide fuel cell technology platform is the foundation for its Energy Server system and Bloom Electrolyzer. The Bloom Energy Server system is designed to deliver reliable, resilient, clean and affordable energy for utilities and organizations alike. Its Energy Server system is designed to deliver reliable electricity. The Bloom Electrolyzer is designed to provide hydrogen solutions based on the same solid oxide platform as its Energy Server systems.', 'San Jose, CA, United States', 2127);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIRE', 'STOCK', 'reAlpha Tech Corp.', 'NCM', 'Real Estate', 'Real Estate Services', 'reAlpha Tech Corp. is a real estate technology company developing an end-to-end commission-free home buying platform, namely, the reAlpha platform. The reAlpha platform integrates artificial intelligence (AI)-driven tools to offer tailored property recommendations, an intuitive visual interface, mortgage brokering, digital title and escrow services within the platform. The reAlpha platform assists homebuyers with tasks such as mortgage pre-approval, booking tours, sending offer letters and completing property acquisitions. The reAlpha platform also provides market insights, detailed property data, and uses large language models to answer queries and facilitate the homebuying process via a user-friendly, 24/7 Web platform and iOS application. It operates in the Technology services segment, which offers and develops AI-based products and services to customers in various industries, including, but not limited to, the real estate, retail, hospitality and education industries.', 'Dublin, OH, United States', 132);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMY', 'STOCK', 'Bristol-Myers Squibb Company', 'NYQ', 'Healthcare', 'Drug Manufacturers - General', 'A Bristol-Myers Squibb Company é uma empresa biofarmacêutica global. Está envolvida na descoberta, desenvolvimento e entrega de medicamentos transformacionais para pacientes que enfrentam doenças graves em áreas: oncologia, hematologia, imunologia, cardiovascular, neurociência e outras áreas. Suas plataformas incluem drogas quimicamente sintetizadas ou pequenas moléculas, incluindo degradadores de proteínas; medicamentos produzidos a partir de processos biológicos, chamados de biológicos; ADCs, terapias celulares CAR-T e terapêutica radiofármaco. As drogas pequenas da molécula são tipicamente administradas oralmente na forma de um tabuleta ou da cápsula, embora outros mecanismos da entrega da droga sejam usados igualmente. Os biológicos são normalmente administrados através de injeções ou por infusão intravenosa. As terapias celulares CAR-T são administradas por infusão intravenosa. Seu portfólio de crescimento inclui Opdivo, Opdivo Qvantig, Orencia, Yervoy, Reblozyl, Opdualag, e outro', 'Princeton, NJ, United States', 34100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AES', 'STOCK', 'The AES Corporation', 'NYQ', 'Utilities', 'Utilities - Diversified', 'A AES Corporation é uma empresa de energia. A empresa atua em quatro segmentos: Energias Renováveis, Utilidades, Infraestrutura Energética e Novas Tecnologias Energéticas. O segmento de energias renováveis inclui instalações solares, eólicas, de armazenamento de energia e de geração hídrica. O segmento de Utilities inclui as concessionárias regulamentadas AES Indiana, AES Ohio e AES El Salvador e suas instalações de geração. O segmento de Infraestrutura de Energia inclui gás natural, gás natural liquefeito (GNL), carvão, coque para animais de estimação, diesel e instalações de geração de petróleo, e seus negócios no Chile, que têm uma mistura de fontes de geração, incluindo energias renováveis. O segmento de Novas Tecnologias Energéticas inclui investimentos em Fluence, Utlight, Maximo e outras iniciativas. Possui duas linhas de negócio: Geração, que possui e/ou opera Usinas de energia para gerar e vender energia a clientes e Utilities que possuem e/ou operam utilidades para gerar ou c', 'Arlington, VA, United States', 9100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKKT', 'STOCK', 'Bakkt Holdings, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'Bakkt Holdings, Inc. builds technology that enables its clients to deliver new opportunities to their customers. Through Software as a Service (SaaS) and Application Programming Interface (API) solutions that provide crypto trading capabilities and loyalty solutions for its clients and customers. The Company operates primarily through the Bakkt Crypto Solutions, LLC (Bakkt Crypto), BakktX ECN, LLC (BakktX), and Bakkts Loyalty Solutions. Through the Bakkt Cryptos platform, customers can purchase approved crypto assets, store crypto assets in custodial wallets, liquidate their holdings, and transfer supported crypto assets between a custodial wallet maintained by Bakkt Crypto and external wallets in certain jurisdictions, if enabled by the client. BakktX order matching technology is being utilized by Bakkts in-house, retail-facing principal brokerage, Bakkt Crypto, to offer US clients and their customers.', 'Alpharetta, GA, United States', 559);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WINT', 'STOCK', 'Windtree Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Windtree Therapeutics, Inc. is a diversified company. The Company is engaged in the biotechnology business, advancing early and late-stage therapies for critical conditions and diseases. Its portfolio of product candidates includes istaroxime, a Phase II candidate with SERCA2a activating properties for acute heart failure and associated cardiogenic shock, preclinical SERCA2a activators for heart failure and preclinical precision aPKCi inhibitors that are being developed for potential in rare and broad oncology applications. Istaroxime is a first-in-class dual-mechanism therapy designed to improve both systolic and diastolic cardiac function. aPKCi inhibitor platform is a potential high-potency, specific, drug candidate with applications in oncology, particularly in hedgehog pathway-dependent cancers. The Company also has a licensing business model with partnership out-licenses in place. The Company is also focused on environmental services space.', 'Warrington, PA, United States', 14);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DJT', 'STOCK', 'Trump Media & Technology Group Corp.', 'NGM', 'Communication Services', 'Internet Content & Information', 'Trump Media & Technology Group Corp. (TMTG) is a social media and technology-focused company. The Company''s product, Truth Social, is a social media platform where any user can create content, follow other users and engage in an open global conversation. The Company does not restrict whom a user can follow. Additionally, users can be followed by other users without requiring a reciprocal relationship, enhancing the ability of its users to reach a broad audience. Its products and services include Truth Social and Truth+. TMTG operates a TV streaming platform, Truth+, across the entire Truth Social platform-iOS, Android, and the Web. The streaming service relies on TMTG''s custom-built content delivery network (CDN), which operates through a data center. TMTG''s streaming technology is powered through specially designed infrastructure with its own servers, routers, and software stack. The Company is also focused on launching Truth.Fi, a financial service and FinTech brand.', 'Sarasota, FL, United States', 29);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATNF', 'STOCK', '180 Life Sciences Corp.', 'NCM', 'Healthcare', 'Biotechnology', '180 Life Sciences Corp. is a biotechnology company, which focuses on the development of therapeutics for unmet medical needs in chronic pain, inflammation and fibrosis. Its programs include Anti-TNF (Clinical), Synthetic Cannabinoid Analogs (SCAs), and a7nAChR (Preclinical). The Company also operates a back-end technology platform to operate an online blockchain casino.', 'Palo Alto, CA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVTR', 'STOCK', 'Avantor, Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Avantor, Inc. is a life science tools company and global provider of mission-critical products and services to the life sciences and advanced technology industries. The Companys segments include Laboratory Solutions and Bioscience Production. Within its segments, it sells materials and consumables, equipment and instrumentation and services and specialty procurement to customers in the biopharma and healthcare, education and government and advanced technologies and applied materials industries. Materials and consumables include ultra-high purity chemicals and reagents, lab products and supplies, highly specialized formulated silicone materials, customized excipients, and others. Equipment and instrumentation include filtration systems, virus inactivation systems, incubators, analytical instruments, and others. Services and specialty procurement include onsite lab and production, equipment, procurement and sourcing and biopharmaceutical material scale-up and development services.', 'Radnor, PA, United States', 13500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OPTT', 'STOCK', 'Ocean Power Technologies, Inc.', 'ASE', 'Industrials', 'Specialty Industrial Machinery', 'Ocean Power Technologies, Inc. provides ocean data collection and reporting, marine power, offshore communications and domain awareness services products, and integrated solutions. The Company focuses on three major service areas: Data as a Service (DaaS), which includes data collected by its Wave Adaptive Modular Vessel (WAM-V) autonomous vehicles or its PowerBuoy product lines; Robotics as a Service (RaaS), which provides a lower cost subscription model for its customers to access use of its WAM-Vs, and Power as a Service (PaaS), which includes its PowerBuoy and subsea battery products. The Company''s solutions are primarily suited to ocean and other offshore environments, and support generation of actionable intelligence on a standalone basis. The Company offers its products and services to a wide range of customers, including those in government and offshore energy, oil and gas, construction, science and research, wind power, and other industries.', 'Monroe Township, NJ, United States', 53);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASX', 'STOCK', 'ASE Technology Holding Co., Ltd.', 'NYQ', 'Technology', 'Semiconductors', 'ASE Technology Holding Co Ltd is a Taiwan-based company that mainly invests in packaging services, testing services, electronic product assembly technology and manufacturing services. The investment business includes general investment business projects. The packaging and testing business provides integrated circuit (IC) services, including packaging and module design, IC packaging, multi-chip packaging, micro and hybrid modules, memory packaging, front-end testing, wafer probe testing, finished product testing, substrate design, and manufacturing. The electronic manufacturing service business mainly provides a series of professional services such as development and design, material procurement, production and manufacturing, logistics, maintenance and other after-sales services for domestic and foreign brand manufacturers in the fields of communications, consumer electronics, computers, storage industrial, automotive electronics and other types of electronic products.', 'Kaohsiung, , Taiwan', 100450);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AI', 'STOCK', 'C3.ai, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'C3.ai, Inc. is an enterprise artificial intelligence (AI) application software company. The Company has built a solution that enables its customers to rapidly develop, deploy, and operate enterprise AI applications. It offers families of software solutions, which it collectively refers to as its C3 AI software: The C3 AI Platform, C3 AI Applications, and C3 Generative AI. The C3 AI Platform, its core technology, is a comprehensive, end-to-end application development and runtime environment that is designed to allow its customers to rapidly design, develop, and deploy Enterprise AI applications of any type. Its C3 AI Applications, built using the C3 AI Platform, is a portfolio of pre-built, extensible, industry-specific, and application-specific software-as-a-service offerings (SaaS) Enterprise AI applications that can be rapidly installed and deployed. Its C3 Generative AI combines the utility of large language models, generative AI, reinforcement learning, natural language processing.', 'Redwood City, CA, United States', 1181);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APH', 'STOCK', 'Amphenol Corporation', 'NYQ', 'Technology', 'Electronic Components', 'Amphenol Corporation é um designer, fabricante e comerciante de conetores elétricos, eletrônicos e de fibra ótica e sistemas de interconexão, antenas, sensores e produtos baseados em sensores e cabos especiais coaxiais e de alta velocidade. A Companhia atua através de três segmentos. O segmento de Soluções de Ambiente Harsh projeta, fabrica e comercializa uma gama de produtos de interconexão reforçada e outros produtos para uso na indústria, defesa, aeroespacial comercial, automotivo, redes móveis, etc. médicos e outros mercados. O segmento de Soluções de Comunicação projeta, fabrica e comercializa uma gama de sistemas de conetores e interconexão para uso nas tecnologias da informação e comunicações de dados, dispositivos móveis, industriais, redes móveis, comunicações de banda larga, mercado automotivo, aeroespacial comercial e de defesa final. Seu segmento de Sistemas de Interconexão e Sensor projeta, fabrica e comercializa uma gama de sensores, sistemas baseados em sensores, conetor', 'Wallingford, CT, United States', 125000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCCS', 'STOCK', 'CCC Intelligent Solutions Holdings Inc.', 'NMS', 'Technology', 'Software - Application', 'CCC Intelligent Solutions Holdings Inc. provides a software as a service (SaaS) platform for the property and casualty (P&C) insurance economy. The Company''s cloud-based SaaS platform connects trading partners, facilitates commerce, and supports artificial intelligence (AI) enabled digital workflows. Its solutions include CCC Insurance Solutions, CCC Repair Solutions, CCC Ecosystem and Other Solutions, and CCC International Solutions. Its CCC Insurance Solutions include CCC Workflow, CCC Estimating, CCC Total Loss, CCC Casualty, CCC Subrogation and CCC Automotive Claim Handling. Its repair solutions include CCC Estimating, CCC Network Management, CCC Repair Workflow and CCC Repair Quality. It offers enterprise solutions that support multiple customer segments, along with specific solutions tailored to other segments of the insurance ecosystem, including parts suppliers and automotive manufacturers. It provides insurance claims software to some of the automotive insurers in China.', 'Chicago, IL, United States', 2310);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SENS', 'STOCK', 'Senseonics Holdings, Inc.', 'ASE', 'Healthcare', 'Medical Devices', 'Senseonics Holdings, Inc. is a medical technology company focused on the development and manufacturing of glucose monitoring products designed to transform lives in the diabetes community. Its glucose monitoring (CGM) systems Eversense 365 and Eversense E3 include a small sensor inserted completely under the skin that communicates with a smart transmitter worn over the sensor. Its CGM systems are indicated for continually measuring glucose levels for up to 365 days for Eversense 365 and 180 days for Eversense E3 in persons with diabetes age 18 and older. Eversense consists of three primary components: a small sensor inserted subcutaneously under the skin by a healthcare provider; an external removable smart transmitter that receives, assesses and relays data from the sensor and provides vibratory alerts; and a mobile app that receives data from the transmitter and provides real-time glucose readings, alerts and other data the person''s mobile device.', 'Germantown, MD, United States', 117);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALAB', 'STOCK', 'Astera Labs, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Astera Labs, Inc. is a global semiconductor company. The Company provides semiconductor-based connectivity solutions for cloud and artificial intelligence (AI) infrastructure. It has developed and deployed its Intelligent Connectivity Platform built from the ground up for cloud and AI infrastructure. Its Intelligent Connectivity Platform provides its customers with the ability to deploy and operate high-performance cloud and AI infrastructure at scale, addressing an increasingly diverse set of requirements. It provides its connectivity products in various form factors, including Integrated Circuits (ICs), boards, and modules. Its PCIe, CXL and Ethernet semiconductor-based connectivity solutions are purpose-built to unleash the potential of accelerated computing at cloud-scale. The Companys products include Aries products, which include its COSMOS software suite; Taurus products, which are hardware modules based on its Taurus ICs; Leo products; and Scorpio products.', 'Santa Clara, CA, United States', 440);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATAI', 'STOCK', 'Atai Life Sciences N.V.', 'NGM', 'Healthcare', 'Biotechnology', 'ATAI Life Sciences NV is a clinical-stage biopharmaceutical company. The Company focused on developing treatments for mental health disorders. The Company''s pipeline includes psychedelic and non-psychedelic compounds targeting depression, anxiety, and other unmet needs in psychiatry.', 'Berlin, , Germany', 54);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQNR', 'STOCK', 'Equinor ASA', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'Equinor ASA, anteriormente Statoil ASA é uma empresa internacional de energia com sede na Noruega. O objetivo da Empresa é transformar os recursos naturais em energia. A Equinor vende petróleo bruto e entrega gás natural ao mercado europeu. Também está envolvida em atividades de processamento, refinação, captura e armazenamento de vento e carbono offshore. A Equinor ASA possui cinco segmentos de relatório: Exploração e Produção Noruega (E&P Noruega), Exploração e Produção Internacional (E&P International), Exploração e Produção EUA (E&P EUA), Marketing, Midstream & Processing (MMP) e Renováveis (REN). A Companhia possui diversas subsidiárias, como Equinor Nigeria Energy Company Ltd, Equinor Wind POWER AS, Equinor International Netherlands BV e Equinor Brasil Energia Ltda.', 'Stavanger, , Norway', 24126);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABCL', 'STOCK', 'AbCellera Biologics Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'AbCellera Biologics Inc. discovers and develops antibody medicines for indications across therapeutic areas, including cancer, metabolic and endocrine conditions, and autoimmune disorders. Its platform integrates technology, data science, infrastructure, and interdisciplinary teams to solve the challenging antibody discovery problems. It is focused on advancing an internal pipeline of programs and collaborating on drug development programs with partners. Its first two internal programs, ABCL635 and ABCL575, are in late-preclinical studies. ABCL635 is an antibody drug candidate for metabolic and endocrine conditions, and ABCL575 is an antibody drug candidate with broad potential in inflammatory conditions and autoimmune diseases and an initial indication in atopic dermatitis. ABCL575 binds OX40L to disrupt OX40/OX40L signaling, a regulator of inflammatory pathways in AD. In addition to ABCL635 and ABCL575, it is advancing a pipeline of more than 20 internal discovery programs.', 'Vancouver, BC, Canada', 596);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COMP', 'STOCK', 'Compass, Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'Compass, Inc. provides an end-to-end platform that empowers its residential real estate agents to deliver service to seller and buyer clients. Its platform includes an integrated suite of cloud-based software for customer relationship management, marketing, client service, brokerage services and other critical functionalities, all custom-built for the real estate industry. Its platform also uses proprietary data, analytics, artificial intelligence, and machine learning to simplify the workflows of agents and deliver recommendations and outcomes for both agents and their clients. It also provides integrated services, such as title and escrow and mortgage, both of which are available on its platform. Its Glide tools, which include completion of various real estate forms and offer preparation and eSignature and collaboration capabilities, are offered to non-Compass agents and their clients. Business Tracker provides agents with a centralized view of their entire business.', 'New York, NY, United States', 2566);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CELC', 'STOCK', 'Celcuity Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Celcuity Inc. is a clinical-stage biotechnology company, which develops targeted therapies for the treatment of multiple solid tumor indications. Its lead therapeutic candidate is gedatolisib, a potent, small-molecule reversible inhibitor that selectively targets all Class I isoforms of phosphatidylinositol-3-kinase (PI3K) and the two mechanistic targets of rapamycin (mTOR) sub-complexes, mTORC1 and mTORC2. Its development programs for gedatolisib focus on the treatment of patients with hormone receptor positive (HR+), human epidermal growth factor receptor 2 negative (HER2-), or HR+/HER2-, advanced or metastatic breast cancer and patients with metastatic castration resistant prostate cancer. A Phase III clinical trial of VIKTORIA-1, evaluating gedatolisib in combination with fulvestrant with or without palbociclib in patients with HR+/HER2- advanced breast has commenced. Its CELsignia companion diagnostic platform is able to analyze live patient tumor cells.', 'Minneapolis, MN, United States', 87);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENPH', 'STOCK', 'Enphase Energy, Inc.', 'NGM', 'Technology', 'Solar', 'A Enphase Energy, Inc. É uma empresa global de tecnologia energética. A empresa é um fornecedor de sistemas solares e de baterias baseados em microinversores que permitem às pessoas aproveitar o sol para fazer, usar, economizar e vender sua própria energia e controlar tudo com um aplicativo móvel inteligente. Projeta, desenvolve, fabrica e vende soluções de energia doméstica que gerenciam a geração de energia, o armazenamento de energia, o controle e as comunicações em uma única plataforma inteligente. O Enphase Energy System traz uma abordagem de tecnologia em rede para geração solar e armazenamento de energia, aproveitando sua experiência de design em eletrônica de energia, semicondutores e tecnologias de software baseadas em nuvem. O Sistema Energético Enphase, alimentado por MICROINVRATOES IQ, baterias IQ e outros produtos e serviços, é uma oferta integrada de gestão de energia solar, armazenamento e energia que permite o autoconsumo. A empresa também oferece uma plataforma de soft', 'Fremont, CA, United States', 2781);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYON', 'STOCK', 'Beyond, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Beyond, Inc. is an e-commerce focused affinity company that owns or has ownership interests in various retail brands. The Company owns Bed Bath & Beyond, Overstock, Zulily, and other related brands and websites. Through its Bed Bath & Beyond brand, it provides an extensive array of home-related products. Its product categories include furniture, rugs, bedding, bath, kitchen, decor, outdoor, home improvement, lighting, baby and kids, and others. Through its Overstock brand, the Company provides an array of goods at discounted prices, and a treasure hunt-like experience for its target customers. Its product assortment includes core legacy categories such as indoor and outdoor furniture, apparel and footwear, rugs, decor, lighting, jewelry and watches, sports and entertainment, and others. Zulily''s primary focus is attracting a loyal customer base with flash sales on women''s, kid''s, and men''s apparel, footwear, beauty, and wellness. The Company also owns BuyBuy Baby brand.', 'Murray, UT, United States', 610);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARCC', 'STOCK', 'Ares Capital Corporation', 'NMS', 'Financial Services', 'Asset Management', 'Ares Capital Corporation is a specialty finance company focused on providing direct loans and other investments in private middle market companies in the United States. The Company invests primarily in first lien senior secured loans (including unitranche loans, which are loans that combine both senior and subordinated debt, generally in a first lien position), and second lien senior secured loans. In addition to senior secured loans, it also invests in subordinated debt, which in some cases includes an equity component, and preferred equity. It also may invest up to 30% of its portfolio in non-qualifying assets. Its investment activities are focused on industries, such as software and services, health care services, commercial and professional services, financial services, commercial and professional services, insurance Services, energy, food and beverage and others. Its investment adviser is Ares Capital Management LLC.', 'Los Angeles, CA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DKNG', 'STOCK', 'DraftKings Inc.', 'NMS', 'Consumer Cyclical', 'Gambling', 'A DraftKings Inc. É uma empresa de entretenimento e jogos de esportes digitais. Ele fornece aos usuários apostas esportivas on-line e de varejo (juntos, Sportsbook), cassino online (iGaming) e ofertas diárias de produtos esportivos de fantasia, bem como courier de loteria digital, mídia e outras ofertas de produtos. O Sportsbook é ao vivo com operações de apostas esportivas móveis e / ou varejo de acordo com os regulamentos em 28 estados, Washington, D.C., e em Ontário, Canadá. Opera iGaming de acordo com os regulamentos em cinco estados e em Ontário, Canadá sob sua marca DraftKings e de acordo com regulamentos em quatro estados sob sua marca Golden Nugget Online Gaming. Possui Jackpocket, um aplicativo de correio de loteria digital nos Estados Unidos. É um parceiro oficial de fantasia e apostas esportivas diário da NFL, NHL, PGA TOUR, WNBA e UFC, bem como um parceiro oficial de fantasia diário da NASCAR, um parceiro oficial de apostas esportivas da NBA. Ela também possui e opera o Dra', 'Boston, MA, United States', 5100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLDP', 'STOCK', 'Ballard Power Systems Inc.', 'NGM', 'Industrials', 'Specialty Industrial Machinery', 'Ballard Power Systems Inc. is engaged in the design, development, manufacture, sale and service of proton exchange membrane (PEM) fuel cell products for a variety of applications, focusing on power products for bus, truck, rail, marine, stationary and emerging market (material handling, off-road and other) applications, as well as the delivery of services, including technology solutions, after sales services and training. The Company operates through fuel cell products and services segment. Embedded in each Ballard fuel cell product lies a stack of unit cells designed with its PEM fuel cell technology that includes membrane electrode assemblies, catalysts, plates, and other key components, and draw on intellectual property from its patent portfolio, together with its experience and know-how, in key areas of PEM fuel cell stack design, operation, production processes and systems integration.', 'Burnaby, BC, Canada', 887);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXK', 'STOCK', 'Endeavour Silver Corp.', 'NYQ', 'Basic Materials', 'Silver', 'Endeavour Silver Corp. is a Canada-based mid-tier precious metals company. With operations in Mexico and Peru, and the development of its mine in Jalisco state, Terronera, the Company focuses on contributing to the mining industry and the communities in which it operates. In addition, it has a portfolio of exploration projects in Mexico, Chile and the United States. It has two producing silver-gold mines in Mexico: the Guanacevi Mine in Durango (the Guanacevi Project) and the Bolanitos Mine in Guanajuato (the Bolanitos Project). In addition to operating these two mines, the Company is advancing one development and two exploration projects in Mexico: the Terronera property in Jalisco state (the Terronera Project), the prospective Pitarrilla property in Durango State and the Parral properties in Chihuahua. Kolpa, its third producing mine, is a silver mine located in the Huachocolpa region of Huancavelica Province, Peru. Its other exploration projects include Bruner, Aida, and Lourdes.', 'Vancouver, BC, Canada', 1539);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RDDT', 'STOCK', 'Reddit, Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Reddit, Inc. operates a social platform, Reddit. Reddit is a community of communities. It is built on shared interests, passion, and trust and is home to open and authentic conversations on the Internet. Reddit is a global, digital city where anyone in the world can join a community to learn from one another, engage in authentic conversations, explore passions, research new hobbies, exchange goods and services, create new communities and experiences, share a few laughs, and find belonging. Reddit has thousands of communities, endless conversations, and authentic human connections. Communities on Reddit are organized based on specific interests and are called subreddits. Reddit offers real-time access to evolving and dynamic topics, such as sports, movies, news, fashion, and the latest trends. On Reddit, users can submit, vote, and comment on the topics they care about. It has approximately 100,000+ active communities and approximately 101+ million daily active visitors.', 'San Francisco, CA, United States', 2233);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASAN', 'STOCK', 'Asana, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Asana, Inc. is an enterprise work management software platform. It enables organizations to align work to goals, coordinate cross-functional work, gain visibility into progress, automate workflows across departments, and scale work securely. It offers two products within the Asana platform to meet the needs of diverse organizations. The Asana platform maintains an application programming interface that enables developers to build apps on Asana and integrate with hundreds of third-party applications like Microsoft Teams, Slack, Jira, Salesforce, Google Workspace, Adobe Creative Cloud and many more. Its flagship product, Asana Work Graph, provides a map of how all work gets done inside an organization. It is built for scale and captures the relationship between the work that teams undertake, the information about that work, the people doing the work, and the outcomes of that work. It provides interactive dynamic views list, calendar, board, timeline, goals, portfolio, reports and more.', 'San Francisco, CA, United States', 1819);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GT', 'STOCK', 'The Goodyear Tire & Rubber Company', 'NMS', 'Consumer Cyclical', 'Auto Parts', 'The Goodyear Tire & Rubber Company is a tire company. It develops, manufactures, distributes and sells tires for most applications. It also manufactures and sells rubber-related chemicals for various applications. It also operates commercial truck service and tire retreading centers. It operates approximately 800 retail outlets where it offers its products for sale to consumer and commercial customers and provides repair and other services. It manufactures its products in 53 manufacturing facilities in 20 countries. Its segments represent its regional tire businesses: the Americas, Europe, Middle East and Africa (EMEA), and Asia Pacific. It manufactures and sells numerous lines of rubber tires for automobiles, trucks, buses, aircraft, motorcycles, earthmoving and mining equipment, farm implements, industrial equipment, and various other applications. Its brands include Goodyear, Cooper, Kelly, Mastercraft, Roadmaster, Debica, Sava, Fulda, Mickey Thompson, Avon and Remington brands.', 'Akron, OH, United States', 68000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DPRO', 'STOCK', 'Draganfly Inc.', 'NCM', 'Industrials', 'Aerospace & Defense', 'Draganfly Inc. is a Canada-based company. The Company is a provider of drone solutions, Artificial intelligence (AI) driven software, and robotics. The Company provides solutions for public safety, agriculture, industrial inspections, security, mapping, and surveying. Its products include Apex, Commander 3XL, Heavy Lift Drone, Flex FPV, Commander 3XL Hybrid, Starling X.2, Payloads and Sensors, Draganflyer Commander2, Software, Precision Delivery System, Legacy Products and Projects, and Development Projects. Its services include custom engineering and drone services. Its engineering services include Hardware design, software design, development, modeling, ITAR equipment management, and support. Its drone services include aerial inspections, surveying and terrain mapping, emergency and disaster response, and landmine detection surveys. Its segments include Drones and Corporate. The Drones segment includes products and services related to the sale of unmanned aerial vehicles (UAV).', 'Saskatoon, SK, Canada', 51);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMB', 'STOCK', 'iShares J.P. Morgan USD Emerging Markets Bond ETF', 'NGM', NULL, NULL, 'The fund will invest at least 80% of its assets in the component securities of the underlying index and will invest at least 90% of its assets in fixed income securities of the types included in the underlying index. The index is a broad, diverse U.S. dollar-denominated emerging markets debt benchmark that tracks the total return of actively traded external debt instruments in emerging market countries.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CZR', 'STOCK', 'Caesars Entertainment, Inc.', 'NMS', 'Consumer Cyclical', 'Resorts & Casinos', 'A Caesars Entertainment, Inc. É uma empresa de entretenimento de cassino e um provedor diversificado de jogos e hospitalidade. A empresa opera principalmente sob as marcas Caesars, Harrah''s, Horseshoe e Eldorado. Seus segmentos incluem Las Vegas, Regional, Caesars Digital e Managed and Branded, além de Corporate e outros. Oferece diversas comodidades de jogos, entretenimento e hospitalidade, destinos e um conjunto completo de jogos móveis e online e experiências de apostas esportivas. A Companhia possui, aluga ou gerencia um agregado de 53 propriedades domésticas em 18 estados. Ele também opera e realiza apostas esportivas em 32 jurisdições na América do Norte, 26 das quais oferecem apostas esportivas online, e opera iGaming em cinco jurisdições na América do Norte. Ele opera o aplicativo Caesars Sportsbook, o aplicativo Caesars Racebook, o aplicativo Caesars Palace Online Casino e o novo aplicativo Horseshoe Online Casino. Os seus jogos de casino online incluem slots, jogos de mesa, ', 'Reno, NV, United States', 50000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRML', 'STOCK', 'Critical Metals Corp.', 'NGM', 'Basic Materials', 'Other Industrial Metals & Mining', 'Critical Metals Corp. is an Australia-based mining development company. The Company is focused on mining critical metals and minerals and producing strategic products essential to electrification and technologies for Europe and its partners. Its flagship Project, Tanbreez, consists of rare earth deposits and is located in Southern Greenland. The Wolfsberg Lithium Project is located in Carinthia, over 270 kilometers south of Vienna, Austria. The Wolfsberg Lithium Project is a fully permitted mine in Europe and is strategically located with access to established road and rail infrastructure. With its strategic asset portfolio, the Company supplies critical minerals essential for defense applications, the clean energy transition, and technologies.', 'New York, NY, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALB', 'STOCK', 'Albemarle Corporation', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A Albemarle Corporation está empenhada em transformar recursos essenciais em ingredientes críticos para mobilidade, energia, conetividade e saúde. Os segmentos da empresa incluem Armazenamento de Energia, Especialidades e Ketjen. O segmento de armazenamento de energia desenvolve e fabrica uma gama de compostos básicos de lítio, incluindo carbonato de lítio, hidróxido de lítio e cloreto de lítio. O seu negócio de especialidades otimiza o seu portfólio de soluções de bromo e lítio altamente especializadas. Seu negócio de especialidades atende uma variedade de indústrias, incluindo energia, mobilidade, conetividade e saúde. Os produtos especiais são essenciais tanto em veículos elétricos como de combustão interna, desde cabos de alta tensão e powertrains até airbags e pneus. Seu segmento Ketjen inclui tecnologias de combustíveis limpos (CFT), catalisadores e aditivos de craqueamento catalítico fluidizado (FCC) e soluções de catalisador de desempenho (PCS). Atende vários mercados, como arm', 'Charlotte, NC, United States', 8300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESPR', 'STOCK', 'Esperion Therapeutics, Inc.', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Esperion Therapeutics, Inc. is a commercial stage biopharmaceutical company. The Company is focused on developing and commercializing oral, once-daily, non-statin medicines for patients who are at risk for cardiovascular disease (CVD) and are struggling with elevated low-density lipoprotein cholesterol (LDL-C). Its products include NEXLETOL, NEXLIZET, NILEMDO and NUSTENDI. Its NEXLETOL and NEXLIZET (bempedoic acid and ezetimibe) tablets are oral, once-daily, non-statin medicines to lower the risk of myocardial infarction and coronary revascularization in adults with primary hyperlipidemia. Its NEXLETOL is an ATP Citrate Lyase (ACLY), inhibitor that lowers LDL-C and cardiovascular risk by reducing cholesterol biosynthesis and up-regulating the LDL receptors. Its NUSTENDI contains bempedoic acid and ezetimibe and lowers elevated LDL-C through complementary mechanisms of action by inhibiting cholesterol synthesis in the liver and absorption in the intestine.', 'Ann Arbor, MI, United States', 304);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAX', 'STOCK', 'Baxter International Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Baxter International Inc. É uma empresa global de medtech. Seus segmentos incluem Produtos e Terapias Médicos, Sistemas e Tecnologias de Saúde e Farmacêuticos. O segmento de Produtos e Terapias Médicos inclui a venda de suas soluções estéreis IV, sistemas de infusão, conjuntos de administração, terapias de nutrição parenteral e hemostato cirúrgico, selante e produtos de prevenção de adesão. O segmento de Sistemas e Tecnologias de Saúde inclui as vendas de suas soluções de cuidados conetados e ferramentas de colaboração, incluindo sistemas de cama inteligente, sistemas de monitoramento de pacientes e tecnologias de diagnóstico, dispositivos de saúde respiratória e equipamentos avançados para o espaço cirúrgico, incluindo tecnologias de integração de sala de operação, dispositivos de posicionamento de precisão e outros acessórios. O segmento Pharmaceuticals inclui vendas de especialidades farmacêuticas injetáveis, anestesia inalada e composição de medicamentos. Fornece um portfólio de pr', 'Deerfield, IL, United States', 38000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPD', 'STOCK', 'Enterprise Products Partners L.P.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Enterprise Products Partners L.P. provides midstream energy services to producers and consumers of natural gas, natural gas liquids (NGLs), crude oil, petrochemicals, and refined products. It operates in four segments: NGL Pipelines & Services, Crude Oil Pipelines & Services, Natural Gas Pipelines & Services, and Petrochemical & Refined Products Services. The NGL Pipelines & Services segment offers natural gas processing and related NGL marketing activities. This segment operates natural gas processing facilities located in Colorado, Louisiana, Mississippi, New Mexico, Texas, and Wyoming; NGL pipelines; NGL fractionation facilities; NGL and related product storage facilities; and NGL marine terminals. The Crude Oil Pipelines & Services segment operates crude oil pipelines; and crude oil storage and marine terminals, which include a fleet of approximately 225 tractor-trailer tank trucks that are used to transport crude oil. It also engages in crude oil marketing activities. The Natural ', 'Houston, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTU', 'STOCK', 'Peabody Energy Corporation', 'NYQ', 'Energy', 'Thermal Coal', 'Peabody Energy Corporation is a coal producer, providing essential products for the production of reliable energy and steel. The Company owns interests in coal mining operations located in the United States and Australia, including interests in Middlemount Coal Pty Ltd. The Company engages in the direct and brokered trading of coal and freight-related contracts. Its segments include Seaborne Thermal, Seaborne Metallurgical, Powder River Basin, Other U.S. Thermal, and Corporate and Other. The Seaborne Thermal operations consist of mines in New South Wales, Australia. The mines in that segment utilize both surface and underground extraction processes to mine low-sulfur, high Btu thermal coal. The Seaborne Metallurgical operations consist of mines in Queensland, Australia, one in New South Wales, Australia and one in Alabama, the United States. The Company owns the southern portion of the Wards Well tenement.', 'Saint Louis, MO, United States', 5600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTCS', 'STOCK', 'BTCS Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'BTCS Inc. is blockchain technology company focused on advancing blockchain infrastructure. The Company operates a network of cloud-based validator nodes that perform essential roles in PoS and dPoS blockchain ecosystems. The Companys primary activities include Ethereum block-building (Builder+) and validator node operations (NodeOps) across PoS and dPoS networks. The Company primarily earn crypto assets through the operation of its non-custodial validator nodes, with the intention of enhancing the production of crypto assets in various blockchain networks. Builder+ is comprised of an advanced block-building operations that leverages advanced algorithms to drive scalable revenue by optimizing the structure and composition of transactions in on-chain blocks. The Company has developed ChainQ, an AI-powered blockchain data and analytics platform designed to increase transparency and accessibility in the blockchain ecosystem.', 'Silver Spring, MD, United States', 7);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTRA', 'STOCK', 'Coterra Energy Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'A Coterra Energy Inc. É uma empresa de exploração e produção com sede em Houston, Texas, com operações focadas na Bacia Permiana, no xisto Marcellus e na Bacia Anadarko. A empresa está envolvida no desenvolvimento, exploração e produção de petróleo, gás natural e líquidos de gás natural exclusivamente dentro dos Estados Unidos continental. Sua operação da bacia do Permiano consiste em aproximadamente 345 000 acres líquidos. Suas atividades de desenvolvimento estão focadas principalmente no xisto Wolfcamp e na formação de primavera óssea em Culberson e Counties Reeves no Texas e Condados Lea e Eddy no Novo México. Sua operação de xisto Marcellus inclui propriedades que estão localizadas principalmente no Condado de Susquehanna, Pensilvânia, onde possui aproximadamente 186 000 acres líquidos na janela de gás seco do xisto de Marcellus. Sua operação Anadarko Basin detém cerca de 182 000 acres líquidos que estão localizados em Oklahoma. Suas atividades de desenvolvimento estão focadas prin', 'Houston, TX, United States', 915);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYBR', 'STOCK', 'CyberArk Software Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'CyberArk Software Ltd is an Israel-based provider of information technology (IT) security solutions that protect organizations from cyber-attacks. The Company''s software solutions are focused on protecting privileged accounts, which have become a critical target in the lifecycle of cyber-attacks. The Company''s Privileged Account Security Solution consists of various products, such as Shares Technology Platform, Enterprise Password Vault, SSH Key Manager, Privileged Session Manager, Privileged Threat Analytics, Application Identity Manager, CyberArk-Conjur, Endpoint Privilege Manager and On-Demand Privileges Manager. The Company''s products protect against external and internal cyber threats and enable detection and neutralization of attacks. The Company''s Enterprise Password Vault provides customers with a tool to manage and protect all privileged accounts across an entire organization, including physical, virtual, or cloud-based assets.', 'Petah Tikva, , Israel', 3793);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAPU', 'STOCK', 'Direxion Daily AAPL Bull 2X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of its net assets (plus any borrowings for investment purposes) in the securities of AAPL and financial instruments, such as swap agreements and options, that, in combination, provide 2X daily leveraged exposure to AAPL, consistent with the fund’s investment objective. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLS', 'STOCK', 'Apellis Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Apellis Pharmaceuticals, Inc. is a commercial-stage biopharmaceutical company. The Company is focused on the discovery, development and commercialization of novel therapeutic compounds to treat diseases with high unmet needs through the inhibition of the complement system. SYFOVRE (pegcetacoplan injection) is the Companys approved treatment for geographic atrophy secondary to age-related macular degeneration (GA). Its EMPAVELI (pegcetacoplan) is for the treatment of paroxysmal nocturnal hemoglobinuria (PNH). Its Aspaveli (pegcetacoplan) for the treatment of adults with PNH who are anemic after treatment with a C5 inhibitor for at least three months. Systemic pegcetacoplan has also been approved for the treatment of PNH in Japan, Saudi Arabia, Australia, the United Kingdom and other jurisdictions. Systemic pegcetacoplan is marketed under the trade name EMPAVELI in the United States, Saudi Arabia and Australia and Aspaveli in the European Union, Japan and the United Kingdom.', 'Waltham, MA, United States', 705);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABBV', 'STOCK', 'AbbVie Inc.', 'NYQ', 'Healthcare', 'Drug Manufacturers - General', 'A AbbVie Inc. É uma empresa biofarmacêutica global e diversificada baseada em pesquisa. A empresa está envolvida em pesquisa e desenvolvimento, fabricação, comercialização e venda de medicamentos e terapias. O seu portfólio de produtos inclui Imunologia, Oncologia, Estética, Neurociência, Cuidados com os Olhos e outros produtos-chave. Seus produtos de Imunologia incluem reumatologia, dermatologia e gastroenterologia. Seus produtos de oncologia incluem Imbruvica, Venclexta/Venclyxto, Elahere e Epkinly. O portfólio de estética da empresa consiste em injetáveis faciais, plásticos e medicina regenerativa, contorno corporal e produtos para a pele. Seus produtos de Neurociência incluem Botox Therapeutic, Vraylar, Duopa e Duodopa, Ubrelvy e Qulipta. Os seus produtos para cuidados com os olhos incluem Ozurdex, Lumigan/Ganfort, Alphagan/Combigan, Restasis e outros cuidados oculares. Seus outros produtos-chave incluem Mavyret/Maviret, Creon e Linzess/Constella. O seu Venclexta é um inibidor do l', 'North Chicago, IL, United States', 55000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OXLC', 'STOCK', 'Oxford Lane Capital Corp.', 'NGM', 'Financial Services', 'Asset Management', 'Oxford Lane Capital Corp. (the Fund) is a closed-end management investment company. The Funds investment objective is to maximize its portfolios risk-adjusted total return. The Fund seeks to achieve its investment objective by investing in structured finance investments, specifically the equity and junior debt tranches of collateralized loan obligation (CLO) vehicles, which are collateralized primarily by a diverse portfolio of senior secured loans made to companies whose debt is unrated or is rated below investment grade (the Senior Loans) and, to a limited extent, subordinated and/or unsecured loans and bonds (CLO Assets). Below investment grade securities, such as the CLO securities in which the Fund primarily intends to invest, are often referred to as junk. The Funds investment activities are managed by Oxford Lane Management, LLC (Oxford Lane Management), which is its investment adviser.', 'Greenwich, CT, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GILD', 'STOCK', 'Gilead Sciences, Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - General', 'A Gilead Sciences, Inc. É uma empresa biofarmacêutica. A empresa está envolvida no avanço de medicamentos para prevenir e tratar doenças que ameaçam a vida, incluindo o vírus da imunodeficiência humana (HIV), hepatite viral, COVID-19, câncer e inflamação. Está focada na descoberta, desenvolvimento e entrega de medicamentos para atender às necessidades médicas não atendidas em virologia, oncologia e outras áreas terapêuticas. Seu portfólio de produtos comercializados inclui Biktarvy, Genvoya, Descovy, Complera/Eviplera, Symtuza, Truvada, Stribild, Sunlenca, Epclusa, Vemlidy, Harvoni, Viread, Livdelzi, Viklury, Yescarta, Tecartus, Trodelvy, AmBisoma e Letairis. Os seus candidatos a produtos incluem Bulevrtide, Lenacapavir, Axicabtagene ciloleucel, Anitocabtagene autoleucel, Sacituzumab govitecan-hziy, e Domvanalimab e zimberelimab. Biktarvy é uma formulação oral dosado uma vez por dia para o tratamento da infeção pelo HIV-1 em certos pacientes. Opera em mais de 35 países em todo o mundo.', 'Foster City, CA, United States', 17600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASPI', 'STOCK', 'ASP Isotopes Inc.', 'NCM', 'Basic Materials', 'Chemicals', 'ASP Isotopes Inc. is a development stage advanced materials company. The Company is engaged in the development of technology and processes to produce isotopes for use in multiple industries. The Company employs proprietary technology, the Aerodynamic Separation Process (ASP technology). Its initial focus is on producing and commercializing highly enriched isotopes for the healthcare and technology industries. Its Nuclear Fuels segment is focused on research and development of technologies and methods used to produce high-assay low-enriched uranium (HALEU) and Lithium-6 for the advanced nuclear fuels target end market. Its Specialist Isotopes and Related Services segment is focused on research and development of technologies and methods used to separate high-value, low-volume isotopes (such as C-14, Mo-100, and Si-28) for highly specialized target end markets other than advanced nuclear fuels, including pharmaceuticals and agrochemicals, nuclear medical imaging, and others.', 'Washington, DC, United States', 136);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('B', 'STOCK', 'Barrick Mining Corporation', 'NYQ', 'Basic Materials', 'Gold', 'A BARRICK MINING CORPORATION é uma produtora de ouro e cobre sediada no Canadá, que está envolvida na produção e venda de ouro e cobre, bem como atividades relacionadas, como exploração e desenvolvimento de minas. Tem interesses de propriedade na produção de minas de ouro que estão localizadas na Argentina, Canadá, Costa do Marfim, República Democrática do Congo, República Dominicana, Mali, Tanzânia e Estados Unidos. Tem interesses de propriedade na produção de minas de cobre no Chile, Arábia Saudita e Zâmbia. Suas operações incluem minas de ouro de Nevada, Bulyanhulu, Hemlo, Jabal Sayid, Kibali, Loulo-Gounkoto, Lumwana, North Mara, Porgera, Pueblo Viejo, Tongon, Veladero e Zaldivar. Sua operação Bulyanhulu está localizada no noroeste da Tanzânia, aproximadamente 55 quilômetros (km) ao sul do Lago Victoria e 150 km a sudoeste da cidade de Mwanza. A operação Hemlo está localizada ao norte do Lago Superior na Rodovia Trans-Canadá, a aproximadamente 35 km a leste de Maratona, Ontário, e é', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BURU', 'STOCK', 'Nuburu, Inc.', 'ASE', 'Industrials', 'Specialty Industrial Machinery', 'NUBURU, Inc. is a developer and manufacturer of industrial blue laser technology. The Company is an innovator in high-power, high-brightness blue laser technology that is focused on bringing improvements to a broad range of high-value applications, including welding and three-dimensional (3D) printing. It provides blue laser systems for welding applications, such as batteries, large screen displays, and cell phone components. Its products include NUBURU BL Series, NUBURU BL-F Series and NUBURU BL-250 With Scanner. NUBURU BL series includes industrial blue lasers that deliver a free-space beam, and are available with output powers of up to 250 W. The fiber-delivered NUBURU BL-F Series extends output powers up to 1 kW. It provides manufacturers with blue lasers for welding, cutting, stripping coatings and 3D printing. The Company offers its products in energy storage, aerospace, e-mobility, defense-tech, security, operational resilience solutions, and other sectors.', 'Centennial, CO, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXGN', 'STOCK', 'Axogen, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Axogen, Inc. is focused on the science, development, and commercialization of technologies for peripheral nerve regeneration and repair. It offers repair solutions for surgeons and healthcare providers. Its portfolio of products includes Avance Nerve Graft, Axoguard Nerve Connector, Axoguard Nerve Protector, Axoguard HA+ Nerve Protector, Axoguard Nerve Cap, and Avive+ Soft Tissue Matrix. Avance Nerve Graft is a biologically active off-the-shelf processed human nerve allograft for bridging severed peripheral nerves. The Axoguard Nerve Connector is a porcine (pig) submucosa extracellular matrix (ECM) coaptation aid for tensionless repair of severed peripheral nerves. Axoguard Nerve Protector is a porcine submucosa ECM product used to wrap and protect damaged peripheral nerves and reinforce the nerve reconstruction while preventing soft tissue attachments. Axoguard HA+ Nerve Protector consists of a processed porcine submucosa ECM base layer with a hyaluronate-alginate gel coating.', 'Alachua, FL, United States', 451);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEFT', 'STOCK', 'DeFi Technologies Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'DeFi Technologies Inc. is a financial technology company that pioneers the convergence of traditional capital markets with decentralized finance (DeFi). The Companys business lines include Asset Management, DeFi Alpha, Stillman Digital, DeFi Ventures, and Reflexivity Research LLC. In the asset management business, the Company, through its subsidiaries, Valour Inc. and Valour Digital Securities Limited) is developing Exchange Traded Products (ETPs) that synthetically track the value of a single DeFi protocol or a basket of protocols. Defi Alpha, a specialized arbitrage trading desk with the focus is to identify low-risk arbitrage opportunities within the crypto ecosystem. Stillman Digital is a digital asset liquidity provider that offers liquidity solutions for businesses, focusing on industry-leading trade execution, settlement and technology. The Companys Research Reflexivity LLC line of business specializes in producing cutting-edge research reports for the cryptocurrency industry.', 'Toronto, ON, Canada', 9);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTM', 'STOCK', 'Castellum, Inc.', 'ASE', 'Technology', 'Information Technology Services', 'Castellum, Inc. is a technology company in the areas of cybersecurity, information technology (IT), electronic warfare, information warfare, and information operations with businesses in the defense, federal, civilian, and commercial markets. The Companys services include intelligence analysis, software development, software engineering, program management, strategic and mission planning, information assurance, cybersecurity and policy support, data analytics, and model based systems engineering (MBSE). These services focus on securing data and establishing related policies, and are applicable to customers in the federal government, financial services, healthcare, and other users of large data applications. It specializes in planning and intelligence support for information warfare and information operations (IW/IO). The Company develops IW/IO plans, exercises, doctrine, and training for the Military Services and the Combatant Commands in domestic and deployed overseas locations.', 'Vienna, VA, United States', 238);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COUR', 'STOCK', 'Coursera, Inc.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'O Coursera, Inc. Fornece uma plataforma de aprendizagem online que coneta alunos, educadores e instituições, fornecendo conteúdo educacional acessível e relevante. Os segmentos da empresa incluem Consumer, Enterprise e Degrees. A empresa fornece uma gama de conteúdo de aprendizagem e credenciais, incluindo clipes, Projetos Guiados, Especializações, cursos, e certificados que podem construir para um curso mais amplo de estudo, como um diploma ou diploma de pós-graduação. Suas ofertas incluem Coursera.org para indivíduos, Coursera para empresas, Coursera para negócios, Coursera para campus e Coursera para governo. Ele oferece um portfólio de certificados profissionais de nível básico do Google, IBM, Intuit, Meta, Microsoft, e a Salesforce que ajudam a desenvolver as habilidades necessárias para conseguir empregos digitais de nível básico em tecnologia da informação, segurança cibernética, ciência de dados, marketing, vendas, design e engenharia de software e desenvolvimento sem exigir um', 'Mountain View, CA, United States', 1260);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FLG', 'STOCK', 'Flagstar Financial, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Flagstar Financial, Inc. is the parent company of Flagstar Bank, N.A. (the Bank), one of the regional banks in the country. Flagstar Bank, N.A. operates over 418 branches, including a significant presence in the Northeast and Midwest and locations in high growth markets in the Southeast and West Coast. In addition, the Bank has approximately 80 private banking teams located in over 10 cities in the metropolitan New York City region and on the West Coast, which serve the needs of high-net worth individuals and their businesses. The Bank''s service offerings include treasury management, banking services, business loans, asset-based lending, checking account, savings, home equity line of credit, residential lending, personal private banking, credit cards, home loans, home equity, investment services and online treasury services with Flagstar Corporate Connect, among others.', 'Hicksville, NY, United States', 6993);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLSD', 'STOCK', 'Clearside Biomedical, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Clearside Biomedical, Inc. is a biopharmaceutical company focused on the delivery of therapies to the back of the eye through the suprachoroidal space (SCS). The Company''s SCS injection platform, utilizing its patented SCS Microinjector, enables an in-office, repeatable, non-surgical procedure for the targeted and compartmentalized delivery of a variety of therapies to the macula, retina, or choroid to potentially preserve and improve vision in patients with sight-threatening eye diseases. The Company is developing its own pipeline of small molecule product candidates for administration via its SCS Microinjector. The Company''s lead program, CLS-AX (axitinib injectable suspension), for the treatment of neovascular age-related macular degeneration (wet AMD). It developed and gained approval for its product, XIPERE (triamcinolone acetonide injectable suspension) for suprachoroidal use, which is available in the United States through a commercial partner.', 'Alpharetta, GA, United States', 32);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVN', 'STOCK', 'Devon Energy Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'A Devon Energy Corporation é uma produtora de petróleo e gás nos Estados Unidos, com um portfólio diversificado de várias bacias, encabeçado por uma posição de acreage na Delaware Basin. A empresa está envolvida principalmente na exploração, desenvolvimento e produção de petróleo, gás natural e líquidos de gás natural (NGL). Possui um portfólio de ativos localizados na Bacia de Delaware, Rockies, Eagle Ford e Anadarko Basin. A Bacia de Delaware opera no sudeste do Novo México e através da linha do estado até o oeste do Texas. Oferece oportunidades de exploração e desenvolvimento de muitos reservatórios geológicos e tipos de jogo, incluindo as formações ricas em petróleo Wolfcamp, Bone Spring, Avalon e Delaware. Seu desenvolvimento das Montanhas Rochosas consiste em seus ativos de Williston Basin e Powder River Basin. As operações da Eagle Ford estão localizadas nos condados de DeWitt e Karnes, Texas. O desenvolvimento da Bacia Anadarko está localizado no oeste de Oklahoma. Tem uma join', 'Oklahoma City, OK, United States', 2300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEVS', 'STOCK', 'DevvStream Corp.', 'NCM', 'Industrials', 'Pollution & Treatment Controls', 'DevvStream Corp is a carbon credit project co-development and generation company, which specializes in technology-based solutions. The Company operates across three strategic domains: an offset portfolio consisting of nature-based, tech-based, and carbon sequestration credits for immediate sale to corporations and governments seeking to offset their difficult-to-reduce emissions; project investment, acquisitions, and industry consolidation to extend the Company''s reach, allowing it to become a full end-to-end solutions provider, and project development, where the Company serves as project manager for activities such as electric vehicles charging in exchange for a percentage of generated credits. Its end-to-end proprietary solution removes risk and complexity from every step, allowing organizations to move from project ideation to credit monetization. The Company also provides carbon credits for purchases.', 'Vancouver, BC, Canada', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRDO', 'STOCK', 'Credo Technology Group Holding Ltd', 'NMS', 'Technology', 'Semiconductors', 'Credo Technology Group Holding Ltd is a Cayman Islands-based holding company. The Company delivers high-speed solutions to break bandwidth barriers on every wired connection in the data infrastructure market. It provides high-speed connectivity solutions that deliver improved power efficiency as data rates and corresponding bandwidth requirements increase exponentially throughout the data infrastructure market. Its connectivity solutions are optimized for optical and electrical Ethernet applications, including the emerging 100 gigabits per second (G), 200G, 400G, 800G and the emerging 1.6 terabits per second (T) port markets. Its products are based on its Serializer/Deserializer (SerDes) and Digital Signal Processor (DSP) technologies. Its product families include integrated circuits (ICs) for the optical and line card markets, active electrical cables (AECs) and SerDes Chiplets. The Companys intellectual property (IP) solutions consist primarily of SerDes IP licensing.', 'Grand Cayman, , Cayman Islands', 622);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTAI', 'STOCK', 'BioXcel Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'BioXcel Therapeutics, Inc. is a biopharmaceutical company utilizing artificial intelligence to develop medicines in neuroscience. Its subsidiary, OnkosXcel Therapeutics LLC, is focused on the development of medicines in immuno-oncology. Its advanced neuroscience candidate, BXCL501, is an investigational, orally dissolving film formulation of dexmedetomidine in development for the treatment of agitation associated with psychiatric and neurological disorders. It is continuing to develop BXCL501 for the potential acute treatment of agitation associated with bipolar disorder or schizophrenia in the at-home setting and for the potential acute treatment of agitation (non-daily) associated with dementia due to probable Alzheimers disease in the at-home setting and in care facilities. Its advanced immuno-oncology candidate, BXCL701, is an investigational oral innate immune activator for the treatment of aggressive forms of prostate cancer, pancreatic cancer, and other solid and liquid tumors.', 'New Haven, CT, United States', 37);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRM', 'STOCK', 'Salesforce, Inc.', 'NYQ', 'Technology', 'Software - Application', 'A Salesforce, Inc. É uma fornecedora de tecnologia de gerenciamento de relacionamento com o cliente (CRM). A empresa ajuda organizações de qualquer porte a reimaginar seus negócios para o mundo da inteligência artificial (IA). Com a Agentforce, sua plataforma, as organizações podem reunir humanos com agentes para impulsionar o sucesso do cliente com inteligência artificial, dados e ação. Com a plataforma Salesforce, a empresa oferece uma única fonte de verdade, conetando dados de clientes com IA integrada em sistemas, aplicativos e dispositivos para ajudar as empresas a vender, atender, comercializar e conduzir o comércio de qualquer lugar. Agentforce é uma nova camada da plataforma Salesforce que permite que as empresas criem e implantem agentes de IA que podem responder a entradas, tomar decisões e agir de forma autônoma em todas as funções de negócios. Agentforce inclui um conjunto de agentes personalizáveis para uso em vendas, serviços, marketing e comércio. AgentExchange é o merca', 'San Francisco, CA, United States', 76453);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLOV', 'STOCK', 'Clover Health Investments, Corp.', 'NMS', 'Healthcare', 'Healthcare Plans', 'A Clover Health Investments, Corp. É uma empresa de tecnologia de capacitação médica. A empresa está focada em trazer acesso aos cuidados de saúde para todos na Medicare. Isso inclui um foco baseado em equidade na saúde em idosos, que historicamente não têm acesso a cuidados de saúde acessíveis. Ele oferece uma plataforma de software, o Clover Assistant, que é projetado para agregar dados de pacientes de todo o ecossistema de saúde para apoiar a tomada de decisões clínicas e melhorar os resultados de saúde através da identificação precoce e gerenciamento de doenças crônicas. A Companhia, através do seu segmento de Seguros, oferece planos de Organização Preferencial de Prestadores (PPO) e Organização de Manutenção de Saúde (HMO) para membros da Medicare Advantage (MA) em vários estados, com foco diferenciado em seus principais planos de PPO de ampla rede e de alta escolha. Para os prestadores de cuidados de saúde fora do seu plano de mestrado, a empresa se concentra em estender os benef', 'Wilmington, DE, United States', 570);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CELH', 'STOCK', 'Celsius Holdings, Inc.', 'NCM', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'Celsius Holdings, Inc. is engaged in the development, processing, marketing, sale, and distribution of functional energy drinks to a range of consumers. The Company''s flagship asset, CELSIUS, is marketed as a lifestyle and energy drink. This product line comes in two versions: a ready-to-drink form and an on-the-go powder form. It also offers a new CELSIUS Essentials line, available in 16-ounce cans and a Hydration line of zero-sugar powders that are infused with electrolytes and are available in a variety of fruit-forward flavors. Celsius products are offered in retail channels across the United States, including conventional grocery, natural, convenience, fitness, mass market, vitamin specialty and e-commerce platforms. Its product''s formulation includes ingredients and supplements such as green tea (EGCG), ginger (from the root), calcium, chromium, B vitamins and vitamin C. The Company''s product portfolio also includes the health and wellness brand Alani Nu.', 'Boca Raton, FL, United States', 1073);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WMB', 'STOCK', 'The Williams Companies, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'A Williams Companies, Inc. É uma empresa de energia. Seus segmentos incluem serviços de marketing Transmission & Gulf of America, Northeast G&P, West e Gás & NGL. O segmento Transmission & Gulf of America compreende os gasodutos interestaduais Transco, NWP e MountainWest, e suas instalações de armazenamento de gás natural relacionadas, bem como coleta e processamento de gás natural e movimentação de produção de petróleo bruto e ativos de transporte na região da Costa do Golfo. A Northeast G&P compreende negócios de coleta, processamento e fracionamento de midstream na região de xisto de Marcellus. O segmento Oeste compreende operações de coleta, processamento e tratamento de gás na região das Montanhas Rochosas do Colorado e Wyoming, na região de xisto de Barnet do centro norte do Texas, e na região de xisto Eagle Ford do sul do Texas, entre outros. O segmento de Serviços de Marketing Gás & NGL inclui operações de comercialização e comercialização de gás natural (NGL) e gás natural.', 'Tulsa, OK, United States', 5829);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VLY', 'STOCK', 'Valley National Bancorp', 'NMS', 'Financial Services', 'Banks - Regional', 'Valley National Bancorp é uma holding bancária e uma holding financeira. A principal subsidiária da Companhia é o Valley National Bank. Seus segmentos incluem Consumer Banking, Commercial Banking e Tesouraria e Corporate Other. O Consumer Banking é composto por hipotecas residenciais e empréstimos de automóveis, e em menor medida, linhas pessoais garantidas de crédito, empréstimos de capital próprio e outros empréstimos ao consumidor. O Consumer Banking também inclui a divisão de serviços de gestão de patrimônio e seguros, composta por consultoria de gestão de ativos, corretagem, confiança, seguro pessoal e título, serviços de consultoria de crédito fiscal e negócios bancários privados internacionais e domésticos. O Banco Comercial compreende taxas flutuantes e taxas ajustáveis empréstimos comerciais e industriais e empréstimos de construção, e empréstimos imobiliários comerciais e comerciais, com taxas fixas e ajustáveis. Também oferece serviços financeiros de nicho, incluindo produto', 'Morristown, NJ, United States', 3732);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AR', 'STOCK', 'Antero Resources Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Antero Resources Corporation is an independent natural gas and natural gas liquids (NGLs) company. The Company is engaged in the acquisition, development and production of unconventional properties located in the Appalachian Basin in West Virginia and Ohio. The Companys segments include the exploration, development and production of natural gas, NGLs and oil; marketing of excess firm transportation capacity, and midstream services through its equity method investment in Antero Midstream. The Company targets large, repeatable resource plays where horizontal drilling and advanced fracture stimulation technologies provide the means to economically develop and produce natural gas, NGLs and oil from unconventional formations. The Company holds approximately 521,000 net acres of natural gas, NGLs and oil properties located in the Appalachian Basin primarily in West Virginia and Ohio.', 'Denver, CO, United States', 616);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCO', 'STOCK', 'Clear Channel Outdoor Holdings, Inc.', 'NYQ', 'Communication Services', 'Advertising Agencies', 'Clear Channel Outdoor Holdings, Inc. operates in the out-of-home advertising industry. The Company''s dynamic advertising platform is broadening the pool of advertisers using its medium through the expansion of digital billboards and displays and the integration of data analytics and programmatic capabilities that deliver measurable campaigns that are simpler to buy. The Company is a provider of out-of-home advertising solutions, offering advertisers opportunities to reach mass audiences across a variety of high-traffic public spaces. Clear Channel Outdoor RADAR, is its data-driven solution for planning, measuring and amplifying the impact of out-of-home advertising. Its segments include America and Airports. The America segment consists of its United States operations excluding airports. The America segment includes roadside billboard displays. The Airports segment includes the operations of the United States and Caribbean airports.', 'San Antonio, TX, United States', 4100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFLT', 'STOCK', 'Confluent, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Confluent, Inc. provides a data streaming platform that enables customers to connect their applications, systems, and data layers and can be deployed as a fully-managed cloud-native software-as-a-service (SaaS) offering, Confluent Cloud, as a self-managed software offering, Confluent Platform, or as a Bring Your Own Cloud (BYOC) managed service offering where the raw data resides inside a customers own cloud environment, WarpStream. The Company also offers professional services and educational services. The Company is focused on developing a category of data infrastructure focused on data in motion for developers and enterprises. Its cloud-native offering works across multi-cloud and hybrid infrastructures and supports a variety of deployment models to support diverse customer requirements, delivering massive scalability, elasticity, security, and global interconnectedness, enabling agile development. WarpStream offers a lower-cost option for relaxed latency use cases for customers.', 'Mountain View, CA, United States', 3060);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COMM', 'STOCK', 'CommScope Holding Company, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'CommScope Holding Company, Inc. is a global provider of infrastructure solutions for communication, data center and entertainment networks. Its solutions for wired and wireless networks enable service providers to deliver media, voice, IP data services and Wi-Fi to their subscribers and allow enterprises to experience constant wireless and wired connectivity across complex and varied networking environments. Its segments include Connectivity and Cable Solutions (CCS), Networking, Intelligent Cellular and Security Solutions (NICS), and Access Network Solutions (ANS). CCS segment provides fiber optic and copper connectivity and cable solutions for use in telecommunications, cable television, residential broadband networks, data centers and others. NICS segment provides wireless networks for enterprises and service providers. ANS segments product solutions include cable modem termination systems (CMTS), video infrastructure, distribution and transmission equipment and cloud solutions.', 'Claremont, NC, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEKE', 'STOCK', 'KE Holdings Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'KE Holdings Inc is a holding company mainly engaged in housing transactions and related services. The Company operates in four segments. The Existing Home Transaction Services segment mainly provides agency services to sales or leases of existing homes, and platform and franchise services to brokerage firms on Beike platform, as well as other transaction services. The New Home Transaction Services segment mainly provides new home transaction and agency services to real estate developers. The Home Renovation and Furnishing segment provides a one-stop solution to give housing customers access to a comprehensive range of home renovation and furnishing, ranging from interior design, renovation, re-modeling, furnishing, supplies, to after-sales maintenance and repair. The Emerging and Other Services segment is engaged in rental property management service business, financial service business and others.', 'Beijing, , China', 135072);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDIT', 'STOCK', 'Editas Medicine, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Editas Medicine, Inc. is a genome-editing company developing potentially transformative genomic medicines to treat a broad range of serious diseases. It has developed a proprietary gene editing platform based on CRISPR technology that includes CRISPR/Cas9, CRISPR/Cas12a, engineered forms and foundational intellectual property for both CRISPR systems. CRISPR uses a protein-RNA complex composed of an enzyme, including either Cas9 (CRISPR-associated protein 9) or Cas12a (CRISPR from Prevotella and Francisella 1, also known as Cpf1), bound to a guide RNA molecule designed to recognize a particular DNA sequence. It is engaged in discovering, developing, manufacturing, and commercializing durable, precision in vivo gene-editing medicines for a broad class of diseases. Vivo medicines include vivo editing of hematopoietic stem cells (HSCs), liver cells and other tissues. Vivo gene editing in HSCs supports the advancement of research programs to treat non-malignant hematological diseases.', 'Cambridge, MA, United States', 246);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAL', 'STOCK', 'Delta Air Lines, Inc.', 'NYQ', 'Industrials', 'Airlines', 'A Delta Air Lines, Inc. Fornece transporte aéreo regular para passageiros e cargas em todos os Estados Unidos e em todo o mundo. A empresa tem hubs e mercados em Amsterdã, Atlanta, Bogotá, Boston, Detroit, Lima, London-Heathrow, Los Angeles, Cidade do México, Minneapolis-St. Paulo, New York-JFK and LaGuardia, Paris-Charles de Gaulle, Salt Lake City, Santiago (Chile), São Paulo, Seattle, Seul-Incheon, e Tóquio. Seus segmentos incluem Companhia Aérea e Refinaria. Seu segmento de companhias aéreas é gerenciado como uma única unidade de negócios que fornece transporte aéreo regular para passageiros e cargas em todo os Estados Unidos e em todo o mundo e inclui seu programa de fidelidade, bem como outros negócios auxiliares. Seu segmento de refinaria opera para o benefício do segmento de companhias aéreas, fornecendo combustível a jato para o segmento de companhias aéreas a partir de sua própria produção e por meio de combustível a jato obtido por meio de acordos com terceiros. A produção da', 'Atlanta, GA, United States', 103000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDNS', 'STOCK', 'Cadence Design Systems, Inc.', 'NMS', 'Technology', 'Software - Application', 'Cadence Design Systems, Inc. É uma empresa de design de sistemas eletrônicos. A Empresa aplica sua estratégia de Design Inteligente de Sistemas para entregar software, hardware e propriedade intelectual (IP) que transformam conceitos de design em realidade. Suas categorias de produtos incluem Core Electronic Design Automation (EDA), Semicondutor IP e System Design and Analysis (SD&A). O EDA do núcleo inclui software, hardware e serviços usados para projetar e verificar uma grande variedade de semicondutores. O portfólio de semicondutores IP inclui subsistemas de silício, software e serviços que são usados no projeto de semicondutores. A categoria SD&A inclui o software e os serviços utilizados para projetar e verificar uma grande variedade de sistemas eletrónicos físicos. Seus semicondutores são usados em vários setores, incluindo automotivo, aeroespacial, biotecnologia, hiperescala e computação em nuvem, data centers, telecomunicações, tecnologia médica, Internet das Coisas industrial', 'San Jose, CA, United States', 13152);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRSP', 'STOCK', 'CRISPR Therapeutics AG', 'NGM', 'Healthcare', 'Biotechnology', 'A CRISPR Therapeutics AG é uma empresa de edição de genes sediada na Suíça focada no desenvolvimento de terapias baseadas em CRISPR/Cas9. CRISPR/Cas9 significa Clustered Regularly Interspaced Short Palindromic Repeats (CRISPR)/CRISPR-associated protein 9 (Cas9) e é uma tecnologia para edição de genes, o processo de alterar com precisão sequências específicas de DNA genômico. A Companhia tem como objetivo aplicar essa tecnologia para interromper, excluir, corrigir e inserir genes para tratar doenças geneticamente definidas e projetar terapias celulares avançadas. A Companhia adquiriu os direitos sobre a propriedade intelectual (PI) que abrange CRISPR/Cas9 e tecnologias relacionadas e também está envolvida em sua própria pesquisa de PI e esforços adicionais de licenciamento. As estratégias de parceria e desenvolvimento de produtos da Companhia são projetadas para explorar todo o potencial da plataforma CRISPR/Cas9, maximizando a probabilidade de desenvolver com sucesso seus produtos-cand', 'Zug, , Switzerland', 393);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVX', 'STOCK', 'Chevron Corporation', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A Chevron Corporation é uma empresa de energia integrada. A empresa produz petróleo bruto e gás natural; fabrica combustíveis de transporte, lubrificantes, petroquímicos e aditivos; e desenvolve tecnologias que aprimoram nossos negócios e a indústria. As operações de upstream da Companhia consistem principalmente em explorar, desenvolver, produzir e transportar petróleo bruto e gás natural; liquefação, transporte e regaseificação associados ao gás natural liquefeito (GNL); transportar petróleo bruto pelos principais oleodutos internacionais de exportação de petróleo; processamento, transporte, armazenamento e comercialização de gás natural; captura e armazenamento de carbono; e uma planta de gás para líquidos. As operações a jusante da Companhia consistem principalmente na refinação de petróleo bruto em produtos petrolíferos; comercialização de petróleo bruto, produtos refinados e lubrificantes; fabricação e comercialização de combustíveis renováveis; transporte de petróleo bruto e pro', 'Houston, TX, United States', 45298);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUK', 'STOCK', 'Carnival Corporation & plc', 'NYQ', 'Consumer Cyclical', 'Travel Services', 'Carnival PLC is a global cruise company. The Companys segments include North America and Australia (NAA) cruise operations, Europe and Asia (EA) cruise operations, Cruise Support, and Tour and Other. NAA cruise operations include Carnival Cruise Line, Princess Cruises, Holland America Line, P&O Cruises (Australia), and Seabourn. The EA segment includes Costa Cruises (Costa), AIDA Cruises (AIDA), P&O Cruises (UK) and Cunard. Cruise Support segment includes its portfolio of port destinations and other services, all of which are operated for the benefit of its cruise brands. Tour and Other segment represent the hotel and transportation operations of Holland America Princess Alaska Tours and other operations. Holland America Princess Alaska Tours is a tour company in Alaska and the Canadian Yukon, which complements its Alaska cruise operations. The Companys cruising offers a broad range of products and services to suit vacationing guests.', 'Miami, FL, United States', 115000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APA', 'STOCK', 'APA Corporation', 'NMS', 'Energy', 'Oil & Gas E&P', 'A APA Corporation é uma empresa independente de energia. A Companhia possui subsidiárias que exploram e produzem petróleo e gás natural nos Estados Unidos, Egito e Reino Unido, e que exploram petróleo e gás natural no Suriname. O negócio de upstream da Companhia possui operações de petróleo e gás em três áreas geográficas: Estados Unidos, Egito e offshore no Reino Unido no Mar do Norte (Mar do Norte). Também tem operações ativas de exploração e avaliação em andamento no Suriname, bem como interesses no Uruguai e em outros locais internacionais. Mantém um portfólio diversificado de ativos, incluindo interesses convencionais e não convencionais, onshore e offshore, exploração e produção de petróleo e gás natural. Nos Estados Unidos, as operações são focadas principalmente na Bacia Permiana do Oeste do Texas e Leste do Novo México, com operações adicionais localizadas nas áreas de xisto Eagle Ford e Austin Chalk do Sudeste do Texas, offshore no Golfo do México e ao longo da Costa do Golfo', 'Houston, TX, United States', 2305);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BP', 'STOCK', 'BP p.l.c.', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A BP p.l.c. é uma empresa de energia integrada com sede no Reino Unido. Os segmentos da empresa incluem gás e energia de baixo carbono, produção e operações de petróleo, clientes e produtos e outras empresas e empresas. Seu negócio de gás inclui regiões com atividades a montante que produzem gás natural, gás e energia integrados e comércio de gás. Seu negócio de baixo carbono inclui energia solar, offshore e onshore, captura e armazenamento de hidrogênio e carbono e comércio de energia. O segmento de produção e operações de petróleo compreende regiões com atividades a montante que produzem predominantemente petróleo bruto, incluindo energia bpx. O segmento Clientes & Produtos compreende os seus negócios focados no cliente, que incluem a conveniência e combustíveis de retalho, carregamento de veículos elétricos, bem como Castrol, aviação e negócios para empresas e midstream. Também inclui seus negócios de produtos, refino e comércio de petróleo, bem como seus negócios de bioenergia. Out', 'London, , United Kingdom', 100500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRDF', 'STOCK', 'Cardiff Oncology, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cardiff Oncology, Inc. is a clinical-stage biotechnology company. It is leveraging PLK1 inhibition, a well-validated oncology drug target, to develop novel therapies across a range of cancers with unmet medical need. It is focused on clinical programs in indications, such as RAS-mutated metastatic colorectal cancer (mCRC), and in investigator-initiated trials in metastatic pancreatic ductal adenocarcinoma (mPDAC), small cell lung cancer (SCLC), and triple negative breast cancer (TNBC). Its lead drug candidate, Onvansertib, is an oral, small-molecule drug candidate that is highly specific for PLK1 inhibition with a 24-hour half-life. It has other ongoing and planned clinical trials of onvansertib: one trial (CRDF-004) in first-line treatment in patients with RAS-mutated mCRC, and investigator-initiated trials in first-line mPDAC, relapsed SCLC and unresectable locally advanced or metastatic TNBC.', 'San Diego, CA, United States', 32);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBRE', 'STOCK', 'CBRE Group, Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'CBRE Group, Inc. É uma empresa comercial de serviços imobiliários e investimento. Seu segmento de Serviços de Consultoria oferece uma gama de serviços globalmente, incluindo locação de imóveis; mercados de capitais, que incluem vendas de imóveis e originação de hipotecas; serviços de hipoteca; gestão e avaliação de propriedades. Seu segmento Global Workplace Solutions oferece soluções integradas de gerenciamento de instalações e gerenciamento de projetos para grandes ocupantes de imóveis comerciais. O seu segmento de Investimentos Imobiliários é composto por dois negócios: Gestão de investimentos e desenvolvimento imobiliário. Os seus serviços de gestão de investimentos são prestados a fundos de pensões, companhias de seguros, fundos soberanos, fundações, dotações, fundos de investimento, e outros investidores institucionais. Seus serviços de desenvolvimento consistem em atividades de desenvolvimento imobiliário e investimento. Ele fornece serviços de engenharia, operações de suporte b', 'Dallas, TX, United States', 140000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SG', 'STOCK', 'Sweetgreen, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Sweetgreen, Inc. is a restaurant and lifestyle brand that serves healthy food at scale. The Company has designed its menu to be customizable and convenient to empower its customers to make healthier choices for both lunch and dinner. The Company''s core menu features approximately 13 signature items which are offered year-round in all of its locations, including its new steak plate. In addition to its core menu items, its single most popular item is the custom salad or bowl, which can include combinations from 40-plus ingredients as well as its made-from-scratch dressings. On its Owned Digital Channels, it offers exclusive menu items, including seasonal digital exclusives and collections relevant to each customer. It has a five-channel model that is designed to help its customers to order. The Company''s five-channel model includes Pick-Up, Native Delivery, Outpost and Catering, In-Store, and Marketplace. It has approximately 250 restaurants across the country.', 'Los Angeles, CA, United States', 6407);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLVT', 'STOCK', 'Clarivate Plc', 'NYQ', 'Technology', 'Information Technology Services', 'Clarivate Plc is a global provider of transformative intelligence. The Company offers enriched data, insights and analytics, workflow solutions and expert services in the areas of Academia & Government (A&G), Intellectual Property (IP) and Life Sciences & Healthcare (LS&H). Within the A&G segment, the Company provides research and analytics, content aggregation, and workflow software solutions. Within the IP segment, the Company provides IP Maintenance, IP Intelligence, and IP Management solutions. Within the LS&H segment, the Company provides research and development, regulatory and safety, and commercialization solutions. It is also a provider of cloud-based solutions that enable life sciences clients to automate regulatory reporting and compliance management. It is also engaged in providing comprehensive and integrated solutions to support patent preparation, filing and prosecution, offering patent practitioners with automation and artificial intelligence (AI)-enabled solutions.', 'London, , United Kingdom', 12000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALT', 'STOCK', 'Altimmune, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Altimmune, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing next-generation peptide-based therapeutics. It is developing pemvidutide, a GLP-1/glucagon dual receptor agonist for the treatment of obesity, metabolic dysfunction-associated steatohepatitis (MASH) and other indications. Activation of the GLP-1 and glucagon receptors is believed to mimic the complementary effects of diet and exercise on weight loss, with GLP-1 suppressing appetite and glucagon increasing energy expenditure. Glucagon is also recognized as having direct effects on hepatic fat metabolism, to rapid reductions in levels of liver fat and serum lipids. The Company has completed the MOMENTUM Phase II obesity trial and is being studied in the IMPACT Phase IIb MASH trial. The Company also develops and commercializes surfactant-functionalized (EuPort domain) incretin-based peptide therapeutics, including (GLP-1-glucagon)/oxyntomodulin, and variants.', 'Gaithersburg, MD, United States', 59);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DIS', 'STOCK', 'The Walt Disney Company', 'NYQ', 'Communication Services', 'Entertainment', 'A Walt Disney Company é uma empresa de entretenimento diversificada em todo o mundo. Os segmentos da empresa incluem entretenimento, esportes e experiências. O segmento de Entretenimento geralmente engloba suas atividades de produção e distribuição de conteúdo episódico e filmes globais não esportivos. As linhas de negócios dentro do segmento de Entretenimento, juntamente com suas atividades de negócios, incluem redes lineares, direto para o consumidor e vendas/licenciamento de conteúdo. O segmento de Esportes engloba suas atividades de produção e distribuição de conteúdo de transmissão de vídeo direto para o consumidor (DTC). As linhas de negócios dentro do segmento de Esportes incluem ESPN e Star. O segmento Experiências inclui Parques e Experiências e Produtos de Consumo. Parques e Experiências consiste em Walt Disney World Resort na Flórida, Disneyland Resort na Califórnia, Disney Cruise Line e outros. Os produtos de consumo incluem o licenciamento de seus nomes comerciais, persona', 'Burbank, CA, United States', 177080);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEG', 'STOCK', 'Aegon Ltd.', 'NYQ', 'Financial Services', 'Insurance - Diversified', 'Aegon Ltd. (Aegon) é uma holding internacional de serviços financeiros. A empresa oferece produtos e serviços em seguros, economias de longo prazo, bancos e gestão de ativos. Nos Estados Unidos, a empresa opera sob duas marcas: Transamerica e World Financial Group Insurance Agency, que oferece seguros de vida, investimentos e soluções de aposentadoria. Na Holanda, a Aegon se concentra em seguros de vida, economias de longo prazo, soluções de pensão e anuidade e hipotecas. No Reino Unido, a Aegon é a plataforma de investimento, fornecendo uma gama de investimentos, soluções de aposentadoria e produtos de proteção para indivíduos, consultores e empregadores. Na China, a empresa possui uma participação na Aegon THTF Life Insurance Company, que oferece soluções de seguro de vida através de uma rede de filiais, principalmente no leste da China. Conta ainda com uma parceria com o Banco Santander para distribuir produtos de seguros de vida, saúde e não vida através das agências do banco em Es', 'The Hague, , Netherlands', 15582);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYH', 'STOCK', 'Community Health Systems, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Community Health Systems, Inc. is a healthcare company. The Companys affiliates are providers of healthcare services, developing and operating healthcare delivery systems in approximately 35 distinct markets across 14 states. The Company''s subsidiaries own or lease 70 affiliated hospitals with more than 10,000 beds and operate more than 1,000 sites of care, including physician practices, urgent care centers, freestanding emergency departments, occupational medicine clinics, imaging centers, cancer centers and ambulatory surgery centers. Its hospitals and other sites of care offer a variety of inpatient and outpatient medical and surgical services. These include general acute care, emergency room, general and specialty surgery, critical care, internal medicine, obstetrics, diagnostic services, psychiatric and rehabilitation services. In addition, some of its hospitals provide skilled nursing and home care services based on individual community needs.', 'Franklin, TN, United States', 45000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CONL', 'STOCK', 'GraniteShares 2x Long COIN Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund aims to generate 2 times the daily performance of the underlying stock for a single day. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EW', 'STOCK', 'Edwards Lifesciences Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'A Edwards Lifesciences Corporation é a empresa global de coração estrutural. A empresa faz parceria com médicos e pesquisadores e investe em pesquisa e desenvolvimento para melhorar o atendimento aos impactados por doenças cardíacas estruturais. Suas categorias de produtos incluem a Substituição da Válvula Aórtica Transcateter (TAVR), as terapias mitral e tricúspide transcateter (TMTT) e o Coração Estrutural Cirúrgico. Ele fornece tecnologias de substituição de válvulas cardíacas transcatetadas projetadas para a substituição minimamente invasiva de válvulas cardíacas aórticas. A categoria TAVR inclui os sistemas EDWARDS SAPIEN 3, EDWARDS SAPIEN 3 Ultra e EDWARDS SAPIEN 3 Ultra RESILIA. A categoria TMTT inclui o sistema de reparação transcateter Pascal Precision, o sistema de substituição da válvula tricúspide EVOQUE e o sistema de reconstrução da válvula tricúspide Cardioband. Sua válvula aórtica INSPIRIS RESILIA, oferece tecido RESILIA e tecnologia VFit. É gerido em várias regiões geo', 'Irvine, CA, United States', 15800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BORR', 'STOCK', 'Borr Drilling Limited', 'NYQ', 'Energy', 'Oil & Gas Drilling', 'Borr Drilling Limited is an offshore shallow-water drilling contractor providing offshore drilling services to the oil and gas industry. The Company''s primary business is the ownership, contracting and operation of jack-up rigs for operations in shallow-water areas (in water depths up to approximately 400 feet), including the provision of related equipment and work crews to conduct oil and gas drilling and workover operations for exploration and production customers. It owns approximately 22 rigs with an additional two jack-up rigs. Its rigs include Skald, Groa, Idun, Thor, Norve, Gerd, Natt, Ran, Odin, Gersemi, Grid, Galar, Njord, Prospector 1, Saga, Prospector 5, Mist, Gunnlod, Frigg, Gyme, Arabia I, and Arabia II. It operates oil-producing geographies throughout the world, including the North Sea, Mexico, West Africa, Southeast Asia, and the Middle East. The Company contracts its jack-up rigs primarily on a daily rate basis to drill wells for its customers.', 'Hamilton, , Bermuda', 2087);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNDX', 'STOCK', 'Vanguard Total International Bond Index Fund', 'NGM', NULL, NULL, 'The fund employs an indexing investment approach designed to track the performance of the Bloomberg Global Aggregate ex-USD Float Adjusted RIC Capped Index (USD Hedged). This index provides a broad-based measure of the global, investment-grade, fixed-rate debt markets. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPB', 'STOCK', 'The Campbell''s Company', 'NMS', 'Consumer Defensive', 'Packaged Foods', 'A Campbell''s Company, anteriormente Campbell Soup Company, oferece alimentos e bebidas acessíveis. A empresa está focada na potência da marca, em duas divisões: Refeições e bebidas e lanches. O portfólio da Companhia de aproximadamente 16 marcas inclui Campbell''s, Cape Cod, Chunky, Goldfish, Kettle Brand, lance, Tarde de de de Julho, Pace, Pacific Foods, Pepperidge Farm, Pretzel Crisps, Snyder''s de Hanover, Swanson e V8. Oferece comida nutritiva e conveniente para famílias canadenses. Sua divisão norte-americana Foodservice oferece alimentos, receitas e soluções sob medida para uma ampla gama de segmentos, incluindo instalações de saúde, restaurantes e cafés especiais, escolas, vending e micro-mercados, e hospedagem em toda a América do Norte. Pacific Foods é um produtor de caldo orgânico e sopa. Oferecendo uma ampla gama de opções orgânicas e vegetais saborosas, as sopas incluem pimenta vermelha assada cremosa e tomate e novas sopas enlatadas prontas a servir.', 'Camden, NJ, United States', 14400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHR', 'STOCK', 'Danaher Corporation', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'A Danaher Corporation é uma inovadora global em ciências da vida e diagnósticos. A Companhia atua através de três segmentos: Biotecnologia, Ciências da Vida e Diagnóstico. O segmento de Biotecnologia inclui os negócios de bioprocessamento e descoberta e medicina e oferece uma ampla gama de equipamentos, consumíveis e serviços que são utilizados principalmente pelos clientes para avançar e acelerar a pesquisa, desenvolvimento, fabricação e entrega de medicamentos biológicos. O segmento de Ciências da Vida oferece uma ampla gama de instrumentos, consumíveis, serviços e software que são usados principalmente pelos clientes para estudar os blocos básicos da vida, incluindo ácido desoxirribonucleico (DNA) e ácido ribonucleico (RNA), ácido nucleico, proteínas, metabólitos e células. O segmento de Diagnóstico oferece instrumentos clínicos, consumíveis, software e serviços que hospitais, consultórios médicos, laboratórios de referência e outras configurações de cuidados críticos usam para diag', 'Washington, DC, United States', 61000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRBU', 'STOCK', 'Caribou Biosciences, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Caribou Biosciences, Inc. is a clinical-stage clustered regularly interspaced short palindromic repeats (CRISPR) genome-editing biopharmaceutical company engaged in developing transformative therapies for patients with devastating diseases. The Companys genome-editing platform, including its Cas12a chRDNA technology, enables superior precision to develop cell therapies that are armored to potentially improve activity against disease. Caribou is advancing a pipeline of off-the-shelf cell therapies from its CAR-T platform to offer broad access and rapid availability of treatments for patients with hematologic malignancies and autoimmune diseases. Its genome-editing platform, including its novel chRDNA technology, enables more precise genome editing of allogeneic cell therapies. It is advancing its pipeline of allogeneic CAR-T cell therapies with clinical development programs targeting the treatment of hematologic malignancies and autoimmune diseases.', 'Berkeley, CA, United States', 147);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSX', 'STOCK', 'Boston Scientific Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'A Boston Scientific Corporation é uma desenvolvedora, fabricante e comerciante global de dispositivos médicos que são usados em uma variedade de especialidades médicas intervencionistas. O segmento MedSurg da Empresa inclui Endoscopia, Urologia e Neuromodulação. Seu negócio de Endoscopia desenvolve e fabrica dispositivos para diagnosticar e tratar uma série de condições gastrointestinais com tecnologias menos invasivas. Seu negócio de urologia desenvolve e fabrica dispositivos para tratar várias condições urológicas para anatomias masculinas e femininas, incluindo pedras nos rins, hiperplasia prostática benigna, câncer de próstata, disfunção erétil, e incontinência. Seu negócio de Neuromodulação desenvolve e fabrica dispositivos para tratar vários distúrbios do movimento neurológico e gerenciar a dor crônica. Seu segmento Cardiovascular inclui Cardiologia e Intervenções Periféricas. A Cardiologia inclui terapias intervencionistas de cardiologia, vigia, gerenciamento do ritmo cardíaco e', 'Marlborough, MA, United States', 53000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIDU', 'STOCK', 'Baidu, Inc.', 'NMS', 'Communication Services', 'Internet Content & Information', 'Baidu Inc é um provedor de pesquisa na Internet em língua chinesa. A Companhia opera seus negócios por meio de dois segmentos, o segmento Baidu Core e o segmento iQIYI. O Baidu Core Segment fornece principalmente serviços de marketing on-line baseados em busca, feed-based e outros serviços de marketing on-line, bem como produtos e serviços das novas iniciativas de inteligência artificial (IA) da Empresa, como anúncios de exibição e baseados em critérios de desempenho que não sejam custo por clique, serviços de nuvem, dispositivos e serviços inteligentes, serviços voltados para o consumidor não marketing, como adesão e condução inteligente. O segmento iQIYI produz, agrega e distribui uma grande variedade de conteúdos produzidos profissionalmente, bem como um amplo espetro de outros conteúdos de vídeo, em uma variedade de formatos, incluindo uma variedade de produtos e serviços que abrangem vídeo on-line, jogos on-line, literatura on-line, quadrinhos e outros.', 'Beijing, , China', 35900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAOI', 'STOCK', 'Applied Optoelectronics, Inc.', 'NGM', 'Technology', 'Communication Equipment', 'Applied Optoelectronics, Inc. is a vertically integrated provider of fiber-optic networking products. The Company designs and manufactures a range of optical communications products at varying levels of integration, from components, subassemblies, and modules to complete turn-key equipment. The Company also designs, manufactures, and integrates its own analog and digital lasers using the proprietary Molecular Beam Epitaxy (MBE) and Metal Organic Chemical Vapor Deposition (MOCVD) alternative processes for the fabrication of lasers. The Company manufactures lasers and laser components and performs research and development activities for laser component and optical module products. The Company offers its fiber-optic networking products, primarily for four networking end-markets, such as cable television, (CATV), Internet data center, telecommunications, (telecom), and fiber-to-the-home (FTTH). The Company has manufacturing facilities in Taipei, Taiwan and Ningbo, China.', 'Sugar Land, TX, United States', 3309);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COHR', 'STOCK', 'Coherent Corp.', 'NYQ', 'Technology', 'Scientific & Technical Instruments', 'Coherent Corp., specializing in materials, networking, and lasers, is a vertically integrated manufacturing company that develops, manufactures, and markets engineered materials, optoelectronic components and devices, and lasers for use in the industrial, communications, electronics, and instrumentation markets. Its segments include Networking, Materials and Lasers. The Networking segment leverages its compound semiconductor technology platforms and knowledge of end-user applications for its key end markets to deliver differentiated components and subsystems. The Materials segment includes engineered materials and optoelectronic devices, such as those based on zinc selenide (ZnSe), zinc sulfide (ZnS), gallium arsenide (GaAs), indium phosphide (InP), gallium antimonide (GaSb), and silicon carbide (SiC). The Lasers segment''s lasers and optics products serve industrial customers in semiconductor and display capital equipment, precision manufacturing, and aerospace & defense, and others.', 'Saxonburg, PA, United States', 26157);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENTG', 'STOCK', 'Entegris, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'A Entegris, Inc. É um fornecedor de materiais avançados e soluções de processo para as indústrias de semicondutores e outras de alta tecnologia (alta tecnologia). Os segmentos da empresa incluem Soluções de Materiais (MS), Controle de Microcontaminação (MC) e Manuseio Avançado de Materiais (AMH). O segmento MS fornece materiais consumíveis avançados, tais como pastas e almofadas de planarização mecânica química (CMP), materiais de deposição, químicos de processo e gases, limpeza formulada, etchants e outros materiais especiais. O segmento MC está envolvido na filtragem e purificação de químicos líquidos críticos e gases usados em processos de fabricação de semicondutores e outras indústrias de alta tecnologia. O segmento AMH protege materiais críticos durante a fabricação, transporte e armazenamento; incluindo produtos que monitoram, protegem, transportam e fornecem químicos líquidos críticos, wafers e outros substratos para um amplo conjunto de aplicações nos setores de semicondutores', 'Billerica, MA, United States', 8000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACIW', 'STOCK', 'ACI Worldwide, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'ACI Worldwide, Inc. is a global payments technology company, delivers software solutions that power intelligent payments orchestration in real time to banks, billers, and merchants. The Company''s segments include Payment Software and Biller. Its Payment Software segment drives payments orchestration for banks and merchants. It provides payment solutions to large and mid-size banks globally for retail banking, digital, and other payment services. Its support of merchants globally includes Tier 1 and Tier 2 merchants (in-store and online), payment service providers, independent selling organizations, value-added resellers, and acquirers who service them. The Company''s Biller segment provides electronic bill presentment and payment services to companies operating in the consumer finance, insurance, healthcare, higher education, utility, government, mortgage, subscription provider, and telecommunications categories. The Company also provides fraud abuse protection to its Biller customers', 'Elkhorn, NE, United States', 3103);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBAY', 'STOCK', 'eBay Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'eBay Inc. é uma empresa de comércio global, que inclui a sua plataforma de mercado. As tecnologias e serviços da empresa são concebidos para dar aos compradores escolha e inventário relevante e permitir aos vendedores oferecer o seu inventário para venda, virtualmente a qualquer hora e em qualquer lugar. A Empresa desenvolve interfaces de utilizador, ferramentas de comprador, vendedor e desenvolvedor e processamento de transacções, base de dados e aplicações de rede que ajudam os seus utilizadores a completar transacções nos seus sites. As suas plataformas são acessíveis através de uma experiência on-line, dispositivos móveis iOS e Android e as suas interfaces de programação de aplicações (APIs). A Empresa opera através de segmentos como o Marketplace. Marketplace inclui o seu mercado online localizado em www.ebay.com, as suas contrapartidas localizadas e o seu conjunto de aplicações móveis.', 'San Jose, CA, United States', 11500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHWY', 'STOCK', 'Chewy, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Chewy, Inc. is an e-commerce business geared toward pet products and services. The Companys products consist of pet food and treats, pet supplies and pet medications, other pet-health products, and pet services. It serves its customers through its retail websites, and its mobile applications and focuses on delivering customer service, competitive prices, convenience, including Chewys Autoship subscription program, and a range of pet food, treats and supplies, and pet healthcare products and services. It partners with approximately 3,200 of the brands in the pet industry, and it creates and offers its own private brands. It owns a number of trademark registrations and applications in the United States and in foreign jurisdictions. These trademarks include American Journey, Blue Box Event, Careplus, Chewy, Chewy.com, Chewy Vet Care, Dr. Lyons, Frisco, Goody Box, Onguard, PetMD, PracticeHub, Tiny Tiger, True Acre Farms, Tylees, Vibeful, and The Zoo.', 'Plantation, FL, United States', 18000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGH', 'STOCK', 'Anghami Inc.', 'NCM', 'Communication Services', 'Entertainment', 'Anghami Inc is a United Arab Emirates based company that provides digital music entertainment technology platform in the Middle East and North Africa (MENA). The Company has catalog comprising more than 72 million songs and licensed content from Arabic labels, independent artists, and distributors, available for more than 75 million users. The Company also features music from the international labels such as Universal, Sony and Warner. The Company''s services are available in English, Arabic and French. It has offices in Beirut, Dubai, Cairo and Riyadh and operates in 16 countries across MENA.', 'Abu Dhabi, , United Arab Emirates', 186);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AQN', 'STOCK', 'Algonquin Power & Utilities Corp.', 'NYQ', 'Utilities', 'Utilities - Diversified', 'Algonquin Power & Utilities Corp. is a Canada-based diversified international generation, transmission, and distribution company. The Company is engaged in providing sustainable energy and water solutions through its portfolio of generation, transmission and distribution utility investments to over one million customer connections. The Company''s operations are organized across three business units, consisting of: the Regulated Services Group, which primarily owns and operates a portfolio of regulated electric, water distribution and wastewater collection and natural gas utility systems and transmission operations in the United States, Canada, Bermuda and Chile; the Hydro Group, consisting of the hydroelectric business, which is not being sold as a part of the Renewables sale; and the Corporate Group, which includes corporate and service companies as well as its investment in Atlantica.', 'Oakville, ON, Canada', 3786);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABT', 'STOCK', 'Abbott Laboratories', 'NYQ', 'Healthcare', 'Medical Devices', 'A Abbott Laboratories é uma empresa global de cuidados de saúde. O principal negócio da empresa é a descoberta, desenvolvimento, fabricação e venda de uma ampla e diversificada linha de produtos de saúde. Seus segmentos incluem produtos farmacêuticos estabelecidos, produtos diagnósticos, produtos nutricionais e dispositivos médicos. O segmento de Produtos Farmacêuticos Estabelecido está envolvido nas vendas internacionais de uma ampla linha de produtos farmacêuticos genéricos de marca. O segmento de produtos de diagnóstico está envolvido nas vendas mundiais de sistemas de diagnóstico e testes para bancos de sangue, hospitais, laboratórios comerciais e locais de testes de cuidados alternativos. O segmento de produtos nutricionais está envolvido nas vendas mundiais de uma ampla linha de produtos nutricionais adultos e pediátricos. O segmento de dispositivos médicos está envolvido nas vendas mundiais de gerenciamento de ritmo, eletrofisiologia, insuficiência cardíaca, vascular, coração es', 'North Chicago, IL, United States', 114000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTDR', 'STOCK', 'Bitdeer Technologies Group', 'NCM', 'Technology', 'Software - Application', 'Bitdeer Technologies Group is a technology company for blockchain. It provides computing solutions for customers. The Company handles processes involved in computing, such as equipment procurement, transport logistics, datacenter design and construction, and equipment management. It primarily operates three business lines, namely self-mining, hash rate sharing, and hosting. Self-mining refers to cryptocurrency mining for its own account, which allows it to directly capture the high appreciation potential of cryptocurrency. It offers two types of hash rate sharing solutions, namely Cloud Hash Rate and Hash Rate Marketplace. Through Cloud Hash Rate, the Company sells its hash rate to customers. It offers hash rate subscription plans at a fixed price and shares mining income with them under certain arrangements. Its hosting services offer customers one-stop mining rig hosting solutions encompassing deployment, maintenance, and management services for efficient cryptocurrency mining.', 'Singapore, , Singapore', 183);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COP', 'STOCK', 'ConocoPhillips', 'NYQ', 'Energy', 'Oil & Gas E&P', 'A ConocoPhillips é uma empresa de exploração e produção. Seu segmento do Alasca explora principalmente para, produz, transporta e comercializa petróleo bruto, gás natural e NGL. O segmento inferior de 48 consiste em operações localizadas nos 48 estados contíguos nos Estados Unidos e no Golfo do México. As operações canadenses consistem no desenvolvimento de areias petrolíferas de Surmont em Alberta, o jogo não convencional Montney rico em líquidos na Colúmbia Britânica e operações comerciais. O segmento Europa, Médio Oriente e Norte de África consiste em operações principalmente localizadas no setor norueguês do Mar do Norte, Mar da Noruega, Qatar, Líbia, Guiné Equatorial e operações comerciais e de terminação no Reino Unido. O segmento Ásia-Pacífico tem operações de exploração e produção na China, Malásia, Austrália e operações comerciais na China, Cingapura e Japão. Outro segmento internacional inclui interesses na Colômbia, bem como contingências associadas a operações anteriores em', 'Houston, TX, United States', 11700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLMZ', 'STOCK', 'BloomZ Inc.', 'NCM', 'Communication Services', 'Entertainment', 'BloomZ Inc is an audio producing and voice actor managing company. The Company operates its business through three divisions. Audio Production business provides comprehensive audio production services for animation and video games. VTuber Management business operates a VTuber, which is a virtual character (animated character) it creates by utilizing motion-capture technology for its streamers to provide their voice to stream real-time videos featuring human facial expressions and gestures, which can also communicate and interact with audiences through the chat function by embedding in live-streaming platforms. Voice Actor Workshop business provides professional and practical voice acting educational services through its voice actor workshops. The Company also manages and promotes talent and artists.', 'Tokyo, , Japan', 10);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPNG', 'STOCK', 'Coupang, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Coupang, Inc. is a technology company that provides retail, restaurant delivery, video streaming, and fintech services to customers around the world under brands, such as Coupang, Coupang Eats, Coupang Play, Farfetch, and Rocket Now. Through its AI cloud computing service as Coupang Intelligent Cloud (CIC), it enhances its services and operations and provides GPU-as-a-Service (GPUaaS), including to external parties. Its Product Commerce segment includes its core Korean retail (owned inventory) and marketplace offerings (third-party merchants) and Rocket Fresh, its fresh grocery offering, as well as advertising products associated with these offerings. Its Developing Offerings include Coupang Eats, its restaurant ordering and delivery service in Korea, Coupang Play, an online content streaming service in Korea, fintech, its retail operations in Taiwan, as well as advertising products associated with these offerings, and also include Farfetch, its global luxury fashion marketplace.', 'Seattle, WA, United States', 95000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDD', 'STOCK', '3D Systems Corporation', 'NYQ', 'Technology', 'Computer Hardware', '3D Systems Corporation provides comprehensive three-dimensional (3D) printing and digital manufacturing solutions, including 3D printers for plastics and metals, materials, software, and services, including maintenance, advanced manufacturing and applications engineering. The Companys segments include Healthcare Solutions and Industrial Solutions. The Healthcare Solutions segment serves industry verticals, including dental, medical devices, personalized health services and regenerative medicine. The Industrial Solutions segment serves industry verticals, including aerospace, defense, transportation and general manufacturing. The Company architects solutions specific to customers needs through a combination of materials, hardware platforms, software, professional services and advanced manufacturing. It markets its products and services through subsidiaries in North America and South America, Europe and the Middle East and Asia Pacific and Oceania.', 'Rock Hill, SC, United States', 1833);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DELL', 'STOCK', 'Dell Technologies Inc.', 'NYQ', 'Technology', 'Computer Hardware', 'A Dell Technologies Inc. Está envolvida na conceção, desenvolvimento, fabricação, marketing, venda, e apoiando uma ampla gama de soluções, produtos e serviços abrangentes e integrados. A Companhia atua por meio de dois segmentos: Infrastructure Solutions Group (ISG) e Client Solutions Group (CSG). Seu segmento de ISG permite a transformação digital do cliente da empresa com soluções que abordam inteligência artificial (IA), aprendizado de máquina, análise de dados e ambientes de várias nuvens. Seu portfólio abrangente de armazenamento inclui soluções de armazenamento modernas e tradicionais, incluindo arrays all-flash, arquivos de expansão, plataformas de objetos, infraestrutura hiperconvergente, e serviços de armazenamento de dados. e armazenamento definido por software. Seu segmento CSG oferece computadores pessoais (PCs) de marca, incluindo notebooks, desktops e estações de trabalho e periféricos de marca que incluem monitores, docking stations, teclados, Mouses e dispositivos de we', 'Round Rock, TX, United States', 108000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCJ', 'STOCK', 'Cameco Corporation', 'NYQ', 'Energy', 'Uranium', 'A Cameco Corporation está empenhada em fornecer combustível de urânio para gerar eletricidade de base limpa e confiável em todo o mundo. A empresa também oferece serviços de processamento de combustível nuclear, serviços de refinaria e fabrica conjuntos de combustível e componentes de reatores. Seus segmentos incluem urânio, serviços de combustível e Westinghouse. O segmento de urânio está envolvido na exploração, mineração, moagem, compra e venda de concentrado de urânio. O segmento de serviços de combustível está envolvido na refinação, conversão e fabricação de concentrado de urânio e na compra e venda de serviços de conversão. O segmento Westinghouse está envolvido nos negócios de serviços nucleares. Seus projetos de urânio incluem Millennium, Yeelirrie e Kintyre. O projeto Cree Extension-Millennium é uma joint venture operada pela Cameco localizada na porção sudeste da Bacia Athabasca do Canadá. O depósito de Yeelirrie está localizado a aproximadamente 650 km a nordeste de Perth e', 'Saskatoon, SK, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASM', 'STOCK', 'Avino Silver & Gold Mines Ltd.', 'ASE', 'Basic Materials', 'Other Precious Metals & Mining', 'Avino Silver & Gold Mines Ltd. is a silver producer from its wholly owned Avino Mine near Durango, Mexico. The Company also maintains a diversified pipeline of gold and base metals'' exploration properties. It operates the Elena Tolosa Mine (Avino Mine), which produces copper, silver and gold at the Avino property in the state of Durango, Mexico. The Avino property also hosts the San Gonzalo Mine, which is in care and maintenance. The Company also holds a 100% interest in Proyectos Mineros La Preciosa S.A. de C.V. (La Preciosa), a Mexican corporation which owns the La Preciosa Property. The Company also owns interests in mineral properties located in British Columbia and Yukon, Canada. The Companys mineral claims in Mexico are divided into two groups: Avino Mine area property and Gomez Palacio/Ana Maria property. La Preciosa is a development stage mineral property located in the state of Durango, Mexico. Its other properties include Eagle, Minto, and Olympic, among others.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARRY', 'STOCK', 'Array Technologies, Inc.', 'NGM', 'Technology', 'Solar', 'Array Technologies, Inc. is a provider of solar tracking technology to utility-scale and distributed generation customers, who construct, develop and operate solar photovoltaic (PV) sites. The Companys segments include Array Legacy Operations and STI Legacy Operations. Its products are a portfolio of integrated solar tracking systems comprised of software and hardware that include component parts such as steel tubing, steel supports, drivelines, center structures, electric motors, motor controller assemblies, bearing assemblies, gearboxes and electronic controllers, commonly referred to as a single-axis tracker. Its flagship tracker uses a patented design that allows one motor to drive multiple rows of solar panels. Its products and services include Tracker Systems; DuraTrack HZ v3; Array STI H250; Array OmniTrack, and SmarTrack Software. SmarTrack is a range of software and control-based products designed for utility-scale solar sites.', 'Albuquerque, NM, United States', 1021);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHTR', 'STOCK', 'Charter Communications, Inc.', 'NMS', 'Communication Services', 'Telecom Services', 'Charter Communications, Inc. É uma empresa de conetividade de banda larga e operadora de cabo que atende mais de 57 milhões de casas e empresas em 41 estados através de sua marca Spectrum. Através de uma rede de comunicações avançada, a empresa oferece uma gama de serviços residenciais e empresariais, incluindo Spectrum Internet, Televisão (TV), Móvel e Voz. Para pequenas empresas, o Spectrum Business oferece uma gama de produtos e serviços de banda larga, juntamente com recursos e aplicativos especiais para aumentar a produtividade. Para empresas de médio e grande porte, o Spectrum Business fornece soluções personalizadas baseadas em fibra. O Spectrum Reach oferece publicidade e produção para o cenário moderno da mídia. A empresa também distribui cobertura de notícias e programação esportiva para seus clientes por meio da Spectrum Networks. A Empresa oferece aos seus clientes serviços de Internet, vídeo, telefonia móvel e voz, com preços e encargos relacionados com base nos tipos de s', 'Stamford, CT, United States', 94500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASPN', 'STOCK', 'Aspen Aerogels, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Aspen Aerogels, Inc. is an aerogel technology company, which provides sustainability and electrification solutions. Its aerogel technology enables its customers and partners to achieve their own objectives around the global megatrends of resource efficiency, e-mobility and clean energy. Its segments include Energy Industrial and Thermal Barrier. Under the Energy Industrial, it designs, develops and manufactures aerogel insulation used in the energy industrial and sustainable insulation markets. It offers two aerogel insulation product lines for the energy industrial market, Pyrogel and Cryogel. Under the Thermal Barrier, it offers PyroThin product, is an ultra-thin, lightweight and flexible thermal barrier designed with other functional layers to impede the propagation of thermal runaway across multiple lithium-ion battery system architectures. Its thermal barrier technology is designed to offer a combination of thermal management, mechanical performance and fire protection properties.', 'Northborough, MA, United States', 554);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXC', 'STOCK', 'Exelon Corporation', 'NMS', 'Utilities', 'Utilities - Regulated Electric', 'A Exelon Corporation é uma holding de serviços públicos que atua nos negócios de transmissão e distribuição de energia através de suas subsidiárias, Commonwealth Edison Company (Comed), PECO Energy Company (PECO), Baltimore Gás and Electric Company (BGE), Potomac Electric Power Company (Pepco), Delmarva Power & Light Company (DPL) e Atlantic City Electric Company (ACE). Seus segmentos incluem Comed, PECO, BGE, Pepco, DPL e ACE. O segmento Comed está envolvido na compra e regulação da venda a retalho de eletricidade. O segmento PECO está envolvido na compra e regulação da venda a retalho de eletricidade e gás natural. Através de sua subsidiária de serviços de negócios, Exelon Business Services Company, LLC (BSC), fornece às suas subsidiárias uma variedade de serviços de suporte a custo, incluindo serviços jurídicos, de recursos humanos, finanças, tecnologia da informação e de gestão de suprimentos. O segmento BGE está focado na transmissão e distribuição de eletricidade e distribuição d', 'Chicago, IL, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFRM', 'STOCK', 'Affirm Holdings, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Affirm Holdings, Inc. provides consumers with an alternative to traditional payment options. The Company is engaged in building a payment network. Its platform comprises three core elements: point-of-sale payment solutions for consumers, merchant commerce solutions, and a consumer-focused app. Its Affirm App and Website provide tailored offers from merchants based on consumers'' preferences. Consumers can apply at affirm.com or via the Affirm App and, upon approval, receive a single-use virtual card to use online or in-store. Its Affirm Card allows consumers to link a bank account to pay in full, or apply to pay overtime through the Affirm App. It offers users an in-app post-purchase feature that allows them to instantly apply to convert any eligible debit transaction into an installment loan. Through the Affirm app and in partnership with Cross River Bank, it offers a high-yield savings account, with no minimum deposit requirements or fees.', 'San Francisco, CA, United States', 2006);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COTY', 'STOCK', 'Coty Inc.', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'Coty Inc. É uma empresa de beleza com um portfólio de marcas em fragrâncias, cosméticos de cor e cuidados com a pele e o corpo. A Companhia possui um portfólio diversificado de marcas, que inclui tanto de propriedade quanto de licenciadas. O seu portfólio de marcas está classificado em dois segmentos: Beleza de consumo e Prestígio. As marcas de beleza de consumo incluem Adidas, Beckham, Bozzano, Bourjois, Bruno Banani, CoverGirl, Jovan, Mexx, Leger por Lena Gercke, Monange, Nautica, Paixao, Rimmel, risque, Sally Hansen, e Vera Wang. Suas marcas de prestígio incluem Burberry, Calvin Klein, Chloe, Davidoff, Escada, Gucci, Hugo Boss, Jil Sander, Kylie Cosmetics by Kylie Jenner, Lancaster, Marc Jacobs, Miu Miu, Orveda, SKKN POR Kim, e Tiffany & Co. Suas marcas de beleza de massa são vendidas principalmente através de hipermercados, supermercados, farmácias e farmácias, lojas de departamento de nível médio, varejistas tradicionais de alimentos e drogas e varejistas dedicados de e-commerce. ', 'New York, NY, United States', 11791);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OWL', 'STOCK', 'Blue Owl Capital Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Blue Owl Capital Inc. is an alternative asset management company. The Company deploys private capital across Credit, GP Strategic Capital and Real Estate platforms on behalf of institutional and private wealth clients. Its product platforms include Credit, GP Strategic Capital and Real Estate. Its credit products offer private financing solutions primarily to upper-middle-market companies. Its credit products are offered through a mix of business development companies, long-dated private funds, managed accounts and collateralized loan obligations. It is focused on acquiring equity stakes in or providing debt financing to private capital firms. Its Real Estate products are focused on acquiring triple net lease real estate occupied by investment-grade or creditworthy tenants. Its Real Estate products are offered through Permanent Capital vehicles, including its real estate investment trusts, and long-dated private funds. It offers asset management services to the insurance industry.', 'New York, NY, United States', 1300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWK', 'STOCK', 'Cushman & Wakefield plc', 'NYQ', 'Real Estate', 'Real Estate Services', 'Cushman & Wakefield plc is a United Kingdom-based global commercial real estate services firm for property owners and occupiers. The Company''s segments include the Americas; Europe, Middle East and Africa (EMEA), and Asia Pacific (APAC). Its core service lines include Services, Leasing, Capital markets, and Valuation and other. For real estate occupiers, the Company offers integrated facilities management, project and development services, portfolio administration, transaction management and strategic consulting. Its leasing services consist of two primary sub-services: owner representation and tenant representation. It represents both buyers and sellers in real estate purchase and sale transactions, and it arranges financing supporting purchases. The Company provides valuations and advice on real estate debt and equity decisions to clients through various services, including appraisal management, investment management, portfolio advisory, diligence advisory and financial reporting.', 'Chicago, IL, United States', 52000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APP', 'STOCK', 'AppLovin Corporation', 'NMS', 'Communication Services', 'Advertising Agencies', 'A AppLovin Corporation fornece soluções completas de publicidade de inteligência artificial (IA) para que as empresas alcancem, monetizem e aumentem seu público global. A empresa também tem um portfólio globalmente diversificado de aplicativos, jogos móveis gratuitos que opera através de seus estúdios de propriedade ou parceiros. Seus segmentos incluem Publicidade e Apps. Sua publicidade é composta principalmente de quatro soluções-chave, como AppDiscovery, MAX, Adjust e Wurl. O AppDiscovery é alimentado PELA AXON, seu mecanismo de publicidade alimentado por IA, e combina com a demanda de anunciantes com a oferta de publishers por meio de leilões em larga escala e em velocidades de microsegundo nível. Max é uma solução de monetização, utilizando uma avançada tecnologia de lances dentro do aplicativo que otimiza o valor de um inventário de publicidade de editores executando um leilão competitivo em tempo real. O Adjust é uma plataforma de marketing de medição e análise que fornece aos p', 'Palo Alto, CA, United States', 1533);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADBE', 'STOCK', 'Adobe Inc.', 'NMS', 'Technology', 'Software - Application', 'A Adobe Inc. É uma empresa global de tecnologia. Os produtos, serviços e soluções da Empresa são usados em todo o mundo para imaginar, criar, gerenciar, entregar, medir, otimize e envolva-se com o conteúdo em todas as superfícies e abasteça experiências digitais. Seus segmentos incluem Mídia Digital, Experiência Digital e Publicação e Publicidade. O segmento de Mídia Digital é centrado em torno da Adobe Creative Cloud e da Adobe Document Cloud, que incluem Adobe Express, Adobe Firefly, Photoshop e outros produtos, oferecendo uma variedade de ferramentas para profissionais criativos, comunicadores e outros consumidores. O segmento Experiência Digital fornece uma plataforma integrada e um conjunto de produtos, serviços e soluções por meio da Adobe Experience Cloud. O segmento de Publicação e Publicidade contém produtos e serviços legados. Além disso, sua solução Adobe GenStudio permite que as empresas simplifiquem seu processo de cadeia de suprimentos de conteúdo com recursos de inteligê', 'San Jose, CA, United States', 30709);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPRT', 'STOCK', 'Copart, Inc.', 'NMS', 'Industrials', 'Specialty Business Services', 'A Copart, Inc. É um fornecedor de leilões online e serviços de remarketing de veículos. A Empresa fornece aos vendedores de veículos uma gama completa de serviços para processar e vender veículos pela internet através da tecnologia de venda em leilão de internet de terceira geração (VB3). A empresa vende principalmente a desmanteladores de veículos licenciados, reconstrutores, licenciados de reparação, concessionários de veículos usados, exportadores, e diretamente ao público em geral. Os vendedores de veículos consistem principalmente em companhias de seguros, mas também incluem revendedores, indivíduos, instituições de caridade, aluguel, bancos, empresas financeiras e operadores de frotas. Opera mais de 200 locais em 11 países e tem mais de 175 000 veículos para leilão todos os dias. A empresa opera nos Estados Unidos, Reino Unido, Alemanha, Brasil, Canadá, Emirados Árabes Unidos, Espanha, Finlândia, Omã, República da Irlanda e Bahrein. Ele opera tanto como um agente e em uma base pr', 'Dallas, TX, United States', 13086);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APPS', 'STOCK', 'Digital Turbine, Inc.', 'NCM', 'Technology', 'Software - Application', 'Digital Turbine, Inc., through its subsidiaries, operates an independent mobile growth platform that levels up the landscape for advertisers, publishers, carriers, and device original equipment manufacturers (OEMs). The Company operates through two segments: On Device Solutions (ODS) and App Growth Platform (AGP). The ODS segment consists of products and services that simplify the discovery and delivery of mobile apps and content media for device end-users. The AGP segment consists of Advertising Solutions and Ad Monetization Solutions. The Company offers end-to-end products and solutions leveraging proprietary technology to all participants in the mobile application ecosystem, enabling brand discovery and advertising, user acquisition and engagement, and operational efficiency for advertisers. In addition, the Companys products and solutions provide monetization opportunities for OEMs, carriers, and app publishers and developers.', 'Austin, TX, United States', 647);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLNK', 'STOCK', 'Blink Charging Co.', 'NCM', 'Industrials', 'Engineering & Construction', 'Blink Charging Co., through its wholly owned subsidiaries, is a manufacturer, owner, operator and provider of electric vehicle (EV) charging equipment and networked EV charging services. It offers residential and commercial EV charging equipment and services, enabling EV drivers to recharge at various location types. Its principal line of products and services is its nationwide Blink EV charging networks (the Blink Networks) and Blink EV charging equipment, also known as electric vehicle supply equipment (EVSE), and other EV-related services. The Blink Networks is a proprietary, cloud-based system that operates, maintains and manages Blink charging stations and handles the associated charging data, back-end operations and payment processing. The Blink Networks provide property owners, managers, parking companies, state and municipal entities, and other types of commercial customers with cloud-based services that enable the remote monitoring and management of EV charging stations.', 'Bowie, MD, United States', 542);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHPT', 'STOCK', 'ChargePoint Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'ChargePoint Holdings, Inc. É um fornecedor de soluções de tecnologia de carregamento de veículos elétricos (EV). A Empresa projeta, desenvolve e comercializa infraestrutura de sistema de carregamento de veículos elétricos em rede (Sistemas de Carregamento em Rede), conetada por meio de serviços baseados na nuvem (Serviços em Nuvem), que permite que os proprietários de sistemas de carregamento ou hosts gerenciem seus Sistemas de Carregamento em Rede e permitam que os motoristas localizem, reservem e autentiquem Sistemas de Carregamento em Rede e transacionem sessões de carregamento de EV nesses sistemas. Os Sistemas de Carregamento em Rede da Empresa, as assinaturas e outras ofertas fornecem uma plataforma aberta que se integra com o hardware do sistema da ChargePoint e de outros fabricantes, conetando sistemas através de uma rede inteligente que fornece informações em tempo real sobre sessões de carregamento e controle total, suporte e gerenciamento dos Sistemas de Carregamento em Rede', 'Campbell, CA, United States', 1395);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CL', 'STOCK', 'Colgate-Palmolive Company', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'A Colgate-Palmolive Company é uma empresa em crescimento. É focado em Cuidados Oral, Cuidados Pessoais, Cuidados Domiciliários e Nutrição Pet, vende seus produtos sob marcas, como Colgate, Palmolive, elmex, olá, meridol, Sorriso, Tom''s of Maine, EltaMD, Filorga, Irish Spring, Lady Speed Stick, PCA SKIN, Protex, Sanex, SoftSoap, Speed Stick, Ajax, Axion, Fabuloso, Murphy, Soupline e Suavitel, bem como Hill''s Science Diet e Hill''s Prescription Diet. Seu segmento de produtos Oral, Personal e Home Care é gerenciado geograficamente em cinco segmentos, como América do Norte, América Latina, Europa, Ásia-Pacífico e África/Eurásia, todos eles vendem principalmente para uma variedade de varejistas tradicionais e de comércio eletrônico, atacadistas, distribuidores, dentistas e profissionais de saúde da pele. Seus produtos Pet Nutrition incluem produtos especiais de nutrição animal de estimação fabricados e comercializados pela Hill''s Pet Nutrition. Os clientes dos produtos Pet Nutrition são ', 'New York, NY, United States', 34000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSLK', 'STOCK', 'Bolt Projects Holdings, Inc.', 'NGM', 'Basic Materials', 'Specialty Chemicals', 'Bolt Projects Holdings, Inc. is a material solutions company. The Company develops and produces biomaterials for the beauty and personal care industry. The Company is a pioneer in the consumer biomaterials space. The Vegan Silk Technology Platform includes b-silk and xl-silk, which are fully biodegradable, film-forming, versatile and functional ingredients for the beauty industry. The Companys Vegan Silk Technology Platform produces b-silk and other offerings for the beauty and personal care industry that are fully vegan and biodegradable. Its intellectual property portfolio is anchored by 68 granted patents and 166 pending patent applications.', 'San Francisco, CA, United States', 14);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIG', 'STOCK', 'American International Group, Inc.', 'NYQ', 'Financial Services', 'Insurance - Diversified', 'American International Group, Inc. É uma companhia de seguros global. Ele fornece soluções de seguros que ajudam empresas e indivíduos em mais de 200 países e jurisdições a proteger seus ativos e gerenciar riscos por meio de suas operações, licenças e autorizações e parceiros de rede. Seu segmento inclui Seguros Gerais e Outras Operações. O negócio de Seguros Gerais inclui seus três segmentos, incluindo Comercial da América do Norte, Comercial Internacional e Pessoal Global. O comercial da América do Norte consiste em empresas de seguros nos Estados Unidos, Canadá e Bermudas. O comercial internacional consiste em empresas de seguros no Japão, Reino Unido, Europa, Oriente Médio e África, Ásia-Pacífico, América Latina e Caribe e China. Os produtos da América do Norte e do segmento comercial internacional incluem propriedade e cauda curta, casualidade, linhas financeiras e especialidade global. Os produtos do segmento pessoal global incluem acidentes e linhas pessoais globais.', 'New York, NY, United States', 22200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARM', 'STOCK', 'Arm Holdings plc', 'NMS', 'Technology', 'Semiconductors', 'Arm Holdings plc is engaged in operating a global computing platform. It architects, develops, and licenses IP solutions for CPUs, GPUs, NPUs and interconnect technologies, which is relied on by semiconductor companies and OEMs to develop their products. Its principal operations are the licensing, marketing, research and development of microprocessors, systems intellectual property (IP), graphics processing units, physical IP and associated systems IP, software, tools and other related services. Its primary product offerings are CPU products that address diverse performance, power, and cost requirements. Its complementary products, such as graphics processing units (GPUs) that accelerate the display of complex graphics onto a screen and can also be used for other mathematical applications, System IP, and compute platforms are also available as well as development tools and a software ecosystem to enable high-performance system-level creation for a range of devices and applications.', 'Cambridge, , United Kingdom', 8330);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMT', 'STOCK', 'American Tower Corporation', 'NYQ', 'Real Estate', 'REIT - Specialty', 'A American Tower Corporation (ATC) é uma holding. A Companhia opera como um fundo de investimento imobiliário (REIT), que possui, opera e desenvolve imóveis para comunicações multitenantes. Os segmentos da ATC incluem propriedade dos EUA, propriedade da Ásia, propriedade da EMEA, propriedade da América Latina, serviços e outros. Seu principal negócio são operações imobiliárias, que incluem a locação de espaço em sites de comunicações para provedores de serviços sem fio, empresas de transmissão de rádio e televisão, provedores de dados sem fio, agências governamentais e municípios e inquilinos em vários outros setores. Seu segmento de propriedades nos EUA inclui operações nos Estados Unidos. Seu segmento de propriedades na Ásia inclui operações na Índia. O segmento imobiliário da EMEA inclui operações na Alemanha, Gana, Nigéria, África do Sul e Uganda. O segmento imobiliário da América Latina inclui operações no Brasil, Chile, Colômbia, Costa Rica, México e Peru. Seu segmento de serviço', 'Boston, MA, United States', 4691);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DFDV', 'STOCK', 'DeFi Development Corp.', 'NCM', 'Technology', 'Software - Infrastructure', 'DeFi Development Corp., formerly Janover Inc., provides an artificial intelligence-powered online platform that connects with the commercial real estate industry. It provides data and software subscriptions, and value-added services to multifamily and commercial property professionals. It intends to provide investors with a way to access the Solana ecosystem. Its key treasury disclosures, including Solana balances, SOL per share, and other key metrics provide public market investors with clear visibility into treasury positioning. It serves over one million Web users annually, including multifamily and commercial property owners and developers applying for billions of dollars of debt financing per year, professional service providers, and thousands of multifamily and commercial property lenders, including more than 10% of the banks in America, credit unions, real estate investment trusts, debt funds, Fannie Mae and Freddie Mac multifamily lenders, FHA multifamily lenders, and more.', 'Boca Raton, FL, United States', 14);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLIK', 'STOCK', 'Click Holdings Limited', 'NCM', 'Consumer Cyclical', 'Personal Services', 'Click Holdings Limited is a holding company principally engaged in the human resources solutions providing business. The Company mainly offering professional solution services, nursing solution services, logistics and other solution services. The Company also engages in the talent sourcing and the provision of temporary and permanent personnel to customers. The Company mainly provides its services to certified public accountant (CPA) firms, charitable organizations, non-governmental organizations, small and medium-sized businesses.', 'Tsim Sha Tsui, , Hong Kong', 14);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNQ', 'STOCK', 'Canadian Natural Resources Limited', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Canadian Natural Resources Limited is a senior crude oil and natural gas production company. The Company has operations in its core areas located in Western Canada, the United Kingdom portion of the North Sea and Offshore Africa. Its Oil Sands Mining and Upgrading segment produces synthetic crude oil through bitumen mining and upgrading operations at Horizon Oil Sands (Horizon) and through the Company''s direct and indirect interest in the Athabasca Oil Sands Project (AOSP). Within Western Canada in the Midstream and Refining segment, the Company maintains certain activities that include pipeline operations, an electricity co-generation system and an investment in the North West Redwater Partnership (NWRP), a general partnership formed to upgrade and refine bitumen in the Province of Alberta. Its Pelican Lake asset is a large, contiguous, shallow, medium crude oil pool. It produces natural gas in western Canada and has a significant land base in both the Montney and Deep Basin.', 'Calgary, AB, Canada', 10640);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CP', 'STOCK', 'Canadian Pacific Kansas City Limited', 'NYQ', 'Industrials', 'Railroads', 'A Canadian Pacific Kansas City Limited opera uma linha ferroviária transnacional que liga o Canadá, os Estados Unidos e o México, com acesso inigualável a portos de Vancouver ao Atlantic Canada até o Golfo do México até Lazaro Cardenas, México. Opera mais de 20 000 milhas de rota e fornece aos clientes norte-americanos um serviço ferroviário incomparável e alcance de rede para os principais mercados em todo o continente. Transporta mercadorias a granel, mercadorias e frete intermodal. Oferece um conjunto de serviços de transporte de mercadorias, soluções logísticas e expertise em cadeia de suprimentos. Ele transporta etanol de áreas de produção no Centro-Oeste dos Estados Unidos para os principais mercados de consumo em todo o Nordeste dos Estados Unidos. Atende vários mercados, incluindo grãos canadenses; grãos dos Estados Unidos; granulação; intermodal; automotivo; produtos florestais e industriais; transload, energia, produtos químicos e plásticos. Sua rede coneta fábricas de montag', 'Calgary, AB, Canada', 19943);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTMX', 'STOCK', 'CytomX Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'CytomX Therapeutics, Inc. is a clinical-stage, oncology-focused biopharmaceutical company. The Company is focused on developing conditionally activated, masked biologics designed to be localized to the tumor microenvironment. The Company is developing a pipeline of localized biologics, through its PROBODY therapeutic platform. Its pipeline comprises therapeutic candidates across multiple treatment modalities, including ADCs, T-cell engagers, and immune modulators such as cytokines. Its clinical-stage pipeline includes CX-2051, CX-904 and CX-801. CX-2051 is a masked, conditionally activated ADC directed toward EpCAM, armed with a topoisomerase-1 inhibitor payload. CX-904 is a masked, conditionally activated T-cell-engaging bispecific antibody targeting the EGFR on tumor cells and the CD3 receptor on T cells. CX-801 is a masked interferon alpha-2b PROBODY cytokine with broad potential applicability in traditionally immuno-oncology-sensitive as well as insensitive (cold) tumors.', 'South San Francisco, CA, United States', 119);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMAT', 'STOCK', 'Applied Materials, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Applied Materials, Inc. É uma empresa de soluções de engenharia de materiais. A empresa fornece equipamentos, serviços e software para as indústrias de semicondutores, display e relacionadas. Opera em três segmentos: Sistemas de Semicondutores, Serviços Globais Aplicados (AGS) e Display. O segmento de sistemas Semicondutor projeta, desenvolve, fabrica e vende uma gama de equipamentos principalmente de 300 mm usados para fabricar chips semicondutores, também conhecidos como circuitos integrados (ICs). O segmento AGS fornece serviços, peças de reposição e software de automação de fábrica para fábricas de fabricação de clientes em todo o mundo. O segmento AGS também fabrica e vende 200mm e outros equipamentos. O segmento Display é composto principalmente de produtos para a fabricação de displays de cristal líquido (LCDs), diodos emissores de luz orgânicos (OLEDs) e outras tecnologias de exibição para televisores, monitores, laptops, computadores pessoais (PCs), tablets, tablets e outros d', 'Santa Clara, CA, United States', 36000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AJG', 'STOCK', 'Arthur J. Gallagher & Co.', 'NYQ', 'Financial Services', 'Insurance Brokers', 'Arthur J. Gallagher & Co. É uma empresa global de serviços de corretagem de seguros, gestão de riscos e consultoria. Seus segmentos incluem corretagem, gestão de risco e corporativa. O segmento de corretagem fornece serviços de corretagem e consultoria a entidades de todos os tipos, incluindo entidades comerciais, sem fins lucrativos, do setor público e, em menor medida, os indivíduos, nas áreas de colocação de seguros e resseguros, o risco de gestão de perdas e a gestão de programas de benefícios patrocinados pelo empregador. O segmento de gerenciamento de riscos fornece solução de sinistros contratuais, administração de sinistros, serviços de controle de perdas e consultoria de gerenciamento de riscos para entidades comerciais, sem fins lucrativos, cativas e do setor público, e várias outras organizações que optam por auto-segurar coberturas de propriedade / acidentes ou optar por usar uma organização de gerenciamento de sinistros de terceiros em vez dos serviços de sinistros prestad', 'Rolling Meadows, IL, United States', 55493);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COF', 'STOCK', 'Capital One Financial Corporation', 'NYQ', 'Financial Services', 'Credit Services', 'A Capital One Financial Corporation é uma holding diversificada de serviços financeiros. A empresa oferece uma gama de produtos e serviços financeiros para consumidores, pequenas empresas e clientes comerciais através de canais digitais, filiais, cafés e outros canais de distribuição. Atua através de três segmentos: Cartão de Crédito, Consumer Banking e Commercial Banking. O segmento de cartão de crédito consiste em seus empréstimos domésticos para consumidores e pequenos cartões de visita, e negócios internacionais de cartões no Reino Unido e no Canadá. O segmento Consumer Banking consiste em suas atividades de coleta e empréstimo de depósitos para consumidores e pequenas empresas, e empréstimos nacionais de automóveis. O segmento de Banca Comercial consiste em seus serviços de empréstimo, coleta de depósitos, mercados de capitais e gestão de tesouraria para clientes comerciais imobiliários e comerciais e industriais.', 'McLean, VA, United States', 76500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMR', 'STOCK', 'Emerson Electric Co.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'A Emerson Electric Co. É uma empresa global de tecnologia e software que fornece soluções para clientes em uma ampla gama de mercados finais em todo o mundo. A empresa opera através de sete segmentos sob dois grupos de negócios, como Dispositivos Inteligentes e Software e Controle. O seu negócio de dispositivos inteligentes inclui Controlo Final, Medição e Analítica, Automação Discreta e Segurança e Produtividade. O negócio de software e controlo inclui sistemas de controlo e software, teste e medição e AspenTech. Seu segmento de controle final é um fornecedor global de válvulas de controle, válvulas de isolamento, válvulas de bloqueio, válvulas de alívio de pressão, válvulas de segurança de pressão, atuadores e reguladores para indústrias de processos e híbridos. O seu segmento de medição e análise é um fornecedor de instrumentação inteligente que mede as propriedades físicas de líquidos ou gases. O segmento AspenTech fornece software de otimização de ativos que permite aos fabricante', 'Saint Louis, MO, United States', 73000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMXC', 'STOCK', 'iShares MSCI Emerging Markets ex China ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of the index and in investments that have economic characteristics that are substantially identical to the component securities of its index and may invest up to 20% of its assets in certain futures, options and swap contracts, cash and cash equivalents. The index is a free float-adjusted market capitalization-weighted index that captures large- and mid-capitalization stocks across 23 of the 24 Emerging Markets countries, excluding China.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRWD', 'STOCK', 'CrowdStrike Holdings, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'A CrowdStrike Holdings, Inc. É uma empresa global de segurança cibernética que fornece proteção de endpoints, cargas de trabalho em nuvem, identidade e dados. Sua plataforma Falcon é projetada para consolidação de segurança cibernética, construída especificamente para impedir violações. As plataformas coletam e integram dados de toda a empresa, incluindo endpoints, cargas de trabalho em nuvem, identidades e fontes de terceiros. Ele oferece 29 módulos de nuvem em sua plataforma Falcon por meio de um modelo baseado em assinatura de software como serviço (SaaS) que abrange vários grandes mercados, incluindo segurança corporativa de endpoint e carga de trabalho na nuvem, serviços de segurança gerenciados, gerenciamento de segurança e vulnerabilidade, gerenciamento de operações de tecnologia da informação (TI), proteção de identidade, proteção de dados, automação e resposta artificial (automação) e outros.', 'Austin, TX, United States', 10363);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ERJ', 'STOCK', 'Embraer S.A.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'A Embraer SA é uma fabricante brasileira de jatos. A Companhia produz aeronaves para aviação comercial e executiva, bem como para fins de defesa e segurança e serviços relacionados. Seus segmentos incluem o negócio de aviação comercial, que envolve o desenvolvimento, produção e venda de jatos comerciais, e prestação de serviços de apoio, particularmente no segmento de aviação regional e locação de aeronaves; negócio de jatos executivos, que comercializa seus jatos executivos para empresas, incluindo empresas de propriedade fracionada, empresas de fretamento e táxi aéreo, indivíduos de alto patrimônio líquido e academias de voo; segmento de Negócios de Defesa e Segurança, que concebe, desenvolve, e suporte a um mercado integrado; e outros segmentos de negócios relacionados, que fornecem sistemas de combustível, peças estruturais e sistemas mecânicos e hidráulicos para a Sikorsky Aircraft Corporation para sua produção de helicópteros.', 'São Paulo, SP, Brazil', 20923);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALKS', 'STOCK', 'Alkermes plc', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Alkermes plc is Ireland-based biopharmaceutical company that seeks to develop medicines in the field of neuroscience. The Company has a portfolio of commercial products for the treatment of alcohol dependence, opioid dependence, schizophrenia and bipolar I disorder and a pipeline of clinical and preclinical candidates in development for neurological disorders. It focuses on commercial products, such as LYBALVI, ARISTADA/ARISTADA INITIO and VIVITROL, and advancing the development of pipeline programs focused on neurological disorders. LYBALVI is a once-daily, oral atypical antipsychotic drug for the treatment of adults with schizophrenia and for the treatment of adults with bipolar I disorder, as a maintenance monotherapy or for the acute treatment of manic or mixed episodes, as monotherapy or an adjunct to lithium or valproate. ARISTADA is an extended-release intramuscular injectable suspension for the treatment of schizophrenia. It has a manufacturing facility in Wilmington, Ohio.', 'Dublin, , Ireland', 1800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALIT', 'STOCK', 'Alight, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Alight, Inc. is a cloud-based human capital technology and services provider. It is engaged in delivering human capital management solutions to various organizations. This includes the implementation and administration of employee benefits (e.g. health, wealth, and leaves benefits) solutions. It allows participants to access their solutions digitally, including through a mobile application on Alight Worklife, its intuitive, cloud-based employee engagement platform. Through Alight Worklife, the Company provides an enterprise level, integrated offering designed to drive better outcomes for organizations and individuals. Its primary business, Employer Solutions, is driven by its Alight Worklife platform, and includes integrated benefits administration, healthcare navigation, financial wellbeing, leave of absence management and retiree healthcare. The Company''s clients'' employees benefit from an integrated platform and user experience, coupled with a full-service customer care center.', 'Chicago, IL, United States', 9500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABNB', 'STOCK', 'Airbnb, Inc.', 'NMS', 'Consumer Cyclical', 'Travel Services', 'A Airbnb, Inc. Opera uma plataforma global para estadias e experiências. O modelo de mercado da empresa coneta anfitriões e convidados on-line ou através de dispositivos móveis para reservar espaços e experiências em todo o mundo. A empresa construiu sua plataforma para integrar novos hosts, especialmente aqueles que anteriormente não tinham considerado hospedagem. Ele faz parceria com os anfitriões durante todo o processo de configuração de sua listagem e fornece-lhes um conjunto de ferramentas para gerenciar suas listagens, incluindo agendamento, merchandising, pagamentos integrados, suporte à comunidade, suporte ao cliente, suporte ao cliente, suporte ao cliente e suporte ao cliente. proteção do host, orientação de preços e feedback de avaliações. Seu site e aplicativos móveis oferecem aos seus hóspedes uma maneira de explorar uma variedade de casas e experiências e uma maneira fácil de reservá-los. Sua plataforma tecnológica alimenta seu mercado bilateral e permite sua rede global ', 'San Francisco, CA, United States', 7300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MMM', 'STOCK', '3M Company', 'NYQ', 'Industrials', 'Conglomerates', 'A 3M Company é uma empresa de tecnologia diversificada. A empresa é um fabricante e comerciante de uma variedade de produtos e serviços. Os segmentos da Companhia incluem Segurança e Industrial; Transportes e Eletrônica e Consumidor. Seu segmento de Segurança e Industrial inclui abrasivos industriais e acabamento para aplicações de metalurgia; soluções de reparo de autocorpos; produtos especiais industriais, como produtos de higiene pessoal, mascaramento e materiais de embalagem, entre outros. Seu segmento de Transporte e Eletrônica inclui soluções cerâmicas avançadas; fixação/colagem, filmes, gerenciamento de som e temperatura para veículos de transporte; filmes gráficos de grande formato premium para publicidade e sinalização de frotas. Seu segmento de consumo inclui produtos de limpeza para casa; produtos de qualidade do ar de consumo e acessórios de suspensão de imagens. Suas marcas incluem 3M Cubitron II Abrasives, Scotch-Brite, Filtrete, Command, Scotchgard, Meguiar, Nexcare, Pos', 'Saint Paul, MN, United States', 61500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DECK', 'STOCK', 'Deckers Outdoor Corporation', 'NYQ', 'Consumer Cyclical', 'Footwear & Accessories', 'Deckers Outdoor Corporation designs, markets, and distributes footwear, apparel, and accessories developed for both everyday casual lifestyle use and high-performance activities. Its segments include UGG brand, HOKA brand, Teva brand, and Other brands, as well as Direct-to-Consumer (DTC). The UGG brand segment provides premium footwear, apparel and accessories with expanded product offerings. The HOKA brand segments products include running, trail, hiking, fitness and lifestyle footwear offerings, as well as select apparel and accessories. The Teva brand segment includes a variety of footwear options, from classic sandals and shoes to boots, all crafted for the demands of the outdoors. Its Other brands segment consists primarily of the Koolaburra brand, as well as the AHNU brand. The Koolaburra brand is a casual footwear fashion line that uses plush materials. The DTC segment encompasses all of its brands and consists of its e-commerce Websites and retail stores.', 'Goleta, CA, United States', 5500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRX', 'STOCK', 'Brixmor Property Group Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Brixmor Property Group Inc. is an internally managed real estate investment trust (REIT). The Company conducts its operations primarily through, Brixmor Operating Partnership LP and subsidiaries (collectively, the Operating Partnership). The Company owns and operates open-air retail portfolios by gross leasable area (GLA) in the United States, comprised primarily of community and neighborhood shopping centers. The Companys portfolio consists of approximately 363 shopping centers (the Portfolio) totaling over 64 million square feet of GLA. The Companys projects include Dickson City Crossings, East Port Plaza, Fox Run, Gateway Plaza, Old Bridge Gateway, Pointe Orlando, Shops at Palm Lakes, Stewart Plaza, Tinley Park Plaza, Tyrone Gardens, Vail Ranch Center, Venice Village, Village at Mira Mesa and Westminster City Center. The Companys national portfolio is primarily located within established trade areas in the top 50 Core-Based Statistical Areas (CBSAs) in the United States.', 'New York, NY, United States', 453);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBWI', 'STOCK', 'Bath & Body Works, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'Bath & Body Works, Inc. É um Varejista omnichannel focado em cuidados pessoais e fragrância doméstica. A empresa vende mercadorias através de suas lojas de varejo nos Estados Unidos (EUA) e Canadá, e através de seus sites e outros canais, sob The Bath & Body Works, White Barn e outras marcas. Seu negócio internacional é conduzido através de franquias, licenças e parceiros grossistas. Oferece uma gama de cuidados e fragrância caseira, incluindo coleções de névoa de fragrância fina, loção corporal e creme corporal, velas de 3 pavio, difusores de fragrância doméstica e sabonete líquido para as mãos. Seus produtos são diferenciados por meio de uma combinação de fragrância, embalagem e qualidade a preços acessíveis. Também vende produtos sob suas sub marcas, incluindo White Barn. Sua mercadoria é vendida através de cerca de 1 850 lojas operadas pela empresa e sites de comércio eletrônico nos EUA e no Canadá, e em 485 lojas e 28 sites de comércio eletrônico em mais de 40 outros países que op', 'Columbus, OH, United States', 8975);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHP', 'STOCK', 'BHP Group Limited', 'NYQ', 'Basic Materials', 'Other Industrial Metals & Mining', 'O BHP Group Ltd, anteriormente BHP Billiton Ltd, é uma empresa de recursos globais. A Companhia é produtora de várias mercadorias, incluindo minério de ferro, carvão metalúrgico, cobre e urânio. Seus segmentos incluem petróleo, cobre, minério de ferro e carvão. O segmento de Petróleo está envolvido na exploração, desenvolvimento e produção de petróleo e gás. O segmento de cobre atua na mineração de cobre, prata, chumbo, zinco, molibdênio, urânio e ouro. O segmento de Minério de Ferro está envolvido na mineração de minério de ferro. O segmento de carvão está envolvido na mineração de carvão metalúrgico e carvão térmico (energia). Seus negócios incluem Minerals Australia, Minerals Americas, Petroleum and Marketing. A Companhia extrai e processa minerais, petróleo e gás de suas operações de produção localizadas principalmente na Austrália e nas Américas. A Companhia gerencia a distribuição de produtos através de sua cadeia logística global, incluindo transporte de cargas e oleodutos.', 'Melbourne, VIC, Australia', 38962);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DX', 'STOCK', 'Dynex Capital, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Dynex Capital, Inc. is a financial services company. The Company is an internally managed mortgage real estate investment trust (REIT), which invests in mortgage-backed securities (MBS). It finances its investments principally with repurchase agreements. Its objective is to provide attractive risk-adjusted returns to its shareholders over the long term that are reflective of a leveraged, high-quality fixed income portfolio with a focus on capital preservation. It seeks to provide returns to its shareholders primarily through the payment of regular dividends and through capital appreciation of its investments. It primarily invests in Agency MBS, of which over 97% are residential MBS (Agency RMBS), including to-be-announced (TBA) securities. The remainder of its investment portfolio consists of Agency commercial MBS (Agency CMBS) and Agency and non-Agency CMBS interest-only (CMBS IO) securities.', 'Glen Allen, VA, United States', 22);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EL', 'STOCK', 'The Estée Lauder Companies Inc.', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'A Estee Lauder Companies Inc. É um fabricante, comerciante e vendedor de produtos de cuidados com a pele, maquiagem, fragrância e cuidados com o cabelo. Suas categorias de produtos incluem cuidados com a pele, maquiagem, fragrância, cuidados com o cabelo e outros. Seus produtos são vendidos em aproximadamente 150 países e territórios sob uma série de marcas, incluindo Estee Lauder, Aramis, Clinique, Lab Series, Origins, M.A.C, Bobbi Brown Cosmetics, La Mer, Aveda, JO Malone London, Bumble and Bumble, Darphin Paris, TOM Ford, Smashbox, AERIN Beauty, Le Labo, Editions de Parfums Frederic Malle, GLAMGLOW, Kilian Paris, Too Faced, Dr.A Jart e a família de marcas DECIEM, incluindo a Ordinária e a NIOD. É licenciado para fragrâncias, cosméticos e/ou produtos relacionados para AERIN, BALMAIN e Dr. Andrew Weil. Seus produtos para cuidados com a pele incluem hidratantes, séruns, limpadores, toners, esfoliantes, máscaras faciais, cuidados corporais, produtos de cuidados solares e outros. Seus pr', 'New York, NY, United States', 44020);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECX', 'STOCK', 'ECARX Holdings Inc.', 'NGM', 'Consumer Cyclical', 'Auto Parts', 'ECARX Holdings Inc is a holding company mainly engaged in the development of system on a chip (SoC) core modules, automotive computing platforms and software solutions. The Company is committed to transforming vehicles into seamlessly integrated information, communications, and transportation devices. The Companys core products include infotainment head units (IHU), digital cockpits, vehicle chip-set solutions, a core operating system and integrated software stack. The Company is also engaged in developing a full-stack automotive computing platform. The Company mainly serves customers such as original equipment manufacturers (OEMs) and tier 1 automotive suppliers.', 'Shanghai, , China', 1800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASST', 'STOCK', 'Asset Entities Inc.', 'NCM', 'Communication Services', 'Internet Content & Information', 'Asset Entities Inc. is a technology company providing social media marketing, management, and content delivery across Discord, TikTok, Instagram, X, YouTube, and other social media platforms. The Company also designs, develops and manages servers for communities on Discord. Its services include Discord investment education and entertainment, social media and marketing, and the AE.360.DDM brand. It also offers Ternary v2, a cloud-based subscription management and payment processing solution for Discord communities, which includes a suite of customer relations management tools and Stripe-verified payment processing. The Company''s Discord investment education and entertainment service is designed primarily by and for Generation Z, retail investors, creators and influencers. The Company''s services are focused on stock, real estate, cryptocurrency, and NFT community learning programs. Its AE.360.DDM is a suite of services for individuals and companies seeking to create a server on Discord', 'Dallas, TX, United States', 9);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALK', 'STOCK', 'Alaska Air Group, Inc.', 'NYQ', 'Industrials', 'Airlines', 'A Alaska Air Group, Inc. Está envolvida em companhias aéreas operacionais. A Companhia opera através de suas subsidiárias Alaska Airlines, Inc., Hawaiian Holdings, Inc., Horizon Air Industries, Inc., e McGee Air Services. Os segmentos da Companhia incluem Alaska Airlines, Hawaiian Airlines e Regional. O segmento da Alaska Airlines inclui transporte aéreo regular na aeronave a jato Boeing do Alasca para passageiros e carga. O segmento da Hawaiian Airlines inclui transporte aéreo regular em aeronaves Boeing e Airbus da Hawaiian para passageiros e carga. O segmento Regional inclui o transporte aéreo regular da Horizon e de outras companhias aéreas terceirizadas em aeronaves a jato E175 para passageiros sob acordos de compra de capacidade (CPAs). A empresa atende mais de 140 destinos em toda a América do Norte, América Central, Ásia e em todo o Pacífico. A Companhia presta serviços de frete e correio (carga) utilizando aeronaves de carga e as barrigas de seus aviões de passageiros.', 'Seattle, WA, United States', 30536);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BK', 'STOCK', 'The Bank of New York Mellon Corporation', 'NYQ', 'Financial Services', 'Banks - Diversified', 'O Bank of New York Mellon Corporation é uma empresa global de serviços financeiros. O segmento de negócios da Companhia inclui Serviços de Valores Mobiliários, Serviços de Mercado e Riqueza e Gestão de Investimentos e Riqueza. O segmento de negócios de Serviços de Valores Mobiliários consiste em Serviços de Serviços de Ativos e Serviços de Emissor, que fornecem soluções de negócios em todo o ciclo de vida da transação para seus clientes globais de proprietários de ativos e gerentes de ativos. O segmento de negócios Market and Wealth Services é composto por três linhas de negócios, Pershing, Treasury Services e Clearance and Collateral Management, que fornecem serviços de negócios e soluções tecnológicas. Seu segmento de negócios de Investimento e Gestão de Riqueza oferece um portfólio diversificado de estratégias de investimento de forma independente, e por meio de sua rede de distribuição global, para clientes institucionais e de varejo globalmente. Ele fornece gestão de investimentos', 'New York, NY, United States', 49900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ONCY', 'STOCK', 'Oncolytics Biotech Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Oncolytics Biotech Inc. is a clinical-stage biotechnology company developing pelareorep, an intravenously delivered immunotherapeutic agent that activates the innate and adaptive immune systems and weakens tumor defense mechanisms. This improves the ability of the immune system to fight cancer, making tumors more susceptible to a broad range of oncology treatments. It acts by inducing anti-cancer immune responses and promotes an inflamed tumor phenotype, turning cold tumors hot through innate and adaptive immune responses to treat a variety of cancers. The Company is also advancing its programs in hormone receptor-positive / human epidermal growth factor 2-negative (HR+/ HER2-) advanced and metastatic breast cancer (mBC) and metastatic pancreatic ductal adenocarcinoma (PDAC) to registration-enabled clinical studies. In addition, it is exploring opportunities for registrational programs in other gastrointestinal cancers through its GOBLET platform study.', 'Calgary, AB, Canada', 28);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCI', 'STOCK', 'Crown Castle Inc.', 'NYQ', 'Real Estate', 'REIT - Specialty', 'A Crown Castle Inc. Possui, opera e aluga mais de 40 000 torres de células e aproximadamente 90 000 quilômetros de rotas de fibra que suportam pequenas células e soluções de fibra em todos os mercados dos Estados Unidos. Seu negócio principal é fornecer acesso, incluindo espaço ou capacidade, à sua infraestrutura de comunicações compartilhadas por meio de contratos de locatários de longo prazo em várias formas, incluindo contratos de locação, licença, sublocação e serviços nos Estados Unidos. Seus segmentos incluem torres e fibra, que inclui células pequenas e soluções de fibra. O segmento Towers fornece acesso, incluindo espaço ou capacidade, às mais de 40 000 torres da Companhia em todo os Estados Unidos. O segmento Towers também presta serviços auxiliares relacionados às torres da Companhia, consistindo em serviços de desenvolvimento de instalações e serviços de instalação. O segmento Fibre consiste em ofertas de infraestrutura de comunicações de pequenas células e soluções de fibra', 'Houston, TX, United States', 3900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AA', 'STOCK', 'Alcoa Corporation', 'NYQ', 'Basic Materials', 'Aluminum', 'Alcoa Corporation is a vertically integrated aluminum company comprised of bauxite mining, alumina refining, aluminum production (smelting and casting), and energy generation. The Companys operations are comprised of two business segments: Alumina and Aluminum. The Alumina segment primarily consists of its bauxite mines and alumina refineries, which generally include the mining of bauxite and other aluminous ores, as well as the refining, production, and sale of smelter grade and non-metallurgical alumina. The alumina produced by this segment is sold to internal and external aluminum smelter customers; a portion of the alumina is sold to external customers who process it into industrial chemical products. The Aluminum segment consists of the Companys aluminum smelting and casting operations along with the Companys energy production assets in Brazil, Canada, and the United States. It has direct and indirect ownership of 26 operating locations across nine countries on six continents.', 'Pittsburgh, PA, United States', 13900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABVE', 'STOCK', 'Above Food Ingredients Inc.', 'NGM', 'Consumer Defensive', 'Packaged Foods', 'Above Food Ingredients Inc. is a differentiated, regenerative ingredient company with a vertically integrated supply chain that produces products. The Company delivers nutritious foods to businesses and consumers. It has three main product lines and operates in two segments: Disruptive Agriculture and Rudimentary Ingredients, and Consumer Packaged Goods (CPG). The Disruptive Agriculture and Rudimentary Ingredients segment concentrates on the provisioning of discrete genetics, origination, purchasing, grading, primary processing and sale of regeneratively grown grain, as well as the origination, purchase, and sale of bespoke ingredients products, processed primarily through the Company-owned ingredient facilities. The CPG segment formulates, manufactures, sells, distributes, and markets proprietary consumer product formulations in owned brands and focuses on manufacturing and distribution for private-labeled retail owned brands. Its brands include Neat, Tuno, Eat Up! and others.', 'Regina, SK, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABVX', 'STOCK', 'ABIVAX Société Anonyme', 'NGM', 'Healthcare', 'Biotechnology', 'Abivax SA is a clinical stage biopharmaceutical company focusing on the discovery, development and commercialization of anti-viral compounds and therapeutic vaccines against severe and life threatening infectious diseases. ABIVAX utilizes RNA-protein interaction interference and cytotoxic TH1 cell amplification to generate therapies to help patients clear viruses like HIV, HBV and HPV. The Company''s product pipeline comprises ABX 203, which is the therapeutic vaccine candidate obtained from the Centre for Genetic Engineering and Biotechnology, Cuba (CIGB) and is intended for patients with chronic hepatitis B disease; and ABX196, the adjuvant for therapeutic vaccines, among others.', 'Paris, , France', 69);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATUS', 'STOCK', 'Altice USA, Inc.', 'NYQ', 'Communication Services', 'Telecom Services', 'Altice USA, Inc. is a broadband communications and video services provider in the United States, delivering broadband, video, mobile, proprietary content and advertising services to residential and business customers across 21 states through its Optimum brand. The Company operates Optimum Media, an advanced advertising and data business, which provides audience-based, multiscreen advertising solutions to local, regional and national businesses and advertising clients. It also provides enterprise-grade fiber connectivity, bandwidth and managed services to enterprise and hyperscaler customers and provides advertising time and services to advertisers. In addition, it offers various news programming through traditional linear and digital platforms to consumers across its footprint. It offers a variety of video services through Optimum TV, which includes delivery of broadcast stations and cable networks, over the top (OTT) services such as Netflix, Amazon Prime, YouTube and others.', 'Long Island City, NY, United States', 10900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELV', 'STOCK', 'Elevance Health, Inc.', 'NYQ', 'Healthcare', 'Healthcare Plans', 'Elevance Health, Inc. É uma empresa de saúde. Atua como seguradora de saúde nos Estados Unidos. A empresa opera através de quatro segmentos: Benefícios para a saúde, CarelonRx, Carelon Services e Corporate & Other. O segmento de benefícios para a saúde oferece um conjunto abrangente de planos e serviços de saúde para o seu indivíduo, Grupo de Empregador baseado em risco, Grupo de Empregador baseado em taxas, BlueCard, Medicare, Membros do Medicaid e do Federal Employee Program (FEP). O segmento de benefícios para a saúde também oferece produtos para a saúde em uma base de risco total. O segmento CarelonRx inclui seu negócio de serviços de farmácia. A CarelonRx comercializa e oferece serviços de farmácia para seus clientes afiliados de planos de saúde, bem como para clientes externos fora dos planos de saúde. O segmento de Serviços Carelon integra serviços físicos, comportamentais, de farmácia e sociais, oferecendo uma variedade de serviços e capacidades relacionados à saúde para client', 'Indianapolis, IN, United States', 104200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACN', 'STOCK', 'Accenture plc', 'NYQ', 'Technology', 'Information Technology Services', 'Accenture plc é uma empresa global de serviços profissionais. Está envolvida no fornecimento de uma gama de serviços e soluções em estratégia e consultoria, tecnologia, operações, Indústria X e Song. Seus serviços incluem serviços de aplicação, inteligência artificial, automação, terceirização de processos de negócios, estratégia de negócios, gerenciamento de mudanças, nuvem, experiência do cliente, dados e análises, parceiros de ecossistema, consultoria financeira, Indústria X, infraestrutura, marketing, fusões e aquisições, modelos operacionais, segurança, gestão da cadeia de suprimentos, sustentabilidade, consultoria de tecnologia, inovação tecnológica e orçamento baseado em zero (ZBB). É especializada na plataforma de tecnologia empresarial SAP que projeta produtos e experiências digitais para clientes empresariais, incluindo portais personalizados e soluções Web e aplicativos móveis. Fornece aos clientes serviços de gestão de riscos e conformidade quantitativos e qualitativos. É e', 'Dublin, , Ireland', 791000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAVA', 'STOCK', 'CAVA Group, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'CAVA Group, Inc. is a category-defining Mediterranean fast-casual restaurant brand. The Companys Mediterranean cuisine unites taste and health, with a menu that features chef-curated and customizable bowls and pitas. Its dips, spreads, and dressings are centrally produced and sold in grocery stores. Its menu offers a range of dietary preferences, from hearty and indulgent to vegan, vegetarian, gluten-free, dairy-free, paleo, keto, and nut-free diets. Its guests can choose a chef-curated meal or a build-your-own-bowl or pita using its 38 ingredients with over 17.4 billion combinations. It has developed a multi-channel experience that consists of in-restaurant dining, digital pick-up, drive-thru pick-up in select restaurants, delivery, catering, and consumer packaged goods offerings, fully supported by its digital infrastructure. It operates two production facilities: one in Maryland and one in Virginia. It operates in approximately 26 states and the District of Columbia.', 'Washington, DC, United States', 10300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFLY', 'STOCK', 'Butterfly Network, Inc.', 'NYQ', 'Healthcare', 'Medical Devices', 'Butterfly Network, Inc. is a healthcare company focused on medical imaging with its Ultrasound-on-Chip semiconductor technology and ultrasound software solutions. The Company''s solution, leveraging its Ultrasound-on-Chip technology, enables the practical application of ultrasound information into the clinical workflow. Its product portfolio includes a combination of hardware and software, including Butterfly iQ3, Butterfly iQ+, Butterfly iQ+ Bladder, and Butterfly iQ+ Vet devices, software subscriptions, and professional services. It offers cloud-based software solutions to healthcare systems, teleguidance, in-app educational tutorials as well as its ScanLab education-only app, formal education programs through its Butterfly Academy software and Butterfly Certified courses, as well as professional services for large scale deployments. Its devices are commercially available to trained healthcare practitioners in areas including, but not limited to, parts of Africa, Asia, and Australia.', 'Burlington, MA, United States', 190);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRH', 'STOCK', 'CRH plc', 'NYQ', 'Basic Materials', 'Building Materials', 'A CRH PLC é uma empresa sediada na Irlanda. A empresa fabrica e distribui uma gama diversificada de materiais e produtos de construção superiores, que são utilizados em projetos de construção de todos os tamanhos. Atua em três segmentos em duas divisões. Suas divisões incluem Américas e Internacional. Sua Divisão das Américas é composta por dois segmentos: Americas Materials Solutions e Americas Building Solutions. A Americas Materials Solutions fornece materiais de construção para a construção e manutenção de infraestrutura pública e edifícios comerciais e residenciais na América do Norte. Os materiais primários produzidos por este segmento incluem agregados, cimento, concreto readymixed e asfalto. A Americas Building Solutions fabrica, fornece e fornece soluções para o ambiente construído em comunidades em toda a América do Norte. Sua Divisão Internacional, que compreende um segmento, a International Solutions, é uma provedora de soluções integradas de construção principalmente em to', 'Dublin, , Ireland', 79800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCRX', 'STOCK', 'BioCryst Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'BioCryst Pharmaceuticals, Inc. is a biotechnology company focused on improving the lives of people living with hereditary angioedema and other rare diseases. The Company leverages its expertise in designing to develop first-in-class oral small-molecule and protein therapeutics to target difficult-to-treat diseases. Its marketed products include oral, once-daily ORLADEYO for the prevention of hereditary angioedema (HAE) attacks and RAPIVAB (peramivir injection) for the treatment of acute uncomplicated influenza in the United States. Its other products and product candidates include BCX10013, RAPIACTA (peramivir injection), PERAMIFLU (peramivir injection), and early-stage discovery programs. BCX10013, is a potent and specific Factor D inhibitor. RAPIACTA focuses on uncomplicated seasonal influenza. The RAPIVAB (peramivir injection) is approved in the United States for the treatment of acute uncomplicated influenza for patients six months and older.', 'Durham, NC, United States', 580);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSTM', 'STOCK', 'Constellium SE', 'NYQ', 'Basic Materials', 'Aluminum', 'Constellium SE is a France-based company. The Company is predominantly engaged in the development, manufacturing, and recycling of aluminum products and solutions. It focuses on the development of aluminum products for a broad scope of markets and applications, including aerospace, packaging and automotive. It operates through three segments: Aerospace & Transportation (A&T), Packaging & Automotive Rolled Products (P&ARP), and Automotive Structures & Industry (AS&I). A&T provides aluminum solutions for aircraft and transportation. P&ARP supplies rolled products for packaging and vehicles. AS&I focuses on structural components for automotive applications, including original equipment manufacturers.', 'Paris, , France', 12000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EH', 'STOCK', 'EHang Holdings Limited', 'NGM', 'Industrials', 'Aerospace & Defense', 'EHang Holdings Ltd is an investment holding company primarily engaged in the provision of unmanned aerial vehicle (UAV) systems and solutions. The Company operates three businesses. The air mobility solutions business is engaged in providing customers with electric vertical takeoff and landing (eVTOL) aircraft products, solutions and operational services for air transportations of passengers, cargos, emergencies and others. The smart city management solutions business is engaged in providing integrated digital platform with customized UAV models as turn-key solutions for monitoring and management across many ordinary municipal functions and public utilities, such as traffic management, powerline inspection, environmental monitoring, firefighting, emergency rescue, aerial mapping and others. The aerial media solutions business is engaged in providing aerial media performances, also known as drone light shows. The Company conducts its business in the domestic and overseas markets.', 'Guangzhou, , China', 483);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMDD', 'STOCK', 'Direxion Daily AMD Bear 1X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of the fund’s net assets in financial instruments, including swap agreements and options, that, in combination, provide 1X daily inverse (opposite) or short exposure to AMD, consistent with the fund’s investment objective. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACGL', 'STOCK', 'Arch Capital Group Ltd.', 'NMS', 'Financial Services', 'Insurance - Diversified', 'Arch Capital Group Ltd. is a Bermuda-based company, which provides insurance, reinsurance and mortgage insurance through its subsidiaries. The insurance segment consists of the Companys insurance underwriting units, which offer specialty product lines, including construction and national accounts; excess and surplus casualty; professional lines; programs; property, energy, marine and aviation; travel, accident and health; warranty and lenders solutions, and others (consisting of alternative markets, excess workers'' compensation and surety business). The reinsurance segment consists of its reinsurance underwriting units, which offer specialty product lines, including casualty; marine and aviation; other specialty; property catastrophe; property excluding property catastrophe, and other (consisting of life reinsurance and other). The mortgage segment includes its United States primary mortgage insurance business, investment and services related to United States credit-risk transfer.', 'Pembroke, , Bermuda', 7200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMBL', 'STOCK', 'Bumble Inc.', 'NMS', 'Communication Services', 'Internet Content & Information', 'A Bumble Inc. Está fornecendo aplicativos de namoro e redes sociais on-line por meio de assinatura e compras no aplicativo de produtos que atendem a América do Norte, Europa e vários outros países ao redor do mundo. A Empresa fornece esses serviços através de sites e aplicativos que possui e opera. Ele opera uma família de aplicativos, incluindo o aplicativo Bumble, o aplicativo Bumble for Friends, o aplicativo Badoo e Genebra. No aplicativo Bumble, os usuários podem inserir informações sobre si mesmos e configurar um perfil, que pode ser personalizado de várias maneiras, como adicionando um Badge para exibir com destaque determinados valores ou caraterísticas. Além de namorar, no aplicativo Bumble também fornece produtos que permitem conexão social, oferecendo aos usuários a oportunidade de desenvolver conexões platônicas através do modo BFF para amizades e através do modo Bizz para redes profissionais e mentoria. Genebra é um aplicativo de grupo e comunidade para as pessoas se coneta', 'Austin, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALHC', 'STOCK', 'Alignment Healthcare, Inc.', 'NMS', 'Healthcare', 'Healthcare Plans', 'Alignment Healthcare, Inc. is a consumer-centric platform designed to improve the healthcare experience for seniors. The Companys operations primarily consist of Medicare Advantage Plans in the states of California, North Carolina, Nevada, Arizona, Florida and Texas. It partners with local providers to deliver coordinated care, powered by its customized care model, 24/7 concierge care team and purpose-built technology (AVA). AVAs capabilities include consumer experience, internal care delivery, external providers, health plan operations and growth operations. AVA offers a digital ecosystem that enables its members and their support system to get the information and care they need, when and how they need it. With their AVA-powered member portal and mobile app, seniors have many self-service capabilities and can get 24/7 care, send secure messages to their concierge and care teams, check their rewards and ACCESS On-Demand Concierge Card balance, and view their health history.', 'Orange, CA, United States', 1679);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DQ', 'STOCK', 'Daqo New Energy Corp.', 'NYQ', 'Technology', 'Semiconductor Equipment & Materials', 'Daqo New Energy Corp. is a polysilicon manufacturer. The Company utilizes the chemical vapor deposition process, or the modified Siemens process, to produce polysilicon. The Company''s segments include Polysilicon and Wafer. The Company manufactures and sells polysilicon to photovoltaic product manufacturers, whereby the polysilicon is processed into ingots, wafers, cells and modules for solar power solutions. The Company offers ready-to-use polysilicon, packaged to meet crucible stacking, pulling and solidification needs. The Company offers wafers through its downstream photovoltaic product manufacturing business. The Company also provides wafer original equipment manufacturer (OEM) service to external customers through tolling agreements by processing polysilicon to produce ingot and wafer. Its annual capacity for polysilicon is approximately 12,150 metric tons (MT) in Xinjiang. The Company''s wafer manufacturing annual capacity is approximately 90 million pieces.', 'Shanghai, , China', 4749);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NVST', 'STOCK', 'Envista Holdings Corporation', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Envista Holdings Corporation is a global dental products company. The Company''s diversified portfolio of solutions covers a range of dentists'' clinical needs for preventing, diagnosing, and treating dental conditions as well as improving the aesthetics of the human smile. It has more than 30 dental brands, including Nobel Biocare, Ormco, DEXIS and Kerr. Its segments include Specialty Products & Technologies, and Equipment & Consumables. The Specialty Products & Technologies segment primarily develops, manufactures and markets dental implant systems, including regenerative solutions, dental prosthetics and associated treatment software and technologies, as well as orthodontic bracket systems, aligners and lab products. The Equipment & Consumables segment primarily develops, manufactures, and markets dental equipment and supplies used in dental offices, including digital imaging systems, software, and other visualization/magnification systems; and endodontic systems and related product', 'Brea, CA, United States', 12300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADM', 'STOCK', 'Archer-Daniels-Midland Company', 'NYQ', 'Consumer Defensive', 'Farm Products', 'A Archer-Daniels-Midland Company é uma gestora e processadora global da cadeia de suprimentos agrícola, fornecendo segurança alimentar conetando as necessidades locais com capacidades globais. É um fornecedor de nutrição humana e animal. Seu segmento de Serviços AG e oleaginosas inclui atividades globais relacionadas à originação, merchandising, transporte e armazenamento de matérias-primas agrícolas, bem como o esmagamento e posterior processamento de oleaginosas, como soja e sementes moles em óleos vegetais e alimentos proteicos. O segmento de Soluções de Hidratos de Carbono está envolvido na moagem de milho e trigo úmido e seco e outras atividades. O segmento de nutrição está envolvido na criação, fabricação, venda e distribuição de uma ampla gama de ingredientes e soluções, incluindo proteínas à base de plantas, sabores e cores derivados da natureza, sistemas de sabor, emulsionantes, fibra solúvel, polióis, hidrocoloides, probióticos, prebióticos, postbióticos, enzimas, extratos bo', 'Chicago, IL, United States', 42383);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKBA', 'STOCK', 'Akebia Therapeutics, Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Akebia Therapeutics, Inc. is a fully integrated biopharmaceutical company with two commercial products for patients impacted by kidney disease. The Company is focused on developing and commercializing therapeutics. Its two preclinical development candidates are AKB-9090 and AKB-10108. The Companys portfolio and hypoxia-inducible factor (HIF)-based commercialized products include Auryxia (ferric citrate) and Vafseo. Auryxia (ferric citrate) is an orally administered medicine approved and marketed in the United States for two indications: the control of serum phosphorus levels in adult patients with dialysis dependent chronic kidney disease (DD-CKD), and the treatment of iron deficiency anemia (IDA), in adult patients with non-dialysis-dependent chronic kidney disease (NDD-CKD). Vafseo, an oral HIF prolyl hydroxylase (HIF-PH), inhibitor. It utilizes third parties for the commercial distribution of Auryxia, including wholesale distributors and certain specialty pharmacy providers.', 'Cambridge, MA, United States', 181);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGL', 'STOCK', 'agilon health, inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'agilon health, inc. is a healthcare company. It enables primary care physicians (PCP) to be the agents for change in the communities they serve. Through its combination of the agilon platform, a long-term partnership model with existing physician groups and a growing network of like-minded physicians, it offers healthcare for seniors across communities throughout the United States. Its model operates by primarily forming risk-bearing entities (RBEs) within local geographies, that enter into arrangements with payors providing for monthly payments to manage the total healthcare needs of its physician partners attributed patients (or global capitation arrangements). It focuses on community-based physician groups and is built around three key elements: agilons platform, agilons long-term physician partnership approach, and agilons network. The agilon platform is holistic in supporting the rapid transition to a Total Care Model with technology, people, process and capital.', 'Westerville, OH, United States', 1076);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DB', 'STOCK', 'Deutsche Bank Aktiengesellschaft', 'NYQ', 'Financial Services', 'Banks - Regional', 'Deutsche Bank AG é um banco e holding para suas subsidiárias. A Empresa oferece uma ampla gama de produtos e serviços financeiros para pessoas físicas, entidades corporativas e clientes institucionais. Ela opera por meio de quatro divisões de negócios: Banco Corporativo, Banco de Investimento, Private Banking e Gestão de Ativos. O Banco Corporativo se concentra principalmente em atender clientes corporativos e atua como um provedor especializado de serviços para instituições financeiras, oferecendo Correspondent Banking, Trust and Agency Services, bem como Securities Services. O Banco de Investimento combina os negócios de Fixed Income & Currencies (FIC) Sales & Trading e Origination & Advisory da empresa, bem como o Deutsche Bank Research. A divisão de Private Banking atende clientes individuais, incluindo pessoas de alta renda, empreendedores e famílias. A Asset Management opera sob a marca DWS e atende a uma base de clientes diversificada, de investidores de varejo a institucionais ', 'Frankfurt am Main, , Germany', 89426);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVNA', 'STOCK', 'Carvana Co.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Carvana Co. is a holding company. The Company operates an e-commerce platform for buying and selling used cars. The Company primarily acquires used vehicle inventory directly from customers, used car auctions, and wholesale used vehicle suppliers, including retail marketplace partners. Once it acquires a vehicle, the Company leverages its in-house logistics network or a vendor to transport the vehicle to one of its inspection and reconditioning centers (IRC) or auction locations with reconditioning capabilities, at which point the vehicle enters its inventory management system. It offers a mobile-optimized Website, where prospective retail car buyers can immediately begin browsing, researching, filtering, and identifying their vehicle of choice, where it offers an annotated virtual vehicle tour, which includes a 360-degree view of the interior and exterior of the actual vehicle. The Company also offers integrated financing using its loan origination platform.', 'Tempe, AZ, United States', 17400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMIX', 'STOCK', 'Autonomix Medical, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Autonomix Medical, Inc. is a medical device company focused on advancing technologies to develop how diseases involving the nervous system are diagnosed and treated. The Companys first-in-class platform system technology includes a catheter-based microchip sensing array that may have the ability to detect and differentiate neural signals with greater sensitivity. It is developing its technology for pancreatic cancer and pancreatitis, conditions that can cause debilitating pain and need an effective solution. Its technology constitutes a platform to address dozens of potential indications, including cardiology, hypertension and chronic pain management, across a wide disease spectrum. Its development efforts are divided into two parts: diagnostic sensing and therapeutic radiofrequency ablation. The Company is developing Autonomix system, which is primarily catheter-based, meaning that its sensing equipment is delivered to its targeted location via a lumen within the body.', 'The Woodlands, TX, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELAN', 'STOCK', 'Elanco Animal Health Incorporated', 'NYQ', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Elanco Animal Health Incorporated is an animal health company delivering products and services to prevent and treat disease in farm animals and pets. The Company''s product portfolio is sold in more than 90 countries and serves animals across many species, primarily dogs and cats (collectively, pet health) and cattle, poultry, swine, and sheep (collectively, farm animal). It has a diverse portfolio of products marketed under approximately 200 brands, including products for both pets and farm animals. The Company''s global pet health portfolio is focused on parasiticides, vaccines and therapeutics. Its pet health products include Advantage Family, Atopica, Credelio Family, Drontal Family, Galliprant, Interceptor Plus, Milbemax, Onsior, Seresto, Trifexis, and TruCan. Its farm animal products include AviPro, Baytril, Catosal, Denagard, Experior, Hemicell, Maxiban/Monteban, Pulmotil, Rumensin, and Surmax. Its customers include consultants, veterinarians, farm animal producers and resellers', 'Greenfield, IN, United States', 9000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXE', 'STOCK', 'Expand Energy Corporation', 'NMS', 'Energy', 'Oil & Gas E&P', 'A Chesapeake Energy Corporation é uma empresa de exploração e produção. A Companhia está envolvida na aquisição, exploração e desenvolvimento de propriedades para a produção de petróleo, gás natural e líquidos de gás natural (GNV) a partir de reservatórios subterrâneos. Atua em um segmento: Exploração e Produção, que atua na busca e produção de petróleo, gás natural e LGN. Possui uma base de recursos diversificada de ativos não convencionais de gás natural e líquidos em terra nos Estados Unidos. A Companhia possui participação em aproximadamente 13.500 poços de petróleo e gás natural.Tem posições em jogos de recursos do Eagle Ford Shale no sul do Texas, o salário empilhado na Bacia do Rio Powder, no Wyoming, e a Bacia Anadarko, no noroeste de Oklahoma. Seus recursos de gás natural são a Bacia dos Apalaches, no norte da Pensilvânia, e os Haynesville / Bossier Shales, no noroeste da Louisiana.', 'Oklahoma City, OK, United States', 1500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHI', 'STOCK', 'D.R. Horton, Inc.', 'NYQ', 'Consumer Cyclical', 'Residential Construction', 'D.R. Horton, Inc. É uma empresa de construção de casas. A empresa constrói e vende casas através de suas divisões operacionais em 125 mercados em 36 estados. Os segmentos da Empresa incluem Homediação, Locação, Forestar, Serviços Financeiros e outros. As divisões de HomedifÃcio estão envolvidas principalmente na aquisição e desenvolvimento de terrenos e na construção e venda de casas residenciais. O segmento de locação da Empresa consiste em operações de locação unifamiliar e multifamiliar. As operações de aluguel unifamiliar constroem e alugam casas unifamiliares dentro de uma comunidade e, em seguida, comercializam geralmente cada comunidade para uma venda em massa de casas de aluguel. O segmento Forestar é uma empresa de desenvolvimento de lotes residenciais com operações em 59 mercados em 24 estados. O segmento de serviços financeiros fornece financiamento hipotecário e serviços de agência de títulos para compradores de imóveis em muitos dos mercados de construção de casas da Compa', 'Arlington, TX, United States', 14766);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BABX', 'STOCK', 'GraniteShares 2x Long BABA Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change of the underlying stock by entering financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DYNX', 'STOCK', 'Dynamix Corporation', 'NGM', 'Financial Services', 'Shell Companies', 'Dynamix Corporation is a blank check company. The Company is formed for the purpose of effecting a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses, which it refers to throughout this prospectus as its initial business combination. The Company plan to focus its pursuit for business combination opportunities with companies operating in the energy and power value chain. These include businesses focused across energy, infrastructure and renewable sectors, including participation in exploration and production (E&P), midstream, oilfield services, power and digital infrastructure. The Company neither engaged in any operations nor generated any revenues.', 'Houston, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSGP', 'STOCK', 'CoStar Group, Inc.', 'NMS', 'Real Estate', 'Real Estate Services', 'Costar Group, Inc. É um fornecedor de mercados imobiliários on-line, informações e análises nos mercados imobiliários. Gerencia seus negócios em dois segmentos: América do Norte, que inclui os Estados Unidos e Canadá, e Internacional, que inclui principalmente Europa, Ásia-Pacífico e América Latina. Suas principais marcas incluem a CoStar, um provedor global de dados imobiliários comerciais, análises e notícias; LoopNet, um mercado imobiliário comercial; Apartments.com, uma plataforma para locação de apartamentos; e Homes.com, um mercado imobiliário residencial. Suas outras marcas incluem STR, que está envolvida em dados de hospitalidade e benchmarking, Ten-X, uma plataforma on-line para leilões de imóveis comerciais e ofertas negociadas e OnTheMarket, um portal de propriedades residenciais no Reino Unido. A empresa, através da Matterport, Inc., está avançando nos insights de propriedade e impulsionando o crescimento da tecnologia digital gêmea orientada por IA em todo o setor imobiliá', 'Arlington, VA, United States', 6593);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACWI', 'STOCK', 'iShares MSCI ACWI ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of its underlying index and in investments that have economic characteristics that are substantially identical to the component securities of its underlying index. The index is a free float-adjusted market capitalization weighted index designed to measure the combined equity market performance of developed and emerging markets countries.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBP', 'STOCK', 'Ardagh Metal Packaging S.A.', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'Ardagh Metal Packaging SA is a Luxembourg-based company that supplies consumer metal beverage cans. It supplies infinitely recyclable, metal beverage cans to brand owners. The Company deals with the multiple categories of products including beer, carbonated soft drinks, energy drinks, hard seltzers, juices, pre-mixed cocktails, teas, sparkling waters and wine. The Company operates approximately 23 production facilities in the Americas and Europe. The Company is also a suppliers of metal beverage can package solutions, capable of supplying multi-national, national and regional beverage producers. The Company''s subsidiaries inlcude Ardagh Metal Packaging Group S.a.r.l. and Hart Print Inc.', 'Luxembourg, , Luxembourg', 6300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUTL', 'STOCK', 'Autolus Therapeutics plc', 'NMS', 'Healthcare', 'Biotechnology', 'Autolus Therapeutics plc is a United Kingdom-based early commercial-stage biopharmaceutical company developing programmed T cell therapies for the treatment of cancer and autoimmune diseases. The Company has an approved commercial product, AUCATZYL, for the treatment of adult patients with r/r B-ALL. Using a suite of proprietary and modular T cell programming technologies, it is also developing five programs in seven hematological and solid tumor indications and one autoimmune indication. It is engineering precisely targeted, controlled and highly active T cell therapies that are designed to better recognize target cells, break down their defense mechanisms and attack and eliminate these cells. Its product pipeline includes obe-cel (ALLCAR19), obe-cel (CAROUSEL), AUTO1/22 (CARPALL), AUTO4 (LibrA T1), AUTO6 (MAGNETO), AUTO5, AUTO8 (MCARTY) and AUTO9. AUTO4 and AUTO5 are two programmed T cell therapies for the treatment of peripheral T-cell lymphoma targeting TRBC 1 and TRBC 2.', 'London, , United Kingdom', 647);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEG', 'STOCK', 'Constellation Energy Corporation', 'NMS', 'Utilities', 'Utilities - Renewable', 'Constellation Energy Corporation is a producer of emissions-free energy and an energy supplier to businesses, homes and public sector customers nationwide. The Companys nuclear, hydro, wind, and solar generation facilities have the generating capacity to power the equivalent of 16 million homes, providing about 10% of the nation''s clean energy in the United States. Its segments include Mid-Atlantic, Midwest, New York, ERCOT, and Other Power Regions. Through its integrated business operations, it sells electricity, natural gas, and other energy-related products and sustainable solutions to various types of customers, including distribution utilities, municipalities, cooperatives, and commercial, industrial, public sector, and residential customers in markets across multiple geographic regions. Its nuclear fleet has a generating capacity of approximately 22 gigawatts (GWs). It operates approximately 10 GWs of natural gas, oil, hydroelectric, wind, and solar generation assets.', 'Baltimore, MD, United States', 14215);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARDX', 'STOCK', 'Ardelyx, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Ardelyx, Inc. is a biopharmaceutical company focused on discovering, developing and commercializing first-in-class medicines. The Company has two commercial products approved in the United States: IBSRELA (tenapanor) and XPHOZAH (tenapanor). IBSRELA is a first-in-class NHE3 inhibitor approved by the United States FDA for the treatment of irritable bowel syndrome with constipation in adults. XPHOZAH is a first-in-class phosphate absorption inhibitor approved in the United States to reduce serum phosphorus in adults with chronic kidney disease (CKD) on dialysis as add-on therapy in patients who have an inadequate response to phosphate binders or who are intolerant of any dose of phosphate binder therapy. It has agreements for the development and commercialization of tenapanor outside of the United States. Kyowa Kirin commercializes PHOZEVEL (tenapanor) for hyperphosphatemia in Japan. A New Drug Application for tenapanor for hyperphosphatemia has been approved in China with Fosun Pharma.', 'Waltham, MA, United States', 395);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLO', 'STOCK', 'Allogene Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Allogene Therapeutics, Inc. is a clinical-stage immuno-oncology company. The Company is focused on development of genetically engineered allogeneic T cell product candidates for the treatment of cancer and autoimmune diseases. It is focused on three core programs: Large B-Cell Lymphoma (LBCL), Autoimmune Disease (AID), and Renal Cell Carcinoma (RCC). It is developing a pipeline of multiple allogeneic chimeric antigen receptor (CAR) T cell product candidates utilizing protein engineering, gene editing, gene insertion and advanced proprietary T cell manufacturing technologies. Its product candidate, cemacabtagene ansegedleucel, referred to as cema-cel, is an engineered allogeneic CAR T cell product candidate that targets CD19, a protein expressed on the cell surface of B cells and a validated target for B cell driven hematological malignancies. It is focused on developing cema-cel for LBCL. Its pipeline also includes ALLO-316 and ALLO-329.', 'South San Francisco, CA, United States', 226);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CART', 'STOCK', 'Maplebear Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'Maplebear Inc., doing business as Instacart, is a grocery technology company in North America, works with grocers and retailers to transform how people shop. The Company partners with more than 1,800 national, regional, and local retail banners to facilitate online shopping, delivery and pickup services from more than 100,000 stores across North America on the Instacart Marketplace. The Instacart Platform offers retailers a suite of enterprise-grade technology products and services to power their e-commerce experiences, fulfill orders, digitize brick-and-mortar stores, provide advertising services, and glean insights. With Instacart Ads, thousands of consumer-packaged goods (CPG) brands - from category leaders to emerging brands - partner with the Company to connect directly with consumers online, right at the point of purchase. The Company, through its Instacart Health, provides tools to increase nutrition security and make healthy choices easier for consumers.', 'San Francisco, CA, United States', 3265);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHGG', 'STOCK', 'Chegg, Inc.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'Chegg, Inc. provides a student-first connected learning platform. The Company provides individualized learning support to students as they pursue their educational journeys. Available on demand 24/7 and powered by quality learning insights, the Chegg platform offers students artificial intelligence (AI)-powered academic support thoughtfully designed for education, coupled with access to a vast network of subject matter experts who help ensure quality and accuracy. Its service and product offerings fall into two categories: Subscription Services, which encompass its Chegg Study Pack, Chegg Study, Chegg Writing, Chegg Math, and Busuu offerings that can be accessed internationally through its websites and on mobile devices, and Skills and Other, which include its Chegg Skills, advertising services, content licensing, print textbooks and eTextbooks offerings. Chegg Study subscribers have access to personalized, step-by-step learning support powered by AI and computational engines.', 'Santa Clara, CA, United States', 1241);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECDA', 'STOCK', 'ECD Automotive Design, Inc.', 'NCM', 'Consumer Cyclical', 'Auto Manufacturers', 'ECD Automotive Design, Inc. is a creator of restored luxury vehicles. The Company restores Land Rover Defenders, Land Rover Series IIA, the Range Rover Classic, the Jaguar E-Type, Ford Mustang and Toyota FJ. It provides clients with all the necessary tools to understand all the available customization possibilities, and its master-certified technicians hand-build a completely restored vehicle in approximately 2,200 man-hours, replacing and customizing substantially all of its components, including the engine, color, seating, stitching, electronics and cosmetic finishes. It operates two production lines, the North Line, where it builds Range Rover Classic, Land Rover Series (IIA and III) and Land Rover Defenders, and the South Line. In addition, its division, ECD Boutique, focuses on higher selling-price projects, such as Porsche 911s and Jaguar Low Drag E-Types, which are built in a single bay rather than a production line. It has an affiliated logistics center in the United Kingdom.', 'Kissimmee, FL, United States', 102);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TSLR', 'STOCK', 'Graniteshares 2x Long TSLA Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed ETF that attempts to replicate 2 times (200%) the daily percentage change of the underlying stock by entering into financial instruments such as swaps and options on the underlying stock, as well as directly purchasing the underlying stock; at the end of each trading day, the notional exposure against the underlying stock obtained through the combination of these instruments will be approximately 200% of the fund’s net asset value. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXTA', 'STOCK', 'Axalta Coating Systems Ltd.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Axalta Coating Systems Ltd. is a global coatings company. The Company is a manufacturer, marketer and distributor of coatings systems and products. Its segments include Performance Coatings and Mobility Coatings. Through its Performance Coatings segment, it provides sustainable liquid and powder coating solutions to both large regional and global customers and to a fragmented and local customer base. These customers comprise, among others, independent or multi-shop operator body shops as well as a wide variety of industrial manufacturers. Through its Mobility Coatings segment, it provides coatings technologies for light vehicle and commercial vehicle original equipment manufacturers (OEMs). Its key products consist of the four main coatings layers: electrocoat (AquaEC), primer (HyperDur), basecoat (ChromaDyne) and clearcoat (Lumeera). Its major industrial brands include Imron Industrial, Tufcote Industrial, Corlar Industrial, Strenex Industrial, PercoTop, Voltatex, and others.', 'Philadelphia, PA, United States', 12700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EIX', 'STOCK', 'Edison International', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'Edison International é a holding da Southern California Edison Company (SCE) e Edison Energy, LLC (Edison Energy). A empresa está envolvida no fornecimento de serviços de energia e energia limpos e confiáveis por meio de suas empresas independentes. A SCE é uma empresa pública que atua principalmente no fornecimento e fornecimento de eletricidade para uma área de aproximadamente 50 000 quilômetros quadrados do sul da Califórnia. A SCE fornece eletricidade a aproximadamente 15 milhões de pessoas em toda a Califórnia do Sul, Central e Costeira. A Edison Energy, LLC, uma subsidiária independente de propriedade integral indireta da Edison International, uma empresa global de consultoria em energia que fornece soluções integradas de sustentabilidade e energia para clientes comerciais, industriais e institucionais.', 'Rosemead, CA, United States', 14013);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OBDC', 'STOCK', 'Blue Owl Capital Corporation', 'NYQ', 'Financial Services', 'Asset Management', 'Blue Owl Capital Corporation is a specialty finance company focused on lending to United States middle-market companies. The Companys investment objective is to generate current income and, to a lesser extent, capital appreciation by targeting investment opportunities with favorable risk-adjusted returns, including senior secured, subordinated, or mezzanine loans and equity-related instruments. Its investment strategy is intended to generate favorable returns across credit cycles with an emphasis on preserving capital. It has investments in approximately 219 portfolio companies. Its portfolio by industry includes Internet software and services, insurance, food and beverage, asset-based lending and fund finance, healthcare providers and services, healthcare technology, buildings and real estate, consumer products, manufacturing, aerospace and defense, distribution, business services, and others. It is externally managed by Blue Owl Credit Advisors LLC.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APO', 'STOCK', 'Apollo Global Management, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Apollo Global Management, Inc. is a global alternative asset manager and a retirement services provider. It operates through three segments: Asset Management, Retirement Services and Principal Investing. The Asset Management segment focuses on three investing strategies: yield, hybrid, and equity. These strategies reflect the range of investment capabilities across its platform based on relative risk and return. The Retirement Services business is conducted by Athene Holding Ltd (Athene), a financial services company that specializes in issuing, reinsuring, and acquiring retirement savings products designed for the increasing number of individuals and institutions seeking to fund retirement needs. Athene product lines include annuities and funding agreements. The Principal Investing segment includes realized performance fee income, realized investment income from its balance sheet investments, and certain allocable expenses related to corporate functions supporting the entire company.', 'New York, NY, United States', 5333);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIG', 'STOCK', 'Companhia Energética de Minas Gerais - CEMIG', 'NYQ', 'Utilities', 'Utilities - Diversified', 'Energy of Minas Gerais Co é uma holding sediada no Brasil. A Companhia atua em diversos estados do Brasil, através de inúmeras subsidiárias. No entanto, as operações da Companhia são centralizadas principalmente no estado de Minas Gerais. O principal segmento operacional é a distribuição de energia elétrica, seguida pela comercialização de energia elétrica, distribuição de gás, geração de energia elétrica e transmissão de energia elétrica. Constituída para atuar na comercialização de energia elétrica e como holding, com interesses em subsidiárias ou entidades controladas conjuntamente, cujos objetivos são: Construção e operação de sistemas de geração, transformação, transmissão, distribuição e venda de energia, e também atividades nos diversos campos do setor energético, incluindo distribuição de gás, prestação de serviços de geração distribuída e soluções de eficiência energética, para fins de operação comercial.', 'Belo Horizonte, MG, Brazil', 5028);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMPS', 'STOCK', 'COMPASS Pathways plc', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Compass Pathways plc is a United Kingdom-based biotechnology company dedicated to accelerating patient access to evidence-based innovation in mental health. The Company is engaged in treating mental health conditions focused on rapid and durable responses through the development of its investigational COMP360 psilocybin treatment. COMP360 is its psilocybin formulation that includes its pharmaceutical-grade polymorphic crystalline psilocybin, optimized for stability and purity. The Companys initial focus is on treatment-resistant depression (TRD), comprising patients who are inadequately served by the current treatment paradigm. It commenced its Phase III program evaluating its COMP360 psilocybin treatment in TRD. In addition, the Company has ongoing Phase II trials in PTSD and anorexia nervosa. It also provides support to research institutions conducting investigator-initiated studies with COMP360 psilocybin in areas of serious unmet need.', 'London, , United Kingdom', 166);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASML', 'STOCK', 'ASML Holding N.V.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'A ASML Holding N.V. é uma holding sediada nos Países Baixos. A empresa opera através de suas subsidiárias nos Países Baixos, Estados Unidos, Itália, França, Alemanha, Reino Unido, Irlanda, Bélgica, Coreia do Sul, Taiwan, Singapura, China, Hong Kong, Japão, Malásia e Israel. A empresa opera através de um segmento de negócios que está engajado no desenvolvimento, produção, marketing, vendas, atualização e manutenção de sistemas avançados de equipamentos semicondutores, consistindo em sistemas de litografia, metrologia e inspeção. A empresa oferece sistemas TWINSCAN, equipados com sistema de litografia com uma lâmpada de mercúrio como fonte de luz (linha I), fluoreto de Krypton (KrF) e fontes de luz de Argon Fluoride (ARF) para processamento de wafers para ambientes de fabricação para os quais é necessária imagem em uma pequena resolução. Os sistemas TWINSCAN também incluem sistemas de litografia de imersão (sistemas de imersão TWINSCAN).', 'Veldhoven, , Netherlands', 43193);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VZLA', 'STOCK', 'Vizsla Silver Corp.', 'ASE', 'Basic Materials', 'Other Industrial Metals & Mining', 'Vizsla Silver Corp. is a Canada-based mineral exploration and development company. The Company is focused on advancing its flagship, 100%-owned Panuco silver-gold project located in Sinaloa, Mexico. The Panuco silver-gold project is an emerging high-grade discovery located in southern Sinaloa, Mexico, near the city of Mazatlan. The 7,189.5-hectare, past producing district benefits from over 86 kilometers (km) of total vein extent, 35 km of underground mines, roads, power, and permits. The district contains intermediate to low sulfidation epithermal silver and gold deposits related to siliceous volcanism and crustal extension in the Oligocene and Miocene. The Company also owns the past-producing La Garra-Metates district (the La Garra) situated in the heart of the silver-gold-rich Panuco - San Dimas corridor.', 'Vancouver, BC, Canada', 79);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CADE', 'STOCK', 'Cadence Bank', 'NYQ', 'Financial Services', 'Banks - Regional', 'Cadence Bank (the Bank) is a regional financial services company with approximately 380 branch locations across the South and Texas. The Bank offers comprehensive banking, investment, trust and mortgage products and services to meet the needs of individuals, businesses and corporations. The Bank''s services and products include consumer banking, consumer loans, mortgages, home equity lines and loans, commercial and business banking, treasury management, specialized lending, asset-based lending, commercial real estate, equipment financing, correspondent banking, small business administration (SBA) lending, foreign exchange, wealth management, investment and trust services, financial planning, retirement plan management. The Banks personal banking services include checking, savings and certificates of deposit, credit cards, online and mobile banking, mortgages, and wealth management. It offers various business banking services, including business loans and lines of credit, among others.', 'Tupelo, MS, United States', 5514);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIEN', 'STOCK', 'Ciena Corporation', 'NYQ', 'Technology', 'Communication Equipment', 'Ciena Corporation is a network system, software, and services company which provides hardware, software, and services to a range of network operators and enables enhanced network capacity, service delivery, and automation. Its segments include Networking Platforms, Platform Software and Services, Blue Planet Automation Software and Services, and Global Services. Networking Platforms segment consists of Optical Networking and Routing and Switching portfolios. Platform Software and Services which provides domain control management, analytics, data and planning tools and applications to assist customers in managing their networks. Blue Planet Automation Software and Services includes inventory management (BPI), multi-domain service orchestration, multi-cloud orchestration, route optimization and analysis (ROA), and unified assurance and analytics (UAA). Global Services segment offers a suite of value-added services that help its customers to build, operate and improve their networks.', 'Hanover, MD, United States', 8570);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEVA', 'STOCK', 'Aeva Technologies, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Aeva Technologies, Inc. is engaged in the design, manufacturing and sale of LiDAR sensing systems and related perception and autonomy-enabling software solutions serving customers in automotive, industrial, and other markets. The Company, through its frequency modulated continuous wave (FMCW) sensing technology, enables the adoption of LiDAR across broad applications. Its sensing and perception technology integrates all key LiDAR components onto a silicon photonics chip in a compact module. Its products include Aeries II, is a 4D LiDAR solution, consisting of its 4D LiDAR sensing system with embedded software designed for automotive grade production across passenger car, trucking, and mobility applications; Atlas, is its FMCW 4D LiDAR with simultaneous velocity and range detection targeted for the automotive market, and Atlas Ultra, is a 4D LiDAR sensor built to meet the performance demands of SAE Level 3 and 4 automated driving systems in passenger and commercial vehicles.', 'Mountain View, CA, United States', 276);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRH', 'STOCK', 'DiamondRock Hospitality Company', 'NYQ', 'Real Estate', 'REIT - Hotel & Motel', 'DiamondRock Hospitality Company is a self-advised real estate investment trust (REIT). The Company owns a portfolio of geographically diversified hotels concentrated in leisure destinations and gateway markets. Its hotels are owned by subsidiaries of its operating partnership, DiamondRock Hospitality Limited Partnership. Its primary business is to acquire, own, renovate and asset manage hotel properties in the United States. The Company''s hotel properties include Chico Hot Springs Resort, Lake Austin Spa Resort, Kimpton Shorebreak Fort Lauderdale Beach Resort, Tranquility Bay, Bourbon Orleans Hotel, Henderson Beach Resort, Henderson Park Inn, Cavallo Point, Kimpton Palomar Phoenix, L''auberge De Sedona, Orchards Inn, Westin San Diego, and Havana Cabana, among others. It owns over 36 hotels and resorts with approximately 9,600 rooms. The Company has positioned its portfolio to be operated both under global brand families as well as independent boutique hotels in the lifestyle segment.', 'Bethesda, MD, United States', 31);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNB', 'STOCK', 'Dun & Bradstreet Holdings, Inc.', 'NYQ', 'Financial Services', 'Financial Data & Stock Exchanges', 'Dun & Bradstreet Holdings, Inc. is a global provider of business decisioning data and analytics. The Company clients embed its end-to-end solutions into their daily workflows to inform commercial credit decisions, confirm suppliers and improve salesforce productivity and gain visibility into key markets. Its solutions support its clients mission critical business operations by providing and curated data and analytics to help drive informed decisions and improved outcomes. The Company operates through two segments: North America and International. Its finance and risk solutions are used in the critical decisioning processes of finance, risk, compliance and procurement departments worldwide. Its sales and marketing solutions combine firmographic, personal contact, intent and non-traditional data to assist clients in optimizing their sales and marketing strategy by cleansing customer relationship management (CRM) data and narrowing their focus and efforts on the probability prospects.', 'Jacksonville, FL, United States', 6247);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTSH', 'STOCK', 'Cognizant Technology Solutions Corporation', 'NMS', 'Technology', 'Information Technology Services', 'A cognizant Technology Solutions Corporation projeta negócios modernos. Seus serviços incluem inteligência artificial (IA) e outros serviços e soluções de tecnologia, consultoria, desenvolvimento de aplicativos, integração de sistemas, engenharia e garantia de qualidade, manutenção de aplicativos, infraestrutura e segurança, bem como serviços de processos de negócios e automação. Seus segmentos incluem Ciências da Saúde (HS), Serviços Financeiros (FS), Produtos e Recursos (P&R) e Comunicações, Mídia e Tecnologia (CMT). O segmento HS é composto por prestadores de cuidados de saúde e pagadores, e empresas de ciências da vida. O segmento FS inclui bancos, mercados de capitais, pagamentos e companhias de seguros. O segmento P&R inclui fabricantes, montadoras, varejistas, empresas de bens de consumo e empresas de viagens e hospitalidade, bem como empresas que fornecem serviços de logística, energia e serviços de utilidade. O segmento CMT inclui empresas globais de comunicação, mídia e entre', 'Teaneck, NJ, United States', 343800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECL', 'STOCK', 'Ecolab Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A Ecolab Inc. Está empenhada em oferecer soluções e serviços de água, higiene e prevenção de infeções que protegem as pessoas e os recursos vitais para a vida. O segmento industrial global da empresa fornece tratamento de água e aplicações de processo, e soluções de limpeza e higienização principalmente para grandes clientes industriais nas indústrias de fabricação, processamento de alimentos e bebidas, transporte, produtos químicos, metais primários e mineração, geração de energia, refino global, petroquímica, celulose e papel. Seu segmento Global Institutional & Specialty fornece produtos especializados de limpeza e higienização para os setores de serviços alimentícios, hospitalidade, hospedagem, governo e educação e varejo. Seu segmento Global Healthcare & Life Sciences fornece produtos especializados de limpeza e higienização para as indústrias de saúde, cuidados pessoais e farmacêutica. O seu segmento Global Pest Elimination fornece serviços concebidos para detetar, prevenir e eli', 'Saint Paul, MN, United States', 48000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHRS', 'STOCK', 'Coherus Oncology, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Coherus Oncology, Inc., formerly Coherus BioSciences, Inc., is a fully integrated commercial-stage oncology company with an approved PD-1 inhibitor, LOQTORZI, and a pipeline that includes two mid-stage clinical candidates targeting liver, lung, head & neck, and other cancers. LOQTORZI (toripalimab-tpzi) is its immuno-oncology franchise. LOQTORZI is the FDA-approved treatment indicated in combination with chemotherapy for recurrent or metastatic nasopharyngeal carcinoma (NPC) and is also in development for the treatment of additional tumor types. Its CHS-114 pipeline is a highly selective cytolytic CCR8 antibody that specifically binds and preferentially depletes CCR8+ tumor regulatory T cells (Tregs) with no off-target binding. Its Casdozokitug pipeline is a first-in-class, clinical-stage IL-27 antagonist, with demonstrated monotherapy activity in treatment-refractory NSCLC and clear cell renal cell carcinoma (ccRCC) and combination activity in hepatocellular carcinoma (HCC).', 'Redwood City, CA, United States', 177);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APG', 'STOCK', 'APi Group Corporation', 'NYQ', 'Industrials', 'Engineering & Construction', 'APi Group Corporation is a global business services provider of fire and life safety, security, elevator and escalator and specialty services in over 500 locations worldwide. Its segments include Safety Services and Specialty Services. Safety Services segment focuses on end-to-end integrated occupancy systems (fire protection solutions, entry systems, elevators and escalators), including design, installation, inspection, and service of these integrated systems. The work performed within this segment spans across industries and facilities and includes commercial, education, healthcare, high-tech, industrial and special-hazard settings. Specialty Services provides a variety of infrastructure services and specialized industrial plant services, including maintenance and repair of critical infrastructure, such as underground electric, gas, water, sewer, telecommunications infrastructure, and design, installation, inspection, and service of heating, ventilation, and air conditioning systems.', 'New Brighton, MN, United States', 29000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DASH', 'STOCK', 'DoorDash, Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'A DoorDash, Inc. Está envolvida no fornecimento de serviços que reduzem o atrito no comércio local e ajudam os comerciantes a se conetar com os consumidores em suas comunidades. As principais ofertas da empresa incluem o DoorDash Marketplace e o Wolt Marketplace (juntos, os marketplaces) e sua Plataforma de Comércio. Seus mercados operam em mais de 30 países em todo o mundo e fornecem um conjunto integrado de serviços que ajudam os comerciantes a estabelecer uma presença on-line, se conetar com os consumidores em suas comunidades e resolver desafios de missão crítica, como aquisição de clientes, geração de demanda, atendimento de pedidos, merchandising, processamento de pagamentos, e outros. e apoio ao cliente. Ele também oferece publicidade como um serviço de valor agregado através de seus marketplaces para ajudar comerciantes e empresas de bens de consumo a aumentar o engajamento do consumidor. Ele também oferece programas de adesão ao consumidor, como DashPass e Wolt. Seus serviços ', 'San Francisco, CA, United States', 23700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXL', 'STOCK', 'American Axle & Manufacturing Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'American Axle & Manufacturing Holdings, Inc. is an automotive and mobility supplier. It designs, engineers and manufactures driveline and metal forming technologies to support electric, hybrid and internal combustion vehicles. Its segment includes Driveline and Metal Forming. The Driveline products consist primarily of front and rear axles, driveshafts, differential assemblies, clutch modules, balance shaft systems, disconnecting driveline technology, and electric and hybrid driveline products and systems for light trucks, sport utility vehicles, crossover utility vehicles, passenger cars and commercial vehicles. The Metal Forming products consist primarily of engine, transmission, driveline and safety-critical components for traditional internal combustion engine and electric vehicle architectures, including light vehicles, commercial vehicles, and off-highway vehicles, as well as products for industrial markets. It is a supplier of driveline components to General Motors Company.', 'Detroit, MI, United States', 19000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZ', 'STOCK', 'Kanzhun Limited', 'NMS', 'Communication Services', 'Internet Content & Information', 'Kanzhun Ltd is a holding company principally engaged in the provision of recruitment and job hunting services. The Company connects job seekers and enterprise users mainly through its interactive BOSS Zhipin mobile app. The Company provides enterprise users with direct recruitment services that allow enterprise users to post jobs, receive personalized candidate recommendations, engage in direct communication and receive resume upon mutual consent. The Company provides job seekers with job seeking services that allow job seekers to receive job recommendations, initiate direct chats and deliver resumes upon mutual consent.', 'Beijing, , China', 5688);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELDN', 'STOCK', 'Eledon Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Eledon Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is developing immune-modulating therapies for the management and treatment of life-threatening conditions. The Companys lead investigational product is tegoprubart, an IgG1, anti-CD40L antibody with high affinity for CD40 Ligand, a well-validated biological target within the costimulatory CD40/CD40L cellular pathway. The central role of CD40L signaling in both adaptive and innate immune cell activation and function positions it as an attractive target for non-lymphocyte depleting, immunomodulatory therapeutic intervention. Tegoprubart is engineered to potentially both improve safety and provides pharmacokinetic, pharmacodynamic, and dosing advantages. CD40L is primarily expressed on activated CD4+ T cells, platelets, and endothelial cells while the CD40 receptor is constitutively expressed on antigen-presenting cells, such as macrophages and dendritic cells, as well as B cells.', 'Irvine, CA, United States', 31);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARBE', 'STOCK', 'Arbe Robotics Ltd.', 'NCM', 'Technology', 'Software - Infrastructure', 'Arbe Robotics Ltd is an Israel-based company. The Company develops and delivers radars for the detection of small objects, using ultra-high resolution multidimensional imaging radar technology, as a part of its business operations. Its patented imaging Synthetic-Aperture Radar (SAR) chipset, generates detailed four-dimensional radar pictures specialized for production of drones and robots, as well as automotive industry. Arbe Robotics Ltd holds industry standard patents in four dimensional (4D) radar, collaborates with automotive companies and produces various autonomous driving applications of its technology. Its modular radar sensor design supports scalable integrations across environments and different conditions, ensuring object detection by the Company''s 4D imaging Synthetic-Aperture Radar picture.', 'Tel Aviv-Yafo, , Israel', 138);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EAF', 'STOCK', 'GrafTech International Ltd.', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'GrafTech International Ltd. is a manufacturer of graphite electrode products essential to the production of electric arc furnace steel and other ferrous and non-ferrous metals. The Company has a portfolio of low-cost, ultra-high power graphite electrode manufacturing facilities, which are located in Calais, France; Pamplona, Spain; Monterrey, Mexico, and St. Marys, Pennsylvania. Its segment, Industrial Materials, is comprised of two major product categories: graphite electrodes and petroleum needle coke products. Graphite electrodes are an industrial consumable product used primarily in EAF steel production, one of the two primary methods of steel production and the steelmaking technology used by all mini mills. Petroleum needle coke, a crystalline form of carbon derived from decant oil, is the key raw material it uses in the production of graphite electrodes. It sells its graphite electrodes primarily through its direct sales force, independent sales representatives, and distributors.', 'Brooklyn Heights, OH, United States', 1072);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTOR', 'STOCK', 'Citius Oncology, Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Citius Oncology, Inc. is a biopharmaceutical company. The Company is focused on developing and commercializing targeted oncology therapies. The Companys lead product candidate is LYMPHIR, an engineered IL-2 diphtheria toxin fusion protein, for the treatment of patients with persistent or recurrent CTCL, a rare form of non-Hodgkin lymphoma. LYMPHIR is a targeted immune therapy for relapsed or refractory cutaneous T-cell lymphoma (CTCL) indicated for use in Stage I-III disease after at least one prior systemic therapy. It is a recombinant fusion protein that combines the IL-2 receptor binding domain with diphtheria toxin fragments. The agent specifically binds to IL-2 receptors on the cell surface, causing diphtheria toxin fragments that have entered cells to inhibit protein synthesis. After uptake into the cell, the diphtheria toxin (DT) fragment is cleaved and the free DT fragments inhibit protein synthesis, resulting in cell death.', 'Cranford, NJ, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('D', 'STOCK', 'Dominion Energy, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'A Dominion Energy, Inc., anteriormente Dominion Resources, Inc., é produtora e transportadora de energia. A Dominion está focada em seu investimento em geração, transmissão e distribuição elétrica regulada e infraestrutura regulamentada de transmissão e distribuição de gás natural. Opera em três segmentos: Dominion Virginia Power Segmento Operacional (DVP), Dominion Generation, Dominion Energy e Corporate e outros. O segmento DVP inclui distribuição elétrica regulada e transmissão elétrica regulada. O segmento Dominion Generation inclui frota elétrica regulamentada e frota elétrica comercial. O segmento de energia da Dominion inclui transmissão e armazenamento de gás, coleta e processamento de gás, importação e armazenamento de gás natural liquefeito e comercialização não regulamentada de energia de varejo. Em 31 de dezembro de 2016, a Dominion atendia a clientes de energia elétrica e de varejo e operava um sistema subterrâneo de armazenamento de gás natural com capacidade de armazenam', 'Richmond, VA, United States', 14700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AS', 'STOCK', 'Amer Sports, Inc.', 'NYQ', 'Consumer Cyclical', 'Leisure', 'Amer Sports Inc is a Finland-based global group of sports and outdoor brands such as Arcteryx, Salomon, Wilson, Peak Performance, Atomic, Armada, ATEC, DeMarini, EvoShield and ENVE. The Company develops, manufactures, and markets sports and fitness equipment. Its products include sports equipment for tennis, badminton, soccer, baseball, basketball, golf, American football, alpine skiing, fitness training, cycling, running, hiking, snowboarding, cross-country skiing and diving. It also offers fitness equipment through factory outlets, and e-commerce companies through trade customers in sporting goods chains, mass merchants, specialty retailers, fitness clubs, and distributors. The Company operates worldwide.', 'Helsinki, , Finland', 13400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VSTM', 'STOCK', 'Verastem, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Verastem, Inc. is a late-stage development biopharmaceutical company, which focuses on the development and commercialization of new medicines to improve the lives of patients diagnosed with ras sarcoma (RAS)/ mitogen-activated pathway kinase (MAPK) pathway-driven cancers. Its product candidates include avutometinib and defactinib. Avutometinib is an oral RAF/MEK clamp that inhibits MEK1/2 kinase activities and induces inactive complexes of MEK with A-Raf proto-oncogene, potentially serine/threonine kinase (ARAF), B-Raf proto-oncogene serine/threonine kinase (BRAF) and C-raf proto-oncogene serine/threonine kinase, creating antitumor response through maximal RAS/MAPK pathway inhibition. Defactinib is an oral, selective inhibitor of FAK and proline-rich tyrosine kinase (PYK2), the two members of the focal adhesion kinase family of non-receptor protein tyrosine kinases. FAK and PYK2 integrate signals from integrin and growth factor receptors to regulate cell proliferation.', 'Needham, MA, United States', 78);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BG', 'STOCK', 'Bunge Global SA', 'NYQ', 'Consumer Defensive', 'Farm Products', 'Bunge Global SA is a global agribusiness and food company. The Company is engaged in the processing of oilseeds and the production and supply of specialty vegetable oils and fats. Its segments include Agribusiness, Refined and Specialty Oils, and Milling segments. The Agribusiness segment is principally involved in the purchase, storage, transportation, processing and sale of agricultural commodities and commodity products. The Refined and Specialty Oils segment involves the processing, production, and marketing of products derived from vegetable oils and fats, including cooking oils, shortenings, specialty ingredients, and renewable diesel feedstocks. The Milling segment involves the processing, production, and marketing of products derived primarily from wheat and corn. It serves a diverse set of industries, including animal feed and pet food, bakery, beverages, biofuels, confectionery, culinary snacks and frying, dairy, foodservice, meat, nutrition, personal care, and more.', 'Chesterfield, MO, United States', 37000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAT', 'STOCK', 'Caterpillar Inc.', 'NYQ', 'Industrials', 'Farm & Heavy Construction Machinery', 'A Caterpillar Inc. É uma fabricante de equipamentos de construção e mineração, motores a diesel e a gás natural off-road, turbinas a gás industriais e locomotivas diesel-elétricas. A Companhia atua através dos seus diversos segmentos, nomeadamente Indústrias da Construção, Indústrias de Recursos e Energia & Transportes. Presta ainda financiamento e serviços conexos através do seu segmento de Produtos Financeiros. O segmento de Indústrias da Construção é o principal responsável por apoiar os clientes que utilizam máquinas em aplicações de infraestrutura e construção de edifícios. O segmento Resource Industries desenvolve e fabrica equipamentos de alta produtividade para operações de mineração subterrânea e de superfície, além de fornecer sistemas hidráulicos, eletrônicos e software para suas máquinas e motores. O segmento de Energia e Transportes oferece produtos e serviços que incluem motores alternativos, grupos geradores, sistemas e soluções integrados, turbinas e serviços relacionad', 'Irving, TX, United States', 112900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BILI', 'STOCK', 'Bilibili Inc.', 'NMS', 'Communication Services', 'Internet Content & Information', 'A Bilibili Inc é uma empresa com sede na China que se dedica principalmente à Internet e outros negócios relacionados. A empresa opera seus negócios em quatro segmentos. O segmento de jogos para celular publica principalmente jogos para celular em sua plataforma para desenvolvedores de jogos terceirizados que podem ser baixados e jogados gratuitamente com contas Bilibili. O segmento de Publicidade está principalmente envolvido em negócios de arranjos de publicidade gráfica. O segmento de transmissão ao vivo e serviços de valor agregado (VAS) gera receita principalmente de taxas de assinatura de programa de associação premium, vendas de itens virtuais no canal e vendas de conteúdo pago e itens virtuais em suas plataformas de vídeo, áudio e quadrinhos. O segmento de comércio eletrônico e outros envolve principalmente vendas online de mercadorias relacionadas a animes, quadrinhos e jogos (AGG) e eventos e atividades de performance offline.', 'Shanghai, , China', 8088);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EC', 'STOCK', 'Ecopetrol S.A.', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A Ecopetrol S.A. é uma empresa petrolífera. A Companhia opera na Colômbia, Peru, Brasil e Costa do Golfo dos Estados Unidos. Os segmentos da empresa incluem Exploração e Produção, Transporte e Logística e Refino, Petroquímica e Biocombustíveis. O segmento de Exploração e Produção da Companhia inclui atividades de exploração, desenvolvimento e produção na Colômbia e no exterior. O segmento de Transporte e Logística da Companhia inclui o transporte de petróleo bruto, combustíveis para motores, óleo combustível e outros produtos refinados, incluindo diesel e biocombustíveis. A capacidade operacional dos principais sistemas de oleoduto da empresa é de aproximadamente 1,34 milhão de barris por dia (BPD). As principais refinarias da Empresa são a refinaria Barrancabermeja, da qual é proprietária e opera diretamente, e uma refinaria na Zona Franca de Cartagena que é operada pela Reficar S.A., uma subsidiária da Empresa. A Companhia também possui e opera duas outras refinarias menores: Orito e', 'Bogotá, , Colombia', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CC', 'STOCK', 'The Chemours Company', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'The Chemours Company provides industrial and specialty chemical products for markets, including coatings, plastics, refrigeration and air conditioning, transportation, semiconductor and advanced electronics, general industrial, and oil and gas. The Companys segments include Titanium Technologies, Thermal & Specialized Solutions and Advanced Performance Materials. The Titanium Technologies segment is a provider of titanium dioxide pigment, a premium white pigment used to deliver whiteness, brightness, opacity and protection in various applications. The Thermal & Specialized Solutions segment is a provider of refrigerants, thermal management solutions, propellants, blowing agents, and specialty solvents. The Advanced Performance Materials segment is a provider of high-end polymers and advanced materials. Its flagship products include brands such as Opteon, Freon, Ti-Pure, Nafion, Teflon, Viton, and Krytox. The Company serves over 2,700 customers in approximately 110 countries.', 'Wilmington, DE, United States', 6000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARR', 'STOCK', 'ARMOUR Residential REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'ARMOUR Residential REIT, Inc. is a real estate investment trust. The Company invests primarily in fixed-rate residential, adjustable rate and hybrid adjustable-rate residential mortgage-backed securities issued or guaranteed by United States Government-sponsored enterprises or guaranteed by the Government National Mortgage Association. It brings private capital into the mortgage markets to support home ownership for a broad and diverse spectrum of Americans. It seeks to create stockholder value through investment and risk management of a leveraged and diversified portfolio of mortgage-backed securities (MBS). It invests in MBS, issued or guaranteed by a United States Government-sponsored entity (GSE), such as the Federal National Mortgage Association, the Federal Home Loan Mortgage Corporation, or a government agency such as Government National Mortgage Administration (Agency Securities). The Company is externally managed and advised by ARMOUR Capital Management LP.', 'Vero Beach, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAP', 'STOCK', 'Advance Auto Parts, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'A ADVANCE Auto Parts, Inc. É uma fornecedora de peças de reposição automotiva na América do Norte, servindo clientes profissionais de instaladores (profissionais) e faça você mesmo (DIY), bem como operadores de propriedade independente. As lojas e filiais da empresa oferecem uma gama de marcas, fabricante de equipamentos originais (OEM) e peças de reposição automotivas de marca própria, acessórios, baterias e itens de manutenção para carros domésticos e importados, vans, veículos utilitários esportivos e caminhões leves e pesados. A empresa opera aproximadamente 4 788 lojas principalmente nos Estados Unidos (EUA), com locais adicionais no Canadá, Porto Rico e Ilhas Virgens dos EUA. A empresa também atende aproximadamente 934 lojas de marca Carquest de propriedade independente nesses locais, além do México e de várias ilhas do Caribe. Suas lojas operam principalmente sob as marcas Advance Auto Parts e Carquest.', 'Raleigh, NC, United States', 33200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VLTO', 'STOCK', 'Veralto Corporation', 'NYQ', 'Industrials', 'Pollution & Treatment Controls', 'Veralto Corporation provides essential technology solutions that monitor, enhance and protect key resources around the globe. Its segments include Water Quality (WQ) and Product Quality & Innovation (PQI). WQ segment provides portfolios of water analytics and differentiated water treatment solutions that enable the delivery of safe drinking water by public and private utilities. Under its Hach, Trojan Technologies, ChemTreat and other globally recognized WQ brands, it provides precision instrumentation and advanced water treatment technologies that its customers rely on to measure, analyze and treat water in residential, commercial, municipal, industrial, research and natural resource applications. PQI segment provides a set of essential solutions for brand owners and consumer packaged goods companies. Under its Videojet, Linx, Esko, X-Rite, Pantone and other globally recognized PQI brands, it provides marking and coding, and packaging and color instrumentation and related consumables.', 'Waltham, MA, United States', 17000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNX', 'STOCK', 'CNX Resources Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'CNX Resources Corporation is an ultra-low carbon intensive natural gas development, production, midstream, and technology company centered in Appalachia, United States. The Company''s operations are primarily centered on unconventional shale formations, primarily the Marcellus Shale and Utica Shale, in Pennsylvania, Ohio and West Virginia. Additionally, it operates and develops Coalbed Methane (CBM) properties in Virginia. It has rights to extract natural gas from Shale formations in Pennsylvania, West Virginia, and Ohio from approximately 528,000 net Marcellus Shale acres and 606,000 net Utica Shale acres. It has rights to extract CBM in Virginia from approximately 283,000 net CBM acres. It extracts CBM natural gas primarily from the Pocahontas #3 seam. It also has the right to capture Coal Mine Methane from active and abandoned mines in this region. It owns or operates around 2,700 miles of natural gas gathering pipelines as well as a number of natural gas processing facilities.', 'Canonsburg, PA, United States', 458);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FINV', 'STOCK', 'FinVolution Group', 'NYQ', 'Financial Services', 'Credit Services', 'FinVolution Group, formerly PPDAI GROUP INC, is a China-based company mainly engaged in operating an online consumer finance platform. The Companys products and services include loan services offered to borrowers, investment services offered to individual investors and institutional funding partners. The loan services offered to borrowers include standard loan products, consumption loan products and other loan products. The investment services offered to individual investors include self-discretionary investing tools, automated investing tools, investment programs and a secondary loan market. The Company also introduces borrowers to institutional funding partners and provides preliminary credit assessment services as well as other services.', 'Shanghai, , China', 3623);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EOG', 'STOCK', 'EOG Resources, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'EOG Resources, Inc. É uma empresa de exploração e produção de petróleo bruto e gás natural. A empresa explora, desenvolve, produz e comercializa petróleo bruto, gás natural líquido (NGL) e gás natural principalmente em grandes bacias produtoras nos Estados Unidos, na República de Trinidad e Tobago (Trinidad) e, de tempos em tempos, seleciona outras áreas internacionais. Suas operações estão localizadas nas bacias dos Estados Unidos, com foco em petróleo bruto e gás natural. É focado no Wolfcamp, Bone Spring e Leonard joga. A área do South Texas inclui o jogo Eagle Ford e o jogo de gás Dorado. Ele detém aproximadamente 535 000 acres líquidos totais no jogo Eagle Ford e aproximadamente 160 000 acres líquidos no jogo de gás Dorado. Em Trinidad, a Companhia, através de suas subsidiárias, incluindo EOG Resources Trinidad Limited, detém participação nas licenças de exploração e produção que abrangem o Consórcio da Costa do Sudeste (SECC) e Pelican Blocks, Banyan e Sercan áreas, entre outros.', 'Houston, TX, United States', 3150);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMA', 'STOCK', 'Comerica Incorporated', 'NYQ', 'Financial Services', 'Banks - Regional', 'Comerica Incorporated é uma empresa de serviços financeiros. Os segmentos da Companhia incluem Banco Comercial, Banco de Varejo, Gestão de Riqueza, Finanças e outros. O segmento de Banco Comercial atende às necessidades de pequenas e médias empresas, corporações multinacionais e entidades governamentais, oferecendo vários produtos e serviços, incluindo empréstimos comerciais e linhas de crédito, depósitos, gestão de caixa, entre outros. O segmento Retail Bank inclui uma gama completa de serviços financeiros pessoais, consistindo em empréstimos ao consumidor, coleta de depósitos ao consumidor e originação de empréstimos hipotecários. Oferece uma variedade de produtos de consumo, incluindo contas de depósito, empréstimos parcelados, cartões de crédito e outros. O segmento de Gestão de Riqueza fornece produtos e serviços para indivíduos e famílias abastados, de alto patrimônio líquido e ultra-alto patrimônio líquido, empresários e executivos e clientes institucionais. O segmento financeir', 'Dallas, TX, United States', 7963);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WAI', 'STOCK', 'Top KingWin Ltd', 'NCM', 'Financial Services', 'Capital Markets', 'Top KingWin Ltd is a holding company principally engaged in corporate business training services, corporate consulting services, advisory and transaction services and sales of devices. The corporate business training services mainly focus on advanced knowledge and new perspectives on the capital markets. The corporate consulting services mainly focus on various aspects of fundraising. The advisory and transaction services aim to connect entrepreneurs and businesses with diversified sources of capital. The sales of devices mainly includes selling devices to support artificial intelligence (AI) data collection and analysis. The Company mainly operates its businesses in the domestic market.', 'Guangzhou, , China', 85);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDOG', 'STOCK', 'Datadog, Inc.', 'NMS', 'Technology', 'Software - Application', 'Datadog, Inc. É a plataforma de observação e segurança para aplicativos em nuvem. A plataforma de software como serviço (SaaS) da empresa integra e automatiza o monitoramento de infraestrutura, monitoramento de desempenho de aplicativos, gerenciamento de logs, monitoramento de usuários reais e vários outros recursos para fornecer observabilidade e segurança unificadas e em tempo real para toda a pilha de tecnologia de seus clientes. Sua plataforma consiste em produtos que podem ser usados individualmente ou como uma solução unificada e inclui um mercado onde os clientes podem acessar produtos criados por seus parceiros em cima da plataforma Datadog. Os produtos da empresa incluem monitoramento de infraestrutura, monitoramento de desempenho de aplicativos (APM), gerenciamento de log, monitoramento de experiência digital, perfilador contínuo, monitoramento de banco de dados, monitoramento de Rede, Gerenciamento de Incidentes, Pipelines de Observabilidade, Gerenciamento de Custos de Nuvem', 'New York, NY, United States', 6500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNK', 'STOCK', 'Cinemark Holdings, Inc.', 'NYQ', 'Communication Services', 'Entertainment', 'Cinemark Holdings, Inc. is a movie theatre company. The Company is engaged in the motion picture exhibition industry, with theaters in the United States, Brazil, Argentina, Chile, Colombia, Peru, Honduras, El Salvador, Nicaragua, Costa Rica, Panama, Guatemala, Bolivia, and Paraguay. Its segments include U.S. markets and international markets. Its circuit, comprised of various brands that also include Century, Tinseltown and Rave, operates approximately 497 theaters with 5,653 screens in 42 states domestically and 13 countries throughout South and Central America. It plays mainstream films from many different genres, such as animated films, family films, dramas, comedies, horror and action films. It offers content in both 2-D and 3-D formats in all of its theaters, and in many locations, it offers either its own premium large format, XD, IMAX or ScreenX. It offers a variety of alternative entertainment content for its guests, such as concert, sporting and gaming events, and others.', 'Plano, TX, United States', 9252);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DYN', 'STOCK', 'Dyne Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Dyne Therapeutics, Inc. is a clinical-stage neuromuscular disease company. It is discovering and advancing therapeutics for people living with genetically driven neuromuscular diseases. Leveraging the modularity of its FORCE platform, it is developing targeted therapeutics that deliver to muscle and the central nervous system (CNS). It has a broad pipeline for neuromuscular diseases, including clinical programs for myotonic dystrophy type 1 (DM1) and Duchenne muscular dystrophy (DMD) and preclinical programs for facioscapulohumeral muscular dystrophy (FSHD) and Pompe disease. Its product candidate, DYNE-101, is being evaluated in ACHIEVE, an ongoing Phase I/II global clinical trial in patients with DM1. Its product candidate, DYNE-251, is being evaluated in DELIVER, an ongoing Phase I/II global clinical trial in patients with DMD who have mutations amenable to exon 51 skipping. Its other product candidates are DYNE-302 and DYNE-401. DYNE-302 addresses the genetic basis of FSHD.', 'Waltham, MA, United States', 206);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPRT', 'STOCK', 'Essential Properties Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Essential Properties Realty Trust, Inc. is an internally managed real estate investment trust (REIT). The Company owns and manages primarily single-tenant properties that are net leased on a long-term basis to companies operating service-oriented or experience-based businesses. The Company has a diversified portfolio that focuses on properties leased to tenants in businesses, including car washes, restaurants (primarily quick service restaurants and casual dining), early childhood education, medical and dental services, convenience stores, automotive services, equipment rental and sales, grocery, entertainment, industrial, and health and fitness. The Companys portfolio consists of about 2,104 freestanding net lease properties with a weighted average lease term of 14 years and a weighted average rent coverage ratio of 3.5x. In addition, the Companys portfolio is leased to about 413 tenants operating 592 different concepts in 16 industries across 49 states.', 'Princeton, NJ, United States', 48);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEN', 'STOCK', 'Franklin Resources, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'A Franklin Resources, Inc. É uma empresa global de gestão de investimentos com subsidiárias que operam como Franklin Templeton e atendem clientes em mais de 150 países. Através de seus gerentes de investimento especializados, a empresa oferece especialização em escala global, trazendo capacidades em capital próprio, renda fixa, alternativas e soluções multi-ativos. Ele fornece sua gestão de investimentos e serviços relacionados a investidores de varejo, institucionais e de alto patrimônio líquido em jurisdições em todo o mundo. Seus produtos de investimento incluem seus fundos patrocinados, bem como contas separadas institucionais e de alto patrimônio líquido, programas de contas gerenciadas separadamente de varejo, produtos sub-aconselhados e outros veículos de investimento. Seus fundos incluem fundos registrados (incluindo fundos negociados em bolsa) e fundos não registrados. Oferece seus serviços e produtos sob suas várias marcas distintas, incluindo, mas não limitado a, Alcentra, B', 'San Mateo, CA, United States', 10100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COLB', 'STOCK', 'Columbia Banking System, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Columbia Banking System, Inc. is the bank holding company for Umpqua Bank (the Bank). Through the Bank, the Company provides a broad range of banking, private banking, mortgage, and other financial services to corporate, institutional, small business, and individual customers. The Bank offers commercial lending products, treasury management and payment solutions, deposit products, wealth management services, residential real estate loans, and consumer loans. It offers specialized loans for corporate, middle market, and small business customers, including commercial lines of credit and term loans, accounts receivable and inventory financing, international trade finance, and others. It offers deposit products, including non-interest-bearing checking accounts, analyzed business accounts, interest-bearing checking and savings accounts, money market accounts, insured cash sweep and other investment sweep solutions, and certificates of deposit.', 'Tacoma, WA, United States', 4721);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBX', 'STOCK', 'Dropbox, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Dropbox, Inc. provides tools to help distributed teams prioritize, get organized, and keep work moving securely from anywhere. The Companys products include Dropbox Passwords, Dropbox Backup, Dropbox Sign, DocSend, Dropbox Dash for Business (Dash), Dropbox Replay and FormSwift, among others. Dropbox Passwords allows users to sign in to Websites and apps by creating and storing usernames and passwords across devices. Dropbox Backup automatically syncs folders on a user''s computer to the cloud. When turned on, files on the user''s personal computer or Mac are continuously backed up on the cloud. Dropbox Sign is an e-signature and document workflow platform that enables customers to easily sign, send and receive documents through its intuitive Web and mobile-based interfaces. DocSend is a secure document sharing and analytics platform. Dropbox Dash is an AI-powered, universal search tool, which enables teams to search, organize, share, and protect content from across their connected app', 'San Francisco, CA, United States', 2204);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNI', 'STOCK', 'Canadian National Railway Company', 'NYQ', 'Industrials', 'Railroads', 'Centuria Capital Group is an Australia-based specialist investment manager. The Company delivers a range of products and services to investors, advisers and security holders. The Company offers a range of investment opportunities, including listed and unlisted real estate funds as well as tax-effective investment bonds. Its principal activities are the marketing and management of investment products including property investment funds and friendly society investment bonds, as well as co-investments in property investment funds. Its segments include Property funds management, Co-investments, Developments, Property and development finance, Investment bonds management and Corporate. Property Funds Management segment is engaged in the management of listed and unlisted property funds. Developments segment manages development projects and completion of structured property developments, which span sectors ranging from commercial office, industrial, health through to residential mixed use.', 'Montreal, QC, Canada', 24912);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OMER', 'STOCK', 'Omeros Corporation', 'NGM', 'Healthcare', 'Biotechnology', 'Omeros Corporation is a biopharmaceutical company. The Company is focused on discovering, developing and commercializing small-molecule and protein therapeutics for large-market and orphan indications targeting immunologic disorders, including complement-mediated diseases, cancers, and addictive and compulsive disorders. Its lead MASP-2 inhibitor, narsoplimab, targets the lectin pathway of complement and is the subject of a biologics license application pending before FDA for the treatment of hematopoietic stem cell transplant-associated thrombotic microangiopathy. Its long-acting MASP-2 inhibitor, OMS1029, is in phase I single- and multiple-ascending-dose clinical studies. OMS906, its inhibitor of MASP-3, the key activator of the alternative pathway of complement, is advancing in clinical programs for paroxysmal nocturnal hemoglobinuria and complement 3 glomerulopathy. Its lead phosphodiesterase 7 inhibitor OMS527 is in clinical development for the treatment of cocaine use disorders.', 'Seattle, WA, United States', 202);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAPR', 'STOCK', 'Capricor Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Capricor Therapeutics, Inc. is a biotechnology company developing transformative cell and exosome-based therapeutics for the treatment and prevention of rare diseases. The Company''s program is focused on the development and commercialization of a cell therapy technology comprised of cardiosphere-derived cells (CDCs) for the treatment of Duchenne muscular dystrophy (DMD). Its lead product candidate deramiocel (also referred to as CAP-1002), is an allogeneic cardiac-derived cell therapy. CAP-1002 is advancing through Phase III clinical development for the treatment of Duchenne muscular dystrophy (DMD). CAP-1002 demonstrates immunomodulatory, antifibrotic, and regenerative actions specifically tailored for dystrophinopathies and heart disease. It leverages its exosome technology, using its StealthX platform in preclinical development focused on the areas of vaccinology, targeted delivery of oligonucleotides, proteins, and small molecule therapeutics.', 'San Diego, CA, United States', 160);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CB', 'STOCK', 'Chubb Limited', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'Chubb Limited é uma holding sediada na Suíça. A Companhia, através de suas subsidiárias, fornece uma gama de produtos e serviços de seguros e resseguros a clientes em todo o mundo. Seus segmentos incluem o seguro de propriedade comercial e acidentes (P&C) da América do Norte, seguro pessoal de P&C da América do Norte, seguro agrícola da América do Norte, seguro geral ultramarino, resseguro global e seguro de vida. Ele oferece produtos de seguros comerciais e ofertas de serviços, como programas de gerenciamento de riscos, controle de perdas e engenharia e gerenciamento complexo de sinistros. Fornece produtos de seguros especializados para áreas como aviação e energia. Ele também oferece cobertura de seguro de linhas pessoais, incluindo proprietários, automóveis, objetos de valor, responsabilidade de guarda-chuva e produtos marinhos recreativos. Além disso, fornece seguro de acidentes pessoais, saúde suplementar e vida a indivíduos em países selecionados.', 'Zurich, , Switzerland', 43000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLTR', 'STOCK', 'Dollar Tree, Inc.', 'NMS', 'Consumer Defensive', 'Discount Stores', 'A Dollar Tree, Inc. É uma operadora de lojas de variedades com desconto. Seus segmentos de negócios incluem Dollar Tree e Family Dollar. O segmento Dollar Tree é o operador de lojas de variedades com desconto que oferecem mercadorias predominantemente ao preço fixo. Suas lojas estão operando sob as marcas Dollar Tree e Dollar Tree Canada. Opera 15 centros de distribuição nos Estados Unidos e dois no Canadá. As lojas da Dollar Tree consistem em mercadorias consumíveis, mercadorias de variedade e produtos sazonais. O segmento Family Dollar opera lojas de varejo de mercadorias em geral, fornecendo aos clientes uma seleção de mercadorias em lojas de bairro convenientes. O segmento Family Dollar consiste em suas operações de loja sob a marca Family Dollar e 10 centros de distribuição. As lojas Family Dollar consistem em produtos consumíveis, produtos domésticos, produtos de vestuário e acessórios, e produtos sazonais e eletrônicos. Também possui marcas comerciais, incluindo Family Dollar e ', 'Chesapeake, VA, United States', 64434);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MFH', 'STOCK', 'Mercurity Fintech Holding Inc.', 'NCM', 'Technology', 'Information Technology Services', 'Mercurity Fintech Holding Inc. is a digital fintech company. The Company, along with its subsidiaries, is engaged in distributed computing, business consulting, and financial brokerage business. Its business segments include Business consultation services, Financial advisory services and brokerage services, and Distributed computing and storage services. Business consultation services segment includes business consultation services and industry resource support to global corporate clients based. Financial advisory services and brokerage services segment includes financial advisory services, online and traditional brokerage services. Distributed computing and storage services segment includes blockchain and cryptocurrencies and cryptocurrency mining. The Company''s subsidiaries include Mercurity Fintech Technology Holding Inc., Mercurity Limited, Ucon Capital (HK) Limited, Beijing Lianji Future Technology Co., Ltd., Chaince Securities, and JVDA, LLC.', 'New York, NY, United States', 11);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUK', 'STOCK', 'Duke Energy Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'Duke Energy Corporation é uma empresa de holding de energia. A empresa opera através de dois segmentos: Serviços Elétricos e Infra-estruturas (EU&I) e Serviços Públicos e Infra-estruturas de Gás (GU&I). O segmento EU&I realiza operações principalmente através das concessionárias públicas regulamentadas de Duke Energy Carolinas, Duke Energy Progress, Duke Energy Florida, Duke Energy Indiana e Duke Energy Ohio. A EU&I fornece serviço elétrico de varejo através da geração, transmissão, distribuição e venda de eletricidade para clientes nas regiões Sudeste e Centro-Oeste dos Estados Unidos. O segmento GU&I realiza operações de gás natural principalmente através das concessionárias públicas regulamentadas de Piedmont, Duke Energy Ohio e Duke Energy Kentucky. A Gu&I serve clientes residenciais, comerciais, industriais e de geração de energia de gás natural, incluindo clientes atendidos por municípios que são clientes grossistas. Também adquire um portfólio diversificado de serviços de transp', 'Charlotte, NC, United States', 26413);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBY', 'STOCK', 'Best Buy Co., Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'A Best Buy Co., Inc. Está envolvida na personalização e humanização de soluções de tecnologia. Atua em dois segmentos: Nacional e internacional. O segmento doméstico compreende suas operações em todos os estados, distritos e territórios dos Estados Unidos e seu negócio de Best Buy Health, e inclui as marcas Best Buy, Best Buy Ads, Best Buy Business, Best Buy Essentials, Best Buy Health, Best Buy Health, Best Buy Business, Best Buy Health, saúde Atual, Esquadrão Geek, Imagine That, Insignia, Lively, My Best Buy, My Best Buy Memberships, Pacific Kitchen and Home, TechLiquidators e Yardbird; e os nomes de domínio bestbuy.com, currenthealth.com, lively.com, techliquidators.com e yardbird.com. O segmento internacional compreende todas as operações no Canadá sob as marcas Best Buy, Best Buy Express, Best Buy Mobile, Geek Squad e TechLiquidators e os nomes de domínio bestbuy.ca e techliquidators.ca. Suas categorias de produtos incluem computação e telefones celulares, eletrônicos de consumo, ', 'Richfield, MN, United States', 85000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAH', 'STOCK', 'Booz Allen Hamilton Holding Corporation', 'NYQ', 'Industrials', 'Consulting Services', 'Booz Allen Hamilton Holding Corporation é a empresa-mãe da empresa de serviços de consultoria e engenharia de gestão e tecnologia, Booz Allen Hamilton Inc. Ele fornece consultoria de gestão e tecnologia, análise, engenharia, soluções digitais, operações de missão, e serviços cibernéticos para governos dos EUA e internacionais. Suas soluções incluem inteligência artificial, nuvem, experiência digital do cliente, treinamento de elite, DevSecOps corporativo, JADC2, prontidão de missão, segurança e força de trabalho do futuro. Ele apoia missões críticas para uma variedade de clientes do governo federal, incluindo quase todos os departamentos de gabinete do governo dos EUA, bem como para clientes comerciais, tanto no mercado interno quanto internacionalmente. Ele apoia seus clientes do governo federal ajudando-os a enfrentar desafios como proteger soldados em combate e apoiar suas famílias. Ele também fornece tecnologias para evoluir missões de defesa e fornece soluções para combatentes na ', 'McLean, VA, United States', 33400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BN', 'STOCK', 'Brookfield Corporation', 'NYQ', 'Financial Services', 'Asset Management', 'A Brookfield Corporation é uma empresa global de investimento sediada no Canadá, focada em construir riqueza de longo prazo para instituições e indivíduos em todo o mundo. A empresa tem três negócios principais: Gestão de ativos alternativos, soluções de riqueza e seus negócios operacionais que estão em energia renovável, infraestrutura, serviços empresariais e industriais e imóveis. Seu negócio de gestão de ativos inclui a gestão de fundos privados de longo prazo, estratégias perpétuas e estratégias líquidas em nome de seus investidores e de si mesmo. Seu negócio de soluções de riqueza inclui sua participação acionária na Brookfield Resseguros Ltd Seu negócio de energia renovável e transição inclui a propriedade, operação e desenvolvimento de hidrelétricas, eólicas e outros. Seu negócio de infraestrutura inclui a propriedade, operação e desenvolvimento de utilidades, transporte, midstream e ativos de dados. Seu negócio de private equity está focado na propriedade e operações no setor ', 'Toronto, ON, Canada', 250000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEO', 'STOCK', 'Diageo plc', 'NYQ', 'Consumer Defensive', 'Beverages - Wineries & Distilleries', 'A Diageo plc é um fabricante e distribuidor internacional de bebidas premium com sede no Reino Unido. Possui também vários investimentos em associados e joint ventures. A Companhia possui um portfólio de aproximadamente 200 marcas e vendas em 180 países. Seus segmentos incluem América do Norte, Europa, Ásia-Pacífico, América Latina e Caribe, África, Supply Chain and Procurement (SC&P), e Corporate e outros. O segmento SC&P fabrica produtos e inclui unidades de produção no Reino Unido, Irlanda, Itália, Guatemala e México, bem como compreende a função de aquisição global. Seus principais produtos incluem uísque escocês, outros whisky(e)y, vodka, tequila, gin, rum, licores, cerveja, vinho e álcool sem e com baixo teor de álcool. A coleção de marcas da Companhia inclui as vodkas Johnnie Walker, Crown Royal, J&B e Buchanan, Smirnoff, Ciroc e Ketel One, Capitão Morgan, Baileys, Don Julio e Tanqueray, entre outros. Ele também oferece Ritual Zero Proof Non-alcoholic Spirits (Ritual).', 'London, , United Kingdom', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRGY', 'STOCK', 'Crescent Energy Company', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'Crescent Energy Company is an energy company. The Companys operations are focused on Texas and the Rockies with active development in the Eagle Ford and Uinta basins. It also operates conventional assets in Wyoming, where it is active in carbon capture, use and storage (CCUS). It is an operator in the Eagle Ford with a proven ability to scale and safely capture operational upside. It operates in both the oil and condensate windows of the Eagle Ford. Its Uinta position has a large inventory of low-risk undeveloped locations with significant resource potential across multiple, prolific formations. The Uinta basin produces high-value crude, and it has secured takeaway capacity into the Salt Lake City refining complex. Its Wyoming operations comprise low-decline conventional production spanning numerous conventional fields. It operates two enhanced oil recovery projects (EOR) in Wyoming.', 'Houston, TX, United States', 987);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEM', 'STOCK', 'Agnico Eagle Mines Limited', 'NYQ', 'Basic Materials', 'Gold', 'Agnico Eagle Mines Limited is a Canada-based and led senior gold mining company engaged in producing precious metals from operations in Canada, Australia, Finland and Mexico, with a pipeline of exploration and development projects. Its operations include Canadian Malartic Complex, Detour Lake, Fosterville, Goldex, Kittila, La India, LaRonde Complex, Macassa, Meadowbank Complex, Meliadine and Pinos Altos. Its exploration sites include Barsele, Delta, Dubuisson, El Barqueno, Hammond Reef, Hope Bay, Jennings, Morelos Sur, North Madsen, Northern Territory, Pandora/Wood-Pandora, and others. The Canadian Malartic complex is located in the town of Malartic, 25 kilometers (km) west of Val-dOr in northwestern Quebec. The Fosterville mine is a high-grade, low-cost underground gold mine, located 20 km from the city of Bendigo. It also owns a 100% interest in all its properties (128,680 hectares) in Quebec. Its projects also include Marban Alliance, Horizon, Alpha, Launay, Peacock, and others.', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUZ', 'STOCK', 'Cousins Properties Incorporated', 'NYQ', 'Real Estate', 'REIT - Office', 'Primos Properties Incorporated é uma confiança de investimento imobiliário totalmente integrada, auto-administrada e auto-gerida (REIT). A empresa realiza seus negócios através da Cousins Properties LP (CPLP), que investe principalmente em prédios de escritórios de Classe A localizados em mercados de alto crescimento da Sun Belt. Possui mais de 99% da CPLP e consolida a CPLP. A CPLP é totalmente proprietária da Cousins TRS Services LLC (CTRS), que possui e gerencia seu próprio portfólio imobiliário e realiza determinados serviços relacionados ao setor imobiliário. A Companhia, CPLP, CTRS e suas subsidiárias desenvolvem, adquirem, locam, gerenciam e possuem principalmente propriedades de escritório Classe A e desenvolvimentos de uso misto nos mercados da Sun Belt dos Estados Unidos com foco em Atlanta, Austin, Tampa, Charlotte, Phoenix, Phoenix, EUA, EUA. Dallas, e Nashville. Suas operações são realizadas no segmento imobiliário de escritório. Seu portfólio de ativos imobiliários consis', 'Atlanta, GA, United States', 306);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRNC', 'STOCK', 'Cerence Inc.', 'NMS', 'Technology', 'Software - Application', 'A Cerence Inc. É uma fornecedora de assistentes alimentados por inteligência artificial (IA) para veículos conetados e autônomos. A empresa constrói assistentes virtuais baseados em IA para o mercado de mobilidade/transporte. Sua plataforma de software é usada para criar assistentes virtuais que podem se comunicar, encontrar informações e agir em uma variedade de categorias em expansão. Sua plataforma de software tem uma arquitetura híbrida que combina componentes de software de borda com componentes conetados à nuvem. Seus componentes de software Edge são instalados na unidade principal de um veículo e podem operar sem acesso a redes e informações externas. Seus componentes conetados à nuvem incluem determinadas tecnologias relacionadas à compreensão de linguagem natural e de fala, personalização habilitada por IA e estruturas de resposta baseadas em contexto e uma plataforma de integração de conteúdo. Assistentes virtuais criados com sua plataforma de software abordam solicitações de', 'Burlington, MA, United States', 1400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AREC', 'STOCK', 'American Resources Corporation', 'NCM', 'Basic Materials', 'Coking Coal', 'American Resources Corporation is a supplier of high raw materials to the new infrastructure market. The Company is focused on the extraction and processing of metallurgical carbon, an essential ingredient used in steelmaking, critical and rare earth minerals for the electrification market, and reprocessed metal to be recycled. It has a portfolio of operations located in the Central Appalachian basin of eastern Kentucky and southern West Virginia. Its subsidiaries include American Carbon Corp. American Carbon Corp. has over seven coal mining and processing operating subsidiaries: McCoy Elkhorn Coal LLC, Knott County Coal LLC, Deane Mining, LLC (Deane Mining), Wyoming County Coal LLC (Wyoming County), Quest Processing LLC (Quest Processing), Perry County Resources, located in eastern Kentucky and western West Virginia within the Central Appalachian coal basin, and ERC Mining Indiana Corporation (ERC) located in southwest Indiana within the Illinois coal basin.', 'Fishers, IN, United States', 23);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRK', 'STOCK', 'Comstock Resources, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Comstock Resources, Inc. is an independent energy company. The Company is engaged in the acquisition, exploration, development and production of oil and natural gas in the United States. The Company operates through the exploration and production of the North American natural gas and oil segment. Its primarily operates in the Haynesville shale, a natural gas basin located in North Louisiana and East Texas, with economic and geographical proximity to the Gulf Coast natural gas markets. The Company is focused on the development of drilling opportunities in the Haynesville and Bossier shales and exploration activities in the Western Haynesville play. It has over 1,099,090 acres (819,489 net) prospective for the Haynesville and Bossier shale plays, located in North Louisiana and East Texas, including its extension of the plays in its Western Haynesville area. The Company owns interests in over 2,427 producing natural gas and oil wells (1,542.6 net) and it operates 1,747 of these wells.', 'Frisco, TX, United States', 256);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFG', 'STOCK', 'Citizens Financial Group, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Citizens Financial Group, Inc. Oferece uma gama de produtos e serviços bancários comerciais e de varejo para indivíduos, pequenas empresas, empresas de médio mercado, grandes corporações e instituições. A Companhia atua através de dois segmentos: Banca de Consumo e Banca Comercial. O segmento de Consumer Banking atende clientes de consumo e pequenas empresas, com produtos e serviços que incluem depósitos, empréstimos hipotecários e capital próprio, cartões de crédito, empréstimos para pequenas empresas, gestão de patrimônio e serviços de investimento em grande parte em sua pegada bancária tradicional de 14 estados. O segmento Consumer Banking opera aproximadamente 1 000 filiais, incluindo 143 locais na loja, e aproximadamente 3 100 caixas eletrônicos. O segmento de Banca Comercial atende principalmente empresas e instituições com produtos e soluções financeiras, incluindo empréstimos e leasing, serviços de gestão de depósitos e tesouraria, câmbio, taxa de juros e soluções de gestão de ', 'Providence, RI, United States', 17677);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BX', 'STOCK', 'Blackstone Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Blackstone Inc. is an alternative asset manager. The Companys assets under management include global investment strategies focused on real estate, private equity, infrastructure, life sciences, growth equity, credit, real assets, secondaries and hedge funds. It operates through four segments: Real Estate, Private Equity, Credit & Insurance and Multi-Asset Investing. Its Real Estate segment primarily comprises its management of opportunistic real estate funds, Core+ real estate funds, and real estate debt strategies. Its Credit & Insurance segment consists principally of Blackstone Credit & Insurance, which is organized into three overarching strategies: private corporate credit, liquid corporate credit and infrastructure and asset-based credit. Multi-Asset Investing is organized into two primary platforms: Absolute Return and Multi-Strategy. In addition, the segment also includes a publicly traded energy infrastructure, renewables and master limited partnership investment platform.', 'New York, NY, United States', 4895);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARBK', 'STOCK', 'Argo Blockchain plc', 'NMS', 'Financial Services', 'Capital Markets', 'Argo Blockchain plc is a United Kingdom-based blockchain technology company focused on large-scale mining of Bitcoin. It mines using purpose-built computers (or mining machines) to solve complex cryptographic algorithms (or verify or solve blocks) on the blockchain in exchange for rewards and fees denominated in the native token of that blockchain network. Its mining fleet primarily consists of Bitmain Antminer S19, S19 Pro, S19J Pro, and ePIC BlockMiners, all of which utilize advanced application-specific-integrated-circuits (ASICs) designed specifically for cryptocurrency mining. Its fleet of miners is operational in its Quebec facility, with additional hosted sites in North America. Its Baie Comeau location is over 40,000 square feet and operates around 15 megawatts (MW). The Baie Comeau hydroelectric dam generates 100% renewable power. The Company''s subsidiaries include Argo Innovation Labs Inc., Argo Operating US LLC, and Argo Holdings US Inc.', 'London, , United Kingdom', 25);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRBR', 'STOCK', 'BellRing Brands, Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'BellRing Brands, Inc. is a consumer product holding company. The Company is a provider of ready-to-drink (RTD) protein shakes, other RTD beverages, powders and nutrition bars. The Company operates through protein-based consumer goods. The Companys primary brands are Premier Protein and Dymatize. Premier Proteins product portfolio consists of RTD protein shakes, refreshing protein beverages and protein powders. Dymatize brands portfolio includes an assortment of sports nutrition products, including protein powders. Dymatize protein powder portfolio consists of three primary products: ISO.100 made with hydrolyzed 100% Whey Protein Isolate, Elite 100% Whey and Super Mass Gainer. The Companys products are distributed across a diverse network of channels including club, food, drug and mass (FDM), e-Commerce, specialty and convenience.', 'Saint Louis, MO, United States', 485);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EA', 'STOCK', 'Electronic Arts Inc.', 'NMS', 'Communication Services', 'Electronic Gaming & Multimedia', 'Electronic Arts Inc. É uma empresa de entretenimento digital interativo. A Empresa desenvolve, comercializa, publica e entrega jogos, conteúdos e serviços que podem ser jogados pelos consumidores em uma variedade de plataformas, que incluem consoles de jogos, computadores pessoais (PCs), telefones celulares e tablets. Seu portfólio inclui a Propriedade Intelectual (IP) que possui integralmente, como Apex Legends, Battlefield e The Sims ou licenças de outros, como as licenças dentro do EA SPORTS FC e EA SPORTS Madden NFL. Desenvolve e publica jogos e serviços em diversos gêneros, como esportes, corridas, tiro em primeira pessoa, ação, interpretação de papéis e simulação. A Companhia comercializa e vende seus jogos e serviços por meio de canais de varejo e canais de distribuição digital. A Empresa também oferece serviços ao vivo, incluindo conteúdo extra, ofertas de assinatura e venda de seus jogos base e jogos gratuitos. A Empresa também oferece seu serviço de assinatura EA Play em cons', 'Redwood City, CA, United States', 14500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AM', 'STOCK', 'Antero Midstream Corporation', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Antero Midstream Corporation is a midstream energy company. The Company owns, operates and develops midstream gathering, compression, processing and fractionation assets located in the Appalachian Basin, as well as integrated water assets that primarily service Antero Resources Corporations (Antero Resources) properties. The Companys assets consist of gathering systems and compression facilities, water handling and blending facilities and interests in processing and fractionation plants. The Companys segments include gathering and processing and water handling. The gathering and processing segment includes a network of gathering pipelines and compressor stations that collect and process production from Antero Resources wells in the Appalachian Basin, as well as equity in earnings from its investments in the Joint Venture and Stonewall. The water handling segment includes two independent systems that deliver water from sources and other fluid handling services.', 'Denver, CO, United States', 616);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('HR', 'STOCK', 'Healthcare Realty Trust Incorporated', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'Healthcare Realty Trust Incorporated é uma confiança de investimento imobiliário auto-gerida e auto-administrada (REIT) que possui e opera edifícios médicos ambulatoriais localizados principalmente em torno de campi hospitalares. A empresa cresce seletivamente seu portfólio por meio de aquisição e desenvolvimento de imóveis. Seu portfólio inclui quase 700 propriedades totalizando mais de 40 milhões de pés quadrados concentrados em 15 mercados em crescimento. A Empresa atua em um amplo espetro de serviços integrados, incluindo leasing, gestão, aquisição, financiamento, desenvolvimento e redesenvolvimento de tais propriedades. Ele se concentra em instalações localizadas principalmente nos campi de hospitais de cuidados agudos associados aos sistemas de saúde. As propriedades da empresa em mercados de alto crescimento com uma ampla mistura de inquilinos que inclui mais de 30 especialidades médicas, bem como cirurgia, imagem, câncer e centros de diagnóstico. O portfólio imobiliário da Comp', 'Nashville, TN, United States', 550);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAKE', 'STOCK', 'The Cheesecake Factory Incorporated', 'NMS', 'Consumer Cyclical', 'Restaurants', 'The Cheesecake Factory Incorporated is an experiential dining company focused on hospitality. The Company owns and operates about 352 restaurants throughout the United States and Canada under brands, including The Cheesecake Factory (215 locations), North Italia (43 locations), Flower Child (38 locations), and a collection within its Fox Restaurant Concepts (FRC) portfolio (49 locations). Internationally, 34 The Cheesecake Factory restaurants operate under licensing agreements. Its bakery division operates two facilities that produce cheesecakes and other baked products for its restaurants, international licensees, and third-party bakery customers. The Cheesecake Factory menu features about 225 items, exclusive of beverage and dessert items and including items presented on supplemental menus, such as its SkinnyLicious menu that offers items at 590 calories or less. Its menu offerings include appetizers, pizza, seafood, steaks, chicken, burgers, small plates, pastas, salads, and others.', 'Calabasas, CA, United States', 47900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NWSA', 'STOCK', 'News Corporation', 'NMS', 'Communication Services', 'Entertainment', 'A News Corporation é uma empresa diversificada de mídia e serviços de informação. Seu segmento de Serviços imobiliários digitais consiste no interesse da Companhia pelo Grupo REA e pela Move. REA Group é uma empresa de mídia digital especializada em imóveis e serviços relacionados à propriedade em seus sites e aplicativos móveis. A Move é uma provedora de serviços imobiliários digitais nos Estados Unidos e opera principalmente uma plataforma de informação imobiliária, publicidade e serviços, bem como seus serviços baseados em referência, ferramentas on-line e serviços para proprietários e inquilinos. Seu segmento Dow Jones consiste na Dow Jones, uma provedora global de notícias e informações de negócios, que distribui seu conteúdo e dados por meio de uma variedade de canais de mídia. Seu segmento de publicação de livros consiste em HarperCollins, uma editora de livros de consumo com operações em 15 países. Seu segmento de mídia de notícias é composto pela News Corp Australia, News UK e', 'New York, NY, United States', 22300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('XEL', 'STOCK', 'Xcel Energy Inc.', 'NMS', 'Utilities', 'Utilities - Regulated Electric', 'A Xcel Energy Inc. É uma empresa de fornecimento de gás elétrico e natural. A empresa fornece um portfólio abrangente de produtos e serviços relacionados à energia para aproximadamente 3,9 milhões de clientes de energia e 2,2 milhões de clientes de gás natural através de quatro subsidiárias de serviços públicos, NSP-Minnesota, NSP-Wisconsin, PSCo e SPS. A Companhia atua através de dois segmentos. Seu segmento de serviços públicos elétricos regulamentados gera, compra, transmite, distribui e vende eletricidade em Colorado, Michigan, Minnesota, Novo México, Dakota do Norte, Dakota do Sul, Texas e Wisconsin. Além disso, este segmento inclui vendas para revenda e fornece serviço de transmissão por atacado a várias entidades nos Estados Unidos. O segmento de utilidade elétrica regulada também inclui operações de comércio e commodities por atacado. Seu segmento regulamentado de serviços públicos de gás natural compra, transporta, armazena, distribui e vende gás natural principalmente em part', 'Minneapolis, MN, United States', 11380);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEAM', 'STOCK', 'Beam Therapeutics Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Beam Therapeutics Inc. is a biotechnology company developing precision genetic medicines through base editing. The Company''s suite of gene editing technologies is anchored by base editing, a technology that is designed to enable precise, predictable and efficient single base changes, at targeted genomic sequences, without making double-stranded breaks in the deoxyribonucleic acid. Its lead programs are focused on sickle cell disease and alpha-1 antitrypsin deficiency, and it is also advancing programs in other genetic diseases. Its primary programs include BEAM-101, Engineered Stem Cell Antibody Paired Evasion (ESCAPE), BEAM-302 and BEAM-301. BEAM-101 is a patient-specific, autologous hematopoietic stem cell (HSC), investigational therapy. ESCAPE is a potentially non-genotoxic approach to HSC transplantation. BEAM-302 is a liver-targeting lipid nanoparticle formulation of base editing reagents designed to offer a one-time treatment to correct the E342K point mutation (PiZZ genotype).', 'Cambridge, MA, United States', 509);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALXO', 'STOCK', 'ALX Oncology Holdings Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'ALX Oncology Holdings Inc. is a clinical-stage immuno-oncology company focused on helping patients fight cancer by developing therapies that block the CD47 immune checkpoint inhibitor and bridge the innate and adaptive immune system. Its product candidate, evorpacept, is a CD47 blocking therapeutic that combines a high-affinity CD47 binding domain with an inactivated, proprietary Fc domain. It is engaged in focusing on combining evorpacept with anti-cancer antibodies, ADCs, and PD-1/PD-L1 immune checkpoint inhibitors. Cancer cells leverage CD47, a cell surface protein, as a dont eat me signal to evade macrophage phagocytosis or as a don''t activate T-cells signal that prevents activation of T-cells by dendritic cells. It focuses on combining evorpacept with anti-cancer antibodies, ADCs, and PD-1/PD-L1 immune checkpoint inhibitors. It also has a preclinical program focused on developing ALTA-002, a SIRPa TRAAC that offers ways to engage the innate and adaptive immune response to cancer', 'South San Francisco, CA, United States', 80);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EONR', 'STOCK', 'EON Resources Inc.', 'ASE', 'Energy', 'Oil & Gas E&P', 'EON Resources Inc. is an independent upstream energy company. The Company is focused on the development of onshore oil and natural gas properties in the United States. It is primarily focused on producing oil and gas properties in the Permian Basin. The Companys properties are in the Grayburg-Jackson Field in Eddy County, New Mexico, which is a sub-area of the Permian Basin and the South Justis Field Property in Lea County, New Mexico. The Company focuses wholly on vertical development drilling. Its Grayburg-Jackson oil field is a waterflood property and is operated by LH Operating, LLC (LHO). Through LHO, it holds approximately 13,700 contiguous leasehold acres, 342 producing wells and 207 injection wells situated on 20 federal and three state leases in the Grayburg-Jackson Oil Field. The South Justis Field Property is a carbonate reservoir, which consists of approximately 5,360 contiguous acres with 208 combined producing and injection wells with a large spacing of 50 acres.', 'Houston, TX, United States', 12);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDSX', 'STOCK', 'Biodesix, Inc.', 'NGM', 'Healthcare', 'Diagnostics & Research', 'Biodesix, Inc. (Biodesix) is a diagnostic solutions and services company. The Company develops diagnostic tests addressing clinical questions by combining multi-omics through the power of artificial intelligence. Biodesix offers over five Medicare-covered tests for patients with lung diseases. The blood based Nodify Lung Nodule Risk Assessment testing strategy, consisting of the Nodify XL2 and the Nodify CDT tests, evaluates the risk of malignancy in incidental pulmonary nodules, enabling physicians to better triage patients to the appropriate course of action. The blood based IQLung strategy for lung cancer patients integrates the GeneStrat targeted ddPCR test, the GeneStrat NGS test and the VeriStrat test to support treatment decisions across all stages of lung cancer. Biodesix also leverages the advanced Diagnostic Cortex artificial intelligence (AI) platform, to collaborate with biotechnology and pharmaceutical companies to solve complex diagnostic challenges in lung disease.', 'Louisville, CO, United States', 273);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DXCM', 'STOCK', 'DexCom, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'DexCom, Inc. É uma empresa de dispositivos médicos. A empresa está focada principalmente na conceção, desenvolvimento e comercialização de monitoramento contínuo de glicose (CGM), sistemas para o gerenciamento de diabetes e saúde metabólica por pacientes, cuidadores e clínicos. Seus produtos incluem Dexcom G6, Dexcom G7, Stelo, Dexcom Share e Dexcom ONE. A empresa permite que as pessoas tomem o controle da saúde por meio de tecnologia inovadora de biossensoriamento. O Dexcom G6 é o seu sistema integrado de monitorização contínua da glicose (iCGM). O STELO foi projetado especificamente para pessoas com diabetes tipo II que não usam insulina como o primeiro biossensor de glicose sem receita médica nos Estados Unidos. O sistema de monitoramento remoto Dexcom Share, oferecido para uso com qualquer sistema Dexcom, usa um aplicativo no dispositivo móvel compatível do paciente. Seu Dexcom G7 é para adultos e crianças (mais de 2 anos) que vivem com diabetes tipo I ou tipo II que estão em qualq', 'San Diego, CA, United States', 10200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FANG', 'STOCK', 'Diamondback Energy, Inc.', 'NMS', 'Energy', 'Oil & Gas E&P', 'A Diamondback Energy, Inc., juntamente com suas subsidiárias, é uma empresa independente de petróleo e gás natural focada na aquisição, desenvolvimento, exploração e exploração de reservas não convencionais de petróleo e gás natural em terra, principalmente na Bacia Permiana, no oeste do Texas. As atividades da empresa são direcionadas principalmente para o desenvolvimento horizontal das formações Wolfcamp e Spraberry na Bacia de Midland e nas formações Wolfcamp e Bone Spring na Bacia de Delaware, ambas fazem parte da maior Bacia Permiana no Oeste do Texas e no Novo México. Além disso, sua subsidiária, Viper Energy, Inc., possui propriedades de petróleo e gás natural principalmente na bacia do Permiano. Sua posição total de acreage na bacia de Permian consiste em aproximadamente 7,77,181 acres líquidos na bacia de Midland e aproximadamente 123 218 acres líquidos na bacia de Delaware. As subsidiárias da empresa incluem Rattler Midstream GP LLC, Rattler Midstream LP e QEP Resources, Inc.', 'Midland, TX, United States', 1983);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CM', 'STOCK', 'Canadian Imperial Bank of Commerce', 'NYQ', 'Financial Services', 'Banks - Diversified', 'Canadian Imperial Bank of Commerce is a North American financial institution. The Company''s segments include Canadian Personal and Business Banking, Canadian Commercial Banking and Wealth Management, U.S. Commercial Banking and Wealth Management, and Capital Markets. Canadian Personal and Business Banking segment provides personal and business clients across Canada with financial advice, services and solutions through banking centers, mobile and online channels. Canadian Commercial Banking and Wealth Management segment provides relationship-oriented banking and wealth management services. U.S. Commercial Banking and Wealth Management segment is focused on middle-market and mid-corporate companies, entrepreneurs, high-net-worth individuals and families, as well as operating personal and small business banking services in six United States markets. Capital Markets segment provides integrated global markets products and services, investment banking and corporate banking solutions.', 'Toronto, ON, Canada', 48726);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CME', 'STOCK', 'CME Group Inc.', 'NMS', 'Financial Services', 'Financial Data & Stock Exchanges', 'CME Group Inc. Fornece um mercado de derivativos. A Empresa permite que os clientes negociem futuros, opções, caixa e mercados de balcão (OTC), otimizem portfólios e analisem dados. As bolsas de TI oferecem uma gama de produtos de referência global em todas as principais classes de ativos com base em taxas de juros, índices de ações, câmbio (FX), energia, produtos agrícolas e metais. Ele oferece futuros e opções de negociação de futuros através da plataforma CME Globex, negociação de renda fixa via BrokerTec e negociação FX na plataforma EBS. Além disso, opera o provedor central de compensação de contrapartes, CME Clearing. Seus produtos fornecem um meio de cobertura, especulação e alocação de ativos relacionados aos riscos associados, entre outras coisas, a instrumentos sensíveis à taxa de juros e mudanças nos preços das commodities agrícolas, energéticas e metálicas. Fornece serviços de compensação e liquidação para uma gama de futuros e opções negociados em bolsa em contratos futuro', 'Chicago, IL, United States', 3760);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COST', 'STOCK', 'Costco Wholesale Corporation', 'NMS', 'Consumer Defensive', 'Discount Stores', 'A Costco Wholesale Corporation (Costco) opera armazéns de associados e sites de comércio eletrônico que oferecem uma seleção de produtos de marca nacional e marca própria em uma ampla gama de categorias. A Companhia compra a maioria de sua mercadoria diretamente de fornecedores e a encaminha para pontos de consolidação cross-docking (depósitos) ou diretamente para seus armazéns. Ele opera 891 armazéns, incluindo 614 nos Estados Unidos e Porto Rico, 108 no Canadá, 40 no México, 35 no Japão, 29 no Reino Unido, 19 na Coreia, 15 na Austrália, 14 em Taiwan, sete na China, cinco na Espanha, dois na França e um na Islândia, Nova Zelândia e Suécia. Ele também opera sites de comércio eletrônico nos Estados Unidos, Canadá, Reino Unido, México, Coreia e outros países. Taiwan, Japão e Austrália. A Empresa oferece ampla seleção de mercadorias, além da conveniência de departamentos especializados e serviços exclusivos para membros.', 'Issaquah, WA, United States', 333000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZI', 'STOCK', 'Autozi Internet Technology (Global) Ltd.', 'NGM', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Autozi Internet Technology Global Ltd is a company that is primarily engaged in providing automotive lifecycle services. The Company operates three divisions. New Car Sales segment includes parallel imported car sales and new energy vehicle sales. Auto Parts and Auto Accessories Sales segment mainly conducts business to auto parts dealers and gradually upgrades to direct connection with local MBS stores. The segment sells multiple product brands as well as its own brands, covering lubricating oil, battery, filter, brake pad, antifreeze, wiper blade, and chemicals. Automotive Insurance Related Services segment includes value-added repair services, claims and repair services, and insurance intermediary services.', 'Beijing, , China', 86);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHAI', 'STOCK', 'DIH Holding US, Inc.', 'NGM', 'Healthcare', 'Medical Devices', 'DIH Holding US, Inc. is a global provider of advanced robotic devices used in physical rehabilitation. Its rehabilitation hospitals and outpatient clinics offering solutions include ArmeoPower, ArmeoSpring, ArmeoSpring Pro, ArmeoSenso, Erigo, Lokomat, SafeGait 360 by Gorbel, RYSEN, Andago, C-Mill, and HocoNet. Its Research & Academia offering solutions include GRAIL, CAREN Extended, CAREN High-End, M-Gait, and D-Flow. The ArmeoSpring Pro is a cutting-edge medical device designed to bring upper limb rehabilitation to the next level. Its new arm weight support, powered by TrueG technology, allows patients to receive continuous arm weight support from shoulder extension to shoulder flexion. ArmeoPower guides the initial phases of arm and hand function recovery. ArmeoSpring supports the recovery of arm and hand functions. ArmeoSenso is a sensor-based solution for arm function recovery. HocoNet is a software platform connecting product portfolio across the entire continuum of care.', 'Norwell, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGI', 'STOCK', 'Alamos Gold Inc.', 'NYQ', 'Basic Materials', 'Gold', 'Alamos Gold Inc. is a Canadian intermediate gold producer with diversified production from three operating mines in North America. This includes the Island Gold District and the Young-Davidson mine in northern Ontario, Canada, and the Mulatos District in Sonora State, Mexico. Additionally, it has a portfolio of development stage projects, including the Phase 3+ Expansion at Island Gold, and the Lynn Lake project in Manitoba, Canada. The Island Gold Mine is located about 83 kilometers (km) northeast of Wawa, in northern Ontario. The Young-Davidson Mine is located in northern Ontario, Canada, centrally located between Timmins, Kirkland Lake, North Bay, and Sudbury. The Mulatos Mine is located 220 km east of Hermosillo in the state of Sonora in northwest Mexico. The Lynn Lake project is located in northern Manitoba and consists of two primary sites, MacLellan and Gordon. Its other projects are the Turkish Development Projects, the Quartz Mountain Gold Project, and Qiqavik Gold Project.', 'Toronto, ON, Canada', 2400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRKR', 'STOCK', 'Bruker Corporation', 'NMS', 'Healthcare', 'Medical Devices', 'A Bruker Corporation é desenvolvedora, fabricante e distribuidora de instrumentos científicos e soluções analíticas e de diagnóstico. Seu segmento BSI BioSpin projeta, fabrica e distribui ferramentas de ciências da vida habilitantes baseadas em tecnologia de ressonância magnética. Seu segmento BSI CALID projeta, fabrica e distribui soluções de espetrometria de massa em ciências da vida e espetrometria de mobilidade iônica, instrumentos e soluções de análise de processos e análises analíticas. Seu segmento BSI Nano projeta, fabrica e distribui instrumentos avançados de raios X, instrumentação de microscopia de força atômica, instrumentos avançados de microscopia ótica de fluorescência. Seu segmento Bruker Energy & Supercon Technologies (BEST) desenvolve e fabrica materiais e dispositivos supercondutores e não supercondutores para uso em energia renovável, infraestrutura de energia, saúde e grande pesquisa científica. Suas linhas de produtos incluem NCounter, CosMx, GeoMx e AtoMx. Também', 'Billerica, MA, United States', 11396);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BXP', 'STOCK', 'BXP, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'A BXP, Inc. É uma confiança de investimento imobiliário totalmente integrada, auto-administrada e auto-gerida. A empresa desenvolve, possui e gerencia locais de trabalho de primeira linha nos Estados Unidos. Os segmentos da empresa por área geográfica são Boston, Los Angeles, Nova York, São Francisco, Seattle, seu segmento por tipo de propriedade inclui escritório (que inclui escritório, ciências da vida e varejo), residencial e hotel. Seu portfólio totaliza 53,0 milhões de pés quadrados e 184 propriedades, incluindo nove propriedades em construção/redesenvolvimento. Suas propriedades consistem em 162 propriedades de escritório e ciências da vida (incluindo sete propriedades em construção / redesenvolvimento); 14 propriedades de varejo (incluindo uma propriedade em construção); sete propriedades residenciais (incluindo duas propriedades em construção) e um hotel. Suas propriedades incluem Times Square Tower, 100 Federal Street, 767 Fifth Avenue, 601 Lexington Avenue, Atlantic Wharf Off', 'Boston, MA, United States', 816);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADMA', 'STOCK', 'ADMA Biologics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'ADMA Biologics, Inc. is an end-to-end commercial biopharmaceutical company dedicated to manufacturing, marketing and developing specialty biologics for the treatment of immunodeficient patients at risk for infection and others at risk for certain infectious diseases. The Company manufactures and markets three United States Food and Drug Administration (FDA)-approved plasma-derived biologics for the treatment of immune deficiencies and the prevention of certain infectious diseases: ASCENIV (immune globulin intravenous, human-slra 10% liquid) for the treatment of primary humoral immunodeficiency (PI); BIVIGAM (immune globulin intravenous, human) for the treatment of PI; and NABI-HB (hepatitis B immune globulin, human) to provide enhanced immunity against the hepatitis B virus. Through its ADMA BioCenters subsidiary, the Company also operates as an FDA-approved source plasma collector in the United States, which provides its blood plasma for the manufacture of its products.', 'Ramsey, NJ, United States', 685);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BROS', 'STOCK', 'Dutch Bros Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Dutch Bros Inc. is an operator and franchiser of drive-thru shops, which is focused on serving hand-crafted beverages. The Company sells a range of customizable hot, iced and blended beverages. Coffee-based beverages include its espresso-based custom drinks, cold brew and its proprietary Freeze blended beverages. Its Private Reserve coffee is a 100% Arabica three-bean blend, roasted in its Grants Pass facility. Its proprietary Blue Rebel energy drink is customizable with flavors and modifiers. It also offers a variety of teas, lemonades, sodas and smoothies. The Company has two segments: Company-operated shops, and Franchising and other. The Company-operated shops segment includes coffee shop sales to customers. The Franchising and other segment includes bean and product sales to franchise partners and includes the initial franchise fees, royalties, and marketing fees. It has approximately 982 shops, of which 670 are operated by the Company and 312 are franchised, across 18 states.', 'Grants Pass, OR, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUD', 'STOCK', 'Anheuser-Busch InBev SA/NV', 'NYQ', 'Consumer Defensive', 'Beverages - Brewers', 'A Anheuser-Busch Inbev SA é uma empresa sediada na Bélgica. A empresa está envolvida principalmente na fabricação de cerveja. A empresa opera através de seis segmentos: América do Norte, Oriente Médio, América do Sul, EMEA, Ásia-Pacífico, empresas globais de exportação e holding. O portfólio de marcas da Companhia inclui marcas globais, como Budweiser, Corona e Stella Artois; marcas internacionais, incluindo Beck''s, Leffe e Hoegaarden, e campeões locais, como Bud Light, Skol, Brahma, Antártica, Quilmes, Victoria, Modelo Especial, Michelob Ultra, Harbin, Sedrin, Klinskoye, Sibirskaya Korona, Chernigivske, Cass e Jupiler. O negócio de refrigerantes da Companhia consiste em produção própria e acordos com a PepsiCo relacionados a arranjos de engarrafamento e distribuição entre suas diversas subsidiárias e a PepsiCo. A AmBev, que é uma subsidiária da Companhia, é um engarrafador da PepsiCo. As marcas que são distribuídas ao abrigo destes acordos são Pepsi, 7UP e Gatorade.', 'Leuven, , Belgium', 144000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OPK', 'STOCK', 'OPKO Health, Inc.', 'NMS', 'Healthcare', 'Diagnostics & Research', 'OPKO Health, Inc. is a multinational biopharmaceutical and diagnostics company. The Companys segments include pharmaceutical and diagnostics. The pharmaceutical segment consists of the pharmaceutical operations it operates in Chile, Mexico, Ireland, Israel, Spain, Ecuador, France, the United States, and its global pharmaceutical research and development operations. The diagnostics segment primarily consists of clinical laboratory operations through BioReference and its point-of-care operations. Its pharmaceutical business features Somatrogon (hGH-CTP), a once-weekly human growth hormone injection, and it is marketed under the brand name NGENLA. The Company, through its pharmaceutical division, manufactures and sells Rayaldee, a United States Food and Drug Administration (FDA) approved treatment for secondary hyperparathyroidism (SHPT) in adults with stage 3 or 4 chronic kidney disease (CKD) and vitamin D insufficiency.', 'Miami, FL, United States', 2997);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMTM', 'STOCK', 'Amentum Holdings, Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'Amentum Holdings, Inc. is a global advanced engineering and technology solutions provider to a broad base of the United States and allied government agencies, supporting programs of critical national importance across energy and environmental, intelligence, space, defense, civilian and commercial end-markets. It offers a range of capabilities, including intelligence and counter-threat solutions, data fusion and analytics, engineering and integration, environmental solutions, advanced test, training and readiness, and citizen solutions. Its segments include Digital Solutions (DS) and Global Engineering Solutions (GES). The DS segment offers advanced digital and data-driven solutions including intelligence analytics, space system development, cybersecurity, and next-generation information technology for the federal government and commercial clients. The GES segment offers large-scale environmental remediation, clean energy, platform engineering, sustainment and supply chain management.', 'Chantilly, VA, United States', 53000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BW', 'STOCK', 'Babcock & Wilcox Enterprises, Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Babcock & Wilcox Enterprises, Inc. is a provider of renewable, environmental and thermal technologies for industrial, electrical utility, municipal and other customers. The Company operates through three segments: Babcock & Wilcox Renewable, Babcock & Wilcox Environmental, and Babcock & Wilcox Thermal. Its Babcock & Wilcox Renewable segment offers technologies for environmentally sustainable power and heat generation, including waste-to-energy, oxygen-fired biomass-to-energy and black liquor systems for the pulp and paper industry. Its Babcock & Wilcox Environmental segment provides emissions control and environmental technology solutions for utility, waste-to-energy, biomass-to-energy, carbon black, and industrial steam generation applications around the world. Its Babcock & Wilcox Thermal segment provides steam generation equipment, aftermarket parts, construction, maintenance and field services for plants in the power generation, oil and gas, and industrial sectors.', 'Akron, OH, United States', 1900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNA', 'STOCK', 'Ginkgo Bioworks Holdings, Inc.', 'NYQ', 'Healthcare', 'Biotechnology', 'Ginkgo Bioworks Holdings, Inc. operates as a horizontal platform for cell programming, providing end-to-end services for organizations across diverse markets, from food and agriculture to pharmaceuticals to industrial and specialty chemicals. Its segments include Cell Engineering and Biosecurity. The Cell Engineering consists of research and development services performed under collaboration and license agreements relating to its cell programming platform. Its cell programming platform includes two core assets: the Foundry, and Codebase. The Biosecurity segment consists of biomonitoring and bioinformatics support services, offered to both government and non-government customers through its two core offerings: Canopy and Horizon. The Company provides comprehensive research and development services spanning the genetic medicine modalities: gene therapy, cell therapy and gene editing, and RNA therapeutics.', 'Boston, MA, United States', 834);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLE', 'STOCK', 'Apple Hospitality REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Hotel & Motel', 'Apple Hospitality REIT, Inc. is a real estate investment trust (REIT) that owns a diverse portfolio of upscale, room-focused hotels in the United States. The Company''s portfolio consists of about 221 hotels with more than 29,893 guest rooms located in 85 markets throughout 37 states as well as one property leased to third parties. Its hotel portfolio consists of 97 Marriott-branded hotels, 118 Hilton-branded hotels, five Hyatt-branded hotels, and one independent hotel. Its hotels operate under Marriott or Hilton brands. The hotels are operated and managed under separate management agreements with 16 hotel management companies, consisting of Hilton Garden Inn, Hampton, Courtyard, Residence Inn, Homewood Suites, SpringHill Suites, Fairfield, Home2 Suites, TownePlace Suites, AC Hotels, Hyatt Place, Aloft, and others. Its hotels are located in various states, including Alaska, Arizona, California, Colorado, Florida, Georgia, Idaho, Illinois, Kansas, Louisiana, Michigan, and others.', 'Richmond, VA, United States', 65);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGXX', 'STOCK', 'Digi Power X Inc.', 'NCM', 'Utilities', 'Utilities - Independent Power Producers', 'Digi Power X Inc. is a vertically integrated artificial intelligence (AI) and energy infrastructure company. The Company designs and deploys modular tier three data centers through its AI-Ready Modular Solution (ARMS) platform and offers enterprise-grade GPU compute through its NeoCloud portal, leveraging advanced NVIDIA GPU technology and secured energy infrastructure. Through its subsidiary, US Data Centers, Inc. (US Data Centers), it is focused on creating a platform dedicated entirely to delivering artificial intelligence (AI) and HPC solutions, ensuring purpose-built infrastructure for computing. Its segments include cryptocurrency mining, sales of energy and electricity and colocation services. With multiple sites, including its combined cycle and high-capacity substations, the Company enhances the energy grid, supporting both industrial clients and broader energy markets. It operates Bitcoin mining sites and focuses on procuring power from renewable energy sources.', 'Miami, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COSM', 'STOCK', 'Cosmos Health Inc.', 'NCM', 'Healthcare', 'Medical Distribution', 'Cosmos Health Inc. is a diversified, vertically integrated global healthcare company. The Company owns a portfolio of proprietary pharmaceutical and nutraceutical brands, including Sky Premium Life, Mediterranation, bio-bebe, C-Sept and C-Scrub. Through its subsidiary Cana Laboratories S.A., it manufactures pharmaceuticals, food supplements, cosmetics, biocides, and medical devices within the European Union. It also distributes a broad line of pharmaceuticals and parapharmaceuticals, including branded generics and over-the-counter (OTC) medications, to retail pharmacies and wholesale distributors through its subsidiaries in Greece and the United Kingdom. It also has research and development (R&D) partnerships targeting health disorders such as obesity, diabetes, and cancer, enhanced by artificial intelligence drug repurposing technologies, and focuses on the R&D of patented nutraceuticals, specialized root extracts, proprietary complex generics, and OTC products.', 'Chicago, IL, United States', 149);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWAN', 'STOCK', 'Clearwater Analytics Holdings, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Clearwater Analytics Holdings, Inc. is a provider of comprehensive cloud-native platforms for institutional investors across global public and private markets. The Companys single-instance, multi-tenant architecture delivers real-time data and artificial intelligence (AI)-driven insights throughout the investment lifecycle. The platform eliminates information silos by integrating portfolio management, trading, investment accounting, reconciliation, regulatory reporting, performance, compliance, and risk analytics in one unified system. The Company serves insurers, asset managers, hedge funds, banks, corporations, and governments. The Company is also a provider of enterprise risk analytics and developer infrastructure. Its capabilities in complex portfolio management across both public and private markets include structured products, private credit, and derivatives.', 'Boise, ID, United States', 1915);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKSY', 'STOCK', 'BlackSky Technology Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'BlackSky Technology Inc. is a space-based intelligence company. The Company delivers on-demand, high frequency imagery, monitoring and analytics of the strategic locations, economic assets, and events in the world. It designs, owns, and operates low earth orbit small satellite constellations. Its BlackSky Spectra platform processes data from its constellation and from other third-party sensors to develop the critical insights and analytics that its customers require. Its Spectra is a first-of-its-kind commercial platform that helps customers manage their monitoring activities from space. Spectra software platform processes millions of observations a day from both its proprietary satellite constellations and by using data from multiple external sources, including imaging, radar and radio frequency satellites, environmental sensors, asset tracking sensors, Internet of Thing connected devices, internet-enabled narrative sources, and a variety of geotemporal data feeds.', 'Herndon, VA, United States', 340);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CI', 'STOCK', 'The Cigna Group', 'NYQ', 'Healthcare', 'Healthcare Plans', 'O Cigna Group é uma empresa global de saúde. A empresa tem duas plataformas de crescimento: Evernorth Health Services e Cigna Healthcare. A Evernorth Health Services inclui seus segmentos de operação de Serviços de Benefício de Farmácia e Serviços de Especialidade e Cuidados, que fornecem soluções e capacidades de saúde independentes e coordenadas para permitir que o sistema de saúde funcione melhor e ajude as pessoas a viver vidas mais ricas e saudáveis. A Cigna Healthcare inclui os segmentos operacionais de saúde e saúde internacional dos EUA, que fornecem serviços abrangentes de plano médico e soluções coordenadas para clientes e clientes. Suas outras operações incluem seguro de vida de propriedade corporativa (coli), operações de run-off da empresa e outros negócios não estratégicos. A Specialty and Care Services fornece medicamentos especiais para o tratamento de doenças complexas e raras, distribuição de especialidades farmacêuticas e suprimentos médicos e programas clínicos para', 'Bloomfield, CT, United States', 71295);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PAYO', 'STOCK', 'Payoneer Global Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'Payoneer Global Inc. is a financial technology company that helps small and medium-sized businesses (SMBs) to transact, do business, and grow globally. The Company''s financial stack provides a suite of cross-border accounts receivable (AR) and accounts payable (AP) capabilities, including multicurrency account capabilities, and includes services such as working capital and funds management. Its customers include goods exporters selling cross-border to consumers and other businesses, services companies exporting their capabilities to international clients, independent professionals, creators, contractors, and business owners capitalizing on the digitization of the workplace and remote work, vacation rental hosts, and others. Its customers sell their goods or services either via a marketplace or directly to other businesses (B2B), and/or to customers via webstores. The Company serves SMBs located in more than 190 countries and territories and operating in a variety of industries.', 'New York, NY, United States', 2407);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCIR', 'STOCK', 'Cohen Circle Acquisition Corp. I', 'NGM', 'Financial Services', 'Shell Companies', 'Cohen Circle Acquisition Corp. I is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or other similar business combination, involving one or more businesses or assets. It intends to concentrate its efforts on identifying companies in the financial services technology (fintech) sector and fintech adjacent sectors that power transformation and innovation. The Company neither engaged in any operations nor generated any revenue.', 'Philadelphia, PA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATCH', 'STOCK', 'AtlasClear Holdings, Inc.', 'ASE', 'Technology', 'Software - Infrastructure', 'AtlasClear Holdings, Inc. is a technology-enabled financial services company. The Company offers a business-to-business platform for trading, clearing, settlement and banking of financial products with a focus on small and middle market financial services firms. It focuses on building a fully vertically integrated suite of cloud-based products, including account opening, trade execution, risk management, regulatory reporting, and settlement. It intends to offer clients the flexibility to choose from a variety of pre-built suites that serve a range of business models. It intends to target the client base for its banking and brokerage services, including financial services firms, including brokerage firms, hedge funds, pension plans, and family offices that are not adequately served by other correspondent clearing firms and banks. The Company is also engaged in providing full-service correspondent securities broker-dealer services through Wilson-Davis & Co., Inc. (Wilson-Davis).', 'Tampa, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTVA', 'STOCK', 'Corteva, Inc.', 'NYQ', 'Basic Materials', 'Agricultural Inputs', 'Corteva, Inc. É uma empresa global de agricultura pura. É um fornecedor global de soluções de proteção de sementes e culturas focadas na indústria agrícola e contribuindo para um fornecimento de alimentos mais saudável, seguro e sustentável. O segmento de sementes está empenhado no desenvolvimento e fornecimento de sementes comerciais combinando germoplasma avançado e traços que produzem um rendimento ideal para fazendas em todo o mundo. Atua em vários mercados chave de sementes, incluindo milho e soja norte-americanos, milho europeu e girassol, bem como milho Brasil, India, África do Sul e Argentina. O segmento de Proteção de Culturas atende à indústria global de insumos agrícolas com produtos que protegem contra ervas daninhas, insetos e outras pragas, e doenças, e que apoiam a saúde geral das culturas tanto acima quanto abaixo do solo, por meio de gerenciamento de nitrogênio e tecnologias aplicadas por sementes. Suas soluções de proteção de culturas e soluções digitais fornecem aos ', 'Indianapolis, IN, United States', 22000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARMK', 'STOCK', 'Aramark', 'NYQ', 'Industrials', 'Specialty Business Services', 'Aramark is a global provider of food and facilities services to education, healthcare, business and industry and sports, leisure, and corrections clients. The Company operates through two segments: Food and Support Services United States (FSS United States) and Food and Support Services International (FSS International). The FSS United States segment consists of five sectors, which include business and industry, education, healthcare, sports, leisure and corrections, and facilities and others. Its FSS International segment provides a similar range of services as those provided to its FSS United States segment clients and operates in each of the sectors. The Company provides food and beverage services, including catering and retail services, and facilities services, including plant operations and maintenance, custodial, housekeeping, landscaping and other services. The Company''s core market is the United States, which is supplemented by an additional 15-country footprint.', 'Philadelphia, PA, United States', 266680);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBIN', 'STOCK', 'Fortune Brands Innovations, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Fortune Brands Innovations, Inc. É uma empresa de produtos de construção residencial, de segurança e comercial. Seu segmento de inovações em água fabrica ou monta e vende torneiras, acessórios, pias de cozinha e descarte de resíduos, predominantemente sob as marcas Moen, ROHL, Riobel, Victoria Albert, Aqualisa e Shaws. A Outdoors Segment fabrica e vende sistemas de portas de entrada de fibra de vidro e aço, portas de tempestade, tela e segurança, decks compostos, trilhos e revestimentos sob a marca Fiberon, moinho de uretano sob a marca Fiberon, e sistemas de portas exteriores de abertura ampla e armários ao ar livre sob a marca Solar Innovations. O segmento de segurança inclui fechaduras, dispositivos de segurança e segurança, e produtos de segurança eletrônica sob as marcas Master Lock e Yale, e cofres resistentes ao fogo, recipientes de segurança sob a marca SentrySafe. A empresa, através da SpringWell Water Filtration Systems, fornece soluções residenciais de filtragem de água e am', 'Deerfield, IL, United States', 11000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADP', 'STOCK', 'Automatic Data Processing, Inc.', 'NMS', 'Technology', 'Software - Application', 'Automatic Data Processing, Inc. (ADP) é uma empresa global de tecnologia envolvida no fornecimento de soluções de gestão de capital humano (HCM) baseadas na nuvem que unem RH, folha de pagamento, talento, tempo, impostos e administração de benefícios. Seus segmentos incluem Serviços de Empregador e Organização Profissional de Empregadores (PEO). Seu segmento de Serviços de Empregador atende clientes que vão desde pequenas empresas de funcionários individuais a grandes empresas com dezenas de milhares de funcionários em todo o mundo, oferecendo uma gama de soluções HCM baseadas em tecnologia, incluindo suas plataformas baseadas em nuvem e soluções de terceirização de recursos humanos (HRO) (além de PEO). Suas ofertas incluem Payroll Services, Administração de Benefícios, Gestão de Talentos, Gestão de RH, Gestão de Força de Trabalho, serviços de Compliance, Serviços de Seguros e Serviços de Aposentadoria. Seu negócio PEO, chamado ADP TotalSource, fornece aos clientes soluções de terceiri', 'Roseland, NJ, United States', 67000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETN', 'STOCK', 'Eaton Corporation plc', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Eaton Corporation plc é uma empresa inteligente de gestão de energia. Seu segmento de Electrical Americas consiste em componentes elétricos, componentes industriais, distribuição e montagem de energia, produtos residenciais, qualidade e conetividade de energia monofásica, dispositivos de fiação e outros. O segmento Electrical Global consiste em componentes elétricos, componentes industriais, distribuição e montagem de energia, qualidade de energia monofásica e trifásica e serviços. O segmento Aeroespacial é um fornecedor global de combustível aeroespacial, hidráulica e sistemas pneumáticos para uso comercial e militar e sistemas de filtração para aplicações industriais. O segmento de veículos projeta, fabrica, comercializa e fornece sistemas de transmissão e componentes críticos. O segmento eMobility projeta, fabrica, comercializa e fornece equipamentos mecânicos, elétricos, e componentes eletrônicos e sistemas. A empresa também está envolvida no fornecimento de monitoramento térmico p', 'Dublin, , Ireland', 94443);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAPD', 'STOCK', 'Direxion Daily AAPL Bear 1X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of the fund’s net assets (plus borrowings for investment purposes) in financial instruments, including swap agreements and options, that, in combination, provide 1X daily inverse (opposite) or short exposure to AAPL, consistent with the fund’s investment objective. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CG', 'STOCK', 'The Carlyle Group Inc.', 'NMS', 'Financial Services', 'Asset Management', 'The Carlyle Group Inc. is a global investment company. The Company operates through three segments: Global Private Equity, Global Credit, and Global Investment Solutions. Global Private Equity segment advises the Companys buyout, middle market and growth capital funds, its U.S. and internationally focused real estate funds, and its infrastructure and natural resources funds. This segment also includes the NGP Carry Funds advised by NGP. Global Credit segment advises funds and vehicles that pursue investment strategies, including segment advises funds and vehicles that pursue investment strategies, including insurance solutions, liquid credit, opportunistic credit, direct lending, asset-backed finance, aviation finance, infrastructure credit, cross-platform credit products, and global capital markets. The Global Investment Solutions segment advises on global private equity programs and related co-investment and secondary activities. It also focuses on private student loan portfolios.', 'Washington, DC, United States', 2300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CURB', 'STOCK', 'Curbline Properties Corp.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Curbline Properties Corp. is an owner and manager of convenience shopping centers positioned on the curbline of intersections and vehicular corridors in suburban, high household income communities. The Company''s properties are located in the United States and are geographically diversified, principally across the Southeast, Mid-Atlantic, Southwest and Mountain regions, along with Texas. It is focused on leasing space to a diversified group of primarily national, high credit quality tenants operating across a range of primarily service and restaurant businesses, including quick-service restaurants, healthcare and wellness, financial services, beverage retail, telecommunications, beauty and hair salons, and fitness, among others. Its properties include Promenade Plaza, Hampton Cove Corner, Eastchase Point, Shops at Tiger Town, Chandler Center, Shops at Gilbert Crossroads, Red Mountain Corner, Crossroads Marketplace, Shops on Montview, Estero Crossing, and Shops at Carillon.', 'New York, NY, United States', 37);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AON', 'STOCK', 'Aon plc', 'NYQ', 'Financial Services', 'Insurance Brokers', 'Aon PLC é uma empresa global de serviços profissionais. A Empresa presta assessoria e soluções a clientes focados em risco, saúde e riqueza através de quatro principais produtos e serviços: Soluções de risco comercial, soluções de resseguro, soluções de saúde e soluções de riqueza. A Commercial Risk Solutions inclui corretagem de varejo, soluções especializadas, consultoria de risco global e gestão de cativos e programas de afinidade. As soluções de resseguro incluem resseguro tratado, resseguro facultativo e mercados de capitais. A Health Solutions inclui consultoria e corretagem, benefícios voluntários e soluções de inscrição e soluções de capital humano. A Wealth Solutions inclui consultoria de aposentadoria, administração de pensões e consultoria de investimentos. Os serviços de análise e dados incluem Affinity, Aon Inpoint, CoverWallet e revisão. A consultoria de aposentadoria é especializada em fornecer aos clientes consultoria de design estratégico em seus programas de aposentad', 'Dublin, , Ireland', 60000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RCKT', 'STOCK', 'Rocket Pharmaceuticals, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Rocket Pharmaceuticals, Inc. is a fully integrated, late-stage biotechnology company focused on the development of gene therapies for rare and devastating diseases. The Company has two clinical stage and one pre-clinical stage in vivo adeno-associated viral (AAV) programs in the United States, which include programs for Danon disease (DD), a multi-organ lysosomal-associated disorder leading to early death due to heart failure; Plakophilin-2 Arrhythmogenic Cardiomyopathy (PKP2-ACM), an inheritable cardiac disorder that is characterized by a progressive loss of cardiac muscle mass, severe right ventricular dilation, dysplasia, fibrofatty replacement of the myocardium and a high propensity to arrhythmias and sudden death (RP-A601), and BAG3 Dilated Cardiomyopathy (BAG3-DCM), which is the most common form of cardiomyopathy and is characterized by progressive thinning of the walls of the heart resulting in enlarged heart chambers that are unable to pump blood.', 'Cranbury, NJ, United States', 299);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEP', 'STOCK', 'American Electric Power Company, Inc.', 'NMS', 'Utilities', 'Utilities - Regulated Electric', 'American Electric Power Company, Inc. É uma empresa de holding de serviços públicos elétricos. Suas empresas operacionais de energia elétrica fornecem serviços de geração, transmissão e distribuição para mais de cinco milhões de clientes de varejo em Arkansas, Indiana, Kentucky, Louisiana, Michigan, EUA. Ohio, Oklahoma, Tennessee, Texas, Virgínia e Virgínia Ocidental. Seus segmentos incluem Utilidades verticalmente integradas, Utilitários de Transmissão e Distribuição, Transmissão AEP Holdco e Geração & Marketing. A Vertical Integrated Utilities está envolvida na geração, transmissão e distribuição de eletricidade para venda a clientes de varejo e atacado. Os Serviços de Transmissão e Distribuição consistem na transmissão e distribuição de eletricidade para venda a clientes de varejo e atacado. A AEP Transmission Holdco está envolvida no desenvolvimento, construção e operação de instalações de transmissão. O segmento de Geração e Marketing realiza atividades de Marketing, Gestão de Ris', 'Columbus, OH, United States', 16330);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGNX', 'STOCK', 'Cognex Corporation', 'NMS', 'Technology', 'Scientific & Technical Instruments', 'A Cognex Corporation inventa e comercializa tecnologias que abordam vários desafios críticos de fabricação e distribuição. A empresa é uma fornecedora global de produtos e soluções de visão de máquina que melhoram a eficiência e a qualidade em empresas em todos os mercados finais industriais. Opera através do segmento de tecnologia de visão de máquina. Suas soluções combinam produtos físicos e software para capturar e analisar informações visuais, permitindo a automação de tarefas de fabricação e distribuição para clientes em todo o mundo. Os produtos de visão por máquina são usados para automatizar a fabricação ou distribuição e rastreamento de itens discretos, como telefones celulares, baterias de veículos elétricos e pacotes de comércio eletrônico, localizando, identificando, inspecionando e medindo-os. A visão por máquina é importante para aplicações em que a visão humana é inadequada para atender aos requisitos de tamanho, precisão ou velocidade, ou em casos em que economias subst', 'Natick, MA, United States', 2914);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWH', 'STOCK', 'Camping World Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Camping World Holdings, Inc. is a retailer of recreational vehicles (RVs) and related products and services. The Company operates through two segments: Good Sam Services and Plans and RV and Outdoor Retail. Its Good Sam Services and Plans segment consists of programs, plans and services that are geared towards protecting, insuring and promoting the RV & travel lifestyles, and includes services such as extended vehicle service contracts, vehicle roadside assistance, property and casualty insurance, travel protection, travel planning and directories, and publications. Its RV and Outdoor Retail segment consists of all aspects of its RV dealership operations, which includes selling new and used RVs, assisting with the financing of new and used RVs, selling protection and insurance-related services and plans for RVs, servicing and repairing new and used RVs, installing RV parts and accessories, and selling RV and outdoor related products, parts and accessories.', 'Lincolnshire, IL, United States', 12701);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GL', 'STOCK', 'Globe Life Inc.', 'NYQ', 'Financial Services', 'Insurance - Life', 'A Globe Life Inc. É uma companhia seguradora de seguros. Suas principais subsidiárias são a Globe Life and Accident Insurance Company, a American Insurance Company, a Liberty National Life Insurance Company, a Family Heritage Life Insurance Company of America e a United American Insurance Company. Os segmentos da Companhia incluem seguro de vida, seguro de saúde suplementar e investimentos. Os produtos de seguro de vida incluem seguro de vida inteira e de vida a termo tradicional. A empresa oferece suplemento Medicare e produtos de seguro de saúde suplementar de benefício limitado que incluem acidente, câncer, doença crítica, coração, cuidados intensivos, e outros produtos de saúde. Estes produtos são projetados para complementar a cobertura de saúde que os candidatos já possuem. Os suplementos Medicare são oferecidos a inscritos no tradicional programa Medicare de taxa por serviço. Os planos de Suplemento Medicare são padronizados por regulamentação federal e são projetados para pagar', 'McKinney, TX, United States', 3732);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTSG', 'STOCK', 'BrightSpring Health Services, Inc.', 'NMS', 'Healthcare', 'Health Information Services', 'BrightSpring Health Services, Inc. provides home and community-based pharmacy and health solutions for populations in need of specialized and/or chronic care. Through the Companys service lines, including pharmacy, home health care and primary care, and rehabilitation and behavioral health, it provides integrated care and clinical solutions in all 50 states to over 450,000 customers, clients and patients daily. With a focus on senior and specialty patients, the Companys platform provides pharmacy and provider services (both clinical and supportive care in nature) in lower-cost home and community settings largely to medicare, medicaid, and commercially insured populations. It delivers services through two reportable segments: Pharmacy Solutions and Provider Services. It provides pharmacy services when and where demanded and as required by customers and patients in their homes and communities, often in coordination with its providers services.', 'Louisville, KY, United States', 37000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLNE', 'STOCK', 'Beeline Holdings, Inc.', 'NCM', 'Consumer Defensive', 'Beverages - Wineries & Distilleries', 'Beeline Holdings, Inc. is a mortgage fintech transforming the way people access property financing. Through its fully digital, artificial intelligence-powered platform, it delivers a path to home loans-whether for primary residences or investment properties. The Company focuses on prop tech, mortgage, and alternative equity products. The Companys segments include Beeline Financial and Corporate. The Beeline Financial segment is a full-service direct-to-consumer lender specializing in conventional conforming and non-conforming residential first-lien mortgages and providing title services. Beeline Financial also has an emerging business in anonymized data sales and technology licensing.', 'Providence, RI, United States', 91);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADI', 'STOCK', 'Analog Devices, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Analog Devices, Inc. É uma empresa global de semicondutores. A empresa projeta, fabrica, testa e comercializa um portfólio de soluções, incluindo circuitos integrados (ICs), software e subsistemas que utilizam tecnologias de processamento de sinais analógicos, mistos e digitais de alto desempenho. Seu portfólio abrangente de produtos, especialização de domínio e capacidades de fabricação se estendem por tecnologias de processamento e gerenciamento de energia, precisão de alto desempenho e sinal misto de alta velocidade, incluindo conversores de dados, amplificadores, gerenciamento de energia, ICs de radiofrequência (RF), processadores de borda e outros sensores. O portfólio de produtos IC da empresa inclui tanto produtos de uso geral usados por uma variedade de clientes e aplicações, bem como produtos específicos para aplicativos projetados para mercados-alvo específicos. Seus ICs analógicos monitoram, condicionam, amplificam ou transformam sinais analógicos contínuos associados a prop', 'Wilmington, MA, United States', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VTYX', 'STOCK', 'Ventyx Biosciences, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Ventyx Biosciences, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing oral therapies for patients with autoimmune, inflammatory, and neurodegenerative diseases. Its lead portfolio of NOD-like receptor protein 3 (NLRP3) inhibitors includes VTX2735, a peripherally restricted NLRP3 inhibitor in Phase II development for recurrent pericarditis, and VTX3232, a CNS-penetrant NLRP3 inhibitor in Phase II development for neurodegenerative and cardiometabolic diseases. Its inflammatory bowel disease portfolio includes tamuzimod (VTX002), an S1P1R modulator, and VTX958, a TYK2 inhibitor, both of which have completed Phase II clinical trials. Tamuzimod is a sphingosine 1 phosphate receptor (S1P1R) modulator in development for patients with moderately to severely active ulcerative colitis (UC). VTX958 is a selective allosteric tyrosine kinase type 2 (TYK2) inhibitor in Phase II development for the treatment of moderately to severely active Crohns disease.', 'San Diego, CA, United States', 81);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRI', 'STOCK', 'Carter''s, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Carter''s, Inc. É um comerciante de vestuário infantil na América do Norte. Seus segmentos incluem varejo dos EUA, atacado dos EUA e internacional. O segmento de varejo dos EUA inclui vendas de produtos nos Estados Unidos através de suas lojas de varejo e sites de comércio eletrônico. O segmento de atacado dos EUA consiste em vendas nos Estados Unidos de produtos para seus parceiros grossistas. O segmento internacional inclui vendas de produtos fora dos Estados Unidos, através de suas lojas de varejo e sites de comércio eletrônico no Canadá e México, e vendas para seus clientes e licenciados internacionais por atacado. Possui as marcas Carter''s e Oshkosh B''gosh. Essas marcas são vendidas em lojas de departamento, redes nacionais e varejistas especializados no mercado interno e internacional. Eles também são vendidos através de quase 1 000 lojas operadas pela empresa nos Estados Unidos, Canadá e México e on-line em www.carters.com, www.oshkosh.com, www.cartersoshkosh.ca e www.carters.', 'Atlanta, GA, United States', 15350);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFL', 'STOCK', 'Aflac Incorporated', 'NYQ', 'Financial Services', 'Insurance - Life', 'A Aflac Incorporated fornece proteção financeira aos tomadores de seguros e clientes através de suas subsidiárias nos Estados Unidos e no Japão. O principal negócio da empresa são produtos complementares de seguro de saúde e vida. Os segmentos da empresa incluem a Aflac Japan, que inclui a Aflac Life Insurance Japan (ALIJ), e a Aflac U.S., que inclui a American Family Life Assurance Company of Columbus (Aflac), a American Family Life Assurance Company of New York (Aflac New York), a Continental American Insurance Company (CAIC), a Tier One Insurance Company (TOIC) e a Aflac Benefits Solutions, Inc. (ABS). O segmento Aflac Japan é a seguradora no Japão em termos de políticas de câncer e de saúde (produtos de seguros do terceiro setor) em vigor. A empresa projeta seus produtos de seguro dos Estados Unidos para fornecer cobertura suplementar para pessoas que já têm cobertura médica ou primária de seguro, já que as apólices de seguro Aflac dos EUA pagam benefícios independentemente de outr', 'Columbus, GA, United States', 12694);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDU', 'STOCK', 'New Oriental Education & Technology Group Inc.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'A New Oriental Education & Technology Group Inc é uma holding que atua principalmente no fornecimento de uma variedade de programas educacionais, serviços e produtos. A empresa opera principalmente quatro segmentos. O segmento de Serviços Educativos e Cursos de Preparação de Testes está envolvido principalmente na prestação de serviços educacionais e cursos de preparação de testes e serviços de educação on-line. Os produtos Private Label e o segmento de e-commerce de live streaming estão envolvidos principalmente na venda de produtos de private label e negócios de e-commerce de live streaming através da East Buy. O segmento de Serviços de Consultoria de Estudo no Exterior ajuda principalmente os alunos através do processo de inscrição e admissão para instituições de ensino no exterior, fornece aconselhamento de faculdade, pós-graduação e carreira, e aconselha e auxilia os alunos no processo de imigração para estudos no exterior, como a obtenção de vistos e organização de habitação. Out', 'Beijing, , China', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZTR', 'STOCK', 'Azitra, Inc.', 'ASE', 'Healthcare', 'Biotechnology', 'Azitra, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing advanced therapies for precision dermatology using engineered proteins and topical live biotherapeutic products. It has built a proprietary platform that includes a microbial library comprised of approximately 1,500 unique bacterial strains that can be screened for therapeutic characteristics. The platform is augmented by artificial intelligence and machine learning technology that analyzes, predicts and helps screen its library of strains for drug-like molecules. Its lead product, ATR-12, is a genetically modified strain of S. epidermidis for treating the orphan disease, Netherton syndrome, a chronic and fatal disease of the skin. Its advanced product, ATR-04, is a genetically modified strain of S. epidermidis for treating papulopustular rash. Its product ATR-01 is a human filaggrin protein for treating ichthyosis vulgaris, a chronic, xerotic (abnormally dry), and scaly skin disease.', 'Branford, CT, United States', 12);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARVN', 'STOCK', 'Arvinas, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Arvinas, Inc. is a clinical-stage biotechnology company. The Company, through its PROteolysis Targeting Chimera (PROTAC) protein degrader platform, is pioneering the development of protein degradation therapies designed to harness the bodys natural protein disposal system to selectively and efficiently degrade and remove disease-causing proteins. It is progressing multiple investigational drugs through clinical development programs, including vepdegestrant, ARV-393 and ARV-102. Vepdegestrant is an investigational orally bioavailable PROTAC protein degrader designed to target and degrade the ER for the treatment of patients with locally advanced or metastatic ER+/HER2- breast cancer. It is co-developing vepdegestrant with Pfizer. ARV-393 is an investigational, orally bioavailable PROTAC designed to degrade BCL6, a transcriptional repressor and a key regulator of normal B-cell maturation and differentiation processes. ARV-102 is in development to treat neurodegenerative diseases.', 'New Haven, CT, United States', 430);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMS', 'STOCK', 'CMS Energy Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'A CMS Energy Corporation é uma empresa de energia que opera principalmente em Michigan. Gere os seus negócios pela natureza dos serviços que cada um presta e opera principalmente em três segmentos de negócio: Electric Utility, Gás Utility e Northstar Clean Energy. O segmento de Utilidade Elétrica consiste em atividades regulamentadas associadas à geração, compra, distribuição e venda de eletricidade em Michigan. O segmento de Gás Utility consiste em atividades regulamentadas associadas à compra, transmissão, armazenamento, distribuição e venda de gás natural em Michigan. O segmento de Energia Limpa Northstar consiste em várias subsidiárias que se envolvem na produção de energia independente nacional, incluindo o desenvolvimento e operação de geração renovável, e a comercialização de produção de energia independente. Seu sistema de transmissão, armazenamento e distribuição de gás consiste em 2 342 quilômetros de linhas de transmissão com 15 campos de armazenamento de gás com uma capacid', 'Jackson, MI, United States', 8324);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COLD', 'STOCK', 'Americold Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'Americold Realty Trust, Inc. É um fundo de investimento imobiliário (REIT). A Companhia está focada na propriedade, operação, aquisição e desenvolvimento de armazéns com temperatura controlada. A empresa é organizada como um REIT auto-administrado e autogestionado. A Companhia atua por meio de três segmentos: Armazém, Gerido por Terceiros e Transporte. Opera uma rede global de aproximadamente 245 armazéns controlados por temperatura, abrangendo aproximadamente 1,5 bilhões de pés cúbicos, com 197 armazéns na América do Norte, 27 na Europa, 19 armazéns na Ásia-Pacífico e dois armazéns na América do Sul. A Companhia detém participações minoritárias em duas joint ventures, uma com a SuperFrio, que possui ou opera 35 armazéns controlados por temperatura no Brasil, e outra com a RSA JV, que possui dois armazéns controlados por temperatura em Dubai. Seus serviços de manuseio otimizam o movimento de produtos de seus clientes através da cadeia de frio, incluindo colocação e outros serviços de m', 'Atlanta, GA, United States', 13755);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYND', 'STOCK', 'Beyond Meat, Inc.', 'NMS', 'Consumer Defensive', 'Packaged Foods', 'Beyond Meat, Inc. É uma empresa de carne baseada em plantas que oferece um portfólio de carnes à base de plantas. A empresa desenvolveu três plataformas de produtos centrais à base de plantas que se alinham às maiores categorias de carne do mundo: Carne bovina, suína e aves. Os principais componentes da carne de origem animal são aminoácidos, lipídios, carboidratos, oligominerais e água, que não são exclusivos dos animais e são abundantes em plantas. Seu principal produto é o Beyond Burger, que é projetado para olhar, cozinhar e saborear como um hambúrguer de carne tradicional. A empresa também vende uma gama de outros produtos à base de carne à base de plantas, incluindo além de salsichas, além de carne bovina, além de Meatballs, além de carne crumbles, além de Frango Tenders, além de Steak, além de Frango Popcorn, além de Frango Nuggets, e outros. Seus produtos estão disponíveis em aproximadamente 133 000 lojas de varejo e serviços de alimentos em 65 países, através de supermercados ', 'El Segundo, CA, United States', 754);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEHR', 'STOCK', 'Aehr Test Systems, Inc.', 'NCM', 'Technology', 'Semiconductor Equipment & Materials', 'Aehr Test Systems, Inc. offers test solutions for testing, burning-in, and stabilizing semiconductor devices in wafer level, singulated die, and package part form. Its products include the FOX-P family of test and burn-in systems and FOX WaferPak Aligner, FOX WaferPak Contactor, FOX DiePak Carrier and FOX DiePak Loader. The FOX-XP and FOX-NP systems are full wafer contact and singulated die/module test and burn-in systems that can test, burn-in and stabilize a range of devices such as silicon carbide-based and other power semiconductors, 2D and 3D sensors used in phones, tablets and other computing devices. FOX-CP system is a single-wafer compact test solution for logic, memory and photonic devices. FOX WaferPak Contactor contains a full wafer contactor capable of testing wafers up to 300 millimeters that enables integrated circuit manufacturers to perform testing, burn-in and stabilization of full wafers on the FOX-P systems. It offers packaged part reliability/burn-in test solutions.', 'Fremont, CA, United States', 136);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DV', 'STOCK', 'DoubleVerify Holdings, Inc.', 'NYQ', 'Technology', 'Software - Application', 'DoubleVerify Holdings, Inc. offers a software platform for digital media measurement and analytics. The Company provides a range of solutions, such as DV Authentic Ad, DV Authentic Attention, Custom Contextual, Scibids AI, and Supply-Side Solutions. The DV Authentic Ad evaluates the existence of fraud, brand safety, viewability and geography for each digital ad. The Authentic Attention analyzes key user-initiated events that occur while the ad creative is exposed, including user touches, screen orientation, video playback, and audio control interactions. The Custom Contextual allows advertisers to match their ads to relevant content in order to maximize user engagement and drive campaign performance. The Supply-side advertising platform utilizes its data analytics to validate the quality of their ad inventory and provide metrics for their customers to facilitate the targeting and purchasing of digital ads.', 'New York, NY, United States', 1197);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('KNSA', 'STOCK', 'Kiniksa Pharmaceuticals International, plc', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Kiniksa Pharmaceuticals International, plc is a biopharmaceutical company focused on discovering, acquiring, developing and commercializing novel therapies for diseases with unmet need, with a focus on cardiovascular indications. Its portfolio of assets is based on strong biologic rationale or validated mechanisms and offers the potential for differentiation. Its ARCALYST is used for the treatment of recurrent pericarditis and reduces the risk of recurrence in adults and children 12 years and older. ARCALYST is also approved for the treatment of Cryopyrin-Associated Periodic Syndromes (CAPS), including Familial Cold Autoinflammatory Syndrome (FCAS) and Muckle-Wells Syndrome, and the maintenance of remission in Deficiency of Interleukin-1 Receptor Antagonist. Its other portfolio includes KPL-387, KPL-1161, Abiprubart, and Mavrilimumab. Mavrilimumab is an investigational monoclonal antibody inhibitor targeting granulocyte-macrophage colony stimulating factor receptor alpha.', 'London, , United Kingdom', 315);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRGX', 'STOCK', 'CARGO Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'CARGO Therapeutics, Inc. is a biotechnology company focused on the development of best-in-class and potentially curative cell therapies for cancer patients. It has a focused pipeline that includes its CRG-023 product candidate, a CD19/CD20/CD22 tri-specific CAR T developed using a tri-cistronic construct and designed to address several known causes of relapse, resulting in a potential best-in-class CAR T-cell therapy across a range of B-cell malignancies with the goal of providing more patients with a durable complete response. Its latest program advancement, an allogeneic platform, is a universal vector solution designed to limit immune-based rejection and enable durable response of CAR T-cell therapy. The universal allogeneic-enabling vector is intended to be paired with any CAR vector to create an allogeneic CAR T-cell therapy, with the potential to maintain the efficacy, durability, and safety of autologous cell therapy while broadening availability to more people with cancer.', 'San Carlos, CA, United States', 167);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCEP', 'STOCK', 'Coca-Cola Europacific Partners PLC', 'NMS', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'Coca-Cola Europacific Partners plc is a United Kingdom-based consumer goods company. The Company is engaged in making, selling and distributing an extensive range of primarily non-alcoholic ready-to-drink (RTD) beverages. The Company''s product categories include Coca-Cola trademark; flavors and mixers; waters, sports, RTD tea and coffee, and other including energy. Its brands include Coca-Cola Original Taste, Coca-Cola Zero Sugar, Diet Coke, Sprite, Fanta, Monster Energy, Costa Coffee and Fuze Tea. The Company''s operations include Europe and Australia, Pacific and Southeast Asia (APS). Its Europe operations include FBN (France, Monaco, Belgium, Luxembourg, the Netherlands, Norway, Sweden and Iceland), Germany, Great Britain, and Iberia (Spain, Portugal and Andorra). The Company''s APS operations include Australia/Pacific (Australia, New Zealand, the Pacific Islands and Papua New Guinea), and Southeast Asia (Indonesia and the Philippines). It operates in approximately 31 markets.', 'Uxbridge, , United Kingdom', 41000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBRT', 'STOCK', 'Franklin BSP Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Franklin BSP Realty Trust, Inc. is a real estate finance company. The Company primarily originates, acquires, and manages a diversified portfolio of commercial real estate debt investments secured by properties located within and outside the United States. Its investment objective is to provide its common shareholders attractive, risk-adjusted returns through a stable dividend and capital growth. It operates through four segments: the real estate debt business, the real estate securities business, the commercial real estate conduit business and the real estate-owned business. The Company invests in commercial real estate debt investments, which include first mortgage loans, subordinated mortgage loans, mezzanine loans and participations in such loans. It also originates conduit loans that intend to sell through its taxable REIT subsidiary (TRS) into commercial mortgage-backed securities securitization transactions. The investment advisor of the Company is Benefit Street Partners L.L.C.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRBG', 'STOCK', 'Corebridge Financial, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Corebridge Financial, Inc. is a provider of retirement solutions and insurance products in the United States. The Company partners with financial professionals and institutions to help individuals plan, save for and achieve secure financial futures. Its Individual Retirement segment consists of fixed annuities, fixed index annuities, registered index-linked annuities and variable annuities. Its Group Retirement segment consists of recordkeeping, plan administrative and compliance services, financial planning and advisory solutions offered in-plan, along with proprietary and limited non-proprietary annuities, advisory and brokerage products offered out-of-plan. Its Life Insurance segment consists of term and universal life insurance products in the United States. Its Institutional Markets segment consists of stable value wrap (SVW) products, structured settlement and pension risk transfer (PRT) annuities, guaranteed investment contracts (GICs) and corporate markets products.', 'Houston, TX, United States', 5200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACHC', 'STOCK', 'Acadia Healthcare Company, Inc.', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Acadia Healthcare Company, Inc. is a provider of behavioral healthcare services across the United States. It provides behavioral healthcare services to its patients in a variety of settings, including inpatient psychiatric hospitals, specialty treatment facilities, residential treatment centers and outpatient clinics. Its acute inpatient psychiatric facilities provide a high level of care in order to stabilize patients that are either a threat to themselves or to others. Its specialty treatment facilities include residential recovery facilities and eating disorder facilities. Its comprehensive treatment centers specialize in providing medication-assisted treatment in an outpatient setting. Its residential treatment centers treat patients with behavioral disorders in a non-hospital setting. The facilities balance therapy activities with social, academic and other activities. It operates a network of 262 behavioral healthcare facilities with over 11,850 beds in 39 states and Puerto Rico.', 'Franklin, TN, United States', 19192);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVTL', 'STOCK', 'Vertical Aerospace Ltd.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'Vertical Aerospace Ltd. is a United Kingdom-based global aerospace and manufacturing company, which is engaged in the electric aviation. The Company is focused on designing, manufacturing, and selling a zero-operating emission eVTOL aircraft for use in the advanced air mobility (AAM) market. It is developing, and is progressing towards the certification of, its flagship eVTOL, the VX4, which has undergone the first stages of its flight test campaign. It is targeting the VX4 to be capable of transporting a pilot and up to four passengers, traveling distances of up to 100 miles, and achieving cruise speeds of approximately 150 miles per hour. It aims to sell globally certified eVTOL aircraft to a variety of customers, including commercial airlines, aircraft leasing companies, business aviation, existing helicopter operators as well as new operators in the AAM market, providing both original equipment manufacturers (OEM) sales and aftermarket services to its customers.', 'Bristol, , United Kingdom', 350);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPRI', 'STOCK', 'Capri Holdings Limited', 'NYQ', 'Consumer Cyclical', 'Luxury Goods', 'A Capri Holdings Limited é uma holding, que possui marcas que são designers, comerciantes, distribuidores e varejistas de acessórios femininos e masculinos, calçados e prontos para usar com os nomes de marca Versace, Jimmy Choo e Michael Kors e marcas e logotipos relacionados. A empresa atua em três segmentos: Versace, Jimmy Choo e Michael Kors. O segmento Versace inclui a venda de luxo pronto-a-vestir, acessórios e calçados da Versace através de boutiques da Versace diretamente operadas em todas as Américas, certas partes da Europa, Oriente Médio e África (EMEA) e certas partes da Ásia, bem como através de lojas de outlets e sites de comércio eletrônico da Versace. O segmento Jimmy Choo inclui calçados de luxo Jimmy Choo, bolsas e pequenos artigos de couro e acessórios. O segmento Michael Kors inclui a venda de produtos Michael Kors através de quatro formatos de loja de varejo Michael Kors: Lojas de coleção, lojas de estilo de vida (incluindo concessões), lojas outlet e sites de e-com', 'London, , United Kingdom', 9700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APTV', 'STOCK', 'Aptiv PLC', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'A Aptiv PLC é uma empresa global de tecnologia que desenvolve soluções conetadas que permitem um futuro mais sustentável de mobilidade. A empresa oferece soluções de mobilidade de ponta a ponta, permitindo a transição de seus clientes para veículos mais eletrificados e definidos por software. Os segmentos da Empresa incluem Soluções de Sinal e Energia e Segurança Avançada e Experiência do Usuário. O segmento de Soluções de Sinal e Energia inclui arquitetura elétrica completa e produtos componentes. O segmento de Segurança Avançada e Experiência do Usuário inclui tecnologia e serviços de veículos em segurança avançada, experiência do usuário e computação e software de veículos inteligentes, além de plataformas de software nativas da nuvem, tecnologias de condução autônoma e ferramentas de DevOps. Projeta e fabrica componentes de veículos e fornece soluções de tecnologia de segurança elétrica, eletrônica e ativa para os mercados globais de veículos automotivos e comerciais. Opera instala', 'Schaffhausen, , Switzerland', 141000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLX', 'STOCK', 'The Clorox Company', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'A empresa Clorox é uma fabricante multinacional e comerciante de produtos de consumo e profissionais. A empresa atua através de quatro segmentos: Saúde e Bem-Estar, Domicílio, Estilo de Vida e Internacional. O seu segmento de Saúde e Bem-Estar consiste em produtos de limpeza, desinfeção e profissionais comercializados e vendidos sob os setores Clorox, Clorox2, Pine-Sol, Scentiva, Tilex, marcas Liquid-Plumr e Fórmula 409 nos Estados Unidos. Seu segmento doméstico consiste em sacos e envoltórios, lixo para gatos e produtos para grelhar comercializados e vendidos sob as marcas Glad, Fresh Step e Scoop Away, e Kingsford nos Estados Unidos. O segmento de estilo de vida consiste em alimentos, filtração de água e produtos de cuidados pessoais naturais comercializados e vendidos sob as marcas Hidden Valley, Brita e Burt''s Bees. Internacional consiste em produtos vendidos fora dos Estados Unidos. Seus produtos dentro deste segmento incluem aditivos de lavanderia, produtos de cuidados domicilia', 'Oakland, CA, United States', 7600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FUN', 'STOCK', 'Six Flags Entertainment Corporation', 'NYQ', 'Consumer Cyclical', 'Leisure', 'A Six Flags Entertainment Corporation é uma operadora regional de resort de diversões com aproximadamente 27 parques de diversões, 15 parques aquáticos e nove propriedades de resort em 17 estados Unidos, Canadá e México. A empresa oferece experiências memoráveis a milhões de hóspedes todos os anos com montanhas-russas, passeios temáticos, parques aquáticos emocionantes, resorts e um portfólio de propriedade intelectual, como Looney Tunes, DC Comics e PEANUTS. Os parques da empresa incluem Hurricane Harbor Phoenix, California''s Great America, Knott''s Berry Farm, Knott''s Soak City Waterpark, Six Flags Magic Mountain, Six Flags Discovery Kingdom, Six Flags Over Georgia, Six Flags White Water, Cedar Point Shores Waterpark, Six Flags Great America, Six Flags Fiesta Texas, Hurricane Splashtown, Dorney Park & Wildwater Kingdom e outros.', 'Charlotte, NC, United States', 5000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIVN', 'STOCK', 'Five9, Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'A Five9, Inc. Ajuda as organizações a criar experiências de cliente hiper-personalizadas e baseadas em inteligência artificial (IA). A Plataforma CX Inteligente da Empresa, alimentada pela Five9 Genius AI, oferece um conjunto de aplicativos que permitem uma variedade de funções de atendimento ao cliente, vendas e marketing. Ele oferece uma solução de software de nuvem de ponta a ponta para contact centers. A solução da Empresa permite a gestão e otimização simultânea das interações dos clientes através de voz, chat, email, Web, redes sociais e canais móveis, diretamente ou através das suas interfaces de programação de aplicações. As categorias de produtos da empresa incluem Core Cloud, IA & Automation, Employee Engagement e Customer Engagement. Seus produtos Core Cloud incluem Global Voice, Agent Desktop Plus, Supervisor Plus, integrações de CRM e integrações de UC. Seus produtos de IA e automação incluem Inteligência Artificial, agentes de IA, insights de IA, conhecimento de IA, GenAI', 'San Ramon, CA, United States', 3073);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXP', 'STOCK', 'American Express Company', 'NYQ', 'Financial Services', 'Credit Services', 'A American Express Company é uma empresa de pagamentos globalmente integrada com empresas de emissão de cartões, aquisição de comerciantes e rede de cartões. Oferece produtos e serviços para uma variedade de clientes, incluindo consumidores, pequenas empresas, empresas de médio porte e grandes corporações em todo o mundo. Seus segmentos incluem Serviços ao Consumidor dos EUA (USCS), Serviços Comerciais (CS), Serviços de Cartões Internacionais (ICS) e Serviços Globais de Comercialização e Rede (GMNS). A USCS oferece serviços de viagens e estilo de vida, bem como produtos bancários e de financiamento sem cartão. A CS oferece serviços de gestão de pagamentos e despesas, produtos bancários e de financiamento sem cartão. A ICS presta serviços a clientes internacionais, incluindo serviços de viagens e estilo de vida, e gerencia certas joint ventures internacionais e seu negócio de coalizão de fidelidade. A GMNS opera uma rede de pagamentos que processa e estabelece transações de cartão, adqu', 'New York, NY, United States', 75100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGS', 'STOCK', 'B&G Foods, Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'B&G Foods, Inc. manufactures, sells and distributes branded shelf-stable and frozen foods across the United States, Canada, and Puerto Rico. Its products include frozen and canned vegetables, vegetable, canola and other cooking oils, vegetable shortening, cooking sprays, oatmeal and other hot cereals, fruit spreads, canned meats and beans, bagel chips, spices, seasonings, hot sauces, wine vinegar, maple syrup, molasses, and other specialty products. It operates in four segments: Specialty, Meals, Frozen & Vegetables, and Spices & Flavor Solutions. Its products are marketed under various brands, including Crisco, Clabber Girl, Bear Creek, Polaner, Underwood, B&G, Grandma''s, New York Style, B&M, Baker''s Joy, Regina, TrueNorth, Static Guard, SugarTwin, Brer Rabbit, Ortega, Maple Grove Farms, Cream of Wheat, Las Palmas, Victoria, Mama Mary''s, Spring Tree, McCann''s, Carey''s, Vermont Maid, Green Giant , Le Sueur, Dash, Spice Islands, Weber, Ac''cent, Tone''s, Trappey''s, Durkee and Wrig', 'Parsippany, NJ, United States', 2610);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DINO', 'STOCK', 'HF Sinclair Corporation', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'A HF Sinclair Corporation é uma empresa independente de energia que produz e comercializa produtos leves, como gasolina, diesel, combustível a jato, diesel renovável e outros produtos especiais. Seus segmentos incluem Refinação, Renováveis, Marketing, Lubrificantes e Especialidades e Midstream. O segmento de refino inclui as operações de seu El Dorado, Tulsa, Puget Sound, Navajo, Woods Cross, refinarias de Parco e Casper e Asfalto. O segmento de energias renováveis inclui as operações das RDUs Artesia, Cheyenne e Sinclair e da PTU Artesia. O segmento de Marketing inclui vendas de combustível de marca. O segmento Lubrificantes e Especialidades inclui as operações dos negócios Petro-Canada Lubricants, Red Giant Oil e Sonneborn, além de produtos lubrificantes especiais produzidos na refinaria de Tulsa West. O segmento Midstream inclui oleodutos de petróleo e petróleo bruto, instalações de terminais, tanques e prateleiras de carga e unidades de processamento de refinarias que suportam prin', 'Dallas, TX, United States', 5297);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CODX', 'STOCK', 'Co-Diagnostics, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Co-Diagnostics, Inc. is a molecular diagnostics company, which develops, manufactures and markets diagnostics technologies. The Companys technologies are utilized for tests that are designed using the detection and/or analysis of nucleic acid molecules (DNA or RNA). The Company also uses its proprietary technology to design specific tests for its Co-Dx PCR platform and to locate genetic markers for use in applications other than infectious disease. Its diagnostics systems enable dependable, low-cost, molecular testing for organisms and genetic diseases by automating or simplifying historically complex procedures in both the development and administration of tests. It is developing a portable diagnostic device and test system designed for point-of-care and at-home use. The system consists of its PCR instrument that it refers to as the Co-Dx PCR Pro instrument, its proprietary diagnostic test cup system and a mobile application to be installed on the users mobile device.', 'Salt Lake City, UT, United States', 132);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WATT', 'STOCK', 'Energous Corporation', 'NCM', 'Technology', 'Scientific & Technical Instruments', 'Energous Corporation is a developer of over-the-air Wireless Power Network (WPN) technology that integrates advanced semiconductor chipsets, software controls, hardware designs and antenna systems to enable radio frequency (RF)-based charging for Internet of Things devices. Its WPN technology provides a comprehensive suite of capabilities designed to power the wireless energy networks, seamlessly delivering power and data across diverse, battery-free device ecosystems. Its RF-based, scalable WPN solutions enable wireless charging, ranging from contact-based applications to at-a-distance applications, that charge over the air, transforming the way electronic devices are charged and powered. Its wireless power transmitter and receiver technologies deliver continuous access to wireless power, helping drive a new generation of battery-free devices for asset and inventory tracking and management. Its integrated circuits (ICs) are designed for both lower-power and higher-power applications.', 'San Jose, CA, United States', 26);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHD', 'STOCK', 'Church & Dwight Co., Inc.', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'A Church & Dwight Co., Inc. Desenvolve, fabrica e comercializa uma gama de produtos domésticos e de cuidados pessoais de consumo e produtos especiais focados na produção animal e alimentar, produtos químicos e produtos de limpeza. Os segmentos da Companhia incluem Consumer Domestic, Consumer International e Specialty Products Division (SPD). O segmento Consumer Domestic inclui cada uma das suas sete marcas de potência, bem como outras marcas e produtos de higiene pessoal e doméstica. O segmento Consumer International comercializa uma variedade de produtos de cuidados pessoais, domésticos e de venda livre em mercados subsidiários internacionais, incluindo Austrália, Canadá, França, Alemanha, Austrália, Austrália, Canadá e outros países. Japão, México, China e Reino Unido. Seu segmento SPD se concentra em vendas para empresas e participa de três áreas de produtos: Nutrição animal, especialidades químicas e comerciais e profissionais. As marcas da Companhia incluem ARM & HAMMER; OXICLEAN;', 'Ewing, NJ, United States', 5750);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSAN', 'STOCK', 'Cosan S.A.', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'A Cosan SA, anteriormente conhecida como Cosan SA Indústria e Comércio, é uma empresa sediada no Brasil que atua principalmente no setor de marketing de petróleo. As atividades da Companhia estão divididas em seis segmentos de negócios: Raizen Energia, que produz e distribui derivados de cana-de-açúcar, como açúcar bruto e etanol hidratado, e co-gera energia a partir do bagaço de cana; Raizen Combustiveis, que distribui combustível, principalmente através de uma rede de postos de gasolina sob a marca Shell; Comgas, que se concentra na distribuição de gás natural no estado de São Paulo, Brasil; Radar, responsável pela compra, venda, gerenciamento e arrendamento de terras agrícolas; Lubrificantes, que fabrica e vende lubrificantes sob a marca Mobil no mercado latino-americano, bem como a marca Comma no mercado europeu e asiático, e Outros, que inclui investimentos em outros negócios. A Companhia é uma subsidiária da Cosan Ltd.', 'São Paulo, SP, Brazil', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMX', 'STOCK', 'América Móvil, S.A.B. de C.V.', 'NYQ', 'Communication Services', 'Telecom Services', 'A America Movil, S.A.B. de C.V. é uma holding. A Companhia fornece serviços de telecomunicações. Seus serviços incluem serviços de voz móvel e fixa, serviços de dados sem fio e fixos, acesso à Internet e televisão por assinatura, venda de equipamentos, acessórios e computadores, bem como outros serviços relacionados. Seus segmentos são México Wireless, México Fixo, Brasil, Colômbia, Cone Sul, Região Andina, América Central, Caribe, Estados Unidos e Europa. O segmento do Cone Sul inclui Argentina, Chile, Paraguai e Uruguai. O segmento da Região Andina inclui Equador e Peru. O segmento da América Central inclui Costa Rica, El Salvador, Guatemala, Honduras, Nicarágua e Panamá. O segmento do Caribe inclui a República Dominicana e Porto Rico. O segmento da Europa inclui Áustria, Bielo-Rússia, Bulgária, Croácia, Macedônia, Sérvia e Eslovênia. Atua em todos os seus segmentos geográficos com a marca Claro, exceto no México, Estados Unidos e Europa.', 'Mexico City, DF, Mexico', 177084);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WWD', 'STOCK', 'Woodward, Inc.', 'NMS', 'Industrials', 'Aerospace & Defense', 'Woodward, Inc. designs, manufactures, and services energy conversion and control solutions for the aerospace and industrial equipment markets. The Companys segments include Aerospace and Industrial. The Aerospace segment offers fuel controls and airframe solutions for commercial, defense, business and general aviation. It offers aircraft engine controls, actuation and control systems, flight deck controls, and space and defense solutions. Its aircraft engine controls include fuel control systems, fuel injection and ignition systems, engine actuation systems, and air management. Its actuation and control systems include electromechanical actuation, hydraulic actuation, precision motors, and thrust reverser actuation systems. Its Industrial segment offers control solutions for reliable and clean power generation and control solutions for critical equipment in a decarbonized world. Its products include easYgen-3000XT and Aeroderivative Gas Turbine Gas Fuel Valves.', 'Fort Collins, CO, United States', 9300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NB', 'STOCK', 'NioCorp Developments Ltd.', 'NGM', 'Basic Materials', 'Other Industrial Metals & Mining', 'NioCorp Developments Ltd. is developing the Elk Creek Project that is expected to produce niobium, scandium, and titanium. The Company is also evaluating the potential to produce several rare earths from the Elk Creek Project. The Elk Creek Project is a shovel-ready pure-play critical minerals project with the highest-grade Niobium resource in North America and an indicated rare earth resource in the United States. The Elk Creek Project is located approximately 105 kilometers (kms) southeast of Lincoln, Nebraska (the state capital); 129 kms south of Omaha, Nebraska, and three miles west of Elk Creek, Nebraska and six miles south of Tecumseh, Nebraska.', 'Centennial, CO, United States', 7);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADD', 'STOCK', 'Color Star Technology Co., Ltd.', 'NCM', 'Communication Services', 'Entertainment', 'Color Star Technology Co., Ltd. is an entertainment technology company. The Company is focused on the application of technology and artificial intelligence in the entertainment industry, and primarily provide services through its wholly owned subsidiaries, Color Metaverse and CACM Group NY, Inc. Color World is its online cultural entertainment platform, which is operated by Color Metaverse. It is a platform primarily providing celebrity-led education services. The curriculum development created by the Company includes music, sports, animation, painting and calligraphy, film and television, life skills, and others. The Company offers services, such as concerts and entertainment events, construction management consulting services, and online music education academy subscription. It provides online entertainment performances and online education through its wholly owned subsidiaries Color Metaverse and CACM.', 'New York, NY, United States', 47);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMTX', 'STOCK', 'Aemetis, Inc.', 'NGM', 'Basic Materials', 'Specialty Chemicals', 'Aemetis, Inc. is a renewable natural gas and renewable fuels company. It is focused on the acquisition, development and commercialization of technologies that replace petroleum-based products and reduce greenhouse gas emissions. Its segments include California Ethanol, California Dairy Renewable Natural Gas, and India Biodiesel. California Ethanol segment consists of an approximately 65 million gallons per year ethanol plant in Keyes, California. California Dairy Renewable Natural Gas segment is engaged in the production and sale of renewable natural gas and associated environmental attributes, consisting of anaerobic digesters located at diaries, a 36-mile biogas collection pipeline, and a biogas upgrading hub and pipeline interconnect that produces Renewable Natural Gas from the biogas. India Biodiesel segment includes a biodiesel production plant in Kakinada, India with a production capacity of over 80 million gallons per year and administrative offices in Hyderabad, India.', 'Cupertino, CA, United States', 223);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMRX', 'STOCK', 'Amneal Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Amneal Pharmaceuticals, Inc. is a global pharmaceutical company, which develops, manufactures, markets and distributes a portfolio of essential medicines. Its Affordable Medicines segment includes a portfolio of over 280 product families covering a range of dosage forms and delivery systems, including both immediate and extended-release oral solids, powders, liquids, sterile injectables, nasal sprays, inhalation and respiratory products, biosimilar products, ophthalmic, films, transdermal patches and topicals. Its Specialty segment is engaged in the development, promotion, sale and distribution of branded pharmaceutical products, with a focus on products addressing central nervous system disorders, including Parkinsons disease and endocrine disorders. Its AvKARE segment provides pharmaceuticals, medical and surgical products and services primarily to governmental agencies, predominantly focused on the U.S. Department of Defense and the U.S. Department of Veterans Affairs.', 'Bridgewater, NJ, United States', 8300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLNE', 'STOCK', 'Clean Energy Fuels Corp.', 'NMS', 'Energy', 'Oil & Gas Refining & Marketing', 'Clean Energy Fuels Corp. is a renewable energy company. The Company is engaged in the business of selling renewable and conventional natural gas as alternative fuels for vehicle fleets and related fueling solutions to its customers, primarily in the United States (U.S.) and Canada. Its principal business is supplying renewable natural gas (RNG) and conventional natural gas, in the form of compressed natural gas (CNG) and liquefied natural gas (LNG), for medium and heavy-duty vehicles and providing operation and maintenance (O&M) services to public and private vehicle fleet customer stations. The Company is also focused on developing, owning, and operating dairy and other livestock waste RNG projects and supplying RNG (procured from third party sources and from its anaerobic digester gas RNG joint venture project with TotalEnergies S.E.) to its customers in the heavy and medium-duty commercial transportation sector.', 'Newport Beach, CA, United States', 577);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDLX', 'STOCK', 'Cardlytics, Inc.', 'NGM', 'Communication Services', 'Advertising Agencies', 'Cardlytics, Inc. is a provider of a digital advertising platform. Through the Cardlytics platform, its financial media network, marketers deliver advertising content to customers that allows them to earn rewards, which are funded with a portion of the fees it collects from marketers. It maintains the Cardlytics platform in both the United States and the United Kingdom. Cardlytics platform helps marketers find new customers that are active in their category but not shopping with them, or to grow their business with existing customers. Cardlytics platform provides its marketers with a scalable solution for driving customer loyalty and engagement, whereby Cardlytics handles everything from contracting with marketers and creating, managing and reporting the performance of their campaigns to attributing incentives to each of its partners customers. The Bridg platform is a customer data platform that utilizes POS data from its merchant data partners, including product-level purchase data.', 'Atlanta, GA, United States', 381);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FL', 'STOCK', 'Foot Locker, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Foot Locker, Inc. is a footwear and apparel retailer. The Company operates through three segments: North America; Europe, Middle East, and Africa (EMEA); and Asia Pacific. The Company''s portfolio of brands includes Foot Locker, Kids Foot Locker, Champs Sports, WSS, and atmos. It uses its omnichannel capabilities to bridge the digital world and physical stores, including order-in-store, buy online and pickup-in-store, and buy online and ship-from-store, as well as e-commerce. It operates Websites and mobile apps aligned with the brand names of its store banners. These sites offer its product selections and provide a link between its e-commerce experience and physical stores. It operates approximately 2,400 retail stores in 20 countries across North America, Europe, Asia, Australia, and New Zealand, and has a licensed presence in Europe, the Middle East, and Asia. The Kids Foot Locker offers a selection of premium brand-name athletic footwear, apparel, and accessories for children.', 'New York, NY, United States', 13140);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECVT', 'STOCK', 'Ecovyst Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Ecovyst Inc. is an integrated global provider of advanced materials, specialty catalysts and services. The Companys Ecoservices segment provides sulfuric acid recycling to the North American refining industry for the production of alkylate and provides virgin sulfuric acid for industrial and mining applications. It also provides chemical waste handling and treatment services, as well as ex-situ catalyst activation services for the refining and petrochemical industry. Its Advanced Materials & Catalysts segment provides finished silica catalysts, catalyst supports and functionalized silicas necessary to produce high performing plastics and to enable sustainable chemistry, through its Advanced Silicas business. This segment also includes Zeolyst Joint Venture, which supplies specialty zeolites used in catalysts that support the production of sustainable fuels, remove nitrogen oxides from diesel engine emissions, and that are broadly applied in refining and petrochemical processes.', 'Malvern, PA, United States', 920);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDTX', 'STOCK', 'Black Diamond Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Black Diamond Therapeutics, Inc. is a clinical-stage oncology company developing MasterKey therapies that target families of oncogenic mutations in patients with cancer. The Companys MasterKey therapies are designed to address a broad spectrum of genetically defined tumors, overcome resistance, minimize wild-type mediated toxicities, and be brain penetrant to treat central nervous system disease. The Company is advancing a Phase 2 NSCLC trial of BDTX-1535, a brain-penetrant fourth-generation epidermal growth factor receptor (EGFR) MasterKey inhibitor targeting EGFR-mutant NSCLC and glioblastoma. Its BDTX-4933 pipeline product is out-licensed to Servier. BDTX-4933 is designed to target RAS and RAF alterations in solid tumors. It is exploring partnership opportunities for its FGFR2/3 selective development candidate BDTX-4876.', 'Cambridge, MA, United States', 24);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVLT', 'STOCK', 'Commvault Systems, Inc.', 'NMS', 'Technology', 'Software - Application', 'Commvault Systems, Inc. is a provider of cyber resilience and data protection solutions. The Companys cyber resilience platform combines data security and rapid recovery at enterprise scale across any workload. The Company provides these products and services for their data across many types of environments, including on-premises, hybrid and multi-cloud. Its offerings are delivered via self-managed software, software-as-a-service (SaaS), integrated appliances, or managed by partners. Its Commvault Cloud offerings are organized into three packages, such as Operational Recovery, Autonomous Recovery and Cyber Recovery. Its Operational Recovery provides backup, verifiable recovery, and cost-optimized cloud workload mobility, helping to ensure data availability and granular recovery, even across multiple clouds. In addition, it also provides customers with a range of offerings, including Cleanroom Recovery, HyperScale X, Air Gap Protect, Cloud Rewind, Clumio Backtrack and Compliance.', 'Tinton Falls, NJ, United States', 3300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLY', 'STOCK', 'Ally Financial Inc.', 'NYQ', 'Financial Services', 'Credit Services', 'Ally Financial Inc. is a financial services company. The Companys segments include Automotive Finance operations, Insurance operations, and Corporate Finance operations. The Automotive Finance operations segment is engaged in providing automotive financing services to consumers, automotive dealers and retailers, companies, and municipalities. Its Insurance operations segment operates as a complementary automotive-focused business, offering both consumer finance protection and insurance products sold primarily through the automotive dealer channel, and commercial insurance products sold directly to dealers. Its Corporate Finance operations segment provides senior secured asset-based and leveraged cash flow loans to U.S.-based middle-market companies, with a focus on businesses owned by private equity sponsors. The Company also includes a robust corporate finance business that offers capital for equity sponsors and middle-market companies.', 'Detroit, MI, United States', 10700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQR', 'STOCK', 'Equity Residential', 'NYQ', 'Real Estate', 'REIT - Residential', 'Equity residential é uma confiança de investimento imobiliário. A Companhia está focada na aquisição, desenvolvimento e gestão de imóveis residenciais localizados em e ao redor das cidades. O principal negócio da Companhia é a aquisição, desenvolvimento e gestão de imóveis residenciais multifamiliares, que incluem a geração de renda alugada e demais renda relacionada por meio do arrendamento de unidades de apartamentos aos moradores. A empresa possui e opera propriedades de aluguel de apartamentos, com presença em Boston, Nova York, Washington, DC, Sul da Califórnia (incluindo Los Angeles, Orange County e San Diego), San Francisco e Seattle, e uma presença em expansão em Denver, Atlanta, Dallas/Ft. Vale e Austin. A Companhia possui investimentos em aproximadamente 311 propriedades localizadas em 10 estados, consistindo em mais de 84 249 unidades de apartamentos. A ERP Operating Limited Partnership (ERPOP) realiza o negócio de imóveis residenciais multifamiliares da Equity Residential.', 'Chicago, IL, United States', 2500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRMD', 'STOCK', 'CorMedix Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'CorMedix Inc. is a biopharmaceutical company. The Company is focused on developing and commercializing therapeutic products for the prevention and treatment of life-threatening conditions and diseases. The Company is focused on commercializing its lead product, DefenCath, which is an antimicrobial catheter lock solution approved to reduce the incidence of catheter-related bloodstream infections in adult patients with kidney failure receiving chronic hemodialysis through a central venous catheter. DefenCath is a formulation of taurolidine 13.5 milligrams per milliliter (mg/mL), and heparin 1000 USP Units/mL indicated to reduce the incidence of catheter-related bloodstream infections (CRBSI) in adult patients with kidney failure receiving chronic hemodialysis through a central venous catheter (CVC). In addition to DefenCath, the Company has sponsored a pre-clinical research collaboration for the use of taurolidine as a possible treatment for rare pediatric tumors.', 'Berkeley Heights, NJ, United States', 64);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLO', 'STOCK', 'DLocal Limited', 'NMS', 'Technology', 'Software - Infrastructure', 'Dlocal Ltd, an Uruguay-based company, is focused on enabling global merchants to connect with emerging market users. The Company offers payment platform for emerging markets. Through the Company''s direct application programming interface (API), one technology platform, and one contract, which is collectively referred as the One dLocal model. The Company enables global enterprise merchants to get paid (pay-in) and to make payments (pay-out) online in a safe and efficient manner. The Company''s cloud-based platform powers both cross-border and local-to-local transactions in approximately 29 countries. The Company enables global merchants to connect with over 600 local payment methods across different geographies, which expands their addressable markets. It operates in different verticals and geographies. The Company''s key verticals include retail, streaming, ride hailing, financial institutions, advertising, software as a service (SaaS), travel, e-learning and gaming.', 'Montevideo, , Uruguay', 1095);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNO', 'STOCK', 'CNO Financial Group, Inc.', 'NYQ', 'Financial Services', 'Insurance - Life', 'CNO Financial Group, Inc. is a holding company for a group of insurance companies. It provides life and health insurance, annuities, financial services and workforce benefits solutions through its family of brands, including Bankers Life, Colonial Penn, Optavise and Washington National. It is focused on serving middle-income pre-retiree and retired Americans. It markets its products through the Consumer and Worksite Divisions that reflect the customers served by the Company. The Consumer Division serves individual consumers, engaging with them on the phone, virtually, online, face-to-face with agents, or through a combination of sales channels. The Worksite Division focuses on the sale of voluntary benefit life and health insurance products in the workplace for businesses, associations and other membership groups, interacting with customers at their place of employment and virtually. It also offers a suite of voluntary benefits, benefits administration technology and advocacy services.', 'Carmel, IN, United States', 3400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEI', 'STOCK', 'Douglas Emmett, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'Douglas Emmett, Inc. is a fully integrated, self-administered and self-managed real estate investment trust (REIT). The Company owns and operates office and multifamily properties located in the coastal submarkets of Los Angeles and Honolulu. It operates through two segments: office segment and multifamily segment. The Company''s segments include the acquisition, development, ownership and management of office and multifamily real estate. The services for its office segment include primarily the rental of office space and other tenant services, including parking and storage space rental. The services for its multifamily segment include primarily the rental of apartments and other tenant services, including parking and storage space rental. Its properties are located in the Beverly Hills, Brentwood, Burbank, Century City, Olympic Corridor, Santa Monica, Sherman Oaks/Encino, Warner Center/Woodland Hills and Westwood submarkets of Los Angeles County, California, and in Honolulu, Hawaii.', 'Santa Monica, CA, United States', 770);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('YETI', 'STOCK', 'YETI Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Leisure', 'YETI Holdings, Inc. is a designer, retailer, and distributor of outdoor products. The Company''s product portfolio consists of three categories: Coolers & Equipment; Drinkware, and Other. Its Coolers & Equipment family is comprised of hard coolers, soft coolers, cargo, bags, outdoor living, and associated accessories. Its hard cooler category includes YETI Tundra, YETI Roadie, YETI V Series hard coolers, YETI TANK ice, and YETI Silo 6G water cooler. The Hopper soft cooler product line includes Hopper M15 Soft Cooler, Hopper M12 Soft Backpack Cooler, Hopper M30 Soft Cooler, Hopper Flip Soft Cooler, and Daytrip Lunch Bag, among others. Its Drinkware product line consists of Rambler Colsters, Rambler Lowball, Rambler Wine Tumblers, Rambler Stackable Pints, Rambler Mugs, Rambler Tumblers, Rambler Straw Mugs and Cups, Rambler Bottles, Rambler Jugs, and Yonder Water Bottles. The Other category offers an array of apparel and gear, such as hats, shirts, bottle openers and ice substitutes.', 'Austin, TX, United States', 1340);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACVA', 'STOCK', 'ACV Auctions Inc.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'ACV Auctions Inc. provides a marketplace for wholesale vehicle transactions and data services that offer vehicle information to its customers. Its marketplace platform leverages data insights and technology to power its digital marketplace and data services, enabling its dealers and commercial partners to buy, sell and value vehicles. Its marketplace platform includes Digital Marketplace, Remarketing Centers, Data Services, and Data and Technology. Digital Marketplace connects buyers and sellers of wholesale vehicles. Remarketing Centers provide an additional channel to provide dealers and commercial partners with auction services. Data Services offers insights into the condition and value of used vehicles for transactions both on and off its marketplace. The Data and Technology helps in vehicle inspections, vehicle intelligence reports, digital marketplace, and operations automation. Its offerings include ACV Auctions, ACV Transportation, ACV Capital, ACV MAX, True360, and ClearCar.', 'Buffalo, NY, United States', 2900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARWR', 'STOCK', 'Arrowhead Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'A Arrowhead Research Corporation (Arrowhead) é uma empresa de nanotecnologia em estágio de desenvolvimento que comercializa tecnologias nas áreas de ciências da vida, eletrônica e energia. A nanotecnologia envolve a investigação e projeto de materiais e dispositivos nos níveis atômico e molecular. A Companhia trabalha com universidades para obter acordos em estágios iniciais e para gerar direitos de propriedade intelectual que abrangem nanotecnologias promissoras. Em 14 de dezembro de 2006, a Arrowhead operava quatro subsidiárias majoritárias. As subsidiárias da Arrowhead comercializam uma variedade de produtos e aplicações de nanotecnologia, incluindo medicamentos anticancerígenos, terapias de interferência de ácido ribonucleico (RNAi), eletrônicos baseados em carbono e materiais semicondutores compostos.', 'Pasadena, CA, United States', 609);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAND', 'STOCK', 'Bandwidth Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Bandwidth Inc. is a global cloud communications software company that helps enterprises deliver experiences through voice calling, text messaging and emergency services. The Companys solutions and its communications cloud cover over 65 countries and have users in unified communications and cloud contact centers. It is a global communications platform-as-a-service (CPaaS) to offer a combination of composable application programming interfaces (APIs), owner-operated network and broad regulatory experience. Its Global Voice Plans serves the power platforms at the forefront of the communications transformation in unified communications as a service (UCaaS) and contact center as a service (CCaaS). Its Programmable Services comprises its text messaging solutions, through which it supports software as a service (SaaS) platform. The Enterprise Voice helps enterprises to leverage its voice, global number management, emergency services and other services in digital transformation.', 'Raleigh, NC, United States', 1100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHVN', 'STOCK', 'Biohaven Ltd.', 'NYQ', 'Healthcare', 'Biotechnology', 'A Biohaven Ltd. É uma empresa biofarmacêutica focada na descoberta, desenvolvimento e comercialização de tratamentos em áreas terapêuticas-chave, incluindo imunologia, neurociência e oncologia. Está avançando seu portfólio de terapias, alavancando sua experiência de desenvolvimento de drogas e múltiplas plataformas proprietárias de desenvolvimento de drogas. Seus programas clínicos e pré-clínicos incluem modulação do canal iônico Kv7 para epilepsia e distúrbios do humor; degradação de proteínas extracelulares para doenças imunológicas; antagonismo TRPM3 para enxaqueca e dor neuropática; inibição TYK2/JAK1 para distúrbios neuroinflamatórios; modulação do glutamato para transtorno obsessivo-compulsivo (TOC) e ataxia espinobelar (SCA); inibição do câncer neuromuscular e atrofia; e doenças neuromuscular; Seu candidato avançado do produto de sua plataforma antagonista do recetor do glutamato é o troriluzole.', 'New Haven, CT, United States', 256);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGC', 'STOCK', 'BGC Group, Inc.', 'NMS', 'Financial Services', 'Capital Markets', 'BGC Group, Inc. is a global marketplace, data, and financial technology services company for a range of products, including fixed income, foreign exchange, energy, commodities, shipping, equities, and includes the FMX Futures Exchange. It also provides a wide range of services, including trade execution, brokerage, clearing, trade compression, information, consulting, and other back-office services to a range of financial and non-financial institutions. Through its brands, including Fenics, FMX, FMX Futures Exchange, Fenics Markets Xchange, Fenics Digital, Fenics UST, Fenics FX, Fenics Repo, Fenics Direct, Fenics MID, Fenics Market Data, Fenics GO, Fenics PortfolioMatch, BGC, BGC Trader, KACE and Lucera, it offers financial technology solutions, market data, and analytics related to numerous financial instruments and markets. Its customers include banks, broker-dealers, investment banks, trading firms, hedge funds, governments, corporations, and investment firms.', 'New York, NY, United States', 3971);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALDX', 'STOCK', 'Aldeyra Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Aldeyra Therapeutics, Inc. is a biotechnology company focused on discovering therapies designed to treat immune-mediated and metabolic diseases. The Company''s approach is to develop pharmaceuticals that modulate protein systems, instead of directly inhibiting or activating single protein targets, with the goal of optimizing multiple pathways at once while minimizing toxicity. Its product candidates include reactive aldehyde species (RASP) modulators ADX-629, ADX 248, ADX-743, ADX-631, ADX-246, and chemically related molecules for the potential treatment of systemic and retinal immune-mediated and metabolic diseases. Its late-stage product candidates are reproxalap, a RASP modulator for the potential treatment of dry eye disease and allergic conjunctivitis, and ADX-2191, a novel formulation of intravitreal methotrexate for the potential treatment of retinitis pigmentosa. ADX 629 is in Phase II clinical trials for moderate alcohol-associated hepatitis and Sjogren-Larsson Syndrome.', 'Lexington, MA, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CURR', 'STOCK', 'CURRENC Group Inc.', 'NGM', NULL, NULL, 'CURRENC Group Inc. is a Singapore-based investment holding company. The Company is a fintech and digital remittance provider that enables electronic wallets, remittance companies, and corporations to offer real-time, global payment services, advancing financial access across underserved communities. The Companys segments include Remittance Services and Sales of Airtime. The Remittance Services segment is operated through Tranglo Sdn BHD and related subsidiaries (Tranglo). Tranglo operates a remittance hub covering Southeast Asia and globally, which is in the downstream segment of the remittance business. The Company operates the Sales of Airtime segment through its international airtime transfer business through Tranglo and its retail airtime trading business locally in Indonesia through PT Walletku Indompet Indonesia (WalletKu). Its subsidiaries are Seamless Group Inc., Dynamic Investment Holdings Limited, and Bagus Fintech Pte. Ltd., among others.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DG', 'STOCK', 'Dollar General Corporation', 'NYQ', 'Consumer Defensive', 'Discount Stores', 'A Dollar General Corporation é um revendedor com desconto. A empresa oferece produtos, incluindo itens consumíveis, itens sazonais, produtos domésticos e vestuário. Sua mercadoria inclui marcas de fabricantes, bem como suas próprias seleções de marca privada com preços a descontos para marcas. Sua categoria de consumíveis inclui papel e produtos de limpeza, alimentos embalados, perecíveis, lanches, saúde e beleza, pet, e produtos de tabaco. Seus produtos sazonais incluem itens de férias, brinquedos, baterias, eletrônicos pequenos, cartões de felicitações, artigos de papelaria, telefones e acessórios pré-pagos, suprimentos de jardinagem, hardware, automotivo e material de escritório em casa. Seus produtos domésticos incluem suprimentos de cozinha, utensílios de cozinha, pequenos eletrodomésticos, lâmpadas, recipientes de armazenamento, quadros, velas, suprimentos artesanais e cozinha, cama e banho de produtos macios. Os produtos de vestuário da empresa incluem itens básicos para bebês, ', 'Goodlettsville, TN, United States', 194200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABR', 'STOCK', 'Arbor Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Arbor Realty Trust, Inc. is a real estate investment trust and direct lender, providing loan origination and servicing for multifamily, single-family rental (SFR) portfolios, and other diverse commercial real estate assets. The Companys segments include Structured Business and Agency Business. Through its Structured Business, it invests in a diversified portfolio of structured finance assets in the multifamily, SFR and commercial real estate markets, primarily consisting of bridge loans to mezzanine loans, junior participating interests in first mortgages and preferred equity. It also invests in real estate-related joint ventures and may directly acquire real property and invest in real estate-related notes and certain mortgage-related securities. Through its Agency Business, the Company originates, sells, and services a range of multifamily finance products through Housing and Urban Development (HUD), Federal National Mortgage Association (Fannie Mae), among others.', 'Uniondale, NY, United States', 659);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMH', 'STOCK', 'American Homes 4 Rent', 'NYQ', 'Real Estate', 'REIT - Residential', 'American Homes 4 Rent is an internally managed Maryland real estate investment trust (REIT). The Companys primary objective is to generate risk-adjusted returns for its shareholders through dividends and capital appreciation by acquiring, developing, renovating, leasing and managing single-family homes as rental properties. The Company conducts all of its operations through, American Homes 4 Rent, L.P. (the Operating Partnership). It owns 61,000 single-family properties in the Southeast, Midwest, Southwest and Mountain West regions of the United States. The Company is focused on developing built-for-rental homes through its internal AMH Development Program. In addition, it also acquires newly constructed homes from third-party developers through its National Builder Program. The Company directly manages all of its properties, including those held in its unconsolidated joint ventures, generally without the engagement of a third-party manager.', 'Las Vegas, NV, United States', 1730);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBVA', 'STOCK', 'Banco Bilbao Vizcaya Argentaria, S.A.', 'NYQ', 'Financial Services', 'Banks - Diversified', 'O Banco Bilbao Vizcaya Argentaria, S.A. (BBVA) é um banco com sede na Espanha. É uma empresa financeira diversificada que atua em banco de varejo, banco de atacado, gestão de ativos e banco privado. Seus segmentos são: Espanha, Estados Unidos, Turquia, México, América do Sul e Resto da Eurásia. As atividades em Espanha são a atividade bancária e os seguros. Nos Estados Unidos oferece serviços por meio do BBVA USA e da filial do BBVA em Nova York. O segmento de Turquia é representado pelo grupo Garanti BBVA, um grupo integrado de serviços financeiros, que também opera na Holanda e na Romênia. As atividades do segmento no México incluem negócios bancários e de seguros. Na América do Sul, oferece negócios bancários e de seguros. O segmento Resto da Eurásia inclui a atividade empresarial no resto da Europa e Ásia', 'Bilbao, , Spain', 125864);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AU', 'STOCK', 'AngloGold Ashanti plc', 'NYQ', 'Basic Materials', 'Gold', 'A AngloGold Ashanti Limited (AngloGold Ashanti) é uma empresa de mineração de ouro. As atividades de negócios da empresa abrangem todo o espectro da cadeia de valor da mineração. Seu principal produto é o ouro. Seu portfólio inclui mina em aproximadamente 10 países. Também produz prata e ácido sulfúrico como subprodutos. A empresa opera em três segmentos: África Continental, Austrália e Américas. Tem operações na África Continental em várias localidades, incluindo a República Democrática do Congo, Gana, Guiné, Mali e Tanzânia. O segmento Austrália inclui as operações na Austrália. Consiste em Sunrise Dam e Tropicana. O segmento Américas inclui as operações na Argentina, Brasil e Colômbia.', 'Greenwood Village, CO, United States', 12634);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRZE', 'STOCK', 'Braze, Inc.', 'NMS', 'Technology', 'Software - Application', 'Braze, Inc. provides a customer engagement platform that enables brands to be engaging. The Companys platform allows any marketer to collect and take action on any amount of data from any source, so they can engage with customers in real time, across channels from one platform. From cross-channel messaging and journey orchestration to artificial intelligence (Al)-powered experimentation and optimization, its platform enables companies to build and maintain engaging relationships with their customers. The Companys platform produces data that informs decisions and actions across customer engagement strategies. It supports interactions across both in-product and out-of-product messaging channels. Braze Cloud Data Ingestion allows its customers to set up a direct connection between their data warehouses or platforms and Braze to automatically sync relevant data. The Companys portfolio also includes OfferFit, an AI decisioning company.', 'New York, NY, United States', 1699);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOH', 'STOCK', 'Bank of Hawaii Corporation', 'NYQ', 'Financial Services', 'Banks - Regional', 'Bank of Hawaii Corporation is a bank holding company. The Company provides a range of financial products and services primarily to customers in Hawaii, Guam, and other Pacific Islands. It is also engaged in securities brokerage, investment advisory services and providing credit insurance. It operates through three segments: Consumer Banking, Commercial Banking, and Treasury and Other. The Consumer Banking segment offers a range of financial products and services, including loan, deposit and insurance products; private banking and international client banking services; trust services; investment management; and institutional investment advisory services. The Commercial Banking segment offers products, including corporate banking, commercial real estate loans, commercial lease financing, auto dealer financing and deposit products. The Treasury consists of corporate asset and liability management activities, including interest rate risk management and a foreign currency exchange business.', 'Honolulu, HI, United States', 1865);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLR', 'STOCK', 'Digital Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Specialty', 'Digital Realty Trust, Inc. Opera como uma confiança de investimento imobiliário. A Empresa está envolvida no negócio de possuir, adquirir, desenvolver e operar data centers. É um provedor global de soluções de data center, colocation e interconexão para clientes em uma variedade de verticais do setor, que vão desde serviços de nuvem e tecnologia da informação, redes sociais e comunicações a serviços financeiros, fabricação, energia, saúde e produtos de consumo. Através de sua plataforma PlatformDIGITAL, que é uma plataforma global de data center que oferece aos clientes um local de encontro seguro de dados e uma metodologia comprovada de solução de arquitetura de data center (PDx) pervasiva para impulsionar a inovação e gerenciar eficientemente os desafios de gravidade de dados. Os data centers da empresa estão localizados nos Estados Unidos, Europa, América Latina, África, Ásia e Oriente Médio. Austrália e Canadá. Também possui um data center de colocation altamente conetado no Slough', 'Dallas, TX, United States', 3936);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EAT', 'STOCK', 'Brinker International, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Brinker International, Inc. is a casual dining restaurant company. The Company owns, develops, operates and franchises the Chilis Grill & Bar (Chilis) and Maggianos Little Italy (Maggianos) restaurant brands. The Company operates through two segments: Chilis and Maggianos. The Chilis segment includes its Company-owned Chilis restaurants, which are principally located in the United States, within the full-service casual dining segment of the industry. The Chilis segment also includes its Canadian Company-owned restaurants and royalties from its franchised locations in the United States, 27 other countries and two United States territories. The Maggianos segment includes its Company-owned Maggiano''s restaurants in the United States as well as royalties from its domestic franchise business. It owns, operates or franchises more than 1,600 restaurants in the United States and 27 other countries and two United States territories.', 'Dallas, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARQT', 'STOCK', 'Arcutis Biotherapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Arcutis Biotherapeutics, Inc. is a commercial-stage medical dermatology company. The Company is focused on developing and commercializing treatments for dermatological diseases with high-unmet medical needs. Its portfolio is comprised of topical and systemic treatments with potential to treat immune-mediated dermatological diseases and conditions. Its lead product, ZORYVE, is for the treatment of plaque psoriasis, including psoriasis in the intertriginous areas, in individuals 12 years of age or older. The ZORYVE is also indicated for topical treatment of mild to moderate atopic dermatitis. ZORYVE cream is a once-daily topical formulation of roflumilast, a potent and selective phosphodiesterase-4 (PDE4) inhibitor. The Companys pipeline includes ARQ-255, ARQ-252, and ARQ-234. Its ARQ-255 is being developed for the treatment of alopecia areata. ARQ-252 is an alternative topical cream formulation of ivarmacitinib that the Company is developing for chronic hand eczema and vitiligo.', 'Westlake Village, CA, United States', 342);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANF', 'STOCK', 'Abercrombie & Fitch Co.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Abercrombie & Fitch Co. is a global, digitally led omnichannel specialty retailer of apparel and accessories. The Company offers an assortment of apparel, personal care products and accessories for men, women and kids, which are sold primarily through its Company-owned stores and digital channels, as well as through various third-party arrangements. The Companys brands include Abercrombie brands, which includes Abercrombie & Fitch, abercrombie kids, and Your Personal Best (YPB), and Hollister brands, which include Hollister and Gilly Hicks. Its geographic segments include the Americas, EMEA, and APAC. The Company also offers its loyalty programs, which include Abercrombies myAbercrombie and Hollisters Hollister House Rewards. The Company operates approximately 790 stores under these brands across North America, Europe, Asia and the Middle East, as well as the e-commerce sites abercrombie.com, abercrombiekids.com, and hollisterco.com.', 'New Albany, OH, United States', 6600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUBE', 'STOCK', 'CubeSmart', 'NYQ', 'Real Estate', 'REIT - Industrial', 'CubeSmart is a self-administered and self-managed real estate investment trust. The Company''s self-storage properties are designed to offer climate-controlled storage space for residential and commercial customers. It owns its assets and conducts its operations through the CubeSmart, L.P. (Operating Partnership), and subsidiaries of the Operating Partnership. Its customers rent storage cubes for their exclusive use, on a month-to-month basis. Additionally, some of its stores offer outside storage areas for vehicles and boats. Its stores are designed to accommodate both residential and commercial customers, with features, such as wide aisles and load-bearing capabilities for large truck access. Its customers can access their storage cubes during business hours, and some of its stores provide customers with 24-hour access. It owns about 631 self-storage properties located in 25 states and in the District of Columbia, containing an aggregate of about 45.8 million rentable square feet.', 'Malvern, PA, United States', 3104);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DXC', 'STOCK', 'DXC Technology Company', 'NYQ', 'Technology', 'Information Technology Services', 'A DXC Technology Company é uma empresa global de serviços de tecnologia da informação (TI). A empresa ajuda as empresas globais a executar seus sistemas e operações de missão crítica enquanto MODERNIZA A TI, otimiza arquiteturas de dados e garante segurança e escalabilidade em nuvens públicas, privadas e híbridas. Seus segmentos incluem Serviços Globais de Negócios (GBS) e Serviços Globais de Infraestrutura (GIS). O segmento GBS oferece soluções tecnológicas que ajudam seus clientes a enfrentar seus desafios de negócios e acelerar transformações ajustadas a cada setor de clientes e objetivos específicos. As ofertas da GBS incluem análise e engenharia, aplicativos e software de seguros e serviços de processos de negócios. O segmento GIS da empresa fornece um portfólio de ofertas de tecnologia que fornecem resultados previsíveis e resultados mensuráveis, reduzindo o risco de negócios e os custos operacionais para os clientes. As ofertas de GIS incluem segurança, infraestrutura em nuvem e', 'Ashburn, VA, United States', 120000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AQMS', 'STOCK', 'Aqua Metals, Inc.', 'NCM', 'Industrials', 'Waste Management', 'Aqua Metals, Inc. is engaged in metals recycling with its AquaRefining technology. It is focused on commercializing sustainable lithium-ion battery recycling that is non-polluting and closes the loop on critical minerals for clean energy technologies. It is focused on building and operating its lithium battery recycling facility, utilizing electricity to recycle instead of intensive chemical processes, fossil fuels, or high-temperature furnaces. Its flagship lithium battery recycling campus - the Sierra ARC (AquaRefining Campus) is a sustainable lithium battery recycling center in North America and commercial-scale deployment of its Li AquaRefining technology. Its process allows for recovery and conversion into high-purity nickel carbonate. It provides equipment and licensing of its lead acid battery recycling technologies in an enabler model. Its process produces high purity metals and alloys that can be returned into the battery manufacturing supply chain or sold into metals markets.', 'Reno, NV, United States', 11);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DT', 'STOCK', 'Dynatrace, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Dynatrace, Inc. Fornece serviços de observabilidade e segurança unificados. Sua plataforma combina observabilidade ampla e profunda e segurança contínua de aplicativos em tempo de execução com inteligência artificial hipermodal Davis para fornecer respostas e automação inteligente a partir de dados em uma escala enorme. As soluções da plataforma Dynatrace incluem observação de infraestrutura, observação de aplicativos, proteção de segurança, análise de segurança, experiência digital, análise de negócios, automações e soluções personalizadas. Sua solução de observação de infraestrutura fornece visibilidade completa da camada de infraestrutura de tecnologia da informação de um cliente em nuvens públicas e privadas e ambientes híbridos e multicloud. Sua solução de automações aproveita dados de observação e segurança para impulsionar automações de fluxo de trabalho criadas com um criador de fluxo de trabalho visual ou automação como código. Ele fornece soluções personalizadas que podem ser', 'Boston, MA, United States', 5200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AME', 'STOCK', 'AMETEK, Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'AMETEK, Inc. É um fornecedor global de soluções de tecnologia industrial que atendem a um conjunto diversificado de nichos de mercado. Os segmentos da Companhia incluem Instrumentos Eletrônicos (EIG) e Eletromecânicos (EMG). O segmento EIG projeta e fabrica avançados instrumentos analíticos, de teste e de medição para os mercados de processo, aeroespacial, médico, pesquisa, energia e industrial. O segmento EIG fornece à indústria aeroespacial sensores de aeronaves e motores, sistemas de monitoramento, sistemas de computação embarcados, fontes de alimentação, sistemas de medição de combustível e fluido e sistemas de aquisição de dados. O segmento EMG fornece soluções de controle de movimento de precisão, componentes e dispositivos médicos altamente projetados, sistemas de gerenciamento térmico, metais especiais e interconexões elétricas. O segmento EMG fornece metais em pó de alta pureza, tiras e folhas, metais folheados especiais e compósitos de matriz metálica. Os mercados finais do s', 'Berwyn, PA, United States', 21500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDN', 'STOCK', 'Brandywine Realty Trust', 'NYQ', 'Real Estate', 'REIT - Office', 'Brandywine Realty Trust is a self-administered and self-managed real estate investment trust (REIT). It is engaged in the acquisition, development, redevelopment, ownership, management, and operation of a portfolio of office, life science/lab, residential and mixed-use properties. It owns its assets and conducts its operations through Brandywine Operating Partnership, L.P. The Company operates through four segments: Philadelphia Central Business District, Pennsylvania Suburbs, Austin, Texas, and Other. The Philadelphia CBD segment includes properties located in the City of Philadelphia, Pennsylvania. The Pennsylvania Suburbs segment includes properties in Chester, Delaware and Montgomery counties in the Philadelphia suburbs. The Austin, Texas segment includes properties in the City of Austin, Texas. The Other segment includes properties in Washington, D.C., Northern Virginia, Southern Maryland, Camden County, New Jersey and New Castle County, Delaware.', 'Philadelphia, PA, United States', 285);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FRO', 'STOCK', 'Frontline plc', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'FRONTLINE PLC is a Cyprus-based company primarily operating in the transportation sector. The Company''s main focus is on seaborne transportation of crude oil and refined products. The Company owns and operates a fleet consisting of multiple VLCC, Suezmax and LR2 / Aframax tankers intended for freight of oil and cargo. The Company operates worldwide.', 'Limassol, , Cyprus', 85);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTM', 'STOCK', 'Bitcoin Depot Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'Bitcoin Depot Inc. is a Bitcoin ATM (BTM) operator and fintech company. The Company provides its users with the means of converting cash into cryptocurrency, which users can deploy in the payments, spending and investing space. Its offerings include approximately 8,500 BTMs in retailer locations throughout the United States, Canada, and Puerto Rico, its BDCheckout product, which is accepted at approximately 7,600 retail locations, and its mobile app. Bitcoin Depot''s process is to convert cash into Bitcoin via its BTMs and the mobile app enables not only the users, but also the broader public, to access the digital financial system. The Company primarily purchases cryptocurrencies to sell to customers. It also offers a software solution to other BTM operators through its controlled subsidiary, BitAccess Inc. The Company''s diverse retail locations consist of convenience stores and gas station chains, pharmacies and grocers, and mall operators.', 'Atlanta, GA, United States', 126);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAR', 'STOCK', 'Darling Ingredients Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'Darling Ingredients Inc. É um desenvolvedor e produtor de ingredientes naturais sustentáveis a partir de bionutrientes comestíveis e não comestíveis, criando uma gama de ingredientes e soluções especiais personalizadas para clientes nas áreas farmacêutica, alimentar, pet food, ração animal, industrial, indústrias de combustíveis, bioenergia e fertilizantes. Seus segmentos incluem ingredientes de alimentação, ingredientes alimentares e ingredientes de combustível. O segmento de Ingredientes Alimentares inclui suas atividades globais relacionadas à coleta e processamento de subprodutos animais de carne bovina, aves e suínos na América do Norte, Europa e América do Sul em óleos não alimentares e refeições proteicas, entre outros. O segmento de Ingredientes Alimentares inclui suas atividades globais relacionadas à compra e processamento de chips de carne bovina e suína, peles de porco, peles de porco e peles de peixe em colágeno, entre outros. O segmento de Ingredientes de Combustível conv', 'Irving, TX, United States', 15500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CROX', 'STOCK', 'Crocs, Inc.', 'NMS', 'Consumer Cyclical', 'Footwear & Accessories', 'Crocs, Inc. is engaged in the design, development, worldwide marketing, distribution, and sale of casual lifestyle footwear and accessories for all. The Company''s brands include Crocs and HEYDUDE. The Crocs Brand''s collection contains Croslite material, a proprietary, molded footwear technology. It also uses Croslite material formulations in connection with material technologies used in its visible comfort collections, such as its LiteRide and Free Feel Technology products. The HEYDUDE Brand offers shoes with an iconic and versatile loafer silhouette with many wearing occasions that focus on casualization, comfort-led functionality and personalization. It sells its products in more than 80 countries, through wholesale and direct-to-consumer channels. Its wholesale channel includes domestic and international multi-brand retailers, e-tailers and others. Its direct-to-consumer channel includes Company-operated retail stores, Company-operated e-commerce sites and third-party marketplaces', 'Broomfield, CO, United States', 7910);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQH', 'STOCK', 'Equitable Holdings, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Equitable Holdings, Inc. is a financial services holding company, which comprised of complementary businesses, such as Equitable, AllianceBernstein and Equitable Advisors. Its segments include Individual Retirement, Group Retirement, Asset Management, Protection Solutions, Wealth Management, and Legacy. Its Individual Retirement segment provides individual variable annuity products. The Group Retirement segment offers tax-deferred investment and retirement services or products to plans sponsored by educational entities, municipalities and not-for-profit entities, as well as small and medium-sized businesses. The Asset Management segment provides diversified investment management and related services to a range of clients globally. The Wealth Management segment offers discretionary and non-discretionary investment advisory accounts, financial planning and advice, insurance, and annuity products. The Legacy segment primarily consists of the capital-intensive fixed-rate GMxB business.', 'New York, NY, United States', 8000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CF', 'STOCK', 'CF Industries Holdings, Inc.', 'NYQ', 'Basic Materials', 'Agricultural Inputs', 'A CF Industries Holdings, Inc. É um fabricante global de produtos de hidrogénio e azoto. A empresa está focada na descarbonização de sua rede de produção de amônia para permitir hidrogênio e nitrogênio com baixo teor de carbono para energia, fertilizantes, redução de emissões e outras atividades industriais. Os segmentos da empresa incluem amônia, ureia granular, UAN, AN e outros. O segmento de amônia produz amônia anidra (amônia), que é o produto base que fabrica (contendo 82% de nitrogênio e 18% de hidrogênio). O segmento de ureia granular produz ureia granular, que contém 46% de azoto. O segmento UAN produz solução de nitrato de amônio de ureia (UAN). Um segmento produz nitrato de amónio (AN). Outro segmento inclui principalmente produtos, como fluido de escape diesel (DEF), licor de ureia e ácido nítrico. Seus complexos de fabricação nos Estados Unidos, Canadá e Reino Unido, uma rede de armazenamento, transporte e distribuição na América do Norte, e capacidades logísticas permitem ', 'Northbrook, IL, United States', 2800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLND', 'STOCK', 'Blend Labs, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Blend Labs, Inc. is a digital origination platform for banks, credit unions, and mortgage lenders. The Company has built a cloud-based software platform and suite of products for financial services firms. From mortgages to consumer loans to deposit accounts, the Company helps financial institutions streamline workflows and deliver customer experiences. The Company has technology, data, and service providers on its software platform, including access to an extensive marketplace of insurance carriers and settlement agencies. The Company''s platform also includes Blend Builder, which gives its customers the ability to easily configure or build custom workflows from a pre-built set of components, all while leveraging existing infrastructure. Financial services firms can create custom solutions with Blend Builder, or choose from pre-built solutions for Mortgage and Consumer Banking, including Home Equity, Deposit Accounts, Credit Cards, Personal Lending, Auto Lending and more.', 'Novato, CA, United States', 540);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VFF', 'STOCK', 'Village Farms International, Inc.', 'NCM', 'Consumer Defensive', 'Farm Products', 'Village Farms International, Inc. is a vertically integrated supplier of plant-based consumer packaged goods in the cannabis and cannabidiol (CBD) categories in North America, the Netherlands, and selected markets internationally. Its segments include Produce, Cannabis-Canada, Cannabis-U.S., Clean Energy and Cannabis - Netherlands. Produce segment produces, markets and sells tomatoes, bell peppers and cucumbers. Cannabis-Canada produces and supplies cannabis products to be sold to other licensed providers and provincial governments across Canada and internationally. Cannabis-U.S. develops and sells CBD-based health and wellness products, including ingestible, edible and topical applications, across the United States. Clean Energy receives a royalty representing a portion of the natural gas that is sold to one customer pursuant to its long-term contract. Cannabis - Netherlands segment produces and supplies cannabis products in the Netherlands, supplying designated coffee shops.', 'Lake Mary, FL, United States', 1400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AWI', 'STOCK', 'Armstrong World Industries, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'A Armstrong World Industries, Inc. Projeta, inova e fabrica soluções de sistema de teto e parede. A empresa fabrica e fabrica produtos feitos de vários materiais, incluindo fibra mineral, lã de fibra de vidro, metal, madeira, fibra de madeira, gesso reforçado com vidro e feltro. Também fabrica produtos de sistema de suspensão de teto (grade). Seu segmento de Fibra Mineral produz sistemas de fibra mineral suspensa e teto de fibra macia. Seus produtos oferecem vários atributos de desempenho, como controle acústico, proteção contra incêndio nominal e eficiência energética. Seu segmento de especialidades arquitetônicas produz, projeta e fontes tetos, paredes e fachadas para uso em ambientes comerciais. Seus produtos estão disponíveis em metal, feltro e madeira, além de várias cores, formas e desenhos. Vende produtos padrão, premium e personalizados. Ela também está envolvida na conceção e fabricação de resinas arquitetônicas e vidro criadas de forma sustentável para tetos, paredes e outras', 'Lancaster, PA, United States', 3700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRTO', 'STOCK', 'Criteo S.A.', 'NMS', 'Communication Services', 'Advertising Agencies', 'Criteo SA is a France-based company specializing in digital performance marketing. Its solution consists of the Criteo Engine, the Company''s data assets, access to inventory, and its advertiser and publisher platforms. The Criteo Engine consists of various machine learning algorithms, such as prediction, recommendation, bidding and creative algorithms and the global hardware and software infrastructure. The Criteo Engine delivers advertisements through multiple marketing channels and formats, including display advertising banners, native advertising banners and marketing messages delivered to opt-in e-mail addresses. Advertisements are delivered on all devices and screens, including Web browsers on desktops and laptops, mobile Web browsers on smart phones and tablets, as well as mobile applications. It operates in approximately 90 countries through a network of over 30 international offices located in Europe, the Americas and the Asia-Pacific region.', 'Paris, , France', 3507);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BJ', 'STOCK', 'BJ''s Wholesale Club Holdings, Inc.', 'NYQ', 'Consumer Defensive', 'Discount Stores', 'BJs Wholesale Club Holdings, Inc. is an operator of membership warehouse clubs concentrated primarily on the eastern half of the United States. The Company provides a wide assortment of fresh foods, produce, a full-service deli, fresh bakery, household essentials and gas. It also offers technology, home decor, apparel, seasonal items, among others. It groups its merchandise offerings into two divisions: perishables, grocery and sundries, and general merchandise and services. Perishables, grocery, and sundries consist of meat, produce, dairy, deli and frozen products, packaged foods, beverages, detergents, disinfectants, paper products, beauty care, adult and baby care, and pet foods. General merchandise and services consist of electronics, apparel, seasonal goods, small appliances, televisions, furniture, optical, tires and third-party gift cards. It offers specialty services, such as full-service optical centers, tire installation services, a propane tank filling service, and others.', 'Marlborough, MA, United States', 33000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLT', 'STOCK', 'Applied Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Applied Therapeutics, Inc. is a clinical-stage biopharmaceutical company engaged in the development of drug candidates against validated molecular targets in rare diseases. The Companys lead drug candidate, govorestat, is a central nervous system penetrant Aldose Reductase Inhibitor (ARI) for the treatment of CNS rare metabolic diseases, including classic galactosemia, sorbitol dehydrogenase (SORD) deficiency and phosphomannomutase 2 (PMM2)-congenital disorder glycosylation (CDG). The Company is also developing AT-001, an investigational, ARI developed as an oral therapy for the treatment of diabetic cardiomyopathy (DbCM). It has completed a Phase I/II clinical trial evaluating AT-001 in approximately 120 patients with type II diabetes. The Companys pipeline also includes AT-003, an ARI designed to cross through the back of the eye when dosed orally, and has demonstrated strong retinal penetrance, for the treatment of diabetic retinopathy (DR).', 'New York, NY, United States', 36);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWIN', 'STOCK', 'The Baldwin Insurance Group, Inc.', 'NMS', 'Financial Services', 'Insurance Brokers', 'The Baldwin Insurance Group, Inc. is an independent insurance distribution company. The Companys business is divided into three operating groups: Insurance Advisory Solutions (IAS), Underwriting, Capacity & Technology Solutions (UCTS) and Mainstreet Insurance Solutions (MIS). The IAS operating group provides commercial risk management, employee benefits and private risk management solutions for businesses and high-net-worth individuals, as well as their families. The UCTS operating group consists of two distinct businesses, its MGA platform (MSI) and its reinsurance brokerage business, Juniper Re. Through MSI, it manufactures proprietary, technology-enabled insurance products that are then distributed internally via risk advisors across its other operating groups and externally via select distribution partners. The MIS operating group offers personal insurance, commercial insurance and life and health solutions to individuals and businesses in their communities.', 'Tampa, FL, United States', 4000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BANC', 'STOCK', 'Banc of California, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banc of California, Inc. is a bank holding company for its subsidiary, Banc of California (the Bank), a California state-chartered bank. The Bank offers a broad range of loan and deposit products and services through 80 full-service branches located throughout California and in Denver, Colorado, and Durham, North Carolina, as well as through regional offices nationwide. The Bank also provides full-stack payment processing solutions through its subsidiary, Deepstack Technologies, LLC (Deepstack). The Bank is organized into four business groups, such as Community Banking, Specialty Banking, Deposit Services, and Payment Solutions. Specialty Banking is focused on serving clients in niche verticals by industry, including homeowner associations, venture banking, SBA lending, mortgage warehouse lending, media and entertainment and equipment finance. Deposit Services provide valuable services to clients in the Community and Specialty Banking groups.', 'Los Angeles, CA, United States', 1903);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AER', 'STOCK', 'AerCap Holdings N.V.', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'AerCap Holdings N.V. is an Ireland-based company, which is primarily engaged in aviation leasing. It provides a range of assets for leasing, including narrowbody and widebody aircraft, regional jets, freighters, engines and helicopters. It provides 10 types of modern narrowbody and widebody cargo aircraft to over 20 customers around the world, including e-commerce, express delivery and general cargo operators. It is a lessor of spare engines, with over 1,000 engines, including engines owned and managed by Shannon Engine Support Ltd (SES), its joint venture with Safran Aircraft Engines, and over 150 customers. Its offer includes new and used commercial passenger and cargo aircraft, and helicopters, on operating lease from its existing fleet and order book. In addition, it offers aftermarket components, equipment and services through its materials business and the lease, purchase and financing of spare engines. Its portfolio consists of about 3,508 aircraft, engines and helicopters.', 'Dublin, , Ireland', 698);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLDR', 'STOCK', 'Builders FirstSource, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Builders FirstSource, Inc. is a supplier of structural building products, value-added components and services to the professional market for single-family and multi-family construction and repair and remodeling. The Company provides customers an integrated homebuilding solution, offering manufacturing, supply, delivery, and installation of a full range of structural and related building products. The Company groups its building products and services into four product categories: Manufactured Products; Windows, Doors and Millwork; Specialty Building Products and Services, and Lumber and Lumber Sheet Goods. Its manufactured products are factory-built substitutes for job-site framing and include wood floor and roof trusses, wall panels and engineered wood. Its specialty building products and services consist of various products, including vinyl, composite and wood siding, exterior trim, metal studs, cement and insulation. The Company operates in approximately 43 states with 590 locations.', 'Irving, TX, United States', 29000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACB', 'STOCK', 'Aurora Cannabis Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Aurora Cannabis Inc. is a Canada-based medical cannabis company. The Companys principal business lines are focused on the production, distribution and sale of cannabis and cannabis-derivative products in Canada and internationally, and the propagation of vegetables and ornamental plants in North America. Its segments include Canadian Cannabis and Plant Propagation. The Company''s adult-use brand portfolio includes Drift, San Rafael ''71, Daily Special, Tasty''s, Being and Greybeard. Its medical cannabis brands include MedReleaf, CanniMed, Aurora and Whistler Medical Marijuana Co, as well as international brands, Pedanios, Bidiol, IndiMed and CraftPlant. It also has a controlling interest in Bevo Farms Ltd., North America''s supplier of propagated vegetables and ornamental plants in North America. Its subsidiaries include Aurora Cannabis Enterprises Inc., Aurora Deutschland GmbH, TerraFarma Inc., Whistler Medical Marijuana Corporation, and Indica Industries Pty Ltd., among others.', 'Edmonton, AB, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOCS', 'STOCK', 'Doximity, Inc.', 'NYQ', 'Healthcare', 'Health Information Services', 'Doximity, Inc. Fornece uma plataforma digital para os profissionais médicos dos Estados Unidos. Ele fornece uma plataforma on-line, que permite que médicos e outros profissionais de saúde colaborem com seus colegas, mantenham-se atualizados com as últimas notícias médicas e pesquisas e gerenciem suas carreiras. Oferece soluções de Marketing, Contratação e Produtividade para fabricantes farmacêuticos, sistemas de saúde, empresas de recrutamento médico e outras empresas de saúde. Suas soluções de marketing permitem que seus clientes farmacêuticos e de sistemas de saúde obtenham o conteúdo, serviços e conexões entre pares certos com os profissionais médicos certos através de uma variedade de módulos. Suas soluções de contratação fornecem recursos de recrutamento digital para sistemas de saúde e empresas de recrutamento médico. Suas Soluções de Produtividade incluem suas ferramentas de telesaúde, agendamento on-call e correspondência médica com suporte a inteligência artificial (IA) e são ', 'San Francisco, CA, United States', 830);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CE', 'STOCK', 'Celanese Corporation', 'NYQ', 'Basic Materials', 'Chemicals', 'A Celanese Corporation é uma empresa global de materiais químicos e especiais. A empresa é um produtor global de polímeros projetados que são usados em uma variedade de aplicações. Seus segmentos incluem materiais projetados e a cadeia de acetil. O segmento de Materiais de Engenharia da Empresa inclui o negócio de Materiais de Engenharia e certas afiliadas estratégicas. O negócio de materiais projetados desenvolve, produz e fornece um amplo portfólio de polímeros especiais de alto desempenho para aplicações automotivas e médicas, bem como produtos industriais e eletrônicos de consumo. O segmento de Cadeia de Acetil da Companhia inclui a cadeia integrada de ácido acético, monômero de acetato de vinila (VAM), anidrido acético, ésteres de acetato, polímeros de emulsão, polímeros de acetato de vinilo de etileno (EVA), pós redispersíveis (RDP) e negócios de reboque de acetato. A cadeia de acetil produz e fornece produtos acetil, incluindo ácido acético, VAM, anidrido acético e ésteres de ac', 'Irving, TX, United States', 11000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EB', 'STOCK', 'Eventbrite, Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Eventbrite, Inc. is a global events marketplace that serves event creators and event-goers in approximately 180 countries. The Company''s two-sided marketplace connects creators and consumers every month to share their passions, artistry, and causes through live experiences. The Company leverages technology and the Eventbrite brand to engage audiences and connect them in ways that help maximize business opportunities for event creators and satisfy consumer demands. The Company''s self-service ticketing and marketing tools enable creators to plan, promote, and sell tickets to their events. The Company''s Website and mobile application allow event seekers to discover and purchase tickets to experiences they enjoy. Its subsidiaries include Eventbrite UK Limited, Eventbrite International, Inc., Eventbrite Operations (IE) Limited, Eventbrite Singapore Pte. Ltd., Eventioz Holdings, Inc., Eventbrite Hong Kong Limited and Eventbrite Technologies India Private Limited.', 'San Francisco, CA, United States', 748);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASB', 'STOCK', 'Associated Banc-Corp', 'NYQ', 'Financial Services', 'Banks - Regional', 'Associated Banc-Corp is a bank holding company. The Company, through Associated Bank and various nonbanking subsidiaries, provides an array of banking and nonbanking products and services to individuals and businesses through 188 banking branches, serving more than 100 communities, primarily within its three-state branch footprint. The Corporate and Commercial Specialty segment serves a wide range of customers, including larger businesses, developers, not-for-profits, municipalities, and financial institutions by providing lending and deposit solutions as well as the support to deliver, fund, and manage such banking solutions. The Community, Consumer and Business segment serves individuals and businesses by providing lending and deposit solutions and a variety of investment, fiduciary, and retirement planning products and services. The Risk Management and Shared Services segment includes key shared operational functions and also includes residual revenue and expenses.', 'Green Bay, WI, United States', 3993);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPLS', 'STOCK', 'AB Core Plus Bond ETF', 'NGM', NULL, NULL, 'The fund pursues its objective by investing, under normal circumstances, at least 80% of its net assets, including any borrowings for investment purposes, in fixed-income securities. It may invest in a broad range of debt securities, including corporate bonds and debt and mortgage- and other asset-backed securities issued by U.S. government-sponsored entities and federal agencies and instrumentalities that are not backed by the full faith and credit of the U.S. government.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZAI', 'STOCK', 'Blaize Holdings, Inc.', 'NGM', 'Technology', 'Software - Application', 'Blaize Holdings, Inc. is a provider of purpose-built, artificial intelligence (AI)-enabled edge computing solutions. The Company provides a full-stack programmable processor architecture suite and a low-code/no-code software platform that enables AI processing solutions for high-performance computing at the networks edge and in the data center. Its solutions deliver real-time insights and decision-making capabilities. Its products include Blaize Pathfinder, Blaize Xplorer platforms and the Blaize AI Software Suite. It includes Blaize Xplorer X1600E EDSFF Small Form Factor Accelerator, Blaize Xplorer X600M M.2 Small Form Factor Accelerator Platform, Blaize Xplorer X1600P PCIe Accelerator, Blaize Xplorer X1600P-Q PCIe Accelerator, Blaize Pathfinder P1600 Embedded System on Module, and Blaize Pathfinder 1600-DK Embedded Kit. Its AI Studio delivers AI-driven, application end-to-end data operations (DataOps), development operations (DevOps), and Machine Learning operations (MLOps) tools.', 'El Dorado Hills, CA, United States', 232);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIQ', 'STOCK', 'Global X Artificial Intelligence & Technology ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index. The underlying index is designed to track the performance of companies involved in the development and utilization of artificial intelligence ("AI") and big data. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNOW', 'STOCK', 'DNOW Inc.', 'NYQ', 'Industrials', 'Industrial Distribution', 'DNOW Inc. is a supplier of energy and industrial products and packaged, engineered process and production equipment. The Company offers a set of supply chain solutions combined with a suite of digital offerings branded as DigitalNOW that provides customers access to digital commerce, data, and information management channels. It is engaged in providing application systems, work processes, parts integration, optimization solutions and after-sales support that provide productive solutions for its customers. Its product offering includes pipe, manual and automated valves, fittings, flanges, gaskets, fasteners, electrical, instrumentation, artificial lift, pumping solutions and modular process, production, measurement, automation, control equipment, and consumable maintenance, repair and operating (MRO) supplies. It also offers sourcing, procurement, warehouse, and inventory management solutions as part of its supply chain and materials management offering.', 'Houston, TX, United States', 2575);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AISP', 'STOCK', 'Airship AI Holdings, Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'Airship AI Holdings, Inc. is a technology company. The Company offers an artificial intelligence (AI)-driven video, sensor and data management surveillance platform that improves public safety and operational efficiency for public sector and commercial customers by providing predictive analysis of events before they occur and meaningful intelligence to decision makers. Its product suite includes Outpost AI edge hardware and software offerings, the Acropolis enterprise management software stack, and the Command family of visualization tools. It specializes in ingesting all available metadata from edge-based sensors used by government and law enforcement agencies around the world, including surveillance cameras (video), audio, telemetry, acoustic, seismic, and autonomous devices, along with large commercial corporations with fundamentally similar capabilities and requirements. Its offerings allow customers to manage their data across the full data lifecycle, when and where they need it.', 'Redmond, WA, United States', 55);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANY', 'STOCK', 'Sphere 3D Corp.', 'NCM', 'Financial Services', 'Capital Markets', 'Sphere 3D Corp. is a Canada-based bitcoin mining company. The Company is engaged with Bitcoin mining pool operators, its customers, to provide a service to perform hash calculations for the mining pool operator. It is engaged in digital asset mining operation through the capital-efficient procurement of next generation mining equipment and partnering with data center operators.', 'Stamford, CT, United States', 2);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHKP', 'STOCK', 'Check Point Software Technologies Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'A Check Point Software Technologies Ltd é uma empresa com sede em Israel envolvida principalmente no setor de segurança cibernética. A empresa se concentra no fornecimento de soluções de segurança baseadas em IA e entregues na nuvem para proteger empresas e governos em todo o mundo. Seu principal produto é a Check Point Infinity Architecture, que é uma plataforma abrangente de segurança cibernética. A Plataforma visa defender-se contra ataques cibernéticos de quinta geração em várias redes, endpoints, ambientes de nuvem, cargas de trabalho, Internet das Coisas (IoT) e dispositivos móveis. Além disso, a empresa oferece uma gama de produtos e serviços projetados para proteger a INFRAESTRUTURA DE TI. Ele integra tecnologias avançadas de prevenção de ameaças, incluindo firewall, sistema de prevenção de intrusão (IPS), antivírus, anti-bot e recursos de sandboxing.', 'Tel Aviv, , Israel', 6669);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ERAS', 'STOCK', 'Erasca, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Erasca, Inc. is a clinical-stage precision oncology company. The Company is focused on discovering, developing, and commercializing therapies for patients with RAS/MAPK pathway-driven cancers. The Company has assembled RAS/MAPK pathway-focused pipeline in the industry, consisting of modality-agnostic programs aligned with its three therapeutic strategies of: targeting key upstream and downstream signaling nodes in the RAS/MAPK pathway; targeting RAS directly; and targeting escape routes that emerge in response to treatment. Its pipeline includes one clinical-stage program (a pan-RAF inhibitor), two IND-enabling stage programs (a pan-RAS molecular glue and a pan-KRAS inhibitor), and an additional discovery-stage program (an EGFR D2/D3 biparatopic antibody). Its lead product candidate is naporafenib, the Company initiated its SEACRAFT-2 pivotal Phase III trial for patients with NRAS-mutated (NRASm) melanoma.', 'San Diego, CA, United States', 103);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASMG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long ASML Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLCO', 'STOCK', 'Bausch + Lomb Corporation', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Bausch + Lomb Corporation is an eye health company. It operates through three segments: Vision Care, Pharmaceuticals, and Surgical. Vision Care segment includes both a contact lens and a consumer eye care business that consists of contact lens care products, over-the-counter eye drops and eye vitamins. Pharmaceuticals segment consists of generic pharmaceutical products for post-operative treatments and treatments for a number of eye conditions, such as glaucoma, eye inflammation, ocular hypertension, dry eyes and retinal diseases. Surgical segment consists of medical device equipment, consumables, instruments and technologies for the treatment of cataracts, corneal and vitreous and retinal eye conditions, which includes delivery systems, phacoemulsification equipment and other surgical instruments and devices for cataract surgery. Its brands consist of PreserVision, Biotrue, Artelac, Alaway, Mioclear, Ocuvite, ScoutPro, XIIDRA, Vyzulta, Lotemax, Prolensa, Minims, INFUSE, and many more.', 'Vaughan, ON, Canada', 13500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MIST', 'STOCK', 'Milestone Pharmaceuticals Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Milestone Pharmaceuticals Inc. is a Canada-based biopharmaceutical company. The Company is focused on the development and commercialization of cardiovascular medicines. Its lead product candidate, etripamil, is a potent rapid-onset calcium channel blocker that the Company designed and is developing as a rapid-onset nasal spray to be administered by patients. The Company is also focused on developing etripamil to treat paroxysmal supraventricular tachycardia, atrial fibrillation, and other cardiovascular indications.', 'Montreal, QC, Canada', 33);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGEN', 'STOCK', 'Agenus Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Agenus Inc. is a clinical-stage biotechnology company specializing in discovering and developing therapies to activate the body''s immune system against cancer and infections. The Companys pipeline includes immune-modulatory antibodies, adoptive cell therapies (via MiNK Therapeutics, Inc.), and vaccine adjuvants (via SaponiQx, Inc.). Its primary focus is immuno-oncology (I-O), and its diverse pipeline is supported by its in-house capabilities, including current good manufacturing practice (cGMP) manufacturing and a clinical operations platform. Its most advanced antibody candidates are botensilimab (a multifunctional immune cell activator and human Fc-enhanced cytotoxic T-lymphocyte antigen 4 (CTLA-4) blocking antibody) and balstilimab (a novel, fully human monoclonal immunoglobulin G4 (IgG4) PD-1 inhibitor). Its pipeline includes several classes of immunotherapies: checkpoint inhibitors, immune activators, and tumor microenvironment conditioning agents.', 'Lexington, MA, United States', 316);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBLG', 'STOCK', 'FibroBiologics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'FibroBiologics, Inc. is a clinical-stage biotechnology company. The Company is focused on developing and commercializing fibroblast-based therapies for patients suffering from chronic diseases with significant unmet medical needs, including wound healing, multiple sclerosis, degenerative disc disease, psoriasis and certain cancers, and potential human longevity applications including thymic involution reversal. Its product candidates include CybroCell, CYMS101 and CYWC628. CybroCell is an allogeneic fibroblast cell-based therapy for degenerative disc disease. This technology is being designed as an alternative method for repairing the cartilage of the intervertebral disc (or any other articular cartilage). It is developing CYMS101 as an allogeneic fibroblast cell-based therapy to treat multiple sclerosis (MS) and has completed the Phase I study. It is developing CYWC628 as an allogeneic fibroblast cell-based therapy for wound healing. Its CYPS317 is used for the treatment of Psoriasis.', 'Houston, TX, United States', 13);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXPD', 'STOCK', 'Expeditors International of Washington, Inc.', 'NYQ', 'Industrials', 'Integrated Freight & Logistics', 'A Expeditors International of Washington, Inc. É uma empresa global de logística. Os serviços da Companhia incluem consolidação ou encaminhamento de frete aéreo e marítimo, corretagem alfandegária, consolidação de fornecedores, seguro de carga, transporte com prazo definido, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias e transporte de mercadorias. gestão de pedidos, armazenagem e distribuição e soluções logísticas personalizadas. Os principais serviços da Companhia incluem serviços de frete aéreo, serviços de frete marítimo e marítimo, corretagem aduaneira e outros serviços. Oferece um conjunto completo de serviços globais de logística, oferecendo aos clientes acesso a uma rede internacional de pessoas e sistemas de informação integrados para apoiar o movimento e posicionamento estratégico de mercadorias. Como fornecedor de logística terceirizado, compra espaço de carga de transportadoras em uma ba', 'Bellevue, WA, United States', 19666);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DD', 'STOCK', 'DuPont de Nemours, Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A DuPont de Nemours, Inc. Fornece materiais e soluções baseados em tecnologia. Seu segmento de Eletrônica e Industrial é um fornecedor global de materiais e sistemas diferenciados para uma gama de eletrônicos de consumo, incluindo dispositivos móveis, monitores de televisão, computadores pessoais e eletrônicos usados em uma variedade de indústrias. O segmento fornece materiais e soluções para a fabricação e embalagem de semicondutores e circuitos integrados e fornece soluções para gestão térmica e processos de blindagem eletromagnética e metalização para aplicações de acabamento metálico, decorativo e industrial. O seu segmento de Água e Proteção fornece produtos de engenharia e sistemas integrados para uma série de indústrias, incluindo segurança dos trabalhadores, purificação e separação de água, aeroespacial, energia, embalagens médicas e materiais de construção. Suas marcas incluem NOMEX, KEVLAR, TYVEK, FILMTEC, AMBERLITE, e ISOPOR. Ele também oferece capacidades avançadas de fabri', 'Wilmington, DE, United States', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELS', 'STOCK', 'Equity LifeStyle Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Residential', 'A Equity lifestyle Properties, Inc. É uma confiança de investimento imobiliário auto-administrada e auto-gerida (REIT). A empresa é proprietária totalmente integrada de propriedades orientadas para o estilo de vida, que consistem em operações de propriedade e vendas e operações de locação em casas manufaturadas (MH) e veículos recreativos (RV) comunidades e marinas. Atua através de dois segmentos: Operações de Propriedade e Operações de Vendas e Aluguel de Casas. O segmento de Operações de Propriedade possui e opera Propriedades arrendadas por terra. O segmento Home Sales and Rentals Operations compra, vende e aluga casas nas Propriedades. Seu portfólio é geograficamente diversificado em locais desejáveis perto de destinos de aposentadoria e férias e áreas urbanas em todos os Estados Unidos. Possui um interesse em um portfólio de aproximadamente 452 propriedades localizadas em todos os Estados Unidos e Canadá, contendo 173 201 áreas desenvolvidas individualmente (sites). Estas propried', 'Chicago, IL, United States', 3800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CERT', 'STOCK', 'Certara, Inc.', 'NMS', 'Healthcare', 'Health Information Services', 'Certara, Inc. is a provider of biosimulation technology and solutions for using Model-Informed Drug Development (MIDD) in the global biopharmaceutical industry. It accelerates medicine using biosimulation software, technology and services to transform traditional drug discovery and development. It delivers software products and technology-driven services to customers to carry out and realize the full benefits of biosimulation in drug discovery, preclinical and clinical research, regulatory submissions and market access. Its regulatory science and market access software and services, such as regulatory submissions software, natural language processing and Bayesian analytics. It offers both mechanistic and empirical biosimulation solutions providing clients with a comprehensive offering based on their therapy goals, mechanism of action, and available data sources. Its clients include 2,400 biopharmaceutical companies, academic institutions and regulatory agencies across 70 countries.', 'Radnor, PA, United States', 1487);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AROC', 'STOCK', 'Archrock, Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Archrock, Inc. is an energy infrastructure company with a primary focus on midstream natural gas compression. The Company is a provider of natural gas compression services to customers in the energy industry throughout the United States. It is a supplier of aftermarket services to customers that own compression equipment. Its segments include Contract Operations and Aftermarket Services. The Contract Operations business is comprised of its owned fleet of natural gas compression equipment that it uses to provide operations services to its customers. The aftermarket services business provides a full range of services to support the compression needs of its customers that own compression equipment, including operations, maintenance, overhaul and reconfiguration services and sales of parts and components. The Company provides comprehensive contract operations services, such as personnel, equipment, tools, materials and supplies to meet its customers natural gas compression needs.', 'Houston, TX, United States', 1300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECC', 'STOCK', 'Eagle Point Credit Company Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Eagle Point Credit Company Inc. is a closed ended fund launched and managed by Eagle Point Credit Management LLC. It invests in fixed income markets of the United States. The fund invests equity and junior debt tranches of collateralized loan obligations consisting primarily of below investment grade U.S. senior secured loans. Eagle Point Credit Company Inc. was formed on March 24, 2014 and is domiciled in the United States.', 'Greenwich, CT, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAWN', 'STOCK', 'Day One Biopharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Day One Biopharmaceuticals, Inc. is a commercial-stage biopharmaceutical company focused on developing and commercializing targeted therapies for people of all ages with life-threatening diseases. The Company partners with clinical oncologists, families, and scientists to identify, acquire, and develop cancer treatments. The Companys commercial product, OJEMDA (tovorafenib), is an oral, brain-penetrant, selective type II rapidly accelerated fibrosarcoma (RAF) kinase inhibitor of mutant BRAF V600, wild-type BRAF, and wild-type CRAF kinases. Its pipeline product candidates include DAY301 and VRK1 program. The DAY301 candidate is a PTK7 targeted ADC composed of a novel humanized anti-PTK7 immunoglobulin G1 monoclonal antibody (mAb), conjugated with a topoisomerase I inhibitor through a stable and hydrophilic modified valine-alanine (VA) cleavable linker. Its VRK1 program is a novel target involved in the regulation of cell division and DNA damage repair.', 'Brisbane, CA, United States', 182);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AHR', 'STOCK', 'American Healthcare REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'A American HEALTHCARE REIT, Inc. É uma confiança de investimento imobiliário que adquire, possui e opera um portfólio diversificado de imóveis de saúde clínica, com foco principalmente em residências seniores, instalações de enfermagem especializadas, edifícios médicos ambulatoriais (OM) e outras instalações relacionadas à saúde em todos os Estados Unidos, Reino Unido e Ilha de Man Possui e opera seus campi de saúde sênior integrados e propriedades operacionais de habitação sênior (loja). Seus segmentos incluem campus de saúde sênior integrados, OM, LOJA e propriedades alugadas triple-net. Seus edifícios OM são alugados a vários inquilinos sob arrendamentos separados. Seus campi de saúde sênior integrados fornecem uma gama de vida independente, vida assistida, cuidados de memória, serviços de enfermagem qualificados e negócios auxiliares. O seu segmento de propriedades alugadas triplas inclui habitação sénior, instalações de enfermagem especializadas e hospitais. Seu segmento DE loja i', 'Irvine, CA, United States', 114);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUB', 'STOCK', 'Atlantic Union Bankshares Corporation', 'NYQ', 'Financial Services', 'Banks - Regional', 'Atlantic Union Bankshares Corporation is the holding company for Atlantic Union Bank (the Bank), which provides banking and related financial products and services to consumers and businesses. The Bank has branches and ATMs located in Virginia, Maryland and North Carolina. It operates through two segments: Wholesale Banking and Consumer Banking. Its Wholesale Banking segment provides loan, leasing, and deposit services, as well as treasury management and capital market services to wholesale customers primarily throughout Virginia, Maryland, North Carolina, and South Carolina. These customers include commercial and industrial customers. This segment also includes its equipment finance subsidiary and its wealth management business. Its Consumer Banking segment provides loan and deposit services to consumers and small businesses throughout Virginia, Maryland, and North Carolina. Consumer Banking includes the home loan division and investment management, and advisory services businesses.', 'Glen Allen, VA, United States', 3160);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALC', 'STOCK', 'Alcon Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'A Alcon AG é uma empresa de oftalmologia sediada na Suíça. A Companhia pesquisa, desenvolve, fabrica, distribui e vende um conjunto completo de produtos para cuidados com os olhos em dois negócios principais: Cirúrgico e Vision Care. O negócio Cirúrgico da Companhia é focado em produtos oftálmicos para cirurgia de catarata, cirurgia vitreorretiniana, cirurgia refrativa a laser e cirurgia de glaucoma. O portfólio cirúrgico inclui implantáveis, consumíveis e equipamentos cirúrgicos necessários para esses procedimentos e atende às necessidades do cirurgião oftalmologista de ponta a ponta. O negócio Vision Care da Companhia compreende lentes de contato diárias descartáveis, reutilizáveis e que melhoram as cores e um portfólio de produtos de saúde ocular, incluindo produtos para olho seco, alergias oculares, glaucoma e cuidados com lentes de contato, bem como vitaminas oculares e aliviadores de vermelhidão. A empresa opera em 60 países e atende consumidores e pacientes em mais de 140 países', 'Geneva, , Switzerland', 25000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMEA', 'STOCK', 'Biomea Fusion, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Biomea Fusion, Inc. is a clinical-stage diabetes and obesity medicines company focused on the discovery and development of oral covalent small molecules to improve the lives of patients with diabetes, obesity, and metabolic diseases. A covalent small molecule is a synthetic compound that forms a permanent bond to its target protein. The Company has built its proprietary FUSION System discovery platform to advance a pipeline of small molecule product candidates. Its lead clinical programs drug candidate, icovamenib, is being developed as an orally bioavailable, and selective covalent inhibitor of menin in two clinical and multiple preclinical studies, investigating icovamenibs potential in type 1 and type 2 diabetes, as well as its impact in obesity. Its second product candidate BMF-650, is an investigational, oral small-molecule glucagon-like peptide-1 receptor agonists (GLP-1 RA), for the treatment of diabetes and obesity.', 'San Carlos, CA, United States', 63);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZU', 'STOCK', 'Direxion Daily AMZN Bull 2X Shares', 'NGM', NULL, NULL, 'The fund will enter into one or more swap agreements with major global financial institutions whereby the fund and the global financial institution will agree to exchange the return earned on an investment by The fund invests in AMZN that is equal, on a daily basis, to 200% of the value of the fund''s net assets. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNLI', 'STOCK', 'Denali Therapeutics Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Denali Therapeutics Inc. É uma empresa biofarmacêutica. A empresa está focada no desenvolvimento de um portfólio de candidatos a produtos projetados para cruzar a barreira hematoencefálica (BBB) para doenças neurodegenerativas e doenças de armazenamento lisossômico. A empresa possui um portfólio de medicamentos de pequena molécula e bioterapêutica, compreendendo sete candidatos a produtos em desenvolvimento clínico em sete indicações, bem como candidatos terapêuticos pré-clínicos. Seus três programas de desenvolvimento em estágio tardio incluem tividenofusp alfa (DNL310) para mucopolissacaridose II (MPS II); BIIB122/DNL151 (inibidor LRRK2) para doença de Parkinson; e DNL343 (ativador eIF2B) para esclerose lateral amiotrófica (ELA). SAR443820/DNL788 (inibidor de RIPK1) está sendo avaliado em um estudo de Fase II para esclerose múltipla (EM). Além disso, tem um estudo de Fase I/II de TAK-594/DNL593 para demência-granulina frontotemporal (FTD-GRN) e um estudo de Fase I/II de DNL126 para M', 'South San Francisco, CA, United States', 422);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVAC', 'STOCK', 'CureVac N.V.', 'NGM', 'Healthcare', 'Biotechnology', 'CureVac NV, formerly CureVac AG, is a Germany-based clinical-stage biopharmaceutical company. The Company develops transformative medicines based on messenger ribonucleic acid, or mRNA. The Company''s mRNAs are designed to prevent infections and to treat diseases by mimicking human biology to synthesize the desired proteins. Its technology platform optimizes mRNA constructs that encode functional proteins which either induce a desired immune response or replace defective or missing proteins using the cells intrinsic translation machinery. The Company''s product portfolio includes clinical and preclinical candidates across multiple disease indications in prophylactic vaccines, oncology, and molecular therapy. In prophylactic vaccines, the Company is advancing its second-generation mRNA backbone against Severe Acute Respiratory Syndrome Coronavirus 2 (SARS-CoV-2) and a range of infectious diseases, including seasonal influenza, in collaboration with GSK(Glaxo Smith Kline).', 'Tübingen, , Germany', 825);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHRW', 'STOCK', 'C.H. Robinson Worldwide, Inc.', 'NMS', 'Industrials', 'Integrated Freight & Logistics', 'C.H. Robinson Worldwide, Inc. É um fornecedor global de logística. Os segmentos da empresa incluem transporte de superfície norte-americano (NAST), Global Forwarding e todos os outros e corporativos. A NAST Segment fornece serviços de transporte e logística em toda a América do Norte através de uma rede de escritórios nos Estados Unidos, Canadá e México. Os serviços DA NAST Segment incluem carga de caminhão e serviços de corretagem de transporte de carga de caminhão. Global Forwarding Segment fornece serviços de transporte e logística através de uma rede internacional de escritórios na América do Norte, Europa, Ásia, Oceania, América do Sul, e o Oriente Médio e também contratos com agentes independentes em todo o mundo. Os serviços do segmento Global Forwarding incluem serviços de frete marítimo, serviços de frete aéreo e corretagem aduaneira. Todo o outro segmento e Corporate inclui Robinson Fresh e Managed Solutions. Robinson Fresh fornece serviços de sourcing. Em seu negócio de Solu', 'Eden Prairie, MN, United States', 13166);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBS', 'STOCK', 'Emergent BioSolutions Inc.', 'NYQ', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Emergent BioSolutions, Inc. is a life sciences company. It is focused on providing preparedness and response solutions addressing accidental, deliberate and naturally occurring public health threats. Its solutions include a product portfolio, a product development portfolio, and a contract development and manufacturing services portfolio. Its segments include Commercial Products, MCM Products, and Services segment. Its Commercial Product segment consists of NARCAN Nasal Spray. Its MCM Products segment consists of Anthrax MCM products, Smallpox MCM products and Other Products. Its Services segment consists of its Bioservices portfolio. NARCAN (naloxone HCl) Nasal Spray, an intranasal formulation of naloxone, is developed for the emergency treatment of known or suspected opioid overdose as manifested by respiratory and central nervous system depression. Its Bioservices consist of development services, bulk drug substance manufacturing, fill, finish, and packaging of final drug products.', 'Gaithersburg, MD, United States', 900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CENX', 'STOCK', 'Century Aluminum Company', 'NMS', 'Basic Materials', 'Aluminum', 'Century Aluminum Company is a global producer of primary aluminum and operates aluminum reduction facilities, or smelters. The Company''s annual production capacity is approximately 1,020,000 tons per year (tpy). It owns a carbon anode production facility located in the Netherlands (Vlissingen). Carbon anodes are consumed in the production of primary aluminum. Vlissingen supplies carbon anodes to its aluminum smelter in Grundartangi, Iceland. Each of its aluminum smelters in the United States produces anodes at on-site facilities. Through its Natur-Al product line, it provides low-carbon aluminum products. It operates three United States aluminum smelters, in Hawesville, Kentucky (Hawesville), Robards, Kentucky (Sebree) and Goose Creek, South Carolina (Mt. Holly), and one aluminum smelter in Grundartangi, Iceland (Grundartangi). The Grundartangi facility, is an aluminum reduction facility owned and operated by the Companys wholly owned subsidiary, Nordural Grundartangi ehf.', 'Chicago, IL, United States', 2971);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EYE', 'STOCK', 'National Vision Holdings, Inc.', 'NMS', 'Consumer Cyclical', 'Specialty Retail', 'National Vision Holdings, Inc. is an optical retail company in the United States with over 1,200 stores in 38 states and Puerto Rico. The Company operates four retail brands: America''s Best Contacts & Eyeglasses, Eyeglass World, and Vista Opticals, inside select Fred Meyer stores and on select military bases. The Company''s segment includes Owned & Host. The Company, through its subsidiary, FirstSight Vision Services, Inc., is licensed as a single-service health plan under California law and issues individual vision plans in connection with its America''s Best operations in California. It offers two products and one service, such as eyeglasses, contact lenses and eye exams. The Companys e-commerce consumer Website, DiscountContacts.com, offers a range of services to customers, including eyeglass purchasing, online scheduling and appointment reminders, contact lens purchasing, buy-in-store and ship-to-home capabilities and online frame browsing, among others.', 'Duluth, GA, United States', 13411);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARM', 'STOCK', 'Carisma Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Carisma Therapeutics Inc. is a clinical-stage biopharmaceutical company focused on macrophage engineering to develop transformative therapies to treat serious diseases including liver fibrosis and cancer. The Company seeks to apply the ability to engineer macrophages and monocytes, either in vivo or ex vivo. Its proprietary chimeric antigen receptor macrophages(CAR-M) platform uses CARs to redirect macrophages or monocytes against specific tumor associated antigens with the goal of targeted antitumor immunity. It is developing a pipeline of product candidates which includes CT-1119, In Vivo CAR-Macrophage: GPC3+ Solid Tumors, In Vivo CAR-Macrophage: Oncology Targets, and CT-2401 (Liver Fibrosis). CT-2401 is a product candidate in development for liver fibrosis, and CT-1119 is a mesothelin-targeted CAR-Monocyte that is designed to treat patients with advanced mesothelin-positive solid tumors, including pancreatic cancer, ovarian cancer, lung cancer, mesothelioma, and others.', 'Philadelphia, PA, United States', 46);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTLP', 'STOCK', 'Cantaloupe, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Cantaloupe, Inc. is a global provider of technology solutions for self-service commerce. The Companys vertically integrated solutions fuel growth by offering micro-payments processing, enterprise cloud software, IoT technology, as well as kiosk and POS innovations. It offers a variety of solutions for self-service commerce, which enable the acceptance of digital payments and allow its customers to simplify inventory, analytics, warehouse, logistics, and back-office management. Its hardware includes Cantaloupe card readers, the Companys integrated payment device, as well as Cantaloupe Go POS kiosks, the Companys range of POS terminals, which are both deployed in self-service, applications, such as vending, micro-markets, amusement, air/vacuum, car wash, and others. Its Cantaloupe Go product line provides a variety of self-checkout kiosks. Its solutions are used by a variety of consumer services in the United States, the United Kingdom, European Union countries, Australia, and Mexico.', 'Malvern, PA, United States', 375);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWA', 'STOCK', 'BorgWarner Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'BorgWarner Inc. Está envolvida em soluções de tecnologia limpa para veículos de combustão, híbridos e elétricos. A Companhia atua em quatro segmentos. As tecnologias da Turbos & Thermal Technologies incluem turbocompressores, e-boosters, e-turbos, sistemas de emissões, sistemas térmicos, tecnologia de ignição a gasolina, atuadores remotos inteligentes, sensores do grupo motopropulsor, entre outros. Os produtos do segmento Drivetrain & Morse Systems incluem módulos de controle, produtos de embreagem mecânica e de fricção para transmissões automáticas, produtos de gerenciamento de torque e sistemas de caixa de transferência de tração traseira (RWD) e tração integral (AWD) e sistemas de acoplamento. Os produtos do segmento Powerdrive Systems incluem eletrônicos de energia, como inversores, carregadores de bordo, conversores DC/DC e caixas de combinação, entre outros. Os produtos do segmento de baterias e sistemas de carregamento incluem sistemas de baterias de iões de lítio para aplicaçõe', 'Auburn Hills, MI, United States', 38300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATI', 'STOCK', 'ATI Inc.', 'NYQ', 'Industrials', 'Metal Fabrication', 'ATI Inc. is a global manufacturer of technically advanced specialty materials and complex components. The Company produces specialty materials, highly differentiated by its materials science expertise and advanced process technologies. It produces high-performance materials and solutions for the global aerospace and defense markets, and has critical applications in electronics, medical and specialty energy. The Companys segment includes High Performance Materials & Components (HPMC) and Advanced Alloys & Solutions (AA&S). The HPMC segment produces a wide range of high-performance materials, components, and advanced metallic powder alloys. These products are made from nickel-based alloys and superalloys, titanium and titanium-based alloys, and a variety of other specialty materials. The AA&S segment produces nickel-based alloys, titanium and titanium-based alloys, and specialty alloys in a variety of forms, including plate, sheet, and strip products.', 'Dallas, TX, United States', 7700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAM', 'STOCK', 'Brookfield Asset Management Ltd.', 'NYQ', 'Financial Services', 'Asset Management', 'Brookfield Asset Management Ltd. is a global alternative asset manager. The Company invests client capital for the long-term with a focus on real assets and essential service businesses that form the backbone of the global economy. It offers a range of alternative investment products to investors around the world including public and private pension plans, endowments and foundations, sovereign wealth funds, financial institutions, insurance companies and private wealth investors. Its products have three categories, which include long-term private funds, permanent capital vehicles and perpetual strategies, and liquid strategies. These are invested across five principal strategies: renewable power and transition, infrastructure, real estate, private equity, and credit.', 'New York, NY, United States', 2500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMGN', 'STOCK', 'Amgen Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - General', 'Amgen Inc. É uma empresa de biotecnologia. Descobre, desenvolve, fabrica e fornece medicamentos para as doenças mais difíceis. Ele se concentra em áreas de alta necessidade médica não atendida e aproveita sua expertise para buscar soluções que melhorem a vida das pessoas. Atua no segmento terapêutico humano. Seu portfólio de produtos comercializados inclui EPOGEN (epoetin alfa); Aranesp (darbepoetin alfa); Parsabiv (etelcalcetide); Neulasta (pegfilgrastim); KANJINTI (trastuzumab-anns); Otezla; BLINCYTO (blinatumomab); Actimmune (interferon gamma-1b); Neulasta (pegfilgrastim); Sensipar/Mimpara (cinacalcet); Prolia (denosumab); ENBREL; QUINSAIR (levofloxacina); Repatha (evolocumab) e outros. Comercializa ENBREL, um bloqueador de fatores de necrose tumoral, nos Estados Unidos e no Canadá. Comercializa Otezla, uma pequena molécula que inibe a fosfodiesterase 4, em muitos países ao redor do mundo. Comercializa o Repatha, um inibidor de subtilisina/kexin tipo 9 (PCSK9) da proproteína convert', 'Thousand Oaks, CA, United States', 28000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CECO', 'STOCK', 'CECO Environmental Corp.', 'NMS', 'Industrials', 'Pollution & Treatment Controls', 'CECO Environmental Corp. is an environmentally focused, diversified industrial company. The Company serves a broad landscape of industrial air, industrial water and energy transition markets globally, providing solutions and application expertise. Its Engineered System segment serves the power generation, hydrocarbon processing, water/wastewater treatment, oily water separation and treatment, marine and naval vessels, and midstream oil and gas sectors. The segment seeks to address the global demand for environmental and equipment protection solutions with its engineered platforms, including emissions management, fluid bed cyclones, thermal acoustics, separation and filtration, and dampers and expansion joints. Its Industrial Process Solutions segment serves the industrial sector with solutions for air pollution and contamination control, and process filtration in applications, such as aluminum beverage can production, automobile production, electronics production, and other markets.', 'Addison, TX, United States', 1600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AWK', 'STOCK', 'American Water Works Company, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Water', 'A American Water Works Company, Inc. É uma empresa de serviços públicos de água e águas residuais. O negócio principal da Companhia envolve a propriedade de serviços públicos que fornecem serviços de água e esgoto para clientes residenciais, comerciais, industriais, de autoridade pública, de serviço de incêndio e de venda para revenda. Também opera outras empresas que fornecem serviços de água e esgoto ao governo dos Estados Unidos em instalações militares, bem como municípios. A Companhia opera seus negócios por meio do segmento de negócios regulamentados. O segmento de negócios regulamentados inclui subsidiárias que prestam serviços de água e esgoto a clientes em aproximadamente 14 estados. Os serviços públicos da empresa operam em estados como Geórgia, Havaí, Indiana, Iowa, Kentucky, Maryland, Tennessee, Virgínia e Virgínia Ocidental. A empresa também atende clientes comerciais, clientes de serviços de incêndio, clientes industriais, autoridades públicas, outros serviços públicos e ', 'Camden, NJ, United States', 6700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLMN', 'STOCK', 'Bloomin'' Brands, Inc.', 'NMS', 'Consumer Cyclical', 'Restaurants', 'Bloomin Brands, Inc. is a casual dining restaurant company. It has four founder-inspired brands: Outback Steakhouse, Carrabbas Italian Grill, BonefishGrill, and Flemings Prime Steakhouse & Wine Bar. The Companys segment includes U.S. and International Franchise. Outback Steakhouse is a casual steakhouse restaurant concept focused on steaks, bold flavors and Australian decor. Carrabbas Italian Grill offers authentic Italian cuisine passed down from its founder''s family recipes. Bonefish Grill specializes in fish from around the world, hand-cut in-house every day, savory wood-grilled specialties, and locally created seasonal partner selection dishes. Flemings Prime Steakhouse & Wine Bar is a contemporary interpretation of the classic American steakhouse, boasting culinary mastery, signature style and unrivaled attentive service to create memorable dining experiences for guests. The Company owns, operates, and franchises over 1,450 restaurants in 46 states, Guam and 12 countries.', 'Tampa, FL, United States', 81000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALGN', 'STOCK', 'Align Technology, Inc.', 'NMS', 'Healthcare', 'Medical Instruments & Supplies', 'A Align Technology, Inc. É uma empresa global de dispositivos médicos que projeta, fabrica e vende o sistema Invisalign de alinhadores transparentes, scanners intraorais iTero e software de design assistido por computador exocad e fabricação assistida por computador (CAD/CAM) para ortodontia digital e odontologia restaurativa. A empresa fornece a Align Digital Platform. Seus segmentos incluem Clear Aligner e Imaging Systems e CAD/CAM Services (Sistemas e Serviços). O segmento Clear Aligner consiste em produtos abrangentes, produtos não abrangentes e produtos não-Case. Seus produtos abrangentes incluem Invisalign Abrangente e Invisalign primeiro. Os produtos não-Case da Empresa incluem produtos de retenção, treinamento Invisalign e ferramentas de ajuste. Oferece até quatro conjuntos de alinhadores transparentes personalizados chamados retentores Vivera. O segmento de Sistemas e Serviços consiste em seus sistemas de escaneamento intraoral iTero. Seus serviços incluem software de assinatu', 'Tempe, AZ, United States', 21485);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALV', 'STOCK', 'Autoliv, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Autoliv, Inc. is a developer, manufacturer, and supplier of safety systems to the automotive industry with a range of product offerings, primarily passive safety systems. Passive safety systems include modules and components for frontal-impact airbag protection systems, side-impact airbag protection systems, seatbelts, steering wheels, inflator technologies and battery cut-off switches. The Company also develops and manufactures mobility safety solutions, such as pedestrian protection, battery cut-off switches, connected safety services and safety solutions for riders of powered two wheelers. The Company has one operating segment, which includes Autolivs airbag and seatbelt products and components. Its subsidiaries include Autoliv AB and Autoliv ASP, Inc. The Company operates its business in geographical regions, such as Europe, the Americas, China, Japan, and the Rest of Asia (ROA). The Company has approximately 62 production facilities in 25 countries.', 'Stockholm, , Sweden', 59241);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASO', 'STOCK', 'Academy Sports and Outdoors, Inc.', 'NMS', 'Consumer Cyclical', 'Specialty Retail', 'Academy Sports and Outdoors, Inc. É uma loja de artigos esportivos de linha completa e recreação ao ar livre nos Estados Unidos. A variedade de produtos da empresa está focada em categorias-chave de outdoor, vestuário, esportes e recreação, e calçados através de marcas nacionais e um portfólio de 19 marcas de marca própria. Tem acesso preferencial a marcas nacionais, como Nike, Under Armour, adidas, Winchester, etc. Columbia Sportswear, Brooks, Skechers, Yeti e Carhartt. Seu portfólio de marca de marca privada consiste em Academy Sports e Outdoor, Magellan Outdoors, BCG, O''rageous, Game Winner, Outdoor Gourmet, livremente e R.O.W. Seus principais tipos de produtos incluem refrigeradores e bebedouros, acessórios de camping e equipamentos de camping; equipamentos de fitness, acessórios de fitness e suprimentos de nutrição; vestuário exterior, vestuário sazonal, denim, vestuário de trabalho, t-shirts gráficas e acessórios; sapatos casuais, chinelos, calçado sazonal, meias; calçado para m', 'Katy, TX, United States', 22000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRS', 'STOCK', 'Leonardo DRS, Inc.', 'NMS', 'Industrials', 'Aerospace & Defense', 'Leonardo DRS, Inc. is a provider of advanced defense technology to the United States national security customers and allies around the world. It specializes in the design, development and manufacture of advanced sensing, network computing, force protection, and electric power and propulsion, and other mission-critical technologies. It is a provider of defense products and technologies that are used across land, air, sea, space, and cyber domains. Its segments include Advanced Sensing and Computing (ASC) and Integrated Mission Systems (IMS). The ASC segment designs, develops, and manufactures sensing and network computing technology that enables real-time situational awareness required for operational decision making and execution by its customers. The IMS segment designs, develops, manufactures, and integrates power conversion, control and distribution systems, ship propulsion systems, motors and variable frequency drives, force protection systems, transportation and logistics systems.', 'Arlington, VA, United States', 7000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBRG', 'STOCK', 'DigitalBridge Group, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'DigitalBridge Group, Inc. is a global investment manager in digital infrastructure, deploying and managing capital across the digital ecosystem, including data centers, cell towers, fiber networks, small cells, and edge infrastructure. Its investment management platform is anchored by its value-added funds within the DigitalBridge Partners (DBP) infrastructure equity series. Its investment offerings also include core equity, credit and liquid securities. The DBP series of funds focuses on value-added digital infrastructure, investing in and building businesses across the digital infrastructure sector. Core Equity invests in digital infrastructure businesses and assets with long-duration cash flow profiles, primarily in more developed geographies, through its Strategic Assets Fund (SAF). DigitalBridge Credit is a private credit strategy that delivers credit solutions to corporate borrowers in the digital infrastructure sector globally through credit financing products.', 'Boca Raton, FL, United States', 309);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CERS', 'STOCK', 'Cerus Corporation', 'NGM', 'Healthcare', 'Medical Devices', 'Cerus Corporation is a biomedical products company. The Company is focused on developing and commercializing the INTERCEPT Blood System to enhance blood safety. The INTERCEPT Blood System, which is based on its proprietary technology for controlling biological replication, is designed to reduce blood-borne pathogens in donated blood components intended for transfusion. Its INTERCEPT Blood System is intended for use with blood components and certain of their derivatives: platelets, plasma, red blood cells and to produce INTERCEPT Fibrinogen Complex (IFC), and pathogen reduced plasma, cryoprecipitate reduced. The INTERCEPT Blood System for Cryoprecipitation uses its plasma system to produce IFC for the treatment and control of bleeding, including massive hemorrhage, associated with fibrinogen deficiency. In addition, the INTERCEPT Blood System for Cryoprecipitation is used to produce pathogen reduced plasma, cryoprecipitate reduced.', 'Concord, CA, United States', 614);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SGRY', 'STOCK', 'Surgery Partners, Inc.', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Surgery Partners, Inc. is a healthcare services company. The Company, through its subsidiaries, owns and operates a national network of surgical facilities and ancillary services. The Company operates through the Surgical Facility Services segment, which includes the operation of ambulatory surgery centers (ASCs), surgical hospitals, anesthesia services, urgent care facilities and multi-specialty physician practices. Its surgical facilities primarily provide non-emergency surgical procedures across many specialties, including, among others, orthopedics and pain management, ophthalmology, gastroenterology (GI) and general surgery. The Company operates a portfolio of 161 surgical facilities comprised of 142 ASCs and 19 surgical hospitals. The Company is focused on surgical services businesses in the United States, with over 200 locations in 31 states, including short-stay surgical hospitals.', 'Brentwood, TN, United States', 15000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHC', 'STOCK', 'Bausch Health Companies Inc.', 'NYQ', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Bausch Health Companies Inc. is a global, diversified specialty pharmaceutical and medical device company. Its comprehensive portfolio of over 400 products includes contact lenses, lens care products, eye care products, ophthalmic pharmaceuticals, over-the-counter (OTC) products and ophthalmic surgical devices and instruments. The Salix segment consists of sales in the U.S. of gastroenterology products. The International segment consists of sales, except for sales of Bausch + Lomb products and Solta Medical aesthetic medical devices, outside the U.S. and Puerto Rico of branded pharmaceutical products, branded generic pharmaceutical products and OTC products. The Solta Medical segment consists of global sales of Solta Medical aesthetic medical devices. Diversified segment consists of sales in the U.S. of pharmaceutical products in the areas of neurology and certain other therapeutic classes. Bausch + Lomb segment includes Bausch + Lomb Vision Care, Surgical and Pharmaceuticals products.', 'Laval, QC, Canada', 20700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARLO', 'STOCK', 'Arlo Technologies, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Arlo Technologies, Inc. is a smart home security platform company. The Company offers advanced home, business, and personal security services that combine a globally scaled cloud platform, advanced monitoring and analytics capabilities, and app-controlled devices to create a personalized security ecosystem. Its expertise in cloud services, artificial intelligence (AI) and computer vision analytics, wireless connectivity and intuitive user experience design deliver seamless, smart home security for its users. Its cloud-based platform provides users with visibility, insight and a powerful means to help protect and connect in real-time with the people and things that matter, from any location with a Wi-Fi or a cellular connection. Its products include Arlo Essential Cameras and Doorbells; Arlo Home Security System; Arlo Pro 5S; Arlo Go 2; Arlo Ultra 2; Arlo Floodlight Camera, and others. Its services include Arlo Secure, Arlo Total Security, Arlo Safe, and other services.', 'Carlsbad, CA, United States', 360);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIVI', 'STOCK', 'Civitas Resources, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Civitas Resources, Inc. is an independent exploration and production company. It is focused on the acquisition, development, and production of crude oil and liquids-rich natural gas from its premier assets in the DJ Basin in Colorado and the Permian Basin in Texas and New Mexico. Its development facilities are in counties across the Front Range of northern and central Colorado, and Southeastern New Mexico and West Texas. Its DJ Basin assets are comprised of over 356,800 net acres located in Weld, Arapahoe, Adams, and Boulder counties, Colorado. Its operations in the DJ Basin target the Niobrara and Codell formations. Its Permian Basin assets are comprised of over 120,400 net acres located in Upton, Reagan, Glasscock, Martin, Midland, Reeves, and Loving counties, Texas and Eddy and Lea counties, New Mexico. Its operations in the Permian Basin primarily target the Spraberry and Wolfcamp formations of the Midland Basin and the Wolfcamp and Bone Spring formations of the Delaware Basin.', 'Denver, CO, United States', 655);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVH', 'STOCK', 'Evolent Health, Inc.', 'NYQ', 'Healthcare', 'Health Information Services', 'Evolent Health, Inc. is a health care company connecting care for people with complex conditions like cancer, cardiovascular disease, and musculoskeletal diagnoses. The Company offers three primary solutions: specialty care management services, total cost of care management and administrative services. It provides comprehensive quality management for oncology and cardiology patients from diagnosis through advanced care planning services, as well as identifying quality, lowest cost of care for outpatient orthopedic surgeries. Its total cost of care management solution enables providers to manage populations they may be accountable for under value-based contracts with payers or accountable care organizations (ACO) contracts with Centers for Medicare and Medicaid Services (CMS). Its administrative services solution includes an integrated value-based care platform designed to help customers manage and administer patient health in a cost-effective manner.', 'Arlington, VA, United States', 4500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BALL', 'STOCK', 'Ball Corporation', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'A Ball Corporation (Ball) fornece soluções sustentáveis de embalagem de alumínio para clientes de bebidas, cuidados pessoais e produtos domésticos. Seus produtos de embalagem são produzidos para uma variedade de usos finais. A empresa vende seus produtos de embalagem de alumínio principalmente para grandes empresas multinacionais de bebidas, cuidados pessoais e produtos domésticos. A empresa opera em três segmentos: Embalagens de bebidas, América do Norte e Central; Embalagens de bebidas, EMEA e Embalagens de bebidas, América do Sul. O segmento de Embalagens de Bebidas, América do Norte e Central fabrica e vende recipientes de bebidas de alumínio em todos os Estados Unidos, Canadá e México. O segmento de Embalagens de Bebidas, EMEA fabrica e vende recipientes de bebidas de alumínio em vários países em toda a Europa, bem como no Egito e na Turquia. O segmento Beverage Packaging, América do Sul, fabrica e comercializa contentores de alumínio para bebidas no Brasil, Argentina, Paraguai e ', 'Westminster, CO, United States', 16000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELF', 'STOCK', 'e.l.f. Beauty, Inc.', 'NYQ', 'Consumer Defensive', 'Household & Personal Products', 'e.l.f. Beauty, Inc. is a multi-brand beauty company. The Company offers inclusive, accessible, clean, vegan, and cruelty-free cosmetics and skincare products. The Company''s family of brands includes e.l.f. Cosmetics, e.l.f. SKIN, Naturium, Well People and Keys Soulcare. Its e.l.f. SKIN is an ingredient-focused, dermatologist-developed formula for every eye, lip, face and skin concern. The Company operates across beauty categories including eye, lip, and face makeup, beauty tools and accessories, and skincare products. Its color cosmetics and skin care products are broadly sold through food, drug, and mass channels, as well as through department stores and direct and specialty channels. The Company''s brands are available online and across beauty, mass market and specialty retailers in the United States and internationally. The Company sell its products online through its own direct e-commerce channels, as well as through other e-commerce Websites.', 'Oakland, CA, United States', 633);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBIO', 'STOCK', 'BridgeBio Pharma, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'BridgeBio Pharma, Inc. is a biopharmaceutical company. It discovers, creates, tests, and delivers transformative medicines to treat patients who suffer from genetic diseases. Its pipeline of development programs ranges from early science to advanced clinical trials, which includes Attruby, an oral small molecule near-complete transthyretin (TTR) stabilizer, for the treatment of cardiomyopathy of wild-type or variant transthyretin-mediated amyloidosis (ATTR-CM); Beyonttra for the treatment of TTR Amyloidosis; Low-dose Infigratinib, an oral FGFR1-3 selective tyrosine kinase inhibitor (TKI) for the treatment of children with achondroplasia and hypochondroplasia; Encaleret, an oral small molecule antagonist of the calcium sensing receptor (CaSR) that it is developing for the treatment of Autosomal Dominant Hypocalcemia Type 1 (ADH1), and BBP-418, for the treatment of Limb Girdle Muscular Dystrophy Type 2I. It also conducting a Phase 1/2 study (CANaspire) for BBP-812 for Canavan disease.', 'Palo Alto, CA, United States', 725);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMRN', 'STOCK', 'BioMarin Pharmaceutical Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'BioMarin Pharmaceutical Inc. (BioMarin) é uma empresa global de biotecnologia, que está envolvida no desenvolvimento e comercialização de terapias que abordam a causa raiz das condições genéticas. Os produtos comerciais da BioMarin incluem Vimizim (elosulfase alpha), Naglazyme (galsulfase), Palynziq (pegvaliase-pqpz), Brineura (cerliponase alfa), Aldurazyme (laronidase), Roctavian (valoctocogene roxaparvovec), Kuvan (dihidrocloreto de sapropterina) e Voxzogo (vosoritide). Vimizim é uma terapia de substituição enzimática para o tratamento de MPS IVA, um distúrbio de armazenamento lisossômico. A Roctaviana é uma terapia genética de vetor de vírus adeno associado (AAV5), projetada para restaurar as concentrações plasmáticas do fator VIII em pacientes com hemofilia grave A. Brineura é uma tripeptidil peptidase humana recombinante 1 (TPP1) para o tratamento de pacientes com CLN2, uma forma de doença de Batten. Voxzogo é um análogo de injeção diária de peptídeo natriurético tipo C (CNP) para', 'San Rafael, CA, United States', 3040);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOCN', 'STOCK', 'DigitalOcean Holdings, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'DigitalOcean Holdings, Inc. provides the simplest scalable cloud platform that democratizes cloud and AI for growing tech companies around the world. It provides a cloud computing platform, offering simple, scalable and approachable on-demand infrastructure and platform services for developers at growing technology companies. Its platform simplifies cloud computing, enabling its customers to rapidly accelerate innovation and productivity. The simplicity of its platform allows users to focus on building and scaling their business instead of on managing their infrastructure. It offers mission-critical solutions across Infrastructure-as-a-Service (IaaS), including its Droplet virtual machines, storage and networking offerings; Platform-as-a-Service and Software-as-a-Service, including its Managed Hosting, Managed Database, Managed Kubernetes and Marketplace offerings; and artificial intelligence and machine learning, including its GPU Droplets, Notebooks and GenAI Platform offerings.', 'New York, NY, United States', 1210);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ED', 'STOCK', 'Consolidated Edison, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'A Edison, Inc. É uma empresa de fornecimento de energia. A Companhia, através de suas subsidiárias, Consolidated Edison Company of New York, Inc. (CECONY), Orange and Rockland Utilities, Inc. (O&R) e Con Edison Transmission, Inc., fornece uma gama de produtos e serviços relacionados à energia para seus clientes. CECONY é uma concessionária regulamentada que fornece serviço elétrico na cidade de Nova York e Westchester County, em Nova York, serviço de gás em Manhattan, no Bronx, partes de Queens e partes de Westchester, e serviço de vapor em Manhattan. A O&R e a sua subsidiária de serviços públicos, a Rockland Electric Company, prestam serviços elétricos a clientes no sudeste de Nova Iorque e no norte de Nova Jersey, uma área de serviço de 1 300 milhas quadradas. O&R entrega gás aos clientes no sudeste de Nova Iorque. A Conn Edison Transmission, Inc. É responsável principalmente pela supervisão da Federal Energy Regulatory Commission e gerencia, através de joint ventures, ativos elétric', 'New York, NY, United States', 15097);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDNA', 'STOCK', 'CareDx, Inc', 'NGM', 'Healthcare', 'Diagnostics & Research', 'CareDx, Inc. is a precision medicine solutions company. The Company is focused on the discovery, development, and commercialization of clinically differentiated healthcare solutions for transplant patients and caregivers. It offers testing services, products, and digital healthcare solutions along the pre- and post-transplant patient journey and is the provider of genomics-based information for transplant patients. Its commercially available post-transplant testing services consist of AlloSure Kidney, a donor-derived cell-free DNA, or dd-cfDNA, solution for kidney transplant patients, AlloMap Heart, a gene expression profiling solution for heart transplant patients, AlloSure Heart, a dd-cfDNA solution for heart transplant patients, and AlloSure Lung, a dd-cfDNA solution for lung transplant patients. Its lab product portfolio includes QTYPE, Olerup SSP and SBT, AlloSeq Tx, AlloSeq HCT, and AlloSeq cfDNA. It also offers a diverse portfolio of digital solutions to transplant centers.', 'South San Francisco, CA, United States', 644);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BILL', 'STOCK', 'BILL Holdings, Inc.', 'NYQ', 'Technology', 'Software - Application', 'A Bill Holdings, Inc. Fornece uma plataforma de operações financeiras para pequenas e médias empresas (PMEs). A empresa oferece software como serviço, pagamentos baseados na nuvem e produtos de gerenciamento de gastos e despesas, que permitem aos usuários automatizar transações de contas a pagar e contas a receber, permitir que as empresas se conetem facilmente com seus fornecedores e/ou clientes para fazer negócios, eliminar relatórios de despesas, gerenciar fluxos de caixa e melhorar a eficiência do back-office. Sua plataforma de software financeiro habilitada para inteligência artificial (IA) cria conexões perfeitas entre seus clientes, seus fornecedores e seus clientes. As empresas em sua plataforma geram e processam faturas, agilizam aprovações, fazem e recebem pagamentos, gerenciam despesas de funcionários, sincronizam com seu sistema de contabilidade, promovem a colaboração e gerenciam seu fluxo de caixa. Sua plataforma integrada também inclui gastos e despesas DE CONTAS, seu pr', 'San Jose, CA, United States', 2187);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CADL', 'STOCK', 'Candel Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Candel Therapeutics, Inc. is a BLA-ready clinical-stage biopharmaceutical company focused on developing off-the-shelf multimodal biological immunotherapies that elicit an individualized, systemic antitumor immune response to help patients fight cancer. CAN-2409 is the lead product candidate from the adenovirus platform. CAN-3110 is the lead product candidate from the herpes simplex virus (HSV) platform and is in an ongoing phase Ib clinical trial in recurrent high-grade glioma. Its enLIGHTEN Discovery Platform is a systematic, iterative HSV-based discovery platform leveraging human biology and advanced analytics to create new viral immunotherapies for solid tumors. CAN-2409, Its advanced multimodal biological immunotherapy candidate, is an investigational, off-the-shelf, replication-defective adenovirus engineered to deliver the herpes simplex virus thymidine kinase (HSV-tk) gene to a patients specific tumor and induce an individualized, systemic immune response against the tumor.', 'Needham, MA, United States', 38);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBR', 'STOCK', 'Centrais Elétricas Brasileiras S.A. - Eletrobrás', 'NYQ', 'Utilities', 'Utilities - Renewable', 'A Eletrobras é uma empresa brasileira de energia, especializada na geração e transmissão de energia elétrica. As operações da Companhia são divididas em dois segmentos primários: Geração de Energia e Transmissão de Energia. O portfólio de energia da Eletrobras consiste principalmente em fontes de baixo carbono, com a maioria das hidrelétricas, complementadas pela energia eólica e solar. No segmento de Geração de Energia, a Eletrobras administra uma ampla gama de Usinas, incluindo hidrelétricas e parques eólicos. O segmento de Transmissão de Energia envolve supervisionar uma ampla rede de linhas de transmissão em todo o Brasil. A Companhia opera através de uma rede de subsidiárias regionais.', 'Rio de Janeiro, RJ, Brazil', 7710);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMI', 'STOCK', 'Cummins Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'A Cummins Inc. projeta, fabrica, distribui e faz manutenção em motores a diesel e gás natural e produtos de componentes relacionados a motores. Os segmentos da empresa incluem motores, distribuição, componentes e sistemas de energia. O segmento de motores fabrica e comercializa uma variedade de motores movidos a diesel e gás natural sob a marca Cummins, bem como certas marcas de clientes, para caminhões pesados e médios, ônibus, veículos recreativos (RV), automóveis leves e mercados agrícolas. O segmento de Distribuição consiste nas linhas de produtos, que atendem e / ou distribuem uma gama de produtos e serviços, incluindo peças, motores, geração de energia e serviços. O segmento de componentes fornece produtos, incluindo sistemas de pós-tratamento, turbocompressores, produtos de filtração e sistemas de combustível para aplicações comerciais de diesel. O segmento de componentes fornece produtos, incluindo sistemas de pós-tratamento, turbocompressores, produtos de filtração e sistemas ', 'Columbus, IN, United States', 69600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMCO', 'STOCK', 'Columbus McKinnon Corporation', 'NMS', 'Industrials', 'Farm & Heavy Construction Machinery', 'Columbus McKinnon Corporation is a designer, manufacturer and marketer of intelligent motion solutions for material handling. Its key products include hoists, crane components, precision conveyor systems, rigging tools, light rail workstations and digital power and motion control systems. The Company focuses on commercial and industrial applications that require the safety and quality provided by its design and engineering know-how. Its products include a wide variety of electric, air-powered, lever, and hand hoists, hoist trolleys, explosion-protected hoists, winches, and aluminum work stations; alloy and carbon steel chain; forged attachments, such as hooks, shackles, textile slings, clamps, and load binders; mechanical and electromechanical actuators and rotary unions; below-the-hook special purpose lifters; and power and motion control systems, among others. Its target market verticals include manufacturing, transportation, energy and utilities, aerospace, and others.', 'Charlotte, NC, United States', 3478);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRNT', 'STOCK', 'Ceragon Networks Ltd.', 'NMS', 'Technology', 'Communication Equipment', 'Ceragon Networks Ltd. offers wireless backhaul solutions. The Company''s products include FibeAir IP-20 Platform, FibeAir IP-20 Assured Platform and Network Management. The Company provides its services to wireless service providers, public safety organizations, government agencies and utility companies, among others. Its solutions are deployed by over 460 service providers, as well as a range of private network owners, in over 130 countries. The Company''s FibeAir IP-20 platform offers flexibility in choosing all-outdoor, split-mount and all-indoor configurations to suit any deployment scenario. The FibeAir IP-20 platform includes product categories, such as shorthaul-access and shorthaul-aggregation. The FibeAir IP-20 Assured platform includes product categories, such as shorthaul-access, shorthaul-aggregation, small cells, longhaul and enterprise access. Its NetMaster is a Network Management System (NMS), which is designed for managing large-scale wireless backhaul networks.', 'Rosh Haayin, , Israel', 1056);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIBR', 'STOCK', 'First Trust NASDAQ Cybersecurity ETF', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the common stocks and depositary receipts that comprise the index. The index includes securities of companies classified as "cyber security" companies by CTA. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCAB', 'STOCK', 'BioAtla, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'BioAtla, Inc. is a clinical-stage biopharmaceutical company focused on developing antibody-based therapeutics for the treatment of solid tumor cancer. The Companys product candidates include Mecbotamab vedotin (BA3011), Ozuriftabmab vedotin (BA3021), evalstotug (BA3071), and BA3182. Its lead product candidate, BA3011, is a conditionally active biologics (CAB) antibody-drug conjugate that targets AXL, which is a protein kinase receptor. The BA3071 is a potential therapeutic for multiple solid tumor types, including soft tissue and bone sarcoma, and non-small cell lung cancer. BA3021 is developing a CAB antibody drug conjugate directed against a receptor tyrosine kinase such as orphan receptor 2 (ROR2). BA3071 is a CAB anti-CTLA-4 antibody that is being developed as a therapeutic for multiple solid tumor indications. BA3182 is designed with an EpCAM binding domain and a CD3 binding domain, both binding domains with CAB activity (Dual-CAB), for the treatment of advanced adenocarcinoma.', 'San Diego, CA, United States', 61);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXPE', 'STOCK', 'Expedia Group, Inc.', 'NMS', 'Consumer Cyclical', 'Travel Services', 'Expedia Group, Inc. É uma empresa de viagens online. Os segmentos da empresa incluem B2C, B2B e trivago. O segmento B2C oferece uma gama completa de serviços de viagens e publicidade para seus clientes em todo o mundo através de uma variedade de marcas de consumo, incluindo: Expedia.com, Hotels.com, VRBO, Orbitz, Travelocity, Wotif Grupo, Bookers, CheapTickets, Hotwire.com e CarRentals.com. O segmento B2B alimenta uma ampla gama de empresas de viagens e não viagens, incluindo companhias aéreas, agentes de viagens offline, varejistas on-line, gestão de viagens corporativas e instituições financeiras, que aproveitam a tecnologia de viagens e aproveitam sua oferta diversificada para aumentar suas ofertas e comercializar tarifas e disponibilidades do Expedia Group para seus viajantes. Seu segmento trivago gera receita de publicidade principalmente através do envio de referências para empresas de viagens on-line e provedores de serviços de viagens a partir de seus sites de metasearch de hot', 'Seattle, WA, United States', 16500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUOL', 'STOCK', 'Duolingo, Inc.', 'NMS', 'Technology', 'Software - Application', 'Duolingo, Inc. É uma empresa de tecnologia. A empresa está empenhada em oferecer uma plataforma de aprendizagem móvel, bem como um exame digital de avaliação de proficiência em inglês. Ele opera um modelo de negócio freemium, a saber, o aplicativo e o site são acessíveis gratuitamente, embora Duolingo também oferece serviços premium por uma taxa de assinatura. Suas soluções consistem no Duolingo App, Super Duolingo, Duolingo Max, Duolingo English Test: AI-Driven Language Assessment, Duolingo para Escolas, e Duolingo ABC. O Duolingo App oferece cursos em mais de 40 idiomas diferentes, incluindo espanhol, inglês, francês, alemão, italiano, português, japonês e chinês. Duolingo também pode ser acessado em computadores desktop através de um navegador da Web. Sua oferta de assinatura, Super Duolingo, oferece aos alunos recursos adicionais para melhorar sua experiência de aprendizado. O Duolingo English Test é uma avaliação de proficiência em inglês on-line, on-demand e high-stakes. Ele tamb', 'Pittsburgh, PA, United States', 830);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AQST', 'STOCK', 'Aquestive Therapeutics, Inc.', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Aquestive Therapeutics, Inc. is a pharmaceutical company. The Company is engaged in developing orally administered and topical gel products to deliver complex molecules, providing novel alternatives to invasive and inconvenient standard of care therapies. It has four commercialized products marketed by the Companys licensees in the United States and around the world and is the manufacturer of these licensed products. The Company also collaborates with pharmaceutical companies to bring new molecules to market using proprietary technologies, including PharmFilm, and has proven drug development and commercialization capabilities. The Company is advancing a late-stage proprietary product candidate for the treatment of severe allergic reactions, including anaphylaxis, and an early-stage epinephrine prodrug topical gel product candidate for various possible dermatology conditions. Its portfolio includes Anaphylm, AQST-108, Libervant, Suboxone, and Emylif.', 'Warren, NJ, United States', 142);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBL', 'STOCK', 'GraniteShares 2x Long META Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change of the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund will aim to primarily obtain its notional exposure against the underlying stock through swap agreements.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVM', 'STOCK', 'CEL-SCI Corporation', 'ASE', 'Healthcare', 'Biotechnology', 'CEL-SCI Corporation is a late clinical-stage biotechnology company. It is engaged in research and development directed at improving the treatment of cancer and other diseases by using the immune system, the bodys natural defense system. It is focused on the development of product candidates and technologies, including Multikine and Ligand Epitope Antigen Presentation System technology (LEAPS). Multikine (Leukocyte Interleukin, Injection), a true first-line cancer therapy, which is designed to help the immune system target the tumor at a time when the immune system is still relatively intact and thereby thought to be better able to mount an attack on the tumor. LEAPS is designed to stimulate the human immune system to more effectively fight bacterial, viral and parasitic infections as well as autoimmune conditions, allergies, transplantation rejection and cancer, when it cannot do so on its own. The LEAPS candidates include CEL-2000, CEL-4000 and DerG-PG275(Cit) (aka, CEL-5000).', 'Vienna, VA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDX', 'STOCK', 'Becton, Dickinson and Company', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Becton, Dickinson and Company é uma empresa global de tecnologia médica. A empresa está envolvida no desenvolvimento, fabricação e venda de uma ampla gama de suprimentos médicos, dispositivos, equipamentos de laboratório e produtos de diagnóstico usados por instituições de saúde, médicos, pesquisadores de ciências da vida, laboratórios clínicos e muito mais. Seu segmento BD Medical produz uma série de tecnologias e dispositivos médicos que são usados para ajudar a melhorar a prestação de cuidados de saúde em uma variedade de configurações. O segmento BD Medical é composto por várias unidades de negócios, incluindo soluções de entrega de medicamentos, soluções de gestão de medicamentos, monitoramento avançado e sistemas farmacêuticos. Seu segmento BD Life Sciences fornece produtos para a coleta e transporte de amostras de diagnóstico e instrumentos e sistemas de reagentes para detetar uma série de doenças infeciosas, infeções associadas à saúde e cânceres. Seu segmento Intervencional BD', 'Franklin Lakes, NJ, United States', 70000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALGM', 'STOCK', 'Allegro MicroSystems, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Allegro MicroSystems, Inc. is engaged in power and sensing semiconductor solutions for motion control and energy-efficient systems. The Company is a global designer, developer, fabless manufacturer and marketer of sensor integrated circuits (ICs) and application-specific power ICs, enabling the important emerging technologies in the automotive and industrial markets. Its sensor ICs enable its customers to measure motion, speed, position and current, while its power ICs include high-temperature and high-voltage capable motor drivers, power management ICs, light-emitting diode (LED) driver ICs and isolated gate drivers. Its product portfolio includes over 1,500 products across a range of high-performance analog mixed-signal semiconductors. The Company also offers tunneling magnetoresistance (TMR) sensor solutions that provide the highest magnetic sensitivity, lowest power consumption, and the smallest size by comparison to other magnetic technologies.', 'Manchester, NH, United States', 4060);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHC', 'STOCK', 'Diversified Healthcare Trust', 'NMS', 'Real Estate', 'REIT - Healthcare Facilities', 'Diversified Healthcare Trust is a real estate investment trust (REIT). The Company is focused on owning healthcare properties located throughout the United States. It has an approximately $7.2 billion portfolio, which includes over 367 properties in 36 states and Washington, D.C., occupied by approximately 450 tenants, and totaling approximately 8.0 million square feet of life science and medical office properties and more than 27,000 senior living units. The Company''s segments include Medical Office and Life Science Portfolio and SHOP. Its Medical Office and Life Science Portfolio segment primarily consists of medical office properties leased to medical providers and other medical-related businesses, as well as life science properties primarily leased to biotech laboratories and other similar tenants. Its SHOP segment consists of managed senior living communities that provide short-term and long-term residential living and, in some instances, care and other services for residents.', 'Newton, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIP', 'STOCK', 'Arteris, Inc.', 'NGM', 'Technology', 'Semiconductors', 'Arteris, Inc. is a provider of semiconductor system IP, including interconnect and other intellectual property, (collectively, System IP) technology. Its System IP technology manages the on-chip communications and IP block deployments in System-on-Chip (SoC) semiconductors and systems of chiplets. It provides semiconductor interconnect IP and SoC Integration Automation software solutions to serve its target end-markets, including automotive, enterprise computing, consumer electronics, communications across wired and wireless, and industrial markets. Its two core product platforms are Network-on-Chip IP Products and SoC Integration Automation Software Solutions Products. Its Network-on-Chip IP products include Non-coherent NoC IP, with FlexGen, FlexNoC and FlexWay; Cache-coherent NoC IP, with Ncore, and NoC interface IP, with CodaCache. Its SoC Integration Automation Software Solutions products include IP and SoC software, with Magillem (Connectivity and Registers) and CSRCompiler.', 'Campbell, CA, United States', 278);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALBT', 'STOCK', 'Avalon GloboCare Corp.', 'NCM', 'Real Estate', 'Real Estate Services', 'Avalon GloboCare Corp. is a commercial-stage company engaged in developing and delivering precision diagnostic consumer products and the advancement of intellectual property in cellular therapy. The Company operates in two reportable business segments: the real property operating segment and the laboratory testing services segment. Its laboratory services offer a test menu that satisfies the clients'' testing needs, from general bloodwork to anatomic pathology, urine toxicology, pharmacogenomics (PGx) testing and more, and it is a one-stop-shop for clinical testing. The Company is currently marketing the KetoAir breathalyzer device and plans to develop additional diagnostic uses of the breathalyzer technology. The KetoAir breathalyzer is a handheld device that allows the user to detect acetone levels in exhaled breath. The acetone level is in concentration units part-per-million (ppm) such that the user knows the real-time ketosis status.', 'Freehold, NJ, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPRX', 'STOCK', 'Catalyst Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Catalyst Pharmaceuticals, Inc. is a commercial-stage biopharmaceutical company focused on in-licensing, developing, and commercializing medicines for patients living with rare and difficult-to-treat diseases. The Company markets three drug products: FIRDAPSE (amifampridine), FYCOMPA (perampanel), and AGAMREE (vamorolone). FIRDAPSE is a treatment for people six years of age or older living with Lambert-Eaton myasthenic syndrome (LEMS). The Company, through its sub-licensee, also offers FIRDAPSE in Canada and Japan. FYCOMPA is a prescription medicine used alone or with other medicines to treat partial-onset seizures with or without secondarily generalized seizures in people with epilepsy aged four and older and with other medicines to treat primary generalized tonic-clonic seizures in people with epilepsy aged 12 and older. AGAMREE is a corticosteroid with a structure that retains the potent anti-inflammatory effects of traditional corticosteroids used in Duchenne muscular dystrophy.', 'Coral Gables, FL, United States', 181);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CENN', 'STOCK', 'Cenntro Inc.', 'NCM', 'Consumer Cyclical', 'Auto Manufacturers', 'Cenntro Inc. is a holding company, which conducts operations through its subsidiaries in the United States, Australia, Europe, Mexico, Hong Kong, the Dominican Republic, and in the Peoples Republic of China. The Company is engaged in designing and manufacturing purpose-built, electric commercial vehicles (ECVs) used primarily in last mile delivery and industrial applications. Through its distribution partners, it provides robust pre-market and after-sales services, and support for its customers. Its vehicles include Logistar 210, Logistar 250, Logistar 260, Logistar 300, Logistar 400, Logistar 450, AVANTIER, Metro, and TeeMak. The Company''s subsidiaries include Cenntro Electric Group Pty Limited, Cenntro Electric Group, Inc., Cenntro Electric Group (Europe) GmbH, Teemak Power Corporation, among others.', 'Freehold, NJ, United States', 260);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGO', 'STOCK', 'Eldorado Gold Corporation', 'NYQ', 'Basic Materials', 'Gold', 'Eldorado Gold Corporation is a Canada-based gold and base metals producer with mining, development and exploration operations in Turkiye, Canada and Greece. The Company operates four mines: Kisladag, Efemcukuru, Lamaque, and Olympias. The Kisladag, Efemcukuru and Lamaque mines are gold mines, while Olympias is a polymetallic operation producing three concentrates bearing gold, lead-silver and zinc. Kisladag is a low-grade, bulk-tonnage, open-pit operation that uses heap leaching for gold recovery. It is located in Usak Province in western Turkiye. Efemcukuru is a high-grade, underground operation located in Izmir Province in western Turkiye. The Lamaque Complex is located in Val-d''Or, Quebec. It includes the Triangle mine, the Ormaque mine, the Parallel deposit, the Plug #4 deposit, and the Sigma Mill. Olympias is a gold-silver-lead-zinc mine located in the Halkidiki Peninsula in northern Greece. It also operates the Bruell Gold Project 51 claim property in Vauquelin township, Quebec.', 'Vancouver, BC, Canada', 5800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABCB', 'STOCK', 'Ameris Bancorp', 'NYQ', 'Financial Services', 'Banks - Regional', 'Ameris Bancorp is a financial holding company, through its banking subsidiary, Ameris Bank (the Bank), which provides a full range of banking services to its retail and commercial customers, who are primarily concentrated in select markets in Georgia, Alabama, Florida, North Carolina and South Carolina. Its Banking Division provides full-service financial services to include commercial loans, consumer loans and deposit accounts. Its Retail Mortgage Division is engaged in the origination, sales and servicing of one-to-four family residential mortgage loans. Its Warehouse Lending Division is engaged in the origination and servicing of warehouse lines to other businesses that are secured by underlying one-to-four family residential mortgage loans and residential mortgage servicing rights. Its Premium Finance Division is engaged in the origination and servicing of commercial insurance premium finance loans. It operates 164 full-service domestic banking offices.', 'Atlanta, GA, United States', 2672);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENOV', 'STOCK', 'Enovis Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'A Enovis Corporation é uma empresa de tecnologia médica. Está focada no desenvolvimento de soluções clinicamente diferenciadas através da fabricação e distribuição de dispositivos médicos com uma gama de produtos utilizados para cirurgia reconstrutiva, reabilitação, gestão da dor e fisioterapia. Atua através de dois segmentos: Prevenção e Recuperação e Reconstrutiva. O segmento de Prevenção e Recuperação desenvolve, fabrica e distribui produtos rígidos de apoio, produtos ortopédicos, sistemas vasculares e vestuário de compressão, produtos de terapia a quente e fria e oferece produtos de ciências de recuperação nos mercados de reabilitação clínica e medicina esportiva, como estimuladores de crescimento ósseo e estimuladores elétricos usados para o gerenciamento da dor. O segmento Reconstructive desenvolve, fabrica e comercializa uma variedade de joelho, quadril, ombro, cotovelo, pé, produtos de implante de tornozelo e dedo e ferramentas de produtividade cirúrgica. Ele também fornece Nov', 'Wilmington, DE, United States', 7367);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYCU', 'STOCK', 'Cycurion, Inc.', 'NGM', 'Technology', 'Information Technology Services', 'Cycurion, Inc. is a technology-enabled cybersecurity company. The Company provides network communications and information technology security solutions. It also provides proprietary solutions to federal, state and local government agencies and commercial partners. Its ARx platform is a turnkey Web application protection and managed security solution that combines all the essential cybersecurity layers in a comprehensive platform. It provides comprehensive managed information technology (IT) services to help organizations optimize their technology infrastructure and operations. Its security management solution is designed to help organizations protect their digital assets against various cyber threats. Its Managed Security Service includes 24/7 monitoring, threat detection, incident response, and remediation. Its Consulting and Advisory Services include security control assessments, staff augmentation, digital modernization, security architecture and engineering, and others.', 'McLean, VA, United States', 46);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CINF', 'STOCK', 'Cincinnati Financial Corporation', 'NMS', 'Financial Services', 'Insurance - Property & Casualty', 'A Cincinnati Financial Corporation oferece principalmente seguros de negócios, de casa e de automóveis, seu principal negócio, através da Cincinnati Insurance Company e suas duas empresas padrão de acidentes de propriedade no mercado. Seus segmentos incluem seguro de linhas comerciais, seguro de linhas pessoais, seguro de excesso e excesso de linhas, seguro de vida e investimentos. O negócio do segmento de seguros de linhas comerciais inclui acidentes comerciais, propriedade comercial, automóvel comercial, compensação de trabalhadores e outras linhas comerciais. O negócio do segmento de Seguros inclui auto pessoal, proprietário e outras linhas pessoais. O segmento de Seguros de Excesso e Excedente abrange a vítima comercial e a propriedade comercial. O negócio do segmento de seguro de vida inclui seguro de vida a termo, produtos de local de trabalho, seguro de vida inteiro e seguro de vida universal. O segmento de investimentos investe o dinheiro que gera a partir de operações de segur', 'Fairfield, OH, United States', 5624);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGON', 'STOCK', 'CG Oncology, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'CG Oncology, Inc. is a late-stage clinical biopharmaceutical company focused on developing and commercializing a potential backbone bladder-sparing therapeutic for patients afflicted with bladder cancer. The Companys product candidate, cretostimogene grenadenorepvec (cretostimogene) is in clinical development for the treatment of patients with non-muscle invasive bladder cancer (NMIBC). Its BOND-003 is in Phase III clinical trial, which is designed to assess the safety and efficacy of cretostimogene in high-risk Bacillus Calmette Guerin (BCG)-unresponsive NMIBC when administered as a monotherapy. Its CORE-001 is a Phase II single-arm, open-label clinical trial of cretostimogene administered with BCG-unresponsive NMIBC. Its portfolio also includes PIVOT-006, a Phase III trial to assess the safety and efficacy of adjuvant cretostimogene when administered as monotherapy to patients with intermediate-risk NMIBC following transurethral resection of the bladder tumor (TURBT).', 'Irvine, CA, United States', 113);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWXT', 'STOCK', 'BWX Technologies, Inc.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'BWX Technologies, Inc. is a specialty manufacturer of nuclear components, a developer of nuclear technologies and a service provider. The Company also provides special nuclear materials processing, environmental site restoration services, products, and services. Its Government Operations segment manufactures naval nuclear reactors, including related nuclear fuel, for the United States Naval Nuclear Propulsion Program for use in submarines and aircraft carriers. It also fabricates fuel-bearing precision components that range in weight from a few grams to hundreds of tons, manufactures electromechanical equipment, and performs design, manufacturing, inspection, assembly, and testing activities. The Company is also a provider of advanced specialty materials, fabrication, and high-strength alloy manufacturing. Its Commercial Operations segment designs and manufactures commercial nuclear steam generators, heat exchangers, pressure vessels, reactor components, and other auxiliary equipment.', 'Lynchburg, VA, United States', 8700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSY', 'STOCK', 'Bentley Systems, Incorporated', 'NMS', 'Technology', 'Software - Application', 'Bentley Systems, Inc is an infrastructure engineering software company. It focuses on developing and supporting a portfolio of integrated software offerings across professional disciplines, infrastructure sectors, geographies, and the infrastructure lifecycle. It serves enterprises and professionals across the infrastructure lifecycle by enabling project delivery and asset performance. Its portfolio of integrated software offerings includes engineering applications, geo-professional applications, Bentley Infrastructure Cloud, Bentley Asset Analytics, and Cesium and iTwin Platform. Its geo-professional applications include GeoStudio, for integrated geotechnical analysis of slope stability, groundwater flow, and heat and mass transfer in soil and rock, and Imago, for the capture and management of drilling core images. Bentley Asset Analytics solutions include Blyncsy, for inspecting and detecting roadway conditions, and Bridge Monitoring, for identifying and classifying bridge defects.', 'Exton, PA, United States', 5500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CXM', 'STOCK', 'Sprinklr, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Sprinklr, Inc. is an enterprise software company for customer-facing functions. The Company''s artificial intelligence (AI) platform, Unified Customer Experience Management (Unified-CXM), enables customer-facing teams, from customer service to marketing, to collaborate across internal silos, communicate across digital channels, and leverage AI to deliver better customer experience. Its platform enables organizations to connect to approximately 30 digital channels, including messaging, live chat, text, social media and hundreds of millions of forums, blogs, news and review sites, as well as traditional channels such as voice and email. Its single-codebase platform is designed to handle unstructured data. Its Unified-CXM platform enables listening, seamless collaboration across the entire customer journey, skills-based workflow, customer-led governance, and timely decision-making.', 'New York, NY, United States', 3589);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRON', 'STOCK', 'Cronos Group Inc.', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Cronos Group Inc. is a global cannabinoid company engaged in building disruptive intellectual property by advancing cannabis research, technology and product development. The Companys diverse international brand portfolio includes Spinach, PEACE NATURALS and Lord Jones. Spinach is a mainstream adult-use cannabis brand with a portfolio that includes cannabinoid products in a wide range of formats, including dried flower, pre-rolls, vaporizers, edibles and tinctures. Lord Jones is a premium adult-use cannabis brand. The Lord Jones brand portfolio includes cannabis products in the pre-roll, vaporizer and edible categories. Lord Jones Ice Water Hash Fusions pre-rolls feature flower and terpene-rich ice water hash and are fitted with a branded ceramic tip. PEACE NATURALS is a global medical brand engaged in producing cannabis products. The Company distributes products under the PEACE NATURALS brand for the Canadian market and the Israeli, German, and United Kingdom medical markets.', 'Stayner, ON, Canada', 459);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDXS', 'STOCK', 'Codexis, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Codexis, Inc. is a provider of enzymatic solutions. It is leveraging its CodeEvolver technology platform to discover, develop, enhance, and commercialize novel, high-performance enzymes and other classes of proteins. The Company utilizes its CodeEvolver technology platform to develop optimized enzymes that are used by some pharmaceutical companies to reduce their costs and improve the efficiency and productivity of their manufacturing processes for small molecule therapeutics. It is developing its Enzyme-Catalyzed Oligonucleotide Synthesis (ECO Synthesis) manufacturing platform to enable the scaled manufacture of RNA interference (RNAi) and other RNA-based therapeutics through an enzymatic route. The Company also uses the CodeEvolver platform technology to develop enzymes for the synthesis of RNAi therapeutics through its ECO Synthesis manufacturing platform, where its enzymes are poised to deliver many of the same benefits it offers in pharmaceutical manufacturing.', 'Redwood City, CA, United States', 188);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVTV', 'STOCK', 'Envirotech Vehicles, Inc.', 'NCM', 'Consumer Cyclical', 'Auto Manufacturers', 'Envirotech Vehicles, Inc. is a provider of purpose-built zero-emission electric vehicles focused on reducing the total cost of vehicle ownership and helping fleet operators unlock the benefits of green technology. The Company serves commercial and last-mile fleets, school districts, public and private transportation service companies and colleges and universities. Its vehicles address the challenges of traditional fuel price cost instability and local, state and federal environmental regulatory compliance. It offers Class 2 through 4 logistics vans, Class 4 through 5 urban trucks, school buses, electric forklifts, street sweepers, neighborhood electric vehicles and right-hand drive vans and urban trucks. Its vehicles include options for telemetric for remote monitoring, electric power-export and various levels of grid-connectivity. The Companys vehicles are manufactured by original equipment manufacturers (OEM) located in China, Malaysia and the Philippines.', 'Houston, TX, United States', 22);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDP', 'STOCK', 'COPT Defense Properties', 'NYQ', 'Real Estate', 'REIT - Office', 'A COPT Defense Properties é uma confiança de investimento imobiliário totalmente integrada e autogestionada (REIT). Está focado em possuir, operar e desenvolver propriedades em locais próximos ou, por vezes, conter instalações e missões de defesa do Governo dos Estados Unidos (USG) (referido como seu Portfólio de Defesa/TI). Seus inquilinos incluem o USG e seus empreiteiros de defesa, que estão envolvidos em atividades prioritárias de segurança nacional, e que exigem melhorias de propriedade de alta segurança e missão crítica. Seu segmento de Portfólio de Defesa/TI é composto por aproximadamente 193 propriedades, incluindo 24 de propriedade de joint ventures não consolidadas, abrangendo 22,0 milhões de pés quadrados. Seus subsegmentos de portfólio de Defesa/TI incluem Fort George G. Meade e o Corredor de Baltimore/Washington; locais de Defesa/TI da Virgínia do Norte; Base da Força Aérea Lackland em San Antonio, Texas; locais que servem a Marinha dos EUA; Arsenal Redstone em Huntsville,', 'Columbia, MD, United States', 427);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CANG', 'STOCK', 'Cango Inc.', 'NYQ', 'Financial Services', 'Capital Markets', 'Cango Inc is a holding company principally engaged in the provision of automotive transaction service platform. The Company mainly provides automobile trading solutions and after-market services facilitation services. Automobile trading solutions mainly include car sourcing and transaction facilitation services, along with logistics and warehousing support for dealers, which are accessible primarily through Cango U-car application (app). After-market services facilitation services include the sale of insurance policies and other after-market services. The Company provides automotive financing facilitation services, as well as value-added services, such as assistance with administrative procedures associated with car purchasing and financing. The Company also operates overseas crypto mining business.', 'Shanghai, , China', 217);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('HCC', 'STOCK', 'Warrior Met Coal, Inc.', 'NYQ', 'Basic Materials', 'Coking Coal', 'Warrior Met Coal, Inc. is a producer and exporter of steelmaking coal, also known as hard coking coal (HCC), operating longwall operations in its underground mines based in Alabama. The Companys two operating mines, Mine No. 4 and Mine No. 7, and Blue Creek are located approximately 300 miles from its export terminal at the Port of Mobile in Alabama. The Company sells its coal to a diversified customer base of blast furnace steel producers, primarily located in Europe, South America and Asia. The Companys HCC, mined from the Southern Appalachian region of the United States, is characterized by low-to-high volatile matter (VM) and high coke strength after reaction (CSR). Mine No.7 operates two longwalls, while Mine No.4 runs a single longwall. Mine No. 4 and Mine No. 7 are located approximately 20 miles east of Tuscaloosa, Alabama and 30 miles southwest of Birmingham, Alabama.', 'Brookwood, AL, United States', 1336);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGAU', 'STOCK', 'Centerra Gold Inc.', 'NYQ', 'Basic Materials', 'Gold', 'Centerra Gold Inc. is a Canada-based gold mining company focused on operating, developing, exploring and acquiring gold and copper properties in North America, Turkiye, and other markets worldwide. Centerra operates two mines: the Mount Milligan Mine in British Columbia, Canada, and the Oksut Mine in Turkiye. The Company also owns the Kemess Project in British Columbia, Canada, the Goldfield Project in Nevada, United States, and owns and operates the Molybdenum Business Unit in the United States and Canada. The Mount Milligan Mine is an open pit mine located in north central British Columbia, Canada producing a gold and copper concentrate. The Oksut Mine is located approximately 300 kilometers southeast of Ankara in Turkiye and 48 kilometers south of Kayseri, the provincial capital. The Molybdenum BU includes the Langeloth Facility in Pennsylvania and two North American molybdenum mines: the Thompson Creek Mine in Idaho and the 75%-owned Endako Mine in British Columbia.', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAR', 'STOCK', 'Avis Budget Group, Inc.', 'NMS', 'Industrials', 'Rental & Leasing Services', 'Avis Budget Group, Inc. is a provider of mobility solutions through its three brands, Avis, Budget and Zipcar, as well as several other brands. Its brands offer a range of options, from car and truck rental to car sharing. Its segments include Americas and International. The Americas segment consists primarily of vehicle rental operations in North America, South America, Central America and the Caribbean and operates car-sharing operations in certain of these markets. The International segment consists of vehicle rental operations in Europe, the Middle East, Africa, Asia and Australasia, and operates car-sharing operations in certain of these markets. The Avis brand provides vehicle rental and other mobility solutions at price points generally above non-branded and value-branded vehicle rental companies and serves the premium commercial and leisure segments of the travel industry. Its other brands include Payless, Apex, AmicoBlu, Maggiore, Morini Rent, FranceCars, and others.', 'Parsippany, NJ, United States', 17000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACMR', 'STOCK', 'ACM Research, Inc.', 'NGM', 'Technology', 'Semiconductor Equipment & Materials', 'ACM Research, Inc. develops, manufactures and sells semiconductor process equipment spanning cleaning, electroplating, stress-free polishing, vertical furnace processes, track, plasma-enhanced chemical vapor deposition (PECVD), and wafer- and panel-level packaging tools, enabling advanced and semi-critical semiconductor device manufacturing. It has also developed Timely Energized Bubble Oscillation (TEBO) technology for application in wet wafer cleaning during the fabrication of two-dimensional (2D) and three-dimensional wafers with fine feature sizes. It has designed these tools for use in fabricating foundry, logic, and memory chips, including dynamic random-access memory (DRAM), 3D NAND-flash memory chips, and compound semiconductor chips. It also develops, manufactures, and sells a range of advanced packaging tools to wafer assembly and packaging customers. Its other advanced packaging tools include Ultra ECP ap, Ultra C Developer, and Ultra C PR Megasonic-Assisted Stripper.', 'Fremont, CA, United States', 2023);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELVA', 'STOCK', 'Electrovaya Inc.', 'NCM', 'Industrials', 'Electrical Equipment & Parts', 'Electrovaya Inc. is a Canada-based lithium-ion battery technology and manufacturing company. The Company designs, develops and manufactures proprietary lithium-ion batteries, battery systems, and battery-related products for energy storage, clean electric transportation, and other specialized applications. The Company is focused on contributing to the prevention of climate change by supplying safe and long-lasting lithium-ion batteries. Its technology includes infinity battery technology and solid state battery technology. The Companys product portfolio includes cell technology, infinity battery systems, low voltage, and high voltage. Its infinity battery system-high voltage applications include E-buses, E-trucks, Mining Vehicles, and Defense. The Company has two operating sites in Canada and a 52-acre site with a 135,000 square foot manufacturing facility in Jamestown, New York state for its planned gigafactory.', 'Mississauga, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWEN', 'STOCK', 'Broadwind, Inc.', 'NCM', 'Industrials', 'Specialty Industrial Machinery', 'Broadwind Inc. is a precision manufacturer of structures, equipment and components for clean tech and other specialized applications. The Companys segments include Heavy Fabrications, Gearing, and Industrial Solutions. The Heavy Fabrications segment provides large, complex and precision fabrications to customers in a broad range of industrial markets. The Gearing segment provides gearing, gearboxes and precision machined components to a set of customers in diverse markets, including surface and underground mining, wind energy, steel, material handling, infrastructure, onshore and offshore oil and gas fracking and drilling, marine, defense, and other industrial markets. It also provides gearbox repair services. Industrial Solutions provides supply chain solutions, light fabrication, inventory management, kitting, and assembly services, primarily serving the combined cycle natural gas turbine market. It also provides packaging solutions and fabricates panels and sub-assemblies.', 'Cicero, IL, United States', 411);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNM', 'STOCK', 'Core & Main, Inc.', 'NYQ', 'Industrials', 'Industrial Distribution', 'Core & Main, Inc. is a holding company. The Company is advancing reliable infrastructure with local service, nationwide. The Company is a specialized distributor with a focus on water, wastewater, storm drainage and fire protection products, and related services. It provides solutions to municipalities, private water companies and professional contractors across municipal, non-residential, and residential end markets, nationwide. With approximately 370 locations across the United States, the Company provides its customers local expertise backed by a national supply chain. The Companys offering consists of pipes, valves and fittings, storm drainage products, fire protection products and smart metering products. The Company is also a provider of geosynthetics and erosion control products. It distributes a range of storm drainage products, with custom fabrication capabilities.', 'Saint Louis, MO, United States', 5700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKAM', 'STOCK', 'Akamai Technologies, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Akamai Technologies, Inc. É uma empresa de segurança cibernética e computação em nuvem. A empresa desenvolve e fornece soluções para que as empresas globais criem, protejam e aceleram suas aplicações e experiências digitais. A Akamai Connected Cloud, a plataforma da empresa, é composta por uma arquitetura de borda e nuvem e uma rede subjacente para serviços de computação em nuvem, segurança e entrega de conteúdo. Seus serviços de computação em nuvem incluem serviços de computação, armazenamento, rede, banco de dados e gerenciamento de contentores necessários para criar, implantar e proteger aplicativos e cargas de trabalho. Suas soluções de segurança são projetadas para manter a infraestrutura, sites, aplicativos, interfaces de programação de aplicativos e usuários seguros de uma infinidade de ataques cibernéticos e ameaças on-line, melhorando o desempenho. Suas soluções de entrega de conteúdo consistem em soluções focadas em desempenho na Web e em dispositivos móveis e soluções de ent', 'Cambridge, MA, United States', 10944);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGH', 'STOCK', 'Aureus Greenway Holdings Inc.', 'NCM', 'Consumer Cyclical', 'Leisure', 'Aureus Greenway Holdings Inc. is a holding company. The Company conducts business activities principally through its wholly owned subsidiaries, Chrome Fields I, Inc. and Chrome Fields II, Inc., which are engaged in the operation of golf courses and selling of merchandise and food and beverages, respectively. The Company owns and operates two public golf country clubs in Florida that each features a golf-club, consisting of over 289 acres of multiservice recreational property. The Companys golf country clubs include two golf-courses with over 13,000 yards of combined fairways, clubhouses boasting food and beverage options, aquatic golf ranges, and pro shops to assist any level of golfer. Each of its golf country clubs is organized into four principal business sectors: golf recreation, retail golf products, and equipment and facilities rental; membership dues; food and beverage services, and ancillary services and amenities.', 'Kissimmee, FL, United States', 47);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CALM', 'STOCK', 'Cal-Maine Foods, Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'Cal-Maine Foods, Inc. is primarily engaged in the production, packaging, marketing and distribution of fresh shell eggs, including conventional, cage-free, organic, brown, free-range, pasture-raised and nutritionally enhanced eggs, as well as a variety of ready-to-eat egg products. The Companys integrated operations consist of hatching chicks, growing and maintaining flocks of pullets, layers and breeders, manufacturing feed, and producing, processing, packaging, and distributing shell eggs. The Company provides specialty and conventional eggs. Specialty eggs encompass a broad range of products, such as cage-free, organic, brown, free-range, pasture-raised and nutritionally enhanced eggs. Its Farmhouse Eggs brand eggs are produced at its facilities by hens that are provided with a vegetarian diet. It markets organic, vegetarian and omega-3 eggs under its 4-Grain brand, which consists of conventional and cage-free eggs. Its Sunups and Sunny Meadow brands are sold as conventional eggs.', 'Ridgeland, MS, United States', 3683);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADCT', 'STOCK', 'ADC Therapeutics SA', 'NYQ', 'Healthcare', 'Biotechnology', 'ADC Therapeutics SA is a Switzerland-based clinical-stage oncology drug discovery and development company. It develops antibody drug conjugates (ADCs) for the treatment of both solid and hematological cancers. It employs monoclonal antibodies specific to particular tumor antigens conjugated to a class of pyrrolobenzodiazepine (PBD)-based warheads to selectively target and kill cancer cells. The Company has multiple PBD-based ADCs in ongoing clinical trials, ranging from first in human to pivotal Phase II clinical trials, and numerous preclinical ADCs in development. Its main drug candidates are ADCT-301 for the treatment of lymphoma and leukemia and ADCT-402 for the treatment of non-Hodgkins lymphoma and B-cell leukemia. It serves customers in the United States, Switzerland, and the United Kingdom.', 'Epalinges, , Switzerland', 263);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COGT', 'STOCK', 'Cogent Biosciences, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Cogent Biosciences, Inc. is a biotechnology company. The Company is focused on developing precision therapies for genetically defined diseases. The Companys clinical program, bezuclastinib, is a selective tyrosine kinase inhibitor that is designed to potently inhibit the KIT D816V mutation as well as other mutations in KIT exon 17. KIT D816V is responsible for driving systemic mastocytosis, a serious disease caused by unchecked proliferation of mast cells. In addition to bezuclastinib, the Company is developing a portfolio of novel targeted therapies to help patients fighting serious, genetically driven diseases initially targeting mutations in FGFR2, ErbB2 and PI3K?. SUMMIT is its randomized, global, multicenter, double-blind, placebo-controlled, multi-part Phase II clinical trial for patients with Non-AdvSM. APEX is an open-label, global, multicenter study evaluating the safety, efficacy, pharmacokinetic, and pharmacodynamic profiles of bezuclastinib.', 'Waltham, MA, United States', 205);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DK', 'STOCK', 'Delek US Holdings, Inc.', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'Delek US Holdings, Inc. is a diversified downstream energy company with assets in petroleum refining, logistics, pipelines, and renewable fuels. The Company''s segments include Refining and Logistics. The Refining segment processes crude oil and other feedstocks for the manufacture of transportation motor fuels, including various grades of gasoline, diesel fuel and aviation fuel, asphalt and other petroleum-based products that are distributed through owned and third-party product terminals. The Refining segment also owns three biodiesel facilities, located in Crossett, Arkansas, Cleburne, Texas and New Albany, Mississippi. The Logistics segment is engaged in gathering, transporting and storing crude oil and natural gas, marketing, distributing, transporting and storing intermediate and refined products and disposing and recycling water in select regions of the southeastern United States and North Dakota, the Midland Basin in Texas, the Delaware Basin in New Mexico and West Texas.', 'Brentwood, TN, United States', 1987);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYD', 'STOCK', 'Boyd Gaming Corporation', 'NYQ', 'Consumer Cyclical', 'Resorts & Casinos', 'Boyd Gaming Corporation is a gaming company. It operates over 28 gaming entertainment properties in 10 states, manager of a tribal casino in northern California, and owner and operator of Boyd Interactive, a B2B and B2C online casino gaming business. Its segments include Las Vegas Locals, Downtown Las Vegas, Midwest & South, and Online. The Las Vegas Locals segment consists of eight casinos in the Las Vegas metropolitan area. The Downtown Las Vegas segment consists of three properties: California Hotel and Casino, Fremont Hotel & Casino, and Main Street Station Hotel and Casino. Its Midwest & South properties consist of five land-based casinos, five dockside riverboat casinos, three racinos and four barge-based casinos that operate in nine states, predominantly in the Midwest and southern United States. The Online segment includes its online gaming operations through collaborative arrangements with third parties throughout the United States and the operations of Boyd Interactive.', 'Las Vegas, NV, United States', 16129);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKD', 'STOCK', 'Brookdale Senior Living Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Brookdale Senior Living Inc. is a premier operator of senior living communities, operating and managing 665 communities in 41 states. The Company operates independent living, assisted living, memory care, and continuing care retirement communities. It operates through three segments: Independent Living; Assisted Living and Memory Care, Continuing Care Retirement Communities (CCRCs). Its Independent Living segment includes owned or leased communities that are primarily designed for middle to upper-income seniors who desire to live in a residential setting that feels like home, without the efforts of ownership. Its Assisted Living and Memory Care segment includes owned or leased communities that offer housing and 24-hour assistance with activities of daily living for the Company''s residents. The CCRCs segment includes large owned or leased communities that offer a variety of living arrangements and services to accommodate a broad spectrum of physical ability and healthcare needs.', 'Brentwood, TN, United States', 24480);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BC', 'STOCK', 'Brunswick Corporation', 'NYQ', 'Consumer Cyclical', 'Recreational Vehicles', 'Brunswick Corporation designs, manufactures and markets recreational marine products, including marine propulsion products and boats, as well as parts and accessories for the marine and RV markets. Its segments include Propulsion, Engine Parts and Accessories (Engine P&A), Navico Group and Boat. The Propulsion segment designs, manufactures and sells engines, controls, rigging, and propellers globally. The Engine P&A segment sells products such as engine parts and consumables including oils and lubricants, electrical products, boat parts and systems, and also includes its marine parts and accessories distribution businesses. The Navico Group segment designs, develops, manufactures, and markets products and systems for the marine and RV, specialty vehicle markets. The Boat segment consists of the Brunswick Boat Group (Boat Group), which manufactures and distributes recreational boats, and Business Acceleration. Its boat brands include Boston Whaler, Lund, Sea Ray and Bayliner.', 'Mettawa, IL, United States', 15000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATEC', 'STOCK', 'Alphatec Holdings, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'Alphatec Holdings, Inc., through its wholly owned subsidiaries, Alphatec Spine, Inc., EOS imaging S.A.S. and SafeOp Surgical, Inc., is a medical device company. The Company is focused on the design, development, and advancement of technology for better surgical treatment of spine disorders. The Company''s Organic Innovation Machine is focused on developing new approaches that integrate with its expanding Alpha InformatiX (AIX) Platform to better inform surgery and safely and reproducibly achieve the goals of spine surgery. Its technologies include AIX, positioners, access systems, implants and fixation systems, and biologics. Its AIX product platform comprises its EOS imaging system and VEA alignment mobile application, its SafeOp Neural InformatiX System and its navigation-enabled robotics platform (Valence). It has developed approach-specific patient positioning systems that integrate with its other access systems, providing for a more rigid construct and enhanced reproducibility.', 'Carlsbad, CA, United States', 867);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FHB', 'STOCK', 'First Hawaiian, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'First Hawaiian, Inc. is a bank holding company. Its principal subsidiary is First Hawaiian Bank (the Bank). The Bank provides a range of banking services to consumer and commercial customers, including deposit products, lending services and wealth management and trust services. Its segments include Retail Banking, Commercial Banking and Treasury and Other. Its Retail Banking segment includes the financial products and services it provides to consumers and small businesses. Its Retail Banking segment also includes its wealth management services. Its Commercial Banking segment includes its corporate banking-related products, commercial real estate loans, commercial lease financing, secured and unsecured lines of credit, automobile loans and auto dealer financing, business deposit products and credit cards. Its Treasury and Other segment include its treasury business, which consists of corporate asset and liability management activities, including interest rate risk management.', 'Honolulu, HI, United States', 2006);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRFS', 'STOCK', 'BRF S.A.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'A BRF S.A. é uma empresa multinacional brasileira que possui um portfólio diversificado de produtos e é um produtor de alimentos. Os segmentos da Companhia incluem Brasil, América Latina (LATAM), Médio Oriente e Norte da África (MENA), África e Outros Segmentos. Esses segmentos incluem vendas de todos os canais de distribuição e operações subdivididas em aves, suínos e outras, processadas e outras vendas. As operações avícolas incluem a produção e venda de cortes integrais e ao natural de aves. A carne suína e outras operações envolvem a produção e a venda de cortes naturais. As operações processadas incluem a produção e venda de alimentos processados, produtos congelados e processados derivados de produtos de aves, carne suína e bovina, margarina, produtos vegetais e à base de soja. As outras operações de vendas incluem a comercialização de farinha para serviço de alimentação e outras. Outros segmentos incluem a venda de cortes naturais de carne bovina, produtos agrícolas e ração anim', 'São Paulo, SP, Brazil', 100000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COWG', 'STOCK', 'Pacer US Large Cap Cash Cows Growth Leaders ETF', 'NGM', NULL, NULL, 'The index uses a rules-based methodology that seeks to provide exposure to large-capitalization U.S. companies with above average free cash flow margins. Under normal circumstances, the fund will seek to invest at least 80% of its net assets, plus the amount of any borrowings for investment purposes, in securities of large-capitalization companies (“large cap”) that are principally traded in the United States. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WCC', 'STOCK', 'WESCO International, Inc.', 'NYQ', 'Industrials', 'Industrial Distribution', 'WESCO International, Inc. is a provider of business-to-business distribution, logistics services and supply chain solutions. The Company''s segments include Electrical & Electronic Solutions (EES), Communications & Security Solutions (CSS) and Utility & Broadband Solutions (UBS). EES segment supplies a range of products and solutions primarily to construction, industrial and original equipment manufacturer customers. EES product portfolio includes a range of electrical equipment and supplies, automation and connected devices, and others. CSS segment specializes in data center, network infrastructure and security solutions. In the security business, CSS offers on premise, cloud or hybrid comprehensive solutions for video surveillance, fire and intrusion detection, and others. UBS segment provides products and services to investor-owned utilities, public power companies, including municipalities, as well as global service providers, wireless providers, broadband operators and others.', 'Pittsburgh, PA, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFC', 'STOCK', 'Ellington Financial Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Ellington Financial Inc. is a real estate investment trust. The Company acquires and manages mortgage-related, consumer-related, corporate-related, and other financial assets. The Companys segments include the Investment Portfolio Segment and the Longbridge Segment. The Investment Portfolio Segment is focused on investing in a diverse array of financial assets, including residential and commercial mortgage loans, residential mortgage-backed securities (RMBS), commercial mortgage-backed securities (CMBS), consumer loans and asset-backed securities (ABS), including ABS-backed by consumer loans, collateralized loan obligations (CLOs), non-mortgage- and mortgage-related derivatives, debt and equity investments in loan origination companies, and other strategic investments. The Longbridge Segment is focused on the origination and servicing of, and investment in, reverse mortgage loans. The Company is externally managed and advised by Ellington Financial Management LLC.', 'Old Greenwich, CT, United States', 400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DE', 'STOCK', 'Deere & Company', 'NYQ', 'Industrials', 'Farm & Heavy Construction Machinery', 'A Deere & Company está envolvida na entrega de equipamentos agrícolas, de construção e florestais. Seus segmentos incluem agricultura de produção e precisão (PPA), pequena agricultura e turfa (SAT), construção e silvicultura (CF) e serviços financeiros (FS). O segmento PPA define, desenvolve e entrega equipamentos e soluções tecnológicas globais para produtores em escala de produção de grãos grandes, grãos pequenos, algodão e cana-de-açúcar. A SAT Segment define, desenvolve e fornece equipamentos e soluções tecnológicas globais para produtores de laticínios e gado, produtores de culturas de pequeno porte e alto valor, e clientes de gramados e serviços públicos. O segmento CF define, desenvolve e fornece uma gama de máquinas e soluções tecnológicas organizadas ao longo dos sistemas de produção de terraplanagem, silvicultura e construção de estradas. O segmento FS financia vendas e locações por revendedores John Deere de equipamentos novos e usados de produção e agricultura de precisão e', 'Moline, IL, United States', 75800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BARK', 'STOCK', 'BARK, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'BARK, Inc. is a dog-centric company. The Company is an omnichannel brand serving dogs across two key categories: toys & accessories and consumables. All of its products are designed, developed, and branded by BARK. The Company''s segments include direct to consumer and commerce. Its products are sold Direct-to-Consumer (DTC) and through its network of retail partners. It offers BarkBox and Super Chewer, which are subscription products that feature monthly themed boxes of BARK toys and treats that are delivered directly to a dogs home. Customers have the option to subscribe to these products on a one-month, three-month, six-month, or twelve-month basis. The Company offers its customers incremental products via ATB, which allows it to cross-sell customers its full portfolio of products, including kibble, treats, toppers, dental, and more. Its toys and accessories category also includes other products such as beds, leashes, apparel, and other accessories.', 'New York, NY, United States', 691);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELPW', 'STOCK', 'Elong Power Holding Limited', 'NGM', NULL, NULL, 'eLong Power Holding Ltd is a holding company principally engaged in the research and development, manufacturing, sales and service of high-power lithium-ion batteries. The Companys product portfolio includes products utilizing lithium manganese oxide and lithium iron phosphate, among others, to meet the needs of high-power applications and energy storage applications in various scenarios. The Companys products are used for electric vehicles and construction machinery, as well as large-capacity, long-cycle lithium-ion batteries for energy storage systems.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLE', 'STOCK', 'Allegion plc', 'NYQ', 'Industrials', 'Security & Protection Services', 'A Allegion plc é um fornecedor global de produtos e soluções de segurança. A empresa assegura pessoas e ativos com uma gama de soluções para residências, empresas, escolas e instituições. Seu segmento Allegion Americas é um fornecedor de produtos, serviços e soluções de segurança em toda a América do Norte. Ela vende uma gama de produtos e soluções, incluindo fechaduras, locksets, sistemas chave, controles de porta e sistemas, dispositivos de saída, portas, acessórios, produtos de segurança eletrônica, sistemas de controle de acesso e soluções de software e serviços para clientes em instalações comerciais, institucionais e residenciais. Seu segmento internacional Allegion fornece produtos, serviços e soluções de segurança principalmente em toda a Europa, Ásia e Oceania. O segmento oferece aos usuários finais uma gama de produtos, serviços e soluções, incluindo fechaduras, locksets, fechaduras portáteis, sistemas chave, fechos de portas e sistemas, entre outros. Suas marcas incluem CISA', 'Dublin, , Ireland', 14400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APPN', 'STOCK', 'Appian Corporation', 'NGM', 'Technology', 'Software - Infrastructure', 'Appian Corporation is a software company that offers platform, which help organizations run better processes that reduce costs, and improve customer experiences. The Companys Appian platform is an integrated automation platform for process orchestration, automation, and intelligence. The platform provides everything an organization needs to design, automate, and optimize critical processes. Its capabilities include data fabric, robotic process automation (RPA); intelligent document processing (IDP); generative artificial intelligence (AI); AI agents; low-code design; application programming interfaces (APIs); and process intelligence capabilities in a single platform. Its data fabric is an integrated data layer that unifies data across systems without requiring companies to migrate their data. Its patented data fabric technology supports both analytical and transactional workloads, which allows users to build applications that create and update enterprise data.', 'McLean, VA, United States', 2033);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACAD', 'STOCK', 'ACADIA Pharmaceuticals Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Acadia Pharmaceuticals Inc. is a biopharmaceutical company. It develops and commercializes medicines that address unmet medical needs in central nervous system (CNS) disorders and rare diseases. It has a portfolio of product candidates and research programs that are designed to address significant unmet medical needs in CNS disorders and rare diseases. Its pipeline includes NUPLAZID (pimavanserin), DAYBUE (trofinetide), ACP-101, ACP-204, and ACP-711. NUPLAZID is a selective serotonin inverse agonist/antagonist preferentially targeting the 5-HT2A receptor. NUPLAZID is developed for the treatment for Parkinson''s Disease Psychosis. Trofinetide is a novel synthetic analog of the amino-terminal tripeptide of insulin-like growth factor 1 designed to treat the core symptoms of Rett syndrome by reducing neuroinflammation and supporting synaptic function. Its early-stage research programs and product candidates include ACP-211, ACP-2591, ACP-271, and Antisense Oligonucleotide (ASO) Programs.', 'San Diego, CA, United States', 653);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFX', 'STOCK', 'Equifax Inc.', 'NYQ', 'Industrials', 'Consulting Services', 'A Equifax Inc. É uma empresa global de dados, análises e tecnologia. A empresa está envolvida em ajudar instituições financeiras, empresas, empregadores e agências governamentais a tomar decisões críticas. O segmento de Soluções de Força de Trabalho da Companhia oferece serviços que permitem aos clientes verificar renda, emprego, histórico educacional, dados de justiça criminal, licenciamento profissional de saúde e sanções de pessoas nos Estados Unidos. O segmento U.S. Information Solutions (USIS) da empresa fornece soluções de informação comercial e de consumo para empresas nos Estados Unidos, incluindo informações on-line, soluções de tecnologia de decisão, serviços de gestão de identidade, serviços analíticos, serviços de proteção contra fraudes e cobranças de comércio eletrônico, serviços de gestão de portfólio, informações sobre hipotecas e serviços de marketing. O segmento internacional da Companhia fornece produtos e serviços semelhantes aos disponíveis no segmento USIS, mas co', 'Atlanta, GA, United States', 15000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNL', 'STOCK', 'Broadstone Net Lease, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'Broadstone Net Lease, Inc. is an industrial-focused, diversified net lease real estate investment trust (REIT). The Company invests primarily in primarily single-tenant commercial real estate properties that are net leased on a long-term basis to a diversified group of tenants. It is primarily diversified across industrial and retail property types. Under industrial property type, it includes manufacturing, distribution and warehouse, food processing, flex and research and development, cold storage, and services. Under retail property type, it includes general merchandise, casual dining, quick service restaurants, automotive, animal services, home furnishings, healthcare services, and education. Under Other property type, it includes office and clinical/surgical. The Company''s portfolio consists of approximately 765 properties, with 758 properties located in 44 U.S. states and seven properties located in four Canadian provinces.', 'Victor, NY, United States', 73);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAH', 'STOCK', 'Cardinal Health, Inc.', 'NYQ', 'Healthcare', 'Medical Distribution', 'A Cardinal Health, Inc. É uma empresa global de serviços e produtos de saúde. A empresa está envolvida no fornecimento de soluções personalizadas para hospitais, sistemas de saúde, farmácias, centros de cirurgia ambulatorial, laboratórios clínicos, consultórios médicos e pacientes em casa. A empresa também fornece produtos farmacêuticos e médicos. Os segmentos da Companhia incluem Soluções Farmacêuticas e Especializadas e Global Medical Products and Distribution (GMPD). O segmento de Soluções Farmacêuticas e Especializadas distribui produtos farmacêuticos de marca e genéricos, farmacêuticos especializados e produtos de consumo e cuidados de saúde de balcão nos Estados Unidos. Seu segmento GMPD fabrica, fornece e distribui produtos médicos, cirúrgicos e laboratoriais da marca Cardinal Health, vendidos nos Estados Unidos, Canadá, Europa, Ásia e outros mercados. A empresa coneta pacientes, prestadores, pagadores, farmacêuticos e fabricantes para coordenação integrada do cuidado.', 'Dublin, OH, United States', 53084);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GORO', 'STOCK', 'Gold Resource Corporation', 'ASE', 'Basic Materials', 'Gold', 'Gold Resource Corporation is a gold and silver producer, developer, and explorer with its operations centered on the Don David Gold Mine in Oaxaca, Mexico. Base metals, critical to the United States, are also produced as a by-product. The Companys focus is to unlock the significant upside potential of its existing infrastructure and large land position surrounding the mine in Oaxaca, Mexico and to develop the Back Forty Project in Michigan, United States. Back Forty is a 100%-owned development-stage project delineating a gold-rich volcanogenic massive sulfide (VMS) deposit located along the mineral-rich Penokean Volcanic Belt in Michigans Upper Peninsula. Its segments include Oaxaca, Mexico, and Michigan, U.S.A. Oaxaca, Mexico represents the Companys only operating segment with a production stage property that produces copper, lead, and zinc concentrates that also contain gold and silver. Michigan, U.S.A. is an advanced exploration stage property with no current metal production.', 'Denver, CO, United States', 480);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WH', 'STOCK', 'Wyndham Hotels & Resorts, Inc.', 'NYQ', 'Consumer Cyclical', 'Lodging', 'Wyndham Hotels & Resorts, Inc. is a hotel franchising company. The Company operates through one segment: Hotel Franchising. The Hotel Franchising segment consists of licensing its lodging brands and providing related services to third-party hotel owners and others. The Company operates approximately 9,300 hotels across over 95 countries on six continents. Through its network of approximately 903,000 rooms appealing to the everyday traveler. The Company operates a portfolio of 25 hotel brands, including Super 8, Days Inn, Ramada, Microtel, La Quinta, Baymont, Wingate, AmericInn, ECHO Suites, Registry Collection Hotels, Trademark Collection, and Wyndham.', 'Parsippany, NJ, United States', 2200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALMS', 'STOCK', 'Alumis Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Alumis Inc. is a late-stage biopharmaceutical company. The Company is engaged in developing next-generation targeted therapies with the potential to significantly improve patient health and outcomes across a range of immune-mediated diseases. Leveraging its proprietary data analytics platform and precision approach, the Company is developing a pipeline of oral tyrosine kinase 2 (TYK2) inhibitors, consisting of ESK-001 for the treatment of systemic immune-mediated disorders, such as moderate-to-severe plaque psoriasis and systemic lupus erythematosus, and A-005 for the treatment of neuroinflammatory and neurodegenerative diseases such as multiple sclerosis and Parkinsons Disease. In addition, its pipeline also includes lonigutamab, a subcutaneously delivered anti-insulin-like growth factor 1 receptor therapy for the treatment of thyroid eye disease, as well as several preclinical programs identified through this precision approach.', 'South San Francisco, CA, United States', 182);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIO', 'STOCK', 'City Office REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'City Office REIT, Inc. is an internally managed real estate company. The Company is focused on acquiring, owning and operating office properties located predominantly in Sun Belt markets. The Company owns around 22 properties comprising approximately 54 office buildings with a total of approximately 5.4 million square feet of net rentable area (NRA) in the metropolitan areas of Dallas, Denver, Orlando, Phoenix, Portland, Raleigh, San Diego, Seattle and Tampa. The Company''s properties include 2525 McKinnon, The Terraces, Circle Point, Denver Tech, Florida Research Park, 5090 North 40th Street, Papago Tech, Pima Center, San Tan, The Quad, AmberGlen, Bloc 83, Mission City, Canyon Park, Carillon Point, City Center, Intellicenter, and Park Tower.', 'Vancouver, BC, Canada', 20);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTCT', 'STOCK', 'BTC Digital Ltd.', 'NCM', 'Technology', 'Computer Hardware', 'BTC Digital Ltd, formerly Meten Holding Group Ltd, is a holding company primarily engaged in the bitcoin mining business. The Company is also involved in mining machines resale and rental business operations.', 'Singapore, , Singapore', 21);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCCC', 'STOCK', 'C4 Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'C4 Therapeutics, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on delivering targeted protein degradation science to create a new generation of medicines that transform patients lives. The Company is focused on progressing targeted oncology programs through clinical studies and leveraging its TORPEDO platform to design and optimize small-molecule medicines to address difficult-to-treat diseases. Its advanced product candidate, cemsidomide, is an orally bioavailable MonoDAC degrader of protein targets called IKZF1 and IKZF3. Cemsidomide is in clinical development for multiple myeloma (MM), and non-Hodgkin lymphoma (NHL). Its CFT1946 is an orally bioavailable BiDAC degrader designed to be potent and selective against BRAF V600X mutant proteins. It is also developing CFT8919, an orally bioavailable, allosteric, mutant-selective BiDAC degrader of epidermal growth factor receptor (EGFR), with an L858R mutation in non-small lung cancer (NSCLC).', 'Watertown, MA, United States', 110);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CABA', 'STOCK', 'Cabaletta Bio, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Cabaletta Bio, Inc. is a clinical-stage biotechnology company focused on the discovery and development of engineered T cell therapies that have the potential to provide deep and durable, perhaps curative, responses with one-time administration for patients with autoimmune diseases. Its Cabaletta Approach to B cell Ablation (CABA) platform encompasses two strategies: Chimeric Antigen Receptor T cells for Autoimmunity (CARTA) and Chimeric AutoAntibody Receptor T cells (CAART). Resecabtagene autoleucel, its lead product candidate from its CARTA platform, is a 4-1BB co-stimulatory domain-containing fully human CD19-CAR T construct designed to treat patients with a range of autoimmune diseases. Its DSG3-CAART product candidate is being evaluated for the treatment of mPV, a subtype of PV that affects the epithelium of the mucous membranes, in the Phase 1 DesCAARTes TM trial. Its MuSK-CAART product candidate is designed to treat a subset of patients with MG, targeting autoreactive B cells.', 'Philadelphia, PA, United States', 167);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('A', 'STOCK', 'Agilent Technologies, Inc.', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'A Agilent Technologies, Inc. É especializada em ciências da vida, diagnósticos e mercados aplicados, fornecendo soluções focadas em aplicações que incluem instrumentos, software, serviços e consumíveis para todo o fluxo de trabalho do laboratório. Seus segmentos incluem mercados de Ciências da Vida e Diagnóstico, Agilent CrossLab e Mercados Aplicados. O segmento de mercados de Ciências da Vida e Diagnóstico compreende sete áreas de atuação. Oferece ingredientes farmacêuticos ativos para terapias à base de oligo, bem como soluções que incluem reagentes, instrumentos, software e consumíveis. O segmento de CrossLab da Agilent oferece um portfólio de serviços e consumíveis que abrange todo o laboratório, além de soluções de automação de software e laboratório, projetadas para melhorar os resultados dos clientes. O segmento de Mercados Aplicados oferece soluções focadas em aplicações que incluem instrumentos e software que permitem aos clientes identificar, quantificar e analisar as proprie', 'Santa Clara, CA, United States', 18000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARQQ', 'STOCK', 'Arqit Quantum Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Arqit Quantum Inc. is engaged in supplying encryption software services. The Companys encryption software service, which makes the communications links of any networked device, cloud machine or data at rest secure against both current and future forms of attack on encryption, even from a quantum computer. Its products and services include Arqit SKA Platform, Arqit NetworkSecure and Encryption Intelligence. Arqit SKA-Platform is a platform as a service that creates a secure global mesh between different cloud providers and on-premises data centers around the globe. SKA-Platform supplies the platform that enables end points to share data securely for the creation of new keys. It also allows the Company to provide secure services for customers to store, communicate and sign their data. NetworkSecure is a standardized interface for network devices, like firewalls, to agree quantum-safe symmetric keys and upgrade the security of VPN connections over Internet Security Protocol (IPsec).', 'London, , United Kingdom', 72);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOOO', 'STOCK', 'BRP Inc.', 'NMS', 'Consumer Cyclical', 'Recreational Vehicles', 'BRP Inc. is a Canada-based company that specializes in powersports products, propulsion systems and boats. The Companys segments include Powersports and Marine. The Powersports segment comprises Year-Round Products (all-terrain vehicles, side-by-side vehicles, three-wheeled vehicles, and two-wheeled vehicles), Seasonal Products (snowmobiles, personal watercraft and pontoons) and Powersports PA&A and OEM Engines (parts, accessories and apparel (PA&A), engines for karts, recreational aircraft and jet boats, and other services). The Marine segment includes boats, pontoons, outboard engines and related PA&A, and other services. Its brands include Ski-Doo and Lynx snowmobiles, Sea-Doo watercraft and pontoons, Can-Am on and off-road vehicles, Alumacraft and Quintrex boats, Manitou pontoons and Rotax marine propulsion systems and Rotax engines for karts and recreational aircraft and Pinion gearboxes. It is developing electric models for its existing product lines.', 'Valcourt, QC, Canada', 16500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVI', 'STOCK', 'CVR Energy, Inc.', 'NYQ', 'Energy', 'Oil & Gas Refining & Marketing', 'CVR Energy, Inc. is a diversified holding company primarily engaged in the renewable fuels and petroleum refining and marketing businesses, as well as in the nitrogen fertilizer manufacturing business through its interest in CVR Partners, LP. The Company''s segments include Petroleum Segment, Renewables Segment and Nitrogen Fertilizer Segment. Petroleum Segment includes the refining and marketing of high value transportation fuels which consist of gasoline, diesel, jet fuel, and distillates. The Petroleum Segment also includes activities related to crude gathering and logistics that support the refinery operations. Renewables Segment includes the refining of renewable feedstocks, such as soybean oil, corn oil, and other renewable feedstocks, into renewable diesel and marketing of renewables products. Nitrogen Fertilizer Segment includes the production and distribution of nitrogen fertilizer products, primarily in the form of ammonia and urea ammonium nitrate, for the farming industry.', 'Sugar Land, TX, United States', 1595);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOCU', 'STOCK', 'DocuSign, Inc.', 'NMS', 'Technology', 'Software - Application', 'A DocuSign, Inc. Oferece produtos de assinatura eletrônica, permitindo que um contrato seja assinado eletronicamente em uma variedade de dispositivos, de praticamente qualquer lugar do mundo. As ofertas de produtos da Empresa incluem o produto de assinatura eletrônica, que permite que as organizações façam negócios mais rapidamente com menos risco e com menor custo, proporcionando uma melhor experiência para os clientes. Ele também oferece software de gerenciamento de ciclo de vida de contratos que automatiza fluxos de trabalho pré e pós-assinatura. Isso inclui gerar automaticamente um contrato a partir de dados em outros sistemas, apoiar fluxos de trabalho de negociação, verificar identidades, permitir a notarização on-line remota, coletar pagamentos após assinaturas e usar inteligência artificial (IA) para analisar uma coleção de acordos para riscos e oportunidades. Seus produtos incluem eSignature, Contract Lifecycle Management (CLM), Gen for Salesforce, Identify and Monitor. Sua Ge', 'San Francisco, CA, United States', 6838);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OPFI', 'STOCK', 'OppFi Inc.', 'NYQ', 'Financial Services', 'Credit Services', 'OppFi Inc. is a tech-enabled, mission-driven specialty finance platform. It provides customer experience in the industry and enables banks to offer credit products. Its primary product is offered by its OppLoans platform. The OppFi platform is a mobile-optimized online application where eligible applicants, at their request, are able to opt into the OppFi TurnUp Program. This program helps these applicants find more affordable credit options by checking the market voluntarily on their behalf for a sub-36% annual percentage rate, products offered by third-party lenders through other platforms. It collects and calculates more than 500 attributes on loan applications for use in underwriting decisions. These attributes are based on data from credit bureaus, bank transactions and loan applications. Using this information, OppFi generates a score in combination with scores generated by third-party providers. It offers a same-day funding service in collaboration with its partner banks.', 'Chicago, IL, United States', 445);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESRT', 'STOCK', 'Empire State Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'Empire State Realty Trust, Inc. is a real estate investment trust (REIT), which owns and operates a portfolio of office, retail and multifamily assets. The Companys portfolio consists of approximately 7.8 million rentable square feet of office space, 0.8 million rentable square feet of retail space and 732 residential units. Its office portfolio included 10 properties. Nine of these office properties are located in midtown Manhattan and encompass over 7.6 million rentable square feet of office space and 0.5 million rentable square feet of retail space, including the Empire State Building. The Companys segments include Real Estate and an Observatory. The Real Estate segment includes all activities related to the ownership, management, operation, acquisition, repositioning and disposition of its office, retail and multifamily assets principally located in New York City. The Observatory segment operates the 86th and 102nd floor observatories in the Empire State Building.', 'New York, NY, United States', 667);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADNT', 'STOCK', 'Adient plc', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Adient PLC is an automotive seating supplier company. The Companys automotive seating solutions include complete seating systems, frames, mechanisms, foam, head restraints, armrests and trim covers. The Company designs, manufactures and markets a full range of seating systems and components for passenger cars, commercial vehicles and light trucks, including vans, pick-up trucks and sport/crossover utility vehicles. The Company manages its business on a geographic basis and operates in three reportable segments: Americas, which is inclusive of North America and South America; Europe, Middle East, and Africa (EMEA), and Asia Pacific/China (Asia). The Company operates approximately 200 wholly- and majority-owned manufacturing or assembly facilities, with operations in approximately 29 countries. The Company provides production and service parts to its customers under multi-year programs.', 'Dublin, , Ireland', 70000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASBP', 'STOCK', 'Aspire Biopharma Holdings, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Aspire Biopharma Holdings, Inc. is an early-stage biopharmaceutical company. It develops and markets a technology for novel delivery mechanisms for FDA approved drugs, nutraceuticals, and supplements. It has developed and acquired technologies that are a Novel Soluble Formulation which address emergencies and drug efficacy, dosage management, and response time. Its Sublingual Aspirin Product, which addresses cardiology emergencies and pain management, is a granular or powder formulation of a soluble, Ph-neutral, fast-acting aspirin. It also has numerous pharmaceutical and nutraceutical applications under development in various areas, including but not limited to a Viagra/Cialis combination product which is faster acting, requiring decreased dosages with the benefit of a longer half-life, various bi-hormonal drugs such as testosterone, estrogen and weight loss drugs, and thyroid drugs, as well as various supplements including a rapid-absorbing pre-workout and a melatonin sleep aid.', 'Estero, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIRK', 'STOCK', 'Birkenstock Holding plc', 'NYQ', 'Consumer Cyclical', 'Footwear & Accessories', 'Birkenstock Holding plc operates through Birkenstock Group B.V. & Co. KG and its subsidiaries. Birkenstock is a global brand, which has developed a unisex portfolio of footbed-based products, anchored by its Core Silhouettes, the Madrid, Arizona, Boston, Gizeh and Mayari. Its proprietary footbed, which reflects the anatomy of the human foot, represents the foundation of its brand and products. It operates a vertically integrated manufacturing base and produce all its footbeds in Germany. In addition, it assembles the majority of its products in Germany and produce the remainder elsewhere in the European Union. The Company operates its channels, utilizing the business-to-business (B2B) channel to facilitate brand accessibility while fully engaging consumers in its direct-to-consumer (DTC) channel, which offers its complete product range and access to its silhouettes.', 'London, , United Kingdom', 6200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNS', 'STOCK', 'The Bank of Nova Scotia', 'NYQ', 'Financial Services', 'Banks - Diversified', 'O Banco da Nova Escócia (o Banco) é um banco fretado canadense. Os segmentos do Banco incluem Canadian Banking, International Banking, Global Wealth Management, Global Banking and Markets, e outros. O segmento bancário canadense fornece um conjunto completo de consultoria financeira e soluções bancárias. O segmento de Banca Internacional é uma franquia diversificada que oferece consultoria financeira e soluções para clientes de varejo, corporativos e comerciais. O segmento Global Wealth Management está focado em fornecer consultoria e soluções abrangentes de gestão de patrimônio para clientes em toda a área de atuação do Banco. O segmento Global Wealth Management atende clientes de fundos de investimento e consultoria em 13 países. O segmento Global Banking and Markets fornece aos clientes corporativos serviços de empréstimo e transação, consultoria bancária de investimento e acesso aos mercados de capitais. O outro segmento inclui Tesouraria de Grupo, segmentos operacionais menores e ', 'Toronto, ON, Canada', 86746);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLM', 'STOCK', 'Cornerstone Strategic Investment Fund, Inc.', 'ASE', 'Financial Services', 'Asset Management', 'Cornerstone Strategic Value Fund, Inc. is a closed-ended equity mutual fund launched and managed by Cornerstone Advisors, LLC. The fund invests in public equity markets across the globe. It seeks to invest in stocks of companies operating across diversified sectors. The fund primarily invests in value and growth stocks of companies. It also invests through other closed-end investment companies and ETF''s. Cornerstone Strategic Value Fund, Inc. was formed on May 1, 1987 and is domiciled in the United States.', 'Asheville, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAN', 'STOCK', 'Dana Incorporated', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Dana Incorporated is engaged in the design and manufacture of propulsion and energy-management solutions that power vehicles and machines in all mobility markets across the globe. The Company is shaping sustainable progress through its conventional and clean-energy solutions that support nearly every vehicle manufacturer with drive and motion systems, and electrodynamic technologies. It offers axles, driveshafts, transmissions, sealing and thermal products to electrification products, including motors, inverters, controllers, e-sealing, e-thermal and digital solutions. The Company operates in four segments: Light Vehicle Drive Systems, Commercial Vehicle Drive and Motion Systems, Off-Highway Drive and Motion Systems, and Power Technologies. It owns and has licensed trademarks, such as Spicer Electrified, Victor Reinz, Long, Graziano and Dana TM4. It operates in North America, Europe, South America and Asia Pacific regions. Its North America includes Canada, Mexico and the USA.', 'Maumee, OH, United States', 28000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXR', 'STOCK', 'Extra Space Storage Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'A Extra Space Storage, Inc. É uma confiança de investimento imobiliário auto-administrada e auto-gerida (REIT). A Companhia possui, opera, gerencia, presta empréstimos, adquire, desenvolve e redesenvolve propriedades de auto-armazenamento (lojas). Suas lojas oferecem aluguel mensal de espaço de armazenamento para uso pessoal ou empresarial. Seus segmentos incluem operações de self-storage e resseguro de inquilino. Seu segmento de operações de self-storage inclui operações de locação de lojas de propriedade integral. Seu segmento de resseguro de inquilino inclui o resseguro de riscos relacionados à perda de bens armazenados pelos inquilinos em suas lojas. Possui e/ou opera aproximadamente 4 011 lojas de self-storage em 42 estados e Washington, D.C. Suas lojas compreendem aproximadamente 2,8 milhões de unidades e 308,4 milhões de pés quadrados de espaço disponível operando sob a marca Extra Space. Oferece aos clientes uma seleção de unidades de armazenamento convenientemente localizadas ', 'Salt Lake City, UT, United States', 8012);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOX', 'STOCK', 'Box, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'Box, Inc. is an intelligent content management provider. The Company''s platform enables organizations to drive collaboration, manage the entire content lifecycle, secure critical content, and transform business workflows with enterprise artificial intelligence (AI). The Company offers Web, mobile and desktop applications of its solution on a single platform, as well as the ability to develop custom applications. Its capabilities include advanced data protection and compliance, modern workflow and collaboration experiences, a flexible and interoperable platform, and integration with advanced AI models. Its advanced data protection and compliance capabilities include global cloud architecture, enterprise-grade security, intelligent threat detection and smart access with Box Shield, and comprehensive data governance strategy. Its modern workflow and collaboration experiences include intelligent, no-code apps; connected forms; electronic signatures, and automated document generation.', 'Redwood City, CA, United States', 2810);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AOS', 'STOCK', 'A. O. Smith Corporation', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'A. O. Smith Corporation aplica tecnologias e soluções a produtos fabricados e comercializados em todo o mundo. A Companhia opera através de dois segmentos: América do Norte e Resto do Mundo. Tanto os segmentos fabricam e comercializam uma linha abrangente de aquecedores de água, caldeiras, tanques e produtos de tratamento de água residenciais e comerciais. Seu segmento do resto do mundo é composto principalmente da China, Europa e India. O segmento da América do Norte atende aos mercados residenciais e comerciais finais com uma gama de produtos, incluindo aquecedores de água, caldeiras, produtos de tratamento de água e outros. A empresa também fabrica tanques de expansão, sistemas comerciais de aquecimento de água solar, aquecedores de piscina e spa, produtos e peças relacionadas. Sua marca Lochinvar é uma marca residencial e comercial de caldeiras nos Estados Unidos. Seus produtos de marca de amaciador de água e soluções de água de poço problemático incluem Haia, Water-Right, Master W', 'Milwaukee, WI, United States', 12700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARES', 'STOCK', 'Ares Management Corporation', 'NYQ', 'Financial Services', 'Asset Management', 'A Ares Management Corporation é um gerente de investimento alternativo que oferece aos clientes soluções complementares de investimento primário e secundário em várias classes de ativos. Seus segmentos incluem Grupo de Crédito, Private Equity Group, Real Assets Group, Secondaries Group e outros. O segmento Credit Group gerencia estratégias de crédito em todo o espetro líquido e líquido, incluindo crédito líquido, crédito alternativo, crédito direto e crédito APAC. O segmento Private Equity Group categoriza suas estratégias de investimento como private equity corporativo, oportunidades especiais e private equity da APAC. O segmento do Real Assets Group gerencia estratégias abrangentes de capital e dívida em investimentos imobiliários e em infraestrutura. O segmento do Grupo Secondaries investe em mercados secundários numa gama de estratégias alternativas de classe de ativos, incluindo private equity, imobiliário, infra-estrutura e crédito. Possui operações na América do Norte, América d', 'Los Angeles, CA, United States', 3776);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIBK', 'STOCK', 'First Interstate BancSystem, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'First Interstate BancSystem, Inc. is a financial and bank holding company focused on community banking. Through its bank subsidiary, First Interstate Bank, the Company delivers a comprehensive range of banking products and services, including online and mobile banking, to individuals, businesses, government entities, and others throughout its market areas. It operates through the Community Banking segment, which encompasses commercial, governmental, and consumer banking services provided through its Bank: primarily the acceptance of deposits, the extension of credit, mortgage loan origination and servicing, and wealth management, which includes trust, employee benefit, investment management, insurance, agency, and custodial services to individuals, businesses, and nonprofit organizations. It provides loans to a wide variety of industries, including agriculture, healthcare, professional services, technology, construction, hospitality, real estate development, tourism, and others.', 'Billings, MT, United States', 3481);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTAS', 'STOCK', 'Cintas Corporation', 'NMS', 'Industrials', 'Specialty Business Services', 'A Cintas Corporation desenvolve programas uniformes usando tecido. A empresa ajuda empresas de todos os tipos e tamanhos, principalmente nos Estados Unidos, bem como no Canadá e na América Latina. A Empresa atua através de dois segmentos: O segmento Uniform Rental e Facility Services e o segmento de Primeiros Socorros e Serviços de Segurança. O segmento Uniform Rental and Facility Services consiste no aluguer e manutenção de uniformes e outras peças de vestuário, incluindo vestuário resistente a chamas, tapetes, esfregões e toalhas de loja e outros artigos auxiliares. Este segmento também inclui serviços de limpeza de banheiros e suprimentos e a venda de itens de seus catálogos para seus clientes. O segmento de Primeiros Socorros e Serviços de Segurança consiste em produtos e serviços de primeiros socorros e segurança. O restante de seus segmentos, que consiste no segmento de Serviços de Proteção contra Incêndio e no segmento Uniforme de Venda Direta, está incluído em todos os outros. ', 'Cincinnati, OH, United States', 48300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCTX', 'STOCK', 'BriaCell Therapeutics Corp.', 'NCM', 'Healthcare', 'Biotechnology', 'BriaCell Therapeutics Corp. is a clinical-stage biotechnology company that develops novel immunotherapies to transform cancer care. Bria-IMT, its Phase 3 lead candidate, is a patented, off-the-shelf, cell-based, targeted immunotherapy that activates the patients immune system to specifically kill cancer cells without harming other cells. The Company is advancing its Bria-IMT targeted immunotherapy in combination with an immune check point inhibitor (Retifanlimab) in a pivotal Phase 3 study in metastatic breast cancer. It is also developing personalized off-the-shelf immunotherapies, Bria-OTS and Bria-OTS+, which provides a platform technology to develop personalized off-the-shelf immunotherapies for numerous types of cancer, and a soluble CD80 protein therapeutic which act both as a stimulator of the immune system, as well as an immune checkpoint inhibitor. Its pipeline also includes Bria-IMT + CPI, Bria-BRES/BRES+, Bria-PROS+, Bria-LUNG+ and Bria-MEL+.', 'West Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('IT', 'STOCK', 'Gartner, Inc.', 'NYQ', 'Technology', 'Information Technology Services', 'A Gartner, Inc. Fornece informações objetivas e acionáveis para executivos e suas equipes. Atua através de três segmentos: Pesquisa, Conferências e Consultoria. O segmento de pesquisa oferece insights objetivos e independentes para líderes de uma empresa por meio de serviços de assinatura que incluem acesso sob demanda a conteúdo de pesquisa publicado, dados e benchmarks, e acesso direto a uma rede de especialistas em pesquisa localizada em todo o mundo. O segmento Gartner Conferences foi projetado para executivos de tecnologia da informação (TI) e de negócios, bem como tomadores de decisão que buscam adaptar e evoluir suas organizações através de interrupções e incertezas, navegar riscos e priorizar investimentos. O segmento de Consultoria atende diretores de informação e outros executivos seniores para otimizar os investimentos em tecnologia e impulsionar o impactos nos negócios. A empresa também fornece soluções para uma gama de prioridades relacionadas com TI, incluindo otimização ', 'Stamford, CT, United States', 20994);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMOD', 'STOCK', 'Alpha Modus Holdings, Inc.', 'NCM', 'Technology', 'Software - Application', 'Alpha Modus Holdings, Inc. is a technology company specializing in artificial intelligence (AI) solutions for the retail industry. It develops and licenses data-driven technologies that enhance consumer engagement and optimize in-store experiences. It has developed comprehensive end-to-end patented solutions for retailers and consumer brands to bring innovation to consumers and enhance their experience at the point of sale. The primary focus of the Companys technology is to analyze consumer behavior and their interactions with retail products in real-time with the objective of providing brands and retailers with the ability to monitor and enhance the consumers in-store experience, manage inventory and create smart planograms, and monetize digital insights. It is focused on engaging consumers with interactive output displays throughout brick-and-mortar retail stores to capture critical decision-making at the point of sale and cater to the specific and immediate needs of the consumer.', 'Cornelius, NC, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AESI', 'STOCK', 'Atlas Energy Solutions Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Atlas Energy Solutions Inc. is a solution provider to the energy industry. Its portfolio of offerings includes oilfield logistics, distributed power systems, and the proppant supply network in the Permian Basin. Its hundred percent of Atlas LLCs sand reserves are located in Texas within the Permian Basin and operations consist of proppant production and processing facilities, including four facilities near Kermit, Texas (together, the Kermit facilities), a fifth facility near Monahans, Texas, and the OnCore distributed mining network. Sand and Logistics segments provide locally sourced over 100 mesh and 40/70 sand used as a proppant during the well completion process. Also, it provides a differentiated logistics platform that includes its fleet of fit-for-purpose trucks, trailers, and the Dune Express, an overland conveyor infrastructure solution. The Power segment provides distributed power solutions through a fleet of approximately 950 natural gas-powered reciprocating generators.', 'Austin, TX, United States', 1143);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAPP', 'STOCK', 'VanEck Digital Transformation ETF', 'NGM', NULL, NULL, 'The fund normally invests at least 80% of its total assets in securities of Digital Transformation Companies. The index is a global index that tracks the performance of Digital Transformation Companies. The fund will not invest in digital assets (including cryptocurrencies) (i) directly or (ii) indirectly through the use of digital asset derivatives. It also will not invest in initial coin offerings. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVDX', 'STOCK', 'AvidXchange Holdings, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'AvidXchange Holdings, Inc. is a provider of accounts payable (AP) automation software and payment solutions for middle market businesses and their suppliers. Its Software-as-a-Service (SaaS)-based, end-to-end software and payment platform digitizes and automates the AP workflows for more than 8,500 businesses (its buyers) and it has made payments to more than 1,350,000 supplier customers of its buyers (suppliers). Its platform automates end-to-end AP workflows for its buyers and enhances the payment experience for its suppliers through the various products and features: AP Automation Software, the AvidPay Network, and the AvidXchange Supplier Hub. The Company provides solutions and services throughout North America spanning multiple industries, including real estate, community association management, construction, financial services (including banks and credit unions), healthcare facilities, social services, education, media, and hospitality.', 'Charlotte, NC, United States', 1600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUPH', 'STOCK', 'Aurinia Pharmaceuticals Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Aurinia Pharmaceuticals Inc. is a fully integrated biopharmaceutical company. The Company is focused on delivering therapies to people living with autoimmune diseases with high unmet medical needs. It has developed LUPKYNIS (voclosporin), an oral therapy for the treatment of adult patients with active lupus nephritis (LN) and continues to conduct clinical and regulatory activities to support the LUPKYNIS development program. The Company is primarily engaged in the development of its pipeline asset AUR200, a differentiated, potential next generation therapy for autoimmune diseases that targets both BAFF (B-cell Activating Factor) and APRIL (A Proliferation-Inducing Ligand). The Company contracted with Otsuka Pharmaceutical Co., Ltd. (Otsuka) as a collaboration partner for the development and commercialization of LUPKYNIS in the Otsuka Territories. It sells LUPKYNIS (voclosporin) primarily to specialty pharmacies and a specialty distributor and directly to its ex-U.S. partner, Otsuka.', 'Edmonton, AB, Canada', 130);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMI', 'STOCK', 'Badger Meter, Inc.', 'NYQ', 'Technology', 'Scientific & Technical Instruments', 'Badger Meter, Inc. is a manufacturer and marketer of products incorporating flow measurement, quality, control and other system solutions serving markets worldwide. Its offerings, marketed as BlueEdge, include a suite of tailorable solutions that connect water management technology, software and support services to deliver insights enabling the proactive management of water across the water cycle. Its solutions include measurement and control hardware, connectivity and communication, data visualization and software-delivered actionable insights, and ongoing support to optimize customers'' operations. Its measurement and control hardware, instruments and sensors include product families, such as meters that measure the flow of water and other fluids, water quality monitoring solutions and high frequency pressure and acoustic leak detection hardware that provides real-time monitoring data. It offers a range of communication solutions including the ORION branded family of radio endpoints.', 'Milwaukee, WI, United States', 2210);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRIO', 'STOCK', 'DarioHealth Corp.', 'NCM', 'Healthcare', 'Health Information Services', 'DarioHealth Corp. is a global digital therapeutics (DTx) company delivering personalized evidence-based interventions that are driven by data analytics, software, and personalized coaching. The Companys platform and suite of solutions deliver personalized and dynamic interventions driven by data analytics and one-on-one coaching for diabetes, hypertension, weight management, musculoskeletal pain, and behavioral health. Its digital therapeutic platform has been designed with a user-first strategy, focusing on the users needs and user experience and satisfaction. Dario Blood Glucose Monitoring Starter Kit is a pocket-sized smartphone glucometer that manages diabetes in one ultra-compact device. Dario Blood Pressure Monitoring System is a blood pressure monitoring system used to measure blood pressure, which allows it to store all its user readings in the Dario App. The Dario mobile app is a complete, cloud-based solution for personal chronic condition management.', 'New York, NY, United States', 196);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACXP', 'STOCK', 'Acurx Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Acurx Pharmaceuticals, Inc. is a late-stage biopharmaceutical company focused on developing a new class of small molecule antibiotics for difficult-to-treat bacterial infections. It develops antibiotic candidates with a Gram-positive selective spectrum (GPSS) that block the active site of the Gram positive specific bacterial enzyme deoxyribonucleic acid (DNA) polymerase IIIC (pol IIIC), inhibiting DNA replication and leading to Gram-positive bacterial cell death. Its research and development (R&D) pipeline include antibiotic product candidates that target Gram-positive bacteria, including Clostridioides difficile (C. difficile), methicillin-resistant Staphylococcus aureus (MRSA), vancomycin resistant Enterococcus (VRE), drug-resistant Streptococcus pneumoniae (DRSP) and B. anthracis (anthrax; a Bioterrorism Category A Threat-Level pathogen). Its lead antibiotic candidate, ibezapolstat targets the pol IIIC enzyme.', 'Staten Island, NY, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUR', 'STOCK', 'Burford Capital Limited', 'NYQ', 'Financial Services', 'Asset Management', 'Burford Capital Limited is a global finance and asset management company focused on law. The Companys businesses include litigation finance and risk management, asset recovery and a range of legal finance and advisory activities. It provides capital, based on portfolio size, against the underlying value of litigation and legal assets. It operates through two segments: Principal Finance and Asset Management and Other Services. The Principal Finance segment funds capital to legal finance assets from its balance sheet, primarily as capital provision assets, and in limited scope through interests in private funds managed the Company. These capital provision assets and private fund interests generate its capital provision income. The Asset Management and Other Services segment manages legal finance assets on behalf of third-party investors, and it provides other services to the legal industry. Its clients are a range of litigants including a number of law firms and businesses.', 'Saint Peter Port, , Guernsey', 160);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACIW', 'STOCK', 'ACI Worldwide, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'ACI Worldwide, Inc. is a global payments technology company, delivers software solutions that power intelligent payments orchestration in real time to banks, billers, and merchants. The Company''s segments include Payment Software and Biller. Its Payment Software segment drives payments orchestration for banks and merchants. It provides payment solutions to large and mid-size banks globally for retail banking, digital, and other payment services. Its support of merchants globally includes Tier 1 and Tier 2 merchants (in-store and online), payment service providers, independent selling organizations, value-added resellers, and acquirers who service them. The Company''s Biller segment provides electronic bill presentment and payment services to companies operating in the consumer finance, insurance, healthcare, higher education, utility, government, mortgage, subscription provider, and telecommunications categories. The Company also provides fraud abuse protection to its Biller customers', 'Elkhorn, NE, United States', 3103);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADPT', 'STOCK', 'Adaptive Biotechnologies Corporation', 'NMS', 'Healthcare', 'Biotechnology', 'Adaptive Biotechnologies Corporation is a commercial-stage biotechnology company. The Company is focused on harnessing the inherent biology of the adaptive immune system to transform the diagnosis and treatment of disease. Its immune medicine platform reveals and translates the massive genetics of the adaptive immune system with scale, precision and speed. It applies its platform to partner with biopharmaceutical companies, inform drug development, and develop clinical diagnostics across its two business segments: Minimal Residual Disease (MRD) and Immune Medicine. The MRD business focuses on the use of its sensitive, next-generation sequencing (NGS) assay to measure MRD in patients with hematologic malignancies. Its MRD business is comprised of its clonoSEQ clinical diagnostic test, offered to clinicians. The IM business focuses on the discovery and development of transformative immune-based therapies in the treatment of patients with cancer and autoimmune diseases.', 'Seattle, WA, United States', 619);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABL', 'STOCK', 'Abacus Global Management, Inc.', 'NCM', 'Financial Services', 'Insurance - Life', 'Abacus Global Management, Inc. is a financial services company specializing in alternative asset management, data-driven wealth solutions, technology innovations, and institutional services. The Companys segments include Asset Management, Life Solutions and Technology Services. The Asset Management segment provides asset management services to primarily institutional investors alongside private clients investing in uncorrelated and longevity-based assets, fixed-income replacement strategies and free cash flow based investment solutions. It also provides policy servicing activities to customers on a contract basis. The Life Solutions segment is engaged in buying, selling, and trading policies, and maintaining policies until receipt of death benefits. The Technology Services segment provides real-time mortality verification, missing participant verification, and other services specific to the life insurance market services to customers on a contract basis.', 'Orlando, FL, United States', 157);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTL', 'STOCK', 'Algoma Steel Group Inc.', 'NGM', 'Basic Materials', 'Steel', 'Algoma Steel Group Inc. is a Canada-based integrated producer of hot and cold rolled steel products including sheet and plate. The Company delivers responsive, customer-driven product solutions for applications in the automotive, construction, energy, defense, and manufacturing sectors. It is a key supplier of steel products to customers in North America and is the producer of discrete plate products in Canada. The Company offers a wide range of steel plate products, which include AR225, Heat Treated Plate, AlgoLaser, AlgoGrip, and The Heavies. Its sheet products include Hot Rolled Sheet - DSPC, AR200, and Cold Rolled Sheet. The Company has a raw steel production capacity of an estimated over 2.8 million liquid tons per year. Its Direct Strip Production Complex is a continuous casting and rolling mill, producing high-quality hot-rolled sheet steel directly from liquid steel. The Company also generates by-products from its operations.', 'Sault Ste. Marie, ON, Canada', 2818);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BURL', 'STOCK', 'Burlington Stores, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'A Burlington Stores, Inc. É uma Varejista de produtos de marca fora do preço a preços baixos diários. As lojas da empresa oferecem uma ampla seleção de produtos em temporada, focados na moda, incluindo roupas para mulheres prontas para usar, roupas masculinas, roupas para jovens, bebê, beleza, calçado, acessórios, casa, brinquedos, presentes e casacos. Sua ampla seleção oferece uma ampla gama de vestuário, acessórios e móveis para todas as idades. Vende uma ampla seleção de mercadorias adquiridas diretamente de fabricantes e outros fornecedores. Tem seis centros de distribuição. Seus três centros de distribuição da costa leste estão localizados em Edgewater Park, Nova Jersey; Burlington, Nova Jersey; e Logan, nova Jérsia. Seus três centros de distribuição da costa oeste estão localizados em San Bernardino, Califórnia, Redlands, Califórnia e Riverside, Califórnia. Esses seis centros de distribuição ocupam um agregado de 5,135,000 pés quadrados, e cada um inclui recursos de processamento', 'Burlington, NJ, United States', 17057);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FFWM', 'STOCK', 'First Foundation Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'First Foundation Inc. is a financial services company that provides a comprehensive platform of financial services to individuals, businesses, and other organizations. Its integrated platform provides banking products and services, investment advisory and wealth management services and trust services. It operates in two segments: Banking and Investment Management and Wealth Planning (Wealth Management). The Banking segment includes the operations of First Foundation Bank (FFB), First Foundation Insurance Services (FFIS), First Foundation Public Finance (FFPF), and Blue Moon Management LLC. The Wealth Management segment includes the operations of First Foundation Advisors (FFA). Through FFB, it offers a range of loan products, deposit products, treasury management products and services, and trust services. It provides business banking products and services to small to moderate-sized firms and professional firms, and consumer banking products and services to individuals and families.', 'Dallas, TX, United States', 564);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVPT', 'STOCK', 'AvePoint, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'AvePoint, Inc. provides a cloud-native data management software platform, enabling them to prepare, secure, and optimize their critical data. The Companys AvePoint Confidence Platform delivers a set of software-as-a-service (SaaS) solutions, empowering users in a variety of technology roles, including IT operations, development operations and cybersecurity, to monitor and secure the digital workplace. Built on top of Platform-as-a-Service (PaaS) architecture, it combines modularity with tailored, industry-specific functionality to address critical operational challenges and manage data effectively across third-party cloud vendors like Microsoft, Salesforce, Google, AWS, Box, and Dropbox. The AvePoint Confidence Platform, and the applications that it powers, is organized into three interconnected suites of functionality, which include the Control Suite, the Resilience Suite, and the Modernization Suite.', 'Jersey City, NJ, United States', 2934);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COO', 'STOCK', 'The Cooper Companies, Inc.', 'NMS', 'Healthcare', 'Medical Instruments & Supplies', 'A Cooper Companies, Inc. É uma empresa global de dispositivos médicos. A Companhia atua em duas unidades de negócios: CooperVision e CooperSurgical. O segmento CooperVision está envolvido na indústria de lentes de contato. O segmento CooperSurgical está envolvido no mercado de fertilidade e cuidados de saúde das mulheres através de seu portfólio diversificado de produtos e serviços, incluindo produtos e serviços de fertilidade, dispositivos médicos, criostarmaz (como o armazenamento de sangue do cordão umbilical e tecido do cordão umbilical) e contracepção. Os produtos da CooperVision incluem MyDay Daily descartável, MyDay Daily descartável toric, MyDay Energys, MyDay Multifocal, Biofinity & Biofinity XR, Biofinity Energys. O portfólio da CooperSurgical inclui INSORB, Lone Star e o Monitor de Fluxo de Sangue Doppler. Ele também oferece um conjunto de retratores cirúrgicos sem fio de uso único com uma fonte de luz de diodo emissor de luz multi-luz (LED) integrada e canais de evacuação d', 'San Ramon, CA, United States', 16000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADSK', 'STOCK', 'Autodesk, Inc.', 'NMS', 'Technology', 'Software - Application', 'A Autodesk, Inc. Está envolvida em soluções de design tridimensional (3D), engenharia e tecnologia de entretenimento, abrangendo arquitetura, engenharia, construção, design de produto, design de produtos e serviços de engenharia. fabricação, mídia e entretenimento. Seus produtos de arquitetura, engenharia, construção e operações melhoram a forma como os projetos de construção, infraestrutura e industriais são projetados, construídos e operados. Seu software de desenvolvimento e fabricação de produtos fornece aos fabricantes nas indústrias automotiva, de transporte, de máquinas industriais, de produtos de consumo e de produtos de construção soluções abrangentes de design digital, engenharia, fabricação e produção. Suas ofertas de produtos incluem AutoCAD Civil 3D, Autodesk Build, BIM Collaborate Pro, Revit, Tandem, AutoCAD, AutoCAD LT, Inventor, Vault, Maya, e 3ds Max. A solução AutoCAD Civil 3D oferece uma solução de levantamento, design, análise e documentação para engenharia civil, i', 'San Francisco, CA, United States', 15300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLBT', 'STOCK', 'Cellebrite DI Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'Cellebrite DI Ltd is an Israel-based company engaged primarily in the software sector. The Company is committed to providing a Digital Intelligence (DI) platform for managing DI in legally sanctioned investigations. The Company provides solutions for the public and private sectors, enabling organizations in mastering the complexities of legally sanctioned digital investigations by streamlining intelligence processes. The Company''s platform and solutions transform how customers collect, review, analyze and manage data in legally sanctioned investigations. The Company aims to enable its customers to protect and save lives, accelerate justice, and preserve privacy in communities around the world.', 'Petah Tikva, , Israel', 1167);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLDE', 'STOCK', 'Blade Air Mobility, Inc.', 'NCM', 'Industrials', 'Airports & Air Services', 'Blade Air Mobility, Inc. provides air transportation and logistics for hospitals across the United States. The Company transports human organs for transplant, and for passengers, with helicopter and fixed wing services primarily in the Northeast United States and Southern Europe. It operates in three key product lines across its Passenger and Medical segments. Its Passenger segment includes Short Distance and Jet and Other. Short Distance business consists of helicopter and amphibious seaplane flights in the United States and Europe. Jet and Other business consists of non-medical jet charter and brand partners for exposure to Blade fliers and certain ground transportation services. Its Medical segment includes MediMobility Organ Transport, which consists of the transportation of human organs for transplant and/or the medical teams supporting these services. It also offers additional services including donor logistics coordination and support for evaluating potential donor organs.', 'New York, NY, United States', 310);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CATX', 'STOCK', 'Perspective Therapeutics, Inc.', 'ASE', 'Healthcare', 'Medical Devices', 'Perspective Therapeutics, Inc. is a radiopharmaceutical development company that is developing advanced treatment applications for cancers throughout the body. The Company has proprietary technology that utilizes the alpha-emitting isotope 212Pb to deliver powerful radiation specifically to cancer cells via specialized targeting moieties. It is also developing imaging diagnostics that incorporate the same targeting moieties, which provide the opportunity to personalize treatment and optimize patient outcomes. This theranostic approach enables the ability to see the specific tumor and then treat it to potentially improve efficacy and minimize toxicity. The Company''s melanoma (VMT01) and neuroendocrine tumor (VMT-a-NET) programs have entered Phase I/IIa imaging and therapy trials for the treatment of metastatic melanoma and neuroendocrine tumors at several academic institutions. It has also developed a 212Pb generator to secure key isotopes for clinical trial and commercial operations.', 'Seattle, WA, United States', 138);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BJRI', 'STOCK', 'BJ''s Restaurants, Inc.', 'NMS', 'Consumer Cyclical', 'Restaurants', 'BJ''s Restaurants, Inc. is a full-service restaurant brand. The Companys restaurants feature a menu with approximately 100 menu items designed to offer various items, including slow roasted entrees, such as prime rib, EnLIGHTened Entrees, such as its Cherry Chipotle Glazed Salmon, its original signature deep-dish pizza, and the Pizookie dessert. It also offers its craft beers, which are produced at four in-house brewing facilities, two standalone brewpubs and by independent third-party brewers using its proprietary recipes. It is a national restaurant chain, which owns and operates approximately 218 restaurants located in 31 states, including Alabama, Arizona, Arkansas, California, Colorado, Connecticut, Florida, Illinois, Indiana, Kansas, Kentucky, Louisiana, Maryland, Massachusetts, Michigan, Nevada, New Jersey, New Mexico, New York, North Carolina, Ohio, Oklahoma, Oregon, Pennsylvania, Rhode Island, South Carolina, Tennessee, Texas, Virginia, Washington and Wisconsin.', 'Huntington Beach, CA, United States', 21230);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WST', 'STOCK', 'West Pharmaceutical Services, Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'A West Pharmaceutical Services, Inc. É um fabricante global que está envolvida no projeto e produção de sistemas de contenção e entrega tecnologicamente avançados e integrados para medicamentos injetáveis e produtos de saúde. A Companhia atua em dois segmentos: Produtos Proprietários e Produtos Contrafabricados. O segmento de produtos proprietários oferece elastômeros e contenção primária, dispositivos de entrega de medicamentos, soluções integradas e serviços de laboratório analítico, principalmente para clientes de medicamentos biológicos, genéricos e farmacêuticos. O segmento de produtos fabricados por contrato é uma empresa totalmente integrada, focada no design, fabricação e montagem automatizada de dispositivos complexos, principalmente para clientes farmacêuticos, de diagnóstico e de dispositivos médicos. Este segmento fabrica componentes e dispositivos de propriedade do cliente usados em sistemas cirúrgicos, diagnósticos, oftálmicos, injetáveis e outros de entrega de medicament', 'Exton, PA, United States', 10600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAON', 'STOCK', 'AAON, Inc.', 'NMS', 'Industrials', 'Building Products & Equipment', 'AAON, Inc. provides heating, ventilation and air conditioning (HVAC) solutions for commercial, industrial and data center indoor environments. The Company''s segments include AAON Oklahoma, AAON Coil Products and BASX. Its AAON Oklahoma segment engineers, manufactures and sells semi-custom and custom HVAC systems, designs and manufactures controls solutions, and sells aftermarket parts to customers through retail part stores and online. The Company''s AAON Coil Products segment engineers and manufactures a selection of its semi-custom, and custom HVAC systems as well as a variety of heating and cooling coils to be used in HVAC systems. Its BASX segment engineers, manufactures, and sells an array of custom, high-performance cooling solutions for hyperscale data center market, ventilation solutions for cleanroom environments in the bio-pharmaceutical, semiconductor, medical and agriculture markets, and highly custom, air handlers and modular solutions for a vast array of markets.', 'Tulsa, OK, United States', 4812);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARCO', 'STOCK', 'Arcos Dorados Holdings Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Arcos Dorados Holdings Inc. É um franqueado do McDonald''s. A empresa opera ou franchising mais de 2 140 restaurantes da marca McDonald''s. Divide suas operações em quatro divisões geográficas: Brasil; a divisão do Caribe, composta por Aruba, Colômbia, Curaçao, Guiana Francesa, Guadalupe, Martinica, Porto Rico, Trinidad e Tobago, as Ilhas Virgens dos Estados Unidos de Saint Croix e Saint Thomas, e Venezuela; a divisão da América Latina do Norte (NOLAD), composta pela Costa Rica, México e Panamá, e a divisão da América Latina do Sul (SLAD), composta pela Argentina, Chile, Equador, Peru e Uruguai. Seus menus apresentam mais de três níveis de produtos: Opções de nível básico, como Big Pleasures, ofertas de pequenos preços e Almuerzos Colombianos (almoços colombianos) na Colômbia; opções principais de menu, como o Big Mac, Happy Meal e Quarter pounder, e opções premium, como Big Tasty ou Angus premium hambúrgueres e sanduíches de frango e produtos de baixa caloria ou de sódio.', 'Montevideo, , Uruguay', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRDL', 'STOCK', 'Cardiol Therapeutics Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Cardiol Therapeutics Inc. is a Canada-based clinical-stage life sciences company focused on developing anti-inflammatory and anti-fibrotic therapies for the treatment of heart disease. The Company''s lead small-molecule drug candidate, CardiolRx (cannabidiol) oral solution, is pharmaceutically manufactured and in clinical development for use in the treatment of heart disease. It holds investigational new drug application authorization from the United States Food and Drug Administration (US FDA) to conduct clinical studies to evaluate the efficacy and safety of CardiolRx in two diseases affecting the heart: recurrent pericarditis and acute myocarditis. The MAVERIC Program in recurrent pericarditis, an inflammatory disease, comprises the completed Phase II MAvERIC-Pilot study (NCT05494788) and the ongoing Phase III MAVERIC trial (NCT06708299). The Company is also developing CRD-38, a novel subcutaneously administered drug formulation intended for use in heart failure.', 'Oakville, ON, Canada', 18);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('KNTK', 'STOCK', 'Kinetik Holdings Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Kinetik Holdings Inc. is an integrated Permian-to-Gulf Coast midstream company operating in the Delaware Basin. It offers comprehensive gathering, transportation, compression, processing and treating services for companies that produce natural gas, natural gas liquids, crude oil and water. Its segments include Midstream Logistics and Pipeline Transportation. The Midstream Logistics segment operates under three streams: gas gathering and processing, crude oil gathering, stabilization and storage services, and produced water gathering and disposal. The Midstream Logistics segment provides gas gathering and processing services with over 3,900 miles of low and high-pressure steel pipeline located throughout the Delaware Basin, including over 2,300 miles of gas pipeline. The Pipeline Transportation segment consists of equity investment interests in three Permian Basin pipelines that access various points along the United States Gulf Coast, Kinetik NGL Pipeline and Delaware Link Pipeline.', 'Midland, TX, United States', 460);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBC', 'STOCK', 'Eastern Bankshares, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Eastern Bankshares, Inc. is the bank holding company for Eastern Bank (The Bank). The Bank is a Massachusetts-chartered bank through which it provides a variety of banking and trust and investment services. Its diversified products and services include lending, deposit, and wealth management. It offers a range of demand deposit accounts, interest checking accounts, money market accounts, savings accounts, and time certificates of deposit accounts. Its lending focuses on various loan categories: commercial and industrial, including its asset-based lending portfolio, commercial real estate, commercial construction, small business banking, residential real estate, and home equity loans. Through Cambridge Trust Wealth Management, a division of Eastern Bank, it provides a range of wealth management and trust services. In addition, it offers automated lock box collection services, cash management services and account reconciliation services to its corporate and institutional customers.', 'Boston, MA, United States', 1998);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAVE', 'STOCK', 'Dave Inc.', 'NGM', 'Technology', 'Software - Application', 'Dave Inc. specializes in neobanking and financial technology (fintech) services. The Company, through its fully integrated, mobile-first platform, delivers financial products designed to help underserved consumers manage their money more effectively. Its platform and products include ExtraCash and Dave Checking. ExtraCash is a 0% interest overdraft product offered through its bank partner that provides members with access to credit to bridge liquidity gaps between paychecks. Dave Checking is a digital demand deposit account offered through its bank partner with features, no account minimums or corresponding fees, and FDIC pass-through insurance eligibility that protects members from the failure of its bank partner. Dave Checking offers security controls such as multifactor authentication, contactless payment, instant card lock and protection against unauthorized purchases if cards are lost or stolen. Its personal financial management products include Budget, Side Hustle, and Surveys.', 'Los Angeles, CA, United States', 274);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARAY', 'STOCK', 'Accuray Incorporated', 'NMS', 'Healthcare', 'Medical Devices', 'Accuray Incorporated is a radiation therapy company. The Company develops, manufactures, sells and supports solutions that are designed to deliver radiation treatments for complex cases. Its solutions are designed to advance patient care: during each individual treatment, throughout the treatment process, and at each stage of the cancer treatment journey, from curative to palliative treatments. Its technologies, the CyberKnife and TomoTherapy platforms, including the Radixact System, its TomoTherapy platform, are designed to deliver advanced treatments, including stereotactic radiosurgery (SRS), stereotactic body radiation therapy (SBRT), intensity modulated radiation therapy (IMRT), image-guided radiation therapy (IGRT), and adaptive radiation therapy (ART). In addition to these products, it also provides services, which include post-contract customer support (warranty period services and post-warranty services), installation services, training, and other professional services.', 'Madison, WI, United States', 987);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXS', 'STOCK', 'AXIS Capital Holdings Limited', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'AXIS Capital Holdings Limited is a holding company. The Company, through its operating subsidiaries, is a global specialty underwriter and provider of insurance and reinsurance solutions with operations in Bermuda, the United States, Europe, Singapore, and Canada. Its underwriting operations are organized around its global underwriting platforms: AXIS Insurance and AXIS Re. It operates through two segments: insurance and reinsurance. The insurance segment offers specialty insurance products to a variety of niche markets on a worldwide basis. The product lines in this segment are professional lines, property, liability, cyber, marine and aviation, accident and health, and credit and political risk. The reinsurance segment provides treaty reinsurance to insurance companies on a worldwide basis. The product lines in this segment are liability, accident and health, professional lines, credit and surety, motor, agriculture, marine and aviation, catastrophe, property, and engineering.', 'Pembroke, , Bermuda', 1876);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMRC', 'STOCK', 'Ameresco, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'Ameresco, Inc. is a cleantech integrator and renewable energy asset developer, owner, and operator. The Company''s comprehensive portfolio includes energy efficiency, infrastructure upgrades, asset sustainability and renewable energy supply solutions. Its North America Regions, U.S. Federal and Europe segments include the design, engineering and installation of equipment and other measures to improve the efficiency and control the operation of a facility''s energy infrastructure, renewable energy solutions and services and the development and construction of small-scale plants. Its Alternative Fuels segment sells electricity and processed renewable natural gas (RNG) derived from biomethane from small-scale plants that it owns and operates and provides operations and maintenance services for customer owned small-scale plants. The Company''s All Other segment offers consulting services and the sale of solar photovoltaic energy products and systems.', 'Framingham, MA, United States', 1509);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEP', 'STOCK', 'Cantor Equity Partners, Inc. Class A Ordinary Shares', 'NGM', 'Financial Services', 'Shell Companies', 'Cantor Equity Partners, Inc. is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses. The Company intends to focus its search on companies operating in the financial services, healthcare, real estate services, technology and software industries. The Company has not commenced operations nor generated any revenues.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTRE', 'STOCK', 'CareTrust REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'CareTrust REIT, Inc. is a self-administered real estate investment trust (REIT). The Company is engaged in the ownership, acquisition, development and leasing of skilled nursing, senior housing and other healthcare-related properties. It has a portfolio of long-term net-leased properties across the United States and United Kingdom. The Company owns, directly or indirectly through joint ventures, and leases to independent operators skilled nursing facilities (SNFs), multiservice campuses, assisted living facilities (ALFs) and independent living facilities (ILFs), consisting of operational beds and units located in various states with the highest concentration of properties by rental income located in California, Texas and Tennessee. Its facilities include Camarillo, San Juan Capistrano, Barton Creek, Bayshire Carlsbad, El Centro Post-Acute Care, Bayshire Rancho Mirage, Weiser Care, Wellspring Health and Rehabilitation of Cascadia, Cornerstone Rehab & Health Care Center, and others.', 'San Clemente, CA, United States', 21);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNTX', 'STOCK', 'BioNTech SE', 'NMS', 'Healthcare', 'Biotechnology', 'A BioNTech SE é uma empresa de biotecnologia de estágio clínico sediada na Alemanha. A empresa concentra-se em imunoterapias específicas para o tratamento do câncer e outras doenças graves. A empresa está fornecendo tecnologias que incluem terapias baseadas em mRNA, terapias celulares, pequenas moléculas e anticorpos, que podem ser utilizados para fins específicos ou podem ser combinados entre si de forma sinérgica. Ele também desenvolve um amplo pipeline de produtos usando diferentes abordagens científicas e plataformas tecnológicas, incluindo candidatos a produtos baseados em mRNA individualizados, células T do recetor de antígeno quimérico, imunomoduladores de ponto de controle, anticorpos de câncer direcionados e pequenas moléculas. Além disso, a empresa oferece produtos de diagnóstico e serviços de descoberta de medicamentos para outras áreas terapêuticas, incluindo doenças infeciosas, alergias e doenças autoimunes.', 'Mainz, , Germany', 6772);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIGS', 'STOCK', 'FIGS, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Manufacturing', 'FIGS, Inc. operates as a direct-to-consumer healthcare apparel and lifestyle brand. The Company sells products designed to serve the particular needs of healthcare professionals primarily through its direct-to-consumer (DTC) digital platform, consisting of its Website, mobile app and B2B business (TEAMS). Its offerings include scrubwear and non-scrubwear, such as outerwear, underscrubs, footwear, compression socks, lab coats, loungewear, and other apparel. Its non-scrubwear products are designed as an integrated system that complements its scrubwear and are comprised of base layer and outer layer products. Its underscrubs include sports bras, performance leggings, performance tops and super-soft pima cotton tops. Its under underscrubs include several styles of underwear. Its outer layer products include footwear, lab coats, and a variety of vests, jackets, and fleeces. The Company also offers necessities, such as scrub caps, lanyards, badge reels, tote bags, baseball caps, and beanies.', 'Santa Monica, CA, United States', 303);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADUR', 'STOCK', 'Aduro Clean Technologies Inc.', 'NCM', 'Industrials', 'Pollution & Treatment Controls', 'Aduro Clean Technologies Inc. is a Canada-based clean technology company. The Company is a developer of water-based technologies to chemically recycle waste plastics; convert heavy crude and bitumen into lighter, more valuable oil, and transform renewable oils into higher-value fuels or renewable chemicals. Its chemical recycling platform features three water-based technologies, such as Hydrochemolytic Plastics Upcycling (HPU), Hydrochemolytic Renewables Upgrading (HRU) and Hydrochemolytic Bitumen Upgrading (HBU). Its Plastics Upcycling application converts waste plastics into feedstocks for producing new plastics or hydrocarbon fuels. Its HRU transform renewable oils into renewable motor fuels, sustainable aviation fuel (SAF), and specialty chemicals in scalable formats that can be integrated straightforwardly into existing operations.', 'London, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIOT', 'STOCK', 'PowerFleet, Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'Powerfleet, Inc. is a provider of artificial Internet of things (AIoT) software-as-a-service (SaaS) solution, which includes valuable business intelligence for managing high-value enterprise assets. The Company delivers advanced mobility solutions that connect assets to increase visibility operational efficiency and profitability by leveraging its Unity platform product strategy. Its Powerfleet for Warehouse solutions are designed to provide on-premises or in-facility asset and operator management, monitoring, and visibility for warehouse trucks. Its Powerfleet for Logistics solutions are designed to provide bumper-to-bumper asset management, monitoring, and visibility for over-the-road based assets. Its Powerfleet for Vehicles solutions are designed both to enhance the vehicle fleet management process, whether its a rental car, a private fleet, or automotive original equipment manufacturer (OEM) partners. Its offerings are sold under the Powerfleet, Pointer, and Cellocator brands.', 'Woodcliff Lake, NJ, United States', 2518);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIRS', 'STOCK', 'AirSculpt Technologies, Inc.', 'NGM', 'Healthcare', 'Medical Care Facilities', 'AirSculpt Technologies, Inc., through its wholly owned subsidiaries, is a provider of practice management services to professional associations (PAs) located throughout the United States, Canada, and the United Kingdom. The Company owns and operates non-clinical assets and provides its management services to the PAs through management services agreements (MSAs). It operates through the direct medical procedure services segment. The Company offers fat removal procedures across treatment areas. It also offers fat transfer procedures that use the patients own fat cells to enhance the breasts, buttocks, hips, or other areas and do not require silicone or foreign materials to be implanted. Its body contouring procedures include the Power BBL, a Brazilian butt lift procedure, the Up a Cup, a breast enhancement procedure, and the Hip Flip, an hourglass contouring procedure. Its AirSculpt + procedure permanently removes fat and tightens the skin with unparalleled precision and finesse.', 'Miami Beach, FL, United States', 389);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRVO', 'STOCK', 'CervoMed Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'CervoMed Inc. is a clinical-stage company focused on developing treatments for age-related neurologic disorders. The Company is developing neflamapimod, an investigational, orally administered small molecule brain penetrant that inhibits p38 mitogen-activated protein kinase alpha. Neflamapimod has the potential to treat synaptic dysfunction, the reversible aspect of the underlying neurodegenerative processes that cause disease in Lewy bodies (DLB) and certain other neurological disorders. It focuses on reducing the impact of inflammation in the brain, or neuroinflammation, which is a key factor in the manifestation of degenerative diseases of the brain, including DLB. Neflamapimod is being evaluated in the Company''s ongoing RewinD-LB Trial, a Phase 2b trial in patients with DLB.', 'Boston, MA, United States', 15);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OTEX', 'STOCK', 'Open Text Corporation', 'NMS', 'Technology', 'Software - Application', 'Open Text Corporation is a Canada-based information management company, which provides software and services. Its comprehensive Information Management platform and services provide secure and scalable solutions for global companies, small and medium-sized businesses (SMBs), governments and consumers around the world. It has a complete and integrated portfolio of information management solutions delivered at scale in the OpenText Cloud, enabling organizations master modern work, automate application delivery and modernization, and optimize their digital supply chains by bringing together content cloud, cybersecurity cloud, business network cloud, information technology (IT) operations management cloud, application modernization cloud and analytics cloud. It also accelerates information modernization with intelligent tools and services for moving off paper, automating classification and building clean data lakes for Artificial Intelligence (AI), analytics and automation.', 'Waterloo, ON, Canada', 21400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAXJ', 'STOCK', 'iShares MSCI All Country Asia ex Japan ETF', 'NGM', NULL, NULL, 'The fund will invest at least 80% of its assets in the component securities of the index and in investments that have economic characteristics that are substantially identical to the component securities of the index. The index is a free float-adjusted market capitalization weighted index designed to measure equity market performance of securities from the following 10 developed and emerging market countries or regions: China, Hong Kong, India, Indonesia, Malaysia, the Philippines, Singapore, South Korea, Taiwan and Thailand.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALKT', 'STOCK', 'Alkami Technology, Inc.', 'NMS', 'Technology', 'Software - Application', 'Alkami Technology, Inc. is a cloud-based digital banking solutions provider. The Company''s solution, the Alkami Digital Banking Platform, allows financial institutions (FIs) to onboard and engage new users, accelerate revenues and improve operational efficiency. The Alkami Digital Banking Platform offers an end-to-end set of digital banking software products. Its platform integrates with core system providers and other third-party fintech providers, and acts as the primary interaction point among consumers, businesses, and FIs. It offers FI with a set of core functional components, which includes a rounded suite of products across account opening, marketing, data insights, card experience, money movement, customer service, business banking, financial wellness, security and fraud protection and extensibility. The Company''s clients include community, regional and super-regional credit unions and banks across both retail and business banking.', 'Plano, TX, United States', 938);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COOP', 'STOCK', 'Mr. Cooper Group Inc.', 'NCM', 'Financial Services', 'Mortgage Finance', 'Mr. Cooper Group Inc. provides servicing, origination and transaction-based services related to single-family residences throughout the United States with operations under its primary brands: Mr. Cooper, Xome, and Rushmore Servicing. It is a home loan servicer focused on delivering a variety of servicing and lending products, services, and technologies. It provides technology and data-enhanced solutions to homebuyers, home sellers, real estate agents and mortgage companies. Its Servicing segment performs operational activities on behalf of investors or owners of the underlying mortgages and mortgage servicing rights, including collecting and disbursing borrower payments, investor reporting, customer service, and modifying loans. Its Originations segment originates residential mortgage loans through its direct-to-consumer channel, which provides refinance options for its existing customers, and through its correspondent channel, which purchases or funds loans from mortgage bankers.', 'Coppell, TX, United States', 7900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NVDU', 'STOCK', 'Direxion Daily Nvda Bull 2X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of its net assets (plus any borrowings for investment purposes) in the securities of NVDA and financial instruments, such as swap agreements and options, that, in combination, provide 2X daily leveraged exposure to NVDA, consistent with the fund’s investment objective. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AN', 'STOCK', 'AutoNation, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'AutoNation, Inc., through its subsidiaries, is an automotive retailer in the United States. The Companys segments include Domestic, Import, Premium Luxury, and AutoNation Finance. Its Domestic segment consists of retail automotive franchises that sell new vehicles manufactured by General Motors, Ford, Mazda and Stellantis, among others. Its Import segment consists of retail automotive franchises that sell new vehicles manufactured primarily by Toyota, Honda, Hyundai, Subaru, and Nissan, others. Its Premium Luxury segment consists of retail automotive franchises that sell new vehicles manufactured primarily by Mercedes-Benz, BMW, Audi, Lexus, and Jaguar Land Rover, others. The AutoNation Finance segment is the captive auto finance company, which provides indirect financing to qualified retail customers on vehicles. It owns and operates approximately 325 new vehicle franchises from over 245 stores located in the United States, primarily in metropolitan markets in the Sunbelt region.', 'Fort Lauderdale, FL, United States', 25100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACWX', 'STOCK', 'iShares MSCI ACWI ex U.S. ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of the underlying index and in investments that have economic characteristics that are substantially identical to the component securities of the underlying index. The index is a free float-adjusted market capitalization-weighted index designed to measure the combined equity market performance of developed and emerging markets countries, excluding the United States.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIGC', 'STOCK', 'Commerce.com, Inc.', 'NGM', 'Technology', 'Software - Application', 'BigCommerce Holdings, Inc. provides an open software-as-a-service e-commerce platform. The Companys brands include BigCommerce, a commerce platform and services business; Feedonomics, an artificial intelligence (AI)-based product feed management platform; and Makeswift, a commerce site builder and visual editor. The Company provides a comprehensive platform for launching and scaling an ecommerce operation, including store design, catalog management, hosting, checkout, order management, reporting, and pre-integration into third-party services like payments, shipping, and accounting. It offers access to its platform on a subscription basis. Its platform serves customers across a variety of sizes, product categories, and purchase types, including business-to-consumer (B2C) and business-to-business (B2B). The Company has organized its product and service solutions into the core offerings into B2B, B2C, and Small Businesses.', 'Austin, TX, United States', 1161);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VYMI', 'STOCK', 'Vanguard International High Dividend Yield Index Fund ETF Shares', 'NGM', NULL, NULL, 'The fund invests by sampling the index, meaning that it holds a broadly diversified collection of securities that, in the aggregate, approximates the full index in terms of key characteristics. The index focuses on companies located in developed and emerging markets, excluding the United States, that are forecasted to have above-average dividend yields.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVAV', 'STOCK', 'AeroVironment, Inc.', 'NMS', 'Industrials', 'Aerospace & Defense', 'AeroVironment, Inc. is a defense technology provider, which delivers integrated capabilities across air, land, sea, space, and cyber. The Company develops and deploys autonomous systems, precision strike systems, counter-UAS technologies, space-based platforms, directed energy systems, and cyber and electronic warfare capabilities built to meet the mission needs of war fighters and conflicts. Its segments include Autonomous Systems, and Space, Cyber and Directed Energy. The Autonomous Systems segment encompasses uncrewed systems (Group 1-3 UAS), precision strike and one-way attack systems (including loitering munitions), defense systems (counter-UAS solutions using radio frequency sensors and electronic warfare solutions), ground and maritime robotic solutions, and MacCready Works. The Space, Cyber and Directed Energy segment encompasses space technologies, directed energy solutions, cyber solutions, and mission services.', 'Arlington, VA, United States', 1456);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMSC', 'STOCK', 'American Superconductor Corporation', 'NMS', 'Industrials', 'Specialty Industrial Machinery', 'American Superconductor Corporation is a provider of megawatt-scale power resiliency solutions. The Company''s solutions include Gridtec, Marinetec and Windtec. The Company, through its Gridtec solutions, provides engineering planning services and advanced grid systems that optimize network reliability, efficiency and performance. The Company, through its Marinetec solutions, provides ship protection and is developing propulsion and power management solutions designed to help fleets increase system efficiencies, enhance power quality and boost operational safety. The Company, through its Windtec solutions, provides wind turbine electronic controls and systems, designs and engineering services. The Company''s segments include Grid and Wind. It provides power supplies to industrial and military customers. It supplies components for a variety of energy applications. Their offerings include power supplies and power controls for industrial and military customers.', 'Ayer, MA, United States', 569);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NTES', 'STOCK', 'NetEase, Inc.', 'NMS', 'Communication Services', 'Electronic Gaming & Multimedia', 'NetEase Inc é uma empresa de tecnologia baseada na China. A empresa atua através de quatro segmentos de negócios. O segmento de Jogos e Serviços de Valor Acrescentado está envolvido no desenvolvimento e venda de jogos móveis, jogos de computador pessoal (PC), operação de jogos e outros serviços de valor agregado, incluindo itens virtuais no jogo e pontos pré-pagos. O segmento Youdao oferece serviços de aprendizagem, dispositivos inteligentes e serviços de marketing online. Seus produtos e serviços incluem cursos on-line e serviços de conteúdo digital. O segmento Cloud Music oferece serviços de música online através da venda de assinaturas de membros em vários pacotes de conteúdo e serviços, serviços de entretenimento social e outros principalmente através da venda de itens virtuais. O segmento de negócios inovadores e outros fornece comércio eletrônico, serviços de publicidade e outros serviços de valor agregado. A Companhia opera principalmente seus negócios nos mercados interno e ext', 'Hangzhou, , China', 26028);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSGM', 'STOCK', 'BioSig Technologies, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'BioSig Technologies, Inc. is a medical device technology company. The Company has an advanced digital signal processing technology platform, the PURE EP Platform (PURE EP), that delivers insights to electrophysiologists for ablation treatments of cardiovascular arrhythmias. PURE EP is designed to address long-standing limitations that slow and disrupt cardiac catheter ablation procedures, such as environmental lab noise from other equipment, signal saturation, slow signal recovery, and inaccurate display of fractionated potentials. PURE EP is a signal processing platform that combines advanced hardware and software to address known challenges associated to signal acquisition, to enable electrophysiologists to see more signals and analyze them in real-time. PURE EP is designed to enhance clinical decision-making and improve clinical workflows for all types of arrhythmias, even the challenging procedures for cardiac arrhythmias, like ventricular tachycardia and atrial fibrillation.', 'Los Angeles, CA, United States', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEPC', 'STOCK', 'Brookfield Renewable Corporation', 'NYQ', 'Utilities', 'Utilities - Renewable', 'Brookfield Renewable Corp. operates renewable power platforms and sustainable solutions. The Companys portfolio consists of hydroelectric, wind, solar and storage facilities in North America, South America, Europe and Asia. It has approximately 33,000 megawatts of installed capacity and a development pipeline with approximately 155,400 megawatts. The Companys businesses include Renewable Power & Transition, Infrastructure, Private Equity, Real Estate, Credit and Insurance Solutions. Its Renewable Power & Transition business operates across five continents, managing a diverse portfolio of hydro, wind, solar, distributed energy and sustainable solutions. Its Infrastructure business owns and operates assets across the transport, data, utilities and midstream sectors. Its Private Equity business sectors include business services, infrastructure services and industrials. Its Real Estate business sectors include housing, logistics, hospitality, science and innovation, office, and retail.', 'New York, NY, United States', 2416);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOUG', 'STOCK', 'Douglas Elliman Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'Douglas Elliman Inc. is a holding company. The Company is engaged in the real estate services and property technology (PropTech) investment business. The Companys segments include Real Estate Brokerage, and Corporate Activities and Other. The Real Estate Brokerage segment provides the residential real estate brokerage services through its subsidiary Douglas Elliman Realty, which operates residential brokerage companies in the New York metropolitan area and also conducts residential real estate brokerage operations in Florida, California, Texas, Colorado, Nevada, Massachusetts, Connecticut, Maryland, Virginia, Washington, D.C. Arizona, New Hampshire and Michigan. The Corporate Activities and Other the operations segment include operations of the holding company as well as its investment business that invests in select PropTech opportunities through our New Valley Ventures subsidiary. The Company''s PropTech investments include Rechat, Purlin, LiveEasy, Fyxify, Bilt, among others.', 'Miami, FL, United States', 783);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSIQ', 'STOCK', 'Canadian Solar Inc.', 'NMS', 'Technology', 'Solar', 'Canadian Solar Inc. is a Canada-based solar technology and renewable energy company. It is a manufacturer of solar photovoltaic modules, a provider of solar energy and battery energy storage solutions, and a developer of utility-scale solar power and battery energy storage projects with a geographically diversified pipeline in various stages of development. It operates through two segments: Recurrent Energy, and CSI Solar. The Recurrent Energy segment is vertically integrated and focuses on greenfield origination, development, financing, execution, operations and maintenance, and asset management. The CSI Solar segment consists of solar module and battery energy storage manufacturing, and delivery of total system solutions, including inverters, solar system kits, and engineering, procurement, and construction (EPC) services. It has developed, built, and connected around 10 Giga Watt peak (GWp) of solar power projects and 3.3 GWh of battery energy storage projects across the world.', 'Kitchener, ON, Canada', 17113);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNAI', 'STOCK', 'Brand Engagement Network, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Brand Engagement Network Inc. is a generative artificial intelligence (AI) (GenAI) company specialized in conversational AI solutions. Through its human-like AI agents (AI Agents), available in different modalities, it seeks to transform consumer engagement and elevate customer experience, productivity, and business performance. Its AI assistants are built on proprietary natural language processing, anomaly detection, multisensory awareness, sentiment and environmental analysis, as well as real-time individuation and personalization capabilities. Its platform is designed to configure, train and operate AI assistants that engage with professionals and consumers through multiple channels, boosting customer experience and providing instant personalized assistance for consumers in the automotive and healthcare markets. Its AI Agents can be offered to its clients customers through mobile apps, desktops or laptops, as well as through in-store life-size kiosks and SDK integrations.', 'Jackson, WY, United States', 39);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FR', 'STOCK', 'First Industrial Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'First Industrial Realty Trust, Inc. É um fornecedor de imóveis industriais. A Companhia possui, opera, desenvolve e adquire propriedades logísticas. A Companhia, através de sua plataforma operacional e de investimento totalmente integrada, fornece instalações e atendimento ao cliente a corporações multinacionais e empresas regionais que são essenciais para suas cadeias de suprimentos. Seu portfólio e novos investimentos estão concentrados em 15 MSA-alvo com ênfase em mercados limitados à oferta e orientados para o litoral. A empresa possui e está em desenvolvimento aproximadamente 69,5 milhões de pés quadrados de espaço industrial. Seus inquilinos estão envolvidos em uma variedade de negócios, incluindo comércio eletrônico, logística e transporte de terceiros, produtos de consumo e outros produtos manufaturados, varejo e serviços de consumo, alimentos e bebidas, madeira e materiais de construção, bens de atacado, serviços de saúde, governamentais e outros. Através de uma TRS de proprie', 'Chicago, IL, United States', 151);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPG', 'STOCK', 'AmpliTech Group, Inc.', 'NCM', 'Technology', 'Communication Equipment', 'AmpliTech Group, Inc. is engaged in designing, engineering, and assembling microwave component-based amplifiers. Its divisions include Specialty Microwave, Spectrum Semiconductor Materials, AmpliTech Group MMIC Design Center (AGMDC) and AmpliTech Group True G Speed Services (AGTGSS). Its products consist of radio frequency (RF) amplifiers and related subsystems, operating at multiple frequencies from 50 kilohertz (kHz) to 44 gigahertz (GHz), and custom assembly designs for the global satellite communications, telecom (fifth generation & Internet of Things), space, defense, and quantum computing markets. Its Specialty Microwave division designs and manufactures satellite communication microwave components, RF subsystems and specialized electronic assemblies for the military and commercial markets. AGMDC designs, develops, and manufactures signal processing components for satellites. AGTGSS division provides managed services, cybersecurity, cloud services, data sciences and others.', 'Hauppauge, NY, United States', 47);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEPO', 'STOCK', 'Cantor Equity Partners I, Inc.', 'NGM', 'Financial Services', 'Shell Companies', 'Cantor Equity Partners I, Inc. is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. It intends to focus on companies operating in the financial services, healthcare, real estate services, technology and software industries. The Company is neither engaged in any operations nor generated any revenue.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRY', 'STOCK', 'Berry Corporation', 'NMS', 'Energy', 'Oil & Gas E&P', 'Berry Corporation (Bry) is an independent upstream energy company with a focus on onshore, low geologic risk, low decline, long-lived oil and gas reserves. The Company operates in two business segments: exploration and production (E&P) and well servicing and abandonment services. The E&P assets are located in California and Utah, are characterized by high oil content and are predominantly located in rural areas with a low population. The California assets are in the San Joaquin Basin (100% oil), and its Utah assets are in the Uinta Basin (65% oil). It provides its well servicing and abandonment services to third-party operators in California and its California E&P operations through C&J Well Services (CJWS). Its California operating area consists of properties located in Midway-Sunset, South Belridge, McKittrick and Poso Creek fields in the San Joaquin basin in Kern County. The Companys properties in this region are primarily mature, low-decline oil wells.', 'Dallas, TX, United States', 1070);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKV', 'STOCK', 'BKV Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'BKV Corporation is an energy company. The Company''s core business is to produce natural gas from its owned and operated upstream businesses. It has four business lines: natural gas production, natural gas gathering, processing and transportation (natural gas midstream business), and power generation and carbon capture, utilization and sequestration (CCUS). It is engaged in the acquisition, operation and development of natural gas and natural gas liquid (NGL) properties located in the Barnett Shale in the Fort Worth Basin of Texas (the Barnett) and in the Marcellus Shale in the Appalachian Basin of Northeastern Pennsylvania (NEPA). It has a 50% ownership interest in the BKV-BPP Power Joint Venture, which owns Temple Plants, a modern combined cycle gas and steam turbine power plant located in the Electric Reliability Council of Texas (ERCOT) North Zone in Temple, Texas. The Company''s operational projects include Barnett Zero Project, Eagle Ford Project, Ethanol Projects, and others.', 'Denver, CO, United States', 366);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ZION', 'STOCK', 'Zions Bancorporation, National Association', 'NMS', 'Financial Services', 'Banks - Regional', 'Zions Bancorporation, Associação Nacional (o Banco) é um provedor de serviços financeiros. Ele fornece uma gama de produtos bancários e serviços relacionados, principalmente nos estados do Arizona, Califórnia, Colorado, Idaho, Nevada, EUA. novo México, Oregon, Texas, Utah, Washington, e Wyoming. Realiza suas operações principalmente através de sete divisões bancárias gerenciadas e geograficamente definidas, cada uma com sua própria marca e gestão local. Seus produtos e serviços incluem bancos comerciais e de pequenas empresas, mercados de capitais e bancos de investimento, empréstimos imobiliários comerciais, bancos de varejo e gestão de patrimônio. Seus produtos e serviços bancários comerciais para pequenas empresas incluem empréstimos e leasing comerciais e industriais e ocupados por proprietários, serviços de finanças públicas e municipais, serviços de confiança corporativa e outros. Seus mercados de capitais e bancos de investimento incluem associações de empréstimos, subscrição de', 'Salt Lake City, UT, United States', 9440);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXTR', 'STOCK', 'Extreme Networks, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'Extreme Networks, Inc. is a provider of cloud networking solutions and industry services and support. The Company designs, develops, and manufactures wired, wireless, and software-defined wide area-network (SD- WAN) infrastructure equipment, software and cloud-based network management solutions. Its cloud solution is a single platform that offers unified network management of wireless access points, switches, and SD-WAN. Its products and services categories include Cloud Networking Platform, Automation, Analytics, and Security Applications, Wireless LAN AP, Wired for Edge, Campus, and Data Center, SD-WAN, Cloud Native Platforms and Applications for Service Providers and Customer Service and Support. It provides service to various industries, including business, hospitality, retail, transportation and logistics, education, government, healthcare, and service providers. Its cloud networking technologies provide flexibility in deployment, management, and licensing of networks globally.', 'Morrisville, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIIB', 'STOCK', 'Biogen Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - General', 'A Biogen Inc. É uma empresa biofarmacêutica global. A empresa está focada em descobrir, desenvolver e oferecer terapias avançadas para pessoas que vivem com doenças graves e complexas em todo o mundo. Ele opera um portfólio de medicamentos para tratar esclerose múltipla (EM), atrofia muscular espinhal (SMA), doença de Alzheimer e esclerose lateral amiotrófica (ELA). Está focada em avançar seu pipeline em neurologia, imunologia especializada e doenças raras. Seus produtos comercializados incluem TECFIDERA, VUMERITY, AVONEX, PLEGRIDY, TYSABRI e FAMPYRA para o tratamento da EM; SPINRAZA para o tratamento da SMA; SKYCLARYS para o tratamento da ataxia de Friedreich; QALSODY para o tratamento da ELA, e FUMADERM para o tratamento da psoríase severa. Também colabora com Eisai na comercialização do LEQEMBI para o tratamento da doença de Alzheimer e Sage na comercialização do ZURZUVAE para o tratamento da depressão pós-parto (PPD).', 'Cambridge, MA, United States', 7605);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BXMT', 'STOCK', 'Blackstone Mortgage Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Blackstone Mortgage Trust, Inc. is a real estate finance company that originates senior loans collateralized by commercial real estate in North America, Europe, and Australia. The Companys investment objective is to preserve and protect shareholder capital while producing attractive risk-adjusted returns primarily through dividends generated from current income from its loan portfolio. Its portfolio is composed primarily of loans secured by high-quality, institutional assets in major markets, sponsored by experienced, well-capitalized real estate investment owners and operators. These senior loans are capitalized by accessing a variety of financing options, depending on its view of the most prudent strategy available for each of its investments. The Company conducts its operations as a real estate investment trust for the United States federal income tax purposes. The Company is externally managed by BXMT Advisors L.L.C.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('REAX', 'STOCK', 'The Real Brokerage Inc.', 'NCM', 'Real Estate', 'Real Estate Services', 'The Real Brokerage Inc. is a real estate technology company that operates as a software-based brokerage across approximately 50 states in United Stated, the District of Columbia, and four Canadian provinces. Its platform leverages artificial intelligence (AI) and automation to enhance agent productivity while maintaining a lean operating model. The Company operates as a fully digital brokerage, offering agents a more flexible, efficient, and financially compelling model. Its technology platform is reZEN, is a proprietary transaction management and brokerage operations software. The Companys services include end-to-end transaction management, automated compliance & brokerage oversight, integrated payment & financial services, Leo CoPilot: AI-powered agent support, and open application programming interface (API) for customization.', 'Miami, FL, United States', 429);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHCT', 'STOCK', 'Community Healthcare Trust Incorporated', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'Community Healthcare Trust Incorporated is a real estate investment trust. The Company focuses on owning income-producing real estate properties associated primarily with the delivery of outpatient healthcare services in its target submarkets throughout the United States. The Company owns and acquires real estate properties that are leased to hospitals, doctors, healthcare systems or other healthcare service providers. The Companys investment portfolio is diversified among healthcare facility types, such as medical office buildings, physician clinics, surgical centers and hospitals, specialty centers, behavioral facilities, inpatient rehabilitation facilities and long-term acute care hospitals, as well as being diverse both geographically and with respect to its tenant base. The Company has investments in approximately 200 real estate properties. The properties are located in 36 states, totaling approximately 4.4 million square feet in aggregate.', 'Franklin, TN, United States', 36);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARMN', 'STOCK', 'Aris Mining Corporation', 'ASE', 'Basic Materials', 'Gold', 'Aris Mining Corporation is a Canada-based gold mining company. The Company is primarily engaged in the acquisition, exploration, development and operation of gold properties in Colombia, Guyana and Canada. The Company operates two underground gold mines in Colombia, which are rich in high-grade deposits: the Segovia Operations and the Marmato Upper Mine. Its other projects include the Soto Norte Project, Toroparu Project, and the Juby Project. The Segovia Operations are 100% owned by the Company and are located in a historic mining district of Colombia and comprise four underground mines. The Marmato mine is 100% owned by the Company and is located in a historic mining district of Colombia and consists of the operating, small-scale underground Upper Mine and a 1,000 tons per-day (tpd) processing facility that produces dore. The Soto Norte Project is located in a historic mining district in Colombia. It holds a 51% joint venture interest and serves as the project operator.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESTC', 'STOCK', 'Elastic N.V.', 'NYQ', 'Technology', 'Software - Application', 'A Elastic NV é uma empresa de análise de dados sediada na Holanda. A plataforma da Companhia, que está disponível como um serviço hospedado e gerenciado em nuvens públicas, bem como um software autogerenciado, permite que seus clientes encontrem insights de grandes quantidades de dados e tomem medidas. A Companhia oferece três soluções baseadas em pesquisa - Enterprise Search, Observability e Security - que são incorporadas à plataforma, que é construída no Elastic Stack, um conjunto de produtos de software que ingerem dados de qualquer fonte, em qualquer formato e executam pesquisa, análise e visualização desses dados. A Companhia ajuda organizações, seus funcionários e seus clientes a encontrar o que precisam, mantendo os aplicativos de missão crítica funcionando sem problemas e os protegendo contra ameaças cibernéticas. A Companhia gera receita principalmente por vendas de assinaturas de sua plataforma.', 'Amsterdam, , Netherlands', 3537);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BL', 'STOCK', 'BlackLine, Inc.', 'NMS', 'Technology', 'Software - Application', 'A Blackline, Inc. Fornece uma plataforma unificada, escalável e flexível, adaptada às necessidades do Escritório do Diretor Financeiro (CFO) e oferece aplicativos específicos. A plataforma abrangente da empresa aborda processos de missão crítica, incluindo registro para relatório e fatura para caixa, permitindo dados unificados, processos simplificados e otimizados e insights em tempo real por meio de visibilidade, automação e inteligência artificial (IA). Seus aplicativos baseados na nuvem, equipados com a plataforma Blackline Studio360, incluem reconciliações de conta, correspondência de transações, gerenciamento de tarefas, análise de relatórios financeiros, e gerenciamento de transações. entrada de revistas, análise de variância, conformidade, gestão de crédito e risco, gestão de cobranças, faturação eletrónica e pagamentos, criação de empresas, equilíbrio e resolução entre empresas e liquidar entre empresas. Sua plataforma Blackline Studio360 inclui Studio360 Integrate, Studio360 ', 'Woodland Hills, CA, United States', 1830);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABEO', 'STOCK', 'Abeona Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Abeona Therapeutics Inc. is a commercial-stage biopharmaceutical company developing cell and gene therapies for serious diseases. The Company''s ZEVASKYN (prademagene zamikeracel) is an autologous cell-based gene therapy for the treatment of wounds in adults and pediatric patients with recessive dystrophic epidermolysis bullosa. Its fully integrated cell and gene therapy cGMP manufacturing facility in Cleveland, Ohio serves as the manufacturing site for ZEVASKYN commercial production. Its development portfolio features adeno-associated virus (AAV)-based gene therapies for ophthalmic diseases with high unmet medical need. Its AAV capsids are being evaluated to improve tropism profiles for a variety of devastating diseases. Its pipeline programs include ABO-504 (Stargardt disease), ABO-503 (X-linked retinoschisis), ABO-505 (autosomal dominant optic atrophy), UX111 (Sanfilippo Syndrome Type A (MPS IIIA)), TSHA-102 (Rett Syndrome), and TSHA-118 (Infantile Batten Disease (CLN1 Disease)).', 'Cleveland, OH, United States', 136);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALMU', 'STOCK', 'Aeluma, Inc.', 'NCM', 'Technology', 'Semiconductors', 'Aeluma, Inc. develops optoelectronic devices for sensing and communications applications. The Company is engaged in manufacturing devices using high-performance compound semiconductor materials on large-diameter substrates that are commonly used to manufacture mass market microelectronics. This enables manufacturing of high-performance photodetectors and photodetector array circuits for imaging applications in mobile devices, as well as other technologies. This technology has the potential to enhance the performance and capability of camera image sensors, light detection and ranging (LiDAR), augmented reality/virtual reality (AR/VR), facial recognition, and other applications. Its potential markets include automotive LiDAR, industrial LiDAR, robotics, mobile, AR/VR, AI, communications, and defense and aerospace.', 'Goleta, CA, United States', 11);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRSP', 'STOCK', 'BrightSpire Capital, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'BrightSpire Capital, Inc. is a commercial real estate (CRE) credit real estate investment trust. The Company is focused on originating, acquiring, financing and managing a diversified portfolio, consisting primarily of CRE debt investments and net leased properties predominantly in the United States. The Company''s segments include Senior and Mezzanine Loans and Preferred Equity, Net Leased and Other Real Estate, and Corporate and Other. The Senior and Mezzanine Loans and Preferred Equity segment has CRE debt investments, including senior loans, mezzanine loans, and preferred equity interests, as well as participation in such loans. The Net Leased and Other Real Estate segment includes direct investments in commercial real estate with long-term leases to tenants on a net lease basis. The Corporate and Other includes corporate-level asset management and other fees. The Company has offices in New York and Los Angeles, California.', 'New York, NY, United States', 48);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WAT', 'STOCK', 'Waters Corporation', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'A Waters Corporation oferece instrumentos analíticos, tecnologias de separação e software, servindo a vida, os materiais, os materiais e os materiais necessários para o desenvolvimento de produtos e serviços. alimentos e ciências ambientais. Os segmentos da Companhia incluem Waters e TA. A empresa projeta, fabrica, vende e presta serviços de cromatografia líquida de alta eficiência (HPLC), cromatografia líquida de ultra-desempenho (UPLC e em conjunto com HPLC, conhecida como LC) e sistemas de tecnologia de espetrometria de massas (MS) e produtos de suporte, incluindo colunas de cromatografia, outros produtos consumíveis e planos de serviço abrangentes pós-garantia. A empresa projeta, fabrica, vende e presta serviços de análise térmica, reometria e calorimetria através de sua linha de produtos TA Instruments (TA). A Companhia também é desenvolvedora e fornecedora de produtos avançados baseados em software que fazem interface com os instrumentos da Companhia, bem como com os instrumentos', 'Milford, MA, United States', 7600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPT', 'STOCK', 'Camden Property Trust', 'NYQ', 'Real Estate', 'REIT - Residential', 'Camden Property Trust é um fundo de investimento imobiliário (REIT). A Empresa e suas subsidiárias estão principalmente envolvidas na propriedade, gestão, desenvolvimento, reposicionamento, redesenvolvimento, aquisição e construção de condomínios multifamiliares. Possui e opera aproximadamente 175 propriedades contendo 59 210 casas de apartamentos em todo os Estados Unidos. Tem três propriedades em desenvolvimento e consistirá de um total de 60 348 casas de apartamentos. Suas propriedades geralmente consistem em edifícios de arranha-céus ou edifícios de dois e três andares em um ambiente paisagístico, bem como edifícios altos, e fornecem aos moradores uma variedade de comodidades comuns às propriedades de aluguel multifamiliares. As propriedades da empresa incluem Camden Chandler, Camden Copper Square, Camden Foothills, Camden Legacy e outros. Suas propriedades estão localizadas no Arizona, Califórnia, Colorado, Washington District of Columbia (DC) Metro, Flórida e outros.', 'Houston, TX, United States', 1660);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSWC', 'STOCK', 'Capital Southwest Corporation', 'NMS', 'Financial Services', 'Asset Management', 'Capital Southwest Corporation is an internally managed business development company. The Company is a market lending firm focused on supporting the acquisition and growth of middle market businesses with investments across the capital structure, including first lien, second lien and non-control equity co-investments. It specializes in providing customized debt and equity financing to lower middle market (LMM) companies in a broad range of investment segments located primarily in the United States. Its investment objective is to produce attractive risk-adjusted returns by generating current income from its debt investments and capital appreciation from its equity and equity-related investments. It invests primarily in first-lien debt securities, secured by security interests in portfolio company assets. It also invests in equity interests in its portfolio companies alongside its debt securities. It also offers managerial assistance to its portfolio companies.', 'Dallas, TX, United States', 30);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETNB', 'STOCK', '89bio, Inc.', 'NGM', 'Healthcare', 'Biotechnology', '89bio, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on the development and commercialization of therapies for the treatment of liver and cardio-metabolic diseases. The Companys lead product candidate, pegozafermin, a specifically engineered glycoPEGylated analog of fibroblast growth factor 21 (FGF21), is being developed for the treatment of metabolic dysfunction-associated steatohepatitis (MASH). Pegozafermin is engineered to protect against proteolysis and reduce renal clearance and optimize its potency, enabling the potential use of a lower dosage/dose. Pegozafermin has been optimally constructed with two mutations via substitutions with natural amino acids at site-specific positions (173 and 176) toward the C-terminus end of the hormone.', 'San Francisco, CA, United States', 93);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BASE', 'STOCK', 'Couchbase, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Couchbase, Inc. provides a cloud database platform for modern applications. The Company provides the developer data platform for critical applications in its artificial intelligence (AI) world. Its products include Couchbase Capella, Couchbase Server, Couchbase Mobile & Edge Computing, Couchbase Edge Server, and Intelligent Data Services. Its Couchbase Capella is a fully managed, automated, and secure DBaaS that simplifies deployment and operations across cloud environments. Its Couchbase Server is a multiservice NoSQL database that combines relational databases (ACID transactions, SQL++ for querying) with the scalability and flexibility of NoSQL. Its Couchbase Mobile is a full-featured embedded NoSQL database designed for mobile and IoT applications that require always-on availability. Its Couchbase Edge Server extends data processing to resource-constrained environments, providing low-latency access, offline resilience, and real-time synchronization.', 'Santa Clara, CA, United States', 804);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OTRK', 'STOCK', 'Ontrak, Inc.', 'NCM', 'Healthcare', 'Health Information Services', 'Ontrak, Inc. is a value-based behavioral healthcare company that identifies and engages people with unmet health needs using its advanced engagement system to improve clinical outcomes. The Company identifies, engages, and delivers care to the vulnerable members of the behavioral health population who would otherwise fall through the cracks of the healthcare system. Through its Advanced Engagement System, it engages individuals with anxiety, depression, substance use disorders and chronic disease by delivering personalized care coaching and customized care pathways that help them receive the treatment and advocacy they need, despite the socio-economic, medical and health system barriers that exacerbate the severity of their comorbid illnesses. It integrates AI, predictive analytics, comprehensive clinical and claims data, patient-generated information, and digital interfaces with care coach engagements to deliver improved member health and better healthcare system utilization.', 'Miami, FL, United States', 104);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RVLV', 'STOCK', 'Revolve Group, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Revolve Group, Inc. is a fashion retailer for millennial and generation Z consumers. The Company is an online retailer and fashion brand. Through its Websites and mobile applications, it delivers a customer experience with a curated merchandise offering. The Company sells merchandise through two segments: REVOLVE and FWRD. REVOLVE segment offers an assortment of premium apparel, footwear, beauty, accessories and home products from emerging, established and owned brands. FWRD segment offers an assortment of curated and elevated iconic and emerging luxury brands. Its platform connects a community of consumers, global fashion influencers, and emerging, established, and owned brands. The Company offers products under various brands, such as Lovers and Friends, GRLFRND, NBD, Camila Coelho, Alexandre Vauthier, and House of Harlow 1960. Its customers can engage with the Company in approximately 12 languages and pay in over 50 currencies.', 'Cerritos, CA, United States', 1632);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGL', 'STOCK', 'VanEck Fallen Angel High Yield Bond ETF', 'NGM', NULL, NULL, 'The fund normally invests at least 80% of its total assets in securities that comprise the fund''s benchmark index. The index is comprised of below investment grade corporate bonds denominated in U.S. dollars that were rated investment grade at the time of issuance.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLLS', 'STOCK', 'Cellectis S.A.', 'NGM', 'Healthcare', 'Biotechnology', 'Cellectis SA is a France-based company active in the field of genome engineering and genomic surgery. The Company specializes in the research, development, and commercialization of rational genome engineering technologies. The Company develops immunotherapies that aim to force the immune system to target and eradicate cancer cells. It has developed an expertise in combining meganucleases with engineered targeting Deoxyribonucleic Acid (DNA) matrices into Meganuclease Recombination Systems (MRS), used for gene excision, correction or replacement. Cellectis SA markets its technologies mainly for use in the research field, in pharmaceutical drug discovery programs, in the agronomics, bioproduction, and biotherapeutics fields. Cellectis SA operates several subsidiaries. The Company operates in France and the United States, among others.', 'Paris, , France', 216);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKR', 'STOCK', 'Acadia Realty Trust', 'NYQ', 'Real Estate', 'REIT - Retail', 'Acadia Realty Trust is an equity real estate investment trust (REIT). The Company is focused on the ownership, acquisition, development, and management of retail properties located primarily in high-barrier-to-entry, supply-constrained, densely populated metropolitan areas in the United States. The Company operates through three segments: Core Portfolio, Investment Management, and Structured Financing. The Company''s Core Portfolio segment consists primarily of retail properties located primarily in high-barrier-to-entry, densely populated metropolitan areas with a long-term investment horizon. The Company''s Investment Management segment holds primarily retail real estate in which the Company co-invests with high-institutional investors. The Company''s Structured Financing segment consists of earnings and expenses related to notes and mortgages receivable. The Company has ownership interests in approximately 210 properties within its core portfolio and investment management.', 'Rye, NY, United States', 129);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARI', 'STOCK', 'Apollo Commercial Real Estate Finance, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Apollo Commercial Real Estate Finance, Inc. is a real estate investment trust. The Company primarily originates, acquires, invests in and manages performing commercial first mortgage loans, subordinate financings and other commercial real estate-related debt investments. Its principal business objective is to acquire its target assets in order to provide attractive risk- adjusted returns to its stockholders over the long term, primarily through dividends and secondarily through capital appreciation. Its investment strategy is to identify opportunities within its target assets through its manager and its affiliates as well as their platform, which integrates real estate experience with private equity and capital markets in transaction sourcing, underwriting, execution, asset operation, management and disposition. It targets assets that are secured by real estate throughout the United States and Europe. The Company is externally managed and advised by ACREFI Management, LLC.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DKS', 'STOCK', 'DICK''S Sporting Goods, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'A Dick''S Sporting Goods, Inc. É uma Varejista de artigos esportivos omni-channel. A empresa possui e opera Golf Galaxy, Public Lands, e indo embora! lojas especializadas concept, e também oferecem seus produtos on-line e através de suas aplicações móveis. Também possui e opera o Dick''s House of Sport e Golf Galaxy Performance Center, bem como o GameChanger, uma plataforma móvel de esportes para jovens para streaming ao vivo, agendamento, comunicações e scorekeeping. Ele opera aproximadamente 723 locais de artigos esportivos DA DICK em todos os Estados Unidos. Ele carrega uma grande variedade de marcas nacionais, incluindo, mas não limitado a, adidas, Asics, Brooks, Callaway Golf, Carhartt, Columbia, Hoka, Jordan, New Balance, Nike, peloton, The North Face, Under Armour, Wilson, Yeti, e outros. Suas marcas verticais incluem marcas que possui em linhas duras e softlines e estão disponíveis em suas lojas e on-line, como Alpine Design, CALIA, DSG, ETHOS, Fitness Gear, MAXFLI, Nishiki, Wa', 'Coraopolis, PA, United States', 18600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPL', 'STOCK', 'Amplitude, Inc.', 'NCM', 'Technology', 'Software - Application', 'Amplitude, Inc. provides a digital analytics platform that helps companies unlock the power of their products. The Companys Digital Analytics Platform helps businesses understand how people are using their products so they can build digital experiences. Its platform comprises several primary offerings: Amplitude Analytics, Amplitude Session Replay, Amplitude Feature Experimentation, Amplitude Web Experimentation, Amplitude Activation and Amplitude Guides and Surveys. Amplitude Analytics is the cornerstone of the platform and provides real-time insights into user behavior. Amplitude Activation unifies data across multiple sources, creating a single, enriched dataset that fuels analytics and personalization. Amplitude Guides and Surveys helps companies to deploy in-product guides, tours, and surveys, using the power of behavioral insights to fuel great results. Amplitude Feature Experimentation enables product, data, and engineering teams to build world-class experiments.', 'San Francisco, CA, United States', 800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGX', 'STOCK', 'Argan, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'Argan, Inc. is a holding company. The Company is a construction firm that conducts operations through its subsidiaries, Gemma Power Systems, LLC and affiliates (GPS), Atlantic Projects Company Limited and affiliates (APC), The Roberts Company, Inc. (TRC), and Southern Maryland Cable, Inc. (SMC). Through GPS and APC, its power industry services, it offers a suite of engineering, procurement, construction, commissioning, maintenance, project development and technical consulting services to the power generation market, including the renewable energy sector. Through TRC, the industrial construction services provide field services and project management that support new plant construction and additions, maintenance turnarounds, shutdowns and emergency mobilizations for industrial plants. Through SMC, its telecommunications infrastructure services provide project management, construction, installation and maintenance services to commercial, local government and federal government customers.', 'Arlington, VA, United States', 1595);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMN', 'STOCK', 'Eastman Chemical Company', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Eastman Chemical Company é uma empresa global de materiais especiais que produz uma gama de produtos encontrados em itens que as pessoas usam todos os dias. Seus segmentos incluem Materiais Avançados (AM), Aditivos e Produtos Funcionais (AFP), Intermediários Químicos (CI) e Fibras. O segmento AM produz e comercializa polímeros, filmes e plásticos com propriedades diferenciadas de desempenho para usos finais de valor agregado no transporte; duráveis e eletrônicos; construção e construção; mercados finais médicos e farmacêuticos e consumíveis. O segmento AFP fabrica materiais para produtos em alimentos, rações e agricultura; transporte; tratamento de água e energia; cuidados pessoais e bem-estar; construção e construção; consumíveis, duráveis e mercados finais eletrônicos. O segmento CI vende intermediários para mercados finais, como produtos químicos industriais e processamento, construção e construção, saúde e bem-estar, alimentos e rações. Seu segmento de fibras fabrica e vende plasti', 'Kingsport, TN, United States', 14000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBSH', 'STOCK', 'Commerce Bancshares, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Commerce Bancshares, Inc. is a bank holding company offering a full line of banking services through its subsidiaries, including payment solutions, investment management and securities brokerage. The Companys subsidiary, Commerce Bank (the Bank), operates full-service banking facilities across the Midwest, including the St. Louis and Kansas City metropolitan areas, Springfield, Central Missouri, Central Illinois, Wichita, Tulsa, Oklahoma City, and Denver. It also maintains commercial offices in Dallas, Houston, Cincinnati, Nashville, Des Moines, Indianapolis, and Grand Rapids and wealth offices in Dallas, Houston, and Naples. Its segments include Commercial, Consumer, and Wealth. The Commercial segment provides a full array of corporate lending, merchant and commercial bank card products, payment solutions, leasing, and international services, as well as business and government deposit, investment, institutional brokerage, and cash management services.', 'Kansas City, MO, United States', 4658);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTM', 'STOCK', 'DT Midstream, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'DT Midstream, Inc. is an owner, operator, and developer of natural gas interstate and intrastate pipelines, storage and gathering systems, compression, treatment, and surface facilities. The Company transports clean natural gas for utilities, power plants, marketers, large industrial customers, and energy producers. Its segments include Pipeline and Gathering. The Pipeline segment owns and operates interstate and intrastate natural gas pipelines, storage systems, and natural gas gathering lateral pipelines. It also has interests in equity method investees that own and operate interstate natural gas pipelines. The segment is engaged in the transportation and storage of natural gas for intermediate and end user customers. The Gathering segment owns and operates gas gathering systems. The segment is engaged in collecting natural gas from points at or near customers wells for delivery to plants for treating, to gathering pipelines for further gathering, or to pipelines for transportation.', 'Detroit, MI, United States', 556);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNOB', 'STOCK', 'ConnectOne Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'ConnectOne Bancorp, Inc. is a financial services company that operates, through its subsidiary, ConnectOne Bank (the Bank) and the Banks fintech subsidiary, BoeFly, Inc (BoeFly). ConnectOne Bank is a commercial bank offering a full suite of banking and lending products and services that focus on small to middle-market businesses. The Bank''s offices are located primarily in the New York metro market and span New Jersey, New York City, Long Island, and the Hudson Valley, including Rockland, Orange, and Westchester counties. It offers a range of deposit and loan products. It also provides a range of other banking services. Its products and services include personal and business checking accounts, money market accounts, time and savings accounts, credit cards, safe deposit boxes, access to automated teller services and telephone, and others. BoeFly is a fintech marketplace that connects borrowers in the franchise space with funding solutions through a network of partner banks.', 'Englewood Cliffs, NJ, United States', 489);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMLX', 'STOCK', 'Amylyx Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Amylyx Pharmaceuticals, Inc. is a clinical-stage pharmaceutical company. The Company is focused on three investigational therapies across several neurodegenerative and endocrine diseases. Its lead investigational asset is avexitide, an investigational, first-in-class glucagon-like peptide-1 (GLP-1) receptor antagonist. Avexitide has been evaluated as a treatment for Post-Bariatric Hypoglycemia (PBH) and congenital HI, two indications characterized by hyperinsulinemic hypoglycemia. In addition to avexitide, it is advancing AMX0035, an oral, fixed-dose combination of sodium phenylbutyrate and taurursodiol in Wolfram syndrome and progressive supranuclear palsy (PSP), and AMX0114 in amyotrophic lateral sclerosis (ALS). AMX0035 is designed to mitigate neurodegeneration by targeting endoplasmic reticulum stress and mitochondrial dysfunction, two cellular processes central to neuronal cell death and neurodegeneration. AMX0114 is an investigational antisense oligonucleotide.', 'Cambridge, MA, United States', 123);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADC', 'STOCK', 'Agree Realty Corporation', 'NYQ', 'Real Estate', 'REIT - Retail', 'A ACORD Realty Corporation é uma confiança integrada de investimento imobiliário (REIT) focada principalmente na propriedade, aquisição, desenvolvimento e gestão de propriedades de varejo líquidas alugadas a inquilinos. Os ativos da Companhia são detidos e todas as suas operações são realizadas através, direta ou indiretamente, da parceria operacional, da qual a Companhia é o único sócio geral. Seu portfólio é composto por mais de 2 370 propriedades localizadas em 50 estados e totalizando aproximadamente 48,8 milhões de pés quadrados de área bruta locável (ABL). Seu portfólio de propriedades está localizado em Texas, Ohio, Flórida, Michigan, Illinois, EUA. Carolina do Norte, Nova Jersey, Pensilvânia, Califórnia, Nova Iorque, Geórgia, Virgínia, Connecticut, Wisconsin e outros. Seus inquilinos incluem Walmart, Dollar General, Tractor Supply, Best Buy, Dollar Tree, TJX Companies, O''Reilly Auto Parts, CVS, Kroger, Lowe''s, Hobby Lobby, Burlington, Sherwin-Williams, Sunbelt Rentals, Wawa, ', 'Royal Oak, MI, United States', 75);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCQ', 'STOCK', 'Invesco BulletShares 2026 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2026 (collectively, "2026 Bonds").', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALNY', 'STOCK', 'Alnylam Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'A Alnylam Pharmaceuticals, Inc. É uma empresa biofarmacêutica de estágio comercial. A empresa está envolvida na descoberta, desenvolvimento, fabricação e comercialização de novas terapias baseadas na interferência do ácido ribonucleico (RNAi). Seus produtos comercializados incluem AMVUTTRA (vutrisiran) para o tratamento da amiloidose mediada por transtiretina hereditária (hATTR) com polineuropatia em adultos; ONPATTRO (patisiran) para o tratamento da polineuropatia da amiloidose 1 Os programas de desenvolvimento clínico da empresa incluem Cemdisiran, Fitusiran, Zilebesiran, Elebsiran, Mivelsiran e ALN-HTT02. Está desenvolvendo o Cemdisiran para tratar doenças mediadas por complemento.', 'Cambridge, MA, United States', 2230);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CANF', 'STOCK', 'Can-Fite BioPharma Ltd.', 'ASE', 'Healthcare', 'Biotechnology', 'Can-Fite BioPharma Ltd., a clinical-stage biopharmaceutical company, develops orally bioavailable small molecule therapeutic products for the treatment of cancer, liver inflammatory diseases, and erectile dysfunction in Israel. The company''s lead drug candidate Piclidenoson, which has been completed Phase III clinical trial for the treatment of psoriasis. It develops Namodenoson that is in Phase III clinical trial for the treatment of liver cancer; and Phase IIa for the treatment of pancreatic cancer; as well as in Phase IIb trial for the treatment of metabolic associated steatohepatitis; and CF602, which is in pre-clinical trial for the treatment of erectile dysfunction. In addition, the company develops commercial predictive biomarker blood test kit for A3AR. It has license and collaboration agreement with CMS Medical to develop, manufacture, and commercialize Piclidenoson and Namodenoson; and collaboration agreement with Univo Pharmaceuticals to identify and co-develop specific for', 'Ramat Gan, , Israel', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAK', 'STOCK', 'Braskem S.A.', 'NYQ', 'Basic Materials', 'Chemicals', 'A Braskem SA é uma petroquímica integrada no Brasil para a primeira e segunda geração de resinas termoplásticas. As atividades da Companhia são divididas em três segmentos operacionais: Brasil; Estados Unidos e Europa; e México. O segmento Brasil está focado na produção de resinas de polietileno (PE), polipropileno (PP) e policloreto de vinilo (PVC), além de insumos químicos básicos como etileno, propileno, butadieno, benzeno, tolueno, etc. cloro, soda e solventes, entre outros. O segmento Estados Unidos e Europa é responsável pela produção de polipropileno em unidades nos Estados Unidos e na Alemanha. O segmento México consiste na operação de blocos de etileno e de polietileno localizados no México.', 'São Paulo, SP, Brazil', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTKB', 'STOCK', 'Cytek Biosciences, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'Cytek Biosciences, Inc. is a cell analysis solutions company. The Company is advancing the cell analysis tools by delivering high-resolution, high-content, and high-sensitivity cell analysis utilizing its patented Full Spectrum Profiling (FSP) technology. Its platform includes its core FSP instruments, the Cytek Aurora and Northern Lights systems and the Cytek Aurora CS cell sorter; the Cytek Orion reagent cocktail preparation system; the Enhanced Small Particle (ESP) detection technology; the flow cytometer and imaging products under the Amnis and Guava brands, and reagents, software and service to provide a comprehensive and integrated suite of solutions for its customers. Its Cytek Aurora and Northern Lights systems are used in the study of infectious diseases, immunology, immunotherapy, immuno-oncology, oncology, and drug discovery. The Cytek Orion reagent cocktail preparation system enables researchers to fully automate the preparation of antibody cocktails for flow cytometry.', 'Fremont, CA, United States', 688);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIAF', 'STOCK', 'bioAffinity Technologies, Inc.', 'NCM', 'Healthcare', 'Diagnostics & Research', 'bioAffinity Technologies, Inc. is a biotechnology company focused on the need for noninvasive diagnosis of early-stage cancer and diseases of the lung and broad-spectrum cancer treatments. It develops noninvasive diagnostics to detect early-stage lung cancer and other diseases of the lung using flow cytometry and automated analysis developed by machine learning, a form of artificial intelligence (AI). The Companys product, CyPath Lung, is a noninvasive test that has shown high sensitivity, specificity and accuracy for the detection of early-stage lung cancer. CyPath is marketed as a Laboratory Developed Test (LDT) by Precision Pathology Laboratory Services, a subsidiary of the Company. CyPath Lung uses flow cytometry technology to detect and analyze cell populations in a persons sputum, or phlegm, to find characteristics indicative of lung cancer, including cancer and/or cancer-related cells that have shed from a lung tumor.', 'San Antonio, TX, United States', 57);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACRS', 'STOCK', 'Aclaris Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Aclaris Therapeutics, Inc. is a clinical-stage biopharmaceutical company. The Company is engaged in developing a pipeline of drug candidates to address the needs of patients with immuno-inflammatory diseases. It has a multi-stage portfolio of drug candidates powered by a robust research and development engine. Its KINect drug discovery platform, combined with its preclinical development capabilities, allows it to identify and advance potential product candidates that it may develop independently or in collaboration with third parties. It has two segments: therapeutics and contract research. The therapeutics segment is focused on identifying and developing therapies to address unmet needs for immuno-inflammatory diseases. The contract research segment is engaged in the provision of laboratory services. Its drug candidates include Bosakitug (ATI-045), ATI-2138 and ATI-052. Its other investigational product candidates include Lepzacitinib (ATI-1777) and Zunsemetinib (ATI-450).', 'Wayne, PA, United States', 61);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEEM', 'STOCK', 'Beam Global', 'NCM', 'Technology', 'Solar', 'Beam Global is a clean technology innovator which develops and manufactures sustainable infrastructure products and technologies. The Company develops designs, engineers, manufactures, and sells renewably energized infrastructure products for electric vehicle (EV) charging. It also manufactures steel structures with electronic integration such as street lighting, cell towers and energy infrastructure products, as well as power electronics including invertors, charge controllers, power supplies and light-emitting diode (LED) lighting. Its product offerings include EV ARC Electric Vehicle Autonomous Renewable Charger, Solar Tree Direct Current Fast Charge (DCFC), EV ARC DCFC, BeamSpot, BeamBike, BeamPatrol, BeamWell, and UAV ARC. Its EV ARC Electric Vehicle Autonomous Renewable Charger is a patented infrastructure product that uses integrated solar power and battery storage to provide a mounting asset and a source of power for factory installed electric vehicle charging stations.', 'San Diego, CA, United States', 245);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANNX', 'STOCK', 'Annexon, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Annexon, Inc. is a clinical-stage biopharmaceutical company advancing a late-stage clinical platform of novel therapies for people living with devastating classical complement-mediated neuroinflammatory diseases of the body, brain, and eye. It identifies and characterizes the role of the classical complement pathway in three therapeutic areas: autoimmune, neurodegeneration and ophthalmology, using its proprietary platform. Its lead candidate, ANX005, an investigational, full-length monoclonal antibody (mAb), is formulated for intravenous administration as the potential first targeted treatment for patients with Guillain-Barre Syndrome (GBS). It is advancing ANX1502, a novel small-molecule inhibitor of classical complement designed for oral administration in a range of chronic autoimmune diseases. It is also advancing ANX007, designed to block C1q locally in the eye, to provide complete protection against excess classical complement activity and the loss of photoreceptor neurons.', 'Brisbane, CA, United States', 106);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRC', 'STOCK', 'California Resources Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'California Resources Corporation is an independent energy and carbon management company committed to energy transition. The Companys segments include Oil and Natural Gas and Carbon Management. Its Carbon Management business, Carbon TerraVault, focuses on building, installing, operating, and maintaining carbon dioxide (CO2) equipment, transportation assets and storage facilities. The Oil and Natural Gas segment explores for, develops and produces crude oil, oil condensate, natural gas liquids and natural gas. It has operations in oil and gas basins, including San Joaquin Basin, Los Angeles Basin, Sacramento Basin, and other. It has interests in oil and gas fields throughout the San Joaquin basin, including in Elk Hills, Buena Vista, Coles Levee, North Belridge and South Belridge, Kern Front, Lost Hills, Cymric, McKittrick, Midway Sunset and Coalinga. The Los Angeles Basin is a northwest-trending plain about 50 miles long and 20 miles wide.', 'Long Beach, CA, United States', 1550);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHC', 'STOCK', 'Encompass Health Corporation', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Encompass Health Corporation is an owner and operator of inpatient rehabilitation hospitals in the United States. The Company provides compassionate rehabilitative care for patients recovering from a major injury or illness, using advanced technology and treatments to maximize recovery. It operates hospitals in 38 states and Puerto Rico, with concentrations in Florida and Texas. It operates approximately 166 inpatient rehabilitation hospitals. Its inpatient rehabilitation hospitals offer specialized rehabilitative care across an array of diagnoses and deliver comprehensive patient care services. It provides care to patients who suffer from cognitive disabilities or injuries due to medical conditions, such as strokes, hip fractures and a variety of debilitating neurological conditions. Its hospitals have settings for treating the debilitating effects of the COVID-19 virus, such as significant muscle weakness, cognitive impairments, shortness of breath with activity and malnutrition.', 'Birmingham, AL, United States', 28678);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACET', 'STOCK', 'Adicet Bio, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Adicet Bio, Inc. is a clinical-stage biotechnology company. It is engaged in advancing a pipeline of off-the-shelf gamma delta T cells, engineered with chimeric antigen receptors (CARs), to facilitate durable activity in patients. Its lead product candidate, ADI-001, a first-in-class allogeneic gamma delta T cell therapy expressing a CAR targeting CD20, is being developed for the potential treatment of autoimmune diseases. ADI-001 contains an anti-CD20 CAR that has a proprietary antigen-binding domain that recognizes a region of CD20 distinct from that recognized by rituximab. Its pipeline also includes ADI-270, an investigational allogeneic gamma delta CAR T cell therapy targeting CD70 via the CD27-ligand for the treatment of RCC and with potential in other solid tumor and hematological malignancy indications. Its pipeline has additional internal gamma delta T cell therapy programs in discovery and preclinical development for both hematological malignancies and solid tumors.', 'Boston, MA, United States', 152);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CISO', 'STOCK', 'CISO Global Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'CISO Global, Inc. is a cybersecurity, compliance, and software company. The Company provides a full range of cybersecurity consulting and related services, encompassing compliance, cybersecurity, and culture. It offers three types of services to clients, including security managed services, professional services, and cybersecurity software. The Companys services include managed security, compliance services, security operations center (SOC) services, virtual Chief Information Security Officer (vCISO) services, incident response, certified forensics, technical assessments, and cybersecurity training. Its cybersecurity software offers a comprehensive suite of proactive cybersecurity software solutions designed to protect organizations from evolving cyber threats. Its CISO Edge is an artificial intelligence (AI) -driven cloud security solution that provides comprehensive protection across cloud-first, hybrid, and remote environments.', 'Scottsdale, AZ, United States', 141);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPY', 'STOCK', 'Amplify Energy Corp.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Amplify Energy Corp. is an independent oil and natural gas company engaged in the acquisition, development, exploitation and production of oil and natural gas properties. The Companys operations are focused on Oklahoma, the Rockies (Bairoil), federal waters offshore Southern California (Beta), and East Texas / North Louisiana. Its liquid-rich acreage in Oklahoma consisted of approximately 95 thousand net (112 thousand gross) prospective acres in the Mississippian Lime trend in the Woods and Alfalfa Counties of Oklahoma. Its liquids-heavy Rockies properties include wells and properties primarily located in the Lost Soldier and Wertz fields in the Rockies at its Bairoil complex. Its Beta properties include two wellbore production platforms and one production handling and processing platform. The Companys business activities are conducted through Amplify Energy Operating LLC, its wholly owned subsidiary, and its wholly owned subsidiaries.', 'Houston, TX, United States', 229);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENR', 'STOCK', 'Energizer Holdings, Inc.', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'Energizer Holdings, Inc. is a manufacturer and distributor of primary batteries, portable lights, and auto care appearance, performance, refrigerant, and fragrance products. The Company''s segments include Batteries & Lights, and Auto Care. The Company offers household batteries including primary, rechargeable, specialty and hearing aid using many technologies including lithium, alkaline, carbon zinc, nickel metal hydride, zinc air, and silver oxide. It offers auto care products in the appearance, fragrance, performance, and air conditioning recharge product categories. Its portfolio of brands includes Energizer, Armor All, Eveready, Rayovac, STP, Varta, A/C Pro, Refresh Your Car!, California Scents, Driven, Bahama & Co., LEXOL, Eagle One, Nu Finish, Scratch Doctor, and Tuff Stuff. It distributes its products to consumers through numerous retail locations worldwide, including mass merchandisers and warehouse clubs, food, drug and convenience stores, e-commerce and military stores.', 'Saint Louis, MO, United States', 5600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRL', 'STOCK', 'Charles River Laboratories International, Inc.', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'Charles River Laboratories International, Inc. is a drug development company. It provides essential products and services to help pharmaceutical and biotechnology companies, government agencies and academic institutions around the globe accelerate their research and drug development efforts. Its Research Models and Services segment includes three businesses that provide foundational tools that enable its clients to discover new molecules: Research Models, Research Model Services, and Cell Solutions. Its Discovery and Safety Assessment segment provides regulated and non-regulated DSA services to support the research, development, and regulatory-required safety testing of potential new drugs, including therapeutic discovery and optimization plus in vitro and in vivo studies, laboratory support services, and strategic non-clinical consulting and program management to support product development. Its Manufacturing Solutions segment includes Microbial Solutions and Biologics Solutions.', 'Wilmington, MA, United States', 18700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOTZ', 'STOCK', 'Global X Robotics & Artificial Intelligence ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index. The underlying index is designed to provide exposure to exchange-listed companies in developed markets that are involved in the development of robotics and/or artificial intelligence as defined by Indxx, the provider of the underlying index. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOX', 'STOCK', 'Amdocs Limited', 'NMS', 'Technology', 'Software - Infrastructure', 'A Amdocs Limited é uma fornecedora de software e serviços para empresas de comunicação e mídia em países desenvolvidos e mercados emergentes. As ofertas da empresa são baseadas em uma mistura de produtos e serviços, usando tecnologias e metodologias, como nuvem e nuvem nativa, microsserviços, desenvolvimento e operações (DevOps), baixo código/sem código, computação de borda, código aberto, operações bimodais, engenharia de Confiabilidade do Local (SRE) e quantidades crescentes de automação através de ferramentas de tecnologia da informação (TI) padrão, interface de programação de aplicações abertas (APIs) e inteligência artificial (IA), inteligência artificial generativa (GenAI) e aprendizado de máquina (ML). Sua linha abrangente de serviços é projetada para atender a todas as etapas do ciclo de vida de um provedor de serviços e inclui consultoria, entrega, engenharia de qualidade (testes), integração de sistemas, operações e serviços. serviços de rede, serviços orientados por experiên', 'Saint Louis, MO, United States', 29058);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYN', 'STOCK', 'Cyngn Inc.', 'NCM', 'Technology', 'Software - Application', 'Cyngn Inc. is an autonomous vehicle (AV) technology company that is focused on addressing industrial uses for autonomous vehicles. The Company integrates its full-stack autonomous driving software, DriveMod, into vehicles manufactured by an original equipment manufacturer either via retrofit of existing vehicles or by integration directly into vehicle assembly. It designs the Enterprise Autonomy Suite (EAS) to be compatible with sensors and components from hardware technology providers and integrates its proprietary Autonomous Vehicle (AV) software to produce differentiated autonomous vehicles. EAS is a suite of technologies and tools that is divided into three categories: DriveMod, Cyngn Insight, and Cyngn Evolve. DriveMod is a modular industrial vehicle autonomous driving software. Cyngn Insight is a customer-facing tool suite for monitoring and managing AV fleets and generating/aggregating/analyzing data. Cyngn Evolve is an internal tool suite.', 'Menlo Park, CA, United States', 58);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBAR', 'STOCK', 'Banco BBVA Argentina S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banco Bbva Argentina SA, formerly known as BBVA French Bank, is an Argentina-based banking institution. Through its banking platform, the Bank provides a broad range of financial and non-financial services to both individuals and companies. It manages three business lines: Retail Banking, Small and Medium-Sized Companies and Corporate and Investment Banking (C&IB). Retail Banking offers checking and savings accounts, time deposits, credit cards, loans, mortgages, insurance and investment products, among others. Small and Medium-Sized Companies targets local private-sector companies providing financing products, factoring, checking accounts, time deposits, transactional and payroll services, insurance and investment products, among others. C&IB offers financial services to corporations and multinational companies, as well as global transaction services, global markets solutions, long term financing, among others. The Bank is active locally, mostly.', 'Buenos Aires, , Argentina', 6399);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRCC', 'STOCK', 'BRC Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'BRC Inc. is a Veteran-founded and led coffee, energy drink, and media company. The Company purchases, roasts, and sells coffee, coffee accessories, and branded apparel through its online channels and business networks. Its product offerings include roast coffee, single-serve coffee, ready-to-drink (RTD) coffee, and Black Rifle Energy (RTD energy beverage). It offers Black Rifle branded apparel, coffee brewing equipment, and outdoor and lifestyle gear. The Company operates through three primary channels: Wholesale, Direct-to-Consumer (DTC), and Outposts. In its Wholesale channel, it sells packaged coffee and its RTD beverages through Food, Drug, and Mass (FDM) retailers such as Walmart, Sams Club, regional and national grocery chains, and convenience stores, such as 7-Eleven, Caseys General Store, and Circle K. Its Outposts channel offers brewed coffee and Black Rifle Coffee merchandise. The Company also develops and promotes online content for the purpose of growing its brands.', 'Salt Lake City, UT, United States', 551);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHT', 'STOCK', 'DHT Holdings, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'DHT Holdings, Inc. is an independent crude oil tanker company. The Company''s fleet trades internationally and consists of crude oil tankers in the Very Large Crude Carriers (VLCC) segment. Its primary business is operating a fleet of crude oil tankers, with a secondary activity of providing technical management services. The Company operates its vessels through its subsidiary management companies in Monaco, Norway, Singapore, and India. Its principal activity is the ownership and operation of a fleet of crude oil carriers. It has approximately 28 vessels in operation. The fleet operates globally on international routes. The Company''s fleets are comprised of DHT Addax, DHT Antelope, DHT Gazelle, DHT Impala, DHT Appaloosa, DHT Mustang, DHT Bronco, DHT Colt, DHT Stallion, DHT Tiger, DHT Harrier, DHT Puma, DHT Panther, DHT Osprey, DHT Lion, DHT Leopard, DHT Jaguar, DHT Taiga, DHT Sundarbans, and DHT Scandinavia, among others.', 'Hamilton, , Bermuda', 924);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVAX', 'STOCK', 'Dynavax Technologies Corporation', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Dynavax Technologies Corporation is a commercial-stage biopharmaceutical company developing and commercializing vaccines to help protect against infectious diseases. The Company has two commercial products: HEPLISAV-B vaccine (Hepatitis B Vaccine (Recombinant), Adjuvanted), and CpG 1018 adjuvant. The HEPLISAV-B vaccine is used for the prevention of infection caused by all known subtypes of hepatitis B virus in adults 18 years of age and older. HEPLISAV-B is a two-dose in-one-month adult hepatitis B vaccine. CpG 1018 adjuvant is used in HEPLISAV-B and multiple adjuvanted COVID-19 vaccines. The Company is advancing a pipeline of differentiated product candidates that leverage its CpG 1018 adjuvant to develop improved vaccines in indications with unmet medical needs. Its pipeline programs include Shingles vaccine program (Z-1018) and Plague vaccine program. Z-1018 is an investigational vaccine candidate being developed for the prevention of shingles in adults aged 50 and older.', 'EmeryVille, CA, United States', 405);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COR', 'STOCK', 'Cencora, Inc.', 'NYQ', 'Healthcare', 'Medical Distribution', 'A Cencora, Inc. É uma empresa global de serviços de fornecimento e distribuição de produtos farmacêuticos. A empresa ajuda os prestadores de cuidados de saúde e os fabricantes farmacêuticos e de biotecnologia a melhorar o acesso dos pacientes aos produtos e a melhorar o atendimento aos pacientes. A empresa opera através de dois segmentos: U.S. Healthcare Solutions e International Healthcare Solutions. O segmento de Soluções de Saúde dos EUA distribui uma oferta abrangente de marca, marca especializada e medicamentos genéricos, produtos de saúde de balcão, suprimentos e equipamentos de saúde em casa e serviços relacionados a uma variedade de prestadores de cuidados de saúde, incluindo hospitais de cuidados agudos e sistemas de saúde, farmácias de varejo independentes e em cadeia, farmácias de longo prazo e locais alternativos e outros clientes. O segmento International Healthcare Solutions é composto por empresas que se concentram em operações internacionais de atacado e serviços relaci', 'Conshohocken, PA, United States', 51000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLR', 'STOCK', 'Allarity Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Allarity Therapeutics, Inc. is a clinical-stage biopharmaceutical company dedicated to developing personalized cancer treatments. It is focused on development of stenoparib, a PARP/tankyrase inhibitor for advanced ovarian cancer patients, using its DRP technology to develop a companion diagnostic that can be used to select those patients expected to derive clinical benefit from stenoparib. Its therapeutic candidate, stenoparib, is a dual inhibitor of the key DNA damage repair enzyme PARP, as well as Tankyrases, critical enzymes involved in the WNT signaling pathway commonly activated in many cancers. Inhibition of key DNA damage repair enzymes, such as PARP, has clinically demonstrated to be therapeutically beneficial in the treatment of cancers (ovarian cancers). The DRP method builds on the comparison of sensitive vs. resistant human cancer cell lines, including transcriptomic information from cell lines, combined with clinical tumor biology filters and prior clinical trial outcomes.', 'Boston, MA, United States', 6);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADTN', 'STOCK', 'ADTRAN Holdings, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'ADTRAN Holdings, Inc. is a provider of open, disaggregated networking and communications solutions that enable voice, data, video and Internet communications across any network infrastructure. Its segments include Network Solutions, which offers hardware and software products, and Services & Support, which includes a portfolio of network design and implementation services, support services and cloud-hosted SaaS applications. The segments span across Subscriber Solutions, Access & Aggregation Solutions, and Optical Networking Solutions. Its Subscriber Solutions portfolio is used by service providers to terminate their access services infrastructure at the customer''s premises. The Access & Aggregation Solutions are solutions that are used by communications service providers to connect subscribers. Its Optical Networking Solutions are used by communications service providers, Internet content providers and large enterprises to securely interconnect metro and regional networks over fiber.', 'Huntsville, AL, United States', 3091);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BXSL', 'STOCK', 'Blackstone Secured Lending Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Blackstone Secured Lending Fund is an externally managed, non-diversified, closed-end management investment company. The Companys investment objectives are to generate current income and, to a lesser extent, long-term capital appreciation. It invests at least 80% of its total assets in secured debt investments. The Company seeks to achieve its investment objectives primarily through originated loans and other securities, including syndicated loans, of private U.S. companies, typically in the form of first lien senior secured and unitranche loans (including first out/last out loans), and to a lesser extent, second lien, third lien, unsecured and subordinated loans and other debt and equity securities. It invests across various sectors, which include aerospace and defense, air freight and logistics, building products, commercial services and supplies, healthcare providers and services and others. The Company is externally managed by Blackstone Credit BDC Advisors LLC.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BR', 'STOCK', 'Broadridge Financial Solutions, Inc.', 'NYQ', 'Technology', 'Information Technology Services', 'Broadridge Financial Solutions, Inc. É uma empresa de tecnologia financeira. Ele fornece comunicações com investidores e soluções baseadas em tecnologia para bancos, corretores, gerentes de ativos e patrimônio, investidores e outros. Seu segmento de Soluções de Comunicação com Investidores (ICS) fornece Soluções Regulatórias, Soluções de Fundo Orientadas a Dados, Soluções de Emissor Corporativo e Soluções de Comunicação com o Cliente. O negócio de ICS envolve o processamento e distribuição de materiais proxy para investidores em títulos de capital e fundos mútuos, e a facilitação do processamento de votos relacionados. Seu segmento de Tecnologia e Operações Globais (GTO) fornece soluções que automatizam o ciclo de vida de transações frente a verso de ações, fundos mútuos, câmbio e derivativos negociados em bolsa, desde a captura e execução de pedidos até a confirmação de negociação, margem, reconciliações e outros. Ela também opera uma plataforma de processamento de transações dos Serv', 'Lake Success, NY, United States', 15000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AHH', 'STOCK', 'Armada Hoffler Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'Armada Hoffler Properties, Inc. is a vertically integrated, self-managed real estate investment trust (REIT). The Company is engaged in developing, building, acquiring, and managing office, retail and multifamily properties located primarily in the Mid-Atlantic and Southeastern United States. The Company operates through five segments: office real estate, retail real estate, multifamily real estate, general contracting & real estate services, and real estate financing. The Company''s general contracting, and real estate services business develops and builds properties for its own account and provides construction and development services to both related and third parties. The real estate financing segment includes the Company''s mezzanine loans and preferred equity investments on development projects. The Company also provides general construction and development services to third-party clients, in addition to developing and building properties to be placed in their stabilized portfoli', 'Virginia Beach, VA, United States', 148);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOV', 'STOCK', 'Dover Corporation', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'A Dover Corporation é um fabricante global diversificado e fornecedor de soluções. Seu segmento de produtos de engenharia fornece uma gama de equipamentos, componentes, software, soluções e serviços para o pós-venda de veículos, aeroespacial e defesa, entre outros. Seu segmento de Energia Limpa e Abastecimento fornece componentes, equipamentos e soluções e serviços de software. Também projeta, fabrica e fornece sistemas de tubulação isolados a vácuo para uma variedade de gases liquefeitos, como nitrogênio, oxigênio, dióxido de carbono e outros gases industriais. O seu segmento de Imaging & Identification fornece marcação e codificação de precisão, rastreabilidade de produtos, proteção da marca e equipamento de impressão digital têxtil. Seu segmento de Bombas e Soluções de Processos fabrica bombas especiais e medidores de vazão, conetores de transferência de fluidos, componentes de precisão projetados, instrumentos e controles digitais. Seu segmento de Tecnologias Climate & Sustainabili', 'Downers Grove, IL, United States', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVXL', 'STOCK', 'Anavex Life Sciences Corp.', 'NMS', 'Healthcare', 'Biotechnology', 'Anavex Life Sciences Corp. is a clinical-stage biopharmaceutical company engaged in the development of differentiated therapeutics by applying precision medicine to central nervous system (CNS) diseases with high unmet need. The Company analyzes genomic data from clinical trials to identify biomarkers, which it uses in the analysis of its clinical trials. Its focus is on developing treatments for Alzheimers disease, Parkinsons disease, schizophrenia, neurodevelopmental, neurodegenerative, and rare diseases, including Rett syndrome, and other CNS disorders. It has two core programs and two seed programs. ANAVEX 2-73 is being developed as an oral liquid once-daily formulation for rare diseases such as Rett syndrome as well as an oral once-daily capsule formulation for diseases such as Alzheimers disease. ANAVEX 3-71 is a CNS-penetrable potential disease-modifying treatment for cognitive impairments. Its other candidates include ANAVEX 1-41, ANAVEX 1066 and ANAVEX 1037.', 'New York, NY, United States', 42);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACHV', 'STOCK', 'Achieve Life Sciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Achieve Life Sciences, Inc. is a late-stage specialty pharmaceutical company. The Company focuses on addressing the global smoking health and nicotine dependence epidemic through the development and commercialization of cytisinicline. It has completed two Phase III studies with cytisinicline for smoking cessation and one Phase II study with cytisinicline in vaping cessation. Cytisinicline is a naturally occurring, plant-based alkaloid. Cytisinicline is structurally similar to nicotine and has a dual-acting mechanism of action, being both a receptor agonist and antagonist. Cytisinicline is an investigational product candidate being developed for the treatment of nicotine dependence and has not been approved by the Food and Drug Administration for any indication in the United States. Cytisinicline acts as a partial agonist/antagonist, binding to alpha-4 beta-2 nicotinic receptors in the brain and is thought to have two potential consequences in treating nicotine dependence.', 'Bothell, WA, United States', 25);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNZI', 'STOCK', 'Banzai International, Inc.', 'NCM', 'Technology', 'Software - Application', 'Banzai International, Inc. is a marketing technology company that provides artificial intelligence (AI)-enabled marketing and sales solutions for businesses of all sizes. The Company enables companies of all sizes to target, engage, and measure both new and existing customers more effectively. Its platform offers three software as a service (SaaS) products: Demio, Boost, and Reach. Demio is a user-friendly, browser-based webinar platform with extensive data and marketing features designed to help businesses engage with their audience through live events and on-demand, interactive video content. Boost is a tool utilized by customers to enhance participation in their Demio webinars. This tool allows registered attendees to promote Demio webinars on social media platforms. Customers use Reach to directly connect with their events target audience to increase registrations for their events. It also provides video hosting and marketing suite solutions for businesses through Vidello.', 'Bainbridge Island, WA, United States', 28);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FLGC', 'STOCK', 'Flora Growth Corp.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Flora Growth Corp. is a cannabis company that manufactures and distributes consumer packaged goods and distributes medicinal cannabis and pharmaceutical products. Its brand consists of JustCBD, Vessel, Melo, Haze, and Australian Vaporizers. JustCBD is a consumer-packaged goods brand with over 350 products, including cannabidiol gummies, topicals, tinctures, and vape products. JustCBD products are available for purchase in smoke and vape shops, clinics, spas, and pet stores, as well as other independent non-traditional retail channels. Vessel is the cannabis accessory and technology brand servicing the United States and Canada through direct-to-consumer and retail sales. Vessel''s products include cannabis consumption accessories, personal storage, and travel accessories for the vape and dry herb categories, which are sold to consumers, dispensaries, smoke shops, and cannabis brands. Australian Vaporizers is an online retailer of vaporizers, hardware, and accessories in Australia.', 'Fort Lauderdale, FL, United States', 64);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CODI', 'STOCK', 'Compass Diversified', 'NYQ', 'Industrials', 'Conglomerates', 'Compass Diversified Holdings is engaged in owning and managing a diverse set of defensible, middle-market businesses across the branded consumer, industrial, healthcare, and critical outsourced services sectors. It categorizes its businesses into two separate groups: branded consumer businesses and industrial businesses. Its segments include 5.11 Acquisition Corp. (5.11), Boa Holdings Inc. (BOA), Lugano Holdings, Inc. (Lugano), Relentless Topco, Inc. (PrimaLoft), THP Topco, Inc., CBCP Products, LLC, AMTAC Holdings, LLC (Arnold), FFI Compass, Inc. (Altor Solutions or Altor) and SternoCandleLamp Holdings, Inc. (Sterno). 5.11 is a provider of purpose-built technical apparel and gear for law enforcement, firefighters, EMS, and military special operations as well as outdoor and adventure enthusiasts. BOA is a creator of the patented BOA Fit System, which consists of three integral parts: a micro-adjustable dial, high-tensile lightweight laces, and low friction lace guides.', 'Westport, CT, United States', 3340);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANVS', 'STOCK', 'Annovis Bio, Inc.', 'NYQ', 'Healthcare', 'Biotechnology', 'Annovis Bio, Inc. is a late-stage clinical drug platform company addressing neurodegeneration such as Alzheimers disease (AD), and Parkinsons disease (PD). The Company is developing its lead product candidate, Buntanetap, which is designed to address AD, PD, and potentially other chronic neurodegenerative diseases. Buntanetap is a synthetically produced small molecule, orally administered, brain penetrant compound. Its product candidate ANVS405 is an intravenous drug being developed for acute indications and focused on protecting the brain after traumatic brain injury and/or stroke. ANVS405 is the same compound as Buntanetap, given in cases of acute head and brain trauma. ANVS301 is an orally administered drug being developed to increase cognitive capability in later stages of AD and dementia. ANVS301 is observed to improve memory and learning in very old rats by lowering the number of errors from over six to three.', 'Malvern, PA, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AHCO', 'STOCK', 'AdaptHealth Corp.', 'NCM', 'Healthcare', 'Medical Devices', 'AdaptHealth Corp. is a provider of patient-centered, healthcare-at-home solutions including home medical equipment (HME), medical supplies, and related services. The Company provides a full suite of medical products and solutions designed to help patients manage chronic conditions in the home. Its product and service offerings include sleep therapy equipment, supplies, and related services (including CPAP and bi PAP services) to individuals suffering from obstructive sleep apnea; medical devices and supplies to patients for the treatment of diabetes, including continuous glucose monitors and insulin pumps; HME to patients discharged from acute care and other facilities; oxygen and related chronic therapy services in the home, and other HME devices and supplies on behalf of chronically ill patients with wound care, urological, incontinence, ostomy and nutritional supply needs. It operates in 50 states through its network of over 670 locations in 47 states.', 'Plymouth Meeting, PA, United States', 10500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AACT', 'STOCK', 'Ares Acquisition Corporation II', 'NYQ', 'Financial Services', 'Shell Companies', 'Ares Acquisition Corporation II is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. The Company is not limited to a particular industry or geographic region for the purposes of consummating a business combination. The Company has neither engaged in any operations nor generated any revenue.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARCT', 'STOCK', 'Arcturus Therapeutics Holdings Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Arcturus Therapeutics Holdings Inc. is a commercial mRNA medicines and vaccines company focused on the development of infectious disease vaccines and opportunities within liver and respiratory rare diseases. The Company with enabling technologies, including LUNAR lipid-mediated delivery, STARR mRNA technology (sa-mRNA) and mRNA drug substances along with drug product manufacturing. It has developed KOSTAIVE, a self-amplifying messenger RNA (sa-mRNA) COVID vaccine. The Companys pipeline includes RNA therapeutic candidates to potentially treat ornithine transcarbamylase (OTC) deficiency and cystic fibrosis (CF), along with its partnered mRNA vaccine programs for SARS-CoV-2 (COVID-19) and influenza. The Company''s versatile RNA therapeutics platforms can be applied to multiple types of nucleic acid medicines, including messenger RNA, small interfering RNA, circular RNA, antisense RNA, self-amplifying RNA, DNA, and gene editing therapeutics.', 'San Diego, CA, United States', 174);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLDX', 'STOCK', 'Celldex Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Celldex Therapeutics, Inc. is a clinical-stage biotechnology company. The Company is focused on exploring the science of mast cell biology and the development of transformative therapeutics for patients. Its pipeline includes antibody-based therapeutics which have the ability to engage the human immune system and/or directly affect critical pathways to improve the lives of patients with severe inflammatory, allergic, autoimmune and other devastating diseases. Its drug candidates include monoclonal and bispecific antibodies designed to address mast cell mediated diseases. Its Barzolvolimab (CDX-0159) is a monoclonal antibody that specifically binds the KIT receptor and potently inhibits its activity, which is being studied across multiple mast cell driven diseases, including Chronic Urticarias, Prurigo Nodularis, Atopic Dermatitis and Eosinophilic Esophagitis. The Companys bispecific platform includes CDX- 622. The CDX- 622 is a bispecific candidate for inflammatory diseases.', 'Hampton, NJ, United States', 186);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CR', 'STOCK', 'Crane Company', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Crane Company is an industrial manufacturing and technology company. The Company is a manufacturer of engineered components for mission-critical applications focused on the aerospace, defense, space and process flow industry end markets. Its segments include Aerospace & Electronics, and Process Flow Technologies. The Aerospace & Electronics segment supplies critical components and systems, including original equipment and aftermarket parts, primarily for the commercial aerospace, and the military aerospace, defense and space markets. The Process Flow Technologies segment is a provider of engineered fluid handling equipment for critical applications. The segment is comprised of Process Valves and Related Products, Pumps and Systems and Commercial Valves. The Company also designs and manufacturers multi-stage lubrication pumps and lubrication system components technology for critical aerospace and defense applications.', 'Stamford, CT, United States', 7500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTCM', 'STOCK', 'BIT Mining Limited', 'NYQ', 'Technology', 'Information Technology Services', 'BIT Mining Ltd is a company principally engaged in cryptocurrency mining operation business. The Company mainly operates cryptocurrency mining machines for the sole purpose of mining cryptocurrencies (primarily bitcoin, and to a lesser extent ether).', 'Akron, OH, United States', 56);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EWZS', 'STOCK', 'iShares MSCI Brazil Small-Cap ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of the underlying index and in investments that have economic characteristics that are substantially identical to the component securities of the underlying index. The index is a free float-adjusted market capitalization-weighted index designed to measure primarily the performance of equity securities of small capitalization companies listed on stock exchanges in Brazil.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FHI', 'STOCK', 'Federated Hermes, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Federated Hermes, Inc. is an investment management company. The Company operates through a single segment, being the investment management business. It sponsors, markets, and provides investment-related services to various investment products, including sponsored investment companies and other funds (Federated Hermes Funds); and Separate Accounts, which include separately managed accounts (SMAs), institutional accounts, sub-advised funds and other managed products in both domestic and international markets. In addition, it markets and provides stewardship and real estate development services to various domestic and international companies. The Company provides investment advisory services to approximately 176 Federated Hermes Funds. It markets these funds to institutional customers and banks, broker/dealers and other financial intermediaries who use them to meet the needs of customers and/or clients, including, among others, retail investors, corporations, and retirement plans.', 'Pittsburgh, PA, United States', 2072);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRI', 'STOCK', 'Darden Restaurants, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'A Darden Restaurants, Inc. É uma empresa de restaurantes. A empresa possui e opera restaurantes de serviço completo nos Estados Unidos e Canadá sob os nomes comerciais Olive Garden, Longhorn Steakhouse, Yard House, Ruth''s Chris Steak House, Cheddar''s Scratch Kitchen, The Capital Grille, Chuy''s, Seasons 52, Eddie V''s e Bahama Breeze. Possui e opera aproximadamente 2 140 restaurantes nos Estados Unidos e no Canadá. Seus segmentos incluem Olive Garden, Longhorn Steakhouse, Fine Dining e outros negócios. O Olive Garden é um operador de restaurantes italianos de serviço completo nos Estados Unidos. O Longhorn Steakhouse é um restaurante especializado em carne bovina com serviço completo, que oferece uma variedade de itens de menu, incluindo carnes exclusivas e frango, bem como salmão, camarão e hambúrgueres. O Fine Dining inclui Chris de Ruth, o Capital Grille e Eddie V. Outros negócios incluem Cheddar''s Scratch Kitchen, Yard House, Bahama Breeze, Seasons 52 e The Capital Burger.', 'Orlando, FL, United States', 197924);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGI', 'STOCK', 'Angi Inc.', 'NMS', 'Communication Services', 'Internet Content & Information', 'Angi Inc. connects home service professionals with consumers across approximately 500 different categories, from repairing and remodeling homes to cleaning and landscaping. The Companys segments include Ads and Leads, Services, Roofing, and International (includes Europe and Canada), and operates under multiple brands including Angi, HomeAdvisor, and Handy. Ads and Leads segment provides service professionals the capability to engage with potential customers, including quoting and invoicing services, and provides consumers with tools and resources to help them find local, pre-screened and customer-rated service professionals nationwide for home repair. Services segment provides a pre-priced offering service, pursuant to which consumers can request services through Angi and Handy branded platforms. Roofing segment provides roof replacement and repair services, primarily in Florida. International segment operates international businesses, such as Travaux, MyHammer and Werkspot.', 'Denver, CO, United States', 2800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMAC', 'STOCK', 'DiaMedica Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'DiaMedica Therapeutics Inc. is a clinical-stage biopharmaceutical company focused on improving the lives of people suffering from preeclampsia (PE) and acute ischemic stroke (AIS). The Companys lead candidate, DM199, is the first pharmaceutically active recombinant (synthetic) form of the KLK1 protein, an established therapeutic modality in Asia for the treatment of pre-eclampsia, acute ischemic stroke and other vascular diseases. DM199 (rinvecalinase alfa) is a recombinant form of human tissue kallikrein-1 (rhKLK1) in clinical development for preeclampsia and acute ischemic stroke. KLK1 is a serine protease enzyme that is involved in the regulation of diverse physiological processes via a molecular mechanism that increases the production of nitric oxide, prostacyclin and endothelium-derived hyperpolarizing factors. In the treatment of preeclampsia, DM199 is intended to lower blood pressure, enhance endothelial health and improve perfusion to maternal organs and the placenta.', 'Minneapolis, MN, United States', 27);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARHS', 'STOCK', 'Arhaus, Inc.', 'NMS', 'Consumer Cyclical', 'Specialty Retail', 'Arhaus, Inc. is a lifestyle brand and omni-channel retailer of premium home furnishings. The Company through its proprietary model, designs and sources products from manufacturers and artisans around the world. It has approximately 100 showrooms and design center locations across the United States. It offers merchandise in various categories, including furniture, outdoor, lighting, textiles, and decor. Its furniture product offerings consist of bedroom, dining room, living room and home office furnishings and include sofas, dining tables, and chairs, among others. Its outdoor product offerings include outdoor dining tables, chairs, chaises and other furniture, lighting, and others. Its lighting product offerings consist of a variety of distinct and artistic lighting fixtures. Its textile product offerings include handcrafted indoor and outdoor rugs, bed linens, and pillows and throws. Decor ranges from wall art to mirrors, vases to candles, and many other decorative accessories.', 'Boston Heights, OH, United States', 2390);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOOT', 'STOCK', 'Boot Barn Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Boot Barn Holdings, Inc. is a lifestyle retailer of western and work-related footwear, apparel, and accessories in the United States. The Company operates through two segments: retail stores and e-commerce. The retail segment is a specialty retail store that sells western and work boots and related apparel and accessories. Its e-commerce segment sells its merchandise via the Internet. The Company carries an assortment of denim, western shirts, cowboy hats, belts and belt buckles, western-style jewelry, and accessories. The western assortment includes various brands, such as Ariat, Cinch, Cody James, Corral, Dan Post, Durango, El Dorado, Idyllwind, Justin, Laredo, Lucchese, Miss Me, Montana Silversmiths, Moonshine Spirit, Shyanne, Stetson, Tony Lama, Twisted X, Resistol and Wrangler. The work assortment includes rugged footwear, outerwear, overalls, denim, and shirts. Its other brand includes Dickies, Carhartt, Wolverine, and Hawx. It operates approximately 403 stores in 45 states.', 'Irvine, CA, United States', 3300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNR', 'STOCK', 'Core Natural Resources, Inc.', 'NYQ', 'Energy', 'Thermal Coal', 'Core Natural Resources, Inc., formerly CONSOL Energy Inc., is a producer and exporter of coals, including metallurgical and high calorific value thermal coals. The Company operates a portfolio, including the Pennsylvania Mining Complex, Leer, Leer South, and West Elk mines. It owns and oversees 11 major coal mining operations across the country, including the longwall coal mining complexes in North America. Its mining operations also include the metallurgical coal portfolios in the United States. It has ownership interests in two marine export terminals. Its product portfolio encompasses Low-Vol, High-Vol A, High Vol-B, Crossover, High Calorific Value Thermal, and PRB coals. Through ownership of two strategic export terminals on the United States Eastern Seaboard, it is an exporter of coal products serving multiple emerging seaborne markets. It mines and markets a broad assortment of carbon-based products for industrial metallurgical applications, primarily steel production.', 'Canonsburg, PA, United States', 2076);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGX', 'STOCK', 'Quest Diagnostics Incorporated', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'O Quest Diagnostics Incorporated é um fornecedor de serviços de informação de diagnóstico. A empresa fornece informações diagnósticas dos resultados de seus testes laboratoriais para permitir que pessoas, médicos e organizações tomem medidas para melhorar os resultados de saúde. Atua através do segmento DIS, que fornece serviços de informação diagnóstica a uma variedade de clientes dentro de seus principais canais de clientes: Médicos, hospitais, pacientes e consumidores. Oferece amplo acesso a testes clínicos através de uma rede nacional de laboratórios, centros de atendimento ao paciente, flebotomistas em consultórios médicos e recursos de conetividade, incluindo call centers e flebotomistas móveis, enfermeiros e outros profissionais de saúde e bem-estar. Também se concentra em soluções de inteligência artificial (IA) e patologia digital. Os serviços da Empresa são principalmente fornecidos sob a marca Quest Diagnostics e sob outras marcas, incluindo AmeriPath, Dermpath Diagnostics, ', 'Secaucus, NJ, United States', 55000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AL', 'STOCK', 'Air Lease Corporation', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'Air Lease Corporation is a global aircraft leasing company. The Company is principally engaged in purchasing new commercial aircraft and leasing them to its airline customers worldwide through customized aircraft leasing and financing solutions. It purchases commercial aircraft directly from aircraft manufacturers, such as Airbus S.A.S. (Airbus) and The Boeing Company (Boeing). In addition to its leasing activities, it sells aircraft from its fleet to third parties, including other leasing companies, financial service companies, airlines and other investors. It also provides fleet management services to investors and owners of aircraft portfolios for a management fee. It has relationships with over 200 airlines across 70 countries. The Company operates its business on a global basis, providing aircraft to airline customers in every major geographical region, including markets, such as Asia Pacific, Europe, the Middle East and Africa, Central America, South America, and others.', 'Los Angeles, CA, United States', 165);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALEC', 'STOCK', 'Alector, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Alector, Inc. is a clinical-stage biotechnology company. The Company is focused on developing therapies to counteract the devastating progression of neurodegenerative diseases. It also develops alector brain carrier (ABC), a proprietary blood-brain barrier platform, which is applied to its next-generation product candidates and research pipeline. Its research and drug discovery platform leverages human genetic datasets, advanced tools in bioinformatics and imaging, and insights in neurodegeneration. Its clinical development portfolio includes latozinemab (AL001) and AL101/GSK4527226, while its preclinical and research pipeline candidates include ADP037-ABC, ADP050-ABC, ADP056, and ADP063-ABC/ADP064-ABC. Its first product candidate, latozinemab, is a human recombinant monoclonal antibody that increases the levels of progranulin (PGRN) in the brains of FTD-GRN patients. The AL101/GSK4527226, is a human recombinant monoclonal antibody designed to elevate PGRN levels in the brain.', 'South San Francisco, CA, United States', 163);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FAF', 'STOCK', 'First American Financial Corporation', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'First American Financial Corporation, through its subsidiaries, is engaged in the business of providing title insurance, settlement services and other financial services and risk solutions. Its segments include Title Insurance and Services, Home Warranty, and Corporate segment. The Title Insurance and Services segment issues title insurance policies on residential and commercial property in the United States and offers similar or related products and services internationally. This segment also provides closing and/or escrow services, accommodates tax-deferred exchanges of real estate, and maintains, manages and provides access to title plant data and records. The Home Warranty segment provides residential service contracts that cover residential systems, such as heating and air conditioning systems, and certain appliances against failures that occur as the result of normal usage during the coverage period. The Corporate segment includes investments in venture-stage companies.', 'Santa Ana, CA, United States', 19038);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWEN', 'STOCK', 'Clearway Energy, Inc.', 'NYQ', 'Utilities', 'Utilities - Renewable', 'Clearway Energy, Inc. is a renewable energy company. It invests in energy infrastructure and focuses on investments in clean energy and owns sustainable and long-term contracted assets across North America. Its portfolio comprises approximately 11.8 gigawatts (GW) of gross capacity in 26 states, including approximately 9.1 GW of wind, solar and battery energy storage systems and approximately 2.8 GW of conventional dispatchable power capacity that provide critical grid reliability services. Its operating facilities include Carlsbad, El Segundo, GenConn Devon, GenConn Middletown, Marsh Landing and Walnut Creek. Its utility-scale solar projects include Agua Caliente, Alpine, Avenal, Avra Valley, Blythe, Borrego, Buckthorn Solar, CVSR, Daggett 2, Daggett 3, Desert Sunlight 250, Kansas South, and others. Its wind projects include Black Rock, Buffalo Bear, Cedro Hill, Crofton Bluffs, Cedar Creek, and others. It also operates the 137 MW Tuolumne Wind Project in Klickitat County, Washington.', 'Princeton, NJ, United States', 60);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGY', 'STOCK', 'VAALCO Energy, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'VAALCO Energy, Inc. is an independent energy company with a diverse portfolio of production, development and exploration assets across Gabon, Egypt, Cote dIvoire, Equatorial Guinea, Nigeria and Canada. It is engaged in the acquisition, exploration, development and production of crude oil, natural gas and natural gas liquids. It owns a working interest in, and is the operator of, the Etame PSC related to the Etame Marin block located offshore Gabon in West Africa. The Etame Marin block covers an area of about 46,200 gross acres. The Company owns an interest in an undeveloped block offshore Equatorial Guinea, West Africa. In Egypt, its interests are spread across two regions: the Eastern Desert and the Western Desert. In Harmattan, Canada, it owns production and working interests in Cardium light oil and Mannville liquids-rich gas assets. It also owns a working interest in the Block CI-40 and CI-705 block offshore Cote dIvoire in West Africa.', 'Houston, TX, United States', 230);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHTH', 'STOCK', 'eHealth, Inc.', 'NMS', 'Financial Services', 'Insurance Brokers', 'eHealth, Inc. is an independent licensed insurance agency and advisor. It is a private health insurance marketplace with a technology and service platform that provides consumer engagement, education and health insurance enrollment solutions. Its segments include Medicare and Employer and Individual (E&I). The Medicare segment markets Medicare-related health insurance plans and, to a lesser extent, ancillary products such as dental and vision insurance and hospital indemnity plans, to its Medicare-eligible consumers. Its Medicare ecommerce platform can be accessed through its Websites www.eHealthMedicare.com and www.GoMedigap.com, along with its telephonic enrollment capabilities. The E&I segment markets individual and family health insurance plans, along with employer plans, which include small business health insurance plans and individual coverage health reimbursement arrangements. It also markets a variety of ancillary products, including short-term, dental and vision plans.', 'Austin, TX, United States', 1773);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DC', 'STOCK', 'Dakota Gold Corp.', 'ASE', 'Basic Materials', 'Gold', 'Dakota Gold Corp. is a gold exploration and development company with a focus on revitalizing the Homestake District in Lead, South Dakota. The Company focuses on advancing the Richmond Hill Oxide Heap Leach Gold Project and outlining a high-grade underground gold resource at the Maitland Gold Project located on private land in South Dakota. The Richmond Hill Oxide Heap Leach Gold Project is located in the western portion of Lawrence County, South Dakota, United States of America. The Maitland Property covers the Homestake iron formation extending from the Blind Gold Property target at the north end to Homestake Mining Company''s North Drift gold discovery. Its other gold projects include City Creek Gold Project, Blind Gold Project, Tinton Gold Project, Cambrian Unconformity Project, West Corridor Gold Project, Ragged Top Gold Project, and South Lead / Whistler Gulch Gold Project. The City Creek project consists of a group of 333 unpatented lode-mining claims (6,161 acres).', 'Lead, SD, United States', 41);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VBTX', 'STOCK', 'Veritex Holdings, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'Veritex Holdings, Inc. is a bank holding company. The Company conducts banking activities through its wholly owned subsidiary, Veritex Community Bank (the Bank), with locations throughout the Dallas-Fort Worth metroplex and in the Houston metropolitan area. The Bank provides a full range of banking services, including commercial and retail lending and checking and savings deposit products, to individual and corporate customers. It operates through the community banking segment. The Bank provides relationship-driven commercial banking products and services tailored to meet the needs of small to medium-sized businesses and professionals. The Bank offers a full suite of online banking solutions, including access to account balances, online transfers, online bill payment and electronic delivery of customer statements, as well as ATMs, and mobile and digital banking, mail and personal appointments. The Bank also offers a full array of commercial treasury management services.', 'Dallas, TX, United States', 858);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRF', 'STOCK', 'Cornerstone Total Return Fund, Inc.', 'ASE', 'Financial Services', 'Asset Management', 'Cornerstone Total Return Fund, Inc. is a closed-ended equity mutual fund launched and managed by Cornerstone Advisors, LLC. It invests in the public equity markets of the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in value and growth stocks of companies across all market capitalizations. The fund also invests through other closed-end investment companies and ETFs. It benchmarks the performance of its portfolio against the S&P 500 Index. Cornerstone Total Return Fund, Inc. was formed on March 16, 1973 and is domiciled in the United States.', 'Asheville, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FTGC', 'STOCK', 'First Trust Global Tactical Commodity Strategy Fund', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund ("ETF") that seeks to achieve attractive risk adjusted returns by investing in commodity futures contracts, exchange-traded commodity linked instruments, and commodity linked total return swaps (collectively, "Commodities Instruments") through a wholly-owned subsidiary of the fund organized under the laws of the Cayman Islands (the "Subsidiary"). The advisor expects to gain exposure to these investments exclusively by investing in the Subsidiary.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TARS', 'STOCK', 'Tarsus Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Tarsus Pharmaceuticals, Inc. is a commercial-stage biopharmaceutical company. The Company is focused on the development and commercialization of therapeutics, starting with eye care. The Companys lead product candidate, XDEMVY, is a lotilaner ophthalmic solution that targets and eradicates the root cause of Demodex blepharitis, Demodex mite infestation. The active pharmaceutical ingredient (API) of XDEMVY, lotilaner, paralyzes and eradicates mites and other parasites through the inhibition of parasite-specific gamma-aminobutyric acid-gated chloride channels. The Company is investigating the development of its product candidates to address targeted diseases with high unmet medical needs, which include TP-04, a novel ophthalmic gel formulation of lotilaner for the potential treatment of Ocular Rosacea, and TP-05, a novel investigational oral formulation of lotilaner, for potential Lyme disease prophylaxis and community malaria reduction.', 'Irvine, CA, United States', 323);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('UPLD', 'STOCK', 'Upland Software, Inc.', 'NGM', 'Technology', 'Software - Application', 'Upland Software, Inc. provides artificial intelligence (AI)-powered knowledge and content management software. The Company provides cloud-based software applications. Its solutions cover knowledge management, content lifecycle and workflow automation, and digital marketing. It provides knowledge management solutions designed to help organizations capture, organize, and distribute information to employees and customers. It also offers content lifecycle and workflow automation solutions that support document management, compliance, and process efficiency across various industries. Digital marketing solutions provide tools for audience engagement, campaign management, and content distribution across digital channels. The Companys customers operate in a range of industries, including financial services, consulting services, technology, manufacturing, media, telecommunications, government, insurance, non-profit, healthcare, life sciences, legal, retail and hospitality.', 'Austin, TX, United States', 998);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNDT', 'STOCK', 'Conduent Incorporated', 'NMS', 'Technology', 'Information Technology Services', 'Conduent Incorporated is a global technology-led business process solutions and services company. The Companys Commercial segment provides business process services that span its clients business processes end-to-end from the front-office to the back-office for a variety of commercial industries. Its technology-led solutions and services include Customer Experience Management (CXM), Business Operations Solutions (BOS), Healthcare Claims and Administration Solutions and Human Capital Solutions (HCS). Its Government segment provides government-centric services and solutions to U.S. federal, state, local and foreign governments for public assistance, healthcare programs and administration, transaction processing, payment services and case management. Its Transportation segment provides systems, support and revenue-generating solutions to government transportation agency clients. It delivers mission-critical tolling, transit and digital payment solutions that streamline operations.', 'Florham Park, NJ, United States', 53000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COCO', 'STOCK', 'The Vita Coco Company, Inc.', 'NMS', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'The Vita Coco Company, Inc. offers a platform for brands in the functional beverage category. The Companys brands include coconut water, Vita Coco; sustainably packaged water, Ever & Ever; and protein-infused water, PWR LIFT. Its branded portfolio is led by its Vita Coco brand, which is engaged in the coconut water category in the United States, and also includes coconut oil, juice, and milk offerings. It supplies private label products to retailers in both the coconut water and coconut oil categories. Additionally, the Company is also engaged in bulk product sales to beverage and food companies. Its Americas segment comprised of its operations primarily in the United States and Canada and the International segment comprised of operations primarily in Europe, the Middle East and the Asia Pacific regions. The Companys products are distributed primarily through club, food, drug, mass, convenience, e-commerce, and foodservice channels.', 'New York, NY, United States', 319);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASH', 'STOCK', 'Ashland Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Ashland Inc. is a global additives and specialty ingredients company. The Company serves customers in a wide range of consumer and industrial markets, including architectural coatings, construction, energy, food and beverage, personal care and pharmaceuticals. The Companys segments include Life Sciences, Personal Care, Specialty Additives, and Intermediates. The Life Sciences segment consists of pharmaceuticals, nutrition, agricultural chemicals, diagnostic films and fine chemicals. The Personal Care segment includes bio functionals, microbial protectants (preservatives), skin care, sun care, oral care, hair care and household solutions. The Specialty Additives segment consists of rheology and performance-enhancing additives serving the architectural coatings, construction, energy, automotive and various industrial markets. The Intermediates segment consists of the production of 1,4 butanediol (BDO) and related derivatives, including n-methyl pyrrolidone.', 'Wilmington, DE, United States', 2960);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APGE', 'STOCK', 'Apogee Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Apogee Therapeutics, Inc. is a clinical-stage biotechnology company. The Company is advancing novel biologics with the potential for differentiated efficacy and dosing in the inflammatory and immunology (I&I) markets, including for the treatment of atopic dermatitis (AD), asthma, eosinophilic esophagitis (EoE), chronic obstructive pulmonary disease (COPD), and other I&I indications. APG777, the Companys most advanced program, is being initially developed for the treatment of AD. With four validated targets in its portfolio, it is seeking to achieve efficacy and dosing through monotherapies and combinations of its novel antibodies. Its most advanced programs are APG777, APG990, APG333, and APG808. APG990 is an SQ extended half-life mAb that utilizes advanced antibody engineering to target OX40L. APG333 is a fully human mAb against thymic stromal lymphopoietin (TSLP). APG808 is an SQ extended half-life mAb targeting IL-4R?. APG279 is for the dual inhibition of OX40L and IL-13.', 'Waltham, MA, United States', 196);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMPO', 'STOCK', 'CompoSecure, Inc.', 'NGM', 'Industrials', 'Metal Fabrication', 'CompoSecure, Inc. is a technology partner to fintechs and consumers around the globe. The Company offers metal payment cards, security, and authentication solutions. Its segments include Payment Card and Arculus. Payment Card is engaged in the production and sale of metal payment cards. Arculus is engaged in the production and sale of metal payment or nonpayment cards containing Arculus technology for authentication and/or digital asset cold storage and related services. Its metal payment cards are issued on the Visa, Mastercard, American Express, and China Union Pay payment networks. Its Arculus business solutions include Payments + Arculus Authenticate, white-labeled cold storage, Payments + Arculus Cold Storage, and Payments + Arculus Authenticate + Arculus Cold Storage. It provides white-labeled cold storage wallets in the form of premium metal cards, to give consumers the ability to make transactions and store the private keys to their digital assets in the same metal cards.', 'Somerset, NJ, United States', 1000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARS', 'STOCK', 'Cars.com Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Cars.com Inc., doing business as Cars Commerce Inc., is an audience-driven technology company. It is engaged in car buying and selling with products, solutions and machine-learning model-driven artificial intelligence technologies that span pretail, retail and post-sale activities. Cars Commerce platform is organized over four brands: the flagship automotive marketplace and dealer reputation site Cars.com, digital retail technology and marketing services from Dealer Inspire and D2C Media, essential trade-in and appraisal technology from AccuTrade, and media solutions from the Cars Commerce Media Network. It enables shoppers with the data, resources and digital tools needed to make informed buying decisions and connect with automotive retailers. Cars.com enables dealerships and original equipment manufacturers with solutions and data-driven intelligence. Its products and solutions have attracted over 19,200 franchise and independent dealer customers across the United States and Canada.', 'Chicago, IL, United States', 1800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCK', 'STOCK', 'Crown Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'Crown Holdings, Inc. designs, manufactures and sells packaging products for consumer goods and industrial products. The Company''s segments include Americas Beverage, European Beverage, Asia Pacific, Transit Packaging and Other. The Americas Beverage segment manufactures infinitely recyclable aluminum beverage cans and ends, glass bottles, steel crowns and aluminum caps. The European Beverage segment manufactures infinitely recyclable aluminum beverage cans and ends in Europe, the Middle East and North Africa. The Asia Pacific segment consists of beverage can and non-beverage can operations, primarily food cans and specialty packaging. The Transit Packaging segment includes its worldwide automation and equipment technologies, protective packaging solutions and steel and plastic consumables. The Company''s Other segments include its food can, aerosol can and closures businesses in North America, and beverage tooling and equipment operations in the United States and the United Kingdom.', 'Tampa, FL, United States', 23000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFFN', 'STOCK', 'Capitol Federal Financial, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Capitol Federal Financial, Inc. is a unitary savings and loan holding company. The Company provides a full range of retail banking services through its subsidiary, Capitol Federal Savings Bank (the Bank), a federal savings bank, which has 44 traditional and four in-store banking offices serving primarily the metropolitan areas of Topeka, Wichita, Lawrence, Manhattan, Emporia and Salina, Kansas and portions of the Kansas City metropolitan area. The Bank attracts deposits primarily from the general public and from businesses and invests those funds primarily in permanent loans secured by first mortgages on owner-occupied, one-to four-family residences and in commercial loans. It offers an array of retail and business deposit products and services. These products include checking, savings, money market, certificates of deposit, and retirement accounts. The Banks deposit services are provided through its network of traditional branches and retail in-store locations, its call center.', 'Topeka, KS, United States', 583);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NUV', 'STOCK', 'Nuveen Municipal Value Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Nuveen Municipal Value Fund, Inc. is a closed-ended fixed income mutual fund launched by Nuveen Investments, Inc. The fund is co-managed by Nuveen Fund Advisors LLC and Nuveen Asset Management, LLC. It invests in the fixed income markets of the United States. The fund also invests some portion of its portfolio in derivative instruments. It invests in undervalued municipal securities and other related investments the income, exempt from regular federal income taxes that are rated Baa or BBB or better. It employs fundamental analysis with bottom-up stock picking approach to create its portfolio. The fund benchmarks the performance of its portfolio against the Standard & Poor''s (S&P) National Municipal Bond Index. Nuveen Municipal Value Fund, Inc. was formed on April 8, 1987 and is domiciled in the United States.', 'Chicago, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNXC', 'STOCK', 'Concentrix Corporation', 'NMS', 'Technology', 'Information Technology Services', 'Concentrix Corporation is a global technology and services company. The Company provides end-to-end capabilities, including customer experience (CX) process optimization, technology innovation, front- and back-office automation, analytics and business transformation. Its customer lifecycle management solutions include services such as customer care, sales support and digital marketing. It also provides complementary services, including CX/user experience (UX) strategy and design, digital transformation, and voice of the customer (VOC) and analytics. Its CX/UX strategy and design solutions, including CX strategy, data-driven user design, journey mapping, and multi-platform engineering. Its digital transformation solutions include services such as robotic process automation and cognitive automation and mobile app development. ConcentrixCX, its VOC solutions platform, helps turn customer feedback into actionable insights. It operates under the trade name Concentrix + Webhelp.', 'Newark, CA, United States', 450000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIRR', 'STOCK', 'First Trust RBA American Industrial RenaissanceTM ETF', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the equity securities that comprise the index. The index is designed to measure the performance of small and mid cap U.S. companies in the industrial and community banking sectors.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BVN', 'STOCK', 'Compañía de Minas Buenaventura S.A.A.', 'NYQ', 'Basic Materials', 'Other Precious Metals & Mining', 'Compania de Minas Buenaventura SAA is a Peru-based company primarily engaged in the mining industry. The Company and its subsidiaries focus on the exploration, extraction, concentration, smelting, and commercialization of polymetallic minerals and metals. Their key product is monohydrate manganese sulphate, which is a mineral compound. The Company''s segments include: Production and sale of minerals; Construction, development and exploration of projects; Generation and transmission of energy; Insurance brokerage; Leasing of mining concessions; Investments in shares; and Industrial activities. The Company operates the Orcopampa, Uchucchacua, Julcani, and Tambomayo mines. Additionally, the Company owns interests in various mines and operates hydroelectric power plants.', 'Lima, , Peru', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DXYZ', 'STOCK', 'Destiny Tech100 Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Destiny Tech100 Inc. (the Fund) is a non-diversified, closed-end management investment company. The Funds investment objective is to maximize the portfolios total return, principally by seeking capital gains on equity and equity-related investments. Under normal market conditions, the Fund will invest at least 80% of its total assets in equity and equity-linked securities of companies principally engaged in the technology sector. The Fund will invest in the equity and equity-linked securities of what it believes to be rapidly growing venture-capital-backed emerging companies, located in the United States. The Fund may also invest on an opportunistic basis in select United States publicly traded equity securities or certain non-United States companies that otherwise meet its investment criteria. It concentrates its investments in companies operating in one or more industries within the technology group of industries. Destiny Advisors LLC serves as the investment adviser to the Fund.', 'Austin, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APD', 'STOCK', 'Air Products and Chemicals, Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A Air Products and Chemicals, Inc. É uma empresa de gases industriais. A empresa está focada em atender mercados de energia, meio ambiente e emergentes. Seu negócio de base fornece gases industriais essenciais, equipamentos relacionados e experiência em aplicações para clientes em dezenas de indústrias, incluindo refino, produtos químicos, metais, eletrônicos, fabricação, e alimentos. A empresa também desenvolve, projeta, constrói, possui e opera projetos de hidrogênio limpo que apoiam a transição para energia de baixo e zero carbono nos setores de transporte pesado e industrial. Além disso, a empresa fornece turbomáquinas, sistemas de membrana e recipientes criogênicos globalmente. A Companhia tem operações em aproximadamente 50 países. Suas indústrias incluem aeroespacial, laboratórios analíticos e pesquisa/ciência, automotivo, bebidas, bioenergia, biotecnologia, cimento e cal, produtos químicos, eletrônicos, alimentos, vidro e frit, energia de hidrogênio, processamento médico, metai', 'Allentown, PA, United States', 21850);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIXD', 'STOCK', 'First Trust Smith Opportunistic Fixed Income ETF', 'NGM', NULL, NULL, 'The fund pursues its objective by investing at least 80% of its net assets (including investment borrowings) in fixed income securities. It may invest up to 35% of its net assets in corporate, non-U.S. and non-agency debt and other securities rated below investment grade by one or more nationally recognized statistical rating organization ("NRSRO"), or, if unrated, judged to be of comparable quality by the Sub-Advisor.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACRV', 'STOCK', 'Acrivon Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Acrivon Therapeutics, Inc. is a clinical-stage biopharmaceutical company developing precision oncology medicines. It uses its precision Generative Phosphoproteomics platform, Acrivon Predictive Precision Proteomics (AP3), to develop its pipeline of oncology drug candidates. Its lead candidate, ACR-368, is a selective small molecule inhibitor which targets CHK1 and CHK2 at sub single-digit nM and single-digit nM potency in intact cells, respectively, in a registrational Phase II trial across multiple solid tumor types. Using its AP3 platform, it has developed a predictive OncoSignature test for ACR-368, called ACR-368 OncoSignature, that can predict patient response to ACR-368 monotherapy and therefore improve the clinical overall response rate (ORR) and has the potential to enable drug development. Its preclinical program, ACR-2316, is advancing in investigational new drug-enabling studies. It is a novel, dual WEE1 and PKMYT1 inhibitor small molecule development candidate.', 'Watertown, MA, United States', 75);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OLED', 'STOCK', 'Universal Display Corporation', 'NMS', 'Technology', 'Electronic Components', 'A Universal Display Corporation está envolvida na pesquisa, desenvolvimento e comercialização de tecnologias e materiais orgânicos de diodos emissores de luz (OLED) para uso em aplicações de iluminação de display e de estado sólido. Os displays OLED podem ser usados no telefone celular, televisão, monitor, wearable, tablet, notebook e computador pessoal, realidade aumentada (AR), realidade virtual (VR) e mercados automotivos. Possui um portfólio de propriedade intelectual em torno de suas tecnologias e materiais PHOLED existentes para telas e produtos de iluminação, que a empresa comercializa sob a marca UniversalPHOLED. Ele licencia suas tecnologias proprietárias, incluindo a tecnologia OLED fosforescente UniversalPHOLED que pode permitir o desenvolvimento de displays energeticamente eficientes e ecológicos e iluminação de estado sólido. A empresa também desenvolve e oferece materiais UniversalPHOLED. As suas tecnologias OLED adicionais incluem FOLED Flexible OLEDs e OVJP Organic Vapo', 'Ewing, NJ, United States', 468);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCTH', 'STOCK', 'Delcath Systems, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Delcath Systems, Inc. is an interventional oncology company focused on the treatment of primary and metastatic liver cancers. The Company''s proprietary products, HEPZATO KIT (HEPZATO (melphalan) for Injection/Hepatic Delivery System) and CHEMOSAT Hepatic Delivery System for Melphalan percutaneous hepatic perfusion (PHP), are designed to administer high-dose chemotherapy to the liver while controlling systemic exposure and associated side effects during a PHP procedure. HEPZATOTM KIT is a drug/device combination product. HEPZATO KIT is comprised of the chemotherapeutic drug melphalan and the Companys proprietary Hepatic Delivery System (HDS). In Europe, the device-only configuration of the HDS is regulated as a Class III medical device and is approved for sale under the trade name CHEMOSAT Hepatic Delivery System for Melphalan. In the United States, HEPZATO is regulated as a drug by the United States Food and Drug Administration (FDA).', 'New York, NY, United States', 96);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAY', 'STOCK', 'Dayforce Inc', 'NYQ', 'Technology', 'Software - Application', 'Dayforce, Inc. is a global human capital management (HCM) software company. The Companys Dayforce, which is a flagship cloud HCM platform, provides a full suite of HCM functionality, including global human resources (HR), payroll and tax, workforce management, benefits, and talent intelligence functionality. The Company also sells Powerpay, a cloud HR and payroll solution for the Canadian small business market, through both direct sales and established partner channels. Dayforce Human Resources provides HR professionals, managers, and employees a single, complete record of all of their HR information. Dayforce Workforce Management helps organizations manage their workforces by configuring the system to meet complex employment and working time rules and policies. Dayforce Wallet is a digital payment solution that gives employees instant access to their net earnings. The Company also offer payroll and payroll-related services using legacy technology and on-premises technology.', 'Minneapolis, MN, United States', 9600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYTK', 'STOCK', 'Cytokinetics, Incorporated', 'NMS', 'Healthcare', 'Biotechnology', 'Cytokinetics, Incorporated is a late-stage, specialty cardiovascular biopharmaceutical company focused on discovering, developing and commercializing muscle biology-directed drug candidates as potential treatments for debilitating diseases in which cardiac muscle performance is compromised. The Company is engaged in the commercialization of aficamten, a cardiac myosin inhibitor, and is being evaluated in additional clinical trials enrolling patients with obstructive and non-obstructive hypertrophic cardiomyopathy. The Company is also developing omecamtiv mecarbil, a cardiac myosin activator, in patients with heart failure with severely reduced ejection fraction (HFrEF); CK-586, a cardiac myosin inhibitor for the potential treatment of heart failure with preserved ejection fraction (HFpEF) and CK-089, a fast skeletal muscle troponin activator with potential therapeutic application to a specific type of muscular dystrophy and other conditions of impaired skeletal muscle function.', 'South San Francisco, CA, United States', 498);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBNX', 'STOCK', 'Beta Bionics, Inc.', 'NGM', 'Healthcare', 'Medical Devices', 'Beta Bionics, Inc. is a commercial-stage medical device company engaged in the design, development and commercialization of various solutions to improve the health of insulin-requiring people with diabetes (PWD). The Company''s product, the iLet Bionic Pancreas (iLet), is an insulin delivery device cleared by the United States Food and Drug Administration (FDA) to utilize adaptive closed-loop algorithms to autonomously determine every insulin dose without requiring a user to count carbohydrate intake. iLet is used for the treatment of Type 1 diabetes (T1D). The Company''s solutions include iLet for Adults, iLet for Children, Bionic Circle App and iLet Simulator. The Company is in the early stages of developing an insulin pump that is designed to adhere directly to the skin and administer insulin without the need for tubing, commonly known in the diabetes industry as a patch pump. It is also in the early stages of developing a bihormonal configuration of the iLet.', 'Irvine, CA, United States', 387);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCP', 'STOCK', 'Invesco BulletShares 2025 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2025 (collectively, "2025 Bonds").', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRVN', 'STOCK', 'Driven Brands Holdings Inc.', 'NMS', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Driven Brands Holdings Inc. is an automotive services company in North America, providing a range of consumer and commercial automotive services, including paint, collision, glass, vehicle repair, oil change, maintenance and car wash. The Company''s segments include Take 5, Franchise Brands and Car Wash. The Take 5 segment is primarily composed of the Company and franchise-operated Take 5 Oil Change business. The Franchise Brands segment is primarily composed of its portfolio of franchise brands, which include CARSTAR, Meineke, Maaco and 1-800 Radiator, along with other smaller brands and services for both retail and commercial customers such as commercial fleet operators and insurance carriers. The Car Wash segment operates under the IMO brand across Europe and Australia, providing express-style conveyor car wash services to both retail and commercial customers. Its AutoGlassNow businesses provide glass replacement and calibration services to commercial, retail and insurance customers', 'Charlotte, NC, United States', 10700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FCFS', 'STOCK', 'FirstCash Holdings, Inc.', 'NMS', 'Financial Services', 'Credit Services', 'FirstCash Holdings, Inc. is an operator of pawn stores in the United States and Latin America. The Company is a provider of technology-driven, retail point-of-sale (POS) payment solutions focused on serving cash and credit-constrained consumers in the U.S. and Puerto Rico. It operates two business lines: pawn operations and retail POS payment solutions, which are organized into three reportable segments. The U.S. pawn segment consists of pawn operations in 29 U.S. states and the District of Columbia, while the Latin America pawn segment consists of pawn operations in Mexico, Guatemala, Colombia and El Salvador. The retail POS payment solutions segment consists of the operations of American First Finance, LLC (AFF) in all 50 states in the U.S., the District of Columbia and Puerto Rico. Its pawn stores buy and sell a variety of jewelry, electronics, appliances, sporting goods, musical instruments and other merchandise, and help customers in providing small non-recourse pawn loans.', 'Fort Worth, TX, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPWK', 'STOCK', 'EPWK Holdings Ltd.', 'NGM', 'Technology', 'Software - Application', 'EPWK Holdings Ltd is a holding company that is primarily engaged in providing services to businesses. The Company has created a cloud procurement platform that connects businesses with outstanding talent. The Company''s platform users include buyers seeking working talent and sellers offering different talents and skills. The Company operates three segments: the Online Promotion, the Shared Office Rental and the Value-added Service. The Company provides a variety of services to businesses of all sizes, including creative design, visual design, e-commerce design, development services, industrial design, marketing copywriting, and others.', 'Xiamen, , China', 184);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OIS', 'STOCK', 'Oil States International, Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Oil States International, Inc. is a global provider of manufactured products and services to customers in the energy, industrial and military sectors. The Company''s manufactured products include highly engineered capital equipment and consumable products. It segments include Offshore Manufactured Products, Completion and Production Services, and Downhole Technologies. The Offshore Manufactured Products segment designs, manufactures and markets capital equipment utilized on floating production systems, subsea pipeline infrastructure, and offshore drilling rigs and vessels, along with short-cycle and other products. The Completion and Production Services segment includes a range of equipment and services used to establish and maintain the flow of oil and natural gas from a well throughout its life cycle. The Downhole Technologies segment provides oil and gas perforation systems and downhole tools in support of completion, intervention, wireline and well abandonment operations.', 'Houston, TX, United States', 2439);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHRD', 'STOCK', 'Chord Energy Corporation', 'NMS', 'Energy', 'Oil & Gas E&P', 'Chord Energy Corporation is an independent exploration and production company, which is engaged in the acquisition, exploration, development and production of crude oil, natural gas liquids (NGL) and natural gas primarily in the Williston Basin. The Companys operations are focused on the North Dakota and Montana areas of the Williston Basin, targeting the Middle Bakken and Three Forks formations, which are present across a substantial portion of its acreage. The Company has an average daily production of approximately 232,737 net barrels of oil equivalent per day (Boepd). It has approximately 9,011 (4,174.2 net) total gross productive wells, of which 4,824 gross (3,752.2 net) productive wells were operated by the Company. The Company sells its crude oil, NGL and natural gas production to refiners, marketers and other purchasers that have access to nearby pipeline and rail facilities.', 'Houston, TX, United States', 762);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATRC', 'STOCK', 'AtriCure, Inc.', 'NGM', 'Healthcare', 'Medical Instruments & Supplies', 'AtriCure, Inc. provides technologies for the treatment for atrial fibrillation (Afib), left atrial appendage (LAA) management and post-operative pain management. The Company''s cardiac ablation and left atrial appendage management (LAAM) products are used by physicians during open-heart and minimally invasive surgical procedures. Its pain management solutions are used by physicians to freeze nerves during cardiothoracic or thoracic surgical procedures. The Company''s products for open and minimally invasive ablation include Isolator Synergy Clamps and Multifunctional Pens and Linear Ablation Devices. Its products for open ablation include cryoICE Cryoablation System. Its products for minimally invasive ablation include EPi-Sense Guided Coagulation System with VisiTrax Technology. Its appendage management products include AtriClip System. The Isolator Synergy Ablation System clamps are single-use disposable radio frequency (RF) products with jaws that close in a parallel fashion.', 'Mason, OH, United States', 1300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DPZ', 'STOCK', 'Domino''s Pizza, Inc.', 'NMS', 'Consumer Cyclical', 'Restaurants', 'A Domino''s Pizza, Inc. É uma empresa de pizza com um negócio significativo tanto na entrega como no transporte. A empresa opera através de três segmentos: Lojas dos EUA, franquia internacional e cadeia de suprimentos. O segmento de lojas dos EUA é composto principalmente de suas operações de franquia, que consiste em lojas franchisadas localizadas nos Estados Unidos. O segmento também opera uma rede de lojas próprias da United States Company. O segmento de franquia internacional inclui principalmente operações relacionadas ao negócio de franchising da Companhia em mercados estrangeiros. O segmento da cadeia de suprimentos inclui principalmente a distribuição de alimentos, equipamentos e suprimentos para lojas a partir das operações do centro da cadeia de suprimentos da Companhia nos Estados Unidos e no Canadá. É principalmente um franqueador, com aproximadamente 99% de suas lojas globais de propriedade e operação por seus franqueados independentes. Em seus mercados internacionais, a e', 'Ann Arbor, MI, United States', 6400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WEX', 'STOCK', 'WEX Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'A WEX Inc. Fornece uma plataforma de comércio global, que possui e opera um ecossistema business-to-business (B2B). A Companhia atua por meio de três segmentos: Mobilidade, Benefícios e Pagamentos Corporativos. Seu segmento de Mobilidade fornece serviços de processamento de pagamentos, processamento de transações e gerenciamento de informações especificamente projetados para as necessidades de frotas de todos os tamanhos, desde pequenas empresas até frotas governamentais federais e estaduais e transportadores rodoviários. Seu segmento de benefícios fornece uma plataforma de Software como serviço (SaaS) para benefícios de saúde direcionados ao consumidor e uma solução de inscrição de benefícios de serviço completo, reunindo administração de benefícios, determinados serviços de conformidade e contas direcionadas ao consumidor e de benefícios. Seu segmento de Pagamentos Corporativos se concentra no complexo ambiente de pagamentos de B2B globais, permitindo que os clientes utilizem suas so', 'Portland, ME, United States', 6500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EWBC', 'STOCK', 'East West Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'East West Bancorp, Inc. is a bank holding company that offers a full range of banking services to individuals and businesses through its subsidiary bank, East West Bank (the Bank). Its segments include Consumer and Business Banking, Commercial Banking, and Treasury and Other. The Consumer and Business Banking segment provides financial products and services to consumer and commercial customers through its domestic branch network and digital banking platforms. This segment also offers consumer and commercial deposits, mortgage and home equity loans, and other products and services. The Commercial Banking segment generates commercial loans and deposits. Commercial loan products include construction finance, commercial business lending, working capital lines of credit, trade finance, letters of credit, and others. Commercial deposit products and other financial services include treasury management, foreign exchange services, interest rate, and commodity risk hedging.', 'Pasadena, CA, United States', 3100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIFF', 'STOCK', 'Firefly Neuroscience, Inc.', 'NCM', 'Technology', 'Software - Application', 'Firefly Neuroscience, Inc. is an artificial intelligence (AI) technology company developing neuroscientific solutions to improve brain health outcomes for patients with mental illnesses and neurological disorders. The Company has developed its FDA-510(k) cleared Brain Network Analytics software platform (the BNA Platform) and is focused on advancing diagnostic and treatment approaches for people suffering from mental illnesses and cognitive disorders, including depression, dementia, anxiety disorders, concussions, and attention-deficit/hyperactivity disorder. The Company''s Brain Network Analytics is a neurophysiological assessment tool that uses artificial intelligence and machine learning to analyze electroencephalogram (EEG) data recorded during rest and cognitive activity. The BNA Platform, in conjunction with an EEG system, provides clinicians with comprehensive insights into brain function (cognition).', 'Kenmore, NY, United States', 13);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMBM', 'STOCK', 'Cambium Networks Corporation', 'NGM', 'Technology', 'Communication Equipment', 'Cambium Networks Corporation is a provider of wireless networking infrastructure solutions. The Company enables service providers, enterprises, industrial organizations, and governments to deliver digital experiences and device connectivity. Its ONE Network platform simplifies management of its wired and wireless broadband and network edge technologies. It designs, develops, and manufactures wireless broadband and Wi-Fi networking infrastructure solutions for a range of applications, including broadband access, wireless backhaul, Internet of Things (IoT), public safety, and others. Its Fixed Wireless Broadband portfolio spans point-to-point (PTP) and point-to-multi-point (PMP) architectures over multiple standards. Its Enterprise portfolio includes Wi-Fi access points, wireless aware switches, security gateways and other networking devices. Its Subscription and Services portfolio includes network planning and design as well as cloud or on-premises network management and control.', 'Hoffman Estates, IL, United States', 625);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CALX', 'STOCK', 'Calix, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'Calix, Inc. is an appliance-based platform, cloud and managed services company. It develops, markets, and sells its appliance-based platform, cloud and managed services that enable service providers of all types and sizes to transform their businesses. Its Calix Platform consists of Calix Cloud, which comes in three role-based editions: Calix Engagement Cloud, Calix Operations Cloud and Calix Service Cloud; Calix Intelligent Access, its network solution for automated, intelligent next-generation networks, and Calix Unlimited Subscriber, its premises solution for subscriber managed services. Its SmartLife managed services consist of SmartHome managed services and applications to enhance, operate and secure the connected experience of subscribers in their home; SmartBiz managed services address the business networking and productivity needs of small business owners, and SmartMDU managed services, which provide purpose-built, flexible connectivity solutions for multifamily properties.', 'San Jose, CA, United States', 1820);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CURI', 'STOCK', 'CuriosityStream Inc.', 'NCM', 'Communication Services', 'Broadcasting', 'CuriosityStream Inc. is a media and entertainment company that offers video and audio programming across the principal categories of factual entertainment, including science, history, society, nature, lifestyle and technology. The Company provides factual entertainment that informs, enchants and inspires. It provides advertising and sponsorships services through developing integrated digital brand partnerships designed to offer the chance to be associated with CuriosityStream content in a variety of forms, including short- and long-form program integration; branded social media promotional videos; broadcast advertising spots in its video and audio programs that are made available on its linear programming channels or in front of the paywall; and its increasing focus on digital display ads while delivering its content through advertising-based video-on-demand, transactional video-on-demand, free advertising-supported streaming television, YouTube and other similar distribution channels.', 'Silver Spring, MD, United States', 45);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDD', 'STOCK', 'Morgan Stanley Emerging Markets Domestic Debt Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Morgan Stanley Emerging Markets Domestic Debt Fund, Inc. is a closed ended fixed income mutual fund launched and managed by Morgan Stanley Investment Management Inc. The fund invests in fixed income markets of emerging market countries across the globe. It typically invests in government bonds denominated in the local currencies of emerging markets. The fund benchmarks the performance of its portfolio against the JPMorgan Government Bond Index - Emerging Markets Global Diversified Index. Morgan Stanley Emerging Markets Domestic Debt Fund, Inc. was formed on January 25, 2007 and is domiciled in United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CURV', 'STOCK', 'Torrid Holdings Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Torrid Holdings Inc. is a direct-to-consumer brand of apparel, intimates, and accessories in North America. The Company is focused on fit and offers products across a broad assortment, which includes tops, bottoms, denim, dresses, intimates, activewear, footwear and accessories. It designs, develops and merchandises almost all of its products in-house, under the Torrid, Torrid Curve, CURV and Lovesick brand names. The Company operates in one segment, being the operation of its e-commerce platform and stores. Through its unified commerce platform, which includes its e-commerce and retail stores, it delivers a brand experience to its customers. Its e-commerce channel is central to its unified commerce platform. Its Website and mobile app feature updates on new collections and guidance on how to wear and put together outfits. It operates approximately 634 stores in the United States, Puerto Rico and Canada. Its stores are located in malls, shopping plazas, and lifestyle centers.', 'City Of Industry, CA, United States', 1810);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIGI', 'STOCK', 'Colliers International Group Inc.', 'NMS', 'Real Estate', 'Real Estate Services', 'Colliers International Group Inc. is a global diversified professional services and investment management company. The Company''s platforms include commercial real estate services, engineering consultancy and investment management. Its service lines are outsourcing, engineering, investment management, leasing and capital markets. Its services for landlords and investors include landlord representation, project management, capital market, valuation and advisory, real estate management, engineering and design services, and others. Its services for occupiers and tenants include occupier services, tenant representation, project management, technology services and others. It offers services to various properties-including hospitality, industrial, land, multifamily, office, retail, healthcare and special purpose. Harrison Street Asset Management (Harrison Street) offers solutions across a variety of closed-end, open-end and specialized vehicles.', 'Toronto, ON, Canada', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRNX', 'STOCK', 'Crinetics Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Crinetics Pharmaceuticals, Inc. is a clinical-stage pharmaceutical company focused on the discovery, development and commercialization of therapeutics for rare endocrine diseases and endocrine-related tumors. Its lead development candidate, PALSONIFY (paltusotine), is the first investigational once-daily, oral, selective somatostatin receptor type 2 (SST2) nonpeptide agonist that is in clinical development for acromegaly and carcinoid syndrome associated with neuroendocrine tumors. Its second product candidate is Atumelnant, which is in clinical development for congenital adrenal hyperplasia (CAH) and patients with either Cushing''s disease or Ectopic ACTH Syndrome (EAS). Its drug candidates are orally delivered, small molecule new chemical entities resulting from in-house drug discovery efforts, including other programs addressing a variety of endocrine conditions such as hyperparathyroidism, polycystic kidney disease, Graves'' disease, thyroid eye disease, diabetes and obesity.', 'San Diego, CA, United States', 437);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGCO', 'STOCK', 'AGCO Corporation', 'NYQ', 'Industrials', 'Farm & Heavy Construction Machinery', 'AGCO Corporation designs, manufactures and distributes agricultural machinery and precision agriculture technology. The Companys brands include Fendt, Massey Ferguson, PTx and Valtra. Its segments include North America, South America, Europe/Middle East and Asia/Pacific/Africa regions. Its solutions include tractors, compact/utility tractors, harvesting, hay & forage, crop care & nutrient management, planting & soil preparation, material handling, power generation, water management, and engines. Its tractors include high horsepower tractors, utility or mid-range tractors, and compact tractors. Its hay and forage solutions range from mowers and balers to forage blowers. It offers seeding and tillage equipment for a variety of crops and conditions - from minimum tillage to primary tillage. Its AGCO Power division produces diesel engines, gears and generating sets. It also provides retail and wholesale financing through its finance joint ventures with Cooperatieve Rabobank U.A.', 'Duluth, GA, United States', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCR', 'STOCK', 'Invesco BulletShares 2027 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in the securities that comprise the underlying index. Strictly in accordance with its guidelines and mandated procedures, Invesco Indexing LLC compiles and maintains the underlying index. The index provider is affiliated with Invesco Capital Management LLC, the fund’s investment adviser (the “Adviser”), and Invesco Distributors, Inc., the fund’s distributor.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKRO', 'STOCK', 'Akero Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Akero Therapeutics, Inc. is a clinical-stage company developing transformational treatments for patients with serious metabolic diseases marked by high unmet medical need, including metabolic dysfunction-associated steatohepatitis (MASH). Efruxifermin (EFX), its lead product candidate for MASH, is being evaluated in three ongoing Phase 3 studies: SYNCHRONY Outcomes in patients with compensated cirrhosis (F4) due to MASH, SYNCHRONY Histology in patients with pre-cirrhotic (F2-F3 fibrosis) MASH, and SYNCHRONY Real-World in patients with MASH (F1-F4). The Phase 3 SYNCHRONY program builds on the results of two Phase 2b clinical trials, the HARMONY study in patients with pre-cirrhotic MASH and the SYMMETRY study in patients with compensated cirrhosis due to MASH. EFX is an analog of fibroblast growth factor 21 (FGF21), which is an endogenously expressed hormone that protects against cellular stress and regulates metabolism of lipids, carbohydrates and proteins throughout the body.', 'South San Francisco, CA, United States', 67);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESNT', 'STOCK', 'Essent Group Ltd.', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'Essent Group Ltd. is a Bermuda-based holding company. The Company, through its wholly owned subsidiaries, offers private mortgage insurance and reinsurance, and title insurance and settlement services to serve the housing finance industry. Through the subsidiary, CUW Solutions, LLC, it offers mortgage insurance and provides contract underwriting services on a limited basis. It also offers mortgage-related insurance and reinsurance through its Bermuda-based subsidiary, Essent Reinsurance Ltd. The Company provides private capital to mitigate mortgage credit risk, allowing lenders to make additional mortgage financing available to prospective homeowners. Its products and services include Bermuda-Based Insurance and Reinsurance, Title Insurance and Settlement Services, Mortgage Insurance, and Contract Underwriting. It offers two types of private mortgage insurance, namely primary and pool. Its subsidiaries include Essent Reinsurance Ltd. and Essent Irish Intermediate Holdings Ltd.', 'Hamilton, , Bermuda', 521);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBR', 'STOCK', 'Amber International Holding Limited', 'NGM', 'Technology', 'Software - Infrastructure', 'Amber International Holding Limited operates under the brand name Amber Premium. Amber Premium is a provider of institutional crypto financial services and solutions. A subsidiary of Amber Group, Amber Premium delivers institutional-grade market access, execution infrastructure, and investment solutions to help institutions and high-net-worth individuals optimize their digital asset portfolios. The Company offers a regulated, scalable financial ecosystem powered by proprietary blockchain and financial technologies, artificial intelligence (AI)-driven risk management, and quantitative algorithms across CeFi, DeFi, and OTC markets. Its core product offerings include Frictionless Fiat On/Off Ramp Services, over the counter (OTC) Trading and Execution Services, Standard Earn/Structured Products, DeFi Yield Enhance Products, Strategic Funds, and Other Services. The Company provides fiat on/off ramp services that offer clients a gateway into the digital assets ecosystem.', 'Singapore, , Singapore', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABG', 'STOCK', 'Asbury Automotive Group, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Asbury Automotive Group, Inc. is an automotive retailer. The Company operates through two segments: Dealerships and Total Care Auto (TCA). The Company offers a range of automotive products and services fulfilling the entire vehicle ownership lifecycle, including new and used vehicles, parts and services, which include vehicle repair and maintenance services, replacement parts and collision repair services, and finance and insurance (F&I) products, including arranging vehicle financing through third parties and aftermarket products, such as extended service contracts, guaranteed asset protection debt cancellation and prepaid maintenance plans. The Company operates approximately 178 new-vehicle dealerships, consisting of over 241 franchises and representing 31 domestic and foreign brands of vehicles. It also operates Total Care Auto, Powered by Landcar, a provider of service contracts and other vehicle protection products, and 40 collision repair centers.', 'Duluth, GA, United States', 15000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MVLL', 'STOCK', 'GraniteShares 2x Long MRVL Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change the underlying stock by entering into financial instruments such as swaps and options underlying stock as well as directly purchasing the underlying stock. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMX', 'STOCK', 'EMX Royalty Corporation', 'ASE', 'Basic Materials', 'Other Industrial Metals & Mining', 'EMX Royalty Corporation is a precious and base metals royalty company. It is in the business of acquisition and management of royalties, strategic investments, and organically generating royalties derived from a portfolio of mineral property interests. Its royalty and exploration portfolio consists of properties in North America, Europe, Turkiye, Latin America, Morocco and Australia. Its diversified portfolio of royalty, mineral property and investment interests spans six continents, and is focused on gold, copper, and polymetallic assets. Its royalties include Leeville, Kwai, Lang Lake, Lucky 7, Manitou, McDonough, Pipestone, Red Lake Gold - Gullrock Lake, Red Lake Gold - Duchess, Red Lake Gold - Tilly, South of Otter, Portage River, Colla Kananchiari, Grand Bois & Surrounding Properties, San Agustin Sulfides, Jasikovo East-Durlan Potok, Gediktepe Oxide / Sulfide, Goodpaster - 64 North, South Orogrande, Gold Bar South - Afgan, Maggie Creek South, Yerington West-Roulette, and others.', 'Vancouver, BC, Canada', 49);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EUFN', 'STOCK', 'iShares MSCI Europe Financials ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of the underlying index and in investments that have economic characteristics that are substantially identical to the component securities of the underlying index. The index is a free float-adjusted market capitalization-weighted index designed to measure the combined equity market performance of the financials sector of developed market countries in Europe.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHEF', 'STOCK', 'The Chefs'' Warehouse, Inc.', 'NMS', 'Consumer Defensive', 'Food Distribution', 'The Chefs'' Warehouse, Inc. is a distributor of specialty food products in the United States, the Middle East, and Canada. The Company offers stock-keeping units (SKUs), ranging from specialty foods and ingredients to basic ingredients and staples, produce and center-of-the-plate proteins. Its product categories include center-of-the-plate, dry goods, pastry, cheeses and charcuterie, produce, dairy and eggs, oils and vinegars and kitchen supplies. It operates through the foodservice distribution segment, which is concentrated primarily in the United States. The Companys customer base consists primarily of menu-driven independent restaurants, fine dining establishments, country clubs, hotels, caterers, culinary schools, bakeries, patisseries, chocolateries, cruise lines, casinos and specialty food stores. Its center-of-the-plate products include custom cut beef, seafood and hormone-free poultry, as well as produce and food products, such as cooking oils, butter, eggs, milk, and flour.', 'Ridgefield, CT, United States', 5029);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVBF', 'STOCK', 'CVB Financial Corp.', 'NMS', 'Financial Services', 'Banks - Regional', 'CVB Financial Corp. is the bank holding company for Citizens Business Bank (the Bank). The Bank offers an array of banking, lending and investing services with more than 60 banking centers and three trust office locations serving California. It offers a range of bank deposit instruments, which include checking, savings, money market and time certificates of deposit for both business and personal accounts, municipalities and districts, and specialized deposit products for title and escrow. It provides a full complement of lending products, including commercial, agribusiness, consumer, small business administration (SBA), real estate, and construction loans, as well as equipment and vehicle leasing. It also offers a range of specialized services designed for the needs of its commercial customers. In addition, it offers a range of financial services and trust services through its CitizensTrust division, which includes fiduciary services, mutual funds, annuities, 401(k) plans and others.', 'Ontario, CA, United States', 1089);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGRW', 'STOCK', 'WisdomTree U.S. Quality Dividend Growth Fund', 'NGM', NULL, NULL, 'Under normal circumstances, at least 80% of the fund''s total assets (exclusive of collateral held from securities lending) will be invested in constituent securities of the index and investments that have economic characteristics that are substantially identical to the economic characteristics of such constituent securities. The index is a fundamentally weighted index that consists of dividend-paying U.S. common stocks with growth characteristics. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTXR', 'STOCK', 'Citius Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Citius Pharmaceuticals, Inc. is a biopharmaceutical company focused on the development and commercialization of first-in-class critical care products, with a pipeline of anti-infectives in oncology, adjunct cancer care, stem cell therapy and prescription products. The Company''s FDA approved LYMPHIR candidate is a targeted immunotherapy for an initial indication in the treatment of cutaneous T-cell lymphoma. Its late-stage pipeline also includes Mino-Lok, and CITI-002 (Halo-Lido). Mino-Lok is an antibiotic lock solution used to treat patients with catheter-related bloodstream infections (CRBSIs) and central line associated bloodstream infections (CLABSIs). Halo-Lido is a topical formulation of halobetasol propionate, a corticosteroid, and lidocaine that is intended for the treatment of hemorrhoids. The Company is also seeking to develop and commercialize the NoveCite mesenchymal stem cells (NC-iMSCs) to treat acute respiratory conditions with a near term focus on ARDS.', 'Cranford, NJ, United States', 23);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDW', 'STOCK', 'CDW Corporation', 'NMS', 'Technology', 'Information Technology Services', 'A CDW Corporation é uma fornecedora multimarca de soluções de tecnologia da informação (TI) para clientes empresariais, governamentais, educacionais e de saúde nos Estados Unidos, Reino Unido e Canadá. A variedade de ofertas da empresa varia de produtos discretos de hardware e software a soluções e serviços integrados DE TI que incluem recursos locais e de nuvem em infraestrutura híbrida, experiência digital e segurança. A Companhia atua por meio de três segmentos: Corporativo, Pequenas Empresas e Público. O segmento corporativo atende principalmente clientes empresariais do setor privado dos Estados Unidos. O segmento de Pequenas Empresas atende principalmente clientes empresariais do setor privado dos Estados Unidos. O segmento Público é composto por agências governamentais e instituições de educação e saúde nos Estados Unidos. As soluções da empresa são entregues em ambientes físicos, virtuais e baseados na nuvem. A empresa fornece soluções integradas DE TI em mais de 150 países.', 'Vernon Hills, IL, United States', 15100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGBD', 'STOCK', 'Carlyle Secured Lending, Inc.', 'NMS', 'Financial Services', 'Asset Management', 'Carlyle Secured Lending, Inc. is a specialty finance company that is a closed-end, externally managed, non-diversified management investment company. The Company''s investment objective is to generate current income and capital appreciation primarily through assembling a portfolio of secured debt investments in United States middle market companies. The Company seeks to achieve its investment objective primarily through direct origination of secured debt instruments, including first lien senior secured loans (which may include stand-alone first lien loans, first lien/last out loans and unitranche loans) and second lien senior secured loans (collectively, Middle Market Senior Loans), with a minority of its assets invested in higher yielding investments (which may include unsecured debt, subordinated debt and investments in equities and structured products). The Company is externally managed by its investment adviser, Carlyle Global Credit Investment Management L.L.C.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHDN', 'STOCK', 'Churchill Downs Incorporated', 'NMS', 'Consumer Cyclical', 'Gambling', 'Churchill Downs Incorporated é uma empresa de entretenimento de jogos e apostas online, que está ancorada pelo seu principal evento, o Kentucky Derby. A empresa opera através de três segmentos portáteis: Live e Historical Racing, Serviços e Soluções de Aposta e Jogos. O segmento Live and Historical Racing inclui corridas de pari-mutuel ao vivo e histórico no Churchill Downs Racetrack e suas propriedades de corrida históricas em Kentucky, Virgínia e New Hampshire. O segmento de Serviços e Soluções de Aposta inclui TwinSpires, que é um negócio de apostas esportivas online e de varejo; United Tote Company, que fabrica e opera sistemas de apostas pari-mutuel para pistas de corrida, instalações de apostas off-track (OTB) e outros negócios de apostas pari-mutuel; e Exacta Systems, LLC que fornece tecnologia de sistema determinante central em máquinas de corrida históricas (HRMS) em todo o país. O segmento Gaming está envolvido nas propriedades do cassino e nas instalações associadas de pista', 'Louisville, KY, United States', 6480);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYRN', 'STOCK', 'Byrna Technologies Inc.', 'NCM', 'Industrials', 'Aerospace & Defense', 'Byrna Technologies Inc. is a technology company specializing in the development, manufacture, and sale of less-lethal personal security solutions. The Company is the manufacturer of the Byrna SD personal security device, a handheld carbon dioxide (CO2) powered launcher designed to provide a less-lethal alternative to a firearm for the consumer, private security, and law enforcement markets. The Companys product portfolio includes handheld personal security devices and shoulder-fired launchers designed for use by consumers and professional security customers without the need for a background check or firearms license; a line of projectiles that are fired by Byrna devices, including chemical irritant, kinetic and inert rounds; a line of self-defense aerosol products, including Byrna Bad Guy Repellent; and accessories and related safety products, including the Byrna Banshee, Byrna Shield, compressed CO2 canisters, sighting systems, holsters and Byrna-branded apparel.', 'Andover, MA, United States', 167);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AACG', 'STOCK', 'ATA Creativity Global', 'NCM', 'Consumer Defensive', 'Education & Training Services', 'ATA Creativity Global (ATA) is a China-based company mainly providing international educational services. The Company''s main businesses include providing international educational experiences related to the cultivation and improvement of students'' creativity. The Company''s principal product and service are portfolio training services which it provide to students in China who are interested in studying art overseas.', 'Hefei, , China', 599);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMC', 'STOCK', 'Commercial Metals Company', 'NYQ', 'Basic Materials', 'Steel', 'Commercial Metals Company is engaged in offering products and technologies to meet the critical reinforcement needs of the global construction sector. The Companys solutions support construction across a wide variety of applications, including infrastructure, non-residential, residential, industrial, and energy generation, and transmission. Its segments include North America Steel Group, Europe Steel Group and the Emerging Businesses Group. The North America Steel Group segment provides a diverse offering of products and solutions to support the construction sector. The Europe Steel Group segment is composed of a vertically integrated network of recycling facilities, an EAF mini mill and fabrication operations located in Poland. The Emerging Businesses Group segment''s portfolio consists of its construction services products, Tensar products and solutions and its impact metals, and performance reinforcing steel products.', 'Irving, TX, United States', 13178);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXG', 'STOCK', 'Eaton Vance Tax-Managed Global Diversified Equity Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Eaton Vance Tax-Managed Global Diversified Equity Income Fund is a closed-ended equity mutual fund launched and managed by Eaton Vance Management. It invests in public equity markets across the globe. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in dividend paying stocks of companies. The fund also invests through derivatives. It also writes call options on one or more U.S. and foreign indices with respect to a portion of the value of its common stock portfolio. The fund benchmarks the performance of its portfolio against the MSCI World Index. Eaton Vance Tax-Managed Global Diversified Equity Income Fund was formed on February 27, 2007 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTOS', 'STOCK', 'Custom Truck One Source, Inc.', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'Custom Truck One Source, Inc. is a provider of specialty equipment, parts, tools, accessories and services to the electric utility transmission and distribution, telecommunications and rail markets in North America. The Companys segments include Equipment Rental Solutions (ERS), Truck and Equipment Sales (TES)and Aftermarket Parts and Services. The ERS segment owns a range of new and used specialty equipment, including truck-mounted aerial lifts, cranes, service trucks, dump trucks, trailers, digger derricks and other machinery and equipment. The TES segment consists of the production and sale of new and used specialty equipment and vocational trucks, which includes equipment from original equipment manufacturers (OEMs) across its end-markets, as well as its Load King brand. The APS segment includes the sale of specialized aftermarket parts, including captive parts related to its Load King brand, used in the maintenance and repair of the equipment it sells and rents.', 'Kansas City, MO, United States', 2619);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACLS', 'STOCK', 'Axcelis Technologies, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Axcelis Technologies, Inc. provides high-productivity solutions for the semiconductor industry. The Company is focused on developing enabling process applications through the design, manufacture and complete life cycle support of ion implantation systems, one of the critical and enabling steps in the IC manufacturing process. Its ion implantation products include high current ion implant, high energy ion implant and medium current ion implant. The Company''s Purion H, Purion Dragon, Purion H200, and GSD/E2 Ovation spot beam, high current systems cover all traditional high current requirements as well as those associated with emerging and future devices. Its Purion XE, EXE, and other Purion high energy systems combine its production-proven RF Linac high energy, spot beam technology with the Purion platform wafer handling system. Its medium current ion implant products include its Purion M Si and SiC medium current systems. It also offers its customers aftermarket service and support.', 'Beverly, MA, United States', 1524);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATAT', 'STOCK', 'Atour Lifestyle Holdings Limited', 'NMS', 'Consumer Cyclical', 'Lodging', 'Atour Lifestyle Holdings Ltd is principally engaged in the hotel operations. The Company''s hotel network has approximately 834 hotels located across 151 cities in China, with more than 96,969 hotel rooms. The Company also has approximately 17 theme-based hotels, which includes music, basketball and literature themes. The Company provides a diversified hotel brand portfolio, including Atour, Atour S, Atour X, Atour Light, ZHOTEL and A.T. House. The Company also rents hotels to third-party lessors.', 'Shanghai, , China', 5488);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTRI', 'STOCK', 'Centuri Holdings, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Centuri Holdings, Inc. is a utility infrastructure services company that partners with regulated utilities to build and maintain the energy network that powers millions of homes and businesses across the United States and Canada. The Company''s segments include U.S. Gas Utility Services (U.S. Gas), Canadian Gas Utility Services (Canadian Gas), Union Electric Utility Services (Union Electric), and Non-Union Electric Utility Services (Non-Union Electric). The U.S. Gas and Canadian Gas segments provide comprehensive services, including maintenance, replacement, repair and installation for local natural gas distribution utilities (LDCs) focused on the modernization of customers infrastructure throughout the United States and Canada. The Union Electric segment provides a comprehensive set of electric utility services encompassing maintenance, replacement, repair, upgrade and expansion services for urban transmission and local distribution infrastructure within union markets.', 'Phoenix, AZ, United States', 8687);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FA', 'STOCK', 'First Advantage Corporation', 'NMS', 'Industrials', 'Specialty Business Services', 'First Advantage Corporation is a global provider of employment background screening, identity, and verification solutions. Enabled by its technology, the Company delivers services and insights that help customers mitigate risk and hire talent: employees, contractors, contingent workers, tenants, and drivers. Its comprehensive product suite enables its customers across all industry sectors to perform pre-onboarding screening and post-onboarding monitoring of employees, contractors, contingent workers, tenants, and drivers. Its pre-onboarding products include criminal background checks, drug/health screening, extended workforce screening, FBI channeling, identity checks and biometric fraud mitigation tools, education/work history verification, driver records and compliance, healthcare credentials, executive screening and others. Its post-onboarding solutions include criminal records monitoring, healthcare sanctions, motor vehicle records, social media and global sanctions and licenses.', 'Atlanta, GA, United States', 10000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DARE', 'STOCK', 'Daré Bioscience, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dare Bioscience, Inc. is a biopharmaceutical company. The Company''s programs target unmet needs in women''s health, primarily in the areas of contraception, sexual health, pelvic pain, fertility, infectious disease, vaginal health and menopause. Its product includes XACIATO (clindamycin phosphate) vaginal gel 2%. XACIATO is a single-dose prescription medication for the treatment of bacterial vaginosis in females 12 years of age and older. Its other product candidates include Ovaprene, Sildenafil Cream, and DARE-HRT1. Ovaprene is an investigational, hormone-free, monthly intravaginal contraceptive. Sildenafil Cream is a novel cream formulation of sildenafil for the treatment of female sexual arousal disorder; and DARE-HRT1 is an intravaginal ring designed to deliver a combination of menopausal hormone therapy, bio-identical 17b-estradiol and progesterone together, continuously over a 28-day period for the treatment of moderate to severe vasomotor symptoms, also known as hot flashes.', 'San Diego, CA, United States', 21);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBZ', 'STOCK', 'CBIZ, Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'CBIZ, Inc. is a professional services advisor to middle-market businesses and organizations nationwide. It provides a range of accounting, tax, advisory, benefits, insurance, and technology services. It delivers its services through three groups: Financial Services, Benefits and Insurance Services, and National Practices. Financial Services is comprised of traditional accounting services, tax return preparation, administrative services, financial and risk advisory, consulting, valuation, and IT services. Benefits and Insurance Services provides brokerage and consulting along lines of service which include group health benefits consulting and brokerage, property and casualty brokerage, retirement plan advisory, payroll, human capital management, actuarial, life insurance, and other services. National Practices provides managed networking and hardware services consisting of installation, maintenance and repair of computer hardware. It also maintains a cyber risk management program.', 'Independence, OH, United States', 10000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CORT', 'STOCK', 'Corcept Therapeutics Incorporated', 'NCM', 'Healthcare', 'Biotechnology', 'Corcept Therapeutics Incorporated is a commercial-stage company. The Company is engaged in the discovery and development of medications to treat severe endocrinologic, oncologic, metabolic and neurologic disorders by modulating the effects of the hormone cortisol. The Company operates through the discovery, development and commercialization of the pharmaceutical products segment. The Company has marketed Korlym (mifepristone) in the United States for the treatment of patients suffering from Cushings syndrome. The Companys portfolio of selective cortisol modulators consists of four series totaling approximately 1,000 compounds. Its portfolio of selective cortisol modulators consists of relacorilant, dazucorilant and miricorilant. Korlyms active ingredient, mifepristone, reduces the binding of excess cortisol to the GR, it can modulate the effects of abnormal levels and release patterns of cortisol without compromising cortisols healthy functions and rhythms.', 'Redwood City, CA, United States', 500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACP', 'STOCK', 'Abrdn Income Credit Strategies Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Asseco Poland S.A. is a Poland-based information technology (IT) company, which is primarily engaged in the development of software for companies from different sectors of the economy. The Company takes part in business acquisitions both in the domestic and foreign markets and develops organically as well. The Companys portfolio includes proprietary products, execution of IT projects, and a customer base, including financial institutions, industrial enterprises as well as public administration bodies. The Company operates globally.', 'Edinburgh, , United Kingdom', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALSN', 'STOCK', 'Allison Transmission Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Allison Transmission Holdings, Inc. is a designer and manufacturer of propulsion solutions for commercial and defense vehicles. The Company is also a manufacturer of medium-and heavy-duty fully automatic transmissions. Its products are used in a variety of applications, including on-highway trucks, including distribution, refuse, construction, fire and emergency; buses, including school, transit and coach; motorhomes, off-highway vehicles, and equipment, including energy, mining and construction applications; and defense vehicles, including tactical wheeled and tracked. The Company operates in approximately 150 countries. The Company has manufacturing facilities in the United States, Hungary and India, as well as global engineering resources, including electrification engineering centers in Indianapolis, Indiana, Auburn Hills, Michigan and London in the United Kingdom. The Company also has approximately 1,600 independent distributor and dealer locations worldwide.', 'Indianapolis, IN, United States', 4000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAPT', 'STOCK', 'Captivision Inc.', 'NGM', 'Basic Materials', 'Building Materials', 'Captivision Inc. is a provider of architectural media glass. The Company is an inventor and manufacturer of architectural display glass. The Company manufactures an integrated architectural information technology (IT) product, G-Glass, which is a product that combines IT building materials and architectural glass into one standalone offering. G-Glass can transform any glass facade into a transparent media screen, enabling real estate owners and developers to monetize vertical real estate. G-Glass can be implemented across a wide range of indoor and outdoor use cases from retailers, shops, entertainment, service companies as well as media, streaming and broadcasting companies. It has a variety of applications, including business marketing, third party advertising, public services, and sports and entertainment.', 'Pyeongtaek-Si, , South Korea', 98);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSL', 'STOCK', 'DoubleLine Income Solutions Fund', 'NYQ', 'Financial Services', 'Asset Management', 'DoubleLine Funds - DoubleLine Income Solutions Fund is a closed end fixed income mutual fund launched and managed by DoubleLine Capital LP. The fund invests in fixed income markets across the globe. It primarily invests in debt securities issued by domestic or foreign corporate or other issuers, obligations of foreign sovereigns or their agencies or instrumentalities, mortgage-backed securities, hybrid REIT securities that trade on an exchange, bank loans, municipal securities, and other debt securities issued by states or local governments and their agencies, authorities, and other government-sponsored enterprises. DoubleLine Funds - DoubleLine Income Solutions Fund is domiciled in the United States.', 'Tampa, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAMT', 'STOCK', 'Camtek Ltd.', 'NGM', 'Technology', 'Semiconductor Equipment & Materials', 'Camtek Ltd is an Israel-based manufacturer of metrology and inspection equipment and a provider of software solutions. The Company mainly serves Advanced Packaging, Memory, Complementary Metal Oxide Semiconductor (CMOS) Image Sensors, Micro Electro Mechanical Sensor (MEMS), Radio Frequency (RF), and other segments in the mid-end of the semiconductors industry. The Company has more than seven offices around the world and provides tailor-made solutions in line with customers'' requirements. Camtek Ltd''s subsidiaries are Camtek Europe SA, Camtek Korea Ltd, Camtek South East Asia Pte Ltd, Camtek USA Inc, Sela - Semiconductor Engineering Laboratories USA Inc, Camtek Japan Ltd and Sela Semiconductor Engineering Laboratories Ltd, among others.', 'Migdal Haemek, , Israel', 656);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('XFLT', 'STOCK', 'XAI Octagon Floating Rate & Alternative Income Trust', 'NYQ', 'Financial Services', 'Asset Management', 'XAI Octagon Floating Rate & Alternative Income Trust is headquartered in Chicago, Illinois.', 'Chicago, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CETX', 'STOCK', 'Cemtrex, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Cemtrex, Inc. is an advanced security technology and industrial services company. The Company owns two operating subsidiaries: Vicon Industries Inc and Advanced Industrial Services Inc. Vicon Industries Inc. delivers mission-critical security surveillance systems, specializing in engineering complete security solutions that simplify deployment, operation and ongoing maintenance. It provides security solutions for some of the municipalities and businesses in the United States and around the world, offering a range of compliant security technologies, from artificial intelligence-driven video analytics to fully integrated access control solutions. Advanced Industrial Services Inc. (AIS) is a provider of industrial contracting services, including millwrighting, rigging, piping, electrical, welding. AIS installs high precision equipment in a variety of industrial markets including automotive, printing and graphics, industrial automation, packaging, and chemicals.', 'Brooklyn, NY, United States', 264);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIV', 'STOCK', 'Apartment Investment and Management Company', 'NYQ', 'Real Estate', 'REIT - Residential', 'A Apartment Investment and Management Company é uma empresa imobiliária diversificada, focada principalmente em investimentos de valor agregado e oportunistas, visando o setor multifamiliar dos Estados Unidos. A Companhia atua através de três segmentos, nomeadamente, Desenvolvimento e Redesenvolvimento, Operação, entre outros. O segmento de Desenvolvimento e Redesenvolvimento inclui propriedades que estão em construção ou que não alcançaram e mantiveram a estabilização, bem como assembleias de terras que são realizadas para desenvolvimento futuro. Seu segmento de atuação inclui aproximadamente 20 comunidades residenciais de apartamentos que alcançaram níveis estabilizados de operações. O outro segmento consiste em propriedades que não estão incluídas em seus segmentos de Desenvolvimento e Redesenvolvimento ou Operação. Seu segmento de Desenvolvimento e Redesenvolvimento inclui aproximadamente nove comunidades de aluguel, incluindo uma em construção e três substancialmente concluídas e ', 'Denver, CO, United States', 58);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUDC', 'STOCK', 'AudioCodes Ltd.', 'NMS', 'Technology', 'Communication Equipment', 'AudioCodes Ltd is an Israel-based software publisher. The Company provides communications software, end-to-end products and productivity solutions for the digital workplace. Company''s solution''s enables enterprises and service providers to build and operate all-IP voice networks for delivering unified communications, contact centers, and hosted business services, whether in the cloud or on premises. AudioCodes Ltd categorizes its products and services into three main business lines: Enterprise solution consists products and solutions designed to simplify the implementation of state-of the-art enterprise communications and contact center solutions; Service provider solutions consist high performance, versatile CPE devices deliver on-premises connectivity to cloud UC services and SIP trunks for business customers; Voice.ai category leverage the latest in voice recognition, AI and machine learning technologies to create voice-driven solutions. The Company servers its customer worldwide.', 'Or Yehuda, , Israel', 946);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMPX', 'STOCK', 'Compass Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Compass Therapeutics, Inc. is a clinical-stage, oncology-focused biopharmaceutical company. The Company is developing proprietary antibody-based therapeutics to treat multiple human diseases. Its pipeline of novel product candidates is designed to target multiple critical biological pathways required for an effective anti-tumor response. Its lead product candidate, tovecimig, is a bispecific antibody targeting Delta-like ligand 4 (DLL4), a ligand of Notch-1, and vascular endothelial growth factor A (VEGF-A). Its second program, CTX-471, is an agonistic antibody targeting a member of the tumor necrosis factor receptor superfamily member 9 (TNFRSF9), also known as CD-137, a co-stimulatory receptor which is mostly expressed on activated, but not on resting T-cells and NK cells. Its third program, CTX-8371, is a bispecific antibody targeting the programmed cell death protein-1 (PD-1), an inhibitory immune checkpoint receptor, and its ligand PD-L1, two validated immune-oncology targets.', 'Boston, MA, United States', 35);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGHT', 'STOCK', '8x8, Inc.', 'NMS', 'Technology', 'Software - Application', '8x8, Inc. is a provider of software-as-a-service solutions for contact centers, voice communications, video meetings, employee collaboration, and embeddable communication application programming interfaces (API). The Companys communications platform solutions comprise the 8x8 XCaaS platform, which is an integrated contact center, voice communications, video, chat, and SMS solution built on one global cloud communications platform. Its integrated technology platform includes 8x8 Work, 8x8 Contact Center, 8x8 Engage and 8x8 X Series. Its 8x8 Work is an end-to-end unified communications as a service solution that delivers enterprise-grade voice services, secure video meetings, and unified messaging including direct messages, public and private team messaging rooms, and peer-to-peer short and multimedia messaging, or SMS/MMS. 8x8 Contact Center is a cloud-based contact center as-a-service solution that includes omnichannel customer engagement, advanced analytics, and other features.', 'Campbell, CA, United States', 1942);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFH', 'STOCK', 'Bread Financial Holdings, Inc.', 'NYQ', 'Financial Services', 'Credit Services', 'A Bread Financial Holdings, Inc. É uma empresa de serviços financeiros de tecnologia avançada, que está envolvida no fornecimento de soluções simples e personalizadas de pagamento, empréstimos e economia. As ofertas de produtos da Empresa consistem em programas de cartão de crédito de marca própria e co-marca com varejistas e outros parceiros de marca; cartões de crédito direto para o consumidor (DTC); produtos Bread Pay e produtos Bread Savings. Suas soluções de pagamento, incluindo cartões de crédito de uso geral da Bread Financial e produtos de poupança. Seus cartões de crédito de marca própria são cartões de crédito de marca parceira usados pelos consumidores para a compra de bens e serviços desse parceiro. O Bread Pay é a sua solução de tecnologia de pagamento para produtos pay-over-time. Os produtos da Empresa são suportados por vários serviços e capacidades, incluindo gestão de riscos, originação de contas e serviços de financiamento; processamento e assistência de cartões de cr', 'Columbus, OH, United States', 6000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATOM', 'STOCK', 'Atomera Incorporated', 'NCM', 'Technology', 'Semiconductor Equipment & Materials', 'Atomera Incorporated is engaged in the business of developing, commercializing and licensing processes and technologies for the semiconductor industry. The Companys lead technology, named Mears Silicon Technology (MST) is a thin film of reengineered silicon, typically 100 to 300 angstroms (approximately 20 to 60 silicon atomic unit cells) thick. MST consists of layers of a non-semiconductor, such as oxygen, inserted into a semiconductor material, such as silicon, so that epitaxial growth is preserved. These layers can be used to modify or enhance the basic semiconductor properties and device attributes in a number of ways, including diffusion blocking, variability, mobility, gate leakage, and reliability, among others. MST can be used to create doping profiles. Its MSTcad is a Mathematical Model for the Synopsys Sentaurus Device Platform. MSTcad is available for Sentaurus Process and Device simulation packages, for physical and electrical characterization.', 'Los Gatos, CA, United States', 20);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVER', 'STOCK', 'EverQuote, Inc.', 'NGM', 'Communication Services', 'Internet Content & Information', 'EverQuote, Inc. operates an online marketplace for consumers shopping for auto and home and renters insurance quotes. The Company operates a marketplace connecting insurance providers to a large volume of high-intent, pre-validated consumer referrals that match the insurers'' specific underwriting and profitability requirements. Its marketplace enables consumers to choose to visit an insurance provider''s Website to purchase a policy or engage with a carrier or agent by phone or submit their data to insurance providers to receive quotes. Its technology platform combines internally developed, third-party and open-source software. Its Websites and supporting services, as well as its development and test environments, are hosted across industry-standard cloud providers, such as Amazon Web Services and Google Cloud Platform. The Company''s insurance provider customers include insurance carriers and third-party insurance agents.', 'Cambridge, MA, United States', 324);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRKU', 'STOCK', 'Direxion Daily BRKB Bull 2X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of its net assets (plus any borrowings for investment purposes) in the securities of BRK/B and financial instruments, such as swap agreements and options, that, in combination, provide 2X daily leveraged exposure to BRK/B, consistent with the fund’s investment objective. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCW', 'STOCK', 'Invesco Bulletshares 2032 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the index. The index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, “effective maturities” in the year 2032. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECG', 'STOCK', 'Everus Construction Group, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'Everus Construction Group, Inc. is a construction solutions provider offering specialty contracting services to a set of end markets across the United States. Its segments are Electrical & Mechanical (E&M) and Transmission & Distribution (T&D). Its E&M segment offers a variety of specialty contracting services, including construction and maintenance of electrical and communication wiring, fire suppression systems, and mechanical piping and services to customers in both the public and private sectors. Its T&D segment specializes in transmission and distribution construction and offers a set of specialty contracting services, including the construction and maintenance of overhead and underground electrical, gas and communication infrastructure. The T&D segment also designs, manufactures, sells and rents overhead and underground line-stringing equipment and tools. This segment also provides solutions for excavation and underground boring, substations, signals and lighting, and others.', 'Bismarck, ND, United States', 8700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYBN', 'STOCK', 'Cybin Inc.', 'ASE', 'Healthcare', 'Biotechnology', 'Cybin Inc. is a Canada-based clinical-stage biopharmaceutical company. The Company creates psychedelic-based therapeutics to address the unmet need for treatment options for people who suffer from mental health conditions. Its N, N-dimethyltryptamine (DMT) and dDMT programs create a dataset of systematic research on these psychedelic molecules. The Company is developing CYB003, a proprietary deuterated psilocybin analog for the treatment of major depressive disorder, and CYB004, a proprietary deuterated dDMT molecule for generalized anxiety disorder and has a research pipeline of investigational psychedelic-based compounds. CYB003 moves to Phase III and CYB004 moves to Phase II.CYB005 is in Preclinical stage. It has an intellectual property portfolio in the psychedelic drug development sector with over 80 patents granted and over 230 patent applications pending. The Company operates in Canada, the United States, the United Kingdom, the Netherlands, and Ireland.', 'Toronto, ON, Canada', 50);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNP', 'STOCK', 'DNP Select Income Fund Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'DNP Select Income Fund Inc. is a closed ended balanced mutual fund launched by Virtus Investment Partners, Inc. The fund is managed by Duff & Phelps Investment Management Co. It invests in the public equity and fixed income markets of the United States. For the fixed income portion, the fund invests in bonds. It seeks to invest in stocks of companies operating in the Utility sector. The fund invests in stocks of companies across all market capitalizations. It benchmarks the performance of its portfolio against the S&P 500 Utilities Index and Barclays Capital U.S. Utility Bond Index. DNP Select Income Fund Inc. was formed on November 26, 1986 and is domiciled in the United States.', 'Chicago, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CXAI', 'STOCK', 'CXApp Inc.', 'NCM', 'Technology', 'Software - Application', 'CXApp Inc. is engaged in the business of delivering intelligent enterprise workplace experiences. The Company operates the CXAI software-as-a-service platform that is anchored on the intersection of customer experience (CX) and artificial intelligence (AI) providing digital transformation for the workplace for enhanced experiences across people, places and things. All features, services, and integrations are housed in one easy-to-access platform allowing businesses to deliver a holistic employee experience in a hybrid workplace. The Company''s platform offers various features that include desk booking, room booking, office mapping, indoor navigation, find a colleague, internal communications, notifications & proximity messaging, and amenities & reservations. Its solutions include Spark Employee Engagement, Space & Amenities Management, Employee Onboarding, Workplace Automation, Visitor Management, Information Technology, Real Estate & Facilities Management, and Information Technology.', 'Palo Alto, CA, United States', 41);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ERII', 'STOCK', 'Energy Recovery, Inc.', 'NMS', 'Industrials', 'Pollution & Treatment Controls', 'Energy Recovery, Inc. is engaged in offering energy efficiency technology. It designs and manufactures solutions that provide cost savings through improved energy efficiency in commercial and industrial processes, with applications across several industries. Its segments include Water and Emerging Technologies. The Water segment develops, sales and supports PX, hydraulic turbochargers and pumps used in seawater desalination and wastewater treatment activities. The Emerging Technologies segment develops, sales and supports activities related to emerging technologies, such as the PX G1300 used in industrial and commercial refrigeration applications. Its solutions are marketed, sold in, or developed for, the fluid-flow and gas markets, such as seawater and wastewater desalination, natural gas, chemical processing and CO2-based refrigeration systems, under the trademarks ERI, PX, Pressure Exchanger, PX Pressure Exchanger (PX), Ultra PX, PX G, PX G1300, PX PowerTrain, AT, and Aquabold.', 'San Leandro, CA, United States', 254);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANIP', 'STOCK', 'ANI Pharmaceuticals, Inc.', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'ANI Pharmaceuticals, Inc. is a diversified biopharmaceutical company engaged in developing, manufacturing, and commercializing therapeutics. Its Rare Disease and Brands segment consists of two reporting units. The Rare Disease unit consists of operations related to the development, manufacturing, and marketing of branded pharmaceutical products, with a focus on products used in the treatment of patients with rare disease conditions and consists of operations related to Cortrophin Gel, ILUVIEN and YUTIQ. In addition, the Brands reporting unit includes a portfolio of over 16 brand products that are principally sold in genericized markets. Its Generics and Other segment consist of operations related to the development, manufacturing, and marketing of generic pharmaceutical products, including those sold through traditional wholesale and retail sales channels, sales of contract manufactured products, royalties on contract manufactured products, product development services, and others.', 'Baudette, MN, United States', 897);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHFAP', 'STOCK', 'Brighthouse Financial, Inc.', 'NMS', 'Financial Services', 'Insurance - Life', 'Brighthouse Financial, Inc. is a provider of annuities and life insurance in the United States. The Companys segments include Annuities; Life; Run-off, and Corporate & Other. The Annuities segment consists of a variety of variable, fixed, index-linked and income annuities designed to address contract holders needs for protected wealth accumulation on a tax-deferred basis, wealth transfer and income security. The Life segment consists of insurance products, including term, universal, whole and variable life products designed to address policyholders needs for financial security and protected wealth transfer, which may be on a tax-advantaged basis. The Run-off segment consists primarily of products that are no longer actively sold and are separately managed, including universal life with secondary guarantees, structured settlements, pension risk transfer contracts, certain Company-owned life insurance policies and certain funding agreements.', 'Charlotte, NC, United States', 1400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBC', 'STOCK', 'Ambac Financial Group, Inc.', 'NYQ', 'Financial Services', 'Insurance - Specialty', 'Ambac Financial Group, Inc. is a financial services holding company. It operates two principal businesses: Insurance Distribution and Specialty Property and Casualty Insurance. Its specialty property and casualty (P&C) insurance distribution business includes Managing General Agents, Underwriters and other appointed and delegated underwriting businesses (MGA), an insurance broker, and other distribution and underwriting businesses. Its insurance distribution platform operates in various lines of business, including, accident & health, specialty auto, other professional, marine & energy, niche specialty risks, property, reinsurance, professional directors & officers and other specialty lines. Its Specialty Property and Casualty Insurance program business includes four admitted carriers that include Everspan Insurance Company, Greenwood Insurance Company, Consolidated Specialty Insurance Company and Providence Washington Insurance Company; and an excess and surplus lines insurer.', 'New York, NY, United States', 380);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DIOD', 'STOCK', 'Diodes Incorporated', 'NMS', 'Technology', 'Semiconductors', 'Diodes Incorporated is a manufacturer and supplier of application-specific standard products within the discrete, logic, analog, and mixed-signal semiconductor markets. The Company''s products include diodes; rectifiers; transistors; MOSFETs; Silicon Carbide (SiC) diodes and MOSFETs; protection devices; logic; photocoupler; voltage translators; amplifiers and comparators; sensors; and power management devices, such as alternating current (AC)-direct current (DC) converters, DC-DC switching, linear voltage regulators, voltage references, light-emitting diode drivers, power switches, and voltage supervisors. It also has timing and connectivity solutions, including clock ICs, crystal oscillators, PCIe packet switches, multiprotocol switches, interface products, and signal integrity solutions for high-speed signals. It serves the industrial, automotive, computing, communications, and consumer markets. Its mixed-signal products, including high-speed mux/demux, digital switches, and others.', 'Plano, TX, United States', 7829);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COLM', 'STOCK', 'Columbia Sportswear Company', 'NMS', 'Consumer Cyclical', 'Apparel Manufacturing', 'A Columbia Sportswear Company é uma empresa multimarca global em produtos ao ar livre, ativos e de estilo de vida, incluindo vestuário, calçados, acessórios e equipamentos. Fornece produtos através de quatro marcas: Columbia, SOREL, Mountain Hardwear e Prana. Sua marca Columbia oferece produtos autênticos e de alta qualidade para o exterior, calçados, acessórios e equipamentos adequados para caminhadas, corrida em trilhas, neve e atividades de pesca e caça, bem como atividades diárias ao ar livre. A marca SOREL oferece calçado. A marca Mountain Hardwear continua a oferecer produtos essenciais e premium de vestuário, acessórios e equipamentos para alpinistas, montanhistas, esquiadores, snowboarders e atletas de trilha. Sua marca Prana oferece vestuário e acessórios. Seus produtos são projetados para ser usado para todas as estações, atividades e locais. A empresa comercializa seus produtos em mais de 110 países e opera em quatro segmentos portáteis: Estados Unidos, América Latina e Ásia', 'Portland, OR, United States', 9780);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENLV', 'STOCK', 'Enlivex Therapeutics Ltd.', 'NCM', 'Healthcare', 'Biotechnology', 'Enlivex Therapeutics Ltd is an Israel-based clinical stage macrophage reprogramming immunotherapy company developing Allocetra, off-the-shelf cell therapy designed to reprogram macrophages into their homeostatic state. AllocetraTM is a therapy designed to reprogram macrophages into their homeostatic state. Diseases such as solid cancers, sepsis, COVID-19 and many others reprogram macrophages out of their homeostatic state. These non-homeostatic macrophages contribute significantly to the severity of the respective diseases. By restoring macrophage homeostasis, AllocetraTM has the potential to provide immunotherapeutic mechanism of action for life-threatening clinical indications that are defined as unmet medical needs, as a stand-alone therapy or in combination with therapeutic agents.', 'Ness Ziona, , Israel', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVY', 'STOCK', 'iShares Select Dividend ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of its underlying index and in investments that have economic characteristics that are substantially identical to the component securities of its underlying index. The underlying index measures the performance of the U.S.''s leading stocks by dividend yield.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TCRX', 'STOCK', 'TScan Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'TScan Therapeutics, Inc. is a clinical-stage biotechnology company. The Company is focused on developing a robust pipeline of T cell receptor (TCR)-engineered T cell (TCR-T) therapies for the treatment of patients with cancer. The Companys lead TCR-T therapy candidates, TSC-100 and TSC-101, are in development for the treatment of patients with hematologic malignancies to prevent relapse following allogeneic hematopoietic cell transplantation. The Company is also developing multiple TCR-T therapy product candidates for the treatment of solid tumors. The Company has developed and continues to build its ImmunoBank with TCRs across different targets and human leukocyte antigens types to enable customized multiplex TCR-T therapy. Its solid tumors programs include TSC-200, TSC-201, TSC-202, TSC-203, and TSC-204. Its hematologic malignancies programs include TSC-100, TSC-101, and TSC-102.', 'Waltham, MA, United States', 194);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EKSO', 'STOCK', 'Ekso Bionics Holdings, Inc.', 'NCM', 'Healthcare', 'Medical Instruments & Supplies', 'Ekso Bionics Holdings, Inc. designs, develops, and markets exoskeleton products. Its exoskeleton technology serves people with physical disabilities or impairments in both physical rehabilitation and mobility. It operates as one segment with two markets: Enterprise Health and Personal Health. Its products include EksoNR, which is a wearable robotic exoskeleton designed for a rehabilitation setting; Ekso Indego Therapy is a modular, adjustable, lightweight, lower limb-powered exoskeleton; Ekso Indego Personal is a lower limb orthosis; Ekso Nomad is a power Knee Ankle Foot Orthosis, and Ekso EVO is a wearable upper body exoskeleton. It enables individuals with neurological conditions affecting gait, including acquired brain injury (ABI) and spinal cord injury (SCI), to rehabilitate, stand and walk again. Additionally, the devices assist people with a variety of upper extremity disabilities and enable industrial employees to perform challenging repetitive tasks for extended periods.', 'San Rafael, CA, United States', 61);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVGX', 'STOCK', 'Defiance Daily Target 2X Long AVGO ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund (“ETF”) that attempts to achieve two times (200%) the daily percentage change in the share price of the underlying security by entering into swap agreements on the underlying security. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EEFT', 'STOCK', 'Euronet Worldwide, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'A Euronet Worldwide, Inc. É uma fornecedora global de soluções de tecnologia financeira e pagamentos. A Companhia atua através de três segmentos. Seu segmento de Transferência Eletrônica de Fundos (EFT) atende às necessidades das instituições financeiras e dos consumidores por meio de caixas eletrônicos e terminais de POS próprios e terceirizados da Euronet, combinados com serviços de valor agregado e processamento de transações. A EFT oferece um conjunto de soluções integradas de software de transações financeiras eletrônicas para sistemas de pagamento eletrônico e entrega de transações. Seu segmento epay fornece soluções de pagamento de varejo e fornece conexões entre o conteúdo digital das marcas e consumidores. Seu segmento de Transferência de Dinheiro fornece transferências globais de dinheiro e informações de câmbio em lojas de varejo, aplicativos e sites por meio da Ria Money Transfer, XE e da rede de pagamentos em tempo real transfronteiriça Dandelion. O seu segmento de Transfe', 'Leawood, KS, United States', 10600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUG', 'STOCK', 'Global X Cybersecurity ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index and in American Depositary Receipts ("ADRs") and Global Depositary Receipts ("GDRs") based on the securities in the underlying index. The underlying index is designed to provide exposure to exchange-listed companies that are positioned to benefit from increased adoption of cybersecurity technology. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLMT', 'STOCK', 'Calumet, Inc.', 'NMS', 'Basic Materials', 'Specialty Chemicals', 'Calumet, Inc. manufactures, formulates and markets a diversified slate of specialty branded products and renewable fuels to customers across a range of consumer-facing and industrial markets. Its segments include Specialty Products and Solutions; Performance Brands; Montana/Renewables, and Corporate. Specialty Products and Solutions segment manufactures and markets a variety of solvents, waxes, customized lubricating oils, white oils, petrolatum, gels, esters, and other products. Performance Brands segment blend, package and market high performance products through its Royal Purple, Bel-Ray, and TruFuel brands. Montana/Renewables segment comprises two facilities: renewable fuels and specialty asphalt. At its Montana Renewables facility, it processes a variety of geographically advantaged renewable feedstocks into renewable diesel, sustainable aviation fuel, renewable hydrogen, renewable natural gas, renewable propane, and renewable naphtha that are distributed into renewables markets.', 'Indianapolis, IN, United States', 1620);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FCPT', 'STOCK', 'Four Corners Property Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Four Corners Property Trust, Inc. is a real estate investment trust (REIT), which owns, acquires and leases properties for use in the restaurant and retail industries. The Company''s segments are real estate operations and restaurant operations. Its real estate operations segment consists of rental revenues primarily generated by leasing restaurant properties to tenants through net lease arrangements under which the tenant is primarily responsible for ongoing costs relating to the properties. Its restaurant operations segment is conducted through a taxable REIT subsidiary and consists of its Kerrow Restaurant Operating Business. The Kerrow Restaurant Operating Business consists of seven LongHorn Steakhouse restaurants located in the San Antonio, Texas area. Its properties are located in Florida, Texas, Georgia, Ohio, Illinois, Indiana, Michigan, Pennsylvania, Wisconsin, Alabama, Minnesota, Arkansas, Louisiana, New York, Arizona, Nevada, Mississippi, and Colorado, among others.', 'Mill Valley, CA, United States', 536);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAPB', 'STOCK', 'GraniteShares 2x Long AAPL Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change of the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund will aim to primarily obtain its notional exposure against the underlying stock through swap agreements. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALE', 'STOCK', 'ALLETE, Inc.', 'NYQ', 'Utilities', 'Utilities - Diversified', 'ALLETE, Inc. is an energy company. The Company''s segments include Regulated Operations, ALLETE Clean Energy, New Energy and Corporate and Other. The Regulated Operations segment includes its regulated utilities, Minnesota Power and Superior Water, Light and Power Company, as well as its investment in American Transmission Company LLC, a Wisconsin-based regulated utility that owns and maintains electric transmission assets in portions of Wisconsin, Michigan, Minnesota and Illinois. The ALLETE Clean Energy segment is focused on developing, acquiring, and operating clean and renewable energy projects. The New Energy segment is a renewable energy company with a primary focus on developing solar and energy storage facilities for external sale and internal ownership while also offering comprehensive operations, maintenance and asset management services. The Corporate and Other segment is comprised of its investment in Nobles 2, South Shore Energy, BNI Energy, ALLETE Properties and others.', 'Duluth, MN, United States', 1610);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCT', 'STOCK', 'Invesco BulletShares 2029 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2029 (collectively, "2029 Bonds").', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFAM', 'STOCK', 'Bright Horizons Family Solutions Inc.', 'NYQ', 'Consumer Cyclical', 'Personal Services', 'Bright Horizons Family Solutions Inc. is a provider of early education and childcare, back-up care, and workforce education services. It partners with employers to support workforces by providing services that help working families and employees thrive personally and professionally. Its segments include full service center-based child care, back-up care, and educational advisory services. The full service center-based child care segment includes the traditional center-based early education and child care, preschool, and elementary education. Its back-up care segment consists of center-based back-up child care, in-home care for children and seniors, school-age programs, pet care, self-sourced reimbursed care, and Sittercity, an online marketplace for families and caregivers. Its educational advisory services segment consists of tuition assistance and student loan repayment program management, workforce education, related educational advising, and college admissions counseling services.', 'Newton, MA, United States', 32050);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARLP', 'STOCK', 'Alliance Resource Partners, L.P.', 'NMS', 'Energy', 'Thermal Coal', 'Alliance Resource Partners, L.P., a diversified natural resource company, engages in the production and marketing of coal to utilities and industrial users in the United States. The company operates through four segments: Illinois Basin Coal Operations, Appalachia Coal Operations, Oil & Gas Royalties, and Coal Royalties. It produces produce bituminous coal from its underground mines sold to electric power generation and the steel production customers. The company operates seven underground mining complexes in Illinois, Indiana, Kentucky, Maryland, Pennsylvania, and West Virginia. In addition, it owns and leases oil and gas mineral interests and equity interests; and leases its coal mineral reserves and resources to its mining complexes; and leases land and operates a coal loading terminal on the Ohio River at Mt. Vernon, Indiana. Further, the company offers various mining technology products and services, including data network, communication and tracking systems, mining proximity dete', 'Tulsa, OK, United States', 3653);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLT', 'STOCK', 'Allot Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'Allot Ltd is an Israel-based company engaged primarily in the software solutions for the communication sector. The Company is a provider of security solutions and network intelligence solutions for mobile, fixed and cloud service providers as well as enterprises worldwide. The Company''s solutions are deployed globally for network-based security, including mobile security, distributed denial of service (DDoS) protection and Internet of Things (IoT) security, network and application analytics, traffic control and shaping, and more. The Company delivers a unified security service for individual consumers and small and medium-sized businesses (SMBs), at home, at work and on the go, with the Allot Secure product family.', 'Hod Hasharon, , Israel', 523);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGO', 'STOCK', 'AngioDynamics, Inc.', 'NMS', 'Healthcare', 'Medical Instruments & Supplies', 'AngioDynamics, Inc. is a transformative medical technology company. The Company is focused on restoring healthy blood flow in the body''s vascular system, expanding cancer treatment options and improving quality of life for patients. It designs, manufactures, and sells a range of medical, surgical and diagnostic devices used by professional healthcare providers for vascular access, for the treatment of peripheral vascular disease and for use in oncology and surgical settings. Its devices are generally used in minimally invasive, image-guided procedures. Its segments include Med Tech and Med Device. Its product categories include oncology, venous therapies, vascular interventions, and ports. Its oncology products include Model 1500X RF Generator, IsoLoc Endorectal Balloon, Habib 4X Laparoscopic Bipolar Resection Device, Habib 4X Bipolar Resection Device, and Alatus. Its venous therapies include VenaCure EVLT 1470 Pro Laser, VenaCure EVLT System, VenaCure EVLT Procedure Packs, and others', 'Latham, NY, United States', 675);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAL', 'STOCK', 'Caleres, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Caleres, Inc. is a global footwear company. The Company operates retail shoe stores and e-commerce websites, and designs, develops, sources, manufactures and distributes footwear for people of all ages. The Company operates through two segments: Famous Footwear and Brand Portfolio. The Famous Footwear segment consists of its Famous Footwear retail stores, famousfootwear.com and famousfootwear.ca. The Famous Footwear segment operates over 846 stores selling primarily branded footwear for the entire family. The Brand Portfolio segment includes its wholesale operations that designs, develops, sources, manufactures, markets and distributes branded, licensed and private-label footwear primarily to online retailers, national chains, department stores, independent retailers and mass merchandisers, as well as Company-owned Famous Footwear, Sam Edelman, Naturalizer and Allen Edmonds stores and e-commerce businesses. The Brand Portfolio segment operates over 114 branded retail stores.', 'Saint Louis, MO, United States', 4800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OZK', 'STOCK', 'Bank OZK', 'NMS', 'Financial Services', 'Banks - Regional', 'Bank OZK (the Bank) is a regional bank that provides a range of financial solutions. The Bank offers a range of products, including checking, savings, loans, mortgages, treasury management, merchant services, trust and estate services, wealth, and credit cards, among others. Its savings products include certificates of deposit, money market accounts, and individual retirement accounts. Its personal lending options include home equity lines of credit, personal lines of credit and auto loans. It offers both a fixed-rate mortgage and an adjustable-rate mortgage. Its online banking enables users to manage their accounts, pay bills, transfer funds, view electronic account statements and others. The Bank also provides individual consultation, financial planning, trust, and investment management services. The Bank conducts banking operations through approximately 240 offices in eight states, including Arkansas, Georgia, Florida, North Carolina, Texas, New York, California, and Mississippi.', 'Little Rock, AR, United States', 3205);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBA', 'STOCK', 'Ambarella, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Ambarella, Inc. É um desenvolvedor de semicondutores de sistema em chip (SoC) de baixa potência que fornecem processamento de inteligência artificial, processamento de sinal de imagem e compressão de vídeo. A empresa atende a aplicativos de visualização humana com processadores de vídeo e imagem para aplicações corporativas, de infraestrutura pública e domésticas, como protocolo de Internet, câmeras de segurança, câmeras esportivas, wearables, drones aéreos, etc. e gravadores de vídeo automotivos pós-venda. Ele está focado na criação de tecnologia de IA que permite que os dispositivos EDGE percebam visualmente o ambiente e tomem decisões com base nos dados coletados de câmeras e outros tipos de sensores. Sua arquitetura CVflow suporta uma variedade de algoritmos de visão computacional, incluindo deteção de objetos, classificação e rastreamento, segmentação semântica e de instâncias, processamento de imagens, deteção de objetos estéreo, mapeamento de terreno e reconhecimento de faces. S', 'Santa Clara, CA, United States', 941);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AOD', 'STOCK', 'Abrdn Total Dynamic Dividend Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Abrdn Total Dynamic Dividend Fund is a closed-ended equity mutual fund launched and managed by Alpine Woods Capital Investors, LLC. The fund invests in the public equity markets across the globe. It seeks to invest in stocks of companies across diversified sectors. The fund invests in growth and value stocks of companies across all market capitalizations. It employs fundamental analysis with a combination of bottom-up and top-down stock picking approach with a focus on factors like special dividends and dividend capture rotation to create its portfolio. The fund benchmarks the performance of its portfolio against the S&P 500 TR Index, MSCI ACWI Index, and MSCI AC World Daily TR Ex Japan (Gross Div) Index. It conducts in-house research to make its investments. Abrdn Total Dynamic Dividend Fund was formed on October 27, 2006 and is domiciled in the United States.', 'Edinburgh, , United Kingdom', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GSHD', 'STOCK', 'Goosehead Insurance, Inc', 'NMS', 'Financial Services', 'Insurance Brokers', 'Goosehead Insurance, Inc. is an independent personal lines insurance agency. The Company is engaged in distributing personal line policies throughout the United States. It offers Digital Agent, an online quoting platform, that allows clients to shop their home and auto insurance rates with top carriers. The Digital Agent combines millions of data points, which includes its quoting data over hundreds of thousands of transactions, to bring clients actual quotes specific to their needs. Clients can then bind these quotes through a short call with one of its local licensed agents with expertise in the client''s specific market. It distributes insurance policies for a range of primarily personal lines of business, including homeowners insurance, automotive, dwelling property insurance, flood, wind and earthquake insurance, excess liability or umbrella insurance, specialty lines insurance (motorcycle, recreational vehicle, and other insurance), commercial lines insurance and life insurance.', 'Westlake, TX, United States', 1580);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELME', 'STOCK', 'Elme Communities', 'NYQ', 'Real Estate', 'REIT - Residential', 'Elme Communities is a multifamily real estate investment trust. The Company operates in a single reportable segment which includes the ownership, development, redevelopment and acquisition of apartment communities. It owns and operates approximately 9,400 apartment homes in the Washington, DC metro and the Atlanta metro regions, and owns approximately 300,000 square feet of commercial space. The Company''s properties include Elme Alexandria, Cascade at Landmark, Clayborne, Riverside Apartments, Bennett Park, Park Adams, The Maxwell, The Paramount, The Wellington, Trove, Roosevelt Towers, Elme Dulles, Elme Herndon, The Ashby at McLean, Kenmore Apartments, Elme Watkins Mill, Elme Germantown, Elme Eagles Landing, Elme Druid Hills, Watergate 600, among others.', 'Bethesda, MD, United States', 255);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNA', 'STOCK', 'CNA Financial Corporation', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'CNA Financial Corporation is an insurance holding company. The Companys segments include Specialty, Commercial, International, Life & Group and Corporate & Other. The Specialty segment provides management and professional liability and other coverages through property and casualty products and services using a network of brokers, independent agencies and managing general underwriters. The Commercial segment works with a network of brokers and independent agents to market a range of property and casualty insurance products to all types of insureds, targeting small business, construction, middle markets and other commercial customers. The International segment underwrites property and casualty coverage on a global basis through a branch operation in Canada, a European business consisting of insurance companies based in the United Kingdom and Luxembourg and Hardy, its Lloyd''s syndicate. The Life & Group segment includes the results of its long-term care business that is in run-off.', 'Chicago, IL, United States', 6500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLX', 'STOCK', 'Atlas Lithium Corporation', 'NCM', 'Basic Materials', 'Other Industrial Metals & Mining', 'Atlas Lithium Corporation is a mineral exploration company with exploration projects for strategic minerals in Brazil. The Companys properties encompass approximately 539 square kilometers for lithium, as well as mineral rights for nickel, rare earths, titanium and graphite. It also owns multiple mining concessions for gold, diamond, and industrial sand. The Company is advancing to produce its wholly owned hard-rock lithium Neves Project located in the state of Minas Gerais, Brazil. It also holds an approximate 32% ownership stake in Atlas Critical Minerals Corporation, a diversified mining company with significant mineral rights in rare earths, copper, graphite, nickel, iron ore, gold, and quartzite. Its Minas Gerais Lithium Project is its largest endeavor and consists of about 85 mineral rights totaling approximately 468 square kilometers. The Companys Northeastern Brazil Lithium Project encompasses seven mineral rights spread over approximately 71 square kilometers.', 'Belo Horizonte, MG, Brazil', 70);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASC', 'STOCK', 'Ardmore Shipping Corporation', 'NYQ', 'Industrials', 'Marine Shipping', 'Ardmore Shipping Corporation is engaged in the ownership and operation of product and chemical tankers in worldwide trade. The Company operates through one segment, which is transportation of refined petroleum products and chemicals. The Company provides seaborne transportation of petroleum products and chemicals worldwide to oil majors, national oil companies, oil and chemical traders, and chemical companies, with its fleet of mid-size product and chemical tankers. It provides shipping services to customers through voyage charters, time charters, and commercial pools. It has the global network to support its seafarers and deliver shipping services to its customers. Its vessels include Ardmore Seafarer, Ardmore Exporter, Ardmore Explorer, Ardmore Enterprise, Ardmore Engineer, Ardmore Endurance, Ardmore Endeavour, Ardmore Encounter, Ardmore Seahawk, Ardmore Seavanguard, Ardmore Seavantage, Ardmore Seaventure, Ardmore Chippewa, Ardmore Chinook, and Ardmore Seavaliant, among others.', 'Hamilton, , Bermuda', 56);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('JUNS', 'STOCK', 'Jupiter Neurosciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Jupiter Neurosciences, Inc. is a clinical-stage research and development pharmaceutical company. The Company has developed a resveratrol platform product targeting the treatment of neuro-inflammation. Its product, JOTROL, has many potential indications of use for rare diseases, which primarily targets Mucopolysaccharidoses Type 1, Friedreich''s Ataxia, and Mitochondrial Encephalopathy, Lactic Acidosis, and Stroke-like episodes (MELAS). In the larger disease areas, it primarily targets Parkinsons Disease and Mild Cognitive Impairment/early Alzheimers disease. The Company has designated the different indications with project numbers, JNS101 - JNS115. JOTROL is a micellar non-aqueous solution of resveratrol delivered in a soft gel capsule. Each capsule includes 100mg of resveratrol. It has a worldwide license from Aquanova AG, the patent holder of micellar technologies, to develop, manufacture, distribute and sell JOTROL.', 'Jupiter, FL, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EWTX', 'STOCK', 'Edgewise Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Edgewise Therapeutics, Inc. is a muscle disease biopharmaceutical company developing novel therapeutics for muscular dystrophies and serious cardiac conditions. The Companys lead product candidate, sevasemten (EDG-5506), is an orally administered skeletal myosin inhibitor in late-stage clinical trials in Becker and Duchenne muscular dystrophies. Its EDG-7500 is a novel cardiac sarcomere modulator for the treatment of hypertrophic cardiomyopathy and other diseases of diastolic dysfunction, which is in Phase II clinical development. The Company is using its proprietary drug discovery platform to develop a pipeline of precision medicine product candidates that target key muscle proteins and modulators to address a broad array of serious muscle disorders. Its platform utilizes custom-built high throughput and translatable systems that measure integrated muscle function in whole organ extracts to identify small molecule precision medicines regulating key proteins in muscle tissue.', 'Boulder, CO, United States', 126);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRS', 'STOCK', 'Carpenter Technology Corporation', 'NYQ', 'Industrials', 'Metal Fabrication', 'Carpenter Technology Corporation is engaged in the manufacturing, fabrication and distribution of specialty metals. The Company operates in two segments: Specialty Alloys Operations (SAO) and Performance Engineered Products (PEP). The SAO segment comprises its premium alloy and stainless-steel manufacturing operations. This includes operations performed at mills primarily in Reading and Latrobe, Pennsylvania and surrounding areas, as well as South Carolina and Alabama. The PEP segment comprises its differentiated operations. This segment includes the Dynamet titanium business, the Carpenter Additive business and the Latrobe and Mexico distribution businesses. It provides specialty alloy-based materials and process solutions for critical applications in the aerospace, defense, medical, transportation, energy, industrial and consumer markets. The Company operates its own network of service and distribution centers, located in the United States, Canada, Mexico, Europe and Asia.', 'Philadelphia, PA, United States', 4500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EE', 'STOCK', 'Excelerate Energy, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Excelerate Energy, Inc. is a liquefied natural gas (LNG) company. The Company offers a full range of flexible regasification services from floating storage and regasification units (FSRUs) to infrastructure development, to LNG and natural gas supply. The Company operates a fleet of ten purpose-built FSRUs, have completed more than 2,700 ship-to-ship (STS) transfers of LNG with over 50 LNG operators and delivered more than 6,600 billion cubic feet of natural gas through 16 LNG regasification terminals. In addition to standard LNG carrier functionality, its purpose-built FSRUs have the onboard capability to vaporize LNG and deliver natural gas through specially designed offshore and near-shore receiving facilities. Its business spans the globe, with regional offices in approximately 10 countries and operations in the Argentina, Bangladesh, Brazil, Finland, Pakistan, the United Arab Emirates (UAE), and the United States.', 'The Woodlands, TX, United States', 919);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLPT', 'STOCK', 'ClearPoint Neuro, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'ClearPoint Neuro, Inc. is a device, cell, and gene therapy-enabling company offering precise navigation to the brain and spine. The Company provides both clinical products as well as pre-clinical development services for controlled drug and device delivery. Its flagship product is the ClearPoint Neuro Navigation System. The Company is engaged with healthcare and research centers in North America, Europe, Asia, and South America. Its primary medical device product, the ClearPoint system, is an integrated system comprised of hardware components, disposable components, and intuitive, menu-driven software. Its ClearPoint Prism Neuro Laser Therapy System is indicated for use to necrotize or coagulate soft tissue through interstitial irradiation or thermal therapy for neuro applications under 3.0T magnetic resonance imaging (MRI) guidance. The Company also provides solutions for direct CNS delivery of therapeutics in preclinical studies and clinical trials worldwide.', 'Solana Beach, CA, United States', 115);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CON', 'STOCK', 'Concentra Group Holdings Parent, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Concentra Group Holdings Parent, Inc. is a provider of occupational health services in the United States. It delivers an extensive suite of services, including occupational and consumer health services and other direct-to-employer care, to more than 50,000 patients each day, on average, from about 620 occupational health centers in 41 states and 160 onsite health clinics at employer worksites in 36 states. Its Occupational Health Centers segment encompasses the services it delivers at its occupational health center facilities across the United States. Its Onsite Health Clinics segment delivers occupational health services and/or employer-sponsored primary care services at an employers workplace, including mobile health services and episodic specialty testing services. Its Other Businesses segment comprises several complementary services to its core occupational health services offering and includes Concentra Telemed, Concentra Pharmacy and Concentra Medical Compliance Administration.', 'Addison, TX, United States', 8758);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APYX', 'STOCK', 'Apyx Medical Corporation', 'NMS', 'Healthcare', 'Medical Devices', 'Apyx Medical Corporation is an advanced energy technology company. The Company''s segments include Advanced Energy and Original Equipment Manufacturer (OEM). The Advanced Energy segment''s product portfolio consists of Helium Plasma Technology, which is marketed and sold as Renuvion in the cosmetic surgery market, and J-Plasma in the hospital surgical market. It focuses on the cosmetic surgery market, where Renuvion offers plastic surgeons, facial plastic surgeons and cosmetic physicians the ability to provide controlled heat to the tissue to achieve their desired results. These product lines consist of a multifunction generator, a handpiece and a supply of helium gas. Through OEM agreements, the OEM segment produces generators, medical devices, and related accessories for medical device manufacturers as well as start-up businesses in need of its energy-based designs. It specializes in the design, development, and manufacturing of electrosurgical equipment and medical devices.', 'Clearwater, FL, United States', 220);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATEN', 'STOCK', 'A10 Networks, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'A10 Networks, Inc. provides security and infrastructure solutions for on-premises, hybrid cloud, and edge-cloud environments. Its product portfolio seeks to address many of the cyber protection challenges and solution requirements. Its security solutions include App & API Security, DNS Security and Secure Web Gateway. Its infrastructure solutions include public cloud, private cloud and broadband growth. Its solutions are available in a variety of form factors, such as optimized hardware appliances, bare metal software, containerized software, virtual appliances and cloud-native software. Its solutions serve various industries including healthcare, higher education, financial services and telecommunications & service providers. Its products include A10 Defend, A10 Infrastructure and centralized management & analytics (A10 Control). It offers TX Protect Web application and API protection solution. Its intelligent management and automation tools include Harmony Controller and aGalaxy TPS.', 'San Jose, CA, United States', 481);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EME', 'STOCK', 'EMCOR Group, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'EMCOR Group, Inc. is a specialty contractor. The Company provides mechanical and electrical construction services, industrial and energy infrastructure and building services. Its services are provided to a range of commercial, technology, manufacturing, industrial, healthcare, utility, and institutional customers through approximately 100 operating subsidiaries. Such operating subsidiaries are organized into the various reportable segments, including United States electrical construction and facilities services, United States mechanical construction and facilities services, United States building services, United States industrial services, and United Kingdom building services. Its electrical and mechanical construction services primarily involve the design, integration, installation, start-up, operation and maintenance, and provision of services relating to roadway and transit lighting and signaling and fiber optic lines, and fire protection and suppression systems.', 'Norwalk, CT, United States', 40400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATXG', 'STOCK', 'Addentax Group Corp.', 'NCM', 'Industrials', 'Integrated Freight & Logistics', 'Addentax Group Corp is a China-based holding company principally engaged in the manufacture of garment and provision of logistic services. The Company operates through four main segments. Garment Manufacturing Business segment is engaged in the production of garment and sales of garment to wholesalers. Logistic Business segment is involved in the provision of delivery and courier services covering approximately 79 cities and two municipalities in China. Property Management and Subleasing business segment provides shops subleasing and property services for garment wholesalers and retailers. Epidemic Prevention Supplies Business segment is involved in manufacturing and distribution of epidemic prevention products and resale of epidemic prevention supplies. The Company is also outsourcing some of the businesses to contractors.', 'Shenzhen, , China', 112);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQ', 'STOCK', 'Equillium, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Equillium, Inc. is a clinical-stage biotechnology company. It is engaged in developing novel therapeutics to treat severe autoimmune and inflammatory disorders with high unmet medical need. The Companys pipeline consists of immunomodulatory assets and a product platform targeting immuno-inflammatory pathways. Its EQ302 is a selective bi-specific cytokine inhibitor targeting IL-15 and IL-21. EQ101 is a clinical-stage, selective, tri-specific inhibitor of IL-2, IL-9 and IL-15, which are key disease-driving, clinically validated cytokine targets to address unmet needs across a range of immuno-inflammatory indications. Its multi-cytokine platform generates rationally designed composite peptides that selectively block key cytokines at the shared receptor level, targeting pathogenic cytokine redundancies and synergies. The Itolizumab is a monoclonal antibody that targets the CD6-ALCAM signaling pathway, which plays a central role in the modulation of effector T cells.', 'La Jolla, CA, United States', 35);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ZJYL', 'STOCK', 'Jin Medical International Ltd.', 'NCM', 'Healthcare', 'Medical Instruments & Supplies', 'Jin Medical International Ltd is a holding company mainly engaged in the design and manufacturing of wheelchairs. The Company, through its wholly owned subsidiaries, is primarily engaged in the design, development, manufacturing and sales of wheelchair and other living aids products to be used by people with disabilities or impaired mobility. The Company''s wheelchair product category includes mid, high and low-end wheelchairs. The wheelchair components include wheels and brakes, which are sold to customers for after-sales service. The living aids product category consists of oxygen concentrators, bath aids and rehabilitative devices. The Company mainly distributes its products in domestic and overseas markets.', 'Changzhou, , China', 269);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AREB', 'STOCK', 'American Rebel Holdings, Inc.', 'NCM', 'Consumer Cyclical', 'Footwear & Accessories', 'American Rebel Holdings, Inc. operates primarily as a designer, manufacturer and marketer of branded safes and personal security and self-defense products. Additionally, the Company designs and produces branded apparel and accessories. In addition to branded safes, it offers an assortment of personal security products as well as apparel and accessories for men and women under the Companys American Rebel brand. The Companys safes and personal security products are constructed primarily of United States-made steel. Its products are designed to safely store firearms, as well as store its customers priceless keepsakes, family heirlooms and treasured memories and other valuables. It produces large floor safes in a variety of sizes as well as small portable keyed safes. It sells its products online to individuals desiring home, personal and office protection, as well as to recreational shooters and hunters. Its gun safes include Constitution 25 Gun Safe and Constitution 40 Gun Safe.', 'Brentwood, TN, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEA', 'STOCK', 'Easterly Government Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'Easterly Government Properties, Inc. is an internally managed real estate investment trust (REIT). It is focused primarily on the acquisition, development and management of Class A commercial properties that are leased to United States government agencies that serve essential functions. It leases its properties to such agencies either directly or through the United States General Services Administration (GSA). The operations of the Company are carried out primarily through Easterly Government Properties, LP (the Operating Partnership) and the wholly owned subsidiaries of the Operating Partnership. The Company owns, directly or through the joint venture, 102 properties totaling 10.2 million square feet. Its properties include VA - Loma Linda, JSC - Suffolk, Various GSA - Chicago, IRS - Fresno, FBI - Salt Lake, VA - San Jose, EPA - Lenexa, FBI - Tampa, FBI - San Antonio, FDA - Alameda, PTO - Arlington, FBI - Omaha, TREAS - Parkersburg, FDA - Lenexa, VA - South Bend, and DHS - Burlington.', 'Washington, DC, United States', 50);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('API', 'STOCK', 'Agora, Inc.', 'NMS', 'Technology', 'Software - Application', 'Agora Inc. is a holding company of two independent divisions, under the Agora brand and Shengwang brand, whose businesses are conducted through separate entities. Agora provides Real-Time Engagement Platform-as-a-Service (PaaS) that operates in the United States, as well as other international markets outside the United States and China. Shengwang provides Real-Time Engagement PaaS in the China market. The Company provides developers with customizable and compatible application programming interfaces (APIs), to embed real-time voice, video, interactive live-streaming, chat, whiteboard, and artificial intelligence capabilities into their applications without the need to develop the technology or build the underlying infrastructure themselves. The real-time data transmission is handled by the Companys Software-Defined Real-Time Network (SD-RTN), which is a virtual network overlay on top of the public Internet.', 'Santa Clara, CA, United States', 608);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FLGT', 'STOCK', 'Fulgent Genetics, Inc.', 'NGM', 'Healthcare', 'Diagnostics & Research', 'Fulgent Genetics, Inc. is a technology-based company with a laboratory services business and a therapeutic development business. Its laboratory services business includes technical laboratory and testing services and professional interpretation of laboratory results by licensed physicians. Its therapeutic development business is focused on developing drug candidates for treating a range of cancers using a novel nanoencapsulation and targeted therapy platform designed to improve the therapeutic window and pharmacokinetic profile of new and existing cancer drugs. Its testing services include comprehensive anatomic pathology testing services, including gastrointestinal pathology, dermatopathology, urologic pathology, breast pathology, neuropathology, and hematopathology, and precision diagnostics testing services, including next-generation sequencing (NGS), tests for biopharma research and clinical tests for rare disease, hereditary cancer, reproductive health, and many other diseases.', 'El Monte, CA, United States', 1313);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGP', 'STOCK', 'EastGroup Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'EastGroup Properties, Inc. is an internally managed equity real estate investment trust (REIT). The Company is focused on the development, acquisition, and operation of industrial properties in Sunbelt markets throughout the United States, primarily in the states of Florida, Texas, Arizona, California, and North Carolina. The Company owns approximately 563 industrial properties in 12 states. The Companys portfolio includes development projects and value-added properties under lease-up and construction, including approximately 63.1 million square feet consisting of 497 business distribution properties containing 57.8 million square feet, 17 bulk distribution properties containing 4.4 million square feet, and 22 business service properties containing 900,000 square feet. The Companys properties are Riverpoint Industrial Park, Akimel Gateway, Waterford Distribution Center, Chestnut Business Center, and others.', 'Ridgeland, MS, United States', 101);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OLB', 'STOCK', 'The OLB Group, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'The OLB Group, Inc. is a fintech company that focuses on a suite of products in the merchant services marketplace and seeks to provide integrated business solutions to merchants throughout the United States. It seeks to provide merchants with a range of products and services through its various online platforms, including financial and transaction processing services. Its business functions through three subsidiaries: eVance, Inc. (eVance), OmniSoft.io, Inc. (OmniSoft), and CrowdPay.Us, Inc. (CrowdPay). OmniSoft operates a cloud-based business management platform that provides turnkey solutions for merchants to enable them to build and manage their retail businesses. eVance provides competitive payment processing solutions to merchants, which enable merchants to process credit and debit card-based Internet payments for sales of their products. CrowdPay operates a white-label capital-raising platform that targets small and midsized businesses seeking to raise capital.', 'New York, NY, United States', 15);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARIS', 'STOCK', 'Aris Water Solutions, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Water', 'Aris Water Solutions, Inc. is an environmental infrastructure and solutions company. The Company helps customers reduce their water and carbon footprints. It delivers full-cycle water handling and recycling solutions for energy operations. Its integrated pipelines and related infrastructure create produced water management, recycling, and supply solutions for operators in the core areas of the Permian Basin. The Company manages its business through a single operating segment comprising two primary revenue streams: Produced Water Handling and Water Solutions. The Produced Water Handling business gathers, transports and, unless recycled, handles produced water generated from oil and natural gas production. The Water Solutions business develops and operates recycling facilities to treat, store and recycle produced water. The Company also supplements its recycled produced water with non-potable groundwater to meet the demands of its customers'' operations.', 'Houston, TX, United States', 276);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FALN', 'STOCK', 'iShares Fallen Angels USD Bond ETF', 'NGM', NULL, NULL, 'The fund will invest at least 80% of its assets in the component securities of the underlying index, and the fund will invest at least 90% of its assets in fixed income securities of the types included in the underlying index. The index is designed to reflect the performance of U.S. dollar denominated, high yield corporate bonds that were previously rated investment grade.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSBR', 'STOCK', 'Banco Santander (Brasil) S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'O Banco Santander Brasil SA é um banco brasileiro. O Banco atua através de dois segmentos: Varejo e Atacado. O segmento Varejo presta serviços financeiros a particulares, bem como a pequenas e médias empresas. O segmento de Atacado concentra-se em grandes corporações e mercados de capitais. Juntamente com as suas subsidiárias, o Banco oferece uma gama de serviços financeiros, incluindo serviços bancários de consumo, comercial e de investimento, empréstimos e financiamentos, empréstimos hipotecários, leasing, operações de cartão de crédito e câmbio. O Banco também está envolvido nas operações de gestão de ativos, capitalização, corretagem de valores mobiliários, corretagem de seguros e planos de pensões. A Companhia possui diversas subsidiárias, como Santander Corretora de Cambio e Valores Mobiliarios SA, Banco Bandepe SA e Sancap Investimentos e Participações SA, entre outras.', 'São Paulo, SP, Brazil', 53918);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LPAA', 'STOCK', 'Launch One Acquisition Corp.', 'NGM', 'Financial Services', 'Shell Companies', 'Launch One Acquisition Corp. is a blank check company. The Company is formed for the purpose of effecting a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses. It has not selected any business combination target and the Company has not, nor has anyone on its behalf, engaged in any substantive discussions, directly or indirectly, with any business combination target. It has no operations nor generated any revenues.', 'Oakland, CA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHMI', 'STOCK', 'Cherry Hill Mortgage Investment Corporation', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Cherry Hill Mortgage Investment Corporation is a real estate finance company. The Company is focused on acquiring, investing in, and managing residential mortgage assets in the United States. Its segments include investments in residential mortgage-backed securities (RMBS), investments in Servicing Related Assets, and All Other. The Companys principal objective is to generate yields and risk-adjusted total returns for its stockholders over the long term, primarily through dividend distributions and secondarily through capital appreciation. The Company focuses on attaining this objective by selectively constructing and actively managing a portfolio of servicing-related assets and RMBS. The Company may also invest in other cash -lowing residential mortgage assets. It is externally managed by Cherry Hill Mortgage Management, LLC.', 'Tinton Falls, NJ, United States', 12);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EARN', 'STOCK', 'Ellington Credit Company', 'NYQ', 'Financial Services', 'Asset Management', 'Ellington Credit Company is a non-diversified closed-end fund. The Company is focused on acquiring, investing in, and managing secondary collateralized loan obligations (CLO) mezzanine debt and equity tranches. It is specialized in acquiring, investing in, and managing residential mortgage- and real estate-related assets. The Company''s primary objective is to generate attractive risk-adjusted total returns for its shareholders by making investments in multiple parts of the CLO capital structure, including mezzanine debt and equity tranches. Additionally, it may also invest in CLO loan accumulation facilities, which are entities that acquire corporate loans and other similar corporate credit-related assets in anticipation of ultimately collateralizing a CLO transaction, as well as other related assets. It is externally managed and advised by Ellington Credit Company Management LLC.', 'Old Greenwich, CT, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMDG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long AMD Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OSRH', 'STOCK', 'OSR Holdings, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'OSR Holdings, Inc. is a global healthcare company, dedicated to advancing healthcare outcomes and improving the quality of life for people and their families. The Company is focused on building and developing a portfolio of transformative therapies and healthcare solutions. The Company''s operating businesses (through its three wholly owned subsidiaries) include developing oral immunotherapies for the treatment of cancer, developing design-augmented biologics for age-related and other degenerative diseases and neurovascular intervention medical device and systems distribution in Korea. The Companys subsidiary, Vaximms flagship asset, VXM01, is a late clinical-stage (NCT037500701) immuno-oncology candidate for glioblastoma. Vaximm has three clinical and pre-clinical drug candidates targeting diseases ranging from glioblastoma to gastrointestinal stromal tumor to ocular diseases. The Company has operations in Europe and South Korea.', 'Bellevue, WA, United States', 19);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKH', 'STOCK', 'Black Hills Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Black Hills Corporation is a customer-focused, growth-oriented utility company. It serves 1.35 million natural gas and electric utility customers in eight states: Arkansas, Colorado, Iowa, Kansas, Montana, Nebraska, South Dakota and Wyoming. Its segments include Electric Utilities and Gas Utilities. Its Electric Utilities segment generates, transmits and distributes electricity to approximately 225,000 electric utility customers in Colorado, Montana, South Dakota, and Wyoming. Its Electric Utilities own 1,394 megawatts of generation and 9,196 miles of electric transmission and distribution lines. Its Gas Utilities segment serves over 1,128,000 natural gas utility customers in Arkansas, Colorado, Iowa, Kansas, Nebraska, and Wyoming. Its Gas Utilities own and operate 4,648 miles of intrastate gas transmission pipelines and 44,524 miles of gas distribution mains and service lines, seven natural gas storage sites, over 50,000 horsepower of compression, and 516 miles of gathering lines.', 'Rapid City, SD, United States', 2841);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGBN', 'STOCK', 'Eagle Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Eagle Bancorp, Inc. is a bank holding company for EagleBank (the Bank). The Bank is a chartered commercial bank. The Company, through the Bank, conducts a full-service community banking business in Northern Virginia, Suburban Maryland and Washington, D.C. The primary financial services offered by the Bank include real estate, commercial and consumer lending, as well as traditional deposit and repurchase agreement products. The Bank offers a range of commercial banking services to its business and professional clients, as well as consumer banking services to individuals living and/or working primarily in the Banks market area. The Banks loan portfolio consists of traditional business and real estate secured loans. It operates 12 branch offices: six in Suburban Maryland, three located in the District of Columbia, and three in Northern Virginia. It also has four lending centers and utilizes various digital capabilities, including remote deposit services and mobile banking services.', 'Bethesda, MD, United States', 451);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CXW', 'STOCK', 'CoreCivic, Inc.', 'NYQ', 'Industrials', 'Security & Protection Services', 'CoreCivic, Inc. is a diversified, government-solutions company. The Company provides a range of solutions to government partners that serve the public good through corrections and detention management, a network of residential and non-residential alternatives to incarceration to help address Americas recidivism crisis, and government real estate solutions. Its CoreCivic Safety segment consists of correctional and detention facilities that are owned or controlled via a long-term lease and managed by the Company, as well as those correctional and detention facilities owned by third parties but managed by the Company. The segment also provides transportation services. CoreCivic Community segment consists of residential reentry centers that are owned or controlled via a long-term lease and managed by the Company. The segment also includes electronic monitoring and case management services. CoreCivic Properties segment consists of correctional real estate properties owned by the Company.', 'Brentwood, TN, United States', 11649);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMN', 'STOCK', 'AMN Healthcare Services, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'AMN Healthcare Services, Inc. is a provider of total talent solutions for healthcare organizations across the United States. The Company provides access to a comprehensive network of quality healthcare professionals through its recruitment strategies and breadth of career opportunities. Its segments include nurse and allied solutions, physician and leadership solutions, and technology and workforce solutions. The nurse and allied solutions segment includes its travel nurse staffing, labor disruption staffing, local staffing, international nurse permanent placement, and allied staffing businesses. The physician and leadership solutions segment includes its locum tenens staffing, healthcare interim leadership staffing, executive search, and physician permanent placement businesses. The technology and workforce solutions segment includes the Companys language services, vendor management systems (VMS), workforce optimization, and outsourced solutions businesses.', 'Dallas, TX, United States', 2968);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVDL', 'STOCK', 'Avadel Pharmaceuticals plc', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Avadel Pharmaceuticals PLC is a biopharmaceutical company. The Company''s product, LUMRYZ, is an extended-release formulation of sodium oxybate, indicated to be taken once at bedtime for the treatment of cataplexy or excessive daytime sleepiness (EDS) in adults with narcolepsy. Its approach includes applying solutions to the development of medications that address the challenges patients face with treatment options. Its drug delivery technologies include MICROPUMP, LIQUITIME, and MEDUSA. Its MICROPUMP technology allows for the development of modified-release solid, oral dosage formulations of drugs. Its LIQUITIME technology allows for the development of modified-release oral products in a liquid suspension formulation, which may make such formulations particularly suited for children and/or patients having issues swallowing tablets or capsules. Its MEDUSA technology allows for the development of modified-release injectable dosage formulations of drugs.', 'Dublin, , Ireland', 188);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLB', 'STOCK', 'Core Laboratories Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Christina Lake Cannabis Corp. is a Canada-based licensed producer of cannabis. The Company is engaged in the processing of its stock of outdoor flowers. They also process dried Cannabis biomass into various extracts, including distilled and winterized oils, kief, and additional extracted products for sale to other licensed producers. The Companys facilities consist of a 32-acre property, which includes over 950,000 square feet of outdoor grow space, offices, propagation and drying rooms, research facilities, and a facility dedicated to processing and extraction. The 342-acre property includes approximately 100-acres of licensed outdoor grow space, greenhouses, and a dryroom. The Company also owns a 99-acre plot of land adjoining its principal site. It focuses its production on creating extracts and distillates for its business-to-business (B2B) client base with proprietary strains specifically developed for outdoor cultivation to enhance extraction quality.', 'Houston, TX, United States', 3300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRW', 'STOCK', 'Saba Capital Income & Opportunities Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Saba Capital Income & Opportunities Fund is a closed-ended fixed income mutual fund launched by Voya Investment Management LLC. The fund is managed by Saba Capital Management, L.P. It invests in the fixed income markets of the United States. The fund seeks to invest in securities of companies operating across diversified sectors. It primarily invests in floating rate secured senior loans, with an emphasis on top-tier, non-investment grade senior loans. The fund seeks to invest in loans with maturities of one to ten years. It benchmarks the performance of its portfolio against the S&P/LSTA Leveraged Loan Index. The fund was formerly known as Voya Prime Rate Trust. Saba Capital Income & Opportunities Fund was formed on December 2, 1987 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('E', 'STOCK', 'Eni S.p.A.', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A Eni SpA (Eni) é uma empresa com sede na Itália que se dedica à exploração, desenvolvimento e produção de hidrocarbonetos, ao fornecimento e comercialização de gás, gás natural liquefeito (GNL) e energia, no refino e comercialização de produtos petrolíferos, na produção e comercialização de petroquímicos básicos, plásticos e elastômeros e no comércio de mercadorias. Seu segmento de Exploração e Produção se dedica à exploração de petróleo e gás natural e ao desenvolvimento e produção de campo, além de operações de GNL em mais de 40 países, incluindo Itália, Líbia, Egito, Noruega, Reino Unido, Angola, Congo, Nigéria e Estados Unidos, Cazaquistão, Argélia, Austrália, Venezuela, Iraque, Gana e Moçambique. Seu segmento de Gás e Energia atua no fornecimento, comercialização e comercialização de gás, GNL e eletricidade, atividades de transporte internacional de gás e comércio de mercadorias e derivados.', 'Rome, RM, Italy', 32356);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCOI', 'STOCK', 'Cogent Communications Holdings, Inc.', 'NMS', 'Communication Services', 'Telecom Services', 'Cogent Communications Holdings, Inc. is a facilities-based provider of Internet access, private network services, optical wavelength, and optical transport services and data center colocation space and power. The Company, through its own facilities, offers on-net Internet access services to customers located in buildings that are physically connected to its network. Its network is specifically designed and optimized to transmit packet routed data. Its on-net service consists of high-speed Internet access and private network services offered at speeds ranging from 100 megabits per second (Mbps) to 400 gigabits per second (Gbps). The Company delivers its services on its network in 56 countries across North America, Europe, South America, Oceania and Africa. Its corporate customers are located in multi-tenant office buildings (MTOBs), which include law firms, advertising and marketing firms, as well as healthcare providers, and other professional services businesses, among others.', 'Washington, DC, United States', 1916);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZUN', 'STOCK', 'Baozun Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'Baozun Inc is a holding company mainly engaged in the provision of brand e-commerce solutions. The Company focus on providing integrated brand-e-commerce solutions to their brand partners, including information technology (IT) solutions, online store operation, digital marketing, customer services, as well as warehousing and fulfillment. The Company operates under three business models: distribution model, service fee model and consignment mode, according to different needs of their brand partners. The Company provides omni-channel solutions across official brand stores, online marketplaces, such as Tmall, JD.com and Pinduoduo, and social media channels, such as WeChat Mini Programs and RED (Xiaohongshu), as well as emerging live streaming and short video platforms, such as Douyin and Kuaishou.', 'Shanghai, , China', 7650);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARG', 'STOCK', 'CarGurus, Inc.', 'NMS', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'CarGurus, Inc. (CarGurus) offers a multinational, online automotive platform for buying and selling vehicles that offer both digital retail solutions and the CarOffer digital wholesale platform. The CarGurus platform enables consumers to purchase and/or sell a vehicle either online or in-person, and it gives dealerships the power to accurately price, instantly acquire, effectively market, and quickly sell vehicles, all with a nationwide reach. It operates through two segments: U.S. Marketplace and Digital Wholesale. The U.S. Marketplace segment provides marketplace services for customers within the United States. Digital Wholesale segment provides Dealer-to-Dealer and Instant Max Cash Offer (IMCO) services and products which are sold on the CarOffer platform. The Company operates online marketplaces under the CarGurus brand in Canada and the United Kingdom. It also operates independent brands, the Autolist and PistonHeads online marketplaces in the United States and the United Kingdom.', 'Boston, MA, United States', 1282);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABUS', 'STOCK', 'Arbutus Biopharma Corporation', 'NMS', 'Healthcare', 'Biotechnology', 'Arbutus Biopharma Corporation is a clinical-stage biopharmaceutical company focused on infectious disease. The Company is developing imdusiran (AB-729), its proprietary, conjugated GalNAc, subcutaneously delivered RNAi therapeutic, and AB-101, its proprietary oral PD-L1 inhibitor, for the treatment of chronic hepatitis B (cHBV). Its HBV product pipeline includes Imdusiran and AB-101. Its pipeline includes two product candidates that target various steps in the HBV viral lifecycle and consists of various programs: RNAi therapeutic (imdusiran, AB-729) and Oral PD-L1 Inhibitor (AB-101). RNAi therapeutics utilize a natural pathway within cells to silence genes by eliminating the disease-causing proteins that they code for. PD-L1 inhibitors complement its pipeline of agents and could potentially be a part of a combination therapy for the treatment of HBV by reawakening the immune system.', 'Warminster, PA, United States', 44);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOMO', 'STOCK', 'Domo, Inc.', 'NGM', 'Technology', 'Software - Application', 'Domo, Inc. provides a cloud-based platform is an artificial intelligence (AI) and data products platform that enables processes that are dependent on business intelligence data from marketing to operations, human resources to finance, information technology to product development, and supply chain to sales. Its platform enables every type of employee to connect to, analyze, and leverage data from their smartphone. Its platform provides real-time access to quantitative and qualitative data. Through the Domo platform, data from across the business is collected, stored, prepared, organized, analyzed, visualized, automated and distributed. AI algorithms and machine learning can be applied to the data. Its platform provides real-time access to data through a flexible set of connection options, including an application programming interface and standards-based connectors that are available in the Domo Appstore, and a library of flexible universal connectors.', 'American Fork, UT, United States', 888);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYCC', 'STOCK', 'Cyclacel Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cyclacel Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing cancer medicines based on cell cycle, epigenetics and mitosis biology. Its epigenetic/anti-mitotic program is evaluating plogo, a Polo-like kinase 1 (PLK1) inhibitor, in solid tumors and hematological malignancies. PLK1 is a serine/threonine kinase with a central role in cell division, or the mitotic phase of the cell cycle, and is a regulator of the DNA damage checkpoint. The Companys plogo is a novel, small-molecule, selective and potent PLK1 inhibitor, which has demonstrated potent and selective target inhibition (PLK1 IC50 approximately 3 nM) and efficacy in human tumor xenografts at non-toxic doses. Its translational biology program supports the development of plogo in solid tumor and hematological malignancy indications. PLK1 over-expressing tumors include colorectal, esophageal, gastric, leukemia, lung, lymphoma, ovarian and squamous cell cancers.', 'Kuala Lumpur, , Malaysia', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVT', 'STOCK', 'Avnet, Inc.', 'NMS', 'Technology', 'Electronics & Computer Distribution', 'Avnet, Inc. is a global electronic component technology distributor and solutions provider. It markets, sells, and distributes electronic components from electronic component manufacturers, including semiconductors, interconnect, passive and electromechanical components, and other integrated and embedded components. Its primary operating groups include Electronic Components (EC) and Farnell. EC serves a variety of markets ranging from industrial to automotive to defense and aerospace. EC offers an array of customer support options throughout the entire product lifecycle, including turnkey and customized design, supply chain, programming, logistics and post-sales services. The Farnell operating group primarily supports lower-volume customers and distributes a portfolio of kits, tools, electronic components, industrial automation components, and test and measurement products to both engineers and entrepreneurs, through an e-commerce channel. It also distributes new product introductions.', 'Phoenix, AZ, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRMA', 'STOCK', 'Dermata Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dermata Therapeutics, Inc. is a late-stage medical dermatology company. The Company is focused on identifying, developing, and commercializing pharmaceutical product candidates for the treatment of medical and aesthetic skin conditions and diseases. Its two product candidates, XYNGARI and DMT410, both incorporate its proprietary, multifaceted, Spongilla technology to topically treat a variety of dermatological conditions. Its lead product candidate, XYNGARI, is intended to utilize its Spongilla technology for once weekly treatment of a variety of skin diseases, with its initial focus being the treatment of acne vulgaris, which has a United States market size of approximately 30 million patients seeking treatment. The Companys second product candidate, DMT410, uses its XYNGARI product candidate as a new method for needle-free intradermal delivery of botulinum toxin for the treatment of multiple aesthetic applications and medical skin diseases.', 'San Diego, CA, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKAN', 'STOCK', 'Akanda Corp.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Akanda Corp. is a United Kingdom-based company, which is focused on the growth of its Canadian farming property in British Columbia. The Company plans to develop tetrahydrocannabinol (THC) and cannabidiol (CBD) facilities.', 'Toronto, ON, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TVGN', 'STOCK', 'Tevogen Bio Holdings Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Tevogen Bio Holdings Inc. is a clinical-stage specialty immunotherapy company. The Company is harnessing CD8+ cytotoxic T lymphocytes (CD8+ CTLs), to develop off-the-shelf, genetically unmodified precision T cell therapies for the treatment of infectious diseases, cancers, and neurological disorders, aiming to address the unmet needs of patient populations. Its first product candidate, TVGN 489, has developed to fill a critical gap in COVID-19 therapeutics for the immunocompromised and the high-risk elderly, with potential applications in both treatment and prevention of chronic lingering symptoms of the disease. Its TVGN 601 is being developed for multiple sclerosis (MS), and its TVGN 930 is being developed for EBV-associated lymphomas.', 'Warren, NJ, United States', 18);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBDC', 'STOCK', 'Barings BDC, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Barings BDC, Inc. is a closed-end, non-diversified investment company. The Companys investment objective is to generate current income by investing directly in privately held middle-market companies to help these companies fund acquisitions, growth or refinancing. The Company seeks to invest primarily in senior secured loans in middle-market companies that operate across a range of industries. It invests primarily in loans that have terms of between five and seven years, and bear interest at rates ranging from the London Interbank Offered Rate (LIBOR) (or an applicable successor rate) plus 450 basis points to LIBOR plus 650 basis points per annum. Its investment capabilities include first lien debt, unitranche, second lien debt and equity co-investments. It invests in various industries, including banking, finance, insurance and real estate, business, healthcare & pharmaceuticals, and others. Its investment activities are managed by its investment adviser, Barings LLC.', 'Charlotte, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PAYC', 'STOCK', 'Paycom Software, Inc.', 'NYQ', 'Technology', 'Software - Application', 'A Paycom Software, Inc. É fornecedora de uma solução abrangente de gerenciamento de capital humano (HCM) baseada na nuvem, fornecida como software como serviço (SaaS). A empresa fornece funcionalidade e análise de dados. Sua solução não requer praticamente nenhuma personalização e é baseada em um sistema central de registro mantido em um único banco de dados para todas as funções de HCM, incluindo aquisição de talentos, gerenciamento de tempo e mão de obra, folha de pagamento, gerenciamento de talentos e aplicativos de gerenciamento de recursos humanos (RH). Suas aplicações simplificam os processos do cliente e fornecem aos clientes e seus funcionários a capacidade de acessar e gerenciar diretamente processos administrativos, incluindo aplicativos que identificam candidatos, funcionários a bordo, gerenciam tempo e mão de obra, administram deduções e benefícios de folha de pagamento, gerenciam o desempenho, encerram funcionários e administram benefícios de saúde pós-término, como COBRA.', 'Oklahoma City, OK, United States', 7306);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CREV', 'STOCK', 'Carbon Revolution Public Limited Company', 'NGM', 'Consumer Cyclical', 'Auto Parts', 'Carbon Revolution plc is a technology company and original equipment manufacturer (OEM) supplier. The Company has commercialized and industrialized the supply of lightweight carbon fiber wheels to the automotive industry. The Company has progressed from single prototypes to designing and manufacturing lightweight wheels for cars and SUVs in the high performance, premium and luxury segments, for the automotive brands. It is focused on creating an advanced technology business that supplies its lightweight wheel technology to automotive manufacturers around the world. Its lightweight technology provides unparalleled improvements in performance, efficiency and handling, which translates to better drivability, fuel efficiency, range extension and reduction in lap times. Its applications include automotive, OEM, electric vehicles, aerospace, motorsport, and heavy vehicles. The Company is the parent of Carbon Revolution Pty Ltd.', 'Dublin, , Ireland', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIPC', 'STOCK', 'Brookfield Infrastructure Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Brookfield Infrastructure Corporation is a global infrastructure company. It owns and operates assets in the utilities, transport, midstream and data sectors across the Americas, Asia Pacific and Europe. Its operations include a United Kingdom-regulated distribution operation, a Brazilian regulated gas transmission operation and a global intermodal logistics operation. Its regulated gas transmission operation in Brazil operates over 2,000 kilometers of natural gas transportation pipelines in the states of Rio de Janeiro, Sao Paulo and Minas Gerais. Its regulated distribution operation is the independent last-mile, multi-utility connection provider, with approximately 4.5 million connections. Its global intermodal logistics operation is the lessor of intermodal containers with a fleet of four million containers representing seven million twenty-foot equivalent units. Operations include the acquisition, leasing, re-leasing, and subsequent sale of multiple types of intermodal containers.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DENN', 'STOCK', 'Denny''s Corporation', 'NCM', 'Consumer Cyclical', 'Restaurants', 'Denny''s Corporation is a franchised full-service restaurant chain. The Company owns and operates the Dennys brand (Dennys) and the Kekes Breakfast Cafe brand (Kekes). It operates in two segments: Dennys and Kekes. It has approximately 1,568 restaurants, 1,493 of which were franchised/licensed restaurants and 75 of which were Company-operated. The Dennys brand consists of over 1,499 franchised, licensed and company restaurants around the world, including 1,334 restaurants in the United States and 165 international restaurant locations. Dennys offers a wide selection of lunch and dinner items, including entrees, burgers, sandwiches and salads, along with an assortment of appetizers and desserts. It has four dayparts, breakfast, lunch, dinner and late night. Kekes is a daytime eatery dedicated to providing a breakfast experience. Kekes brand consists of over 69 franchised and company restaurants in the United States. Kekes also serves burgers, paninis, salads, and sandwiches.', 'Spartanburg, SC, United States', 3800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADTX', 'STOCK', 'Aditxt, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Aditxt, Inc. is a social innovation platform dedicated to accelerating promising health innovations. It develops and commercializes technologies with a focus on monitoring and modulating the immune system. Its portfolio includes Adimune, Inc., developing a new class of therapeutics designed to retrain the immune system to address organ rejection, autoimmunity, and allergies; Adivir, Inc., focused on identifying, developing, and commercializing new ways to treat infectious diseases, and Pearsanta, Inc., offering personalized lab testing, backed by CLIA-certified and CAP-accredited monitoring center. Adimune, Inc''s immune modulation product candidate, ADI-100, is based on the Apoptotic DNA Immunotherapy platform technology, utilizes a novel approach that mimics the way bodies naturally induce tolerance to own tissues. It also offers electroencephalography (EEG) brain monitoring technologies and devices, including NeuroCap and NeuroEEG for telehealth and tele-neurology applications.', 'Mountain View, CA, United States', 26);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNTH', 'STOCK', 'Dianthus Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dianthus Therapeutics, Inc. is a clinical-stage biotechnology company engaged in designing and delivering monoclonal antibodies with improved selectivity and potency. The Company is focused on developing complement therapeutics for patients living with severe autoimmune and inflammatory diseases. Its advanced product candidate, DNTH103, is a clinical-stage, highly potent, selective and fully human monoclonal immunoglobulin G4 with picomolar binding affinity that is designed to selectively bind only to the active form of C1s. DNTH103 is engineered with YTE half-life extension technology, a specific three amino acid change in the Fc domain, and has a pharmacokinetic (PK) profile designed to support less frequent, lower dose, self-administration as a convenient S.C. injection. It is conducting three mid- to late-stage clinical trials with DNTH103 in generalized Myasthenia Gravis (gMG), Chronic Inflammatory Demyelinating Polyneuropathy (CIDP), and Multifocal Motor Neuropathy (MMN).', 'New York, NY, United States', 78);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNMD', 'STOCK', 'CONMED Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'CONMED Corporation is a medical technology company, which provides devices and equipment for surgical procedures. Its products are used by surgeons and other healthcare professionals in a variety of specialties, including orthopedics, general surgery, gynecology, thoracic surgery and gastroenterology. Its product lines consist of orthopedic surgery and general surgery. Orthopedic surgery consists of sports medicine instrumentation and lower extremities instrumentation and implants, small bone, large bone and specialty-powered surgical instruments as well as imaging systems for use in minimally invasive surgical procedures and service fees related to the promotion and marketing of sports medicine allograft tissue. General surgery consists of a complete line of endo-mechanical instrumentation for minimally invasive laparoscopic and gastrointestinal procedures, smoke evacuation devices, a line of cardiac monitoring products as well as electrosurgical generators and related instruments.', 'Largo, FL, United States', 3900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVY', 'STOCK', 'Avery Dennison Corporation', 'NYQ', 'Consumer Cyclical', 'Packaging & Containers', 'A Avery Dennison Corporation é uma empresa global de soluções de ciência de materiais e identificação digital. A empresa fornece uma gama de soluções de branding e informação que otimizam a eficiência da mão-de-obra e da cadeia de fornecimento, reduzem o desperdício, promovem a sustentabilidade, a circularidade e a transparência, e conetam marcas e consumidores. Seu segmento de Grupo de Materiais fabrica e vende materiais de etiquetas sensíveis à pressão, filmes para produtos gráficos e reflexivos, fitas de desempenho e outros produtos adesivos para aplicações industriais, médicas e outras, bem como soluções de fixadores. Seu segmento Solutions Group projeta, fabrica e vende uma variedade de soluções de marca e informação, incluindo bilhetes de marca e preço, etiquetas e rótulos (incluindo inlays de identificação por radiofrequência (RFID)), e serviços relacionados, suprimentos e equipamentos. Ela atende uma variedade de indústrias em todo o mundo, incluindo cuidados domésticos e pesso', 'Mentor, OH, United States', 35000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CING', 'STOCK', 'Cingulate Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cingulate Inc. is a biopharmaceutical company. The Company is focused on the development, manufacturing, and commercialization of pharmaceutical products that utilize its precision timed release (PTR) drug delivery platform technology to create dosing schedules and drug release profiles. It focuses on the treatment of attention deficit/hyperactivity disorder (ADHD). The Company is in the development of two lead product candidates, such as CTx-1301 (dexmethylphenidate) and CTx-1302 (dextroamphetamine). The Companys CTx-1301 and CTx-1302 are being developed for the treatment of ADHD in the three core patient segments: children (ages 6-12), adolescents (ages 13-17), and adults (ages18+). In addition, the Company has a third product to treat anxiety, CTx-2103, in a formulation stage. Its CTx-1301, CTx-1302 and CTx-2103 drug candidates contain three releases of active pharmaceutical ingredient combined into one small tablet dosage form.', 'Kansas City, KS, United States', 13);\n\n-- INSERÇÃO MASSIVA EM STOCK_METRICS_SNAPSHOT\nINSERT INTO stock_metrics_snapshot (asset_id, snapshot_date, current_price, market_cap, shares_outstanding, volume_avg_30d, returns_12m, returns_24m, returns_36m, returns_5y, ten_year_return, volatility_12m, volatility_24m, volatility_36m, ten_year_volatility, sharpe_12m, sharpe_24m, sharpe_36m, ten_year_sharpe, max_drawdown, max_drawdown_12m, dividend_yield_12m, dividends_12m, dividends_24m, dividends_36m, dividends_all_time, size_category, liquidity_category, source_meta) VALUES (1, '2025-08-14', 5.09, 14642505, 2